(3, 1, 'Third article title', '/uploads/article/article-3.jpg', 'At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt molliti', '<p>At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae. Itaque earum rerum hic tenetur a sapiente delectus, ut aut reiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat.</p>', 'third-article-title', 1453456967, 0, 1);
INSERT INTO `easyii_carousel` (`carousel_id`, `image`, `link`, `title`, `text`, `order_num`, `status`) VALUES
(2, '/uploads/carousel/1-d7d9cf1138-651c5bfc61.jpg', 'montage', 'Монтаж фасадов', 'Позитив-Строй является лидером строительного рынка Челябинска в области навесных фасадов. Наш Заказчик — это комбинация сложности объекта, большого объёма работ и сжатых сроков строительства. Наша политика по отношению к Заказчику отличается строгим соблюдением сроков и качества работ, а самая мощная в регионе материально-техническая база позволяет учитывать интересы Заказчика любой сложности и объёма. Со многими из них мы работаем неоднократно, что говорит о том, что за время нашей деятельности мы заслужили хорошую репутацию и большое портфолио объектов.', 5, 1),
(3, '/uploads/carousel/2-bbf6ef5949-5b380d8e8f.jpg', 'complectation', 'Комплектация', 'Количество и разнообразие смонтированных нами фасадов укрепило отношения с ключевыми поставщиками фасадных материалов, что позволяет нам компетентно предлагать максимально широкий ассортимент любых фасадных материалов по оптимальным ценам. Один из инновационных подходов нашей компании — это подбор индивидуальных навесных вентилируемых систем под каждый тип здания и вид облицовки, что позволяет сокращать металлоёмкость конструкций, сроки работ и конечную стоимость фасада для наших Заказчиков.', 3, 1),
(4, '/uploads/carousel/1-d7d9cf11381-e6f1e9158e-e0584ea5ed.jpg', 'architector', 'Архитектура & проектирование', 'Мы создаём не просто уникальный и качественный вентилируемый фасад, но и красивейшие и функциональные архитектурные формы, совместно реализующие любые желания Заказчика, выводим способы взаимодействия с Заказчиком на новый уровень. Наш продукт — безупречный фасад, обеспечивающий зданиям и сооружениям не только долговечность и отменные эксплуатационные характеристики, но и безукоризненную эстетику. Мы уверенно идём вперёд в своём стремлении менять к лучшему наш город и добавлять привлекательности его архитектурному ландшафту. Воплощая в жизнь самые смелые идеи обустройства фасадов зданий, мы создаём новую, функциональную, качественную и современную среду обитания.', 4, 1);
