(4, 2, 'Административное здание  Челябинск, Россия', '<p>«Административное здание с подземной автостоянкой на 72 машиноместа в мкрн. №13 Курчатовского района г. Челябинска», расположенный по адресу: квартал улиц 40 лет Победы, Аношкина, 10стрв 13 микрорайоне Курчатовского района, г. Челябинскпредставляет собой 8 этажное нежилое здание общественного назначения. Согласно заданию, отделка фасадов производится: алюминиево-пластиковой композитной панелью, керамогранитом Керама MarazziКаракорум SG501900R 1192x595x11мм, фасадной рейкой, отделка откосов производится материалом примыкающего к ним фасада, отделка сливов оконных проемов производится алюминиево-пластиковой композитной панелью.</p>', NULL, NULL, NULL, '{"buildname":"\\u0410\\u0434\\u043c\\u0438\\u043d\\u0438\\u0441\\u0442\\u0440\\u0430\\u0442\\u0438\\u0432\\u043d\\u043e\\u0435 \\u0437\\u0434\\u0430\\u043d\\u0438\\u0435 \\u0441 \\u043f\\u043e\\u0434\\u0437\\u0435\\u043c\\u043d\\u043e\\u0439 \\u0430\\u0432\\u0442\\u043e\\u0441\\u0442\\u043e\\u044f\\u043d\\u043a\\u043e\\u0439 \\u043d\\u0430 72 \\u043c\\u0430\\u0448\\u0438\\u043d\\u043e\\u043c\\u0435\\u0441\\u0442\\u0430 \\u0432 \\u043c\\u043a\\u0440\\u043d. \\u211613 \\u041a\\u0443\\u0440\\u0447\\u0430\\u0442\\u043e\\u0432\\u0441\\u043a\\u043e\\u0433\\u043e \\u0440\\u0430\\u0439\\u043e\\u043d\\u0430 \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a\\u0430","buildyear":"1-\\u0439 \\u043a\\u0432\\u0430\\u0440\\u0442\\u0430\\u043b 2016\\u0433","buildaddr":"\\u0423\\u043b. \\u0410\\u043d\\u043e\\u0448\\u043a\\u0438\\u043d\\u0430, 10\\u0441\\u0442\\u0440  \\u0432 13 \\u043c\\u0438\\u043a\\u0440\\u043e\\u0440\\u0430\\u0439\\u043e\\u043d\\u0435 \\u041a\\u0443\\u0440\\u0447\\u0430\\u0442\\u043e\\u0432\\u0441\\u043a\\u043e\\u0433\\u043e \\u0440\\u0430\\u0439\\u043e\\u043d\\u0430, \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a\\u0430"}', '/uploads/catalog/1-6d8be59e3b.jpg', 'administrativnoe-zdanie-celabinsk-rossia', 145363347