INSERT INTO `easyii_catalog_mixapp_items` (`item_id`, `category_id`, `title`, `description`, `available`, `price`, `discount`, `data`, `image`, `slug`, `time`, `status`, `files`, `build_status`, `coords`) VALUES
(4, 2, 'Административное здание', '<p>\r\n	Современное 8-ми этажное офисное здание расположено в живописном месте в ЖК «Александровский» рядом с лесным массивом. При его отделке использовались самые актуальные материалы: алюминиевые композитные панели и крупноформатный керамогранит на скрытом креплении анкером KEIL (единственный объект в городе).\r\n</p>\r\n<p>\r\n	<strong color="#1e1ea8">Площадь облицовки:</strong>&nbsp;\r\n</p>\r\n<p>\r\n	4 500 м2\r\n</p>', NULL, NULL, NULL, '{"buildname":"\\u0410\\u0434\\u043c\\u0438\\u043d\\u0438\\u0441\\u0442\\u0440\\u0430\\u0442\\u0438\\u0432\\u043d\\u043e\\u0435 \\u0437\\u0434\\u0430\\u043d\\u0438\\u0435 \\u0441 \\u043f\\u043e\\u0434\\u0437\\u0435\\u043c\\u043d\\u043e\\u0439 \\u0430\\u0432\\u0442\\u043e\\u0441\\u0442\\u043e\\u044f\\u043d\\u043a\\u043e\\u0439 \\u043d\\u0430 72 \\u043c\\u0430\\u0448\\u0438\\u043d\\u043e\\u043c\\u0435\\u0441\\u0442\\u0430 \\u0432 \\u043c\\u043a\\u0440\\u043d. \\u211613 \\u041a\\u0443\\u0440\\u0447\\u0430\\u0442\\u043e\\u0432\\u0441\\u043a\\u043e\\u0433\\u043e \\u0440\\u0430\\u0439\\u043e\\u043d\\u0430 \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a\\u0430","buildyear":"2016","buildmonth":"8","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0410\\u043d\\u043e\\u0448\\u043a\\u0438\\u043d\\u0430, \\u0434. 10 \\u0441\\u0442\\u0440  \\u0432 13 \\u043c\\u0438\\u043a\\u0440\\u043e\\u0440\\u0430\\u0439\\u043e\\u043d\\u0435 \\u041a\\u0443\\u0440\\u0447\\u0430\\u0442\\u043e\\u0432\\u0441\\u043a\\u043e\\u0433\\u043e \\u0440\\u0430\\u0439\\u043e\\u043d\\u0430 (\\u0416\\u041a \\u00ab\\u0410\\u043b\\u0435\\u043a\\u0441\\u0430\\u043d\\u0434\\u0440\\u043e\\u0432\\u0441\\u043a\\u0438\\u0439\\u00bb)"}', '/uploads/catalog/legion-1-3e13753839.jpg', NULL, 1464699574, 1, '[]', 0, ''),
(23, 3, '20-ти этажное жилое здание', '<p>20-ти этажное жилое здание с помещениями общественного назначения. Отделка фасадов произведена фиброцементными панелями «LATONIT»,&nbsp;керамическим гранитом, а также&nbsp;натуральным камнем (цоколь)&nbsp;и алюминиевыми композитными кассетами (ограждения балконов).&nbsp;Отделка откосов и сливов оконных (дверных) проемов произведена оцинкованной сталью с полимерным покрытием. Применена фасадная подсистема из коррозионностойкой стали производства "Ронсон".</p><p><strong>Площадь облицовки:</strong></p><p>7 000 м2</p>', 1, 0, 0, '{"buildname":"\\u0416\\u0438\\u043b\\u043e\\u0439 \\u043a\\u043e\\u043c\\u043f\\u043b\\u0435\\u043a\\u0441 \\u0441 \\u043f\\u043e\\u043c\\u0435\\u0449\\u0435\\u043d\\u0438\\u044f\\u043c\\u0438 \\u043e\\u0431\\u0449\\u0435\\u0441\\u0442\\u0432\\u0435\\u043d\\u043d\\u043e\\u0433\\u043e \\u043d\\u0430\\u0437\\u043d\\u0430\\u0447\\u0435\\u043d\\u0438\\u044f \\u043d\\u0430 \\u043f\\u0435\\u0440\\u0435\\u0441\\u0435\\u0447\\u0435\\u043d\\u0438\\u0438 \\u0443\\u043b\\u0438\\u0446 \\u041a\\u0430\\u043b\\u0438\\u043d\\u0438\\u043d\\u0430 \\u0438 \\u0421\\u0432\\u0435\\u0440\\u0434\\u043b\\u043e\\u0432\\u0441\\u043a\\u043e\\u0433\\u043e \\u043f\\u0440\\u043e\\u0441\\u043f\\u0435\\u043a\\u0442\\u0430 \\u0432 \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a\\u0435","buildyear":"2013","buildmonth":"6","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0421\\u0432\\u0435\\u0440\\u0434\\u043b\\u043e\\u0432\\u0441\\u043a\\u0438\\u0439 \\u043f\\u0440., 35"}', '/uploads/catalog/dsc4445-51e4e0fb1f.jpg', '20-ti-etaznoe-ziloe-zdanie', 1455058315, 1, NULL, 0, ''),
(5, 3, '16-ти этажное жилое здание', '<p>16-ти этажное высотное жилое здание. Реализовано сочетание отделки фасадов фиброцементными панелями «LATONIT» на лицевой части и штукатурным фасадом на дворовой части с сохранением общего цветового решения. Стилобатная часть здания отделана натуральным гранитом Caesar.</p><p><strong style="background-color: initial;">Площадь облицовки:</strong>&nbsp;</p><p>3 850 м2</p>', 1, 0, 0, '{"buildname":"16-\\u0442\\u0438 \\u044d\\u0442\\u0430\\u0436\\u043d\\u044b\\u0439 \\u0436\\u0438\\u043b\\u043e\\u0439 \\u0434\\u043e\\u043c \\u043f\\u043e \\u0443\\u043b. \\u0421\\u043c\\u0438\\u0440\\u043d\\u044b\\u0445 \\u0432 \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a","buildyear":"2015","buildmonth":"4","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0421\\u043c\\u0438\\u0440\\u043d\\u044b\\u0445, \\u0434. 7 \\u0432 \\u0426\\u0435\\u043d\\u0442\\u0440\\u0430\\u043b\\u044c\\u043d\\u043e\\u043c \\u0440\\u0430\\u0439\\u043e\\u043d\\u0435 (\\u0416\\u041a \\u00ab\\u0422\\u0438\\u0445\\u0438\\u0439 \\u0426\\u0435\\u043d\\u0442\\u0440\\u00bb)"}', '/uploads/catalog/fajl-110415-20-51-23-2756e901a1.jpeg', '16-ti-etaznoe-ziloe-zdanie-2', 1463121960, 1, '[]', 0, ''),
(6, 3, '16-ти этажный жилой дом', '<p>«16-ти&nbsp;этажный жилой дом по ул. Сони Кривой, 24» представляет собой 16-ти этажное высотное жилое здание. Согласно заданию, отделка фасадов производится: фиброцементными панелями «Latonit», клинкерными керамическими плитами «ArGeLite», металлическими кассетами, фасадной рейкой, профилированным листом, а также плоским стальным оцинкованным листом, отделка откосов и сливов оконных (дверных) проемов производится оцинкованной сталью с полимерным покрытием.</p><p><strong>Площадь облицовки:</strong></p><p>5&nbsp;750 м2</p>', 1, 0, 0, '{"buildname":"16-\\u044d\\u0442\\u0430\\u0436\\u043d\\u044b\\u0439 \\u0436\\u0438\\u043b\\u043e\\u0439 \\u0434\\u043e\\u043c \\u043f\\u043e \\u0443\\u043b. \\u0421\\u043e\\u043d\\u0438 \\u041a\\u0440\\u0438\\u0432\\u043e\\u0439, 24 \\u0432 \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a","buildyear":"2013","buildmonth":"12","buildaddr":"\\u0443\\u043b. \\u0421\\u043e\\u043d\\u0438 \\u041a\\u0440\\u0438\\u0432\\u043e\\u0439, \\u0434. 24 \\u0432 \\u0426\\u0435\\u043d\\u0442\\u0440\\u0430\\u043b\\u044c\\u043d\\u043e\\u043c \\u0440\\u0430\\u0439\\u043e\\u043d\\u0435 \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a\\u0430"}', '/uploads/catalog/foto-fasada-99a0897716.jpg', '16-ti-etaznyj-ziloj-dom', 1453663403, 1, '[]', 0, ''),
(8, 3, '8-ми этажное жилое здание', '<p>8-ми этажное жилое здание, расположенное с видом на городской Цирк. Отделка фасадов произведена фиброцементными панелями «LATONIT» с сохранением цветовой гаммы уже построенной части микрорайона.</p><p><strong>Площадь облицовки:&nbsp;</strong></p><p>1 726 м2.</p>', 1, 0, 0, '{"buildname":"\\u0416\\u0438\\u043b\\u043e\\u0439 \\u0434\\u043e\\u043c \\u2116 16 (\\u0441\\u0442\\u0440) \\u043c\\u043a\\u0440 4 \\u041a\\u0430\\u043b\\u0438\\u043d\\u0438\\u043d\\u0441\\u043a\\u0438\\u0439 \\u0440\\u0430\\u0439\\u043e\\u043d \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a\\r\\n","buildyear":"2012","buildmonth":"9","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0411\\u0440. \\u041a\\u0430\\u0448\\u0438\\u0440\\u0438\\u043d\\u044b\\u0445, \\u0434. 10. (\\u0416\\u041a \\u00ab\\u041a\\u0438\\u0440\\u043e\\u0432\\u0441\\u043a\\u0438\\u0439\\u00bb)\\r\\n"}', '/uploads/catalog/1-822d249290.jpg', '8-mi-etaznoe-ziloe-zdanie', 1453661636, 1, NULL, 0, ''),
(9, 3, '22-х этажный жилой комплекс', '<p>22-х этажный жилой комплекс, расположенный вдоль реки Миасс рядом с городским бором и зоопарком. Отделка фасадов произведена фиброцементными панелями «LATONIT» стального цвета. Применена фасадная подсистема из коррозионностойкой стали с креплением в межэтажные перекрытия. На уровне детской площадки применен новый облицовочный материал, композитная террасная доска с текстурой под дерево (декинг), а также алюминиевые композитные кассеты и натуральный гранит.</p><p><strong>Площадь облицовки:</strong>&nbsp;</p><p>12 200 м2.</p>', 1, 0, 0, '{"buildname":"\\u041c\\u0438\\u043a\\u0440\\u043e\\u0440\\u0430\\u0439\\u043e\\u043d \\u041c\\u0430\\u043d\\u0445\\u044d\\u0442\\u0442\\u0435\\u043d, \\u0416\\u0438\\u043b\\u043e\\u0439 \\u0434\\u043e\\u043c \\u2116 9 \\u0441 \\u0430\\u0432\\u0442\\u043e\\u043f\\u0430\\u0440\\u043a\\u043e\\u0432\\u043a\\u043e\\u0439 \\u0438 \\u0434\\u0435\\u0442\\u0441\\u043a\\u043e\\u0439 \\u043f\\u043b\\u043e\\u0449\\u0430\\u0434\\u043a\\u043e\\u0439, \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0426\\u0435\\u043d\\u0442\\u0440\\u0430\\u043b\\u044c\\u043d\\u044b\\u0439 \\u0440\\u0430\\u0439\\u043e\\u043d, \\u0443\\u043b. \\u0422\\u0440\\u0443\\u0434\\u0430.","buildyear":"2013","buildmonth":"9","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0413\\u0435\\u0440\\u043e\\u044f \\u0420\\u043e\\u0441\\u0441\\u0438\\u0438 \\u0410\\u043b\\u0435\\u043a\\u0441\\u0430\\u043d\\u0434\\u0440\\u0430 \\u042f\\u043a\\u043e\\u0432\\u043b\\u0435\\u0432\\u0430, \\u0434. 3 (\\u0416\\u041a \\u00ab\\u041c\\u0430\\u043d\\u0445\\u044d\\u0442\\u0442\\u0435\\u043d\\u00bb, \\u043f\\u0435\\u0440\\u0432\\u0430\\u044f \\u043e\\u0447\\u0435\\u0440\\u0435\\u0434\\u044c \\u0441\\u0442\\u0440\\u043e\\u0438\\u0442\\u0435\\u043b\\u044c\\u0441\\u0442\\u0432\\u0430)"}', '/uploads/catalog/3-d2f67858c1.jpg', '22-h-etaznyj-ziloj-kompleks', 1455057310, 1, NULL, 0, ''),
(10, 3, '22-х этажное жилое здание', '<p>22-х этажное элитное жилое здание, расположенное в центре города рядом с городским бором и Южно-Уральским Государственным Университетом. В его отделке классический облицовочный кирпич дружелюбно сочетается с хайтековскими вставками из серебристых металлокассет, реализованы проверенные решения из керамогранита и вандалоустойчивого натурального гранита.</p><p><strong>Площадь облицовки:&nbsp;</strong></p><p>8 900 м2.</p>', 1, 0, 0, '{"buildname":"\\u0416\\u0438\\u043b\\u043e\\u0439 \\u043a\\u043e\\u043c\\u043f\\u043b\\u0435\\u043a\\u0441 \\u0441 \\u043f\\u043e\\u043c\\u0435\\u0449\\u0435\\u043d\\u0438\\u044f\\u043c\\u0438 \\u043e\\u0431\\u0449\\u0435\\u0441\\u0442\\u0432\\u0435\\u043d\\u043d\\u043e\\u0433\\u043e \\u043d\\u0430\\u0437\\u043d\\u0430\\u0447\\u0435\\u043d\\u0438\\u044f \\u0438 \\u043f\\u043e\\u0434\\u0437\\u0435\\u043c\\u043d\\u043e\\u0439 \\u043f\\u0430\\u0440\\u043a\\u043e\\u0432\\u043a\\u043e\\u0439 \\u043d\\u0430 \\u043f\\u0435\\u0440\\u0435\\u0441\\u0435\\u0447\\u0435\\u043d\\u0438\\u0438 \\u0443\\u043b. \\u0421\\u043e\\u043d\\u0438 \\u041a\\u0440\\u0438\\u0432\\u043e\\u0439 \\u2013 \\u041b\\u0435\\u0441\\u043e\\u043f\\u0430\\u0440\\u043a\\u043e\\u0432\\u0430\\u044f \\u0432 \\u0426\\u0435\\u043d\\u0442\\u0440\\u0430\\u043b\\u044c\\u043d\\u043e\\u043c \\u0440\\u0430\\u0439\\u043e\\u043d\\u0435, \\u0440\\u0430\\u0441\\u043f\\u043e\\u043b\\u043e\\u0436\\u0435\\u043d\\u043d\\u044b\\u0439 \\u043f\\u043e \\u0430\\u0434\\u0440\\u0435\\u0441\\u0443: \\u0443\\u043b. \\u0422\\u0435\\u0440\\u043d\\u043e\\u043f\\u043e\\u043b\\u044c\\u0441\\u043a\\u0430\\u044f, 6 (\\u0441\\u0442\\u0440.)","buildyear":"2013","buildmonth":"9","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u041b\\u0435\\u0441\\u043e\\u043f\\u0430\\u0440\\u043a\\u043e\\u0432\\u0430\\u044f, \\u0434. 5"}', '/uploads/catalog/dsc02641-018fe892ad.jpg', '22-h-etaznoe-ziloe-zdanie', 1455058001, 1, NULL, 0, ''),
(22, 2, 'Федеральный центр травматологии', '<p>\r\n	Комплекс, состоящий из нескольких блоков разной этажности (от 2 до 4 этажей). Отделка фасадов произведена металлическими кассетами и стальным листом «дизайн-профиль». Работы были&nbsp;произведены в рекордные сроки - за 110 календарных дней, крепление кронштейнов системы выполнено в несущие металлические балки и колонны модулей Cadolto.\r\n</p>\r\n<p>\r\n	<strong color="#1e1ea8">Площадь облицовки:</strong>\r\n</p>\r\n<p>\r\n	15 000 м2\r\n</p>', 1, 0, 0, '{"buildname":"\\u0424\\u0435\\u0434\\u0435\\u0440\\u0430\\u043b\\u044c\\u043d\\u044b\\u0439 \\u0446\\u0435\\u043d\\u0442\\u0440 \\u0442\\u0440\\u0430\\u0432\\u043c\\u0430\\u0442\\u043e\\u043b\\u043e\\u0433\\u0438\\u0438, \\u043e\\u0440\\u0442\\u043e\\u043f\\u0435\\u0434\\u0438\\u0438 \\u0438 \\u044d\\u043d\\u0434\\u043e\\u043f\\u0440\\u043e\\u0442\\u0435\\u0437\\u0438\\u0440\\u043e\\u0432\\u0430\\u043d\\u0438\\u044f, \\u0433. \\u0411\\u0430\\u0440\\u043d\\u0430\\u0443\\u043b, \\u0443\\u043b. \\u041b\\u044f\\u043f\\u0438\\u0434\\u0435\\u0432\\u0441\\u043a\\u043e\\u0433\\u043e","buildyear":"2012","buildmonth":"8","buildaddr":"\\u0433. \\u0411\\u0430\\u0440\\u043d\\u0430\\u0443\\u043b, \\u0443\\u043b. \\u041b\\u044f\\u043f\\u0438\\u0434\\u0435\\u0432\\u0441\\u043a\\u043e\\u0433\\u043e"}', '/uploads/catalog/na-otpravku-marine-829fee9171.jpg', NULL, 1453633477, 1, NULL, 0, ''),
(11, 2, 'Краевая клиническая больница', '<p>\r\n	Комплекс, состоящий из нескольких блоков разной этажности (от 2 до 9 этажей). Отделка фасадов произведена фиброцементными панелями «LATONIT», керамогранитными панелями, металлическими кассетами (покрытие PVDF Ruukki, Финляндия), стальным листом «дизайн-профиль». Эскизный проект здания был разработан «Позитив-Строй» и прошел личное согласование у губернатора Алтайского края.\r\n</p>\r\n<p>\r\n	<strong color="#1e1ea8">Площадь облицовки:&nbsp;</strong>\r\n</p>\r\n<p>\r\n	40 500 м2.\r\n</p>', 1, 0, 0, '{"buildname":"\\u041a\\u0413\\u0411\\u0423\\u0417 \\u00ab\\u041a\\u0440\\u0430\\u0435\\u0432\\u0430\\u044f \\u043a\\u043b\\u0438\\u043d\\u0438\\u0447\\u0435\\u0441\\u043a\\u0430\\u044f \\u0431\\u043e\\u043b\\u044c\\u043d\\u0438\\u0446\\u0430\\u00bb \\u0433. \\u0411\\u0430\\u0440\\u043d\\u0430\\u0443\\u043b, \\u0443\\u043b. \\u041b\\u044f\\u043f\\u0438\\u0434\\u0435\\u0432\\u0441\\u043a\\u043e\\u0433\\u043e.","buildyear":"2013","buildmonth":"6","buildaddr":"\\u0433. \\u0411\\u0430\\u0440\\u043d\\u0430\\u0443\\u043b, \\u0443\\u043b. \\u041b\\u044f\\u043f\\u0438\\u0434\\u0435\\u0432\\u0441\\u043a\\u043e\\u0433\\u043e, \\u0434. 1"}', '/uploads/catalog/v-portfolio-b9a789730c.jpeg', NULL, 1455058670, 1, NULL, 0, ''),
(12, 2, 'Медицинский центр', '<p>\r\n	2-х этажное здание клиники «Оптик-Центр». Отделка фасадов произведена панелями керамического гранита, металлическими кассетами, фасадной рейкой, а также плоским стальным оцинкованным листом, отделка откосов и сливов оконных (дверных) проемов произведена оцинкованной сталью с полимерным покрытием.\r\n</p>\r\n<p>\r\n	<strong color="#1e1ea8">Площадь облицовки:</strong>&nbsp;\r\n</p>\r\n<p>\r\n	4 200 м2.\r\n</p>', 1, 0, 0, '{"buildname":"\\u041c\\u0435\\u0434\\u0438\\u0446\\u0438\\u043d\\u0441\\u043a\\u0438\\u0439 \\u0446\\u0435\\u043d\\u0442\\u0440 \\u043f\\u043e \\u0443\\u043b. 40-\\u043b\\u0435\\u0442\\u0438\\u044f \\u041e\\u043a\\u0442\\u044f\\u0431\\u0440\\u044f, 15","buildyear":"2013","buildmonth":"7","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. 40-\\u043b\\u0435\\u0442\\u0438\\u044f \\u041e\\u043a\\u0442\\u044f\\u0431\\u0440\\u044f, \\u0434. 15"}', '/uploads/catalog/optikcentr-2-1d32bfbe66.jpg', NULL, 1455059054, 1, NULL, 0, ''),
(13, 2, 'Птицефабрика', '<p>\r\n	3-х этажное здание. Отделка фасадов произведена панелями керамического гранита, отделка откосов и сливов оконных (дверных) проемов произведена оцинкованной сталью с полимерным покрытием.\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;" color="#1e1ea8">Площадь облицовки:</strong>&nbsp;\r\n</p>\r\n<p>\r\n	2 400 м2.\r\n</p>', 1, 0, 0, '{"buildname":"\\u041f\\u0442\\u0438\\u0446\\u0435\\u0444\\u0430\\u0431\\u0440\\u0438\\u043a\\u0430 \\u043f\\u043e \\u0432\\u044b\\u0440\\u0430\\u0449\\u0438\\u0432\\u0430\\u043d\\u0438\\u044e \\u0446\\u044b\\u043f\\u043b\\u044f\\u0442-\\u0431\\u0440\\u043e\\u0439\\u043b\\u0435\\u0440\\u043e\\u0432 \\u0441 \\u0438\\u043d\\u0436\\u0435\\u043d\\u0435\\u0440\\u043d\\u043e\\u0439 \\u0438\\u043d\\u0444\\u0440\\u0430\\u0441\\u0442\\u0440\\u0443\\u043a\\u0442\\u0443\\u0440\\u043e\\u0439 \\u0434\\u043b\\u044f \\u0435\\u0435 \\u043e\\u0431\\u0441\\u043b\\u0443\\u0436\\u0438\\u0432\\u0430\\u043d\\u0438\\u044f. \\u0426\\u0435\\u0445 \\u0443\\u0431\\u043e\\u044f, \\u043f\\u0435\\u0440\\u0435\\u0440\\u0430\\u0431\\u043e\\u0442\\u043a\\u0438 \\u0438 \\u0443\\u0442\\u0438\\u043b\\u0438\\u0437\\u0430\\u0446\\u0438\\u0438 \\u0441 \\u0441\\u0430\\u043d\\u043f\\u0440\\u043e\\u043f\\u0443\\u0441\\u043a\\u043d\\u0438\\u043a\\u043e\\u043c","buildyear":"2013","buildmonth":"12","buildaddr":"\\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a\\u0430\\u044f \\u043e\\u0431\\u043b., \\u043f. \\u041a\\u0443\\u043d\\u0430\\u0448\\u0430\\u043a"}', '/uploads/catalog/800-24401bb651.jpg', NULL, 1455058862, 1, NULL, 0, ''),
(14, 3, '9-ти этажное жилое здание', '<p>9-ти этажное жилое здание. Отделка фасадов произведена фиброцементными панелями «LATONIT», панелями керамического гранита, а также плоским стальным оцинкованным листом, отделка откосов и сливов оконных (дверных) проемов произведена оцинкованной сталью с полимерным покрытием.</p><p><strong>Площадь облицовки:&nbsp;</strong></p><p>2 940 м2.</p>', 1, 0, 0, '{"buildname":"\\u0416\\u0438\\u043b\\u043e\\u0439 \\u0434\\u043e\\u043c \\u2116 2 \\u0432 \\u043c\\u0438\\u043a\\u0440\\u043e\\u0440\\u0430\\u0439\\u043e\\u043d\\u0435 \\u2116 34 \\u0426\\u0435\\u043d\\u0442\\u0440\\u0430\\u043b\\u044c\\u043d\\u043e\\u0433\\u043e \\u0440\\u0430\\u0439\\u043e\\u043d\\u0430 \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a\\u0430","buildyear":"2014","buildmonth":"2","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0410\\u043a\\u0430\\u0434\\u0435\\u043c\\u0438\\u043a\\u0430 \\u041a\\u043e\\u0440\\u043e\\u043b\\u0435\\u0432\\u0430, \\u0434. 27 (\\u043c\\u043a\\u0440 \\u00ab\\u0422\\u043e\\u043f\\u043e\\u043b\\u0438\\u043d\\u0430\\u044f \\u0410\\u043b\\u043b\\u0435\\u044f\\u00bb)"}', '/uploads/catalog/akkoroleva-27-4-23cc1e81a7.jpg', '9-ti-etaznoe-ziloe-zdanie', 1455059258, 1, NULL, 0, ''),
(15, 2, 'Главное управление ЦБ РФ', '<p>\r\n	9-ти этажное здание расположено в историческом центре города, накладывающем свои требования к отделке стен. С помощью современных фасадных решений (алюминиевые композитные панели, металлоконструкции, натуральный гранит) воплощена классическая архитектура ХХ века, выполнены объемные элементы карнизов и пилястр.\r\n</p>\r\n<p>\r\n	<strong color="#1e1ea8">Площадь облицовки:</strong>&nbsp;\r\n</p>\r\n<p>\r\n	2 960 м2\r\n</p>', 1, 0, 0, '{"buildname":"\\u0420\\u0435\\u043c\\u043e\\u043d\\u0442 \\u0444\\u0430\\u0441\\u0430\\u0434\\u043e\\u0432 \\u0437\\u0434\\u0430\\u043d\\u0438\\u044f \\u0420\\u0435\\u0433\\u0438\\u043e\\u043d\\u0430\\u043b\\u044c\\u043d\\u043e\\u0433\\u043e \\u0446\\u0435\\u043d\\u0442\\u0440\\u0430 \\u0438\\u043d\\u0444\\u043e\\u0440\\u043c\\u0430\\u0442\\u0438\\u0437\\u0430\\u0446\\u0438\\u0438 \\u0413\\u043b\\u0430\\u0432\\u043d\\u043e\\u0433\\u043e \\u0443\\u043f\\u0440\\u0430\\u0432\\u043b\\u0435\\u043d\\u0438\\u044f \\u0426\\u0435\\u043d\\u0442\\u0440\\u0430\\u043b\\u044c\\u043d\\u043e\\u0433\\u043e \\u0431\\u0430\\u043d\\u043a\\u0430 \\u0420\\u043e\\u0441\\u0441\\u0438\\u0439\\u0441\\u043a\\u043e\\u0439 \\u0424\\u0435\\u0434\\u0435\\u0440\\u0430\\u0446\\u0438\\u0438, \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a","buildyear":"2015","buildmonth":"2","buildaddr":" \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0415\\u043b\\u044c\\u043a\\u0438\\u043d\\u0430, \\u0434. 47"}', '/uploads/catalog/800-af7ecbcbe6.jpg', NULL, 1455059482, 1, NULL, 0, ''),
(16, 3, '10-ти этажное жилое здание', '<p>10-ти этажное жилое здание. Отделка фасадов произведена фиброцементными панелями «LATONIT», натуральным гранитом «Жельтау», фасадной рейкой, алюминиевыми композитными панелями. Решена задача: сымитировать отделкой фасадов идентичность примыкающему панельному жилому домом, образовав единый комплекс.</p><p><strong>Площадь облицовки:&nbsp;</strong></p><p>2 376 м2</p>', 1, 0, 0, '{"buildname":"\\u0416\\u0438\\u043b\\u043e\\u0439 \\u0434\\u043e\\u043c \\u0441 \\u043f\\u043e\\u043c\\u0435\\u0449\\u0435\\u043d\\u0438\\u044f\\u043c\\u0438 \\u0430\\u0434\\u043c\\u0438\\u043d\\u0438\\u0441\\u0442\\u0440\\u0430\\u0442\\u0438\\u0432\\u043d\\u043e\\u0433\\u043e \\u043d\\u0430\\u0437\\u043d\\u0430\\u0447\\u0435\\u043d\\u0438\\u044f \\u0438 \\u043f\\u043e\\u0434\\u0437\\u0435\\u043c\\u043d\\u043e\\u0439 \\u0430\\u0432\\u0442\\u043e\\u0441\\u0442\\u043e\\u044f\\u043d\\u043a\\u043e\\u0439 \\u043f\\u043e \\u0443\\u043b. \\u042d\\u043d\\u0442\\u0443\\u0437\\u0438\\u0430\\u0441\\u0442\\u043e\\u0432 (2-\\u044f \\u043e\\u0447\\u0435\\u0440\\u0435\\u0434\\u044c \\u0441\\u0442\\u0440\\u043e\\u0438\\u0442\\u0435\\u043b\\u044c\\u0441\\u0442\\u0432\\u0430)","buildyear":"2015","buildmonth":"3","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u042d\\u043d\\u0442\\u0443\\u0437\\u0438\\u0430\\u0441\\u0442\\u043e\\u0432, \\u0434. 23"}', '/uploads/catalog/800-cafef2a890.jpg', '10-ti-etaznoe-ziloe-zdanie-2', 1463121653, 1, NULL, 0, ''),
(17, 3, '10-ти этажное жилое здание', '<p>10-ти этажное жилое здание. Отделка фасадов произведена фиброцементными панелями «LATONIT», с сохранением цветовой гаммы уже построенной части микрорайона. Выполнена облицовка сложных объемных металлоконструкций.</p><p><strong style="background-color: initial;">Площадь облицовки:</strong></p><p>2 613 м2</p>', 1, 0, 0, '{"buildname":"\\u0416\\u0438\\u043b\\u043e\\u0439 \\u0434\\u043e\\u043c \\u2116 18 (\\u0441\\u0442\\u0440) \\u0443\\u043b. \\u0411\\u0440\\u0430\\u0442\\u044c\\u0435\\u0432 \\u041a\\u0430\\u0448\\u0438\\u0440\\u0438\\u043d\\u044b\\u0445\\/\\u041a\\u0438\\u0440\\u043e\\u0432\\u0430","buildyear":"2014","buildmonth":"11","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0411\\u0440. \\u041a\\u0430\\u0448\\u0438\\u0440\\u0438\\u043d\\u044b\\u0445, \\u0434. 8 (\\u0416\\u041a \\u00ab\\u041a\\u0438\\u0440\\u043e\\u0432\\u0441\\u043a\\u0438\\u0439)"}', '/uploads/catalog/800-7b901446b3.jpg', '10-ti-etaznoe-ziloe-zdanie', 1455059676, 1, NULL, 0, ''),
(18, 3, '16-ти этажное жилое здание', '<p>16-ти этажное жилое здание. Отделка фасадов произведена фиброцементными панелями «LATONIT». Отделка откосов и сливов оконных (дверных) проемов произведена оцинкованной сталью с полимерным покрытием.&nbsp;Применена фасадная подсистема с креплением в межэтажные перекрытия.</p><p><strong style="background-color: initial;">Площадь облицовки:</strong>&nbsp;</p><p>5 802 м2</p>', 1, 0, 0, '{"buildname":"\\u0416\\u0438\\u043b\\u043e\\u0439 \\u0434\\u043e\\u043c \\u2116 19, \\u043c\\u043a\\u0440. \\u2116 34, \\u0426\\u0435\\u043d\\u0442\\u0440\\u0430\\u043b\\u044c\\u043d\\u043e\\u0433\\u043e \\u0440\\u0430\\u0439\\u043e\\u043d\\u0430 \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a\\u0430","buildyear":"2014","buildmonth":"11","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0410\\u043a. \\u041a\\u043e\\u0440\\u043e\\u043b\\u0435\\u0432\\u0430, \\u0434. 31 (\\u0416\\u041a \\u00ab\\u0422\\u043e\\u043f\\u043e\\u043b\\u0438\\u043d\\u0430\\u044f \\u0410\\u043b\\u043b\\u0435\\u044f\\u00bb)"}', '/uploads/catalog/800-6af918f17c.jpg', '16-ti-etaznoe-ziloe-zdanie', 1455059863, 1, NULL, 0, ''),
(19, 3, '16-ти этажные жилые здания', '<p>16-ти этажные жилые здания. Отделка фасадов произведена фиброцементными панелями «LATONIT» и керамическим гранитом. Отделка откосов и сливов оконных (дверных) проемов произведена оцинкованной сталью с полимерным покрытием. C помощью вставок из навесных вентилируемых фасадов панельные здания не уступают по своему внешнему виду монолитно-каркасным домам индивидуальных проектов.</p><p><strong style="background-color: initial;">Площадь облицовки:</strong>&nbsp;</p><p>4 331 м2</p>', 1, 0, 0, '{"buildname":"\\u0416\\u0438\\u043b\\u044b\\u0435 \\u0434\\u043e\\u043c\\u0430 \\u2116\\u2116 6, 9, 11 \\u0438 13, \\u043c\\u0438\\u043a\\u0440\\u043e\\u0440\\u0430\\u0439\\u043e\\u043d \\u2116 56 \\u0436\\u0438\\u043b\\u043e\\u0433\\u043e \\u0440\\u0430\\u0439\\u043e\\u043d\\u0430 \\u2116 12 \\u041a\\u0440\\u0430\\u0441\\u043d\\u043e\\u043f\\u043e\\u043b\\u044c\\u0441\\u043a\\u043e\\u0439 \\u043f\\u043b\\u043e\\u0449\\u0430\\u0434\\u043a\\u0438 \\u21161 \\u0432 \\u041a\\u0443\\u0440\\u0447\\u0430\\u0442\\u043e\\u0432\\u0441\\u043a\\u043e\\u043c \\u0440\\u0430\\u0439\\u043e\\u043d\\u0435 \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a\\u0430","buildyear":"2014","buildmonth":"9","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u041a\\u0440\\u0430\\u0441\\u043d\\u043e\\u043f\\u043e\\u043b\\u044c\\u0441\\u043a\\u0438\\u0439 \\u043f\\u0440., \\u0434. 7, 9, 11, 13. (\\u043c\\u043a\\u0440. \\u00ab\\u041f\\u0430\\u0440\\u043a\\u043e\\u0432\\u044b\\u0439\\u00bb)"}', '/uploads/catalog/800-e563cd2aef.jpg', '16-ti-etaznye-zilye-zdania', 1455060002, 1, NULL, 0, ''),
(20, 3, '20-ти этажные жилые здания', '<p>20-ти этажные жилые здания. Отделка фасадов произведена фиброцементными панелями «LATONIT» и керамическим гранитом. Отделка откосов и сливов оконных (дверных) проемов произведена оцинкованной сталью с полимерным покрытием. Эти объекты стали логическим продолжением новой концепции города с доступным жильем, но богато отделанными фасадами вдоль гостевого маршрута по Университетской набережной.</p><p><strong style="background-color: initial;">Площадь облицовки:&nbsp;</strong></p><p>8 400 м2</p>', 1, 0, 0, '{"buildname":"\\u0413\\u0440\\u0443\\u043f\\u043f\\u0430 \\u0436\\u0438\\u043b\\u044b\\u0445 \\u0434\\u043e\\u043c\\u043e\\u0432 \\u2116 60, 64, \\u043c\\u043a\\u0440\\u043d. AKADEM RIVERSIDE.","buildyear":"2015","buildmonth":"4","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0423\\u043d\\u0438\\u0432\\u0435\\u0440\\u0441\\u0438\\u0442\\u0435\\u0442\\u0441\\u043a\\u0430\\u044f \\u043d\\u0430\\u0431\\u0435\\u0440\\u0435\\u0436\\u043d\\u0430\\u044f, \\u0434. 60, 64"}', '/uploads/catalog/800-acb41ba757.jpg', '20-ti-etaznye-zilye-zdania', 1455060757, 1, NULL, 0, ''),
(24, 3, '3-х секционный жилой дом', '<p>8-ми этажное жилое здание реконструировано из бывшего цеха завода "Полет" и имеет переменную этажность. Отделка фасадов произведена керамическим гранитом, натуральным камнем (цоколь) и стальными металлокассетами (ограждения балконов). Отделка откосов и сливов оконных (дверных) проемов произведена оцинкованной сталью с полимерным покрытием.</p><p><strong>Площадь облицовки:</strong></p><p>7 600 м2</p>', 1, 0, 0, '{"buildname":"\\u0420\\u0435\\u043a\\u043e\\u043d\\u0441\\u0442\\u0440\\u0443\\u043a\\u0446\\u0438\\u044f \\u0441\\u0443\\u0449\\u0435\\u0441\\u0442\\u0432\\u0443\\u044e\\u0449\\u0435\\u0433\\u043e \\u0437\\u0434\\u0430\\u043d\\u0438\\u044f \\u043f\\u043e\\u0434 3-\\u0445 \\u0441\\u0435\\u043a\\u0446\\u0438\\u043e\\u043d\\u043d\\u044b\\u0439 \\u0436\\u0438\\u043b\\u043e\\u0439 \\u0434\\u043e\\u043c \\u0441 \\u043f\\u043e\\u043c\\u0435\\u0449\\u0435\\u043d\\u0438\\u044f\\u043c\\u0438 \\u043e\\u0431\\u0449\\u0435\\u0441\\u0442\\u0432\\u0435\\u043d\\u043d\\u043e\\u0433\\u043e \\u043d\\u0430\\u0437\\u043d\\u0430\\u0447\\u0435\\u043d\\u0438\\u044f","buildyear":"2015","buildmonth":"2","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u041b\\u0435\\u0441\\u043e\\u043f\\u0430\\u0440\\u043a\\u043e\\u0432\\u0430\\u044f, \\u0434. 7 \\u0410"}', '/uploads/catalog/ooo-44aa337379.jpg', '3', 1463122664, 1, NULL, 1, '55.28371749270315,37.52623363952637'),
(34, 2, 'Офисно-торговое здание', '<p>Здание расположено в деловой части ул. Российской, напротив офисного комплекса GreenPlex, но исполнено в более классической архитектуре, сочетая фигурные декоративные элементы из металла с функциональным керамогранитом крупного формата.</p><p>Применяемые материалы:</p><p>1. Керамогранит  размером 600*1200*10 мм. </p><p>2. Каcсеты из оцинкованной окрашенной стали.</p><p>3. Декоративные элементы (флаги, пояса) из оцинкованной окрашенной стали.</p><p>4. Фасадная рейка из оцинкованной окрашенной стали.</p><p><strong>Площадь облицовки:</strong></p><p>2075 м2</p>', 1, 0, 0, '{"buildname":"\\u0417\\u0434\\u0430\\u043d\\u0438\\u0435 \\u0441 \\u0442\\u043e\\u0440\\u0433\\u043e\\u0432\\u044b\\u043c\\u0438 \\u043f\\u043e\\u043c\\u0435\\u0449\\u0435\\u043d\\u0438\\u044f\\u043c\\u0438 \\u0438 \\u043f\\u043e\\u043c\\u0435\\u0449\\u0435\\u043d\\u0438\\u044f\\u043c\\u0438 \\u043f\\u043e \\u043e\\u0431\\u0441\\u043b\\u0443\\u0436\\u0438\\u0432\\u0430\\u043d\\u0438\\u044e \\u043a\\u043b\\u0438\\u0435\\u043d\\u0442\\u043e\\u0432 \\u043f\\u043e \\u0443\\u043b. \\u0420\\u043e\\u0441\\u0441\\u0438\\u0439\\u0441\\u043a\\u0430\\u044f, 63","buildyear":"2017","buildmonth":"3","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0420\\u043e\\u0441\\u0441\\u0438\\u0439\\u0441\\u043a\\u0430\\u044f, 63"}', '', 'ofisno-torgovoe-zdanie', 1485773479, 1, NULL, 0, '54.90446947079394;37.43885799865723'),
(25, 3, '9-ти этажный жилой дом', '<p>9-ти этажный жилой дом. Отделка фасадов произведена фиброцементными панелями «LATONIT». Отделка откосов и сливов оконных (дверных) проемов произведена оцинкованной сталью с полимерным покрытием.</p><p><strong>Площадь облицовки:</strong></p><p>3 783 м2</p>', 1, 0, 0, '{"buildname":"\\u0416\\u0438\\u043b\\u043e\\u0439 \\u0434\\u043e\\u043c \\u2116 3 \\u043c\\u043a\\u0440\\u043d. 34 \\u0426\\u0435\\u043d\\u0442\\u0440\\u0430\\u043b\\u044c\\u043d\\u043e\\u0433\\u043e \\u0440\\u0430\\u0439\\u043e\\u043d\\u0430 \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a\\u0430","buildyear":"2014","buildmonth":"12","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0411\\u0440. \\u041a\\u0430\\u0448\\u0438\\u0440\\u0438\\u043d\\u044b\\u0445, 160"}', '/uploads/catalog/akkoroleva-27-2-94d73a9098.jpg', '9-ti-etaznyj-ziloj-dom', 1455060120, 1, NULL, 0, ''),
(26, 2, 'Оздоровительный комплекс с бассейном', '<p>\r\n	3-х этажное здание административного назначения (бассейн с длиной дорожки 50м для проведения соревнований разного уровня). Отделка фасадов производится алюминиевыми композитными кассетами и керамогранитом. Отделка оконных и дверных откосов, и сливов выполнена из алюминиевых композитных кассет, а также стальных оцинкованных окрашенных панелей. Фасад здания имеет сложную геометрию за счёт перепадов плоскостей между различными видами облицовки, включая радиусные элементы фасада, выполняемые из вальцованных алюминиевых композитных кассет.</p><p>\r\n	<strong color="#1e1ea8">Площадь облицовки:</strong></p><p>\r\n	5 300 м2</p>', 1, 0, 0, '{"buildname":"\\u0411\\u0430\\u0441\\u0441\\u0435\\u0439\\u043d \\u0441 \\u043c\\u043d\\u043e\\u0433\\u043e\\u044d\\u0442\\u0430\\u0436\\u043d\\u043e\\u0439 \\u0441\\u0442\\u043e\\u044f\\u043d\\u043a\\u043e\\u0439 \\u043d\\u0430 \\u043f\\u0435\\u0440\\u0435\\u0441\\u0435\\u0447\\u0435\\u043d\\u0438\\u0438 \\u0443\\u043b. \\u041c\\u043e\\u043b\\u0434\\u0430\\u0432\\u0441\\u043a\\u043e\\u0439 \\u0438 \\u041a\\u043e\\u043c\\u0441\\u043e\\u043c\\u043e\\u043b\\u044c\\u0441\\u043a\\u043e\\u0433\\u043e \\u043f\\u0440\\u043e\\u0441\\u043f\\u0435\\u043a\\u0442\\u0430","buildyear":"2016","buildmonth":"12","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u041c\\u043e\\u043b\\u0434\\u0430\\u0432\\u0441\\u043a\\u0430\\u044f,  \\u0434. 10"}', '/uploads/catalog/moldavskaa-5b1f6e8ecc.jpg', NULL, 1464699462, 1, NULL, 0, ''),
(27, 2, '2-х этажное административное здание', '<p>\r\n	Нашей компанией выполнен следующий комплекс работ:&nbsp;эскизный и рабочий проект фасада здания, разработка концепции подсветки здания, а также монтажные работы по разработанным проектам. Учитывая размещения объекта в парковой зоне, концепция фасада была разработана с учетом имитации лесного массива (зеленый цвет фасада и белые трубы ассоциируются, соответственно, с кроной и стволами березок).</p><p>\r\n	<strong></strong></p><p>\r\n	<strong color="#1e1ea8">Объект с уникальными архитектурными решениями: </strong></p><ul>\r\n	\r\n<li>Применение современных материалов «премиум» сегмента: HPL-панели (Австрия), фиброцементные плиты ETERNIT (Бельгия).</li>	\r\n<li>Декоративные элементы в виде «Берез» выступающих перед фасадом здания.</li>	\r\n<li>Архитектурная подсветка здания, выгодно подчеркивающая элементы декора в вечернее время и создающая уют для возвращающихся с работы жителей комплекса.</li></ul><p>\r\n	<strong color="#1e1ea8">Площадь облицовки:</strong></p><p>\r\n	1902,8 м2</p>', 1, 0, 0, '{"buildname":"2-\\u0445 \\u044d\\u0442\\u0430\\u0436\\u043d\\u043e\\u0435 \\u0430\\u0434\\u043c\\u0438\\u043d\\u0438\\u0441\\u0442\\u0440\\u0430\\u0442\\u0438\\u0432\\u043d\\u043e\\u0435 \\u0437\\u0434\\u0430\\u043d\\u0438\\u0435, \\u0438\\u0441\\u043f\\u043e\\u043b\\u044c\\u0437\\u0443\\u0435\\u043c\\u043e\\u0435 \\u0432 \\u043a\\u0430\\u0447\\u0435\\u0441\\u0442\\u0432\\u0435 \\u0432\\u044a\\u0435\\u0437\\u0434\\u043d\\u043e\\u0439 \\u0433\\u0440\\u0443\\u043f\\u043f\\u044b \\u0432 \\u043f\\u043e\\u0434\\u0437\\u0435\\u043c\\u043d\\u0443\\u044e \\u043f\\u0430\\u0440\\u043a\\u043e\\u0432\\u043a\\u0443 \\u0441 \\u043e\\u0431\\u044a\\u0435\\u043c\\u043e\\u043c 400 \\u043f\\u0430\\u0440\\u043a\\u043e\\u0432\\u043e\\u0447\\u043d\\u044b\\u0445 \\u043c\\u0435\\u0441\\u0442 \\u0434\\u043b\\u044f \\u0436\\u0438\\u0442\\u0435\\u043b\\u0435\\u0439 \\u043c\\u0438\\u043a\\u0440\\u043e\\u0440\\u0430\\u0439\\u043e\\u043d\\u0430 \\u0416\\u041a \\u00ab\\u041b\\u0435\\u0441\\u043e\\u043f\\u0430\\u0440\\u043a\\u043e\\u0432\\u044b\\u0439\\u00bb","buildyear":"2016","buildmonth":"8","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0422\\u0435\\u0440\\u043d\\u043e\\u043f\\u043e\\u043b\\u044c\\u0441\\u043a\\u0430\\u044f, \\u0434. 6 \\u0441\\u0442\\u0440"}', '/uploads/catalog/img0461-90d1a90a97.jpg', '2-h-etaznoe-administrativnoe-zdanie', 1464699728, 1, NULL, 0, ''),
(28, 2, 'Торговый центр', '<p>\r\n	На объекте силами нашей компании производится монтаж сэндвич-панелей поэлементной сборки с утеплением в качестве ограждающих конструкций (стен). Облицовочные материалы разнообразны:</p><p>\r\n	HPL-панели (Австрия) с фактурой красного дерева, натуральный камень, алюминиевые композитные кассеты, металлические кассеты четырех цветов, фасадная рейка, дизайн-профиль, фиброцементные панели ETERNIT (Бельгия), а также декоративные ламели из клееного бруса.</p><p>\r\n	Здание отличается сложной геометрией, яркими и необычными цветами.</p><p>\r\n	<strong color="#1e1ea8">Площадь облицовки:</strong></p><p>\r\n	4793,80 м2</p>', 1, 0, 0, '{"buildname":"\\u0422\\u043e\\u0440\\u0433\\u043e\\u0432\\u044b\\u0439 \\u0446\\u0435\\u043d\\u0442\\u0440 \\u00ab\\u0415\\u043b\\u043a\\u0438\\u00bb \\u0432 \\u0416\\u041a \\u0410\\u043b\\u0435\\u043a\\u0441\\u0430\\u043d\\u0434\\u0440\\u043e\\u0432\\u0441\\u043a\\u0438\\u0439.","buildyear":"2017","buildmonth":"3","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u0411\\u0435\\u0439\\u0432\\u0435\\u043b\\u044f,  \\u0434. 6 \\u0441\\u0442\\u0440. (\\u043f\\u0435\\u0440\\u0435\\u0441\\u0435\\u0447\\u0435\\u043d\\u0438\\u0435 \\u0443\\u043b\\u0438\\u0446 40-\\u043b\\u0435\\u0442\\u0438\\u044f \\u041f\\u043e\\u0431\\u0435\\u0434\\u044b \\u2013 \\u0443\\u043b. \\u0411\\u0435\\u0439\\u0432\\u0435\\u043b\\u044f)"}', '/uploads/catalog/elki-3-49cfcf826f.jpg', NULL, 1462280940, 1, NULL, 0, ''),
(30, 2, 'Административное здание', '<p>\r\n	9-ти этажное офисное здание «премиум» класса. Отделка фасадов произведена алюминиевыми композитными кассетами, подобранными в тон уже построенным секциям, по цоколю натуральным камнем Caesar и керамогранитом. Отделка оконных и дверных откосов и сливов выполнена из алюминиевых композитных кассет. Разработано и выполнено архитектурное освещение, имитирующее искривление прямоугольного фасада («парус»).\r\n</p>\r\n<p>\r\n	<strong color="#1e1ea8">Площадь облицовки:</strong>\r\n</p>\r\n<p>\r\n	4 500 м2\r\n</p>', 1, 0, 0, '{"buildname":"\\u0411\\u0438\\u0437\\u043d\\u0435\\u0441-\\u0446\\u0435\\u043d\\u0442\\u0440 ARKAIM PLAZA (3-\\u044f \\u043e\\u0447\\u0435\\u0440\\u0435\\u0434\\u044c \\u0441\\u0442\\u0440\\u043e\\u0438\\u0442\\u0435\\u043b\\u044c\\u0441\\u0442\\u0432\\u0430) \\u043f\\u043e \\u0443\\u043b. \\u041a\\u0440\\u0430\\u0441\\u043d\\u043e\\u0430\\u0440\\u043c\\u0435\\u0439\\u0441\\u043a\\u0430\\u044f, 112, \\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a","buildyear":"2015","buildmonth":"12","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u041a\\u0440\\u0430\\u0441\\u043d\\u043e\\u0430\\u0440\\u043c\\u0435\\u0439\\u0441\\u043a\\u0430\\u044f, \\u0434. 112"}', '/uploads/catalog/arkaim-3-87948903f5.jpg', NULL, 1463119843, 1, NULL, 0, ''),
(31, 3, '16-ти и 22-х этажные жилые здания', '<p>\r\n	3-х секционный 16-ти этажный и односекционный 22-х этажный жилые дома заканчивают третью очередь строительства ЖК «Лесопарковый», создавая всё более уютную, элитную и закрытую атмосферу комплекса. На первом этаже 16-ти этажного жилого дома расположен детский сад, есть большая придомовая территория с подземной автопарковкой. Дома расположены в самом центре города и их доминирующая высотность позволяет охватить обзором весь город. Цветовая палитра продолжает преемственность со зданиями первой и второй очередей, но с добавлением уникальных вертикальных вставок из фиброцементных плита LATONIT. В основном фасад выполнен из керамогранитных панелей, металлокассет и натурального гранита, сочетая надежность и современность.</p><p>\r\n	<strong style="color: #1e1ea8;">Площадь облицовки:</strong></p><p>\r\n	21 000 м2</p>', 1, 0, 0, '{"buildname":"\\u0416\\u0438\\u043b\\u043e\\u0439 \\u043a\\u043e\\u043c\\u043f\\u043b\\u0435\\u043a\\u0441 (16-\\u0442\\u0438 \\u0438 22-\\u0445 \\u044d\\u0442\\u0430\\u0436\\u043d\\u044b\\u0435 \\u0436\\u0438\\u043b\\u044b\\u0435 \\u0434\\u043e\\u043c\\u0430) \\u0441 \\u043f\\u043e\\u043c\\u0435\\u0449\\u0435\\u043d\\u0438\\u044f\\u043c\\u0438 \\u043e\\u0431\\u0449\\u0435\\u0441\\u0442\\u0432\\u0435\\u043d\\u043d\\u043e\\u0433\\u043e \\u043d\\u0430\\u0437\\u043d\\u0430\\u0447\\u0435\\u043d\\u0438\\u044f \\u0438 \\u043f\\u043e\\u0434\\u0437\\u0435\\u043c\\u043d\\u043e\\u0439 \\u043f\\u0430\\u0440\\u043a\\u043e\\u0432\\u043a\\u043e\\u0439 \\u043d\\u0430 \\u043f\\u0435\\u0440\\u0435\\u0441\\u0435\\u0447\\u0435\\u043d\\u0438\\u0438 \\u0443\\u043b. \\u0421\\u043e\\u043d\\u0438 \\u041a\\u0440\\u0438\\u0432\\u043e\\u0439 \\u2013 \\u041b\\u0435\\u0441\\u043e\\u043f\\u0430\\u0440\\u043a\\u043e\\u0432\\u0430\\u044f \\u0432 \\u0426\\u0435\\u043d\\u0442\\u0440\\u0430\\u043b\\u044c\\u043d\\u043e\\u043c \\u0440\\u0430\\u0439\\u043e\\u043d\\u0435, \\u0440\\u0430\\u0441\\u043f\\u043e\\u043b\\u043e\\u0436\\u0435