(35, 2, 'Теплый переход', '<p>Переход между зданиями, установленный на металлических колоннах, с облицовкой стен алюминиевыми композитными кассетами и нижней плоскости фасада фиброцементными панелями «Латонит». На колоннах вальцованные кассеты из алюминиевых композитных панелей.</p><p><strong>Площадь облицовки:</strong></p><p>1250 м2</p>', 1, 0, 0, '{"buildname":"\\u0422\\u0435\\u043f\\u043b\\u044b\\u0439 \\u043f\\u0435\\u0440\\u0435\\u0445\\u043e\\u0434. \\u041c\\u0435\\u0436\\u0434\\u0443 \\u0434\\u0432\\u0443\\u043c\\u044f \\u043a\\u043e\\u0440\\u043f\\u0443\\u0441\\u0430\\u043c\\u0438 \\u043e\\u0437\\u0434\\u043e\\u0440\\u043e\\u0432\\u0438\\u0442\\u0435\\u043b\\u044c\\u043d\\u043e\\u0433\\u043e \\u043a\\u043e\\u043c\\u043f\\u043b\\u0435\\u043a\\u0441\\u0430 \\u0441 \\u0431\\u0430\\u0441\\u0441\\u0435\\u0439\\u043d\\u043e\\u043c","buildyear":"2017","buildmonth":"5","buildaddr":"\\u0433. \\u0427\\u0435\\u043b\\u044f\\u0431\\u0438\\u043d\\u0441\\u043a, \\u0443\\u043b. \\u041c\\u043e\\u043b\\u0434\\u0430\\u0432\\u0441\\u043a\\u0430\\u044f, \\u0434. 10"}', '/uploads/catalog/img2287-e3c846a512.jpg', NULL, 1485862090, 1, NULL, 0, '');
