INSERT INTO `easyii_pages_carousel` (`id`, `order`, `page_id`, `name`, `text`, `images`, `link`, `linkcaption`, `class`) VALUES
(25, 1, 0, 'О Компании', 'Позитив-Строй является лидером строительного рынка Челябинска в области навесных фасадов. Наш Заказчик — это комбинация сложности объекта, большого объёма работ и сжатых сроков строительства. ', '[]', '#', 'Подробнее', 'pageslider-slide1'),
(26, 6, 0, 'Награды', 'Государственные и иные награды, присуждавшиеся ранее и присуждающиеся в настоящее время в России. Наградная система России включает в себя национальную символику и давние традиции...', '[{"file":"stunning-images-of-the-space.jpg","caption":"","description":"","url":"","order":""},{"file":"Dubai-Photos-Images-Photos-of-Dubai-800x600.jpg","caption":"","description":"","url":"","order":""},{"file":"stunning-images-of-the-space.jpg","caption":"","description":"","url":"","order":""}]', '', '', 'pageslider-slide2'),
(27, 4, 0, 'Отзывы', '«Строили небольшую баньку из сруба год назад. За это время дерево не рассохлось, банька стоит, как будто новая! Подумываем построить еще баньку родителям на даче. Спасибо за качественную работу!»', '[]', '', '', 'pageslider-slide3'),
(28, 3, 0, 'Пресса', '<b>ПРЕССА</b>\r\nПро нас очень много пишут', '[]', '', '', 'pageslider-slide4'),
(29, 10, 0, 'Сертификаты', 'Мы каждый год обновляем наши сертификаты', '[]', '', '', 'pageslider-slide5'),
(30, 11, 0, 'Партнеры', 'Наши партнёры по строительству. Мы работаем совместно с хорошими компаниями и строим дома', '[]', '', '', 'pageslider-slide6'),
(31, 12, 0, 'Контакты', '\r\n<h3>Адрес</h3>\r\n454092, г. Челябинск, ул. Воровского, 5а\r\nПостроить маршрут на Google maps\r\n\r\n<h3>Контакты</h3>\r\nEmail: postroy174@mail.ru\r\nТел. +7(351) 267-29-17(18)\r\nФакс: +7(351) 267-29-22\r\n\r\n<iframe src="https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d244700.09820845848!2d61.33862349467611!3d55.26316095505027!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sru!4v1492145074980" frameborder="0" style="border:0" allowfullscreen></iframe>', '[]', '', '', 'pageslider-slide7');
