INSERT INTO `mails` (`id`, `name`, `subject`, `from`, `zone`, `content`, `order`) VALUES
(2, 'Регистрация пользователя', 'Спасибо за регистрацию', '', 'registration', '<p>Благодарим Вас за регистрацию на сайте <a href="dressyshop.ru" target="_blank" rel="noopener">Dressyshop.ru</a>! Мы надеемся, Вам понравится совершать покупки в нашем магазине.</p>\r\n<p>Используйте адрес Вашей электронной почты {email} в качестве логина для авторизации на сайте. Также рекомендуем Вам заполнить свои данные в личном кабинете сайта для удобства в оформлении первого&nbsp; и последующих заказов.</p>\r\n<p>&nbsp;</p>\r\n<p>Ваш Dressyshop</p>\r\n<p>+7(495)532-97-70</p>\r\n<p>www.dressyshop.ru</p>\r\n<p>&nbsp;</p>', 0),
(10, 'Восстановление пароля', 'Восстановление пароля', '', 'remember', '<p>Вы забыли Ваш пароль для входа? Не страшно, мы напомним!</p>\r\n<p>Ваш Логин: {email}</p>\r\n<p>Ваш Пароль: {password}</p>\r\n<p>Просто скопируйте его&nbsp; и вставьте в соответствующее поле на сайте. Напоминаем, что В Вашем личном кабинете Вы всегда можете изменить его на удобный для Вас.</p>\r\n<p>Приятных покупок!</p>\r\n<p>&nbsp;</p>\r\n<p>Ваш Dressyshop</p>\r\n<p>+7(495)532-97-70</p>\r\n<p>www.dressyshop.ru</p>', 0),
(11, 'Новый заказ', 'Ваш заказ {order_number} принят', '', 'new_order', '<p>Благодарим за Ваш заказ!</p>\r\n<p>Номер Вашего заказа: {order_number}</p>\r\n<p>Более полную информацию о Вашем заказе Вы можете уточнить в своём <a href="../../../../account">Личном кабинете</a></p>\r\n<p>Если Вы обнаружили какие-то неточности или хотите внести какие-то изменения в заказ, то необходимо связаться с нашими менеджерами следующими способами:</p>\r\n<ul>\r\n<li>по электронной почте, с которой поступило данное сообщение</li>\r\n<li>по телефону магазина +7(495)532-97-70</li>\r\n<li>отправив нам сообщение с уточнениями в <a href="../../../../page/gostevaya_kniga">Гостевую книгу</a></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Ваш Dressyshop</p>\r\n<p>+7(495)532-97-70</p>\r\n<p>www.dressyshop.ru</p>', 0),
(12, 'Созвон с клиентом', 'Dressyshop не может с Вами связаться', '', 'status_18', '<p>Статус Вашего заказа {order_number} изменен.</p>\r\n<p>Новый статус заказа: Созвон с клиентом.</p>\r\n<p>Причина: Dressyshop не может связаться с клиентом и уточнить детали заказа или договориться о доставке. Просьба связаться с магазином по электронной почте или телефону офиса +7(495)532-97-70.</p>\r\n<p>&nbsp;</p>\r\n<p>Ваш Dressyshop</p>\r\n<p>+7(495)532-97-70</p>\r\n<p>www.dressyshop.ru</p>', 0),
(13, 'На доставке', 'Заказ {order_number} передан на доставку', '', 'status_12', '<p>Статус Вашего заказа {order_number} изменен.</p>\r\n<p>Новый статус заказа: На доставке.</p>\r\n<p>Причина: Заказ передан на доставку в курьерскую службу. В ближайшее время с Вами свяжется менеджер для согласования даты и времени доставки Вашего заказа.</p>\r\n<p>&nbsp;</p>\r\n<p>Ваш Dressyshop</p>\r\n<p>+7(495)532-97-70</p>\r\n<p>www.dressyshop.ru</p>', 0),
(14, 'Отправлен', 'Ваш заказ {order_number} отправлен', '', 'status_15', '<p>Статус Вашего заказа {order_number} изменен.</p>\r\n<p>Новый статус заказа: Отправлен.</p>\r\n<p>Номер отправления: {order_track}.</p>\r\n<p>Причина: Ваш заказ, переданный ранее на почтовое отделение, успешно отправлен. По имеющемуся номер отправления (РПО) Вы можете отследить местонахождение Вашей посылки на сайте Почты России по ссылке&nbsp;<a href="https://www.pochta.ru/tracking" target="_blank" rel="noopener">https://www.pochta.ru/tracking</a></p>\r\n<p>Обращаем Ваше внимание, что Почта России не всегда отправляет извещения в момент поступления посылки в почтовое отделение. Мы советуем нашим Покупателям отслеживать почтовое отправление для избежания невыкупа посылок.</p>\r\n<p>&nbsp;</p>\r\n<p>Ваш Dressyshop</p>\r\n<p>+7(495)532-97-70</p>\r\n<p>www.dressyshop.ru</p>', 0),
(15, 'Готов к отправке', 'Заказ {order_number} готов к отправке', '', 'status_13', '<p>Статус Вашего заказа {order_number} изменен.</p>\r\n<p>Новый статус заказа: Готов к отправке.</p>\r\n<p>Причина: Заказ укоплектован и передан на почту для отправки. Уточнить номер отправления Вы сможете после изменения статуса заказа на Отправлен. Ожидайте дополнительного сообщения об этом статусе на Ваш адрес электронной почты.</p>\r\n<p>&nbsp;</p>\r\n<p>Обращаем Ваше внимание, что в связи с особенностями работы нашего магазина, заказ может быть укомплекован не полностью. Ознакомиться с составом укомплектованного заказа Вы можете в Вашем <a href="../../../../account">Личном кабинете</a>.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Ваш Dressyshop</p>\r\n<p>+7(495)532-97-70</p>\r\n<p>www.dressyshop.ru</p>', 0),
(16, 'Принят в обработку', 'Заказ {order_number} принят в обработку', '', 'status_11', '<p>Статус Вашего заказа {order_number} изменен.</p>\r\n<p>Новый статус заказа: Заказ принят в обработку.</p>\r\n<p>Причина: Магазин Dressyshop принял заказ в обработку. Сроки обработка зказов зависят от наличия той или иной модели на складе магазина или поставщика. Поставка товара на склад в Москве происходит раз в неделю. В связи с этим обработка заказов может занимать от одного дня до двух недель. Уточнить сроки обработки Вашего заказа Вы можете по электронной почте, с которой получено данное сообщение, в нашей <a href="../../../../page/gostevaya_kniga">Гостевой книге</a> или по телефону офиса +7(495)532-97-70.</p>\r\n<p>&nbsp;</p>\r\n<p>Ваш Dressyshop</p>\r\n<p>+7(495)532-97-70</p>\r\n<p>www.dressyshop.ru</p>', 0),
(17, 'Доставлен и оплачен', 'Заказ {order_number} доставлен и оплачен. ', '', 'status_16', '<p>Заказ {order_number} доставлен и оплачен.&nbsp;</p>', 0),
(18, 'Отказ клиента', 'Статус заказа {order_number} изменен на "Отказ клиента"', '', 'status_19', '<p>Статус Вашего заказа {order_number} изменен.</p>\r\n<p>Новый статус заказа: Отказ клиента.</p>\r\n<p>Причина: Клиент отказался от заказа до передачи его на отправку/доставку или по факту доставки.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Ваш Dressyshop</p>\r\n<p>+7(495)532-97-70</p>\r\n<p>www.dressyshop.ru</p>', 0),
(19, 'Возврат', 'Возврат по заказу {order_number} получен', '', 'status_20', '<p>Статус Вашего заказа {order_number} изменен.</p>\r\n<p>Новый статус заказа: Возврат.</p>\r\n<p>Причина: Магазин Dressyshop получил согласованный и зафиксированный возврат. Денежные средства за возврат перечисляются в течении 10 рабочих дней с даты получения складом возвращенного товара.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Ваш Dressyshop</p>\r\n<p>+7(495)532-97-70</p>\r\n<p>www.dressyshop.ru</p>', 0),
(20, 'Ответ на вопрос в Гостевой книге', 'Ответ на Ваш вопрос в Гостевой книге Dressyshop', '', 'answer', '<p>Добрый день!</p>\r\n<p>Вы задавали вопрос в Гостевой книге магазина <a href="../../../../">Dressyshop.ru</a></p>\r\n<p>Ответ магазина: {answer}</p>\r\n<p style="line-height: 18.2px;">Ваш Dressyshop</p>\r\n<p style="line-height: 18.2px;">+7(495)532-97-70</p>\r\n<p style="line-height: 18.2px;">www.dressyshop.ru</p>', 0),
(21, 'Отмена (не поступил в привоз)', 'Заказ {order_number} отменен (не поступил в привоз). ', '', 'status_21', '<p>Статус Вашего заказа {order_number} изменен.</p>\r\n<p>Новый статус заказа: Отменен (не поступил в привоз).</p>\r\n<p>Причина: Заказ был передан на фабрику, но не поступил в привоз, т.к. модели не успели прошиться. Если модели из заказа еще присутствуют на сайте и Вы готовы ожидать следующего привоза с фабрик, то сделайте перезаказ через сайт.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;Ваш Dressyshop</p>\r\n<p>+7(495)532-97-70</p>\r\n<p>www.dressyshop.ru</p>', 0);
