INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(168, 0, 8, 0, 'stilnyj_bryuchnyj_kostyum_s_pajetkami', 'Стильный брючный костюм с пайетками', NULL, 10, 'Стильный костюм не оставит равнодушной ни одну модницу!', 'СБК-1', NULL, 4850, NULL, 2300, '2017-08-23 12:57:21', '2017-08-31 13:39:26', NULL, 0, 1, '', '', '', '', '', ''),
(169, 0, 8, 0, 'molodezhnoe_palto_pryamogo_silueta', 'Молодежное  пальто прямого силуэта', NULL, 7, 'Молодежное пальто прямого силуэта.  Демисезонное пальто с прямыми рукавами и круглой горловиной. Пальто подходит для носки на каждый день.', 'СПА-1', NULL, 4250, NULL, 2000, '2017-08-23 13:17:53', '2017-08-23 13:50:43', NULL, 0, 1, '', '', '', '', '', ''),
(170, 0, 8, 0, 'molodezhnoe_plate_s_razrezami_i_v_obraznym_vyrezom', 'Молодежное платье с разрезами и V-образным вырезом', NULL, 10, 'Молодежное платье с разрезами по бокам. Отлично подойдет для прохладного летнего вечера. В данном платье Вы не останетесь незамеченной. Платье будит отлично сочетаться как с  каблуками так и с кедами. Будь модной вместе с нами.', 'СПЛ-1', NULL, 2450, NULL, 1100, '2017-08-23 14:22:01', '2017-08-23 14:45:00', NULL, 0, 1, '', '', '', '', '', ''),
(171, 0, 8, 0, 'zhenskij_bryuchnyj_kostyum_trojka', 'Женский брючный костюм-тройка', NULL, 12, 'Женский брючный костюм. Данный костюм состоит из удлиненного кардигана с завязками, футболки и брюк. Костюм сшит из легкой ткани. Элегантный костюм для работы в офисе.  Данный образ должен быть в шкафу каждой модницы.', 'СБК-2', NULL, 3650, NULL, 1700, '2017-08-23 15:46:55', '2017-08-23 16:04:18', NULL, 0, 1, '', '', '', '', '', ''),
(172, 0, 8, 0, 'stilnyj_zhenskij_klassicheskij_pidzhak_', 'Стильный женский классический пиджак', NULL, 10, 'Стильный женский классический пиджак. По определению, пиджак – это элемент деловой верхней одежды. Женский пиджак – идеальный вариант для делового стиля одежды, его можно носить на учебу или работу, а также просто для «выхода в свет». Вы можете одеть его буквально с любой вещью . Наличие V-образного выреза также является отличительной деталью. ', 'СП-1', NULL, 2650, NULL, 1200, '2017-08-24 10:58:55', '2017-08-24 11:12:55', NULL, 0, 1, '', '', '', '', '', ''),
(173, 0, 8, 0, 'modnyj_yubochnyj_kostyum_iz_zamshi', 'Модный юбочный костюм из замши', NULL, 10, 'Модный костюм из замши. Костюм состоит из стильной курточки с оригинальной молнией и  юбки  с завышенной талией и силуэтом по фигуре. Данный костюм отлично подойдет  для работы в офисе или для вечеринки.Строгость в сочетании с соблазнительностью создают пикантный и загадочный образ. Быть модной просто.', 'СЮК-1', NULL, 4050, NULL, 1900, '2017-08-24 13:59:54', '2017-08-24 14:16:23', NULL, 0, 1, '', '', '', '', '', ''),
(174, 0, 8, 0, 'zhenskij_bryuchnyj_kostyum_s_baskoj', 'Женский брючный костюм с баской', NULL, 10, 'Женский брючный костюм с баской.  Стильный костюм состоит из двух элементов: пиджак на пуговицах с баской и имитацией погонов и брюк облегающего покроя. Брючный костюм с баской - это прекрасное решение как для делового, так и для вечернего наряда. Брючный костюм моден всегда. С нами ты всегда будешь стильной.', 'СБК-3', NULL, 3850, NULL, 1800, '2017-08-24 14:38:00', '2017-08-24 14:54:19', NULL, 0, 1, '', '', '', '', '', ''),
(175, 0, 8, 0, 'stilnyj_molodezhnyj_sportivnyj_kostyum_', 'Стильный молодежный спортивный костюм', NULL, 10, 'Стильный молодежный спортивный костюм. Спорт это жизнь, так почему ее не сделать еще и модной. Оригинальный дизайн костюма все скажет за Вас. Подходит для повседневной носки и для занятий спортом. Будь в тренде вместе с нами.', 'ССК-1', NULL, 2850, NULL, 1300, '2017-08-24 15:17:34', '2017-08-24 15:26:13', NULL, 0, 1, '', '', '', '', '', ''),
(176, 0, 8, 0, 'zhenskij_bryuchnyj_kostyum_s_lampasami', 'Женский брючный костюм с лампасами', NULL, 10, 'Женский брючный костюм с лампасами. Еще несколько сезонов назад стали модными брюки с лампасами или вертикальными полосками на внешней стороне брючины. Один из стильных трендов 2017 года. Костюм состоит из двух элементов  пиджак на одной пуговице и укороченные брюки с лампасами. Будь модной вместе с нами.', 'СБК-4', NULL, 4850, NULL, 2300, '2017-08-24 15:44:22', '2017-08-24 15:59:57', NULL, 0, 1, '', '', '', '', '', ''),
(177, 0, 8, 0, 'molodezhnaya_kofta_so_shnurovkoj_na_vyreze', 'Молодежная кофта со шнуровкой на вырезе', NULL, 10, 'Молодежная кофта со шнуровкой на вырезе. Стильная кофта свободного силуэта. Пикантный  V-образный вырез подчеркнет Ваш образ. Оригинально будет выглядеть на каждой моднице. Быть модным просто.', 'СДЖ-1', NULL, 2050, NULL, 900, '2017-08-24 18:40:16', '2017-09-07 12:54:13', NULL, 0, 1, '', '', '', '', '', ''),
(178, 0, 8, 0, 'molodezhnyj_yubochnyj_komplekt_s_rubashkoj', 'Молодежный юбочный комплект с рубашкой', NULL, 10, 'Молодежный юбочный комплект с рубашкой. Комплект состоит из двух позицией, модная рубашка на пуговицах и завышенная юбка из замши.Юбочный костюм может быть любым.Этим летом данный комплект стал настоящей изюминкой женского гардероба. Будь в тренде вместе с нами.', 'СЮК-2', NULL, 4050, NULL, 1900, '2017-08-25 11:45:08', '2017-08-25 11:45:08', NULL, 0, 1, '', '', '', '', '', ''),
(179, 0, 8, 0, 'stilnyj_bryuchnyj_komplekt_s_baskoj', 'Стильный брючный комплект с баской', NULL, 10, 'Стильный брючный комплект с баской. Комплект состоит из двух элементов блуза с баской и длинным рукавом и стрейчевых брюк. Брючный костюм с баской - это прекрасное решение как для делового, так и для вечернего наряда. Красивая широкая оборка на талии всегда сделает внешность утонченной и элегантной. Будь модной вместе с нами.', 'СБК-5', NULL, 4850, NULL, 2300, '2017-08-25 12:00:31', '2017-08-25 12:00:31', NULL, 0, 1, '', '', '', '', '', ''),
(180, 0, 8, 0, 'modnoe_plate_bez_rukavov', 'Модное платье без рукавов', NULL, 10, 'Модное платье без рукавов.Платье без рукавов – идеальный вариант для жаркого дня. Платье без рукавов один из самых популярных и модных фасонов. Тренды предлагают нам множество модных платьев без рукавов . Именно в нашем магазине Вы найдете много интересных моделей.', 'СПЛ-2', NULL, 2650, NULL, 1200, '2017-08-25 12:13:53', '2017-08-25 12:19:37', NULL, 0, 1, '', '', '', '', '', ''),
(181, 0, 8, 0, 'stilnoe_palto_s_zavyazkami_na_poyase', 'Стильное пальто с завязками на поясе', NULL, 7, 'Стильное пальто с завязками на поясе.Пальто привлекательного дизайна. Модель с отложным воротником. Линия талии подчеркнута узким поясом-завязкой. Будь модной этой осенью.', 'СПА-2', NULL, 4050, NULL, 1900, '2017-08-25 12:28:28', '2017-08-25 12:31:14', NULL, 0, 1, '', '', '', '', '', ''),
(182, 0, 8, 0, 'sportivnyj_kostyum_s_asimmetrichnym_gorlom', 'Спортивный костюм с асимметричным горлом', NULL, 10, 'Спортивный костюм с асимметричным горлом.Модный костюм с оригинальным дизайном. Отлично подходит для прохладного летнего дня. Костюм для тех кто любит индивидуальность.  Будь модной вместе с нами.', 'ССК-2', NULL, 2950, NULL, 1350, '2017-08-25 12:44:29', '2017-08-25 12:48:41', NULL, 0, 1, '', '', '', '', '', ''),
(183, 0, 8, 0, 'zhenskij_uteplennyj_kardigan_s_kapyushonom', 'Женский утепленный кардиган с капюшоном', NULL, 12, 'Женский утепленный кардиган с капюшоном. Кардиганы с капюшоном практичны и удобны. Каждая женщина просто обязана иметь в своем гардеробе несколько кардиганов разных фасонов и цветов. Каждая женщина просто обязана иметь в своем гардеробе несколько кардиганов разных фасонов и цветов. Будь модной вместе с нами.', 'СКА-1', NULL, 2450, NULL, 1100, '2017-08-25 13:00:36', '2017-08-25 13:22:46', NULL, 0, 1, '', '', '', '', '', ''),
(184, 0, 8, 0, 'molodezhnaya_steganaya_kurtka_s_kapyushonom_', 'Молодежная стеганая куртка с капюшоном', NULL, 10, 'Молодежная стеганая куртка с капюшоном. Молодежный вариант верхней одежды удачно «практикуется» среди молодых девушек, сочетаясь с абсолютно любым низом. Куртка имеет функциональные карманы и капюшон, заcзастегивается на молнию. Вы можете купить куртку стеганую с капюшоном в нашем интернет-магазине. Будь модной вместе с нами.', 'СКУ-1', NULL, 3050, NULL, 1400, '2017-08-25 13:42:28', '2017-08-25 13:46:43', NULL, 0, 1, '', '', '', '', '', ''),
(185, 0, 8, 0, 'stilnyj_zhenskij_kostyum_iz_ekokozhi', 'Стильный  женский костюм из экокожи', NULL, 10, 'Стильный  женский костюм из экокожи. Невероятно стильный костюм, который подойдет и для повседневной носки, и для похода в клуб. Модный костюм свободного силуэта.  Цвета в ассортименте. Будь модной вместе с нами.', 'ССК-3', NULL, 3050, NULL, 1400, '2017-08-25 16:20:10', '2017-08-25 16:23:02', NULL, 0, 1, '', '', '', '', '', ''),
(186, 0, 8, 0, 'zhenskoe_palto_s_mehovymi_vstavkami', 'Женское пальто с меховыми вставками', NULL, 7, 'Женское пальто с меховыми вставками. Пальто с вставками из искусственного меха. Пальто женское прямого кроя. Завязывается на пояс. Имеет 2 накладных кармана, декорированных искусственным мехом. Стиль и комфорт в одной модели.', 'СПА-3', NULL, 4450, NULL, 2100, '2017-08-25 16:36:36', '2017-08-25 16:36:36', NULL, 0, 1, '', '', '', '', '', ''),
(187, 0, 8, 0, 'zhenskaya_steganaya_kurtka_na_rezinke', 'Женская стеганая куртка на резинке', NULL, 7, 'Женская стеганая куртка на резинке. Каких только фасонов курток не представлено в современном модном мире. Стеганая женская куртка - это невероятно удобная, практичная и, одновременно, стильная вещь. Стильная куртка на молнии с карманами. В нашем магазине Вы найдете ,то что подходит именно  Вам.', 'СКУ-2', NULL, 2850, NULL, 1300, '2017-08-25 16:50:12', '2017-08-25 16:50:12', NULL, 0, 1, '', '', '', '', '', ''),
(188, 0, 8, 0, 'zhenskij_vyazanyj_sportivnyj_kostyum', 'Женский вязаный спортивный костюм', NULL, 10, 'Женский вязаный спортивный костюм. Новой модной тенденцией грядущего сезона становится женский вязаный спортивный костюм. Особенно гармонично смотрятся вязаные толстовки в пастельных оттенках, а также в черном, синем и коричневом цветах. Трикотажные женские костюмы: спорт, легкость и мода. Быть модной легко.', 'ССК-4', NULL, 4950, NULL, 2350, '2017-08-25 17:06:19', '2017-08-25 17:06:19', NULL, 0, 1, '', '', '', '', '', ''),
(189, 0, 8, 0, 'stilnaya_zhenskaya_kurtka_iz_ekokozhi', 'Стильная женская куртка из экокожи', NULL, 10, 'Стильная женская куртка из экокожи. Женские куртки из экокожи становятся все популярнее. Покупая куртку из экокожи, каждая красавица сможет оценить ее достоинства. Стильная куртка из экокожи на молнии. В нашем магазине ты найдешь свою вещь.  ', 'СКУ-3', NULL, 2450, NULL, 1100, '2017-08-25 17:20:13', '2017-08-25 17:20:13', NULL, 0, 1, '', '', '', '', '', ''),
(190, 0, 8, 0, 'steganoe_demisezonnoe_zhenskoe_palto', 'Стеганое демисезонное женское пальто', NULL, 10, 'Стеганное демисезонное женское пальто. Одним из возродившихся элементов стало – женское пальто стеганое демисезонное.  Демисезонное стеганное пальто приталенного силуэта , длиной до колена.  Пальто на заклепках. Женские стеганые пальто представлены в нашем интернет магазине', 'СПА-4', NULL, 3250, NULL, 1500, '2017-08-25 17:55:20', '2017-09-06 20:16:10', NULL, 0, 1, '', '', '', '', '', ''),
(191, 0, 8, 0, 'elegantnoe_zhenskoe_plate_na_pugovicah', 'Элегантное женское платье на пуговицах', NULL, 10, 'Элегантное женское платье на пуговицах. Платье по фигуре. Платья на пуговицах выглядят стильно и оригинально. Потому что пуговицы – это простор для дизайнерской фантазии. Женские платья – женственность и элегантность всегда в моде!', 'СПЛ-3', NULL, 3850, NULL, 1800, '2017-08-28 12:55:09', '2017-08-28 12:55:09', NULL, 0, 1, '', '', '', '', '', ''),
(192, 0, 8, 0, 'stilnaya_kurtka_s_asimmetrichnym_vorotnikom', 'Стильная куртка с асимметричным воротником', NULL, 8, 'Стильная куртка с асимметричным воротником. Женские куртки с воротником – простая, но удобная вещь в модном арсенале.  Куртка прямого силуэта с длинным рукавом. Куртка без капюшона. Будь модной вместе с нами!', 'СКУ-4', NULL, 3250, NULL, 1500, '2017-08-28 13:31:13', '2017-08-28 13:31:13', NULL, 0, 1, '', '', '', '', '', ''),
(193, 0, 8, 0, 'sportivnyj_kostyum_s_serebryanymi_vstavkami', 'Спортивный костюм с серебряными вставками', NULL, 10, 'Спортивный костюм с серебряными вставками. Красивая фигура – мечта любой женщины, и редко когда в ее гардеробе нет спортивного костюма! Он пригодится не только для занятий фитнесом, но прекрасно подойдет и для загородной прогулки. В комплект входит кофта с длинными рукавами и штаны свободного силуэта.  Быть модной просто.', 'ССК-5', NULL, 5250, NULL, 2500, '2017-08-28 16:43:37', '2017-08-28 16:43:37', NULL, 0, 1, '', '', '', '', '', ''),
(194, 0, 8, 0, 'zhenskij_sportivnyj_kostyum_so_shnurovkoj', 'Женский спортивный костюм со шнуровкой', NULL, 10, 'Женский спортивный костюм со шнуровкой. Стильный женский комплект состоит из штанов и кофты на молнии.  Оригинальный костюм дополняет шнуровка по бокам рукавов и штанов. Женские спортивные костюмы на весну и лето. Будь стильной вместе с нами.', 'ССК-6', NULL, 5450, NULL, 2600, '2017-08-28 16:59:27', '2017-08-28 16:59:27', NULL, 0, 1, '', '', '', '', '', ''),
(195, 0, 8, 0, 'elegantnyj_kostyum_s_vyrezom_na_spine', 'Элегантный костюм с вырезом на спине', NULL, 10, 'Элегантный костюм с вырезом на спине. Стильный брючный костюм с оригинальной шнуровкой на спине. Обнажённая спина ничуть не уступает внушительному декольте. Выглядеть изысканно и элегантно можно только в платье. У нас ты найдешь именно свой образ. ', 'СБК-6', NULL, 5850, NULL, 2800, '2017-08-28 17:13:36', '2017-08-28 17:13:36', NULL, 0, 1, '', '', '', '', '', ''),
(196, 0, 8, 0, 'zhenskaya_parka_svobodnogo_silueta', 'Женская парка свободного силуэта', NULL, 12, 'Женская парка свободного силуэта. Достаточно длинный силуэт такой куртки надёжно защитит как от холодного ветра.  Эффектная весенняя куртка свободного силуэта на кнопках. Модный дизайн куртки не оставит Вас не замеченной. Будь модной вместе с нами.', 'СКУ-5', NULL, 3850, NULL, 1800, '2017-08-28 17:45:27', '2017-08-28 17:45:27', NULL, 0, 1, '', '', '', '', '', ''),
(197, 0, 8, 0, 'bryuchnyj_komplekt_s_udlinennym_zhaketom', 'Брючный комплект с удлиненным жакетом', NULL, 10, 'Брючный комплект с удлиненным жакетом. Такой комплект считается одним из самых распространенных. Комплект состоит из брюк  зауженных к низу и удлиненный жакет на пуговицах и с поясом. Так же отлично дополняют жакет карманы. Будь стильной вместе с нами.', 'СБК-7', NULL, 6050, NULL, 2900, '2017-08-28 18:07:27', '2017-08-28 18:07:27', NULL, 0, 1, '', '', '', '', '', ''),
(198, 0, 8, 0, 'modnaya_zhenskaya_kurtka_s_rukavom_3_4', 'Модная женская куртка с рукавом 3/4', NULL, 7, 'Модная женская куртка с рукавом 3/4. Стильный вариант рукава по локоть. Женская куртка с рукавом 3/4 особенно популярна в осенний период. Эта модная куртка для самого требовательного вкуса.  У нас Вы найдет, что искали.', 'СКУ-6', NULL, 4050, NULL, 1900, '2017-08-28 18:36:13', '2017-08-28 18:36:13', NULL, 0, 1, '', '', '', '', '', ''),
(199, 0, 8, 0, 'stilnyj_yubochnyj_komplekt_s_baskoj', 'Стильный юбочный комплект с баской', NULL, 10, 'Стильный юбочный комплект с баской. Женский костюм с юбкой - основа делового стиля. Стильный комплект с юбкой карандаш и блузой с баской сочетает в себе строгость и женственность и легко превращается из повседневного офисного костюма в вечерний наряд. Стильный костюм с оригинальной баской. Абсолютно всем подойдет юбочный костюм. ', 'СЮК-3', NULL, 3850, NULL, 1800, '2017-08-29 16:41:27', '2017-08-29 16:41:27', NULL, 0, 1, '', '', '', '', '', ''),
(200, 0, 8, 0, 'modnaya_kurtka_s_yarkim_mehom_i_kapyushonom', 'Модная куртка с ярким мехом и капюшоном', NULL, 7, 'Модная куртка с ярким мехом и капюшоном. Молодежная куртка отлично подойдет на осень. Укороченная куртка с мехом на капюшоне.  Женская куртка с розовым мехом – модный тренд сезона.  Будь модной вместе с нами.', 'СКУ-7', NULL, 4150, NULL, 1950, '2017-08-29 17:01:03', '2017-08-29 17:01:03', NULL, 0, 1, '', '', '', '', '', ''),
(201, 0, 8, 0, 'sportivnaya_steganaya_kurtka_s_kapyushonom', 'Спортивная стеганая куртка с капюшоном', NULL, 7, 'Спортивная стеганая куртка с капюшоном. На пике популярности – стеганые куртки из плащевой ткани. Стеганая куртка с утеплителем. Куртка с капюшоном и боковыми карманами станет базовой вещью гардероба.  Будь модной вместе с нами.', 'СКУ-8', NULL, 3850, NULL, 1800, '2017-08-29 17:17:26', '2017-08-29 17:17:26', NULL, 0, 1, '', '', '', '', '', ''),
(202, 0, 8, 0, 'vyazanyj_kardigan_svobodnogo_silueta', 'Вязаный кардиган свободного силуэта', NULL, 10, 'Вязаный кардиган свободного силуэта. Классический кардиган прямоугольного силуэта. Отлично дополняют кардиган вязанные цветы и карманы. Легкий модный вязаный кардиган . Данная вещь украсить каждую модницу.', 'СКА-2', NULL, 2050, NULL, 900, '2017-08-29 17:41:44', '2017-08-29 17:41:44', NULL, 0, 1, '', '', '', '', '', ''),
(203, 0, 8, 0, 'modnyj_kostyum_s_razrezami_po_bokam', 'Модный костюм с разрезами по бокам', NULL, 10, 'Модный костюм с разрезами по бокам.  Стильный спортивный костюм  свободного  силуэта.  Дополняют костюм разрезы по бокам кофты. Удлиненная женская кофта с разрезами по бокам - функциональна, модна и практична.  Оригинальный костюм в Ваш гардероб.', 'ССК-7', NULL, 3850, NULL, 1800, '2017-08-29 18:01:10', '2017-08-29 18:01:10', NULL, 0, 1, '', '', '', '', '', ''),
(204, 0, 8, 0, 'legkoe_zhenskoe_palto_na_pugovicah', 'Легкое женское пальто на пуговицах', NULL, 10, 'Легкое женское пальто на пуговицах.  Женские пальто сегодня – настоящий тренд! Легкое пальто для межсезонья легко вписывается практически в любой лук.   Никакая куртка не идет в сравнение с этой разновидностью верхней одежды, ничто не выглядит так элегантно и женственно. Будь стильной вместе с нами.', 'СПА-5', NULL, 4050, NULL, 1900, '2017-08-29 18:21:45', '2017-08-29 18:35:03', NULL, 0, 1, '', '', '', '', '', ''),
(205, 0, 8, 0, 'zhenskij_sportivnyj_kostyum_s_pajetkami', 'Женский спортивный костюм с пайетками', NULL, 10, 'Женский спортивный костюм с пайетками.  Стильный спортивный костюм состоит из двух позиций, штаны с карманами и кофта с пайетками.  Данный костюм не оставит Вас не замеченной.  Костюм свободного силуэта. Будь в тренде с нами.', 'ССК-8', NULL, 5050, NULL, 2400, '2017-08-30 12:26:31', '2017-08-30 12:26:31', NULL, 0, 1, '', '', '', '', '', ''),
(206, 0, 8, 0, 'zhenskij_puhovik_s_vysokim_vorotnikom', 'Женский пуховик с высоким воротником', NULL, 7, 'Женский пуховик с высоким воротником. Декоративные элементы: высокая стойка-воротник. Короткий пуховик .   Воротник с высокой стойкой, боковые карманы, застёжка на молнии, длинные рукава. Демисезонная куртка.', 'СКУ-9', NULL, 2850, NULL, 1300, '2017-08-30 12:41:48', '2017-08-30 12:41:48', NULL, 0, 1, '', '', '', '', '', ''),
(207, 0, 8, 0, 'zhenskoe_sherstyanoe_palto_s_poyasom', 'Женское шерстяное пальто с поясом', NULL, 7, 'Женское шерстяное пальто с поясом. Женское шерстяное пальто – эталон моды каждого столетия. Шерстяное пальто с рукавами из искусственного меха.  Шикарное пальто на запах хороший выбор для весенне-осеннего сезона.  Покупка пальто из шерсти - это правильный выбор.  ', 'СПА-6', NULL, 5050, NULL, 2400, '2017-08-30 12:55:53', '2017-08-30 12:55:53', NULL, 0, 1, '', '', '', '', '', ''),
(208, 0, 8, 0, 'zhenskij_udlinennyj_zhilet_s_kapyushonom', 'Женский удлиненный жилет с капюшоном', NULL, 8, 'Женский удлиненный жилет с капюшоном.  Жилет с капюшоном и застежке на молнии. Современный и теплый. Данный жилет станет отличным дополнением вашего гардероба.  В нем Вам будет более чем комфортно.', 'СЖИ-1', NULL, 4050, NULL, 1900, '2017-08-31 16:26:18', '2017-08-31 16:26:18', NULL, 0, 1, '', '', '', '', '', ''),
(209, 0, 8, 0, 'zhenskaya_zamshevaya_kurtka_pryamogo_kroya', 'Женская замшевая куртка прямого кроя', NULL, 10, 'Женская замшевая куртка прямого кроя. Женская замшевая куртка не теряет свою популярность. Аккуратный прямой покрой визуально стройнит фигуру. Замшевая женская куртка смотрится стильно и позволяет создать эффектный лук. Будь модной вместе с нами.', 'СКУ-10', NULL, 4450, NULL, 2100, '2017-08-31 16:48:42', '2017-08-31 16:48:42', NULL, 0, 1, '', '', '', '', '', ''),
(210, 0, 8, 0, 'zhenskaya_kurtka_s_zavyazkami_na_rukavah', 'Женская куртка с завязками на рукавах', NULL, 7, 'Женская куртка с завязками на рукавах. Куртка прямого кроя с карманами.  Особенность этой куртке придают завязки на рукавах.  Данная куртка поможет  выразить свою индивидуальность и неповторимость. Быть модной просто.', 'СКУ-11', NULL, 3050, NULL, 1400, '2017-08-31 17:11:08', '2017-08-31 17:11:08', NULL, 0, 1, '', '', '', '', '', ''),
(211, 0, 8, 0, 'zhenskoe_steganoe_palto_pryamogo_kroya', 'Женское стеганое пальто прямого кроя', NULL, 8, 'Женское стеганное пальто прямого кроя. Стеганое пальто прямого кроя с утеплителем из синтепона.  Пальто прямого покроя – классический вариант для спокойной и уверенной в себе женщины.  Данное пальто отлично подходит для любой погоды. Яркий тренд предстоящего сезона – стеганое . ', 'СПА-7', NULL, 3850, NULL, 1800, '2017-08-31 17:42:37', '2017-09-06 20:18:09', NULL, 0, 1, '', '', '', '', '', ''),
(212, 0, 8, 0, 'elegantnoe_palto_s_raskleshennym_nizom', 'Элегантное пальто с расклешенным низом', NULL, 8, 'Элегантное пальто с расклешенным низом.  Пальто расклешенного силуэта подойдет многим девушкам. Девушка в приталенном пальто всегда выглядит современно и элегантно.  С расклешенным низом – стильно смотрятся юбки и высокие сапожки. Будь модой вместе с нами.', 'СПА-8', NULL, 3850, NULL, 1800, '2017-08-31 18:16:19', '2017-08-31 18:16:19', NULL, 0, 1, '', '', '', '', '', ''),
(213, 0, 8, 0, '_zhenskaya_kurtka_s_ob_emnym_vorotnikom', 'Женская куртка с объемным воротником', NULL, 7, 'Женская куртка с объемным воротником. Женские куртки с воротником – простая, но удобная вещь в модном арсенале женщины. Оригинальная стеганая курточка с объемным воротником. Спереди есть два кармана и оригинальные завязки.  Высокий объемный хомут не только является превосходным декором, но и надежно защищает шею от ветра и холода.', 'СКУ-12', NULL, 3050, NULL, 1400, '2017-09-01 12:30:18', '2017-09-01 12:30:18', NULL, 0, 1, '', '', '', '', '', ''),
(214, 0, 8, 0, 'zhenskij_velyurovyj_sportivnyj_kostyum', 'Женский велюровый  спортивный костюм', NULL, 10, 'Женский велюровый  спортивный костюм. Комплект состоит из кофты на молнии с капюшоном и штанов с карманами.  Женские велюровые костюмы позволяют любой моднице подчеркнуть свой неповторимый образ. В нем Вы будите неотразимы как в спортивном зале, так и дома или на даче. Женские велюровые костюмы – удобство, практичность, стиль и мода. ', 'ССК-9', NULL, 3050, NULL, 1400, '2017-09-01 13:07:05', '2017-09-01 13:07:05', NULL, 0, 1, '', '', '', '', '', ''),
(215, 0, 8, 0, 'palto_zhenskoe_s_mehovymi_vstavkami', 'Пальто женское с меховыми вставками', NULL, 8, 'Пальто женское с меховыми вставками.  Осень – это не только яркие краски природы, но и холодные ветра и первые заморозки. В этом сезоне стоит присмотреться к стеганым моделям.  Пальто с вставками из искусственного меха. Одевайся со вкусом вместе с нами.', 'СПА-9', NULL, 4050, NULL, 1900, '2017-09-01 13:53:53', '2017-09-01 13:53:53', NULL, 0, 1, '', '', '', '', '', ''),
(216, 0, 8, 0, 'sportivnyj_kostyum_s_dekorativnoj_otdelkoj', 'Спортивный костюм с декоративной отделкой', NULL, 12, 'Спортивный костюм с декоративной отделкой.  Спортивные костюмы давно стали частью  гардероба современных женщин.  Данный костюм отличает от других оригинальный дизайн, использование различных декоративных элементов для отделки. Современные женские спортивные костюмы выглядят красиво и ярко. У нас вы можете купить модные женские спортивные костюмы.', 'ССК-10', NULL, 5050, NULL, 2400, '2017-09-01 14:18:03', '2017-09-01 14:18:03', NULL, 0, 1, '', '', '', '', '', ''),
(217, 0, 8, 0, 'zhenskoe_palto_s_vorotnikom_stojka', 'Женское пальто с воротником стойка', NULL, 14, 'Женское пальто с воротником стойка.  Воротник - важная деталь пальто, которая влияет на общий стиль изделия. Так, воротник стойка придает пальто сдержаный, аккуратный вид.  Пальто прямого силуэта. Женское пальто с воротником – ваш правильный выбор! ', 'СПА-10', NULL, 3850, NULL, 1800, '2017-09-01 15:05:41', '2017-09-01 15:15:55', NULL, 0, 1, '', '', '', '', '', ''),
(219, 0, 8, 0, 'udlinennoe_palto_s_dekorativnoj_broshyu', 'Удлиненное пальто с декоративной брошью', NULL, 14, 'Удлиненное пальто с декоративной брошью.  Пальто дополняет капюшон. Удлиненное пальто с поясом и карманами.  На стойке - декоративная брошь.  Будь  модной вместе с нами.', 'СПА-11', NULL, 4850, NULL, 2300, '2017-09-01 15:31:54', '2017-09-01 15:31:54', NULL, 0, 1, '', '', '', '', '', ''),
(220, 0, 8, 0, 'zhenskoe_palto_na_sintepone_s_kapyushonom', 'Женское пальто на синтепоне с капюшоном', NULL, 14, 'Женское пальто на синтепоне с капюшоном. Женское  пальто на синтепоне - один из наиболее универсальных и теплых вариантов. Удобное, теплое, комфортное. Такая вещь незаменима на каждый день в осеннюю погоду. В нашем каталоге Вы найдете подходящий для Вас вариант.', 'СПА-12', NULL, 4050, NULL, 1900, '2017-09-04 12:29:40', '2017-09-04 12:29:40', NULL, 0, 1, '', '', '', '', '', ''),
(221, 0, 8, 0, 'zhenskaya_kurtka_na_sintepone_s_vstavkami_iz_meha', 'Женская куртка на синтепоне с вставками из меха', NULL, 7, 'Женская куртка на синтепоне с вставками из меха. С приходом холодов все больше девушек предпочитает покупать женские куртки на синтепоне. Бесспорным достоинством подобной одежды является ее универсальность. Стильные куртки на синтепоне отлично подходят для зимнего времени года. Они позволяют создавать бесконечное количество оригинальных композиций и всегда выглядеть привлекательно.', 'СКУ-13', NULL, 3050, NULL, 1400, '2017-09-04 12:50:58', '2017-09-04 12:50:58', NULL, 0, 1, '', '', '', '', '', ''),
(222, 0, 8, 0, 'stilnyj_bryuchnyj_komplekt_s_lampasami', 'Стильный брючный комплект с лампасами', NULL, 10, 'Стильный брючный комплект с лампасами. Один из стильных трендов 2017 - женские брюки с лампасами.  Вертикальная полоса сбоку визуально добавляет стройности и удлиняет ноги. Стильный брючный комплект из двух элементов, штаны и кофта. Будь модной вместе с нами.', 'ССК-11', NULL, 4050, NULL, 1900, '2017-09-04 13:15:44', '2017-09-04 13:15:44', NULL, 0, 1, '', '', '', '', '', ''),
(223, 0, 8, 0, 'zhenskoe_palto_svobodnogo_kroya', 'Женское пальто свободного кроя', NULL, 14, 'Женское пальто свободного кроя. Невероятно комфортное пальто свободного кроя с капюшоном.  Пальто женское свободного кроя – универсальная вещь в гардеробе представительниц прекрасного пола всех возрастов. Гармонично сочетается с нарядами в классическом стиле и с повседневной одеждой. Будь модной вместе с нами.', 'СПА-13', NULL, 4050, NULL, 1900, '2017-09-04 13:32:52', '2017-09-04 13:32:52', NULL, 0, 1, '', '', '', '', '', ''),
(224, 0, 8, 0, 'zhenskaya_uteplennaya_zhiletka_na_molnii', 'Женская утепленная жилетка на молнии', NULL, 10, 'Женская утепленная жилетка на молнии. Женские утепленные жилетки – отличная альтернатива наскучившим курткам и стильный способ показать модный ансамбль. Женские жилеты отлично вписываются в городской стиль. Мягкая женская жилетка. Будь модной вместе с нами.', 'СЖИ-2', NULL, 3850, NULL, 1800, '2017-09-05 18:13:43', '2017-09-05 18:13:43', NULL, 0, 1, '', '', '', '', '', ''),
(225, 0, 8, 0, 'palto_svobodnogo_silueta_s_mehovymi_vstavkami', 'Пальто свободного силуэта с меховыми вставками', NULL, 14, 'Пальто свободного силуэта с меховыми вставками. Модной верхней одеждой считается женское пальто свободного кроя. Такой фасон подходит девушкам с разным типом фигуры. Модели пальто с мехом свободного силуэта смотрятся очень женственно. У нас Вы найдете своё идеальное  пальто.', 'СПА-14', NULL, 3250, NULL, 1500, '2017-09-05 18:51:19', '2017-09-05 18:51:19', NULL, 0, 1, '', '', '', '', '', ''),
(226, 0, 8, 0, 'uteplennaya_zhenskaya_kurtka_s_poyasom', 'Утепленная  женская куртка с поясом', NULL, 10, 'Утепленная  женская куртка с поясом. Модные и трендовые женские осенние куртки. Эти укороченные модели курток с меховым воротником и поясом могут стать яркой. Если вы любите яркие решения, то и такая женская верхняя одежды найдется для Вас. Будь модной вместе с нами.', 'СКУ-14', NULL, 4450, NULL, 2100, '2017-09-05 19:10:21', '2017-09-06 13:49:51', NULL, 0, 1, '', '', '', '', '', ''),
(227, 0, 8, 0, 'zhenskie_modnye_shtany_s_lampasami', 'Женские модные штаны с лампасами', NULL, 10, 'Женские модные штаны с лампасами. Безусловный тренд этой осени –  штаны с лампасами. Масса поклонниц увлеклись брюками с лампасами. Штаны перестали быть просто спортивной вещью. Они подчеркивают Вашу индивидуальность.', 'СБР-1', NULL, 2450, NULL, 1100, '2017-09-06 13:26:07', '2017-09-06 13:26:07', NULL, 0, 1, '', '', '', '', '', ''),
(228, 0, 8, 0, 'zhenskoe_steganoe_palto_na_knopkah', 'Женское стеганое пальто на кнопках', NULL, 7, 'Женское стеганное пальто на кнопках. Женские стеганые пальто – это легкий вариант верхней одежды. Пальто прямого кроя. Вы будете самой яркой даже с наступлением холодов!  Будь модной вместе с нами.', 'СПА-15', NULL, 3250, NULL, 1500, '2017-09-06 13:55:31', '2017-09-06 20:17:07', NULL, 0, 1, '', '', '', '', '', ''),
(229, 0, 8, 0, 'ukorochennyj_zhenskij_puhovik_s_kapyushonom', 'Укороченный женский пуховик с капюшоном', NULL, 7, 'Укороченный женский пуховик с капюшоном. К несомненным достоинствам укороченных курток можно отнести эффектный вид, практичность, легкость, комфортность. Куртки и пуховики с капюшоном позволяют забыть про головной убор. Укороченные пуховики более универсальны к подпору обуви и аксессуаров под них. Будь модной вместе с нами.', 'СКУ-15', NULL, 3250, NULL, 1500, '2017-09-06 14:21:05', '2017-09-06 14:21:05', NULL, 0, 1, '', '', '', '', '', ''),
(230, 0, 8, 0, 'zhenskij_puhovik_cveta_metallik', 'Женский пуховик цвета металлик', NULL, 7, 'Женский пуховик цвета металлик. Подойдет на осень, зиму и весну. Модный пуховик  цвета металлик с капюшоном. Этот цвет придает пуховику дороговизну и дополнительный шик. Идеален для покупательниц, ценящих не только практичные, но и стильные вещи! ', 'СКУ-16', NULL, 4450, NULL, 2100, '2017-09-06 14:43:48', '2017-09-06 14:43:48', NULL, 0, 1, '', '', '', '', '', ''),
(231, 0, 8, 0, 'stilnoe_plate_s_otkrytymi_plechami', 'Стильное платье с открытыми плечами', NULL, 10, 'Стильное платье с открытыми плечами. Платья с открытыми плечами весьма разнообразны. Не бойтесь экспериментов. Оригинальные платья с открытыми плечами могут стать украшением любого гардероба.Платья с открытыми плечами  выглядят модно и стильно. ', 'СПЛ-4', NULL, 3050, NULL, 1400, '2017-09-07 12:18:46', '2017-09-07 12:18:46', NULL, 0, 1, '', '', '', '', '', ''),
(232, 0, 8, 0, 'zhenskij_dzhemper_s_prozrachnymi_rukavami', 'Женский джемпер с прозрачными рукавами', NULL, 10, 'Женский джемпер с прозрачными рукавами. Микс плотных и прозрачных тканей в данной модели. Отлично подойдет как для работы в офисе так и для вечернего мероприятия. Отлично дополнит Ваш образ. Будь модной вместе с нами.', 'СДЖ-2', NULL, 2450, NULL, 1100, '2017-09-07 12:50:10', '2017-09-07 12:53:36', NULL, 0, 1, '', '', '', '', '', ''),
(233, 0, 8, 0, 'zhenskoe_palto_s_pajetkami_na_karmanah', 'Женское пальто с пайетками на карманах', NULL, 7, 'Женское пальто с пайетками на карманах. Изумительное женское пальто украшено пайетками на накладных карманах. Так же пальто имеет капюшон.  Отдайте предпочтение этому женскому пальто  и Вы не останетесь не замеченной. Быть модной просто.', 'СПА-16', NULL, 4450, NULL, 2100, '2017-09-07 13:02:04', '2017-09-07 13:02:04', NULL, 0, 1, '', '', '', '', '', ''),
(234, 0, 8, 0, 'elegantnyj_yubochnyj_komplekt_s_baskoj', 'Элегантный юбочный комплект с баской', NULL, 10, 'Элегантный юбочный комплект с баской. Очень стильный и изысканный комплект, состоящий из блузы с баской и юбки. Классическая юбка прямого кроя - всегда беспроигрышный вариант. Блузки с баской – одежда для стильных дам. Эта модель гардероба выглядит одновременно строго, стильно и женственно.', 'СЮК-4', NULL, 3450, NULL, 1600, '2017-09-07 13:14:08', '2017-09-07 13:14:08', NULL, 0, 1, '', '', '', '', '', ''),
(236, 0, 8, 0, 'velyurovoe_plate_svobodnogo_silueta', 'Велюровое платье свободного силуэта', NULL, 10, 'Велюровое платье свободного силуэта. Среди модных трендов – стильное и эффектное велюровое платье. Женское велюровое платье — свободного силуэта, длиной выше колен, с цельнокроеным рукавом. Платье с капюшоном. Легкая и нежная велюровая ткань и свободный силуэт подарят ощущение внутренней свободы и легкости.', 'СПЛ-5', NULL, 2850, NULL, 1300, '2017-09-11 18:38:58', '2017-09-11 18:38:58', NULL, 0, 1, '', '', '', '', '', ''),
(237, 0, 8, 0, 'molodezhnaya_parka_s_mehovym_kapyushonom', 'Молодежная парка с меховым капюшоном', NULL, 7, 'Молодежная парка с меховым капюшоном. Молодежная парка обладает легким весом, удобством. На талии у парки присутствуют шнурки, которые можно затянуть для дополнительного тепла.  На рукавах мех отстегивается. На сегодняшний день куртки парки стали неотъемлемой часть молодежного образа.', 'СКУ-17', NULL, 9850, NULL, 4800, '2017-09-11 19:00:58', '2017-09-11 19:00:58', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(238, 0, 8, 0, 'zhenskoe_plate_s_yubkoj_iz_shifona', 'Женское платье с юбкой из шифона', NULL, 10, 'Женское платье с юбкой из шифона. В этом году дизайнеры разработали всевозможные фасоны платьев на любой вкус и цвет! Если вы следите за модой, то знаете, что женские платья из шифона помогут вам быть в тренде. Можно купить платья  с нижней юбкой из шифона и верхом из непрозрачной ткани, такие изделия лучше всего выглядят на стройных девушках. Будь модной вместе с нами.', 'СПЛ-6', NULL, 2650, NULL, 1200, '2017-09-11 19:26:34', '2017-09-11 19:31:20', NULL, 0, 1, '', '', '', '', '', ''),
(239, 0, 8, 0, 'palto_so_s_emnymi_vyazannymi_rukavami', 'Пальто со съемными вязанными рукавами', NULL, 7, 'Пальто со съемными вязанными рукавами. Ультрамодное пальто со съемными рукавами и декоративными деталями. Стеганое пальто приталенного силуэта. Подкладка пальто на синтепоне. Будь модной этой зимой.', 'СПА-17', NULL, 4450, NULL, 2100, '2017-09-11 19:42:25', '2017-09-11 19:42:25', NULL, 0, 1, '', '', '', '', '', ''),
(240, 0, 8, 0, 'molodezhnyj_puhovik_pryamogo_kroya', 'Молодежный пуховик прямого кроя', NULL, 14, 'Молодежный пуховик прямого кроя. Стильный комбинированный цветами пуховик. Декорирован молниями. Так же  есть карманы и капюшон. Пуховик благодаря которому Вы встретите зиму в тренде нового года. ', 'СКУ-18', NULL, 4250, NULL, 2000, '2017-09-11 19:59:30', '2017-09-11 19:59:30', NULL, 0, 1, '', '', '', '', '', ''),
(241, 0, 9, 0, 'kurtka_pilot_iz_neoprena', 'Куртка-пилот из неопрена', NULL, 12, 'Свободная куртка оверсайз со свободной посадкой из неопрена. Куртка на подкладке с отложным воротником.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: отложной воротник\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 70 см (44, 48 р.)\r\n• Силуэт: оверсайз\r\n• Карманы: прорезные\r\n• Застежка: молния', 'ФЛА-308', NULL, 5090, NULL, 2420, '2017-09-12 12:21:16', '2017-09-12 12:21:16', NULL, 0, 1, '', '', '', '', '', ''),
(242, 0, 9, 0, 'yarkoe_molodezhnoe_palto_s_karmanami', 'Яркое молодежное пальто с карманами', NULL, 12, 'Модное пальто для яркой осени!\r\nСостав: полиэстер 100%\r\n• Тип горловины: воротник - стойка, V-образный вырез\r\n• Тип проймы: спущенный\r\n• Длина изделия: по спинке 100 см (44, 48 р)\r\n• Силуэт: прямой, зауженный к низу\r\n• Застежка: внутренние кнопки\r\n• Особенности: карманы в боковых швах', 'ФЛА-604', NULL, 9030, NULL, 4390, '2017-09-12 12:35:09', '2017-09-12 12:38:29', NULL, 0, 1, '', '', '', '', '', ''),
(243, 0, 9, 0, 'svobodnaya_trikotazhnaya_kurtka_iz_zhakkarda', 'Свободная трикотажная куртка из жаккарда', NULL, 12, 'Модная трикотажная куртка на каждый день.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: длинный, на манжете, с декоративными защипами\r\n• Тип горловины: V-образный, отложной\r\n• Тип проймы: спущенный\r\n• Длина изделия: по спинке около 71 см (44, 48 р.)\r\n• Застежка: молния\r\n• Особенности: карманы', 'ФЛА-303', NULL, 4810, NULL, 2280, '2017-09-12 14:20:24', '2017-09-12 14:33:35', NULL, 0, 1, '', '', '', '', '', ''),
(244, 0, 9, 0, 'stilnyj_trench_bez_zastezhki', 'Стильный тренч без застежки', NULL, 11, 'Стильный тренч прямого силуэта без подклада, без застежки. Линия горловины обработана обтачкой. Втачной рукав со спущенной проймой длиной 3/4. Женский тренч прочно закрепил за собой звание «базового» предмета гардероба. Длина изделия по спинке около 90 см (44 р), 92 (50 р).\r\nСостав: хлопок 70%, полиэстер 20%, эластан 10%.', 'ФЛА-319', NULL, 3230, NULL, 1490, '2017-09-12 16:36:40', '2017-09-12 16:36:40', NULL, 0, 1, '', '', '', '', '', ''),
(245, 0, 9, 0, 'svobodnoe_palto_bez_podkladki', 'Свободное пальто без подкладки', NULL, 12, 'Свободное пальто на теплую осень/весну. Отлично сочетается с одеждой в стиле casual.\r\n• Тип горловины: воротник с лацканами\r\n• Тип проймы: спущенный\r\n• Длина изделия: по спинке 115 см (44, 48 р)\r\n• Застежка: внутренние кнопки\r\n• Особенности: без подклада, объем oversize, карманы в боковых швах', 'ФЛА-603', NULL, 9030, NULL, 4390, '2017-09-12 17:04:33', '2017-09-12 17:04:33', NULL, 0, 1, '', '', '', '', '', ''),
(246, 0, 9, 0, 'svobodnoe_palto_na_podkladke_s_shirokim_poyasom', 'Свободное пальто на подкладке с широким поясом', NULL, 12, 'Стильное пальто оверсайз хит сезона! Отлично сочетается с любым стилем одежды. \r\nСостав: полиэстер 100%\r\n• Тип горловины: воротник с лацканами\r\n• Тип проймы: спущенный\r\n• Длина изделия: по спинке 110 см (44, 48 р)\r\n• Застежка: широкий пояс\r\n• Особенности: накладные карманы', 'ФЛА-602', NULL, 10230, NULL, 4990, '2017-09-12 17:24:57', '2017-09-12 17:24:57', NULL, 0, 1, '', '', '', '', '', ''),
(247, 0, 9, 0, 'svobodnaya_uteplennaya_kurtka_na_sintepone', 'Свободная утепленная куртка на синтепоне', NULL, 12, 'Утепленная куртка на подкладке и синтепоне. Незаменимая вещь в гардеробе любой модницы. \r\nСостав: верх - хлопок 70%, полиэстер 27%, эластан 3% ; подклад: полиэстер 100%\r\n• Тип горловины: воротник-стойка\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 67 см (44 р.), 68 см (48 р.)\r\n• Карманы: прорезные\r\n• Застежка: молния\r\n• Особенности: утеплитель - синтепон\r\n', 'ФЛА-307.1', NULL, 5570, NULL, 2660, '2017-09-12 17:35:56', '2017-09-12 17:35:56', NULL, 0, 1, '', '', '', '', '', ''),
(248, 0, 9, 0, 'trikotazhnyj_bomber_bez_podkladki', 'Трикотажный бомбер без подкладки', NULL, 12, 'Молодежная укороченная курточка с нашивкой. Всегда в тренде.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Тип горловины: округлая, воротник-стойка\r\n• Тип проймы    : спущенный\r\n• Длина изделия: по спинке 49 см (44, 48 р)\r\n• Застежка: внутренние кнопки\r\n• Особенности: карманы, декоративная нашивка, без подклада', 'ФЛА-304', NULL, 3830, NULL, 1790, '2017-09-12 17:46:09', '2017-09-12 17:46:09', NULL, 0, 1, '', '', '', '', '', ''),
(251, 0, 9, 0, 'klassicheskie_zhenskie_bryuki_iz_kostyumnoj_tkani', 'Классические женские брюки из костюмной ткани', NULL, 10, 'Женские классические брюки.  Элегантность и сдержанность – вот кредо классики.\r\nСостав: хлопок 50%, полиэстер 45%, эластан 5%\r\n• Тип верха: притачной пояс\r\n• Тип проймы: втачной\r\n• Длина изделия: по внешнему шву 98 см (44, 50 р)\r\n• Застежка: молния, потайной крючок\r\n• Особенности: брючные карманы с отделкой, разрезы\r\n', 'ФЛА-460', NULL, 3750, NULL, 1750, '2017-09-12 18:30:40', '2017-09-12 18:41:56', NULL, 0, 1, '', '', '', '', '', ''),
(252, 0, 9, 0, 'zhenskie_klassicheskie_bryuki_s_karmanami', 'Женские классические брюки с карманами', NULL, 12, 'Элегантные женские брюки. Серые брюки универсальны и подойдут для множества образов. \r\nСостав: хлопок 50%, полиэстер 45%, эластан 5%\r\n• Тип верха: притачной пояс\r\n• Длина изделия: по внешнему боковому шву 102 см (44, 48 р)\r\n• Застежка: молния, потайной крючок\r\n• Особенности: брючные карманы, отвороты\r\n', 'ФЛА-461', NULL, 3350, NULL, 1550, '2017-09-12 18:55:10', '2017-09-12 19:34:22', NULL, 0, 1, '', '', '', '', '', ''),
(253, 0, 9, 0, 'trikotazhnaya_yubka_s_risunkom_romby', 'Трикотажная юбка с рисунком ромбы', NULL, 12, 'Яркая трикотажная юбка на контрастном поясе. Дополнит любой образ.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина изделия: 70 см (44, 48 р)\r\n• Застежка: на молнию в среднем шве спинки\r\n• Особенности модели: юбка в круговую складку на контрастном поясе', 'ФЛА-404-01', NULL, 2950, NULL, 1350, '2017-09-12 19:37:55', '2017-09-12 19:37:55', NULL, 0, 1, '', '', '', '', '', ''),
(254, 0, 9, 0, 'trikotazhnaya_yubka_s_krupnymi_cvetami', 'Трикотажная юбка с крупными цветами', NULL, 12, 'Яркая трикотажная юбка с цветами. Отличный вариант для вечера!\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина изделия: по спинке 70 см (44, 48 р)\r\n• Застежка: на молнию в среднем шве спинки\r\n• Особенности модели: юбка в круговую складку на контрастном поясе', 'ФЛА-404-06', NULL, 3410, NULL, 1580, '2017-09-12 19:43:50', '2017-09-12 19:43:50', NULL, 0, 1, '', '', '', '', '', ''),
(255, 0, 9, 0, 'yarkaya_trikotazhnaya_yubka_v_polosku', 'Яркая трикотажная юбка в полоску', NULL, 12, 'Яркая трикотажная юбка в морском стиле. Полоска всегда в моде!\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина изделия: 70 см (44, 48 р)\r\n• Застежка: на молнию в среднем шве спинки\r\n• Особенности модели: юбка в круговую складку на контрастном поясе', 'ФЛА-404-08', NULL, 2950, NULL, 1350, '2017-09-12 19:49:37', '2017-09-12 19:49:37', NULL, 0, 1, '', '', '', '', '', ''),
(256, 0, 9, 0, 'modnye_ukorochennye_zhenskie_bryuki', 'Модные укороченные женские брюки', NULL, 12, 'Укороченные женские брюки вот уже несколько сезонов подряд — безусловный тренд. Если женщина хочет выглядеть максимально элегантно, изящно и стильно, то укороченные женские брюки подойдут как никогда лучше.\r\nСостав: хлопок 50%, полиэстер 45%, эластан 5%\r\n• Тип верха: обтачной\r\n• Длина изделия: по внешнему шву 98 см (44, 48 р.)\r\n• Застежка: потайная молния\r\n• Особенности: карманы, разрезы по низу\r\n', 'ФЛА-463', NULL, 2950, NULL, 1350, '2017-09-12 19:50:34', '2017-09-12 19:50:34', NULL, 0, 1, '', '', '', '', '', ''),
(257, 0, 9, 0, 'universalnaya_yubka_iz_plotnogo_strejcha', 'Универсальная юбка из плотного стрейча', NULL, 11, 'Состав: хлопок 70%, полиэстер 20%, эластан 10%\r\nОфисная модель юбки. Юбка выполнена из плотного стрейч-сатина. Изделие прямого силуэта с двумя защипами по переду. На поясе, оформленном широкими шлицами свободно вставлен узкий пояс. Сзади по центру спинки юбка застегивается на молнию. На спинке имеется шлица. Длина изделия по спинке около 43 см (44 р), около 46 см (48р).', 'ФЛА-415', NULL, 2230, NULL, 990, '2017-09-12 19:54:32', '2017-09-12 19:58:10', NULL, 0, 1, '', '', '', '', '', ''),
(258, 0, 9, 0, 'korotkaya_trikotazhnaya_yubka_s_karmanami', 'Короткая трикотажная юбка с карманами', NULL, 10, 'Трикотажная юбка из жаккарда А-силуэта. Должна быть в гардеробе каждой модницы!\r\nСостав: полиэстер 95%, эластан 5%\r\n• Длина изделия: по спинке 48 см (44, 48 р)\r\n• Застежка: потайная молния в боковом шве\r\n• Особенности: притачной пояс, карманы', 'ФЛА-419', NULL, 2750, NULL, 1250, '2017-09-12 20:01:22', '2017-09-12 20:01:22', NULL, 0, 1, '', '', '', '', '', ''),
(259, 0, 9, 0, 'stilnye_shorty_s_zavyshennoj_taliej', 'Стильные шорты с завышенной талией', NULL, 10, 'Шорты с завышенной талией подходят большинству девушек с разным типом фигуры. Шорты с завышенной талией - модный тренд сезона.\r\nСостав: полиэстер 67%, вискоза 30%, эластан 3%\r\n• Тип верха: притачной пояс\r\n• Длина изделия: по боковому шву около 35 см (44, 48 р.)\r\n• Застежка: молния\r\n• Особенности: защипы, брючные карманы\r\n', 'ФЛА-466', NULL, 2430, NULL, 1090, '2017-09-12 20:12:21', '2017-09-12 20:12:21', NULL, 0, 1, '', '', '', '', '', ''),
(260, 0, 9, 0, 'modnye_zhenskie_bryuki_s_poyasom', 'Модные женские брюки с поясом', NULL, 12, 'Стильные брюки — удобная и актуальная одежда для женщины разного возраста. Отличительные особенности этого фасона – стрелки, прорезные карманы, четко выраженный пояс.\r\nСостав: полиэстер 67%, вискоза 30%, эластан 3%\r\n• Тип верха: притачной пояс\r\n• Длина изделия: по боковому шву около 96 см (44, 48 р.)\r\n• Застежка: молния\r\n• Особенности: пояс с металлическими полукольцами, брючные карманы\r\n', 'ФЛА-468', NULL, 3630, NULL, 1690, '2017-09-12 20:24:43', '2017-09-12 20:24:43', NULL, 0, 1, '', '', '', '', '', ''),
(261, 0, 9, 0, 'stilnaya_yubka_karandash_s_razrezom', 'Стильная юбка-карандаш с разрезом', NULL, 12, 'Стильная юбка-карандаш на подкладке. Разрез до середины бедра подчеркнет Ваши ножки!\r\nСостав: полиэстер 70%, вискоза 30%\r\n• Длина изделия: по спинке около 75 см (44, 48 р.)\r\n• Застежка: молния\r\n• Особенности: разрез до середины бедра, притачной пояс, из костюмной ткани с фактурной поверхностью\r\n', 'ФЛА-422', NULL, 3550, NULL, 1650, '2017-09-12 20:30:22', '2017-09-12 20:30:22', NULL, 0, 1, '', '', '', '', '', ''),
(262, 0, 9, 0, 'zauzhennye_zhenskie_bryuki_so_strelkami', 'Зауженные женские брюки со стрелками', NULL, 12, 'Зауженные женские брюки - это главный модный тренд актуальных сезонов. Это весьма актуальный вариант для всех, кто следит за модой.\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Тип верха: притачной пояс\r\n• Длина изделия: по боковому шву около 94 см (44, 48 р.)\r\n• Застежка: нет\r\n• Особенности: пояс на резинке с завязками, карманы в швах', 'ФЛА-469', NULL, 3090, NULL, 1420, '2017-09-12 20:37:07', '2017-09-12 20:37:07', NULL, 0, 1, '', '', '', '', '', ''),
(263, 0, 9, 0, 'zhenskie_sportivnye_bryuki_s_poyasom_na_rezinke', 'Женские спортивные брюки с поясом на резинке', NULL, 11, 'Очень комфортные и универсальные брюки. Такая модель необходима в любом гардеробе.\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Тип верха: притачной пояс\r\n• Длина изделия: по боковому шву около 102 см (44, 48 р.)\r\n• Застежка: нет\r\n• Особенности: пояс на резинке с завязкой, манжеты\r\n', 'ФЛА-470', NULL, 3090, NULL, 1420, '2017-09-12 20:47:56', '2017-09-12 20:47:56', NULL, 0, 1, '', '', '', '', '', ''),
(264, 0, 9, 0, 'trikotazhnaya_yubka_s_vysokoj_posadkoj', 'Трикотажная юбка с высокой посадкой', NULL, 12, 'Трикотажная юбка с завышенной талией. Идеальный офисный вариант.\r\nСостав: полиэстер 65%, вискоза 30%, спандекс 5%\r\n• Пояс: пояс-обтачка\r\n• Посадка: высокая (на линии талии)\r\n• Длина изделия: по спинке около 76 см (44, 48 р.)\r\n• Карманы: нет\r\n• Застежка: молния\r\n', 'ФЛА-425', NULL, 3010, NULL, 1380, '2017-09-12 20:48:40', '2017-09-12 20:48:40', NULL, 0, 1, '', '', '', '', '', ''),
(265, 0, 9, 0, 'stilnaya_trikotazhnaya_yubka_s_razrezom', 'Стильная трикотажная юбка с разрезом', NULL, 12, 'Стильная юбка на подкладке. Яркое дополнение для офисного гардероба.\r\nСостав: полиэстер 65%, вискоза 30%, спандекс 5%\r\n• Пояс: притачной\r\n• Посадка: высокая (на линии талии)\r\n• Длина изделия: по спинке около 68 см (44, 48 р.)\r\n• Карманы: в боковых швах\r\n• Застежка: молния', 'ФЛА-426', NULL, 3230, NULL, 1490, '2017-09-12 20:56:33', '2017-09-12 20:56:33', NULL, 0, 1, '', '', '', '', '', ''),
(266, 0, 9, 0, 'zhenskie_sportivnye_bryuki_pryamogo_kroya', 'Женские спортивные брюки прямого кроя', NULL, 12, 'Классическая модель спортивных брюк. Обязательный пункт модного гардероба – спортивные брюки.\r\nСостав: полиэстер 67%, вискоза 30%, эластан 3%\r\n• Пояс: притачной\r\n• Посадка: средняя\r\n• Длина изделия: по боковому шву около 100 см (44, 48 р.)\r\n• Карманы: в боковых швах\r\n• Застежка: нет\r\n• Особенности: узкая складка по боковому шву\r\n', 'ФЛА-471', NULL, 3270, NULL, 1510, '2017-09-12 20:57:50', '2017-09-12 20:57:50', NULL, 0, 1, '', '', '', '', '', ''),
(267, 0, 9, 0, 'oblegayushaya_trikotazhnaya_yubka_s_molniej_', 'Облегающая трикотажная юбка с молнией', NULL, 12, 'Практичная юбка с ярким штрихом в виде молнии спереди. Такой наряд не останется незамеченным!\r\nСостав: полиэстер 97%, эластан 3%\r\n Пояс: пояс-обтачка\r\n• Посадка: высокая (на линии талии)\r\n• Длина изделия: по спинке около 63 см (44, 48 р.)\r\n• Карманы: нет\r\n• Застежка: молния\r\n• Особенности: металлическая молния с кольцом', 'ФЛА-427', NULL, 2770, NULL, 1260, '2017-09-12 21:03:04', '2017-09-12 21:03:04', NULL, 0, 1, '', '', '', '', '', ''),
(268, 0, 9, 0, 'korotkaya_trikotazhnaya_yubka_s_zapahom', 'Короткая трикотажная юбка с запахом', NULL, 12, 'Очаровательная юбочка с запахом А-образного силуэта. Подойдет для любого базового гардероба.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Пояс: пояс-обтачка\r\n• Посадка: средняя\r\n• Длина изделия: по спинке около 46 см (44 р.), 47 см (48 р.)\r\n• Карманы: нет\r\n• Застежка: пуговицы, петли', 'ФЛА-428', NULL, 2930, NULL, 1340, '2017-09-12 21:10:00', '2017-09-12 21:10:00', NULL, 0, 1, '', '', '', '', '', ''),
(269, 0, 9, 0, 'ukorochennye_zhenskie_bryuki_s_karmanami', 'Укороченные женские брюки с карманами', NULL, 12, 'Укороченные брюки с классической посадкой. По бокам функциональные карманы.\r\nСостав: полиэстер 65%, вискоза 30%, спандекс 5%\r\n• Пояс: притачной\r\n• Посадка: средняя\r\n• Длина изделия: по боковому шву около 88 см (44, 48 р.)\r\n• Карманы: брючные\r\n• Застежка: молния, пуговица', 'ФЛА-472', NULL, 3810, NULL, 1780, '2017-09-12 21:10:35', '2017-09-12 21:10:35', NULL, 0, 1, '', '', '', '', '', ''),
(270, 0, 9, 0, 'udobnyj_sportivnyj_trikotazhnyj_kostyum', 'Удобный спортивный трикотажный костюм', NULL, 12, 'Стильный спортивный костюм из приятного для тела материала. Аккуратные разрезики на брючках и свитшоте привлекают внимание.\r\nСостав: хлопок 98%, эластан 2%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлая\r\n• Пройма плеча: спущенная\r\n• Длина изделия: свитшот: по спинке 55 см (44, 48 р.), брюки: по боковому шву: 90 см (44, 48 р.)\r\n• Пояс: притачной\r\n• Карманы: брючные\r\n• Застежка: нет', 'ФЛА-474', NULL, 5910, NULL, 2830, '2017-09-12 21:19:46', '2017-09-12 21:24:35', NULL, 0, 1, '', '', '', '', '', ''),
(271, 0, 9, 0, 'sportivnyj_kostyum_s_zavyazkami_po_bokam', 'Спортивный костюм с завязками по бокам', NULL, 12, 'Оригинальный спортивный костюм. В комплект входит  стильная кофта с завязками и штаны с карманами.\r\nСостав: хлопок 98%, эластан 2%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлая\r\n• Пройма плеча: спущенная\r\n• Длина изделия: свитшот: по спинке 58 см (44, 48 р.), брюки: по боковому шву: 90 см (44, 48 р.)\r\n• Пояс: притачной\r\n• Карманы: накладные\r\n• Застежка: нет\r\n• Особенности: необработанные края', 'ФЛА-473', NULL, 4750, NULL, 2250, '2017-09-12 21:23:16', '2017-09-12 21:23:16', NULL, 0, 1, '', '', '', '', '', ''),
(272, 0, 9, 0, 'stilnoe_plate_pryamogo_silueta', 'Стильное платье прямого силуэта', NULL, 14, 'Модные платья прямого покроя, которые плавно облегают женский силуэт. Красивые платья прямого покроя – это самое то, если Вы хотите создать сдержанный, но при этом очень стильный деловой образ.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: 3/4, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке 90 см (44 р), 95 см (50 р)\r\n• Застежка: на молнию в среднем шве спинки\r\n', 'ФЛА-102', NULL, 3590, NULL, 1670, '2017-09-13 11:20:53', '2017-09-13 11:20:53', NULL, 0, 1, '', '', '', '', '', ''),
(273, 0, 9, 0, 'zhenskoe_plate_s_v_obraznym_vyrezom', 'Женское платье с V-образным вырезом', NULL, 12, 'Платье женское прилегающего силуэта, из однотонного трикотажного полотна . Модель с V-образным вырезом горловины.\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: 3/4\r\n• Тип горловины: округлая с разрезом\r\n• Тип проймы: втачной\r\n• Длина изделия: по спинке 90 см (44, 50 р)\r\n• Застежка: нет\r\n• Особенности: фигурные рельефные швы', 'ФЛА-105', NULL, 3430, NULL, 1590, '2017-09-13 11:48:54', '2017-09-13 11:52:06', NULL, 0, 1, '', '', '', '', '', ''),
(274, 0, 9, 0, 'stilnoe_plate_iz_kombinirovannoj_tkani', 'Стильное платье из комбинированной ткани', NULL, 11, 'Комбинированные платья - платья из разных тканей или сочетающие несколько цветов. Платья из комбинированных тканей  миди – такие изделия смотрятся эффектно.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый, под обтачку\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке 85 см (44 р), 90 см (50 р)\r\n• Застежка: нет\r\n• Особенности: комбинировано из двух видов ткани', 'ФЛА-108', NULL, 3230, NULL, 1490, '2017-09-13 12:02:02', '2017-09-13 12:02:02', NULL, 0, 1, '', '', '', '', '', ''),
(275, 0, 9, 0, 'modnoe_plate_s_nebolshim_razrezom_', 'Модное платье с небольшим разрезом', NULL, 12, 'Платье с разрезом – стильное решение для любого случая.  Модное платье с длинными рукавами.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: длинный\r\n• Тип горловины: округлый\r\n• Длина изделия: по спинке 100 см (44 р), 108 см (50 р)\r\n• Застежка: нет\r\n• Особенности: шлица в среднем шве спинки, без воротника', 'ФЛА-109', NULL, 2630, NULL, 1190, '2017-09-13 12:15:22', '2017-09-13 12:15:22', NULL, 0, 1, '', '', '', '', '', ''),
(276, 0, 9, 0, 'plate_svobodnogo_silueta_s_zavyazkami_na_talii', 'Платье свободного силуэта с завязками на талии', NULL, 12, 'Стильное платье с завязками, будет отлично сочетаться со спортивной обовью. Платье свободного силуэта подойдет девушкам с любым типом фигуры. \r\nСостав: хлопок 70%, полиэстер 27%, эластан 3%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: до талии – 50 см, длина юбки – 35 см (44, 48 р.)\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: кулиска с завязкой на текстильную ленту, декоративный лампас по рукаву', 'ФЛА-110', NULL, 3430, NULL, 1590, '2017-09-13 12:44:30', '2017-09-13 12:44:30', NULL, 0, 1, '', '', '', '', '', ''),
(277, 0, 9, 0, 'stilnoe_plate_raskleshennoe_k_nizu', 'Стильное платье расклешенное к низу', NULL, 12, 'Платье такого кроя является популярным трендом последних сезонов. Так же прекрасным элементом является низ платья обработанный кружевом.\r\nСостав: полиэстер 67%, вискоза 30%, эластан 3%\r\n• Длина рукава: длинный, втачной, расклешенный\r\n• Тип горловины: округлый, под обтачку\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке 102 см (44, 50 р.)\r\n• Застежка: на молнию в среднем шве спинки, 20 см\r\n• Особенности: низ оформлен кружевом', 'ФЛА-113', NULL, 4150, NULL, 1950, '2017-09-13 13:00:24', '2017-09-13 13:00:24', NULL, 0, 1, '', '', '', '', '', ''),
(278, 0, 9, 0, 'modnaya_tunika_s_asimmetrichnym_nizom', 'Модная туника с асимметричным низом', NULL, 12, 'Модная туника прямого силуэта с асимметричным низом, представленная в оригинальной дизайне. Женские туники - это одежда для женщин всех возрастов и типов фигуры.\r\nСостав: хлопок 70%, полиэстер 27%, эластан 3%\r\n• Длина рукава: длинный, втачной \r\n• Тип горловины: отложной воротник\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 97 см (44 р.), 98 см (48 р.)\r\n• Карманы: нет\r\n• Застежка: пуговицы, петли\r\n•Особенности: воланы, перед короче спинки на 5 см.\r\n', 'ФЛА-116', NULL, 4090, NULL, 1920, '2017-09-13 13:17:58', '2017-09-13 13:17:58', NULL, 0, 1, '', '', '', '', '', ''),
(279, 0, 9, 0, 'modnyj_sarafan_na_perekrestnyh_bretelyah', 'Модный сарафан на перекрестных бретелях', NULL, 12, 'Сарафаны на тонких бретельках всегда притягивают особое внимание.  Стильный сарафан будет отличным дополнение Вашего  гардероба\r\nСостав: полиэстер 67%, вискоза 30%, эластан 3%\r\n• Длина рукава: без рукавов\r\n• Тип горловины: V-образный\r\n• Длина изделия: по спинке общая длина около 104 см (44, 48 р.), от пояса около 76 см (44, 48 р.)\r\n• Длина платья: миди\r\n• Пояс: притачной\r\n• Посадка: завышенная линия талии\r\n• Карманы: нет\r\n• Застежка: молния\r\n• Особенности: перекрестные бретели', 'ФЛА-118', NULL, 3190, NULL, 1470, '2017-09-13 13:31:12', '2017-09-13 13:31:12', NULL, 0, 1, '', '', '', '', '', ''),
(280, 0, 9, 0, 'trikotazhnoe_plate_v_ofisnom_stile', 'Трикотажное платье в офисном стиле', NULL, 10, 'Лаконичное платье прилегающего силуэта отрезное по линии талии. По линии горловины выполнена кокетка. Воротник отложной. Спинка со средним швом, заканчивающимся шлицей, по среднему шву выполнен замок. Рукав втачной длиной 1/2. Длина изделия по спинке около 90 см (44 р), около 92 см (50 р). ', 'ФЛА-812', NULL, 3630, NULL, 1690, '2017-09-13 13:45:41', '2017-09-13 13:45:41', NULL, 0, 1, '', '', '', '', '', ''),
(281, 0, 9, 0, 'molodezhnoe_plate_iz_plotnogo_trikotazha', 'Молодежное платье из плотного трикотажа', NULL, 10, 'Состав: полиэстер 90%, эластан 10%\r\nСовременное платье, выполнено из объемного трикотажа яркой расцветки. Вырез горловины  овальный, рукав длинный. Легкость платью придает расклешенная юбка, выполненная с помощью подрезов. По средней линии спинки выполнена молния. Длина изделия по спинке около 95 см (44 р), около 100 см (50 р)', 'ФЛА-799', NULL, 3630, NULL, 1690, '2017-09-13 13:52:35', '2017-09-13 13:52:35', NULL, 0, 1, '', '', '', '', '', ''),
(282, 0, 9, 0, 'elegantnoe_plate_s_zanizhennoj_liniej_talii', 'Элегантное платье с заниженной линией талии', NULL, 12, 'Заниженная линия талии в сочетании с расклешенной юбкой – весьма популярный фасон. Платье выглядит женственно и элегантно.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: 4/5, втачной\r\n• Тип горловины: округлый\r\n• Длина изделия: по спинке 95 см (44,50 р)\r\n• Застежка: на молнию в среднем шве спинки\r\n• Особенности: платье выполненно во французском стиле: широкая, заниженная линия талии', 'ФЛА-132', NULL, 3030, NULL, 1390, '2017-09-13 13:55:11', '2017-09-13 13:55:11', NULL, 0, 1, '', '', '', '', '', ''),
(283, 0, 9, 0, 'miloe_plate_s_zavyshennoj_taliej', 'Милое платье с завышенной талией', NULL, 12, 'Состав: полиэстер 90%, эластан 10%\r\nСовременное трикотажное платье с завышенной линией талии, оформленное бантом из атласной ленты. Особую легкость  платью придает расклешенная юбка! Длина рукава ¾. Вырез горловины овальный, окантован в цвет банта. По средней линии спинки выполнена молния. Длина изделия по спинке около 92 см (44 р), около 98 см (50 р).', 'ФЛА-798', NULL, 3030, NULL, 1390, '2017-09-13 13:59:20', '2017-09-13 13:59:20', NULL, 0, 1, '', '', '', '', '', ''),
(284, 0, 9, 0, 'trikotazhnoe_plate_s_rukavom_fonarik', 'Трикотажное платье с рукавом фонарик', NULL, 11, 'Состав: полиэстер 90%, эластан 10%\r\nПлатье приталенного силуэта с рельефными вертикальными линиями придающими стройность и элегантность. Укороченный рукав реглан оформлен  в современном стиле "фонарик".  На спинке  по среднему шву выполнен замок. Длина изделия по спинке около 90 см(44 р), около 95 см (50 р). ', 'ФЛА-791', NULL, 1750, NULL, 750, '2017-09-13 14:02:32', '2017-09-13 14:02:32', NULL, 0, 1, '', '', '', '', '', ''),
(285, 0, 9, 0, 'trikotazhnoe_plate_s_potajnymi_karmanami', 'Трикотажное платье с потайными карманами', NULL, 12, 'Состав: вискоза 95%, эластан 5%\r\nПлатье свободного силуэта без застежки ,заужено книзу и оформлено элегантной встречной складкой. Отрезное по линии бедер с потайными карманами. Длина изделия по спинке около 90 см (44 р), около 92 см (48 р).', 'ФЛА-787', NULL, 2950, NULL, 1350, '2017-09-13 14:07:52', '2017-09-13 14:07:52', NULL, 0, 1, '', '', '', '', '', ''),
(286, 0, 9, 0, 'elegantnoe_plate_maksi_bez_rukavov', 'Элегантное платье макси без рукавов', NULL, 10, 'Платья-макси – это удобная одежда на каждый день и на на праздник.  В данном платье Вы не останетесь не замеченной.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: без рукавов\r\n• Тип горловины: округлый\r\n• Длина изделия: по спинке 112 см (44, 50 р)\r\n• Застежка: по спинке на молнию\r\n• Особенности: лиф платья на вискозном подкладе, юбка-полусолнце', 'ФЛА-133', NULL, 5030, NULL, 2390, '2017-09-13 14:11:49', '2017-09-13 14:11:49', NULL, 0, 1, '', '', '', '', '', ''),
(287, 0, 9, 0, 'trikotazhnoe_plate_s_povsednevnom_stile', 'Трикотажное платье с повседневном стиле', NULL, 12, 'Идеальное платье для любого типа фигуры. В зависимости от аксессуаров может быть разноплановым.\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: короткий, цельновыкроенный\r\n• Тип горловины: округлая\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 108 см (44, 48 р.)\r\n• Застежка: нет\r\n• Пояс: без пояса\r\n• Особенности: принт', 'ФЛА-782', NULL, 3030, NULL, 1390, '2017-09-13 14:20:19', '2017-09-13 14:20:19', NULL, 0, 1, '', '', '', '', '', ''),
(288, 0, 9, 0, 'stilnoe_plate_s_ob_emnoj_baskoj', 'Стильное платье с объемной баской', NULL, 12, 'Модные и стильные платья с баской не сходят с пьедестала популярной женской одежды. Платье с баской считается по праву одним из самых элегантных и стильных вариантов.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: 4/5, втачной\r\n• Тип горловины: округлый, под обтачку\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке 100 см (44, 48 р)\r\n• Застежка: на молнию в среднем шве спинки, 50 см\r\n• Особенности: объемная баска из тафты', 'ФЛА-142', NULL, 4950, NULL, 2350, '2017-09-13 14:21:47', '2017-09-13 14:21:47', NULL, 0, 1, '', '', '', '', '', ''),
(289, 0, 9, 0, 'zhenstvennoe_plate_s_ob_emnymi_rukavami', 'Женственное платье с объемными рукавами', NULL, 10, 'Состав: вискоза 95%, эластан 5%\r\nЖенственное платье в классическом стиле. Отрезное по линии талии с защипами по переду. Слегка расширенный рукав собран  на манжету без застежки. По среднему шву спинки выполнен  удлиненный замок. По низу платье слегка заужено,сзади для удобства носки выполнена шлица. Длина изделия по спинке около 100 см (44р),около 105 см (50 р).  Ремень в комплект не входит.', 'ФЛА-781', NULL, 3430, NULL, 1590, '2017-09-13 14:31:17', '2017-09-13 14:31:17', NULL, 0, 1, '', '', '', '', '', ''),
(290, 0, 9, 0, 'elegantnoe_pritalennoe_plate_s_rukavom', 'Элегантное приталенное платье с рукавом', NULL, 10, 'Ткань: костюмная\r\nСостав: хлопок 70%, полиэстер 20%, эластан 10%\r\nСтрогое и одновременно романтичное платье приталенного силуэта. Отрезное по линии талии, слегка расширенные рукава 3/4  собраны на манжету и застегиваются на пуговицу. Украшением платья служит прямая кокетка и симметричные застрочки. По середине спинки  выполнен замок и шлица. Длина изделия по спинке около 92 см (44 р), около 98 см(48 р). Ремень в комплект не входит. ', 'ФЛА-774', NULL, 3030, NULL, 1390, '2017-09-13 14:37:42', '2017-09-13 14:37:42', NULL, 0, 1, '', '', '', '', '', ''),
(291, 0, 9, 0, 'stilnoe_plate_s_atlasnym_poyasom', 'Стильное платье с атласным поясом', NULL, 11, 'Состав: вискоза 95%, эластан 5%\r\nЛаконичное платье прилегающего силуэта. Украшением платья является атласный пояс, вшитый в боковой шов. Короткий втачной рукав. По среднему шву спинки выполнен замок и щлица. Длина изделия по спинке около 92 см (44 р), 100 см (50 р). ', 'ФЛА-154', NULL, 3150, NULL, 1450, '2017-09-13 14:47:38', '2017-09-13 14:47:38', NULL, 0, 1, '', '', '', '', '', ''),
(292, 0, 9, 0, 'trikotazhnoe_plate_s_krupnoj_vstavkoj', 'Трикотажное платье с крупной вставкой', NULL, 11, 'Состав: полиэстер 90%, эластан 10%\r\nРомантичное и яркое платье оформлено крупной вставкой-кокеткой с серебристыми пуговицами. Самый популярный силуэт "татьянка" не сходит с первый позиций модных предложений. Длина изделия по спинке около 95 см (44 р), 100 см (50 р). ', 'ФЛА-772', NULL, 2030, NULL, 890, '2017-09-13 14:55:00', '2017-09-13 14:55:00', NULL, 0, 1, '', '', '', '', '', ''),
(293, 0, 9, 0, 'svobodnoe_plate_s_chehlom_setkoj', 'Свободное платье с чехлом-сеткой', NULL, 10, 'Ткань: сетка стрейч\r\nТкань подклада: трикотаж\r\nСостав: вискоза 95%, эластан 5%\r\nЭлегантное  платье свободного силуэта нежного цвета. Вырез горловины овальный. Рукав спущенный, оформлен  в виде "легкого" валана. Из вискозного полотна выполнен подклад.', 'ФЛА-771', NULL, 2630, NULL, 1190, '2017-09-13 14:59:08', '2017-09-13 14:59:08', NULL, 0, 1, '', '', '', '', '', ''),
(294, 0, 9, 0, 'dlinnoe_plate_yarkoj_rascvetki', 'Длинное платье яркой расцветки', NULL, 11, 'Ткань: трикотаж масло\r\nСостав: полиэстер 90%, эластан 10%\r\nСтильное современное платье "в пол" выполнено из гладкого трикотажа. По линии талии - плотная вставка, в боковом шве предусмотрен замок. Такая деталь платья подчеркнет стройность и элегантность фигуры. \r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый, под обтачку\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке 145 см (44, 48 р)\r\n• Застежка: на молнию в боковом шве, 30 см\r\n• Особенности: по линии талии выполнена плотная вставка\r\n', 'ФЛА-766', NULL, 4230, NULL, 1990, '2017-09-13 15:03:54', '2017-09-13 15:10:06', NULL, 0, 1, '', '', '', '', '', ''),
(295, 0, 9, 0, 'povsednevnaya_tunika_svobodnogo_silueta', 'Повседневная туника свободного силуэта', NULL, 11, 'Состав: вискоза 95%, эластан 5%\r\nТрикотажная туника свободного силуэта. Овальный вырез горловины  и манжет рукава обработаны окантовкой. По боку туники выполнен разрез, перед изделия короче спинки на  3 см. Длина изделия по спинке около 75 см (44 р,48 р).', 'ФЛА-155', NULL, 2830, NULL, 1290, '2017-09-13 15:04:17', '2017-09-13 15:04:17', NULL, 0, 1, '', '', '', '', '', ''),
(296, 0, 9, 0, 'naryadnoe_plate_s_zapahom_iz_satina', 'Нарядное платье с запахом из сатина', NULL, 10, 'Состав: вискоза 95%, эластан 5%\r\nНарядное платье с запахом из вискозного сатина.  Отрезное по линии талии, на резинке. По переду выполнены кокетки, рукав 3/4, оформлен  манжетой  на пуговице. Длина изделия по спинке около 95 см (44 р,50 р). ', 'ФЛА-158', NULL, 2830, NULL, 1290, '2017-09-13 15:18:45', '2017-09-13 15:18:45', NULL, 0, 1, '', '', '', '', '', ''),
(297, 0, 9, 0, 'plate_rubashka_pryamogo_silueta', 'Платье-рубашка прямого силуэта', NULL, 11, 'Платье-рубашка прямого силуэта без пояса. Платье - рубашка прямого силуэта незаменимый наряд для многих случаев.\r\nСостав: хлопок 50%, полиэстер 45%, эластан 5%\r\n• Длина рукава: длинный, втачной, с манжетой, застегивающейся на пуговицы\r\n• Тип горловины: воротник на стойке\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке 96 см (44, 50 р)\r\n• Застежка: на пуговицы\r\n• Особенности: по переду иммитация застежки "фальш-планка", спинка длиннее переда.', 'ФЛА-159', NULL, 3230, NULL, 1490, '2017-09-13 15:37:52', '2017-09-13 15:37:52', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(298, 0, 9, 0, 'trikotazhnoe_plate_s_krugloj_gorlovinoj_', 'Трикотажное платье с круглой горловиной', NULL, 10, 'Элегантное платье расклешенное к низу. Подойдет для создания благородного образа это трикотажное платье лаконичного кроя с  круглой горловиной и укороченными рукавами.\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: круглая, с обтачкой\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке 110 см (44, 48 р)\r\n• Застежка: на молнию в среднем шве спинки\r\n• Особенности: кант по горловине', 'ФЛА-174', NULL, 4430, NULL, 2090, '2017-09-13 16:00:57', '2017-09-13 16:00:57', NULL, 0, 1, '', '', '', '', '', ''),
(299, 0, 9, 0, 'stilnoe_plate_s_figurnoj_liniej_niza', 'Стильное платье с фигурной линией низа', NULL, 12, 'Стильное платье с фигурной линией низа. Основа базового гардероба.\r\nТкань: костюмная стрейч\r\nСостав: хлопок 50%, полиэстер 45%, эластан 5%\r\n• Длина рукава: 3/4, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: 90 см (44 р), 96 см (50 р)\r\n• Силуэт: прямой\r\n• Застежка: нет\r\n• Особенности: фигурная линия низа', 'ФЛА-765', NULL, 3230, NULL, 1490, '2017-09-13 16:03:40', '2017-09-13 16:03:40', NULL, 0, 1, '', '', '', '', '', ''),
(300, 0, 9, 0, 'elegantnoe_plate_prilegayushego_silueta_', 'Элегантное платье прилегающего силуэта', NULL, 11, 'Состав: вискоза 95%, эластан 5%\r\nЛаконичное платье прилегающего силуэта отрезное по линии талии. По линии плеча и талии выполнены геометрические кокетки. Круглый ворот обработан контрастной бейкой. Длинный втачной рукав. Ремень в комплект не входит. Длина изделия по спинке около 90 см (44р, 50р).', 'ФЛА-178', NULL, 2230, NULL, 990, '2017-09-13 16:10:45', '2017-09-13 16:10:45', NULL, 0, 1, '', '', '', '', '', ''),
(301, 0, 9, 0, 'molodezhnoe_plate_s_rukavom_3_4', 'Молодежное платье с рукавом 3/4', NULL, 12, 'Милое платье подчеркивающее фигуру. \r\nТкань: костюмная\r\nСостав: хлопок 50%, полиэстер 45%, эластан 5%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый\r\n• Длина изделия: 96 см (44 р), 102 см (50 р)\r\n• Силуэт: прилегающий\r\n• Застежка: по спинке на молнию\r\n• Особенности: притачная полоса из отделочной ткани по низу изделия\r\nРемень в комплект не входит.', 'ФЛА-760', NULL, 3150, NULL, 1450, '2017-09-13 16:11:35', '2017-09-13 16:11:35', NULL, 0, 1, '', '', '', '', '', ''),
(302, 0, 9, 0, 'pritalennoe_trikotazhnoe_plate_s_rukavom_3_4', 'Приталенное трикотажное платье с рукавом 3/4', NULL, 11, 'Ткань: трикотаж\r\nСостав: вискоза 95%, эластан 5%\r\nПлатье в минималистичном стиле. Приталенный силуэт модели за счет декоративных защипов по линии талии придает стройность. Рукав 3/4 по типу реглан. На спинке изделия замок. Длина изделия по спинке около 95 см (44 р), около 100 см (50 р). ', 'ФЛА-742', NULL, 3550, NULL, 1650, '2017-09-13 16:22:23', '2017-09-13 16:22:23', NULL, 0, 1, '', '', '', '', '', ''),
(303, 0, 9, 0, 'plate_pryamogo_kroya_s_razrezami', 'Платье прямого кроя с разрезами', NULL, 12, 'Прямое платье с разрезами по бокам. Самыми популярными фасонами с интересной отделкой кроя считаются свободные модели.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: короткий, втачной\r\n• Тип горловины: округлый, притачная бейка\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке 112 см (44 р)\r\n• Застежка: нет', 'ФЛА-184', NULL, 3290, NULL, 1520, '2017-09-13 16:25:54', '2017-09-13 16:25:54', NULL, 0, 1, '', '', '', '', '', ''),
(304, 0, 9, 0, 'svobodnoe_trikotazhnoe_plate_v_kletku', 'Свободное трикотажное платье в клетку', NULL, 12, 'Трикотажное платье свободного силуэта. Незаменимая вещь в гардеробе любой модницы!\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: длинный/втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке 85 см (44 р) / 90 см (50 р)\r\n• Застежка: нет', 'ФЛА-735', NULL, 3030, NULL, 1390, '2017-09-13 16:28:12', '2017-09-13 16:28:12', NULL, 0, 1, '', '', '', '', '', ''),
(305, 0, 9, 0, 'stilnoe_plate_rubashka_s_otkrytymi_plechami', 'Стильное платье рубашка с открытыми плечами', NULL, 12, 'Романтичное платье из хлопка с открытыми плечами и удлиненной спинкой. Невероятно стильная вещь!\r\nСостав: хлопок 98%, эластан 2%\r\n• Длина рукава: 3/4\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 108 см (44, 48 р.)\r\n• Застежка: пуговицы\r\n• Особенности: спущенные плечи, спинка длиннее переда на 18 см', 'ФЛА-731', NULL, 3750, NULL, 1750, '2017-09-13 16:34:21', '2017-09-13 16:34:21', NULL, 0, 1, '', '', '', '', '', ''),
(306, 0, 9, 0, 'plate_pryamogo_kroya_bez_zastezhki', 'Платье прямого кроя без застежки', NULL, 10, 'Одним из распространенных фасонов деловых платьев является платье прямого кроя. Платье прямого кроя подойдет абсолютно каждой представительнице женского пола вне зависимости от возраста. \r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: 3/4\r\n• Тип горловины: округлый\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке 92 см (44р), 95 см (48р)\r\n• Застежка: нет\r\n• Особенности: фигурная линия кокетки', 'ФЛА-187', NULL, 2830, NULL, 1290, '2017-09-13 16:37:01', '2017-09-13 16:37:01', NULL, 0, 1, '', '', '', '', '', ''),
(307, 0, 9, 0, 'stilnoe_plate_s_effektnym_vyrezom', 'Стильное платье с эффектным вырезом', NULL, 11, 'Эффектное платье для уверенных дам. Облегающий крой и эффектный вырез подчеркнут все достоинства Вашей фигуры.\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: запах по переду, V-образная\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке 98 см (44, 48 р)\r\n• Застежка: нет', 'ФЛА-721', NULL, 3350, NULL, 1550, '2017-09-13 16:42:21', '2017-09-13 16:42:21', NULL, 0, 1, '', '', '', '', '', ''),
(308, 0, 9, 0, 'molodezhnoe_plate_pryamogo_kroya', 'Молодежное платье прямого кроя', NULL, 12, 'Для девушек предпочитающих платья прямого кроя наверняка будет к чему присмотреться на нашем сайте. стильное платье миди с рукавами 3/4 и боковыми карманами.\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: длинный\r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 90 см (44 р.),  92 см (48 р.)\r\n• Карманы: в боковых швах\r\n• Застежка: нет', 'ФЛА-190', NULL, 3350, NULL, 1550, '2017-09-13 16:45:06', '2017-09-13 16:45:06', NULL, 0, 1, '', '', '', '', '', ''),
(309, 0, 9, 0, 'svobodnoe_trikotazhnoe_plate_s_rukavom_3_4', 'Свободное трикотажное платье с рукавом 3/4', NULL, 12, 'Трикотажное платье ярких оттенков. Прекрасное дополнение для любого гардероба.\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: ¾, цельновыкроенный\r\n• Тип горловины: округлый\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 85 см (44 р.), 90 см (48 р.)\r\n• Силуэт: О-образный\r\n• Карманы: нет\r\n• Застежка: молния', 'ФЛА-719', NULL, 3150, NULL, 1450, '2017-09-13 16:48:49', '2017-09-13 16:48:49', NULL, 0, 1, '', '', '', '', '', ''),
(310, 0, 9, 0, 'elegantnoe_plate_s_razrezami_i_rukavami_3_4', 'Элегантное платье  с разрезами и рукавами 3/4', NULL, 12, 'Платье с рукавом 3/4 с разрезами на каждый день. Платье – это базовый предмет гардероба.\r\nСостав: полиэстер 65%, вискоза 30%, спандекс 5%\r\n• Длина рукава: 3/4, втачной \r\n• Тип горловины: округлая\r\n• Пройма плеча: на естественном месте\r\n• Длина платья: миди\r\n• Длина изделия: по спинке около 114 см (44 р.), 115 см (48 р.)\r\n• Карманы: накладные\r\n• Застежка: молния', 'ФЛА-194', NULL, 4610, NULL, 2180, '2017-09-13 16:53:58', '2017-09-13 16:53:58', NULL, 0, 1, '', '', '', '', '', ''),
(311, 0, 9, 0, 'atlasnaya_bluza_v_vyrezom_lodochka', 'Атласная блуза в вырезом лодочка', NULL, 12, 'Блуза изготовлена из стрейчевого атласа. Модель с короткими рукавами, вырез горловины выполнен в форме "лодочки". Длина изделия по спинке около 65 см (44 р). ', 'ФЛА-206', NULL, 1230, NULL, 490, '2017-09-13 17:03:14', '2017-09-13 17:03:14', NULL, 0, 1, '', '', '', '', '', ''),
(312, 0, 9, 0, 'molodezhnoe_legkoe_plate_s_rukavami_3_4', 'Молодежное легкое платье с рукавами 3/4', NULL, 10, 'Состав: хлопок 100%\r\nМодное платье свободного силуэта. Отрезное по линии талии, на резинке. Вырез горловины округлый, выполнена кружевная кокетка. Втачные рукава 3/4 оформлены окантовкой на резинке. Длина изделия по спинке около 85 см (44,50 р).', 'ФЛА-220', NULL, 2030, NULL, 890, '2017-09-13 17:06:15', '2017-09-13 17:22:25', NULL, 0, 1, '', '', '', '', '', ''),
(313, 0, 9, 0, 'bluza_iz_cvetnogo_atlasa_s_poyaosm', 'Блуза из цветного атласа с пояосм', NULL, 12, 'Состав: полиэстер 90%, эластан 10%\r\nБлуза выполнена из цветного атласа, с рукавами «грибок» и вырезом горловины в форме «лодочка». Общий образ дополняет пояс в цвет изделия. Длина изделия по спинке около 68 см (44 р), около 70 см (50 р). ', 'ФЛА-208', NULL, 2830, NULL, 1290, '2017-09-13 17:10:05', '2017-09-13 17:10:05', NULL, 0, 1, '', '', '', '', '', ''),
(314, 0, 9, 0, 'trikotazhnaya_oblegayushaya_yubka_nizhe_kolen', 'Трикотажная облегающая юбка ниже колен', NULL, 12, 'Трикотажная юбка для романтичных натур.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Пояс: притачной\r\n• Посадка: высокая (на линии талии)\r\n• Длина изделия: по спинке около 75 см (44, 48 р.)\r\n• Застежка: молния\r\n• Особенности: фигурные вытачки, разрез', 'ФЛА-423-10', NULL, 2970, NULL, 1360, '2017-09-13 17:29:33', '2017-09-13 17:29:33', NULL, 0, 1, '', '', '', '', '', ''),
(315, 0, 9, 0, 'stilnaya_zhenskaya_rubashka_v_kletku_', 'Стильная женская рубашка в клетку', NULL, 12, 'Женская рубашка в клетку – это один из вариантов, который можно предложить современной моднице. Рубашки в клетку — модно и практично. \r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: отложной воротник\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 75 см (44 р.), 76 см (48 р.)\r\n• Карманы: накладные\r\n• Застежка: пуговицы, петли', 'ФЛА-210', NULL, 4790, NULL, 2270, '2017-09-13 17:30:37', '2017-09-13 18:04:16', NULL, 0, 1, '', '', 'Рубашка', '', '', ''),
(316, 0, 9, 0, 'top_bez_rukavov_s_abstraktnym_risunkom', 'Топ без рукавов с абстрактным рисунком', NULL, 12, 'Трикотажный топ для романтичных натур\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: без рукавов\r\n• Тип горловины: округлый\r\n• Длина изделия: по спинке около 38 см (44, 48 р.)\r\n• Застежка: молния\r\n• Особенности: фигурные вытачки', 'ФЛА-268-10', NULL, 2430, NULL, 1090, '2017-09-13 17:34:09', '2017-09-18 22:20:08', NULL, 0, 1, '', '', '', '', '', ''),
(317, 0, 9, 0, 'yarkij_top_s_cvetochnym_printom', 'Яркий топ с цветочным принтом', NULL, 12, 'Трикотажный топ для юркого образа.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: без рукавов\r\n• Тип горловины: округлый\r\n• Длина изделия: по спинке около 38 см (44, 48 р.)\r\n• Застежка: молния\r\n• Особенности: фигурные вытачки', 'ФЛА-268-04', NULL, 2430, NULL, 1090, '2017-09-13 17:39:17', '2017-09-13 17:39:17', NULL, 0, 1, '', '', '', '', '', ''),
(318, 0, 9, 0, 'yarkaya_yubka_s_cvetochnym_printom', 'Яркая юбка с цветочным принтом', NULL, 12, 'Эффектная трикотажная юбка для яркого образа.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Пояс: притачной\r\n• Посадка: высокая (на линии талии)\r\n• Длина изделия: по спинке около 75 см (44, 48 р.)\r\n• Застежка: молния\r\n• Особенности: фигурные вытачки, разрез', 'ФЛА-423-04', NULL, 2970, NULL, 1360, '2017-09-13 17:43:21', '2017-09-13 17:43:21', NULL, 0, 1, '', '', '', '', '', ''),
(319, 0, 9, 0, 'stilnaya_bluza_pryamogo_silueta', 'Стильная блуза прямого силуэта', NULL, 12, 'Состав: полиэстер 90%, эластан 10%\r\nБлуза выполнена из  костюмной ткани. Модель с рукавами 3/4, вырез горловины округлый, оформлен отделкой. По переду изделия выполнена элегантная встречная складка Длина изделия по спинке около 63 см (44 р), около 65 см (50 р).', 'ФЛА-212', NULL, 2230, NULL, 990, '2017-09-13 17:44:13', '2017-09-13 17:44:13', NULL, 0, 1, '', '', '', '', '', ''),
(320, 0, 9, 0, 'ukorochennyj_top_na_bretelyah', 'Укороченный топ на бретелях', NULL, 12, 'Эффектный топ на бретелях. Стильный образ для офиса.\r\nСостав: полиэстер 70%, вискоза 30%\r\n• Длина рукава: без рукавов\r\n• Тип горловины: фигурный\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке около 40 см (44, 48 р.)\r\n• Застежка: молния\r\n• Особенности: изделие на подкладке, из костюмной ткани с фактурной поверхностью', 'ФЛА-267', NULL, 2630, NULL, 1190, '2017-09-13 17:52:27', '2017-09-13 17:52:27', NULL, 0, 1, '', '', '', '', '', ''),
(321, 0, 9, 0, 'svobodnaya_rubashka_s_udlinennoj_spinkoj', 'Свободная рубашка с удлиненной спинкой', NULL, 12, 'Хлопковая рубашка на каждый день. Свободный крой и приятная фактура.\r\nСостав: хлопок 100%\r\n• Длина рукава: короткий, втачной\r\n• Тип горловины: отложной воротник\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке около 72 см (44, 48 р.)\r\n• Застежка: пуговицы\r\n• Особенности: манжеты, удлиненная спинка, кокетка по спинке, встречная складка по спинке', 'ФЛА-266', NULL, 3030, NULL, 1390, '2017-09-13 17:58:22', '2017-09-13 18:03:53', NULL, 0, 1, '', '', 'Рубашка', '', '', ''),
(322, 0, 9, 0, 'zhenskaya_rubashka_iz_shelka_s_poyasom', 'Женская рубашка из шелка с поясом', NULL, 12, 'Женская шелковая рубашка идеально подходит как для офисного стиля, так и романтического. Стильная вещь а Ваш гардероб.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: ¾, втачной\r\n• Тип горловины: отложной воротник\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 70 см (44 р.), 71 см (48 р.)\r\n• Пояс: в комплекте\r\n• Карманы: нет\r\n• Застежка: кнопка\r\n• Особенности: пижамный стиль', 'ФЛА-213', NULL, 3710, NULL, 1730, '2017-09-13 18:07:46', '2017-09-13 18:07:46', NULL, 0, 1, '', '', '', '', '', ''),
(323, 0, 9, 0, 'stilnaya_bluza_s_kontrastnoj_otdelkoj', 'Стильная блуза с контрастной отделкой', NULL, 12, 'Блуза из креп-шифона. Отличный офисный вариант.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: длинный, окантовка по низу\r\n• Тип горловины: V-образный вырез\r\n• Тип проймы: втачной\r\n• Длина изделия: по спинке 63 см (44, 48 р.)\r\n• Застежка: нет\r\n• Особенности: отлетные края, декоративная отделка', 'ФЛА-264', NULL, 2630, NULL, 1190, '2017-09-13 18:12:29', '2017-09-13 18:12:29', NULL, 0, 1, '', '', '', '', '', ''),
(324, 0, 9, 0, 'shifonovaya_bluzka_s_zapahom', 'Шифоновая блузка с запахом', NULL, 12, 'Блуза с запахом из блузочного шифона. Будь стильной вместе с нами.\r\nСостав: полиэстер 95%, эластан 5%\r\n• Длина рукава: длинный\r\n• Тип горловины: V-образный вырез\r\n• Тип проймы: втачной\r\n• Длина изделия: по спинке 70 см (44, 48 р), спинка длиннее переда на 10 см\r\n• Застежка: потайная кнопка\r\n• Особенности: с запахом', 'ФЛА-261', NULL, 3350, NULL, 1550, '2017-09-13 18:20:02', '2017-09-13 18:20:02', NULL, 0, 1, '', '', '', '', '', ''),
(325, 0, 9, 0, 'zhenskaya_bluzka_s_volanami_na_rukavah', 'Женская блузка с воланами на рукавах', NULL, 12, 'Женские блузки с воланами олицетворяют нежность, хрупкость, соблазнительность. Легкая женская блуза с воланом внесет разнообразие и озорную нотку в Ваш гардероб.\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: длинный, втачной \r\n• Тип горловины: отложной воротник\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 62 см (44, 48 р.)\r\n• Карманы: нет\r\n• Застежка: пуговицы, петли\r\n•Особенности: воланы', 'ФЛА-214', NULL, 3790, NULL, 1770, '2017-09-13 18:21:12', '2017-09-13 18:21:12', NULL, 0, 1, '', '', '', '', '', ''),
(326, 0, 9, 0, 'bluzka_so_spushennoj_projmoj_i_yarkim_printom', 'Блузка со спущенной проймой и ярким принтом', NULL, 12, 'Свободная блуза из блузочного стрейча. Простая и удобная одежда для любой фигуры.\r\nСостав: полиэстер 95%, эластан 5%\r\n• Длина рукава: 4/5 втачной, притачная манжета\r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке 64 см (44, 48 р)\r\n• Застежка: на петли и пуговицы по переду\r\n• Особенности модели: фигурная форма низа изделия', 'ФЛА-259', NULL, 2630, NULL, 1190, '2017-09-13 18:31:21', '2017-09-13 18:31:21', NULL, 0, 1, '', '', '', '', '', ''),
(327, 0, 9, 0, 'bluza_svobodnogo_silueta_iz_shifona', 'Блуза свободного силуэта из шифона', NULL, 12, 'Состав: полиэстер 90%, эластан 10%\r\nБлуза свободного силуэта изготовлена из шифона с модным цветовым решением. Рукава свободного силуэта "летучая мышь". Низ блузы и низ рукавов собран под окантовку. Длина изделия по спинке около 63 см (44 р), около 65 см (50 р). ', 'ФЛА-218', NULL, 2550, NULL, 1150, '2017-09-13 18:44:22', '2017-09-13 18:44:22', NULL, 0, 1, '', '', '', '', '', ''),
(328, 0, 9, 0, 'majka_s_udlinennoj_spinkoj', 'Майка с удлиненной спинкой', NULL, 12, 'Блуза свободного силуэта, без рукавов. Изготовлена из хлопкового сатина. Оформлена карманом с отделкой. Перед короче спинки на 8 см. Длина изделия по спинке около 72 см (44 р, 50 р).\r\nТкань: сатин\r\nСостав: хлопок 100%', 'ФЛА-255', NULL, 2230, NULL, 990, '2017-09-13 19:07:17', '2017-09-13 19:07:40', NULL, 0, 1, '', '', '', '', '', ''),
(329, 0, 9, 0, 'zhenskaya_rubashka_iz_hlopka_s_rukavami_3_4', 'Женская рубашка из хлопка с рукавами 3/4', NULL, 12, 'Женская рубашка свободного удлиненного кроя. Обращайтесь к нам, и мы подскажем, как оформить заказ быстро и недорого! \r\nСостав: хлопок 100%\r\n• Длина рукава: 3/4, с притачной манжетой\r\n• Тип горловины: воротник на стойке\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке 65 см (44, 50 р)\r\n• Застежка: по переду потайная застежка на пуговицах', 'ФЛА-221', NULL, 3230, NULL, 1490, '2017-09-13 19:09:30', '2017-09-13 19:24:34', NULL, 0, 1, '', '', 'Рубашка', '', '', ''),
(330, 0, 9, 0, 'dvuhcvetnaya_futbolka_iz_satina', 'Двухцветная футболка из сатина', NULL, 12, 'Блуза-туника свободного силуэта, выполнена из хлопкового сатина. Спущенный рукав. Кокетка ниже линии груди, выполнена в контрастном цвете.\r\nТкань: сатин\r\nСостав: хлопок 100%\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке около 70 см (44 р.), 72 см (48 р.) \r\n• Особенности: кокетка ниже линии груди', 'ФЛА-254', NULL, 2430, NULL, 1090, '2017-09-13 19:14:55', '2017-09-13 19:20:30', NULL, 0, 1, '', '', '', '', '', ''),
(331, 0, 9, 0, 'svobodnyj_top_s_milym_printom', 'Свободный топ с милым принтом', NULL, 12, 'Легкий топ прямого силуэта. \r\nТкань: штапель\r\nСостав: хлопок 100%\r\n•     Длина рукава: без рукава\r\n•     Тип горловины: округлый\r\n•     Тип проймы: стандартный\r\n•     Длина изделия:    по спинке около 63 см (44 р), около 65 см (48 р).\r\n•     Застежка: планка с пуговицами\r\n•     Особенности: кокетка с наборкой', 'ФЛА-253', NULL, 2550, NULL, 1150, '2017-09-13 19:27:50', '2017-09-13 19:27:50', NULL, 0, 1, '', '', '', '', '', ''),
(332, 0, 9, 0, 'bluza_pryamogo_silueta_s_risunkom_strekoz', 'Блуза прямого силуэта с рисунком стрекоз', NULL, 11, 'Блузка прямого силуэта, с круглым вырезом горловины. Очаровательная блуза с рисунком стрекоз.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый, окантованный косой бейкой\r\n• Длина изделия: по спинке 65 см (44 р), 68 см (50 р)\r\n• Застежка: на пуговицу по горловине спинки\r\n• Особенности: рукав по низу собран на резинку', 'ФЛА-223', NULL, 2750, NULL, 1250, '2017-09-13 19:29:20', '2017-09-13 19:29:20', NULL, 0, 1, '', '', '', '', '', ''),
(333, 0, 9, 0, 'bluza_pryamogo_silueta_iz_hlopka', 'Блуза прямого силуэта из хлопка', NULL, 12, 'Состав: хлопок 70%, полиэстер 20%, эластан 10%\r\nБлуза прямого силуэта из хлопкового коттона. Короткий рукав заканчивается манжетой. По центру спинки выполнен замок.\r\nДлина изделия по спинке около 67 см (44 р), около 68 см (50 р). ', 'ФЛА-250', NULL, 2230, NULL, 990, '2017-09-13 19:33:30', '2017-09-13 19:33:56', NULL, 0, 1, '', '', '', '', '', ''),
(334, 0, 9, 0, 'bluza_figurnym_vyrezom_po_linii_grudi', 'Блуза фигурным вырезом по линии груди', NULL, 10, 'Состав: полиэстер 90%, эластан 10%\r\nБлуза свободного силуэта c коротким рукавом, изготовлена из яркого крепа и оформлена фигурным вырезом по линии груди. Вырез горловины овальный, обработан бейкой. Длина изделия по спинке ок. 65 см (44 р,50 р)', 'ФЛА-227', NULL, 2830, NULL, 1290, '2017-09-13 19:38:32', '2017-09-13 19:38:32', NULL, 0, 1, '', '', '', '', '', ''),
(335, 0, 9, 0, 'bluza_pryamogo_silueta_iz_atlasa', 'Блуза прямого силуэта из атласа', NULL, 12, 'Ткань: атлас стрейч\r\nСостав: полиэстер 90%, эластан 10%\r\nАтласная блуза прямого силуэта. Рукав короткий. Вырез горловины овальный. По середине спинки выполнен  шов.\r\nДлина изделия по спинке около 65 см (44 р), около 66 см (50 р).', 'ФЛА-248', NULL, 2030, NULL, 890, '2017-09-13 19:38:50', '2017-09-13 19:39:37', NULL, 0, 1, '', '', '', '', '', ''),
(336, 0, 9, 0, 'top_iz_krepa_s_kontrastnoj_otdelkoj', 'Топ из крепа с контрастной отделкой', NULL, 10, 'Ткань: креп стрейч\r\nСостав: полиэстер 90%, эластан 10%\r\nБлуза свободного силуэта изготовлена из крепа и оформлена контрастной отделкой. Вырез горловины овальный, без застежки.  Короткий слегка спущенный  рукав. Длина изделия по спинке около 65 см (44 р ), около 66 см ( 50 р).', 'ФЛА-246', NULL, 2030, NULL, 890, '2017-09-13 19:43:26', '2017-09-13 19:43:26', NULL, 0, 1, '', '', '', '', '', ''),
(337, 0, 9, 0, 'abstraktnaya_bluza_iz_zhatogo_krepa', 'Абстрактная блуза из жатого крепа', NULL, 12, 'Ткань: креп стрейч жатый\r\nСостав: полиэстер 90%, эластан 10%\r\nСовременная блуза свободного силуэта  выполнена с использованием жатого крепа. Манжет удлиненного рукава  и воротник на стойке оформлены контрастным цветом . По спинке -застежка на пуговицу. Длина изделия по спинке около 60 см (44р), около 62 см (50 р).', 'ФЛА-234', NULL, 2030, NULL, 890, '2017-09-13 19:49:10', '2017-09-13 19:49:10', NULL, 0, 1, '', '', '', '', '', ''),
(338, 0, 9, 0, 'bluza_svobodnogo_silueta_iz_krepa_s_rukavom_7_8', 'Блуза свободного силуэта из крепа с рукавом 7/8', NULL, 12, 'Ткань: креп стрейч\r\nСостав: полиэстер 90%, эластан 10%\r\nБлуза свободного силуэта из крепа. Длина рукава 7/8, выполнены на трикотажных манжетах. Длина изделия по спинке около 65 см (44 р), около 68 см (50 р).', 'ФЛА-231', NULL, 2630, NULL, 1190, '2017-09-13 19:54:27', '2017-09-13 19:54:27', NULL, 0, 1, '', '', '', '', '', ''),
(339, 0, 9, 0, 'bluza_svobodnogo_kroya_s_v_obraznym_vyrezom', 'Блуза свободного кроя с V-образным вырезом', NULL, 12, 'Блузка с V-образным вырезом горловины и рукавами 3/4. Блуза свободного силуэта.\r\nСостав: хлопок 70%, полиэстер 27%, эластан 3%\r\n• Длина рукава: 3/4, втачной\r\n• Тип горловины: V-образный\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 59 см (44 р.), 60 см (48 р.)\r\n• Карманы: нет\r\n• Застежка: нет', 'ФЛА-229', NULL, 2970, NULL, 1360, '2017-09-13 19:57:57', '2017-09-13 19:57:57', NULL, 0, 1, '', '', '', '', '', ''),
(340, 0, 9, 0, 'ukorochennyj_top_iz_kostyumnoj_tkani', 'Укороченный топ из костюмной ткани', NULL, 12, 'Стильный топ для современного гардероба.\r\nТкань: костюмная\r\nСостав: полиэстер 67%, вискоза 30%, эластан 3%\r\n• Длина рукава: короткий, втачной \r\n• Тип горловины: округлая\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке около 44 см (44, 48 р.)\r\n• Застежка: молния', 'ФЛА-270', NULL, 2290, NULL, 1020, '2017-09-13 20:03:34', '2017-09-14 23:12:24', NULL, 0, 1, '', '', '', '', '', ''),
(341, 0, 9, 0, 'udlinennaya_bluza_s_kruzhevnoj_vstavkoj', 'Удлиненная блуза с кружевной вставкой', NULL, 12, 'Ткань: трикотаж вискозный\r\nСостав: вискоза 95%, эластан 5%\r\nБлуза свободного силуэта. Декорирована кружевным полотном по линии груди. Спущенный короткий рукав. Линия низа блузы имеет округлую форму. Длина переда короче спинки на 10 см. Длина изделия по спинке около 82 см (44 р,50 р).', 'ФЛА-502', NULL, 2630, NULL, 1190, '2017-09-13 20:16:16', '2017-09-13 20:16:16', NULL, 0, 1, '', '', '', '', '', ''),
(342, 0, 9, 0, 'stilnaya_bluza_iz_zamshi', 'Стильная блуза из замши', NULL, 12, 'Стильная блуза из замши. Идеально впишется в любой деловой гардероб.\r\nТкань: замша\r\nСостав: полиэстер 100%\r\n• Длина рукава: ¾, втачной\r\n• Тип горловины: округлая\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 65 см (44 р.), 66 см (48 р.)\r\n• Застежка: нет', 'ФЛА-503', NULL, 2590, NULL, 1170, '2017-09-13 22:53:40', '2017-09-13 22:53:40', NULL, 0, 1, '', '', '', '', '', ''),
(343, 0, 9, 0, 'stilnaya_kofta_s_vyrezom_v_polosku', 'Стильная кофта с вырезом в полоску', NULL, 12, 'Морская тематика всегда в тренде!\r\nТкань: трикотаж\r\nСостав: полиэстер 95%, эластан 5%\r\n• Длина рукава: длинный\r\n• Тип горловины: V-образный вырез, планки\r\n• Тип проймы: спущенный\r\n• Длина изделия: по спинке 65 см (44, 48 р)\r\n• Застежка: нет\r\n', 'ФЛА-504', NULL, 2830, NULL, 1290, '2017-09-13 23:01:10', '2017-09-13 23:01:10', NULL, 0, 1, '', '', '', '', '', ''),
(344, 0, 9, 0, 'raskleshennaya_bluza_s_udlinennoj_spinkoj', 'Расклешенная блуза с удлиненной спинкой', NULL, 10, 'Ткань: трикотаж\r\nСостав: вискоза 95%, эластан 5%\r\nБлуза-туника выполнена из вискозного трикотажа  в самом современном стиле.  Овальный вырез горловины, рукав укороченный. Силуэт расклешенный , имеет округлую форму по низу. Спинка длиннее переда на 8 см. Длина изделия по спинке около 75 см (44 р), около 78 см (50 р).', 'ФЛА-505', NULL, 2550, NULL, 1150, '2017-09-13 23:08:30', '2017-09-13 23:08:30', NULL, 0, 1, '', '', '', '', '', ''),
(345, 0, 9, 0, 'trikotazhnyj_sviter_s_volanom', 'Трикотажный свитер с воланом', NULL, 12, 'Стильный свитер с ярким декором.\r\nТкань: трикотаж, кашкорсе\r\nСостав: хлопок 97%, эластан 3%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 59 см (44 р.),  60 см (48 р.)\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: волан, необработанный край', 'ФЛА-509', NULL, 3330, NULL, 1540, '2017-09-13 23:17:18', '2017-09-13 23:17:18', NULL, 0, 1, '', '', '', '', '', ''),
(346, 0, 9, 0, 'klassicheskaya_vodolazka_s_dlinnym_rukavom', 'Классическая водолазка с длинным рукавом', NULL, 12, 'Классическая водолазка. Незаменимый атрибут любого делового гардероба.\r\nТкань: трикотаж\r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: воротник-стойка\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 63 см (44, 48 р.)\r\n• Карманы: нет\r\n• Застежка: нет', 'ФЛА-510', NULL, 2590, NULL, 1170, '2017-09-13 23:23:54', '2017-09-13 23:23:54', NULL, 0, 1, '', '', '', '', '', ''),
(347, 0, 9, 0, 'trikotazhnaya_bluza_s_otkrytoj_spinoj', 'Трикотажная блуза с открытой спиной', NULL, 12, 'Красивая блуза с открытой спинкой. Шикарный элемент гардероба.\r\nТкань: трикотаж\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: 3/4, втачной\r\n• Тип горловины: округлая\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 50 см (44 р.), 51 см (48 р.)\r\n• Застежка: нет\r\n• Карманы: нет', 'ФЛА-513', NULL, 3110, NULL, 1430, '2017-09-13 23:31:02', '2017-09-13 23:31:02', NULL, 0, 1, '', '', '', '', '', ''),
(348, 0, 9, 0, 'stilnaya_bluza_s_rukavom_3_4', 'Стильная блуза с рукавом 3/4', NULL, 12, 'Лаконичная блуза для любого гардероба.\r\nТкань: трикотаж\r\nСостав: вискоза 95%, эластан 5%\r\n•     Длина рукава: 3/4 с манжетом\r\n•     Тип горловины: округлая горловина, лацканы\r\n•     Тип проймы: цельнокроенный рукав\r\n•     Длина изделия:    по спинке 63 см (44, 48 р)\r\n•     Застежка: нет\r\n•     Особенности: нет', 'ФЛА-515', NULL, 2030, NULL, 890, '2017-09-13 23:38:58', '2017-09-13 23:38:58', NULL, 0, 1, '', '', '', '', '', ''),
(349, 0, 9, 0, 'zhenskij_zhaket_svobodnogo_kroya', 'Женский жакет свободного кроя', NULL, 10, 'Жакеты уже давно прижились в женском гардеробе.  Жакет свободного силуэта без застежки.\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: длинный\r\n• Тип проймы: втачной\r\n• Длина изделия: по спинке 52 см (44, 50 р)\r\n• Застежка: нет\r\n• Особенности: карманы, драпирующиеся лацканы. Спинка короче переда на 8 см', 'ФЛА-301', NULL, 3550, NULL, 1650, '2017-09-14 10:14:13', '2017-09-14 10:14:13', NULL, 0, 1, '', '', '', '', '', ''),
(350, 0, 9, 0, 'zhenskij_udlinennyj_zhaket_s_karmanami', 'Женский удлиненный жакет с карманами', NULL, 10, 'Женский жакет отлично подойдет для  работы в офисе. Жакет – это базовая вещь в женском гардеробе.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: V-образная\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 76 см (44, 48 р.)\r\n• Карманы: накладные\r\n• Застежка: пуговицы, петли', 'ФЛА-310', NULL, 5450, NULL, 2600, '2017-09-14 10:30:45', '2017-09-14 10:30:45', NULL, 0, 1, '', '', '', '', '', ''),
(351, 0, 9, 0, 'stilnyj_zhaket_bez_zastezhki', 'Стильный жакет без застежки', NULL, 12, 'Модный свободный жакет без застежки. Жакет — стильный и практичный предмет женского гардероба.\r\nСостав: полиэстер 67%, вискоза 30%, эластан 3%\r\n•     Длина рукава: 3/4 с отворотом\r\n•     Тип горловины: воротник отложной, переходящий в лацканы\r\n•     Тип проймы: втачной\r\n•     Длина изделия:    по спинке около 72 см (44, 48 р.)\r\n•     Застежка: нет\r\n•     Особенности: фигурная кокетка\r\n', 'ФЛА-315', NULL, 3630, NULL, 1690, '2017-09-14 10:45:33', '2017-09-14 10:45:33', NULL, 0, 1, '', '', '', '', '', ''),
(352, 0, 9, 0, 'ukorochennyj_zhenskij_zhaket_s_rukavami_3_4', 'Укороченный женский жакет с рукавами 3/4', NULL, 12, 'Жакет женский прямого силуэта силуэта. Укороченный пиджак  должен быть в гардеробе каждой уважающей себя модницы. \r\nСостав: вискоза 95%, эластан 5%\r\n•     Длина рукава: 3/4\r\n•     Тип горловины: округлый\r\n•     Тип проймы: втачной\r\n•     Длина изделия: по спинке около 52 см (44, 48 р)\r\n•     Застежка: нет\r\n•     Особенности: фигурные рельефы, вытачки, подкладка', 'ФЛА-317', NULL, 3750, NULL, 1750, '2017-09-14 10:56:07', '2017-09-14 10:56:07', NULL, 0, 1, '', '', '', '', '', ''),
(353, 0, 9, 0, 'stilnyj_zhaket_pryamogo_silueta', 'Стильный жакет прямого силуэта', NULL, 11, 'Состав: вискоза 95%, эластан 5%\r\nСтильный жакет прямого силуэта без подклада из качественного жаккардового трикотажа. Двубортная застежка на две кнопки. Линия борта и горловины обработаны обтачкой. Оформлен большими накладными карманами. Рукав втачной, удлиненный со спущенной проймой. Длина изделия по спинке около 90 см (44 р), 92 см (50 р). ', 'ФЛА-321', NULL, 6030, NULL, 2890, '2017-09-14 11:08:50', '2017-09-14 11:08:50', NULL, 0, 1, '', '', '', '', '', ''),
(354, 0, 9, 0, 'modnyj_zhenskij_zhaket_oversize', 'Модный женский жакет Oversize', NULL, 12, 'Жакеты достаточно универсальны и используются для создания множества образов. Жакеты есть в гардеробе каждой женщины.\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: отложной воротник\r\n• Длина изделия: по спинке 80 см (44, 48 р.)\r\n• Карманы: прорезные\r\n• Застежка: пуговицы', 'ФЛА-322', NULL, 4870, NULL, 2310, '2017-09-14 11:23:04', '2017-09-14 11:23:04', NULL, 0, 1, '', '', '', '', '', ''),
(355, 0, 9, 0, 'elegantnoe_plate_s_v_obraznym_vyrezom', 'Элегантное платье с v-образным вырезом', NULL, 16, 'Элегантное платье с V-образным вырезом.  Платье прилегающего силэта  – одно из любимых платьев наших покупательниц.\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: 3/4\r\n• Тип горловины: V-образный вырез\r\n• Тип проймы: втачной\r\n• Длина изделия: по спинке 110 см (52, 58 р)\r\n• Застежка: нет\r\n• Особенности: манжета с разрезом на рукаве\r\n', 'ФЛА-2-103', NULL, 4150, NULL, 1950, '2017-09-14 11:50:25', '2017-09-14 14:03:18', NULL, 0, 1, '', '', '', '', '', ''),
(356, 0, 9, 0, 'plate_midi_s_razrezom_na_yubke', 'Платье миди с разрезом на юбке', NULL, 16, 'Прямая юбка с разрезом – классический, универсальный и наиболее распространенный вариант. Длина миди – эталон строгости и официальности.\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: 3/4\r\n• Тип горловины: V-образный вырез\r\n• Тип проймы: спущенный\r\n• Длина изделия: по спинке 102 см (50, 58 р)\r\n• Застежка: нет\r\n• Особенности: кружево по горловине, разрез по низу', 'ФЛА-2-104', NULL, 3830, NULL, 1790, '2017-09-14 12:07:37', '2017-09-14 12:07:37', NULL, 0, 1, '', '', '', '', '', ''),
(357, 0, 9, 0, 'stilnyj_trikotazhnyj_sviter_iz_zhakkarda', 'Стильный трикотажный свитер из жаккарда', NULL, 10, 'Свитшот свободного силуэта. По низу изделия и рукавам выполнены двойные манжеты. При изготовлении данной модели использован плотный трикотаж.\r\nТкань: трикотаж жаккард\r\nСостав: полиэстер 90%, эластан 10%\r\n•     Длина рукава: длинный, на манжете\r\n•     Тип горловины: округлый\r\n•     Тип проймы: спущенный\r\n•     Длина изделия:    по спинке 60 см (44 р), 63 см (48 р)\r\n•     Застежка: нет\r\n•     Особенности: нет\r\n', 'ФЛА-522', NULL, 2630, NULL, 1190, '2017-09-14 12:16:44', '2017-09-14 12:24:19', NULL, 0, 1, '', '', '', '', '', ''),
(358, 0, 9, 0, 'stilnyj_svitshot_s_gipyurovoj_vstavkoj', 'Стильный свитшот с гипюровой вставкой', NULL, 11, 'Ткань: трикотаж\r\nСостав: полиэстер 90%, эластан 10%\r\nМодель свитшота свободного кроя выполнена из плотного трикотажа Диор. Перед изделия двойной - гипюр на трикотаже. Длина изделия по спинке ок.65 см(44р).', 'ФЛА-524', NULL, 2830, NULL, 1290, '2017-09-14 12:22:32', '2017-09-14 12:22:32', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(359, 0, 9, 0, 'plate_prilegayushego_silueta_s_krugloj_gorlovinoj', 'Платье прилегающего силуэта с круглой горловиной', NULL, 17, 'Платье полуприлегающего силуэта с круглым вырезом горловины, с длинными рукавами. Комфортное платье прилегающего силуэта.\r\nСостав: вискоза 95%, эластан 5%\r\n•     Длина рукава: длинный\r\n•     Тип горловины: округлый\r\n•     Тип проймы: спущенный\r\n•     Длина изделия: по спинке 96 см (50, 58 р.)\r\n•     Силуэт: полуприлегающий\r\n•     Застежка: потайная молния\r\n•     Особенности: кокетки из искусственной замши', 'ФЛА-2-105', NULL, 3950, NULL, 1850, '2017-09-14 12:25:21', '2017-09-14 12:25:21', NULL, 0, 1, '', '', '', '', '', ''),
(360, 0, 9, 0, 'viskoznaya_bluza_s_vstavkoj_setkoj', 'Вискозная блуза с вставкой сеткой', NULL, 12, 'Ткань: трикотаж\r\nСостав: вискоза 95%, эластан 5%\r\nКомфортная блуза из плотного вискозного трикотажа, длина рукава ¾. Блуза оформлена кокеткой из трикотажной сетки в цвет изделия. Длина изделия по спинке около 65 см (44 р), около 66 см (50 р)', 'ФЛА-530', NULL, 2230, NULL, 990, '2017-09-14 12:27:52', '2017-09-14 12:27:52', NULL, 0, 1, '', '', '', '', '', ''),
(361, 0, 9, 0, 'legkij_trikotazhnyj_sviter_svobodnogo_kroya', 'Легкий трикотажный свитер свободного кроя', NULL, 12, 'Свободный свитер для базового гардероба.\r\nТкань: трикотаж\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: длинный с притачной манжетой\r\n• Тип горловины: округлый, с притачной бейкой\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке 66 см (44 р.), 68 см (50 р.)\r\n• Застежка: нет\r\n• Особенности: притачной пояс по низу изделия, в комплекте с брошью "герб"', 'ФЛА-533', NULL, 2410, NULL, 1080, '2017-09-14 12:33:18', '2017-09-14 12:33:18', NULL, 0, 1, '', '', '', '', '', ''),
(362, 0, 9, 0, 'povsednevnoe_plate_s_nebolshimi_razrezami', 'Повседневное платье с  небольшими разрезами', NULL, 16, 'Модные платья на каждый день могут быть лаконичных и сдержанных силуэтов. Повседневное платье - для кого-то оно является офисным костюмом, а для кого-то просто повседневная одежда.\r\nСостав: полиэстер 90%, эластан 10%\r\n•     Длина рукава: 3/4\r\n•     Тип горловины: округлый\r\n•     Тип проймы: спущенный\r\n•     Длина изделия: по спинке 98 см (50, 58 р.)\r\n•     Застежка: нет\r\n•     Особенности: кокетка по плечу, разрезы', 'ФЛА-2-106', NULL, 4150, NULL, 1950, '2017-09-14 12:35:51', '2017-09-14 12:35:51', NULL, 0, 1, '', '', '', '', '', ''),
(363, 0, 9, 0, 'bluza_iz_zhakkarda_s_udlinennoj_spinkoj', 'Блуза из жаккарда с удлиненной спинкой', NULL, 12, 'Свободная блуза с удлиненной спинкой.\r\nТкань: трикотаж жаккард\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: короткий, втачной\r\n• Тип горловины: округлый, обработан косой бейкой\r\n• Длина изделия: по спинке 72 см (44, 50 р)\r\n• Застежка: нет\r\n• Особенности: спинка длиннее переда на 8 см', 'ФЛА-534', NULL, 2750, NULL, 1250, '2017-09-14 12:51:40', '2017-09-14 12:51:40', NULL, 0, 1, '', '', '', '', '', ''),
(364, 0, 9, 0, 'plate_midi_s_poyasom_i_rukavami_3_4', 'Платье миди с поясом и рукавами 3/4', NULL, 16, 'Элегантное платье  с рисунком цветов. Платье прилегающего силуэта.\r\nСостав: полиэстер 90%, эластан 10%\r\n•     Длина рукава: до локтя, с отворотом\r\n•     Тип горловины: округлый\r\n•     Тип проймы: цельнокроенный\r\n•     Длина изделия: по спинке 100 см (50, 56 р.)\r\n•     Застежка: потайная молния\r\n•     Особенности: отрезной пояс, сборка по поясу\r\n', 'ФЛА-2-108', NULL, 3950, NULL, 1850, '2017-09-14 12:53:55', '2017-09-14 12:53:55', NULL, 0, 1, '', '', '', '', '', ''),
(365, 0, 9, 0, 'viskoznaya_futbolka_s_kruzhevom', 'Вискозная футболка с кружевом', NULL, 12, 'Летняя футболка с кружевом.\r\nТкань: кружево\r\nТкань подклада: трикотаж\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: короткий, цельновыкроенный\r\n• Тип горловины: округлая\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по переду около 64 см (44 р.), 66 см (48 р.)\r\n• Застежка: нет\r\n• Особенности: полупрозрачная кокетка', 'ФЛА-536', NULL, 2830, NULL, 1290, '2017-09-14 13:05:42', '2017-09-14 13:05:42', NULL, 0, 1, '', '', '', '', '', ''),
(366, 0, 9, 0, 'povsednevnoe_plate_pryamogo_silueta', 'Повседневное платье прямого силуэта', NULL, 17, 'Прямое платье отличает лаконичный и минималистичный дизайн. Благодаря свободному силуэту можно скрыть недостатки фигуры.\r\nСостав: хлопок 98%, эластан 2%\r\n• Длина рукава: 1/2, втачной \r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 103 см (52 р.), 107 см (58 р.)\r\n• Застежка: молния\r\n• Особенности: манжеты, декоративные отстрочки', 'ФЛА-2-110', NULL, 4030, NULL, 1890, '2017-09-14 13:06:08', '2017-09-14 14:02:31', NULL, 0, 1, '', '', '', '', '', ''),
(367, 0, 9, 0, 'sportivnaya_trikotazhnaya_kofta_so_spushennoj_projmoj', 'Спортивная трикотажная кофта со спущенной проймой', NULL, 11, 'Свободная кофта на одно плечо. \r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: длинный, втачной \r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 46 см (44 р.), 47 см (48 р.)\r\n• Застежка: нет\r\n', 'ФЛА-537', NULL, 2570, NULL, 1160, '2017-09-14 13:11:40', '2017-09-14 13:11:40', NULL, 0, 1, '', '', '', '', '', ''),
(368, 0, 9, 0, 'povsednevnoe_plate_midi_s_zapahom', 'Повседневное платье миди  с запахом', NULL, 16, 'Платье миди с запахом и вырезом. Такие платья относят к повседневной одежде. \r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: короткий, втачной\r\n• Тип горловины: V-образный\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 107 см (52 р.), 108 см (58 р.)\r\n• Карманы: в боковых швах\r\n• Застежка: нет', 'ФЛА-2-111', NULL, 7510, NULL, 3630, '2017-09-14 13:18:50', '2017-09-14 14:01:53', NULL, 0, 1, '', '', '', '', '', ''),
(369, 0, 9, 0, 'trikotazhnaya_futbolka_s_udlinennoj_spinkoj', 'Трикотажная футболка с удлиненной спинкой', NULL, 12, 'Стильная футболка свободного кроя.\r\nТкань: трикотаж\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: короткий, втачной \r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 72 см (44 р.), 73 см (48 р.)\r\n• Застежка: нет\r\n• Особенности: манжеты, декоративная брошь, удлиненная спинка', 'ФЛА-538', NULL, 2830, NULL, 1290, '2017-09-14 13:18:52', '2017-09-14 13:18:52', NULL, 0, 1, '', '', '', '', '', ''),
(370, 0, 9, 0, 'svobodnyj_sviter_s_rukavom_do_loktya', 'Свободный свитер с рукавом до локтя', NULL, 17, 'Повседневная кофта полуприлегающего силуэта. Комфорт и удобство.\r\nТкань: трикотаж\r\nСостав: хлопок 70%, полиэстер 27%, эластан 3%\r\n• Длина рукава: 3/4, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 70 см (52 р.), 71 см (58 р.)\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: декоративная брошь\r\n', 'ФЛА-2-517', NULL, 3030, NULL, 1390, '2017-09-14 13:28:53', '2017-09-14 13:28:53', NULL, 0, 1, '', '', '', '', '', ''),
(371, 0, 9, 0, 'plate_iz_zamshi_pryamogo_silueta', 'Платье из замши прямого силуэта', NULL, 17, 'Прекрасный выбор для модниц с пышными формами – платье прямого силуэта из замши. Одним из распространенных фасонов деловых платьев является платье прямого кроя.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: 3/4, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 100 см (52, 58 р.)\r\n• Карманы: нет\r\n• Застежка: молния', 'ФЛА-2-112', NULL, 5370, NULL, 2560, '2017-09-14 13:32:22', '2017-09-14 13:32:22', NULL, 0, 1, '', '', '', '', '', ''),
(372, 0, 9, 0, 'trikotazhnaya_tunika_s_businami', 'Трикотажная туника с бусинами', NULL, 17, 'Свободная трикотажная туника с карманами.\r\nТкань: трикотаж\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 70 см (52 р.), 71 см (58 р.)\r\n• Карманы: в боковых швах\r\n• Застежка: нет', 'ФЛА-2-515', NULL, 3170, NULL, 1460, '2017-09-14 13:36:03', '2017-09-14 13:38:59', NULL, 0, 1, '', '', '', '', '', ''),
(373, 0, 9, 0, 'udobnyj_sviter_s_imitaciej_dvojki', 'Удобный свитер с имитацией двойки', NULL, 17, 'Стильный свитер с имитацией рубашки.\r\nТкань: трикотаж, плательно-костюмная\r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 70 см (52, 58 р.)\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: отделка по низу', 'ФЛА-2-514', NULL, 3210, NULL, 1480, '2017-09-14 13:44:21', '2017-09-14 13:44:21', NULL, 0, 1, '', '', '', '', '', ''),
(374, 0, 9, 0, 'bluzka_iz_shifona_s_v_obraznym_vyrezom', 'Блузка из шифона с V-образным вырезом', NULL, 16, 'Модель приталенного силуэта, с V-образным вырезом горловины. Шифоновая, универсальная, свободная блузка .\r\nСостав: полиэстер 100%\r\n• Длина рукава: длинный, на манжете\r\n• Тип горловины: V-образный вырез\r\n• Тип проймы: втачной\r\n• Длина изделия: по спинке 70 см (50, 58 р), перед короче спинки на 4 см\r\n• Застежка: нет\r\n• Особенности: длинные завязки', 'ФЛА-2-201', NULL, 2950, NULL, 1350, '2017-09-14 13:45:43', '2017-09-14 13:45:43', NULL, 0, 1, '', '', '', '', '', ''),
(375, 0, 9, 0, 'trikotazhnaya_tunika_s_figurnym_nizom', 'Трикотажная туника с фигурным низом', NULL, 17, 'Свободная туника для стильно образа.\r\nТкань: трикотаж\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: 3/4, втачной\r\n• Пройма плеча: обычная\r\n• Тип горловины: V-образный\r\n• Длина изделия: по спинке около 78 см (52, 58 р.)\r\n• Карманы: нет\r\n• Застежка: нет', 'ФЛА-2-512', NULL, 4110, NULL, 1930, '2017-09-14 13:52:54', '2017-09-14 13:52:54', NULL, 0, 1, '', '', '', '', '', ''),
(376, 0, 9, 0, 'bluzka_iz_shifona_s_zavyazkami_na_rukavah', 'Блузка из шифона с завязками на рукавах', NULL, 16, 'Безусловно, новинками 2017 стали блузки из шифона. Эффектно выглядят блузы свободного силуэта из струящихся тканей.\r\nСостав: полиэстер 100%\r\n• Длина рукава: 3/4, на манжете\r\n• Тип горловины: V-образный вырез, стойка\r\n• Тип проймы: втачной\r\n• Длина изделия: по спинке 68 см (52 р), 70 см (58 р)\r\n• Застежка: планка с застежкой на пуговицы\r\n• Особенности: завязки на рукавах', 'ФЛА-2-202', NULL, 3030, NULL, 1390, '2017-09-14 13:56:47', '2017-09-14 14:01:46', NULL, 0, 1, '', '', '', '', '', ''),
(377, 0, 9, 0, 'povsednevnaya_bluzka_pritalennogo_silueta', 'Повседневная блузка приталенного силуэта', NULL, 16, 'Классическая блузка-рубашка приталенного силуэта. Классика вечна, потому что она рациональна.\r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: 3/4\r\n• Тип горловины: округлая, окантованная\r\n• Тип проймы: втачной\r\n• Длина изделия: по спинке 70 см (50, 58 р)\r\n• Застежка: нет\r\n• Особенности: окантованные рельефы, широкая складка\r\n', 'ФЛА-2-203', NULL, 2950, NULL, 1350, '2017-09-14 14:12:11', '2017-09-14 22:41:34', NULL, 0, 1, '', '', '', '', '', ''),
(378, 0, 9, 0, 'povsednevnaya_zhenskaya_tunika_s_rukavami_3_4', 'Повседневная женская туника с рукавами 3/4', NULL, 16, 'Стильная женская туника свободного кроя. Туника с округлым вырезом горловины.\r\nСостав: полиэстер 90%, эластан 10%\r\n•     Длина рукава: 3/4\r\n•     Тип горловины: округлый с разрезом\r\n•     Тип проймы: втачной\r\n•     Длина изделия: по спинке 89 см (50, 58 р.)\r\n•     Застежка: нет\r\n•     Особенности: декоративные отстрочки, разрезы. Спинка длиннее переда на 4 см', 'ФЛА-2-206', NULL, 3230, NULL, 1490, '2017-09-14 14:21:33', '2017-09-14 14:21:33', NULL, 0, 1, '', '', '', '', '', ''),
(381, 0, 9, 0, 'zhenskaya_povsednevnaya_rubashka_na_pugovicah', 'Женская повседневная рубашка на пуговицах', NULL, 16, 'Женские повседневные рубашки прекрасно дополняют гардероб представительниц прекрасного пола. Рубашка свободного силуэта.\r\nСостав: хлопок 70%, полиэстер 27%, эластан 3%\r\n• Длина рукава: короткий, втачной \r\n• Тип горловины: отложной воротник\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке около 90 см (52, 58 р.)\r\n• Застежка: пуговицы\r\n• Особенности: горизонтальная складка', 'ФЛА-2-207', NULL, 3430, NULL, 1590, '2017-09-14 14:34:56', '2017-09-14 14:34:56', NULL, 0, 1, '', '', 'Рубашка', '', '', ''),
(382, 0, 9, 0, 'trikotazhnaya_tunika_s_zavyazkami', 'Трикотажная туника с завязками', NULL, 17, 'Туника для повседневной носки.\r\nТкань: трикотаж\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: 3/4, втачной \r\n• Тип горловины: округлый\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке около 83 см (52 р.), 84 см (58 р.)\r\n• Карманы: нет\r\n• Застежка: нет', 'ФЛА-2-511', NULL, 3550, NULL, 1650, '2017-09-14 14:41:06', '2017-09-14 14:41:06', NULL, 0, 1, '', '', '', '', '', ''),
(383, 0, 9, 0, 'letnyaya_futbolka_s_assimetrichnym_nizom', 'Летняя футболка с ассиметричным низом', NULL, 17, 'Блузка с завязками для создания собственного образа.\r\nТкань: трикотаж\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: короткий, втачной \r\n• Тип горловины: округлая\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке около 80 см (52, 58 р.)\r\n• Застежка: нет\r\n• Особенности: ассиметричный низ с завязками', 'ФЛА-2-509', NULL, 2830, NULL, 1290, '2017-09-14 14:46:36', '2017-09-14 14:46:36', NULL, 0, 1, '', '', '', '', '', ''),
(384, 0, 9, 0, 'klassicheskaya_futbolka_s_razrezami', 'Классическая футболка с разрезами', NULL, 16, 'Свободная футболка с удлиненной спинкой.\r\nТкань: трикотаж\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: короткий, втачной \r\n• Тип горловины: округлая\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 82 см (52, 58 р.)\r\n• Застежка: нет\r\n• Пояс: притачной\r\n• Особенности: удлиненная спинка', 'ФЛА-2-508', NULL, 2830, NULL, 1290, '2017-09-14 14:51:48', '2017-09-14 14:51:48', NULL, 0, 1, '', '', '', '', '', ''),
(385, 0, 9, 0, 'stilnaya_kofta_s_kontrastnoj_otdelkoj', 'Стильная кофта с контрастной отделкой', NULL, 16, 'Кофта с имитацией джемпера надетого на рубашку. Стильно и модно.\r\nТкань: трикотаж жаккард\r\nСостав: полиэстер 90%, эластан 10%\r\n•     Длина рукава: 3/4\r\n•     Тип горловины: V-образный вырез\r\n•     Тип проймы: спущенный\r\n•     Длина изделия: по спинке 72 см (50, 58 р.)\r\n•     Застежка: нет\r\n\r\n', 'ФЛА-2-507', NULL, 2950, NULL, 1350, '2017-09-14 14:58:41', '2017-09-14 14:58:41', NULL, 0, 1, '', '', '', '', '', ''),
(386, 0, 9, 0, 'povsednevnaya_trikotazhnaya_bluza_iz_zhakkarda', 'Повседневная трикотажная блуза из жаккарда', NULL, 17, 'Повседневная блуза с разрезиками. Незаменимая вещь базового гардероба.\r\nТкань: трикотаж жаккард\r\nСостав: полиэстер 70%, вискоза 30%\r\n•     Длина рукава: 3/4\r\n•     Тип горловины: округлый\r\n•     Тип проймы: спущенный\r\n•     Длина изделия: по спинке 67 см (50, 58 р.)\r\n•     Силуэт: полуприлегающий\r\n•     Застежка: нет\r\n•     Особенности: кокетка по плечу, разрезы. Спинка длиннее переда на 6 см', 'ФЛА-2-506', NULL, 3230, NULL, 1490, '2017-09-14 15:04:33', '2017-09-14 15:04:33', NULL, 0, 1, '', '', '', '', '', ''),
(387, 0, 9, 0, 'zhenskaya_bluzka_svobodnogo_silueta_bez_zastezhki', 'Женская блузка свободного силуэта без застежки', NULL, 16, 'Блузка прямого силуэта. Свободный силуэт позволяет скрыть возможные недостатки фигуры.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: 1/2, втачной \r\n• Тип горловины: V-образный\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке около 84 см (52 р.), 86 см (54 р.)\r\n• Застежка: нет\r\n• Особенности: волан\r\n', 'ФЛА-2-208', NULL, 3150, NULL, 1450, '2017-09-14 15:04:52', '2017-09-14 15:04:52', NULL, 0, 1, '', '', '', '', '', ''),
(388, 0, 9, 0, 'bluza_s_korotkim_rukavom_i_drapirovkoj', 'Блуза с коротким рукавом и драпировкой', NULL, 16, 'Красивая блуза с драпировкой по низу. Строго и изящно.\r\nТкань: трикотаж вискозный\r\nСостав: вискоза 95%, эластан 5%\r\n•     Длина рукава: короткий, до локтя\r\n•     Тип горловины: округлый\r\n•     Тип проймы: спущенный\r\n•     Длина изделия: по спинке 72 см (50, 58 р.)\r\n•     Застежка: нет\r\n•     Особенности: драпировка в виде узла по перед', 'ФЛА-2-505', NULL, 2750, NULL, 1250, '2017-09-14 15:17:52', '2017-09-14 15:17:52', NULL, 0, 1, '', '', '', '', '', ''),
(389, 0, 9, 0, 'bluzka_svobodnogo_silueta_na_pugovicah', 'Блузка свободного силуэта на пуговицах', NULL, 17, 'Женская блузка свободного силуэта. Комфортная женская блузка.\r\nСостав: хлопок 98%, эластан 2%\r\n• Длина рукава: 3/4, втачной \r\n• Тип горловины: отложной воротник\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 92 см (52, 58 р.)\r\n• Силуэт: свободный\r\n• Застежка: пуговицы\r\n• Особенности: удлиненная спинка, разрезы', 'ФЛА-2-209', NULL, 2950, NULL, 1350, '2017-09-14 15:23:28', '2017-09-14 15:23:28', NULL, 0, 1, '', '', '', '', '', ''),
(390, 0, 9, 0, 'trikotazhnaya_bluza_s_otdelkoj_iz_ekokozhi', 'Трикотажная блуза с отделкой из экокожи', NULL, 16, 'Блуза с эффектной отделкой. Стильно и со вкусом. \r\nТкань: трикотаж\r\nСостав: вискоза 95%, эластан 5%\r\n•     Длина рукава: длинный, на манжете\r\n•     Тип горловины: округлый\r\n•     Тип проймы: спущенный\r\n•     Длина изделия: по спинке 74 см (50, 58 р.)\r\n•     Застежка: нет\r\n•     Особенности: декоративная отделка "под кожу", разрезы. Спинка длиннее переда на 3 см', 'ФЛА-2-503', NULL, 2950, NULL, 1350, '2017-09-14 15:24:24', '2017-09-14 15:24:24', NULL, 0, 1, '', '', '', '', '', ''),
(391, 0, 9, 0, 'klassicheskaya_udlinennaya_trikotazhnaya_bluza', 'Классическая удлиненная трикотажная блуза', NULL, 17, 'Вискозная блуза удлиненная. Прекрасно скрывает недостатки фигуры. \r\nСостав: вискоза 95%, эластан 5%\r\n•     Длина рукава: длинный\r\n•     Тип горловины: округлый\r\n•     Тип проймы: спущенный\r\n•     Длина изделия: по спинке 73 см (50, 58 р.)\r\n•     Силуэт: полуприлегающий\r\n•     Застежка: нет', 'ФЛА-2-502', NULL, 3430, NULL, 1590, '2017-09-14 15:29:26', '2017-09-14 15:29:26', NULL, 0, 1, '', '', '', '', '', ''),
(392, 0, 9, 0, 'trikotazhnaya_bluza_s_myagkoj_stojkoj', 'Трикотажная блуза с мягкой стойкой', NULL, 16, 'Вискозная блуза полуприлегающего силуэта из фактурного трикотажа.\r\nТкань: трикотаж фактурный\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: 3/4\r\n• Тип горловины: мягкая стойка\r\n• Тип проймы: спущенный\r\n• Длина изделия: по спинке 80 см (52 р.), 82 см (58 р.)\r\n• Застежка: нет\r\n', 'ФЛА-2-501', NULL, 3550, NULL, 1650, '2017-09-14 15:33:01', '2017-09-14 15:33:01', NULL, 0, 1, '', '', '', '', '', ''),
(393, 0, 9, 0, 'zhenskaya_bluzka_s_asimmetrichnym_nizom', 'Женская блузка с асимметричным низом', NULL, 17, 'Блузка асимметричного кроя. Блузы с асимметричным низом очень популярными в 2017 году.\r\nСостав: хлопок 98%, эластан 2%\r\n• Длина рукава: короткий, втачной \r\n• Тип горловины: округлый\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке около 75 см (52 р.), 76 см (58 р.)\r\n• Силуэт: прямой\r\n• Застежка: нет', 'ФЛА-2-210', NULL, 2570, NULL, 1160, '2017-09-14 15:35:31', '2017-09-14 15:35:31', NULL, 0, 1, '', '', '', '', '', ''),
(394, 0, 9, 0, 'stilnaya_zhenskaya_rubashka_oversize', 'Стильная женская рубашка Oversize', NULL, 16, 'Женская рубашка OverSize.  Женская рубашка свободного силуэта.\r\nСостав: хлопок 98%, эластан 2%\r\n• Длина рукава: 3/4, «летучая мышь»\r\n• Тип горловины: отложной воротник\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 86 см (52 р.), 87 см (58 р.)\r\n• Застежка: пуговицы, петли\r\n', 'ФЛА-2-211', NULL, 4070, NULL, 1910, '2017-09-14 16:12:37', '2017-09-14 16:12:37', NULL, 0, 1, '', '', 'Рубашка', '', '', ''),
(395, 0, 9, 0, 'povsednevnaya_zhenskaya_bluzka_s_karmanami', 'Повседневная женская блузка с карманами', NULL, 17, 'Женская блузка – незаменимая вещь вашего гардероба. Повседневный вариант.\r\nСостав: полиэстер 100%\r\n• Длина рукава: короткий, втачной\r\n• Пройма плеча: обычная\r\n• Тип горловины: округлый\r\n• Длина изделия: по спинке около 72 см (52, 58 р.)\r\n• Силуэт: прямой\r\n• Карманы: прорезные\r\n• Застежка: нет', 'ФЛА-2-212', NULL, 2770, NULL, 1260, '2017-09-14 16:23:50', '2017-09-14 16:23:50', NULL, 0, 1, '', '', '', '', '', ''),
(396, 0, 9, 0, 'zhenskaya_rubashka_pryamogo_kroya', 'Женская рубашка прямого кроя', NULL, 16, 'Рубашка женская прямого кроя.Незаменимая вещь в гардеробе.\r\nСостав: хлопок 98%, эластан 2%\r\n• Длина рукава: длинный, втачной\r\n• Пройма плеча: обычная\r\n• Тип горловины: отложной воротник\r\n• Длина изделия: по спинке около 80 см (52, 58 р.)\r\n• Карманы: накладные\r\n• Застежка: пуговицы, петли', 'ФЛА-2-213', NULL, 4450, NULL, 2100, '2017-09-14 16:49:47', '2017-09-14 16:49:47', NULL, 0, 1, '', '', 'Рубашка', '', '', ''),
(397, 0, 9, 0, 'bryuki_v_kletku_na_podkladke', 'Брюки в клетку на подкладке', NULL, 17, 'Удобные брюки на подкладке. Стильно и комфортно\r\nТкань: костюмная\r\nТкань подклада: подкладочная\r\nСостав: полиэстер 90%, эластан 10%\r\n• Тип верха: притачной пояс\r\n• Посадка: средняя\r\n• Длина изделия: по боковому шву около 96 см (52, 58 р.)\r\n• Карманы: брючные\r\n• Застежка: нет', 'ФЛА-2-455', NULL, 4290, NULL, 2020, '2017-09-14 16:53:53', '2017-09-14 16:53:53', NULL, 0, 1, '', '', '', '', '', ''),
(398, 0, 9, 0, 'klassicheskie_bryuki_na_podkladke', 'Классические брюки на подкладке', NULL, 17, 'Классические брюки для офиса. Стильное дополнение гардероба.\r\nТкань: костюмная\r\nТкань подклада: подкладочная\r\nСостав: полиэстер 97%, эластан 3%\r\n• Тип верха: притачной пояс\r\n• Посадка: средняя\r\n• Длина изделия: по боковому шву около 94 см (52 р.), 95 см (58 р.)\r\n• Карманы: брючные\r\n• Застежка: молния', 'ФЛА-2-454', NULL, 4330, NULL, 2040, '2017-09-14 16:59:56', '2017-09-14 16:59:56', NULL, 0, 1, '', '', '', '', '', ''),
(399, 0, 9, 0, 'stilnaya_zhenskaya_bluzka_s_volanami', 'Стильная женская блузка с воланами', NULL, 17, 'Женские стильные блузки – модные решения на все случаи жизни. Блузка: романтично, женственно, стильно, красиво, строго.\r\nСостав: хлопок 70%, полиэстер 27%, эластан 3%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 76 см (52, 58 р.)\r\n• Силуэт: полуприлегающий\r\n• Карманы: нет\r\n• Застежка: завязка по горловине\r\n• Особенности: воланы', 'ФЛА-2-217', NULL, 3690, NULL, 1720, '2017-09-14 17:03:09', '2017-09-14 17:03:09', NULL, 0, 1, '', '', '', '', '', ''),
(400, 0, 9, 0, 'stilnye_bryuki_iz_strejchevoj_kostyumnoj_tkani', 'Стильные брюки из стрейчевой костюмной ткани', NULL, 16, 'Красивые брюки с необычным дополнением в виде завязок.\r\nТкань: костюмная стрейч\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Тип верха: притачной пояс\r\n• Длина изделия: по боковому шву около 96 см (52, 58 р.)\r\n• Силуэт: зауженный к низу\r\n• Застежка: молния\r\n• Особенности: пояс с завязками, брючные карманы\r\n', 'ФЛА-2-452', NULL, 3630, NULL, 1690, '2017-09-14 17:05:58', '2017-09-14 17:05:58', NULL, 0, 1, '', '', '', '', '', ''),
(401, 0, 9, 0, 'klassicheskie_serye_bryuki_s_karmanami', 'Классические серые брюки с карманами', NULL, 16, 'Классические серые брюки для офиса. Классика всегда в моде.\r\nТкань: костюмная стрейч\r\nСостав: хлопок 50%, полиэстер 45%, эластан 5%\r\n•     Тип верха: притачной пояс\r\n•     Длина изделия: по внешнему шву 104 см (50, 58 р.)\r\n•     Силуэт: полуприлегающий, зауженный\r\n•     Застежка: молния, пуговица\r\n•     Особенности: брючные карманы, разрезы\r\n', 'ФЛА-2-451', NULL, 3350, NULL, 1550, '2017-09-14 17:15:58', '2017-09-14 17:15:58', NULL, 0, 1, '', '', '', '', '', ''),
(402, 0, 9, 0, 'zhenskij_zhaket_s_v_obraznym_vyrezom', 'Женский жакет с V-образным вырезом', NULL, 17, 'Женский жакет. Глубокий V-образный вырез горловины переходит в застёжку на пуговицах.\r\nСостав: полиэстер 100%\r\n• Длина рукава: длинный, втачной \r\n• Тип горловины: V-образный\r\n• Пройма плеча: обычная\r\n• Длина изделия: по спинке около 65 см (52, 58 р.)\r\n• Карманы: прорезные\r\n• Застежка: пуговицы, петли', 'ФЛА-2-303', NULL, 5030, NULL, 2390, '2017-09-14 17:18:14', '2017-09-14 17:18:14', NULL, 0, 1, '', '', '', '', '', ''),
(403, 0, 9, 0, 'stilnyj_trench_iz_plashevki', 'Стильный тренч из плащевки', NULL, 16, 'Стильный тренч на подкладке. Модная модель для современного образа.\r\nТкань: плащево-курточная\r\nТкань подклада: подкладочная\r\nСостав: хлопок 70%, полиэстер 27%, эластан 3%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 76 см (52, 58 р.)\r\n• Карманы: прорезные\r\n• Застежка: пуговицы, петли', 'ФЛА-2-306', NULL, 7330, NULL, 3540, '2017-09-14 17:21:56', '2017-09-14 17:21:56', NULL, 0, 1, '', '', '', '', '', ''),
(404, 0, 9, 0, 'zhenskij_zhilet_pryamogo_silueta', 'Женский жилет прямого силуэта', NULL, 17, 'Стильный женский жилет. Одна из самых практичных, универсальных вещей жилет.\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: без рукавов \r\n• Тип горловины: V-образный\r\n• Длина изделия: по спинке около 95 см (52 р.), 96 см (58 р.)\r\n• Пояс: в комплекте\r\n• Карманы: в боковых швах\r\n• Застежка: пуговицы, петли', 'ФЛА-2-304', NULL, 5590, NULL, 2670, '2017-09-14 17:27:25', '2017-09-14 17:32:54', NULL, 0, 1, '', '', '', '', '', ''),
(405, 0, 9, 0, 'trikotazhnyj_zhaket_na_podkladke', 'Трикотажный жакет на подкладке', NULL, 17, 'Стильный трикотажный жакет с карманами подойдет к любому образу.\r\nТкань: трикотаж\r\nТкань подклада: подкладочная\r\nСостав: полиэстер 100%\r\n• Длина рукава: длинный, втачной\r\n• Пройма плеча: обычная \r\n• Тип горловины: V-образный\r\n• Длина изделия: по спинке около 72 см (52, 58 р.)\r\n• Карманы: прорезные\r\n• Застежка: пуговицы, петли', 'ФЛА-2-305', NULL, 4530, NULL, 2140, '2017-09-14 17:29:36', '2017-09-14 17:29:36', NULL, 0, 1, '', '', '', '', '', ''),
(406, 0, 9, 0, 'elegantnyj_dzhemper_pryamogo_silueta_na_pugovicah', 'Элегантный джемпер прямого силуэта на пуговицах', NULL, 12, 'Состав: шерсть 50%, акрил 50%\r\nЭлегантный вязаный джемпер прямого силуэта на пуговицах. Прекрасное повседневное решение. Длина изделия по спинке около 62 см (44 р),около 67см (50р). ', 'ФЛА-9101', NULL, 2550, NULL, 1150, '2017-09-14 17:50:00', '2017-09-14 17:51:34', NULL, 0, 1, '', '', '', '', '', ''),
(407, 0, 9, 0, 'vyazanyj_dvuhcvetnyj_dzhemper_s_dlinnymi_rukavami', 'Вязаный двухцветный джемпер с длинными рукавами', NULL, 12, 'Состав: акрил 100%\r\nВязаный двухцветный джемпер с длинными рукавами и округлым вырезом горловины. Резинки по горловине, рукавам, низу изделия и треугольные вставки по бокам выполнены из меланжированной пряжи. Длина изделия по спинке около 62 см (44 р), около 64 см (50р).', 'ФЛА-9111', NULL, 2230, NULL, 990, '2017-09-14 17:54:48', '2017-09-14 17:54:48', NULL, 0, 1, '', '', '', '', '', ''),
(408, 0, 9, 0, 'legkij_kardigan_s_korotkim_rukavom', 'Легкий кардиган с коротким рукавом', NULL, 12, 'Состав: акрил 100%\r\nКардиган связан из меланжированной пряжи светлого цвета фактурным способом. Горловина и полочки кардигана оформлены бейкой. По переду выполнены большие карманы. Оригинальное выполнение спинки и боковые разрезы придают легкому кардигану особую пикантность. Длина изделия по спинке около 86 см (44 р), около 88 см (50р).', 'ФЛА-9112', NULL, 2630, NULL, 1190, '2017-09-14 20:04:39', '2017-09-14 20:04:39', NULL, 0, 1, '', '', '', '', '', ''),
(409, 0, 9, 0, 'melanzhirovannyj_dzhemper_vypolnen_po_tipu_vodolazki', 'Меланжированный джемпер выполнен по типу водолазки', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nМеланжированный джемпер выполнен по типу водолазки. Воротник "гольф", манжеты рукавов и низ изделия оформлен в рубчик. Длина изделия по спинке около 62 см (44 р), около 64 см (50р).', 'ФЛА-9113', NULL, 2430, NULL, 1090, '2017-09-14 20:11:11', '2017-09-14 20:11:11', NULL, 0, 1, '', '', '', '', '', ''),
(410, 0, 9, 0, 'vyazanoe_plate_iz_smesovoj_melanzhevoj_pryazhi', 'Вязаное платье из смесовой меланжевой пряжи', NULL, 12, 'Вязаное платье выполнено из смесовой меланжевой пряжи. Платье свободного силуэта с длиной рукава 3/4. Воротник выполнен в виде стойки в рубчик. Длина изделия по спинке около 91 см (44 р),около 94 см (50 р). \r\nСостав: вискоза 80%, акрил 20%', 'ФЛА-9114', NULL, 1830, NULL, 790, '2017-09-14 20:15:07', '2017-09-14 20:15:07', NULL, 0, 1, '', '', '', '', '', ''),
(411, 0, 9, 0, 'vyazanyj_dzhemper_s_rukavami_3_4', 'Вязаный джемпер с рукавами 3/4', NULL, 12, 'Состав: шерсть 50%, акрил 50%\r\nВязаный джемпер с рукавами 3/4. Округлый вырез горловины. Рукава и низ джемпера оформлены фактурной окантовкой. ', 'ФЛА-9136', NULL, 2230, NULL, 990, '2017-09-14 20:18:54', '2017-09-14 20:18:54', NULL, 0, 1, '', '', '', '', '', ''),
(412, 0, 9, 0, 'vyazannoe_plate_midi_s_vorotnikom_stojka', 'Вязанное платье миди с воротником стойка', NULL, 12, 'Вязанное трикотажное платье "миди" с воротником стойка. Выполнено из меланжированной пряжи. Длина изделия по спинке около 108 см (44 р,50 р). \r\nСостав: акрил 100%', 'ФЛА-9137', NULL, 2630, NULL, 1190, '2017-09-14 20:22:10', '2017-09-14 20:22:10', NULL, 0, 1, '', '', '', '', '', ''),
(413, 0, 9, 0, 'vyazanaya_yubka_s_fakturnoj_vyazkoj', 'Вязаная юбка с фактурной вязкой', NULL, 12, 'Вязаная юбка выполнена тонкой фактурной вязкой. По центру спинки шлица. Длина изделия по спинке около 78 см (44 р, 50 р).\r\nСостав: акрил 100%', 'ФЛА-9140', NULL, 2230, NULL, 990, '2017-09-14 20:26:16', '2017-09-14 20:26:16', NULL, 0, 1, '', '', '', '', '', ''),
(414, 0, 9, 0, 'tunika_plate_iz_tonkoj_pryazhi', 'Туника платье из тонкой пряжи', NULL, 12, 'Состав: акрил 100%\r\nВязаная туника выполнена  из  тонкой  трикотажной пряжи актуального модного цвета. Низ изделия имеет овальную форму, по бокам выполнены разрезы.  Длина изделия по спинке около 90 см (44 р, 50 р)', 'ФЛА-9141', NULL, 2030, NULL, 890, '2017-09-14 20:47:20', '2017-09-14 20:47:20', NULL, 0, 1, '', '', '', '', '', ''),
(415, 0, 9, 0, 'vyazanyj_dzhemper_iz_smesovoj_pryazhi', 'Вязаный джемпер из смесовой пряжи', NULL, 11, 'Состав: шерсть 50%, акрил 50%\r\nВязаный джемпер выполнен из смесовой пряжи меланжевого цвета фактурным способом. Округлый вырез горловины и низ рукавов оформленны резинкой в рубчик. Рукав 1/2 со спущенной проймой. Низ изделия имеет овальную форму с небольшими разрезами по бокам и оформлен резинкой в рубчик. Длина изделия по спинке около 71 см (44 р), около 73 см (50 р). ', 'ФЛА-9145', NULL, 2430, NULL, 1090, '2017-09-14 20:54:18', '2017-09-14 20:54:18', NULL, 0, 1, '', '', '', '', '', ''),
(416, 0, 9, 0, 'klassicheskij_kardigan_s_udlinennoj_spinkoj', 'Классический кардиган с удлиненной спинкой', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nКардиган связан фактурным способом. Полочки кардигана оформлены широкой бейкой. По переду выполнены оригинальные цельновязанные карманы. Рукав удлиненный со спущеной проймой. По боковым швам выполнены разрезы. Спинка длиннее переда на 5 см. Длина изделия по спинке около 72 см (44, 50 р). ', 'ФЛА-9147', NULL, 2830, NULL, 1290, '2017-09-14 21:08:01', '2017-09-14 21:08:01', NULL, 0, 1, '', '', '', '', '', ''),
(417, 0, 9, 0, 'vyazanaya_tunika_svobodnogo_silueta', 'Вязаная туника свободного силуэта', NULL, 12, 'Вязаная туника свободного силуэта выполнена из мелажированной пряжи. Рукав удлиненный, пройма рукава спущена. Овальный вырез горловины, низ рукавов и низ изделия оформлены контрастной отделкой. Длина изделия по спинке около 70 см (44, 50 р). \r\nСостав: акрил 70%, шерсть 30%', 'ФЛА-9149', NULL, 2750, NULL, 1250, '2017-09-14 21:14:07', '2017-09-14 21:14:07', NULL, 0, 1, '', '', '', '', '', ''),
(418, 0, 9, 0, 'udlinennyj_kardigan_svobodnogo_silueta_bez_zastezhki', 'Удлиненный кардиган свободного силуэта без застежки', NULL, 12, 'Состав: шерсть 50%, акрил 50%\r\nУдлиненный кардиган свободного силуэта без застежки. Полочки обработаны узкой бейкой и оформлены крупными накладными карманами. Рукава и низ изделия украшает широкая резинка в рубчик. По бокам выполнены удлиненные разрезы. Длина изделия по спинке около 91 см (44 р), около 94 см (50 р). ', 'ФЛА-9152', NULL, 3150, NULL, 1450, '2017-09-14 21:26:49', '2017-09-14 21:26:49', NULL, 0, 1, '', '', '', '', '', ''),
(419, 0, 9, 0, 'vyazannoe_trikotazhnoe_plate_v_krupnuyu_polosku', 'Вязанное трикотажное платье в крупную полоску', NULL, 12, 'Состав: хлопок 50%, акрил 50%\r\nВязанное трикотажное платье "миди" в крупную полоску. Выполнено с укороченным рукавом и округлым воротником. Длина изделия по спинке около 111 см (44, 48 р.)', 'ФЛА-9153', NULL, 2950, NULL, 1350, '2017-09-14 21:46:10', '2017-09-14 21:46:10', NULL, 0, 1, '', '', '', '', '', ''),
(420, 0, 9, 0, 'vyazannyj_zhilet_svobodnogo_silueta', 'Вязанный жилет свободного силуэта', NULL, 12, 'Вязанный жилет свободного силуэта в стиле "oversize". V-образный вырез горловины и низ изделия оформленны резинкой в рубчик. По бокам выполнены разрезы. Длина изделия по спинке около 68 см (44 р), 70 см (50 р).\r\nСостав: акрил 100%', 'ФЛА-9156', NULL, 2430, NULL, 1090, '2017-09-14 21:49:48', '2017-09-14 21:49:48', NULL, 0, 1, '', '', '', '', '', ''),
(421, 0, 9, 0, 'vyazanyj_dvuhcvetnyj_dzhemper', 'Вязаный двухцветный джемпер', NULL, 12, 'Вязаный двухцветный джемпер в стиле "oversize" с длинными рукавами. Горловина изделия выполнена в виде "лодочки" и оформлена бейкой. Длина изделия по спинке около 66 см (44 р), около 68 см (50 р). \r\nСостав: шерсть 50%, акрил 50%', 'ФЛА-9157', NULL, 2830, NULL, 1290, '2017-09-14 21:57:02', '2017-09-14 21:57:02', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(427, 0, 9, 0, 'zhenskij_zhilet_svobodnogo_silueta', 'Женский жилет свободного силуэта', NULL, 12, 'Состав: акрил 100%\r\nВязанный жилет свободного силуэта. Вырез горловины и пройма рукава обработаны двойной резинкой в рубчик. Низ изделия оформлен закруткой, по бокам выполнены разрезы. Спинка длиннее переда на 7см. Длина изделия по спинке около 68 см (44 р.), 70 см (48 р.)', 'ФЛА-9158', NULL, 2430, NULL, 1090, '2017-09-15 10:50:24', '2017-09-15 10:50:24', NULL, 0, 1, '', '', '', '', '', ''),
(428, 0, 9, 0, 'vyazannyj_zhenskij_zhilet_bez_zastezhki', 'Вязанный женский жилет без застежки', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nВязанный удлиненный жилет свободного силуэта без застежки. Полочки жилета и пройма рукава оформлены двойной резинкой "в рубчик". По бокам изделия выполнены большие накладные карманы. Длина изделия по спинке около 90 см (44, 48 р.)', 'ФЛА-9159', NULL, 3230, NULL, 1490, '2017-09-15 11:03:00', '2017-09-15 11:03:00', NULL, 0, 1, '', '', '', '', '', ''),
(429, 0, 9, 0, 'udlinennyj_kardigan_svobodnogo_silueta_v_polosku', 'Удлиненный кардиган свободного силуэта в полоску', NULL, 12, 'Состав: шерсть 50%, акрил 50%\r\nУдлиненный кардиган свободного силуэта в полоску без застежки. Полочки обработаны узкой бейкой. Рукав удлиненный, линия плеча спущена. По бокам выполнены разрезы. Длина изделия по спинке около 87 см (44 р), около 89 см (50 р). ', 'ФЛА-9160', NULL, 3230, NULL, 1490, '2017-09-15 11:11:33', '2017-10-02 18:50:21', NULL, 0, 1, '', '', '', '', '', ''),
(430, 0, 9, 0, 'zhenskij_vyazannyj_dzhemper_v_polosku', 'Женский вязанный джемпер в полоску', NULL, 12, 'Состав: шерсть 50%, акрил 50%\r\nВязаный джемпер в крупную полоску со спущенной проймой рукава длиной 3/4. Вырез горловины овальный и оформлен бейкой. Длина изделия по спинке около 67 см (44 р), около 68 см (50 р).', 'ФЛА-9162', NULL, 2830, NULL, 1290, '2017-09-15 11:29:42', '2017-09-15 11:29:42', NULL, 0, 1, '', '', '', '', '', ''),
(431, 0, 9, 0, 'vyazannoe_plate_pryamogo_silueta', 'Вязанное платье прямого силуэта', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nВязаное платье выполнено из меланжевой пряжи. Вырез горловины овальный, низ изделия и низ рукавов оформлен широкой резинкой в рубчик. Длина изделия по спинке около 88 см (44 р), около 90 см (50 р). ', 'ФЛА-9164', NULL, 3230, NULL, 1490, '2017-09-15 11:44:16', '2017-09-15 11:44:16', NULL, 0, 1, '', '', '', '', '', ''),
(432, 0, 9, 0, 'vyazanyj_dzhemper_svobodnogo_silueta_', 'Вязаный джемпер свободного силуэта', NULL, 7, 'Состав: акрил 70%, шерсть 30%\r\nВязаный джемпер свободного силуэта в стиле "oversize". Вырез горловины овальный. Рукав со спущенной проймой длиной 3/4, по низу оформлен цельновязанной манжетой. По переду изделия выполнены накладные карманы.Длина изделия по спинке около 56 см (44 р), около 57 см (50 р).', 'ФЛА-9165', NULL, 2630, NULL, 1190, '2017-09-15 11:52:36', '2017-09-15 12:03:03', NULL, 0, 1, '', '', '', '', '', ''),
(433, 0, 9, 0, 'udlinennyj_dzhemper_svobodnogo_silueta', 'Удлиненный джемпер свободного силуэта', NULL, 12, 'Состав: акрил 100%\r\nУдлиненный джемпер свободного силуэта в стиле "oversize". Вырез горловины овальный, оформлен резинкой в рубчик. Рукав со спущенной проймой длиной 3/4, по низу оформлен цельновязанной манжетой. По переду изделия выполнены крупные накладные карманы. Длина изделия по спинке 70 см (44, 50 р)', 'ФЛА-9166', NULL, 2630, NULL, 1190, '2017-09-15 12:08:40', '2017-09-15 12:08:40', NULL, 0, 1, '', '', '', '', '', ''),
(434, 0, 9, 0, 'vyazannoe_plate_sarafan_svobodnogo_silueta_', 'Вязанное платье-сарафан свободного силуэта', NULL, 7, 'Состав: акрил 70%, шерсть 30%\r\nВязанное платье-сарафан свободного силуэта в стиле "oversize". По переду изделия выполнены большие накладные карманы. Пройма рукава и горловины оформлена двойной резинкой "в рубчик". По боковым швам выполнены разрезы. Длина изделия по спинке около 90 см (44, 50 р).', 'ФЛА-9167', NULL, 3150, NULL, 1450, '2017-09-15 12:23:01', '2017-09-15 12:36:20', NULL, 0, 1, '', '', '', '', '', ''),
(435, 0, 9, 0, 'vyazannyj_udlinennyj_zhilet_svobodnogo_silueta', 'Вязанный удлиненный жилет свободного силуэта', NULL, 12, 'Состав: акрил 100%\r\nВязанный удлиненный жилет свободного силуэта. Вырез горловины V-образный. Горловина жилета и пройма рукава оформлены резинкой. Особенностью данной модели являются разрезы по бокам изделия. Длина изделия по спинке около 97 см (44 р.),  98 см (48 р.). Спинка длиннее переда на 15 см.', 'ФЛА-9190', NULL, 2550, NULL, 1150, '2017-09-15 12:38:11', '2017-09-15 12:38:11', NULL, 0, 1, '', '', '', '', '', ''),
(436, 0, 9, 0, 'vyazanyj_zhenskij_kardigan_bez_zastezhki', 'Вязаный женский кардиган  без застежки', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nВязаный кардиган свободного силуэта без застежки. Выполнен объемной фактурной вязкой. Рукава длинной 3/4, со спущенной проймой. Полочки кардигана оформлены широкой бейкой. По переду изделия выполнены большие накладные карманы. Длина изделия по спинке около 72 см (44 р.), 73 см (50 р.).', 'ФЛА-9169', NULL, 3430, NULL, 1590, '2017-09-15 12:43:20', '2017-09-15 12:43:20', NULL, 0, 1, '', '', '', '', '', ''),
(437, 0, 9, 0, 'udlinennyj_kardigan_svobodnogo_silueta', 'Удлиненный кардиган свободного силуэта', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nУдлиненный кардиган свободного силуэта выполнен из меланжированной пряжи. Длинный рукав с зафиксированным подворотом, пройма плеча спущена. По бокам изделия выполнены накладные карманы. Длина изделия по спинке около 95 см (44, 48 р).', 'ФЛА-9191', NULL, 3430, NULL, 1590, '2017-09-15 12:43:46', '2017-09-15 12:43:46', NULL, 0, 1, '', '', '', '', '', ''),
(438, 0, 9, 0, 'vyazanyj_tonkij_dzhemper_svobodnogo_silueta', 'Вязаный тонкий джемпер свободного силуэта', NULL, 12, 'Состав: акрил 100%\r\nВязаный тонкий джемпер свободного силуэта. Овальная горловина изделия оформлена резинкой в рубчик. Рукав 1/2 со спущенной проймой. По боку изделия выполнен накладной карман. Длина изделия по спинке около 64 см (44 р.), 65 см (50 р).', 'ФЛА-9189', NULL, 2230, NULL, 990, '2017-09-15 12:47:21', '2017-09-15 12:47:21', NULL, 0, 1, '', '', '', '', '', ''),
(439, 0, 9, 0, 'vyazanyj_sviter_svobodnogo_silueta', 'Вязаный свитер свободного силуэта', NULL, 12, 'Состав: акрил 100%\r\nВязаный свитер свободного силуэта выполнен из пряжи меланжевого цвета. Воротник-стойка, рукав удлиненный, пройма плеча спущенная. Манжеты рукавов и низ изделия оформлены в рубчик. Длина изделия по спинке около 63 см (44 р), около 65 см (48 р).', 'ФЛА-9170', NULL, 2830, NULL, 1290, '2017-09-15 12:51:13', '2017-09-15 12:51:13', NULL, 0, 1, '', '', '', '', '', ''),
(440, 0, 9, 0, 'vyazanyj_tonkij_dzhemper_s_rukavom_3_4', 'Вязаный тонкий джемпер с рукавом 3/4', NULL, 12, 'Состав: акрил 100%\r\nВязаный тонкий джемпер свободного силуэта. Овальная горловина изделия оформлена резинкой в рубчик. Рукав 3/4 со спущенной проймой. Длина изделия по спинке около 61 см (44, 50 р). \r\n', 'ФЛА-9187', NULL, 2150, NULL, 950, '2017-09-15 12:53:26', '2017-09-15 12:53:26', NULL, 0, 1, '', '', '', '', '', ''),
(441, 0, 9, 0, 'zhenskij_dzhemper_svobodnogo_kroya', 'Женский джемпер свободного кроя', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nВязанный джемпер свободного силуэта из меланжированной пряжи. Рукав удлиненный со спущенной проймой, низ изделия присобран на резинку. Длина изделия по спинке около 72 см (44 р), около 75 см (50 р).', 'ФЛА-9173', NULL, 2550, NULL, 1150, '2017-09-15 12:58:39', '2017-09-15 12:58:39', NULL, 0, 1, '', '', '', '', '', ''),
(442, 0, 9, 0, 'myagkij_vyazannyj_kardigan_iz_pryazhi', 'Мягкий вязанный кардиган из пряжи', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nМягкий вязанный кардиган из фактурной меланжированной пряжи. Воротник отложной в форме лацкана. По бокам изделия выполнены накладные карманы. Длина изделия по спинке около 90 см (44, 50 р).', 'ФЛА-9185', NULL, 3750, NULL, 1750, '2017-09-15 12:58:59', '2017-09-15 12:58:59', NULL, 0, 1, '', '', '', '', '', ''),
(443, 0, 9, 0, 'svobodnyj_sviter_s_rukavom_3_4', 'Свободный свитер с рукавом 3/4', NULL, 12, 'Состав: акрил 100%\r\nДжемпер свободного силуэта связан фактурной вязкой. Вырез горловины овальный, рукав 3/4 со спущенной проймой. По бокам изделия выполнены фигурные разрезы, обработанные под оверлок. Длина изделия по спинке около 67 см (44, 50 р). ', 'ФЛА-9184', NULL, 2710, NULL, 1230, '2017-09-15 13:02:11', '2017-09-15 13:02:11', NULL, 0, 1, '', '', '', '', '', ''),
(444, 0, 9, 0, 'zhenskij_dzhemper_svobodnogosilueta', 'Женский джемпер свободногосилуэта', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nВязаный джемпер свободного силуэта выполнен фактурным способом. Вырез горловины - овальный, рукав удлиненный со спущенной проймой. Горловина, низ рукавов и низ изделия оформлены резинкой в рубчик. Длина изделия по спинке около 68 см (44, 50 р).', 'ФЛА-9179', NULL, 2710, NULL, 1230, '2017-09-15 13:04:09', '2017-09-15 13:04:09', NULL, 0, 1, '', '', '', '', '', ''),
(445, 0, 9, 0, 'svobodnyj_dzhemper_fakturnoj_vyazki', 'Свободный джемпер фактурной вязки', NULL, 10, 'Состав: акрил 100%\r\nДжемпер свободного силуэта связан фактурной вязкой. Вырез горловины овальный, рукав удлиненный втачной со смещенной проймой. По бокам изделия выполнены разрезы. Длина изделия по спинке около 62 см (44, 48 р). \r\n', 'ФЛА-9183', NULL, 2550, NULL, 1150, '2017-09-15 13:06:48', '2017-09-15 13:06:48', NULL, 0, 1, '', '', '', '', '', ''),
(446, 0, 9, 0, 'svobodnyj_kardigan_v_stile_oversize_', 'Свободный кардиган в стиле "oversize"', NULL, 12, 'Состав: шерсть 50%, акрил 50%\r\nБазовая вещь любого гардероба. Свободный кардиган в стиле "oversize". Полочки обработаны узкой бейкой. Рукав со спущенной проймой, длиной 7/8, оформлен цельновязанной манжетой. Длина изделия по спинке около 75 см (44 р), 77 см (50 р). ', 'ФЛА-9181', NULL, 3030, NULL, 1390, '2017-09-15 13:10:10', '2017-09-15 13:10:10', NULL, 0, 1, '', '', '', '', '', ''),
(447, 0, 9, 0, 'vyazanyj_zhaket_kurtka_svobodnogo_silueta_', 'Вязаный жакет-куртка свободного силуэта', NULL, 11, 'Состав: акрил 70%, шерсть 30%\r\nВязаный жакет-куртка свободного силуэта без застежки. Вырез горловины овальный, воротник - стойка. Удлиненный рукав со спущенной проймой. По переду изделия выполнены большие накладные карманы. Низ изделия по спинке присобран на широкую резинку. Длина изделия по спинке около 60 см (44, 48 р).', 'ФЛА-9180', NULL, 3610, NULL, 1680, '2017-09-15 13:10:54', '2017-09-15 13:10:54', NULL, 0, 1, '', '', '', '', '', ''),
(449, 0, 9, 0, 'tonkij_dzhemper_svobodnogo_silueta', 'Тонкий джемпер свободного силуэта', NULL, 12, 'Вязаный тонкий джемпер свободного силуэта. Горловина изделия овальной формы. Рукав 1/2 и низ изделия оформлены широкой манжетой в рубчик. Покрой рукава - "летучая мышь". Длина изделия по спинке около 54 см (44, 50 р).', 'ФЛА-9193', NULL, 2430, NULL, 1090, '2017-09-18 11:24:50', '2017-09-18 11:24:50', NULL, 0, 1, '', '', '', '', '', ''),
(450, 0, 8, 0, 'stilnyj_kostyum_so_spushennymi_rukavami_', 'Стильный костюм со спущенными рукавами', NULL, 10, 'Большой ассортимент женских стильных спортивных костюмов.  Со спущенным рукавом. Стильный и эффектный женский спортивный костюм. Прекрасный вариант для активного отдыха, прогулок и занятий. Будь модной вместе с нами.', 'ССК-12', NULL, 5250, NULL, 2500, '2017-09-18 13:19:15', '2017-09-18 13:19:15', NULL, 0, 1, '', '', '', '', '', ''),
(451, 0, 9, 0, 'vyazannoe_plate_svobodnogo_silueta', 'Вязанное платье свободного силуэта', NULL, 12, 'Состав: акрил 100%\r\nВязанное платье свободного современного силуэта. Пройма рукава увеличена. Изделие дополнет съемная брошь "сова". Длина изделия по спинке около 100 см (44, 48 р.)\r\n', 'ФЛА-9194', NULL, 2630, NULL, 1190, '2017-09-18 13:59:37', '2017-09-18 13:59:45', NULL, 0, 1, '', '', '', '', '', ''),
(452, 0, 9, 0, 'vyazannoe_plate_s_rukavom_letuchaya_mysh', 'Вязанное платье с рукавом летучая мышь', NULL, 10, 'Состав: акрил 70%, шерсть 30%\r\nВязанное платье свободного современного силуэта. Горловина изделия оформлена двойным высоким воротником "стойка". Рукав удлиненный со спущенной проймой, покрой рукава - "летучая мышь". Воротник, рукава и низ изделия оформлены в рубчик. Длина по спинке около 84 см (44, 48 р).', 'ФЛА-9195', NULL, 3810, NULL, 1780, '2017-09-18 14:05:42', '2017-09-18 14:05:42', NULL, 0, 1, '', '', '', '', '', ''),
(453, 0, 9, 0, 'vyazanyj_kardigan_bez_zastezhki_', 'Вязаный кардиган без застежки', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nВязаный кардиган свободного силуэта без застежки. Тип воротника - "шалка". Рукава оформлены цельновязанной манжетой. По бокам изделия выполнены большие накладные карманы. Длина изделия по спинке около 68 см (44, 48 р.)\r\n', 'ФЛА-9196', NULL, 3410, NULL, 1580, '2017-09-18 14:09:23', '2017-09-18 14:09:23', NULL, 0, 1, '', '', '', '', '', ''),
(454, 0, 9, 0, 'ukorochennyj_dzhemper_iz_hlopka', 'Укороченный джемпер из хлопка', NULL, 12, 'Состав: хлопок 50%, акрил 50%\r\nУкороченный джемпер из хлопка на лето связан ажурным способом. Низ изделия, рукавов и горловина обработаны резинкой в рубчик. Длина изделия по спинке около 54 см (44 р.), 55 см (48 р.)', 'ФЛА-9197', NULL, 2630, NULL, 1190, '2017-09-18 14:18:32', '2017-09-18 14:18:32', NULL, 0, 1, '', '', '', '', '', ''),
(455, 0, 9, 0, 'vyazanyj_dzhemper_so_smeshennym_bokovym_karmanom', 'Вязаный джемпер со смещенным боковым карманом', NULL, 12, 'Состав: хлопок 50%, акрил 50%\r\nВязаный джемпер свободного силуэта. Горловина изделия овальной формы. Рукав 1/2 со спущенной проймой. По переду изделия выполнен смещенный накладной карман. Длина изделия по спинке около 69 см (44 р.), 71 см (48 р.)', 'ФЛА-9201', NULL, 2630, NULL, 1190, '2017-09-18 14:23:41', '2017-09-18 14:23:41', NULL, 0, 1, '', '', '', '', '', ''),
(456, 0, 8, 0, 'zhiletka_zhenskaya_iz_iskusstvennogo_meha', 'Жилетка женская из искусственного меха', NULL, 10, 'Жилетка женская из искусственного меха. Жилетки гораздо более практичны и выглядят не менее роскошно чем шубы.Уже который сезон жилеты из искусственного меха прочно занимают свои места в женском гардеробе. Модные меховые жилеты. Универсальные вещи, которые сразу пришлись по вкусу модницам – это жилетки из меха.', 'СЖИ-3', NULL, 4650, NULL, 2200, '2017-09-18 14:25:22', '2017-09-18 14:25:22', NULL, 0, 1, '', '', '', '', '', ''),
(457, 0, 9, 0, 'vyazanyj_dzhemper_v_rubchik', 'Вязаный джемпер в рубчик', NULL, 12, 'Состав: хлопок 50%, акрил 50%\r\nВязаный джемпер прямого силуэта выполнен фактурным поперечным способом "в рубчик". Вырез горловины овальный, рукав удлиненный. Длина изделия по спинке около 64 см (44р.), 66 см (48 р). ', 'ФЛА-9202', NULL, 3090, NULL, 1420, '2017-09-18 14:26:49', '2017-10-20 12:16:28', NULL, 0, 1, '', '', '', '', '', ''),
(458, 0, 9, 0, 'vyazanyj_dzhemper_s_raskleshennym_rukavom', 'Вязаный джемпер с расклешенным рукавом', NULL, 12, 'Состав: хлопок 50%, акрил 50%\r\nВязаный тонкий джемпер свободного силуэта. Овальная горловина изделия оформлена резинкой в рубчик. Особенностью изделия является длинный расклешённый рукав. Длина изделия по спинке около 67 см (44 р.), 69 см (48 р.)', 'ФЛА-9203', NULL, 2710, NULL, 1230, '2017-09-18 14:35:05', '2017-09-18 14:35:05', NULL, 0, 1, '', '', '', '', '', ''),
(459, 0, 9, 0, 'vyazanyj_udlinennyj_dzhemper_iz_smesovoj_pryazhi', 'Вязаный удлиненный джемпер из смесовой пряжи', NULL, 12, 'Состав: хлопок 50%, акрил 50%\r\nВязаный удлиненный джемпер свободного силуэта выполнен из смесовой пряжи меланжевого цвета. V-образный вырез горловины, рукава "реглан" и низ изделия оформлены резинкой в рубчик. Длина изделия по спинке около 67 см (44, 48 р.)', 'ФЛА-9205', NULL, 2570, NULL, 1160, '2017-09-18 14:38:44', '2017-09-18 14:38:44', NULL, 0, 1, '', '', '', '', '', ''),
(460, 0, 8, 0, 'zhenskij_bryuchnyj_kostyum_s_rukavami_7_8', 'Женский брючный костюм с рукавами 7/8', NULL, 12, 'Женский брючный костюм с рукавами 7/8. Стильный и элегантный брючный костюм для успешной деловой леди. .Идеальный вариант как для офиса, так и для выхода в свет. В 2017 году женские брючные костюмы — тренд модного сезона. Будь модной вместе с нами.', 'СБК-8', NULL, 3450, NULL, 1600, '2017-09-18 14:41:20', '2017-09-18 14:41:20', NULL, 0, 1, '', '', '', '', '', ''),
(461, 0, 9, 0, 'vyazanyj_dzhemper_s_v_obraznym_vyrezom', 'Вязаный джемпер с V-образным вырезом', NULL, 12, 'Состав: хлопок 50%, акрил 50%\r\nВязаный джемпер выполнен фактурным способом. Рукав удлиненный со спущенной проймой. V-образный вырез горловины, рукава и низ изделия оформлены резинкой в рубчик. Длина изделия по спинке около 65 см (44, 48 р.)', 'ФЛА-9206', NULL, 2430, NULL, 1090, '2017-09-18 14:43:38', '2017-09-18 14:43:38', NULL, 0, 1, '', '', '', '', '', ''),
(462, 0, 9, 0, 'vyazanyj_kardigan_iz_fakturnoj_melanzhirovannoj_pryazhi', 'Вязаный кардиган из фактурной меланжированной пряжи', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nВязаный кардиган свободного силуэта без застежки выполнен из фактурной меланжированной пряжи. Рукав удлиненный со спущенной проймой. По бокам изделия выполнены накладные карманы. Длина изделия по спинке около 94 см (44, 48 р.)', 'ФЛА-9209', NULL, 3750, NULL, 1750, '2017-09-18 14:49:04', '2017-09-18 14:49:04', NULL, 0, 1, '', '', '', '', '', ''),
(463, 0, 8, 0, 'zhenskaya_rubashka_voennoj_rascvetki', 'Женская рубашка военной расцветки', NULL, 10, 'Женская рубашка военной расцветки. Со временем рубашки видоизменились и разделились на мужские и женские, офисные и торжественные. Рубашка форменная женская длинный рукав. Яркая женская рубашка . Будь яркой вместе с нами.', 'СБР-2', NULL, 2450, NULL, 1100, '2017-09-18 14:54:47', '2017-09-18 14:54:47', NULL, 0, 1, '', '', 'Рубашка', '', '', ''),
(467, 0, 9, 0, 'vyazannyj_dzhemper_s_okrugloj_gorlovinoj', 'Вязанный джемпер с округлой горловиной', NULL, 12, 'Состав: акрил 70%, шерсть 30%\r\nВязаный джемпер выполнен из смесовой пряжи меланжевого цвета фактурным способом. Округлый вырез горловины, рукава и низ изделия оформлены резинкой в рубчик. Длина изделия по спинке около 63 см (44 р), 64 см (48 р.)', 'ФЛА-961', NULL, 2550, NULL, 1150, '2017-09-18 15:15:56', '2017-09-18 15:15:56', NULL, 0, 1, '', '', '', '', '', ''),
(468, 0, 9, 0, 'zhenskij_pulover_s_shirokim_vyrezom', 'Женский пуловер с широким вырезом', NULL, 12, 'Состав: вискоза 40%, шерсть 40%, акрил 20%\r\nПуловер вязаный - самая популярная модель базового гардероба. Выполнен фактурным способом. Рукав реглан 1/2 и широкий вырез, оформленный в рубчик придает образу легкость и фантазийность. Длина изделия по спинке около 55 см (44 р).', 'ФЛА-962', NULL, 2230, NULL, 990, '2017-09-18 15:22:41', '2017-09-18 15:22:41', NULL, 0, 1, '', '', '', '', '', ''),
(469, 0, 9, 0, 'elegantnaya_vyazannaya_tunika_iz_pryazhi', 'Элегантная вязанная туника из пряжи', NULL, 12, 'Состав: шерсть 50%, акрил 50%\r\nВязаная туника выполнена в элегантном стиле из пряжи. Низ изделия имеет овальную форму, заниженную по спинке. Воротник, манжеты рукавов и низ изделия оформлены в рубчик. Длина изделия по спинке около 85 см(44 р), около 88 см (50 р).', 'ФЛА-965', NULL, 2950, NULL, 1350, '2017-09-18 15:29:48', '2017-09-18 15:29:48', NULL, 0, 1, '', '', '', '', '', ''),
(470, 0, 9, 0, 'vyazanyj_dzhemper_s_vorotnikom_golf', 'Вязаный джемпер с воротником гольф', NULL, 12, 'Состав: акрил 100%\r\nВязаный двухцветный джемпер с длинными рукавами. Изделие выполнено по типу водолазки. Воротник "гольф" оформлен резинкой в рубчик. Длина изделия по спинке около 65 см (44 р.), 67 см (48 р). \r\n', 'ФЛА-997', NULL, 2230, NULL, 990, '2017-09-18 15:34:02', '2017-09-18 15:34:02', NULL, 0, 1, '', '', '', '', '', ''),
(471, 0, 9, 0, 'dzhemper_iz_krupnoj_vyazki_s_rukavom_3_4', 'Джемпер из крупной вязки с рукавом 3/4', NULL, 12, 'Состав: шерсть 50%, акрил 50%\r\nДжемпер связан из полушерстяной пряжи крупной вязкой. Элегантный цвет и мягкая фактура напомнит любимую кофточку связанную вручную. Длина рукава 3/4. Рукав и низ изделия оформлены крупной вывязанной окантовкой. Длина изделия по спинке около 62 см (44 р, 50 р).', 'ФЛА-995', NULL, 2630, NULL, 1190, '2017-09-18 15:38:12', '2017-09-18 15:38:12', NULL, 0, 1, '', '', '', '', '', ''),
(472, 0, 9, 0, 'vyazannyj_zhenskij_dzhemper_s_rukavami_3_4', 'Вязанный женский джемпер с рукавами 3/4', NULL, 7, 'Состав: акрил 100%\r\nВязаный джемпер выполнен из смесовой пряжи фактурным способом. Спущенный рукав длиной 3/4 и широкий вырез ,оформленный в рубчик придает образу легкость и фантазийность. Длина изделия по спинке около 62 см (44 р), около 64 см (50 р). ', 'ФЛА-972', NULL, 1890, NULL, 820, '2017-09-18 15:39:36', '2017-09-18 15:39:36', NULL, 0, 1, '', '', '', '', '', ''),
(473, 0, 9, 0, 'dzhemper_s_udlinennoj_spinkoj', 'Джемпер с удлиненной спинкой', NULL, 12, 'Состав: акрил 100%\r\nВязаный двухцветный джемпер с длинными рукавами. По переду изделия выполнена фигурная вставка. Спинка длиннее переда на 10 см. Длина изделия по переду около 60 см (44 р), около 63 см (50р).', 'ФЛА-990', NULL, 2430, NULL, 1090, '2017-09-18 15:40:56', '2017-09-18 15:40:56', NULL, 0, 1, '', '', '', '', '', ''),
(474, 0, 9, 0, 'dvuhcvetnyj_dzhemper_s_vstavkoj_iz_shifona', 'Двухцветный джемпер с вставкой из шифона', NULL, 12, 'Состав: шерсть 50%, акрил 50%\r\nВязаный джемпер с удлиненными рукавами. Округлый вырез горловины, перед джемпера оформлен рюшей из жатого шифона в романтичном стиле Коко Шанель. Длина изделия по спинке около 66 см (44 р),около 69см (50р).', 'ФЛА-987', NULL, 2430, NULL, 1090, '2017-09-18 15:43:55', '2017-09-18 15:43:55', NULL, 0, 1, '', '', '', '', '', ''),
(475, 0, 9, 0, 'elegantnyj_vyazanyj_dvuhcvetnyj_dzhemper_', 'Элегантный вязаный двухцветный джемпер', NULL, 12, 'Элегантный вязаный двухцветный джемпер с длинным рукавом. Горловина изделия выполнена в виде "лодочки" и оформлена бейкой. Прекрасное решение для каждого дня. Длина изделия по спинке около 58 см (44 р), около 62 см(50р). ', 'ФЛА-974', NULL, 2630, NULL, 1190, '2017-09-18 15:47:21', '2017-09-18 15:47:21', NULL, 0, 1, '', '', '', '', '', ''),
(476, 0, 9, 0, 'stilnaya_zhenskaya_sumka_cherez_plecho', 'Стильная женская сумка через плечо', NULL, 9, 'Стильная женская сумка через плечо. Сумка — неотъемлемый аксессуар любой модницы. Сумка содержит золотистые элементы.', 'ФЛА-9-011', NULL, 2830, NULL, 1290, '2017-09-18 16:28:13', '2017-09-18 16:34:06', NULL, 0, 1, '', '', '', '', '', ''),
(477, 0, 9, 0, 'stilnyj_ryukzachok_iz_plastika_i_ekokozhi', 'Стильный рюкзачок из пластика и экокожи', NULL, 9, 'Стильный рюкзак на все случаи жизни. Отделка из экокожи. Золотистый замок и регуляторы длины ручек.', 'ФЛА-9-044', NULL, 3030, NULL, 1390, '2017-09-18 16:37:55', '2017-09-18 16:37:55', NULL, 0, 1, '', '', '', '', '', ''),
(478, 0, 9, 0, 'tekstilnaya_sumka_s_printom', 'Текстильная сумка с принтом', NULL, 9, 'Объемная сумка на каждый день. Можно носить в руке или на плече. Яркий принт привлекает внимание. Незаменимый аксессуар для отдыха.', 'ФЛА-9-043', NULL, 1630, NULL, 690, '2017-09-18 16:54:18', '2017-09-18 16:54:18', NULL, 0, 1, '', '', '', '', '', ''),
(479, 0, 9, 0, 'povsednevnaya_sumochka_cherez_plecho', 'Повседневная сумочка через плечо', NULL, 9, 'Сумка формы "трапеция" с отстёгивающимся ремешком. Сумка на каждый день.  Золотистый замок и регуляторы длины ручек.', 'ФЛА-9-012', NULL, 2630, NULL, 1190, '2017-09-18 16:57:48', '2017-09-18 17:04:00', NULL, 0, 1, '', '', '', '', '', ''),
(480, 0, 9, 0, 'tekstilnaya_sumka_s_nadpisyu', 'Текстильная сумка с надписью', NULL, 9, 'Объемная и вместительная сумка на плечо. Можно носить в руке. Удобный вариант для отдыха.', 'ФЛА-9-042', NULL, 1630, NULL, 690, '2017-09-18 16:59:13', '2017-09-18 16:59:13', NULL, 0, 1, '', '', '', '', '', ''),
(481, 0, 9, 0, 'stilnaya_sumka_cherez_plecho_iz_perforirovannoj_kozhi', 'Стильная сумка через плечо из перфорированной кожи', NULL, 9, 'Стильная сумочка из перфорированной экокожи. Яркий аксессуар в виде кисточки добавит игривости образу. Металлические элементы серебристые.', 'ФЛА-9-041', NULL, 1830, NULL, 790, '2017-09-18 17:08:48', '2017-09-18 17:08:48', NULL, 0, 1, '', '', '', '', '', ''),
(482, 0, 9, 0, 'stilnaya_sumka_iz_plastika_i_ekokozhi', 'Стильная сумка из пластика и экокожи', NULL, 9, 'Стильная сумка подходит как на каждый день, так для отдыха. Оригинальный дизайн сумки  из экокожи, пластика, ручки сделаны из текстиля. Сумку можно носить как на одно плечо так и в руках. На сумке присутсвуют металлические  элементы серебряного цвета.', 'ФЛА-9-021', NULL, 2830, NULL, 1290, '2017-09-18 17:13:31', '2017-09-18 17:24:30', NULL, 0, 1, '', '', '', '', '', ''),
(483, 0, 9, 0, 'yarkaya_sumka_iz_ekokozhi_cherez_plecho', 'Яркая сумка из экокожи через плечо', NULL, 9, 'Стильная сумочка ярких и насыщенных цветов. Аккуратный замочек и соединительные элементы золотистого цвета. Ярким элементом является ремень с контрастной отделкой.  Ремень не отстегивается.', 'ФЛА-9-040', NULL, 1430, NULL, 590, '2017-09-18 17:21:04', '2017-09-18 17:21:04', NULL, 0, 1, '', '', '', '', '', ''),
(484, 0, 9, 0, 'elegantnaya_sumka_na_zolotoj_cepochke', 'Элегантная сумка на золотой цепочке', NULL, 9, 'Классическая сумка из искусственной кожи. Золотистый замок и цепочка, прекрасно дополняют сумку.', 'ФЛА-9-024', NULL, 2030, NULL, 890, '2017-09-18 17:35:14', '2017-09-18 17:35:14', NULL, 0, 1, '', '', '', '', '', ''),
(485, 0, 9, 0, 'ryukzak_iz_ekokozhi_s_blestkami', 'Рюкзак из экокожи с блестками', NULL, 9, 'Стильный рюкзачок, усыпанный блестками. Металлические элементы в золотистом цвете. Крупная молния на кармане и основном отделении. Регулируемые лямки на отстегивающихся карабинах.  ', 'ФЛА-9-039', NULL, 3030, NULL, 1390, '2017-09-18 17:48:38', '2017-09-18 17:48:38', NULL, 0, 1, '', '', '', '', '', ''),
(486, 0, 9, 0, 'stilnaya_sumka_cherez_plecho', 'Стильная  сумка через плечо', NULL, 9, 'Повседневная сумка через плечо. Сумка из экокожи, присутствует регулятор на ремешке. Дополняют сумки металлические элементы золотистого цвета.', 'ФЛА-9-025', NULL, 2030, NULL, 890, '2017-09-18 17:48:43', '2017-09-18 17:48:43', NULL, 0, 1, '', '', '', '', '', ''),
(487, 0, 9, 0, 'nebolshaya_sumka_na_otstegivayushemsya_remne', 'Небольшая сумка на отстегивающемся ремне', NULL, 9, 'Классическая сумочка на каждый день. Металлические элементы с золотистым оттенком. Ремень на отстегивающихся карабинах.', 'ФЛА-9-038', NULL, 1030, NULL, 390, '2017-09-18 17:54:34', '2017-09-18 17:54:34', NULL, 0, 1, '', '', '', '', '', ''),
(488, 0, 8, 0, 'modnyj_zhenskij_ryukzak_iz_ekokozhi', 'Модный женский рюкзак из экокожи', NULL, 9, 'Стильный рюкзак из экокожи. Регулируемые лямки на отстегивающихся карабинах. Данный рюкзак можно использовать как рюкзак, так и для носки в руке.', 'ФЛА-9-026', NULL, 2430, NULL, 1090, '2017-09-18 18:00:49', '2017-09-18 18:00:49', NULL, 0, 1, '', '', '', '', '', ''),
(489, 0, 9, 0, 'povsednevnaya_sumka_na_odno_plecho', 'Повседневная сумка на одно плечо', NULL, 9, 'Повседневная сумка из экокожи. Сумка прямоугольной мешковатой формы. Подходит для носки в руке и на плече.', 'ФЛА-9-027', NULL, 1830, NULL, 790, '2017-09-18 18:14:07', '2017-09-18 18:18:31', NULL, 0, 1, '', '', '', '', '', ''),
(490, 0, 9, 0, 'nebolshaya_sumka_cherez_plecho_neobychnoj_formy', 'Небольшая сумка через плечо необычной формы', NULL, 9, 'Сумка из экокожи необычной вытянутой формы. Металлические элементы золотистого оттенка. Двухцветная отделка ремня и краев сумки.', 'ФЛА-9-037', NULL, 1430, NULL, 590, '2017-09-18 18:22:15', '2017-09-18 18:23:28', NULL, 0, 1, '', '', '', '', '', ''),
(491, 0, 9, 0, 'sumka_iz_ekokozhi_s_kontrastnoj_otdelkoj', 'Сумка из экокожи с контрастной отделкой', NULL, 9, 'Сумка из экокожи с контрастной отстрочкой. Ремень не регулируется и не отстегивается. Подходит для любого стиля в одежде.', 'ФЛА-9-036', NULL, 1030, NULL, 390, '2017-09-18 18:29:30', '2017-09-18 18:29:30', NULL, 0, 1, '', '', '', '', '', ''),
(492, 0, 9, 0, 'elegantnyj_klach_iz_iskusstvennoj_kozhi_', 'Элегантный клач из искусственной кожи', NULL, 9, 'Стильный клач из искусственной кожи. На сумке присутствует золотой элемент. Данная сумка подходит как на каждый день и для особого случая.', 'ФЛА-9-028', NULL, 1830, NULL, 790, '2017-09-18 18:30:05', '2017-09-18 18:30:05', NULL, 0, 1, '', '', '', '', '', ''),
(493, 0, 9, 0, 'klassicheskaya_sumka_iz_perforirovannoj_kozhi_s_karmanom', 'Классическая сумка из перфорированной кожи с карманом', NULL, 9, 'Классическая сумка из перфорированной экокожи. Ремень отстегивается. Все металлические элементы золотистого оттенка. ', 'ФЛА-9-034', NULL, 2230, NULL, 990, '2017-09-18 18:44:59', '2017-09-18 18:44:59', NULL, 0, 1, '', '', '', '', '', ''),
(494, 0, 9, 0, 'zhenskij_tekstilnyj_ryukzak_na_kazhdyj_den', 'Женский текстильный рюкзак на каждый день', NULL, 9, 'Текстильный рюкзак. Подходит для носки на каждый день, так же можно ходить с ним в спорт зал. Универсальный рюкзак для каждой девушки.', 'ФЛА-9-029', NULL, 1750, NULL, 750, '2017-09-18 18:45:31', '2017-09-18 18:45:31', NULL, 0, 1, '', '', '', '', '', ''),
(495, 0, 9, 0, 'stilnyj_zhenskij_ryukzak_iz_vilveta', 'Стильный женский рюкзак из вильвета', NULL, 9, 'Стильный рюкзак из вельвета на каждый день. Регулируемые лямки на отстегивающихся карабинах. Крупная молния на кармане и основном отделении. ', 'ФЛА-9-031', NULL, 2830, NULL, 1290, '2017-09-18 18:55:31', '2017-09-18 18:55:31', NULL, 0, 1, '', '', '', '', '', ''),
(496, 0, 9, 0, 'klatch_iz_ekokozhi_s_dekorom', 'Клатч из экокожи с декором', NULL, 9, 'Стильный клатч с завязками из экокожи. На молнии. Стильный аксессуар для любого образа.', 'ФЛА-9-033', NULL, 1390, NULL, 570, '2017-09-18 18:57:45', '2017-09-18 18:57:45', NULL, 0, 1, '', '', '', '', '', ''),
(497, 0, 9, 0, 'stilnaya_sumka_na_otstegivayushihsya_karabinah', 'Стильная сумка на отстегивающихся карабинах', NULL, 9, 'Стильная сумка на отстегивающихся карабинах. На сумке присутствует крупная застежка в виде ремня и металлические элементы.', 'ФЛА-9-032', NULL, 1630, NULL, 690, '2017-09-18 19:09:31', '2017-09-18 19:09:31', NULL, 0, 1, '', '', '', '', '', ''),
(501, 0, 9, 0, 'sinij_pletenyj_remen', 'Синий плетеный ремень', NULL, 9, 'Тонкий плетеный ремень из искусственной кожи.\r\nРазмер: ширина 1,5 см, длина 110,0 см\r\nПряжка: серебристая.', 'ФЛА-999-448', NULL, 640, NULL, 195, '2017-09-18 20:02:16', '2017-09-18 20:02:16', NULL, 0, 1, '', '', '', '', '', ''),
(502, 0, 9, 0, 'zelenyj_pletenyj_remen', 'Зеленый плетеный ремень', NULL, 9, 'Тонкий плетеный ремень из искусственной кожи.\r\nРазмер: ширина 1,8 см, длина 105,0 см\r\nПряжка: серебристая.', 'ФЛА-999-449', NULL, 640, NULL, 195, '2017-09-18 20:12:22', '2017-09-18 20:12:22', NULL, 0, 1, '', '', '', '', '', ''),
(503, 0, 9, 0, 'oranzhevyj_pletenyj_remen', 'Оранжевый плетеный ремень', NULL, 9, 'Тонкий плетеный ремень из искусственной кожи.\r\nРазмер: ширина 0,9 см, длина 105,0 см\r\nПряжка: золотистая.', 'ФЛА-999-455', NULL, 550, NULL, 150, '2017-09-18 20:15:51', '2017-09-18 20:15:51', NULL, 0, 1, '', '', '', '', '', ''),
(504, 0, 9, 0, 'tonkij_gladkij_chernyj_remen', 'Тонкий гладкий черный ремень', NULL, 9, 'Тонкий гладкий ремень из искусственной кожи.\r\nРазмер: ширина 1,0 см, длина 109,0 см\r\nПряжка: черная.', 'ФЛА-999-515', NULL, 680, NULL, 215, '2017-09-18 20:22:05', '2017-09-18 20:22:05', NULL, 0, 1, '', '', '', '', '', ''),
(505, 0, 9, 0, 'rozovyj_remen_s_tisneniem', 'Розовый ремень с тиснением', NULL, 9, 'Ремень из искусственной кожи. На ремне выполнено тиснение.\r\nРазмер: ширина 2,5 см, длина 108,0 см\r\nПряжка: золотистая.', 'ФЛА-999-527', NULL, 890, NULL, 320, '2017-09-18 20:26:49', '2017-09-18 20:26:49', NULL, 0, 1, '', '', '', '', '', ''),
(506, 0, 9, 0, 'chernyj_remen_s_tisneniem', 'Черный ремень с тиснением', NULL, 9, 'Черный ремень из искусственной кожи. На ремне выполнено тиснение.\r\nРазмер: ширина 2,5 см, длина 108,0 см\r\nПряжка: золотистая.', 'ФЛА-999-531', NULL, 890, NULL, 320, '2017-09-18 20:31:17', '2017-09-18 20:31:17', NULL, 0, 1, '', '', '', '', '', ''),
(507, 0, 9, 0, 'sinij_remen_s_dekorom_zvezdy', 'Синий ремень с декором звезды', NULL, 9, 'Ремень из искусственной перфорированной кожи с декором звезды.\r\nРазмер: ширина 2,5 см, длина 108,0 см\r\nПряжка: золотистая.', 'ФЛА-999-533', NULL, 890, NULL, 320, '2017-09-18 20:34:25', '2017-09-18 20:34:25', NULL, 0, 1, '', '', '', '', '', ''),
(508, 0, 9, 0, 'chernyj_remen_s_dekorom_zvezdy', 'Черный ремень с декором звезды', NULL, 9, 'Ремень из искусственной перфорированной кожи с декором звезды.\r\nРазмер: ширина 2,5 см, длина 108,0 см\r\nПряжка: золотистая.', 'ФЛА-999-536', NULL, 890, NULL, 320, '2017-09-18 20:36:38', '2017-09-18 20:36:38', NULL, 0, 1, '', '', '', '', '', ''),
