(547, 0, 8, 0, 'stilnoe_bodi_krasnogo_cveta', 'Стильное боди красного цвета', 3, 7, 'Стильное боди красного  цвета. Боди предмет гардероба, которое выделит из толпы, позволит чувствовать себя стильно и неотразимо. Стильное боди , Вы сможете носить его как с юбкой, так и с брюками. Модное боди красного цвета с надписью из трикотажа. Будь модной вместе с нами.', 'СБО-1', NULL, 1250, NULL, 500, '2017-09-19 14:38:25', '2017-11-03 15:56:36', NULL, 0, 0, '', '', '', '', '', ''),
(548, 0, 8, 0, 'modnoe_zhenskoe_bodi_krasnogo_cveta', 'Модное женское боди красного цвета', 3, 10, 'Стильное боди красного  цвета. Боди предмет гардероба, которое выделит  из толпы, позволит чувствовать себя стильно и неотразимо. Стильное боди , Вы сможете носить его как с юбкой, так и с брюками. Модное боди красного цвета с принтом. Будь модной вместе с нами.', 'СБО-2', NULL, 1250, NULL, 500, '2017-09-19 14:53:33', '2017-11-03 15:56:53', NULL, 0, 0, '', '', '', '', '', ''),
(549, 0, 8, 0, 'stilnoe_plate_s_dzhinsovoj_zhiletkoj', 'Стильное платье с джинсовой жилеткой', 3, 11, 'Стильное платье с джинсовой жилеткой. Платье с джинсовой жилеткой всегда смотрится интересно, загадочно. Женская жилетка идеально дополняет платье. Платье с юбкой из фатина и с завышенной линией талии. Быть стильной – легко! ', 'СПЛ-7', NULL, 2650, NULL, 1200, '2017-09-19 15:23:25', '2017-09-19 15:23:25', NULL, 0, 1, '', '', '', '', '', ''),
(550, 0, 8, 0, 'modnyj_zhenskij_bomber_chernogo_cveta', 'Модный женский бомбер черного цвета', 3, 10, 'Модный женский бомбер черного цвета. Стильный бомбер с необычным дизайном в виде висюлек на рукавах. Женский бомбер – это стильная курточка на межсезонье и не только. Черный бомбер – вещь универсальная. Будь модной вместе с нами.', 'СКУ-19', NULL, 3950, NULL, 1850, '2017-09-19 15:36:26', '2017-09-19 15:36:26', NULL, 0, 1, '', '', '', '', '', ''),
(551, 0, 8, 0, 'letnee_plate_s_otkrytymi_plechami', 'Летнее платье с открытыми  плечами', 3, 14, 'Летнее платье с открытыми  плечами. Изделия, дающие шанс продемонстрировать соблазнительные части женской фигуры.  Платья со спущенными плечами остаются актуальными на протяжении десятилетий. данная модель привлекает свое внимание яркой расцветкой. Хлопковое летнее платье с открытыми плечами как нельзя лучше подходит для знойной погоды.', 'СПЛ-8', NULL, 2650, NULL, 1200, '2017-09-19 15:49:33', '2017-09-19 15:49:33', NULL, 0, 1, '', '', '', '', '', ''),
(552, 0, 8, 0, 'zhenskij_udlinennyj_zhilet_myatnogo_cveta', 'Женский удлиненный жилет мятного цвета', 3, 7, 'Женский удлиненный жилет мятного цвета. Удлиненный жилет – это, пожалуй, самая универсальная вещь в женском гардеробе.Женский жилет — идеальный вариант на любой случай в жизни. яркий цвет не оставит Вас не замеченной. Будь модной вместе с нами.', 'СЖИ-4', NULL, 2750, NULL, 1250, '2017-09-19 15:58:02', '2017-09-19 15:59:39', NULL, 0, 1, '', '', '', '', '', ''),
(553, 0, 8, 0, 'stilnyj_bomber_krasnogo_cveta', 'Стильный бомбер красного цвета', 3, 10, 'Модный женский бомбер красного цвета. Стильный бомбер с надписью и цифрами на спине.. Женский бомбер – это стильная курточка на межсезонье и не только. Красный бомбер – вещь универсальная. Будь модной вместе с нами.', 'СКУ-20', NULL, 2650, NULL, 1200, '2017-09-19 16:04:46', '2017-09-19 16:04:46', NULL, 0, 1, '', '', '', '', '', ''),
(554, 0, 10, 0, 'stilnoe_palto_a_silueta_s_rukavom_3_4', 'Стильное пальто А-силуэта с рукавом 3/4', NULL, 18, 'Стильное пальто А-силуэта из плотного текстильного полотна. Круглый вырез изделия обработан внутренней обтачкой. Пальто с втачными рукавами длиной 3/4. По переду изделия планка с застежкой на пуговицы. Низ рукавов и кокетка пальто дополнены очаровательной кружевной аппликацией нежно-розового цвета. В боковых швах изделия втачные карманы. Пальто без подклада. Аксессуары в комплект не входят.\r\nСостав: 	Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%\r\nДлина изделия 81 см.\r\nДлина рукава 48 см.\r\nШирина рукава 24 см.\r\nГлубина проймы 30 см.\r\nДлина плечевого шва 8 см.', 'ВА-П4-3676', NULL, 6250, NULL, 3000, '2017-09-19 16:28:10', '2017-09-19 16:32:14', NULL, 0, 1, '', '', '', '', '', ''),
(555, 0, 10, 0, 'modnye_bryuki_sharovary_iz_tekstilnogo_polotna', 'Модные брюки-шаровары из текстильного полотна', NULL, 18, 'Модные брюки-шаровары из текстильного полотна. \r\nПеред изделия сверху дополнен поясом с застежкой на пуговицу и молнию по переду. По бокам брюк карманы. По переду изделия выполнены декоративные складки, благодаря которым формируются вертикальные линии визуально удлиняющие силуэт.\r\nДлина изделия от линии пояса до низа изделия — 107 см.\r\nШирина брюк по низу изделия — 19 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-Б5-3570', NULL, 2850, NULL, 1300, '2017-09-19 16:53:36', '2017-09-19 17:02:19', NULL, 0, 1, '', '', '', '', '', ''),
(556, 0, 10, 0, 'stilnaya_yubka_iz_polotna_imitiruyushego_kozhu', 'Стильная юбка из полотна имитирующего кожу', NULL, 18, 'Стильная юбка из полотна имитирующего кожу черного цвета. Юбка с высокой посадкой и застежкой на потайную молнию. По низу изделия шлица. Перед изделия по низу дополнен роскошной купонной вышивкой и пробивным кружевом.\r\nАксессуары в комплект не входят.\r\nДлина от пояса до низа изделия — 82 см.\r\nРост фотомодели — 165 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-Ю4-3089/14-15', NULL, 3050, NULL, 1400, '2017-09-19 17:14:13', '2017-09-19 18:24:41', NULL, 0, 1, '', '', '', '', '', ''),
(557, 0, 10, 0, 'bryuki_polusvobodnogo_silueta_iz_trikotazha', 'Брюки полусвободного силуэта из трикотажа', NULL, 18, 'Эксклюзивные брюки полусвободного силуэта из трикотажного полотна. Верхняя часть изделия дополнена поясом на резине. По переду брюк имитация застежки, декоративные складки и стрелки. По боковым швам изделия карманы с застежкой на молнию золотого цвета. По низу брюки дополнены манжетами. Аксессуары в комплект не входят.\r\nДлина изделия от линии пояса до низа изделия - 98 см.\r\nШирина брюк по низу изделия - 17,5 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-Б4-3629/0-3', NULL, 3050, NULL, 1400, '2017-09-19 17:18:59', '2017-09-19 17:29:39', NULL, 0, 1, '', '', '', '', '', ''),
(558, 0, 10, 0, 'stilnaya_yubka_iz_trikotazha', 'Стильная юбка из трикотажа', NULL, 18, 'Стильная юбка из плотного трикотажного полотна. Юбка с высокой посадкой и застежкой на потайную молнию. По низу изделия шлица. Аксессуары в комплект не входят.\r\nДлина от пояса до низа изделия — 75 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-Ю4-3089/10-13', NULL, 2650, NULL, 1200, '2017-09-19 17:20:26', '2017-09-19 18:24:52', NULL, 0, 1, '', '', '', '', '', ''),
(559, 0, 10, 0, 'seraya_trikotazhnaya_yubka', 'Серая трикотажная юбка', NULL, 12, 'Стильная юбка из трикотажного полотна серого цвета. Юбка с высокой посадкой с застежкой на потайную молнию. Снизу изделия шлица. \r\nАксессуары в комплект не входят.\r\nДлина от пояса до низа изделия — 70 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-Ю4-3089/4', NULL, 2010, NULL, 880, '2017-09-19 17:25:38', '2017-09-19 18:25:11', NULL, 0, 1, '', '', '', '', '', ''),
(560, 0, 10, 0, 'yubka_s_bahromoj_iz_polotna_imitiruyushego_kozhu', 'Юбка с бахромой из полотна имитирующего кожу', NULL, 18, 'Стильная юбка из полотна имитирующего кожу черного цвета. Юбка с высокой посадкой и застежкой на потайную молнию в боковом шве. Низ изделия дополнен великолепной длинной бахромой из кожи. Аксессуары в комплект не входят.\r\nДлина от пояса до низа изделия — 75 см.\r\nРост фотомодели — 165 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-Ю4-3089/16-17', NULL, 2850, NULL, 1300, '2017-09-19 17:34:21', '2017-09-19 17:34:21', NULL, 0, 1, '', '', '', '', '', ''),
(561, 0, 10, 0, 'bryuki_iz_trikotazhnogo_barhata_', 'Брюки из трикотажного бархата', NULL, 18, 'Эксклюзивные брюки свободного силуэта из трикотажного бархата черного цвета. Верхняя часть изделия дополнена поясом на резине и декоративными складки. Боковые части изделия украшены декоративной вышивкой контрастного красного цвета. По низу брюки обработаны манжетами. Аксессуары в комплект не входят.\r\nДлина изделия от линии пояса до низа изделия - 105 см.\r\nШирина брюк по низу изделия - 12 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-Б4-3629/4-5', NULL, 3450, NULL, 1600, '2017-09-19 17:35:41', '2017-09-19 17:35:41', NULL, 0, 1, '', '', '', '', '', ''),
(562, 0, 10, 0, 'yubka_s_vysokoj_posadkoj_v_kletku', 'Юбка с высокой посадкой в клетку', NULL, 18, 'Восхитительная юбка свободного силуэта из трикотажного полотна. Линия талии эффектно подчеркнута широким  поясом. Юбка с высокой посадкой с застежкой на потайную молнию. Перед изделия дополнен встречными складками. Аксессуары в комплект не входят.\r\nДлина от пояса до низа изделия — 72-73 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-Ю4-3677', NULL, 3050, NULL, 1400, '2017-09-19 17:39:02', '2017-10-10 11:08:14', NULL, 0, 1, '', '', '', '', '', ''),
(563, 0, 10, 0, 'effektnaya_trikotazhnaya_yubka_na_molnii', 'Эффектная трикотажная юбка на молнии', NULL, 18, 'Эффектная юбка прямого силуэта из трикотажного полотна красного цвета с рельефной фактурой. Идеальную посадку на фигуре обеспечивает втачной пояс-резинка, украшенный металлическими страза. По переду изделия застежка - молния во всю длину юбки.\r\nДлина от пояса до низа изделия —53 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-Ю3-3208/2-3', NULL, 3050, NULL, 1400, '2017-09-19 17:47:12', '2017-09-19 18:24:26', NULL, 0, 1, '', '', '', '', '', ''),
(564, 0, 10, 0, 'stilnye_uzkie_bryuki_iz_tekstilya', 'Стильные узкие брюки из текстиля', NULL, 18, 'Роскошные узкие брюки из текстильного полотна .(Внимание! Полотно плохо тянется!) Брюки дополнены поясом и застежкой на пуговицу и молнию по переду. \r\nДлина изделия от линии пояса до низа изделия - 115 см.\r\nШирина брюк по низу изделия - 15 см.\r\nСостав: Хлопок 97%, Эластан 3', 'ВА-Б5-2537', NULL, 2950, NULL, 1350, '2017-09-19 17:50:29', '2017-09-19 18:24:14', NULL, 0, 1, '', '', '', '', '', ''),
(565, 0, 10, 0, 'trikotazhnaya_yubka_s_relefnoj_fakturoj', 'Трикотажная юбка с рельефной фактурой', NULL, 18, 'Очаровательная юбка прямого силуэта из трикотажного полотна черного цвета с рельефной фактурой. Идеальную посадку на фигуре обеспечивают внутренние вытачки. По спинке на юбке разрез и застежка на потайную молнию. Низ изделия дополнен ажурным кружевом\r\nДлина от пояса до низа изделия — 58 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-Ю3-3152/6-7', NULL, 2350, NULL, 1050, '2017-09-19 17:53:30', '2017-09-19 17:53:30', NULL, 0, 1, '', '', '', '', '', ''),
(566, 0, 10, 0, 'trikotazhnaya_chernaya_yubka_s_relefnoj_fakturoj', 'Трикотажная черная юбка с рельефной фактурой', NULL, 18, 'Идеальная юбка прямого силуэта из трикотажного полотна черного цвета с рельефной фактурой. Идеальную посадку на фигуре обеспечивают внутренние вытачки. По спинке на юбке разрез и застежка на потайную молнию.\r\nДлина от пояса до низа изделия — 55 см.\r\nСостав: 	Вискоза 67%, Нейлон 28%, Эластан 5%.', 'ВА-Ю3-3152/12-13', NULL, 2950, NULL, 1350, '2017-09-19 17:58:28', '2017-10-18 21:04:48', NULL, 0, 1, '', '', '', '', '', ''),
(567, 0, 10, 0, 'zhenstvennye_bryuki_pryamogo_silueta', 'Женственные брюки прямого силуэта', NULL, 18, 'Женственные брюки прямого силуэта из текстильного полотна сливового цвета. Пояс изделия украшен контрастной окантовкой черного цвета. Брюки по переду дополнены застежкой на пуговицы и молнию. По бокам изделия черная окантовка имитирующая карманы. Аксессуары в комплект не входят.\r\nДлина изделия от линии пояса до низа изделия — 105 см.\r\nШирина брюк по низу изделия — 16 см\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-Б5-3583', NULL, 2750, NULL, 1250, '2017-09-19 18:12:33', '2017-09-19 18:12:33', NULL, 0, 1, '', '', '', '', '', ''),
(568, 0, 10, 0, 'pryamaya_yubka_s_vstavkoj_iz_ekokozhi', 'Прямая юбка с вставкой из экокожи', NULL, 7, 'Изумительная юбка прямого силуэта из плотного трикотажного полотна. Перед изделия выполнен из полотна имитирующего кожу и дополнен карманами. По низу изделия однотонный манжет, украшенный декоративным элементом. Пояс изделия  дополнен потайной молнией. \r\nДлина от пояса до низа изделия —  46 см.\r\nСостав:	Полиэстер 95%, Эластан 5%', 'ВА-Ю3-2185', NULL, 2450, NULL, 1100, '2017-09-19 18:27:35', '2017-09-19 18:27:35', NULL, 0, 1, '', '', '', '', '', ''),
(569, 0, 10, 0, 'stilnaya_yubka_na_molnii_s_vysokoj_posadkoj', 'Стильная юбка на молнии с высокой посадкой', NULL, 18, 'Стильная юбка из плотного трикотажного полотна. Юбка с высокой посадкой с застежкой на потайную молнию. Снизу на спинке изделия вставка с воланами.  Аксессуары в комплект не входят.\r\nДлина от пояса до низа изделия —  62 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-Ю3-3595', NULL, 2550, NULL, 1150, '2017-09-19 18:33:34', '2017-09-19 18:33:34', NULL, 0, 1, '', '', '', '', '', ''),
(570, 0, 10, 0, 'klassicheskaya_pryamaya_yubka_s_cvetami', 'Классическая прямая юбка с цветами', NULL, 18, 'Чудесная юбка прямого силуэта из текстильного полотна сине-серого цвета с рельефной фактурой. Идеальную посадку на фигуре обеспечивают внутренние вытачки. По спинке на юбке разрез и застежка на потайную молнию. Аксессуары в комплект не входят.\r\nДлина от пояса до низа изделия — 52 см.\r\nСостав: Шерсть 80%, Акрил 20%.', 'ВА-Ю3-3545', NULL, 2650, NULL, 1200, '2017-09-19 18:40:32', '2017-09-19 18:40:32', NULL, 0, 1, '', '', '', '', '', ''),
(571, 0, 10, 0, 'klassicheskie_pryamye_bryuki_iz_tekstilya', 'Классические прямые брюки из текстиля', NULL, 18, 'Классические прямые брюки из плотного текстильного полотна. Брюки со шлевками, застежкой на переднюю молнию и пуговицы. Аксессуары в комплект не входят.\r\nДлина изделия от линии пояса до низа изделия — 117 см.\r\nШирина брюк по низу изделия — 21 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-Б5-3518', NULL, 3250, NULL, 1500, '2017-09-19 18:43:44', '2017-11-23 14:40:42', NULL, 0, 1, '', '', '', '', '', ''),
(572, 0, 10, 0, 'zhenskie_bryuki_s_relefnym_risunkom', 'Женские брюки с рельефным рисунком', NULL, 18, 'Роскошные узкие брюки из текстильного полотна. Брюки дополнены поясом и застежкой на пуговицу и молнию по переду. \r\nДлина изделия от линии пояса до низа изделия - 108 см.\r\nШирина брюк по низу изделия - 19 см.\r\nСостав: Хлопок 97%, Эластан 3%', 'ВА-Б5-2752', NULL, 3050, NULL, 1400, '2017-09-19 19:00:41', '2017-09-19 19:00:41', NULL, 0, 1, '', '', '', '', '', ''),
(573, 0, 10, 0, 'stilnye_bryuki_klassicheskogo_kroya', 'Стильные брюки классического кроя', NULL, 7, 'Стильные летние брюки классического кроя из текстильного полотна. Верхняя часть брюк обработана поясом. Передняя застежка на молнию и пуговицу.\r\nДлина изделия от линии талии до низа — 110 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-Б5-3249', NULL, 2650, NULL, 1200, '2017-09-19 19:16:24', '2017-09-19 19:16:24', NULL, 0, 1, '', '', '', '', '', ''),
(574, 0, 10, 0, 'stilnye_bryuki_prilegayushego_silueta', 'Стильные брюки прилегающего силуэта', NULL, 18, 'Стильные брюки прилегающего силуэта из трикотажного полотна черного-зеленого цвета с купонным рисунком. Застежка на потайную молнию по боковому шву изделия. \r\nДлина изделия от линии пояса до низа изделия — 103 см.\r\nШирина брюк по низу изделия — 12 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-Б5-3217', NULL, 2650, NULL, 1200, '2017-09-19 19:25:19', '2017-09-19 19:25:19', NULL, 0, 1, '', '', '', '', '', ''),
(575, 0, 10, 0, 'stilnye_bryuki_s_kuponnym_risunkom', 'Стильные брюки с купонным рисунком', NULL, 18, 'Стильные брюки прилегающего силуэта из плотного трикотажного полотна черного цвета с купонным рисунком. Застежка на потайную молнию по боковому шву изделия. \r\nДлина изделия от линии пояса до низа изделия — 105 см.\r\nШирина брюк по низу изделия — 15 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-Б5-2971', NULL, 2450, NULL, 1100, '2017-09-19 19:36:53', '2017-09-19 19:36:53', NULL, 0, 1, '', '', '', '', '', ''),
(576, 0, 10, 0, 'molodezhnye_bryuki_so_vstavkami_iz_ekokozhi', 'Молодежные брюки со вставками из экокожи', NULL, 18, 'Молодежные брюки  со вставками из полотна, имитирующего "мокрую кожу". Задняя кокетка и широкий пояс брюк подчеркивают линию талии. Передняя застежка на молнию и  пуговицы.\r\nДлина изделия от линии пояса до низа изделия — 106 см\r\nШирина брюк по низу изделия — 15 см.\r\nСостав: 	Вискоза 65%, Полиэстер 30%, Эластан 5%\r\n', 'ВА-Б5-3362', NULL, 3250, NULL, 1500, '2017-09-19 19:48:13', '2017-09-19 19:48:13', NULL, 0, 1, '', '', '', '', '', ''),
(577, 0, 10, 0, 'uzkie_bryuki_iz_plotnogo_trikotazha', 'Узкие брюки из плотного трикотажа', NULL, 18, 'Роскошные узкие брюки из плотного трикотажного полотна. Брюки дополнены поясом и застежкой на пуговицу и переднюю молнию. По низу изделия — разрезы. \r\nДлина изделия от линии пояса до низа изделия — 103 см.\r\nШирина брюк по низу изделия -  15 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-Б5-3364', NULL, 3450, NULL, 1600, '2017-09-19 20:01:12', '2017-09-19 20:01:12', NULL, 0, 1, '', '', '', '', '', ''),
(578, 0, 10, 0, 'uzkie_bryuki_iz_plotnogo_trikotazhnogo_polotna', 'Узкие брюки из плотного трикотажного полотна', NULL, 18, 'Роскошные узкие брюки из плотного трикотажного полотна. Брюки дополнены поясом и застежкой на пуговицу и переднюю молнию. По низу изделия — разрезы. \r\nДлина изделия от линии пояса до низа изделия — 96 см.\r\nШирина брюк по низу изделия -  15 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-Б5-3122', NULL, 3250, NULL, 1500, '2017-09-19 20:35:27', '2017-09-19 20:35:27', NULL, 0, 1, '', '', '', '', '', ''),
(579, 0, 10, 0, 'molodezhnye_bryuki_prilegayushego_silueta', 'Молодежные брюки  прилегающего силуэта', NULL, 18, 'Молодежные брюки  прилегающего силуэта. Передняя часть брюк выполнена из кожаного полотна, а спинка из однотонного текстиля. Посадка брюк - средняя. Застежка на молнию и крючок сбоку изделия.\r\nДлина изделия от линии пояса до низа изделия — 110 см\r\nШирина брюк по низу изделия — 13 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-Б5-2950', NULL, 3250, NULL, 1500, '2017-09-19 20:52:41', '2017-09-19 20:52:41', NULL, 0, 1, '', '', '', '', '', ''),
(580, 0, 10, 0, 'bryuki_iz_ekokozhi_korichnevogo_cvet', 'Брюки из экокожи коричневого цвет', NULL, 18, 'Молодежные брюки  со вставками из полотна, имитирующего "мокрую кожу". Задняя кокетка и широкий пояс брюк подчеркивают линию талии. Передняя застежка на молнию и  пуговицы.\r\nДлина изделия от линии пояса до низа изделия — 110 см\r\nШирина брюк по низу изделия — 15 см\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-Б5-2488', NULL, 3250, NULL, 1500, '2017-09-19 21:10:19', '2017-09-19 21:10:19', NULL, 0, 1, '', '', '', '', '', ''),
(581, 0, 10, 0, 'uzkie_zhenskie_bryuki_iz_trikotazha', 'Узкие женские брюки из трикотажа', NULL, 18, 'Роскошные узкие брюки из плотного трикотажного полотна. Брюки дополнены поясом и застежкой на пуговицу и переднюю молнию. \r\nДлина изделия от линии пояса до низа изделия — 110 см.\r\nШирина брюк по низу изделия — 16 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-Б5-3092', NULL, 3250, NULL, 1500, '2017-09-19 21:19:55', '2017-09-19 21:19:55', NULL, 0, 1, '', '', '', '', '', ''),
(582, 0, 10, 0, 'stilnye_zhenskie_bryuki_prilegayushego_silueta', 'Стильные женские брюки прилегающего силуэта', NULL, 18, 'Стильные брюки прилегающего силуэта из плотного трикотажного полотна "Эмбос" . Верхний край брюк обработан внутренней обтачкой и дополнен широкой резинкой изнутри. По боковому шву изделия застежка на потайную молнию. \r\nДлина изделия от линии пояса до низа  — 110 см.\r\nШирина брюк по низу изделия — 15 см.\r\nРост фотомодели — 170 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-Б5-3136', NULL, 2650, NULL, 1200, '2017-09-19 21:32:27', '2017-09-19 21:32:27', NULL, 0, 1, '', '', '', '', '', ''),
(583, 0, 10, 0, 'plate_svobodnogo_silueta_iz_trikotazhnogo_polotna_', 'Платье свободного силуэта из трикотажного полотна', NULL, 18, 'Чудесное платье свободного силуэта из трикотажного полотна . Круглый вырез горловины обработан бейкой. Платье с кружевной кокеткой. Низ втачных рукавов дополнен манжетом. Линия талии подчеркнута резинкой. Аксессуары в комплект не входят.\r\nСостав: Полиэстер 95%, Эластан 5%\r\nДлина изделия 133 см.\r\nДлина рукава 61 см.\r\nШирина рукава 14 см.\r\nГлубина проймы 24.5 см.\r\nДлина плечевого шва 9 см.\r\nДлина от плечевого шва до талии 53.5 см.', 'ВА-П5-3644', NULL, 3450, NULL, 1600, '2017-09-20 11:10:04', '2017-09-20 11:10:04', NULL, 0, 1, '', '', '', '', '', ''),
(584, 0, 10, 0, 'uyutnoe_plate_poluprilegayushego_siluet', 'Уютное платье полуприлегающего силуэт', NULL, 18, 'Уютное платье полуприлегающего силуэта из трикотажного полотна цвета. Круглый вырез изделия дополнен капюшоном. Платье с втачными рукавами. Изделие отрезное по линии талии. Линия талии завышена. Низ платья по переду двойной, верхний слой выполнен из роскошного кружева. В боковых швах платья втачные карманы и разрезы по низу. Аксессуары в комплект не входят. Длина изделия по спинке от плечевого шва до низа изделия — 121 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-П5-3679', NULL, 4050, NULL, 1900, '2017-09-20 11:35:04', '2017-11-22 21:36:12', NULL, 0, 1, '', '', '', '', '', ''),
(585, 0, 10, 0, 'ocharovatelnoe_plate_poluprilegayushego_silueta', 'Очаровательное платье полуприлегаюшего силуэта', NULL, 18, 'Очаровательное платье полуприлегаюшего силуэта из трикотажного полотна синего цвета Верхняя часть переда выполнена в форме запаха с эффектными драпировками. Платье с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 105 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П5-3438', NULL, 3050, NULL, 1400, '2017-09-20 11:46:49', '2017-09-20 11:46:49', NULL, 0, 1, '', '', '', '', '', ''),
(586, 0, 10, 0, 'voshititelnoe_plate_poluprilegayushego_silueta', 'Восхитительное платье полуприлегающего силуэта', NULL, 18, 'Восхитительное платье полуприлегающего силуэта из трикотажного полотна. Горловина изделия обработана воротником — стойка. Перед изделия сверху дополнен застежкой на  втачную молнию и украшен декоративными карманами. Низ втачных рукавов обработан манжетами с застежкой на пуговицу. Платье отрезное по линии талии. Аксессуары в комплект не входят.\r\nСостав: Полиэстер 95%, Эластан 5%\r\nДлина изделия 123 см.\r\nДлина рукава 65 см.\r\nШирина рукава 15 см.\r\nГлубина проймы 26.5 см.\r\nДлина плечевого шва 12 см.\r\nДлина от плечевого шва до талии 50.5 см.', 'ВА-П5-3410/4-7', NULL, 4450, NULL, 2100, '2017-09-20 12:02:06', '2017-10-02 18:53:06', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(587, 0, 10, 0, 'izyashnoe_plate_poluprilegayushego_silueta', 'Изящное платье полуприлегающего силуэта', NULL, 18, 'Изящное платье полуприлегающего силуэта из трикотажного полотна сине-белого цвета. Фигурный вырез изделия обработан воротником — стойка. Перед изделия сверху дополнен застежкой на втачную молнию и украшен декоративными карманами. Низ втачных рукавов обработан манжетами с застежкой на пуговицу. Платье отрезное по линии талии. Аксессуары в комплект не входят. \r\nСостав: Вискоза 95%, Эластан 5%\r\nДлина изделия 98 см.\r\nДлина рукава 63 см.\r\nШирина рукава 9 см.\r\nГлубина проймы 20 см.\r\nДлина плечевого шва 11 см.\r\nДлина от плечевого шва до талии 37 см.', 'ВА-П5-3410/2-3', NULL, 3650, NULL, 1700, '2017-09-20 12:18:45', '2017-10-02 18:52:12', NULL, 0, 1, '', '', '', '', '', ''),
(588, 0, 10, 0, 'raskleshennaya_yubka_na_rezinke', 'Расклешенная юбка на резинке', NULL, 18, 'Женственная юбка полуприлегающего силуэта черно-белого цвета. Юбка выполнена в технике «ручного вязания» из натуральных нитей с содержанием шерсти. Пояс на эластичной резине. Верхняя часть юбки однотонная, по клиньям юбки вывязан декоративный орнамент. Аксессуары в комплект не входят. Длина от пояса до низа изделия — 75 см.\r\nСостав: 	Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%', 'ВА-Ю4-158', NULL, 3050, NULL, 1400, '2017-09-20 12:25:39', '2017-09-20 12:25:39', NULL, 0, 1, '', '', '', '', '', ''),
(589, 0, 10, 0, 'zhenstvennoe_plate_poluprilegayushego_silueta', 'Женственное платье полуприлегающего силуэта', NULL, 18, 'Женственное платье полуприлегающего силуэта из трикотажного полотна сине-белого цвета. Платье с кружевным отложным воротником.  Верхняя часть переда изделия дополнена планкой с застежкой на пуговицы. Платье отрезное по линии талии. Аксессуары в комплект не входят.\r\nСостав: Полиэстер 95%, Эластан 5%\r\nДлина изделия 113 см.\r\nДлина рукава 62 см.\r\nШирина рукава 15 см.\r\nГлубина проймы 26.5 см.\r\nДлина плечевого шва 13 см.\r\nДлина от плечевого шва до талии 47.5 см.', 'ВА-П5-3563', NULL, 4450, NULL, 2100, '2017-09-20 12:37:42', '2017-09-20 12:37:42', NULL, 0, 1, '', '', '', '', '', ''),
(590, 0, 10, 0, 'zhenstvennaya_yubka_raskleshennogo_silueta', 'Женственная юбка расклешенного силуэта', NULL, 18, 'Женственная юбка расклешенного силуэта из текстильного полотна черно-бордового. Юбка на широком поясе, дополнена складкой по переду. Застежка на потайную молнию.\r\nДлина от пояса до низа изделия — 84 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-Ю3-3391', NULL, 2930, NULL, 1340, '2017-09-20 12:48:23', '2017-09-20 12:48:23', NULL, 0, 1, '', '', '', '', '', ''),
(591, 0, 10, 0, 'effektnoe_plate_poluprilegayushego_silueta', 'Эффектное платье полуприлегающего силуэта', NULL, 19, 'Эффектное женственное платье полуприлегающего силуэта, восхитительное сочетание трикотажного полотна и ткани «шифон». Горловина изделия украшена декоративным элементом и дополнена изящным вырезом. Широкие втачные рукава выполнены из плотного шифона с купонным рисунком и припосажены на однотонные манжеты. Линия талии подчеркнута втачным однотонным поясом и дополнена небольшой оборкой. \r\nАксессуары в комплект не входят. \r\nСостав: Полиэстер 95%, Эластан 5%\r\nДлина изделия 108 см.\r\nДлина рукава 67 см.\r\nШирина рукава 14 см.\r\nГлубина проймы 26.5 см.\r\nДлина от плечевого шва до талии 46.5 см.\r\n', 'ВА-П5-2329', NULL, 4250, NULL, 2000, '2017-09-20 12:54:34', '2017-09-20 12:54:34', NULL, 0, 1, '', '', '', '', '', ''),
(592, 0, 10, 0, 'plate_rubashka_pryamogo_silueta', 'Платье-рубашка прямого силуэта', NULL, 18, 'Роскошное платье-рубашка прямого силуэта из трикотажного полота имитирующего мокрую кожу, черного цвета. Горловина изделия обработана отложным воротничком. По переду изделия планка с застежкой на пуговицы. Платье-рубашка с цельнокроеными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —100 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3414/2-3', NULL, 3850, NULL, 1800, '2017-09-20 13:16:35', '2017-09-20 13:16:35', NULL, 0, 1, '', '', '', '', '', ''),
(594, 0, 10, 0, 'roskoshnoe_plate_rubashka_pryamogo_silueta', 'Роскошное платье-рубашка прямого силуэта', NULL, 18, 'Роскошное платье-рубашка прямого силуэта из трикотажного полотна, имитирующего замшу  цвета охры. Круглый вырез изделия обработан отложным воротничком. Кокетка выполнена из перфорированного полотна имитирующего кожу. По переду изделия планка с застежкой на пуговицы. Низ втачных рукавов со спущенной линией проймы дополнен манжетом с застежкой на пуговицу. Талию подчеркивает тонкий ремешок на завязках. В боковых швах изделия небольшие разрезы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —100 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-3414/10-11', NULL, 3650, NULL, 1700, '2017-09-20 13:33:46', '2017-10-02 18:48:19', NULL, 0, 1, '', '', '', '', '', ''),
(595, 0, 10, 0, 'romantichnoe_plate_pryamogo_silueta_', 'Романтичное платье прямого силуэта', NULL, 18, 'Романтичное платье прямого силуэта из мягкого трикотажного полотна. Круглый вырез изделия обработан воротником-стойка и дополнен декоративным кружевом белого цвета. Декоративный воротничок закреплен одной машинной строчкой, при желании его можно снять. Платье с цельнокроеными рукавами. Спинка изделия дополнена застежкой на потайную молнию и разрезом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 109 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-П4-2995/21-26', NULL, 3250, NULL, 1500, '2017-09-20 14:09:12', '2017-11-23 15:36:15', NULL, 0, 1, '', '', '', '', '', ''),
(596, 0, 10, 0, 'plate_pryamogo_silueta_iz_myagkogo_trikotazha', 'Платье прямого силуэта из мягкого трикотажа', NULL, 18, 'Интересное платье прямого силуэта из мягкого трикотажного полотна. Изделие со спущенной линией плеча и втачными рукавами. Горловина изделия украшена декоративным элементом из страз. По низу изделия в боковых швах - разрезы.\r\nАксессуары в комплект не входят.\r\nСостав: 	Вискоза 95%, Эластан 5%\r\nДлина изделия 122 см.\r\nДлина рукава 40 см.\r\nШирина рукава 9 см.\r\nГлубина проймы 30 см.\r\nДлина плечевого шва 31 см.\r\nДлина от плечевого шва до талии 44 см.', 'ВА-П4-2995/2-3', NULL, 3850, NULL, 1800, '2017-09-20 14:29:34', '2017-11-17 22:39:20', NULL, 0, 1, '', '', '', '', '', ''),
(597, 0, 10, 0, 'uyutnoe_plate_pryamogo_silueta_iz_vyazanogo_trikotazha', 'Уютное платье прямого силуэта из вязаного трикотажа', NULL, 18, 'Уютное платье прямого силуэта из вязаного трикотажного полотна сине-серого цвета с  геометрическим принтом. Изделие с втачными рукавами. Круглый вырез изделия обработан воротником «стойка». Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —  110 см', 'ВА-П4-2995/19-20', NULL, 3450, NULL, 1600, '2017-09-20 14:46:04', '2017-11-17 22:37:33', NULL, 0, 1, '', '', '', '', '', ''),
(598, 0, 10, 0, 'effektnoe_plate_iz_trikotazhnogo_polotna', 'Эффектное платье из трикотажного полотна', NULL, 18, 'Эффектное платье полуприлегающего силуэта из плотного трикотажного полотна. Круглый вырез изделия и низ рукавов декорирован перфорированной кожей цвета. Рукава втачные. \r\nПлатье отлично сидит и выгодно подчеркивает фигуру. Дизайнеры Wisell привнесли в эту модель эффектную изюминку — съёмный шарф-трансформер из перфорированной кожи с несколькими вариантами завязывания. Аксессуары в комплект не входят.\r\nСостав: Вискоза 95%, Эластан 5%\r\nДлина изделия 108 см.\r\nДлина рукава 63 см.\r\nШирина рукава 16 см.\r\nГлубина проймы 26.5 см.\r\nДлина плечевого шва 10 см.\r\nДлина от плечевого шва до талии 50.5 см.\r\n\r\n', 'ВА-П5-3505', NULL, 4250, NULL, 2000, '2017-09-20 15:44:17', '2017-09-20 15:45:17', NULL, 0, 1, '', '', '', '', '', ''),
(599, 0, 10, 0, 'plate_pryamogo_silueta_cherno_korichnevogo_cveta', 'Платье прямого силуэта черно-коричневого цвета', NULL, 18, 'Великолепное платье прямого силуэта из текстильного полотна черно-коричневого цвета. Фигурный вырез изделия обработан отложным воротничком. Верхняя часть переда изделия дополнена застежкой на пуговицы. Платье со спущенной линией проймы. Низ втачных рукавов обработан манжетами. Отложной воротничок, манжеты и накладные карманы выполнены из кожи. Аксессуары в комплект не входят.\r\nСостав: 	Вискоза 65%, Полиэстер 30%, Эластан 5%\r\nДлина изделия 105 см.\r\nДлина рукава 44 см.\r\nШирина рукава 15 см.\r\nГлубина проймы 30.5 см.\r\nДлина плечевого шва 34 см.\r\nДлина от плечевого шва до талии 50.5 см', 'ВА-П4-3547', NULL, 4250, NULL, 2000, '2017-09-20 15:57:37', '2017-09-20 15:57:37', NULL, 0, 1, '', '', '', '', '', ''),
(600, 0, 10, 0, 'plate_iz_trikotazha_polotna_sinego_cveta', 'Платье из трикотажа полотна синего цвета', NULL, 19, 'Романтичное платье полуприлегающего силуэта из трикотажного полотна синего цвета. Круглый вырез изделия обработан внешней обтачкой. Рукава «реглан» расширяются к низу. Линия талии эффектно подчеркнута фигурной вставкой. Аксессуары в комплект не входят.\r\nСостав: Вискоза 95%, Эластан 5%\r\nДлина изделия 102 см.\r\nДлина рукава 48 см.\r\nШирина рукава 27 см.\r\nГлубина проймы 26.5 см.\r\nДлина от плечевого шва до талии 43.5 см.', 'ВА-П4-2377', NULL, 3850, NULL, 1800, '2017-09-20 16:13:16', '2017-09-20 16:13:16', NULL, 0, 1, '', '', '', '', '', ''),
(601, 0, 10, 0, 'stilnoe_maksi_plate_iz_trikotazha_', 'Стильное макси-платье из трикотажа', NULL, 18, 'Стильное макси-платье полуприлегающего силуэта из трикотажного полотна «лапша». Платье со спущенной линией проймы и втачными рукавами. По спинке изделия шлица. Аксессуары в комплект не входят.\r\nСостав:Вискоза 95%, Эластан 5%\r\nДлина изделия 125 см.\r\nДлина рукава 49 см.\r\nШирина рукава 14 см.\r\nГлубина проймы 31.5 см.\r\nДлина плечевого шва 31 см.\r\nДлина от плечевого шва до талии 50.5 см.', 'ВА-П5-3544', NULL, 3650, NULL, 1700, '2017-09-20 16:43:16', '2017-09-20 16:43:16', NULL, 0, 1, '', '', '', '', '', ''),
(602, 0, 10, 0, 'utonchennoe_plate_chernogo_cveta', 'Утонченное платье черного цвета', NULL, 19, 'Утонченное платье полуприлегающего силуэта из мягкого трикотажного полотна черного цвета. Изделие со спущенной линией плеча и втачными рукавами. Горловина изделия украшена декоративным элементом со стразами. Аксессуары в комплект не входят.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%\r\nДлина изделия 100 см.\r\nДлина рукава 40 см.\r\nШирина рукава 14 см.\r\nГлубина проймы 28.5 см.\r\nДлина плечевого шва 33 см.\r\nДлина от плечевого шва до талии 50.5 см.\r\n', 'ВА-П5-2945', NULL, 3050, NULL, 1400, '2017-09-20 17:06:27', '2017-09-20 17:06:27', NULL, 0, 1, '', '', '', '', '', ''),
(603, 0, 10, 0, 'izyashnoe_plate_s_kruzhevnymi_rukavami', 'Изящное платье с кружевными рукавами', NULL, 18, 'Роскошное платье полуприлегающего силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан внутренней обтачкой. Втачные рукава дополнены кружевом. По переду изделия декоративные элементы в форме цветов. Аксессуары в комплект не входят.\r\nСостав: Полиэстер 95%, Эластан 5%\r\nДлина изделия\r\n114 см.\r\nДлина рукава 56 см.\r\nШирина рукава 21 см.\r\nГлубина проймы 26.5 см.\r\nДлина плечевого шва 12 см.\r\nДлина от плечевого шва до талии 50.5 см.', 'ВА-П4-3556', NULL, 4250, NULL, 2000, '2017-09-20 18:11:28', '2017-10-02 18:53:58', NULL, 0, 1, '', '', '', '', '', ''),
(604, 0, 10, 0, 'ofisnoe_plate_pryamogo_silueta', 'Офисное платье прямого силуэта', NULL, 18, 'Стильное офисное платье прямого силуэта из трикотажного полотна черного цвета. Горловина изделия обработана отложным воротничком. Перед дополнен верхней планкой с застежкой на пуговицы. Широкие втачные рукава выполнены из легкого полупрозрачного шифона с купонным рисунком, по низу рукавов — манжеты дополненные застежкой на пуговицу. Воротничок, планка и манжеты из трикотажного полотна песочного цвета имитирующего замшу. Аксессуары в комплект не входят.\r\nСостав: Вискоза 95%, Эластан 5%\r\nДлина изделия 93 см.\r\nДлина рукава 63 см.\r\nШирина рукава 14 см.\r\nГлубина проймы 26.5 см.\r\nДлина плечевого шва 13 см.\r\nДлина от плечевого шва до талии 50.5 см.', 'ВА-П5-3520', NULL, 3950, NULL, 1850, '2017-09-20 18:23:51', '2017-11-22 20:47:47', NULL, 0, 1, '', '', '', '', '', ''),
(605, 0, 10, 0, 'originalnoe_plate_svobodnogo_silueta', 'Оригинальное платье свободного силуэта', NULL, 19, 'Оригинальное платье свободного силуэта из трикотажного полотна черного цвета. Круглый вырез изделия украшен декоративным элементом. Платье с цельнокроеными рукавами, по боковым швам изделия — разрезы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 97 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-П5-2979', NULL, 3050, NULL, 1400, '2017-09-20 18:35:50', '2017-09-20 18:35:50', NULL, 0, 1, '', '', '', '', '', ''),
(606, 0, 10, 0, 'plate_poluprilegayushego_silueta_iz_barhata', 'Платье полуприлегающего силуэта из бархата', NULL, 18, 'Шикарное платье полуприлегающего силуэта из текстильного полотна (бархат) сливово-фиолетового цвета. Фигурный вырез обработан внутренней обтачкой и украшен декоративным элементом со стразами. Платье со спущенной линией проймы и втачными рукавами. Низ платья украшен кокетливыми разрезами по бокам, обработанными окантовкой.Аксессуары в комплект не входят.\r\nСостав: Полиэстер 95%, Эластан 5%\r\nДлина изделия 120 см.\r\nДлина рукава 39 см.\r\nШирина рукава 8 см.\r\nГлубина проймы 23 см.\r\nДлина плечевого шва 28 см.\r\nДлина от плечевого шва до талии 44 см.\r\n', 'ВА-П5-3498', NULL, 4250, NULL, 2000, '2017-09-20 18:44:19', '2017-09-20 18:44:19', NULL, 0, 1, '', '', '', '', '', ''),
(607, 0, 10, 0, 'dlinnaya_yubka_v_kletku', 'Длинная юбка в клетку', NULL, 18, 'Уютная юбка-макси полуприлегающего силуэта из трикотажного полотна зелено-бежевого цвета. Верхняя часть юбки обработана поясом. Застежка на молнию по спинке изделия.\r\nДлина от пояса до низа изделия — 97 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-Ю5-3213/4-7', NULL, 2850, NULL, 1300, '2017-09-20 18:51:47', '2017-09-20 18:51:47', NULL, 0, 1, '', '', '', '', '', ''),
(608, 0, 10, 0, 'dlinnaya_pryamaya_yubka_iz_zhakkarda', 'Длинная прямая юбка из жаккарда', NULL, 18, 'Стильная юбка прямого силуэта из текстильного полотна-жаккард темно-серого цвета с рельефной текстурой. Идеальную посадку на фигуре обеспечивают втачной пояс и  внутренние вытачки. По спинке на юбке: в верхней части — застежка на потайную молнию, снизу — эффектный разрез.\r\nДлина от пояса до низа изделия — 90 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-Ю4-3440/4-5', NULL, 2850, NULL, 1300, '2017-09-20 19:01:42', '2017-09-20 19:01:42', NULL, 0, 1, '', '', '', '', '', ''),
(609, 0, 10, 0, 'stilnaya_yubka_poluprilegayushego_silueta', 'Стильная юбка полуприлегающего силуэта', NULL, 18, 'Стильная юбка полуприлегающего силуэта. Юбка выполнена в технике «ручного вязания» из нитей с содержанием шерсти. Пояс на эластичной резинке. По спинке изделия металлическая молния. Низ изделия обработан «чулком». \r\nДлина от пояса до низа изделия — 55 см.\r\nДизайнеры Wisell предлагают носить юбку как молнией сзади, так и спереди.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%.', 'ВА-Ю4-163/0-3', NULL, 2950, NULL, 1350, '2017-09-20 19:09:52', '2017-09-20 19:09:52', NULL, 0, 1, '', '', '', '', '', ''),
(610, 0, 10, 0, 'effektnoe_plate_izumrudnogo_cveta', 'Эффектное платье изумрудного цвета', NULL, 12, 'Эффектное платье прилегающего силуэта из текстильного жаккарда с рельефным рисунком потрясающего изумрудного цвета. Фигурный вырез изделия и линия груди подчёркнуты декоративным кантом. Втачные рукава выполнены из эластичного кружевного полотна. \r\nВ спинке изделия — потайная молния.\r\nОбратите внимание, платье идёт размер в размер. Особенно рекомендуем это платье обладательницам пышного бюста.\r\nАксессуары в комплект не входят.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%\r\nДлина изделия 123 см.\r\nДлина рукава 62 см.\r\nШирина рукава 8 см.\r\nГлубина проймы 20 см.\r\nДлина плечевого шва 9 см.\r\nДлина от плечевого шва до талии 37 см.', 'ВА-П5-3490', NULL, 4450, NULL, 2100, '2017-09-20 19:12:20', '2017-09-20 19:16:13', NULL, 0, 1, '', '', '', '', '', ''),
(611, 0, 10, 0, 'izyskannoe_plate_zelenogo_cveta', 'Изысканное платье зеленого цвета', NULL, 19, 'Изысканное платье длины макси прилегающего силуэта из трикотажного полотна зеленого цвета. Кокетка изделия и втачные рукава выполнены из плотного ажурного кружева. Перед изделия дополнен складками и украшен металлическим элементом.  Платье отрезное по линии талии. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 138 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П5-3032', NULL, 5250, NULL, 2500, '2017-09-20 19:23:28', '2017-09-20 19:23:28', NULL, 0, 1, '', '', '', '', '', ''),
(612, 0, 10, 0, 'uyutnyj_vyazanyj_sarafan_bezhevogo_cveta', 'Уютный вязаный сарафан бежевого цвета', NULL, 18, 'Уютный сарафан прямого силуэта бежевого цвета. Платье выполнено в технике «ручного вязания» из нитей с добавлением шерсти. Круглый вырез и проймы изделия обработаны двусторонней лицевой бейкой. Кокетка сарафана дополнена декоративной объемной косой.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —110 см. \r\nРост фотомодели — 170 см.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%', 'ВА-П1-201', NULL, 3450, NULL, 1600, '2017-09-20 19:24:40', '2017-09-20 19:24:40', NULL, 0, 1, '', '', '', '', '', ''),
(613, 0, 10, 0, 'plate_iz_ekokozhi_s_neobychnymi_rukavami', 'Платье из экокожи с необычными рукавами', NULL, 18, 'Игривое платье ультра-модного А-образного силуэта из трикотажного полотна с перфорацией, имитирующее мокрую кожу. Круглый вырез изделия обработан внутренней обтачкой. Эффектные втачные рукава со спущенной линией проймы и воланом.\r\nДизайнеры Wisell особенно рекомендуют это платье обладательницам фигуры типа «треугольник». Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 92-102 см. (в зависимости от размера)\r\nРост фотомодели — 165 см.\r\nСостав: 	Полиэстер 95%, Эластан 5%.', 'ВА-П4-3504', NULL, 4250, NULL, 2000, '2017-09-20 19:32:58', '2017-09-20 19:36:49', NULL, 0, 1, '', '', '', '', '', ''),
(614, 0, 10, 0, 'plate_maksi_iz_trikotazhnogo_polotna_', 'Платье макси из трикотажного полотна', NULL, 19, 'Роскошное платье-макси полуприлегающего силуэта из трикотажного полотна. Круглый вырез изделия обработан внутренней обтачкой. Цельнокроеные рукава обработаны манжетами. Перед изделия украшен декоративным элементом, который входит в комплект. Платье отрезное по линии бедра. Аксессуары в комплект не входят.\r\nСостав: Полиэстер 95%, Эластан 5%\r\nДлина изделия 125 см.\r\nДлина рукава 52 см.\r\nШирина рукава 17 см.\r\nГлубина проймы 26.5 см.\r\nДлина от плечевого шва до талии 50.5 см.\r\n', 'ВА-П4-2976', NULL, 4250, NULL, 2000, '2017-09-20 19:42:16', '2017-09-20 19:42:16', NULL, 0, 1, '', '', '', '', '', ''),
(615, 0, 10, 0, 'elegantnoe_plate_s_kruzhevnymi_rukavami', 'Элегантное платье с кружевными рукавами', NULL, 18, 'Элегантное платье полуприлегающего силуэта из трикотажного полотна  розового цвета. Круглый вырез изделия обработан косой бейкой. Кокетка и втачные рукава выполнены из кружевного полотна.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке  от плечевого шва до низа изделия —95-100 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%.', 'ВА-П4-3234/0-1', NULL, 4050, NULL, 1900, '2017-09-20 19:43:08', '2017-09-20 19:45:47', NULL, 0, 1, '', '', '', '', '', ''),
(616, 0, 10, 0, 'elegantnoe_plate_s_kruzhevnymi_rukavami_i_podolom', 'Элегантное платье с кружевными рукавами и подолом', NULL, 18, 'Модное платье полуприлегающего силуэта из полотна имитирующего кожу черного цвета. Круглый вырез изделия обработан косой бейкой. Кокетка, втачные рукава и низ переда платья выполнены из ажурной кружевной кожи. Спинка изделия дополнена застежкой на потайную молнию и разрезом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке  от плечевого шва до низа изделия — 106-110 см.\r\nРост фотомодели — 165 см.\r\nСостав: 	Полиэстер 95%, Эластан 5%', 'ВА-П4-3234/2-3', NULL, 4250, NULL, 2000, '2017-09-20 19:50:57', '2017-09-20 19:50:57', NULL, 0, 1, '', '', '', '', '', ''),
(617, 0, 10, 0, 'voshititelnoe_plate_maksi_poluprilegayushego_silueta', 'Восхитительное платье-макси полуприлегающего силуэта', NULL, 18, 'Восхитительное платье-макси полуприлегающего силуэта из трикотажного полотна зеленого цвета. Втачные рукава выполнены из полотна шифон и обработаны окантовкой. Линия талии эффектно подчеркнута втачным поясом. Платье отрезное по линии. Юбка изделия украшена сборкой. Декоративный элемент-воротничок в комплект не входит. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 145 см', 'ВА-П4-3230', NULL, 4250, NULL, 2000, '2017-09-20 20:01:05', '2017-09-20 20:01:05', NULL, 0, 1, '', '', '', '', '', ''),
(618, 0, 10, 0, 'voshititelnoe_plate_maksi_sinego_cveta', 'Восхитительное платье-макси синего цвета', NULL, 18, 'Восхитительное платье-макси полуприлегающего силуэта из трикотажного полотна синего-розового цвета. Рукава - реглан выполнены из полотна шифон и обработаны окантовкой. Перед изделия украшен декоративным элементом — цветы. Линия талии эффектно подчеркнута втачным поясом. Платье отрезное по линии. Юбка изделия украшена сборкой. \r\nАксессуары в комплект не входят. \r\nСостав: Полиэстер 95%, Эластан 5%.\r\nДлина изделия 141- 145 см.\r\nДлина рукава 50 см.\r\nШирина рукава 21 см.\r\nГлубина проймы 22.5 см.\r\nДлина плечевого шва 21 см.\r\nДлина от плечевого шва до талии 47.5 см.', 'ВА-П5-3302', NULL, 4250, NULL, 2000, '2017-09-20 20:14:19', '2017-11-20 15:39:32', NULL, 0, 1, '', '', '', '', '', ''),
(619, 0, 10, 0, 'stilnoe_pryamoe_platn_s_geometricheskim_risunkom', 'Стильное прямое платьн с геометрическим рисунком', NULL, 18, 'Стильное платье прямого силуэта из трикотажного полотна сине-серого цвета с геометрическим рисунком. Круглый вырез изделия дополнен цельнокроеным воротником-хомут. Платье с отрезной кокеткой, выполненной из перфорированного полотна, имитирующего кожу. Изделие с цельнокроенными рукавами. Перед изделия дополнен декоративными сборками. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 113-120 см.\r\nСостав: 	Вискоза 95%, Эластан 5%\r\n', 'ВА-П4-3012/4-5', NULL, 4050, NULL, 1900, '2017-09-20 20:21:52', '2017-09-20 20:21:52', NULL, 0, 1, '', '', '', '', '', ''),
(620, 0, 10, 0, 'vechernee_plate_poluprilegayushego_silueta', 'Вечернее платье полуприлегающего силуэта', NULL, 18, 'Вечернее платье полуприлегающего силуэта из текстильного полотна (кружево на текстильной основе) бежевого цвета с цветочным узором. Фигурный вырез обработан кантом. Втачные рукава и низ изделия дополнены вставками из струящегося полупрозрачного шифона. Аксессуары в комплект не входят.\r\nСостав: Полиэстер 95%, Эластан 5%\r\nДлина изделия 110 см.\r\nДлина рукава 54 см.\r\nШирина рукава 20 см.\r\nГлубина проймы 26.5 см.\r\nДлина плечевого шва 11 см.\r\nДлина от плечевого шва до талии 50.5 см.\r\n', 'ВА-П4-3481', NULL, 4650, NULL, 2200, '2017-09-20 20:28:19', '2017-09-20 20:32:27', NULL, 0, 1, '', '', '', '', '', ''),
(621, 0, 10, 0, 'izyashnoe_kruzhevnoe_plate_na_podkladke', 'Изящное кружевное платье на подкладке', NULL, 19, 'Изящное платье полуприлегающего силуэта из трикотажного полотна в  бежевых тонах. Круглый вырез изделия обработан внутренней обтачкой. Платье двойное: верхняя часть выполненная из кружевного полотна и посажена на тонкий однотонный подклад. Платье с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —100 см.\r\nСостав: 	Полиэстер 95%, Эластан 5%.', 'ВА-П4-3227/3', NULL, 4650, NULL, 2200, '2017-09-20 20:36:06', '2017-11-20 15:29:42', NULL, 0, 1, '', '', '', '', '', ''),
(622, 0, 10, 0, 'plate_v_krupnuyu_kletku_so_srednim_rukavom', 'Платье в крупную клетку со средним рукавом', NULL, 18, 'Очаровательное платье из трикотажного плательного полотна. Круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. По низу изделия декоративное кружево.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 93-97см.\r\nСостав: Полиэстер 95%, Эластан 5%.\r\n', 'ВА-П4-3227/18-21', NULL, 3250, NULL, 1500, '2017-09-20 20:46:09', '2017-09-20 20:46:09', NULL, 0, 1, '', '', '', '', '', ''),
(623, 0, 10, 0, 'trikotazhnoe_plate_s_dekorativnym_kruzhevom', 'Трикотажное платье с декоративным кружевом', NULL, 18, 'Очаровательное платье из трикотажного плательного полотна черного цвета. Круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. Кокетка, низ рукавов и низ изделия дополнены декоративным кружевом.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 95-100 см.\r\nСостав:	Вискоза 95%, Эластан 5%.', 'ВА-П4-3227/22-25', NULL, 3450, NULL, 1600, '2017-09-20 21:03:12', '2017-09-20 21:03:12', NULL, 0, 1, '', '', '', '', '', ''),
(624, 0, 10, 0, 'klassicheskoe_trikotazhnoe_plate_', 'Классическое трикотажное платье', NULL, 18, 'Изысканное платье полуприлегающего силуэта из трикотажного полотна. Круглый вырез горловины обработан внутренней обтачкой. Платье с втачными рукавами. Перед изделия украшен декоративными отстрочками. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 96-100 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3227/10-17', NULL, 3050, NULL, 1400, '2017-09-20 21:14:26', '2017-09-20 21:14:26', NULL, 0, 1, '', '', '', '', '', ''),
(625, 0, 10, 0, 'plate_v_goroh_s_kruzhevnymi_kurakami', 'Платье в горох с кружевными кураками', NULL, 18, 'Изящное платье полуприлегающего силуэта из текстильного полотна черного цвета в крупный белый горох. Круглый вырез изделия обработан внутренней обтачкой и дополнен кружевной кокеткой. Втачные рукава платья выполнены из кружевного полотна.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100-104 см.\r\nСостав: 	Полиэстер 95%, Эластан 5%.', 'ВА-П4-3227/8-9', NULL, 3850, NULL, 1800, '2017-09-20 21:24:45', '2017-09-20 21:26:10', NULL, 0, 1, '', '', '', '', '', ''),
(626, 0, 10, 0, 'naryadnoe_chernoe_plate_s_vyshivkoj', 'Нарядное черное платье с вышивкой', NULL, 18, 'Роскошное платье прилегающего силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан обтачкой. Низ втачных рукавов и низ изделия дополнены кружевом в тон изделия. Перед платья двойной, верхний слой выполнен из сетки с великолепной вышивкой. Спинка изделия дополнена застежной на потайную молнию и разрезом по низу. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 128-129 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3671', NULL, 4650, NULL, 2200, '2017-09-20 21:33:11', '2017-09-20 21:33:11', NULL, 0, 1, '', '', '', '', '', ''),
(627, 0, 10, 0, 'lakonichnoe_plate_v_kletku', 'Лаконичное платье в клетку', NULL, 18, 'Лаконичное платье полуприлигающего силуэта из трикотажного полотна в клетку. Круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. Спинка изделия сверху дополнена молнией, по низу — небольшой разрез. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 90-102 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3527/0-3', NULL, 3450, NULL, 1600, '2017-09-20 21:42:31', '2017-09-20 21:42:31', NULL, 0, 1, '', '', '', '', '', ''),
(628, 0, 10, 0, 'yarkoe_plate_s_kuponnym_risunkom', 'Яркое платье с купонным рисунком', NULL, 18, 'Яркое платье полуприлегающего силуэта из трикотажного полотна с купонным цветочным рисунком. Круглый вырез изделия обработан внешней обтачкой и дополнен декоративным элементом. Платье с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —  96-110 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3527/4-7', NULL, 3450, NULL, 1600, '2017-09-20 21:50:04', '2017-11-20 13:41:46', NULL, 0, 1, '', '', '', '', '', ''),
(629, 0, 10, 0, 'zhenstvennoe_plate_v_goroh', 'Женственное платье в горох', NULL, 18, 'Женственное платье полуприлегающего силуэта из трикотажного полотна в «горох». Круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. Спинка изделия по низу  дополнена небольшим разрезом..  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —  102-108 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3527/8-11', NULL, 3850, NULL, 1800, '2017-09-20 21:55:55', '2017-09-20 21:55:55', NULL, 0, 1, '', '', '', '', '', ''),
(630, 0, 10, 0, 'cherno_beloe_trikotazhnoe_plate_s_geometricheskim_risunkom', 'Черно-белое трикотажное платье с геометрическим рисунком', NULL, 19, 'Очаровательное платье прямого силуэта из трикотажного полотна черно-белого цвета. Круглый вырез изделия обработан внутренней обтачкой и украшен металлическим элементом. Платье с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —110 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3429/1', NULL, 2850, NULL, 1300, '2017-09-20 22:01:13', '2017-09-20 22:01:13', NULL, 0, 1, '', '', '', '', '', ''),
(631, 0, 10, 0, 'seroe_trikotazhnoe_plate_so_stojkoj', 'Серое трикотажное платье со стойкой', NULL, 18, 'Стильное платье  полуприлегающего силуэта из трикотажного полотна с рельефным рисунком серого цвета. Платье с воротником «стойка» и втачными рукавами. Перед изделия украшен декоративным элементом в форме цветка. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 95-99 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П3-3558', NULL, 3050, NULL, 1400, '2017-09-20 22:10:07', '2017-09-20 22:10:07', NULL, 0, 1, '', '', '', '', '', ''),
(632, 0, 10, 0, 'stilnoe_sine_beloe_plate_s_relefnoj_fakturoj', 'Стильное сине-белое платье с рельефной фактурой', NULL, 19, 'Стильное платье полуприлегающего силуэта из трикотажного полотна сине-белого цвета с рельефной фактурой. Фигурный вырез обработан контрастной окантовкой. Втачные рукава и низ изделия обработаны окантовками.  Аксессуары в комплект не входят. \r\nДлина изделия по спинке  от плечевого шва до низа изделия — 102 см.\r\nСостав: 	Вискоза 95%, Эластан 5%.', 'ВА-П3-3114/3', NULL, 2850, NULL, 1300, '2017-09-20 22:15:08', '2017-09-20 22:15:08', NULL, 0, 1, '', '', '', '', '', ''),
(633, 0, 10, 0, 'stilnoe_plate_s_kuponnym_risunkom', 'Стильное платье с купонным рисунком', NULL, 18, 'Стильное платье полуприлегающего силуэта  из трикотажного полотна сине-белого цвета с купонным рисунком. Круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке  от плечевого шва до низа изделия — 94-98 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-2900', NULL, 3050, NULL, 1400, '2017-09-20 22:20:14', '2017-09-20 22:20:14', NULL, 0, 1, '', '', '', '', '', ''),
(634, 0, 10, 0, 'plate_iz_myagkogo_trikotazha_s_kuliskoj', 'Платье из мягкого трикотажа с кулиской', NULL, 18, 'Очаровательное платье полуприлегающего силуэта из мягкого трикотажного полотна. Круглый вырез изделие обработан внутренней обтачкой. Платье со спущенной линией проймы и втачными рукавами. Линия талии эффектно подчеркнута кулиской. Низ изделия выполнен из вязанного полотна.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 105-110 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%.\r\n', 'ВА-П3-3082/12-17', NULL, 4150, NULL, 1950, '2017-09-20 22:25:16', '2017-10-18 16:06:43', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(635, 0, 10, 0, 'vyazanoe_trikotazhnoe_plate_s_gradientnoj_okraskoj', 'Вязаное трикотажное платье с градиентной окраской', NULL, 18, 'Волшебное платье полуприлегающего силуэта из вязаного трикотажного полотна градиентной окраски. V-образный вырез изделия обработан внутренней обтачкой и дополнен декоративным элементом «стразы». Платье с втачными рукавами длиной 3/4.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 124-127 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3670/0-5', NULL, 4050, NULL, 1900, '2017-09-20 22:46:34', '2017-10-18 16:57:34', NULL, 0, 1, '', '', '', '', '', ''),
(636, 0, 10, 0, 'trikotazhnyj_kostyum_s_yubkoj_midi', 'Трикотажный костюм с юбкой миди', NULL, 18, 'Женственный костюм черного цвета, состоящий из блузы и юбки.\r\nБлуза свободного силуэта из плотного трикотажного полотна черного цвета Круглый вырез изделия обработан внутренней обтачкой. Низ блузы и втачных рукавов дополнены широкой вставкой с контрастным узором. В боковых швах изделия разрезы. Блуза удлиненна по спинке. Стильная юбка полуприлегающего силуэта из трикотажного полотна черного цвета. Изделие с высокой посадкой. Верх юбки обработан внутренней обтачкой и дополнен застежкой на молнию. Низ изделия дополнен широкой вставкой с контрастным узором и шлицей. \r\nАксессуары в комплект не входят.\r\nДлина блузы по спинке от плечевого шва до низа изделия —  63-69 см.\r\nДлина юбки от пояса до низа — 66-72 см.\r\nСостав: 	Вискоза 95%, Эластан 5%', 'ВА-К4-3678/4-5', NULL, 3650, NULL, 1700, '2017-09-20 22:54:03', '2017-10-06 15:37:56', NULL, 0, 1, '', '', '', '', '', ''),
(637, 0, 10, 0, 'stilnoe_plate_a_silueta_iz_trikotazhnogo_barhata', 'Стильное платье А-силуэта из трикотажного бархата', NULL, 18, 'Стильное платье А-силуэта из трикотажного бархата черного цвета с купонным рисунком. Круглый вырез изделия обработан внутренней обтачкой и дополнен пуговицами. В комплект изделия входит съемный отложной белый воротничок, который можно пристегнуть на пуговицы и добавить образу официальность. Втачные рукава выполнены из бархата с купонным рисунком и дополнены сборкой.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 100-107 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П3-3668', NULL, 4050, NULL, 1900, '2017-09-20 23:01:56', '2017-09-20 23:01:56', NULL, 0, 1, '', '', '', '', '', ''),
(638, 0, 10, 0, 'elegantnoe_plate_s_krupnoj_perforaciej', 'Элегантное платье  с крупной перфорацией', NULL, 18, 'Элегантное платье полуприлегающего силуэта из трикотажного полотна. Круглый вырез обработан кантом. Отрезная кокетка и втачные рукава выполнена из декоративного полотна с крупной перфорацией.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия -  100 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-2891/2-5', NULL, 3850, NULL, 1800, '2017-09-21 10:43:29', '2017-09-21 10:43:29', NULL, 0, 1, '', '', '', '', '', ''),
(639, 0, 10, 0, 'stilnoe_plate_s_elementami_iz_ekokozhi', 'Стильное платье с элементами из экокожи', NULL, 18, 'Эффектное платье полуприлегающего силуэта из трикотажного полотна. Круглый вырез обработан внутренней бейкой. Отрезная кокетка и втачные рукава выполнена из декоративного полотна имитирующего «кожу» с крупной перфорацией. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия -102 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-2891/6-9', NULL, 4050, NULL, 1900, '2017-09-21 10:53:11', '2017-09-21 10:53:11', NULL, 0, 1, '', '', '', '', '', ''),
(640, 0, 10, 0, 'plate_s_kruglym_vyrezom_gorloviny', 'Платье с круглым вырезом горловины', NULL, 18, 'Восхитительное платье полуприлегающего силуэта из трикотажного полотна. Круглый вырез изделия обработан внутренней обтачкой и дополнен пуговицами. Втачные рукава обработаны окантовками. Перед изделия дополнен накладными карманы с застежкой на пуговицу. По спинке изделия застежка на потайную молнию. Платье дополнено шлицей. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-3433', NULL, 4250, NULL, 2000, '2017-09-21 11:14:38', '2017-09-21 11:14:38', NULL, 0, 1, '', '', '', '', '', ''),
(641, 0, 10, 0, 'zhenstvennoe_plate_s_vtachnym_poyasom', 'Женственное платье с втачным поясом', NULL, 18, 'Привлекательное платье полуприлегающего силуэта из плотного трикотажного полотна. Круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. Перед изделия дополнен складками и втачным поясом. По спинке изделия застежка на потайную молнию. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 95 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-П4-3458', NULL, 4450, NULL, 2100, '2017-09-21 11:39:12', '2017-09-21 11:39:12', NULL, 0, 1, '', '', '', '', '', ''),
(642, 0, 10, 0, 'plate_pryamogo_silueta_iz_ekokozhi', 'Платье прямого силуэта из экокожи', NULL, 18, 'Роскошное платье прямого силуэта из текстильного полотна, имитирующего кожу, черного цвета. Круглый вырез изделия обработан внутренней обтачкой. По низу изделия — перфорация. В боковых швах платья карманы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 97-105 см.\r\nСостав: Полиэстер 95%, Эластан 5%\r\n', 'ВА-П2-3656', NULL, 4050, NULL, 1900, '2017-09-21 12:07:59', '2017-09-21 12:07:59', NULL, 0, 1, '', '', '', '', '', ''),
(643, 0, 10, 0, 'plate_s_yarkim_zhaketom', 'Платье с ярким жакетом', NULL, 18, 'Эффектный костюм состоящий: из трикотажного платья темно-серого цвета приталенного силуэта и жакета из текстильного полотна розового цвета с набивным цветочным рисунком. Круглый вырез платья обработан внутренней обтачкой. Имеет укороченный втачной рукав. На спинке платья застежка на потайную молнию, по низу дополнено разрезом. Элегантный укороченный жакет с втачными рукавами и застежкой на пуговицы. Аксессуары в комплект не входят. \r\nДлина жакета от плечевого шва по спинке до низа изделия — 46-52 см.\r\nДлина платья от плечевого шва до низа изделия —  93-105 см.\r\nСостав: 	Полиэстер 95%, Эластан 5%.', 'ВА-К3-3573', NULL, 4850, NULL, 2300, '2017-09-21 12:29:52', '2017-09-21 12:29:52', NULL, 0, 1, '', '', '', '', '', ''),
(644, 0, 10, 0, 'trikotazhnoe_plate_s_kruzhevnym_kardiganom', 'Трикотажное платье с кружевным кардиганом', NULL, 18, 'Очаровательный комплект состоящий из платья прилегающего силуэта и легкого кардигана прямого силуэта. Платье выполнено из трикотажного полотна средней плотности. Фигурный вырез изделия обработан внутренней обтачкой. Платье с завышенной линией талии. Спинка изделия дополнена вытачками и разрером. Застежка на потайную молнию по спинке изделия. Кардиган выполнен из роскошного кружева. Кардиган с втачными рукавами. Круглый вырез изделия обработан бейкой и дополнен застежкой на декоративную пуговицу. Комплект создает восхитительный весенний образ! \r\nАксессуары в комплект не входят.\r\nДлина платья по спинке от плечевого шва до низа изделия — 92-100см.\r\nДлина кардигана по спинке от плечевого шва до низа изделия — 84-90см.\r\nСостав: 	Вискоза 95%, Эластан 5%.', 'ВА-П4-3539/2-7', NULL, 5250, NULL, 2500, '2017-09-21 12:40:31', '2017-09-21 12:40:31', NULL, 0, 1, '', '', '', '', '', ''),
(645, 0, 10, 0, 'romantichnoe_plate_poluprilegayushego_silueta', 'Романтичное платье полуприлегающего силуэта', NULL, 18, 'Яркое и романтичное платье полуприлегающего силуэта из трикотажного полотна. Круглый вырез изделия обработан внутренней обтачкой. Низ втачных рукавов дополнен встречными складками и обработан окантовкой. Перед изделия двойной, дополнен легким вышитым кружевом. Платье отрезное по линии талии. Юбка дополнена складками. Спинка изделия дополнена застежкой на потайную молнию. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 120-125 см. \r\nРост модели 175 см.', 'ВА-П4-3371/27-30', NULL, 4250, NULL, 2000, '2017-09-21 12:42:01', '2017-11-20 12:59:20', NULL, 0, 1, '', '', '', '', '', ''),
(646, 0, 10, 0, 'naryadnoe_trikotazhnoe_plate_s_kruzhevom', 'Нарядное трикотажное платье с кружевом', NULL, 18, 'Нарядное платье прилегающего силуэта из трикотажного полотна. Круглый вырез изделия обработан обтачкой. Перед и втачные рукава выполнены из великолепного кружева. Спинка изделия  по низу дополнена разрезом. Аксессуары в комплект не входят.\r\nДлина платья по спинке от плечевого шва до низа изделия —  108-112 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3637/4-9', NULL, 4650, NULL, 2200, '2017-09-21 13:02:31', '2017-09-21 13:03:06', NULL, 0, 1, '', '', '', '', '', ''),
(647, 0, 10, 0, 'romantichnoe_plate_sine_belogo_cveta', 'Романтичное платье сине-белого цвета', NULL, 7, 'Романтичное платье полуприлегающего силуэта из трикотажного полотна сине-белого цвета. Круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами три четверти. Платье отрезное по линии талии. Юбка с купонным рисунком.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 125 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-П4-3371', NULL, 3650, NULL, 1700, '2017-09-21 13:14:02', '2017-09-21 13:14:02', NULL, 0, 1, '', '', '', '', '', ''),
(648, 0, 10, 0, 'stilnoe_pritalennoe_plate_s_kozhanymi_vstavkami', 'Стильное приталенное платье с кожаными вставками', NULL, 18, 'Стильное платье приталенного силуэта из трикотажного полотна. Круглый вырез изделия обработан внешней обтачкой. Платье декорировано элементами из перфорированной «кожи». Изделие с втачными рукавами, отрезное по линии талии. Юбка изделия дополнена накладными декоративными карманами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —104-107 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П3-3540/2-5', NULL, 3850, NULL, 1800, '2017-09-21 13:14:44', '2017-09-21 13:14:44', NULL, 0, 1, '', '', '', '', '', ''),
(649, 0, 10, 0, 'plate_iz_tekstilya_s_yarkim_cvetochnym_risunkom', 'Платье из текстиля с ярким цветочным рисунком', NULL, 18, 'Стильное платье полуприлегающего силуэта из текстильного полотна с ярким цветочным рисунком. Перед изделия дополнен декоративным элементом из легкого кружева. Круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. Изделие отрезное по линии талии. Аксессуары в комплект не входят.\r\nДлина платья по спинке от плечевого шва до низа изделия — 113-118 см.\r\nСостав: 	Полиэстер 95%, Эластан 5%.', 'ВА-П3-3639/3-6', NULL, 4050, NULL, 1900, '2017-09-21 13:25:55', '2017-09-21 13:25:55', NULL, 0, 1, '', '', '', '', '', ''),
(650, 0, 10, 0, 'plate_chernogo_cveta_s_risunkom_iz_straz', 'Платье черного цвета с рисунком из страз', NULL, 18, 'Ослепительное платье полуприлегающего силуэта из трикотажного полотна черного цвета. Круглый вырез и линия талии обработаны окантовкой и украшен рисунком из страз . Платье отрезное по линии талии. Юбка дополнена складками.Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 125 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-3371/4-6', NULL, 4490, NULL, 2120, '2017-09-21 13:28:56', '2017-09-21 13:28:56', NULL, 0, 1, '', '', '', '', '', ''),
(651, 0, 10, 0, 'otreznoe_po_linii_plate_iz_trikotazha', 'Отрезное по линии платье из трикотажа', NULL, 18, 'Роскошное платье полуприлегающего силуэта из трикотажного полотна сине-белого цвета. Круглый вырез изделия обработан внутренней обтачкой. Низ втачных рукавов дополнен кружевом. Платье отрезное по линии талии, юбка изделия дополнена складками и изящным кружевом по низу. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 123-126 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%.', 'ВА-П4-3382/3', NULL, 3850, NULL, 1800, '2017-09-21 13:32:41', '2017-09-21 13:32:41', NULL, 0, 1, '', '', '', '', '', ''),
(652, 0, 10, 0, 'trikotazhnoe_plate_s_cvetami', 'Трикотажное платье с цветами', NULL, 18, 'Очаровательное платье прямого силуэта из трикотажного полотна с цветами. Круглый вырез изделия обработан внутренней обтачкой. По низу втачных рукавов и низу изделия воланы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 93-100 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3561', NULL, 3450, NULL, 1600, '2017-09-21 13:39:11', '2017-11-20 12:07:37', NULL, 0, 1, '', '', '', '', '', ''),
(653, 0, 10, 0, 'plate_s_vyrezom_azhurnoj_koketkoj', 'Платье с вырезом ажурной кокеткой', NULL, 18, 'Восхитительное платье-макси полуприлегающего силуэта из трикотажного полотна. Фигурный вырез изделия украшен ажурной кокеткой. Втачные рукава  обработаны окантовкой. Платье отрезное по линии бедер, юбка изделия дополнена складками. По боковым швам изделия — втачной пояс. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 132-135 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-2571/2-5', NULL, 4250, NULL, 2000, '2017-09-21 13:42:23', '2017-09-21 14:01:39', NULL, 0, 1, '', '', '', '', '', ''),
(654, 0, 10, 0, 'zhenstvennoe_plate_s_v_obraznym_vyrezom', 'Женственное платье с V-образным вырезом', NULL, 18, 'Женственное платье полуприлегающего силуэта из трикотажного полотна сине-зеленого цвета. V-образный вырез горловины обработан внутренней обтачкой. Платье с втачными рукавами. Перед изделия дополнен сборками. Платье отрезное по линии талии. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 120-123 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3645', NULL, 3650, NULL, 1700, '2017-09-21 13:45:46', '2017-09-21 13:45:46', NULL, 0, 1, '', '', '', '', '', ''),
(655, 0, 10, 0, 'zhenstvennoe_plate_v_melkij_goroh', 'Женственное платье в мелкий горох', NULL, 18, 'Женственное платье полуприлегающего силуэта из текстильного полотна синего цвета в мелкий белый горох. Фигурный вырез горловины обработан воротником-стойкой белого цвета. Перед платья дополнен декоративными пуговицами. Втачные рукава по низу обработаны контрастными манжетами. Платье отрезное по линии талии. Линия талии по переду подчеркнута сборками. В боковом шве изделия застежка на потайную молнию. Спинка платья дополнена шлицей. Аксессуары в комплект не входят.\r\nДлина платья по спинке от плечевого шва до низа изделия — 105 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П3-3643', NULL, 3850, NULL, 1800, '2017-09-21 13:54:25', '2017-09-21 13:54:25', NULL, 0, 1, '', '', '', '', '', ''),
(656, 0, 10, 0, 'plate_s_figurnym_vyrezom_na_spinke', 'Платье с фигурным вырезом на спинке', NULL, 18, 'Интересное платье-макси полуприлегающего силуэта из трикотажного полотна черно-желтого цвета. Фигурный вырез изделия по спинке украшен красивым кружевным элементом золотого цвета. Втачные рукава обработаны окантовкой. Платье отрезное по линии бедер, юбка изделия дополнена складками. По боковым швам изделия — втачной пояс. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия —  127 -130см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-2571/12-13', NULL, 4450, NULL, 2100, '2017-09-21 13:55:35', '2017-11-20 11:58:09', NULL, 0, 1, '', '', '', '', '', ''),
(657, 0, 10, 0, 'plate_sine_bezhevogo_cveta', 'Платье сине-бежевого цвета', NULL, 18, 'Восхитительное платье-макси полуприлегающего силуэта из трикотажного полотна сине-бежевого цвета. Круглый вырез изделия обработан внутренней обтачкой. Втачные рукава обработаны окантовкой и украшены таким же роскошным  узором, что и низ платья . Платье отрезное по линии талии, юбка изделия дополнена складками. По боковым швам изделия — втачной пояс. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 127- 130 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-2571/6-7', NULL, 4450, NULL, 2100, '2017-09-21 14:04:38', '2017-11-20 11:54:59', NULL, 0, 1, '', '', '', '', '', ''),
(658, 0, 10, 0, 'zhenstvennoe_ofisnoe_plate_iz_plotnogo_tekstilya', 'Женственное офисное платье из плотного текстиля', NULL, 18, 'Женственное офисное платье приталенного силуэта из плотного текстильного полотна. Горловина изделия обработана внутренней обтачкой. Платье с втачными рукавами три четверти. Перед изделия дополнен застежкой на пуговицах. Низ изделия украшен асимметричным воланом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 102-108 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3523/1-5', NULL, 3850, NULL, 1800, '2017-09-21 14:14:31', '2017-09-21 14:16:04', NULL, 0, 1, '', '', '', '', '', ''),
(659, 0, 10, 0, 'plate_cherno_fioletovogo_cveta', 'Платье черно-фиолетового цвета', NULL, 18, 'Обворожительное платье прямого силуэта из плотного трикотажного полотна черно-фиолетового цвета. Горловина изделия обработана внутренней обтачкой. Низ втачных рукавов и низ изделия украшены черным кружевом.  Спинка изделия сверху дополнена потайной молнией, по низу — разрез. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100-108 см.\r\nСостав:Полиэстер 95%, Эластан 5%', 'ВА-П4-3528', NULL, 4250, NULL, 2000, '2017-09-21 14:23:00', '2017-09-21 14:23:00', NULL, 0, 1, '', '', '', '', '', ''),
(660, 0, 10, 0, 'voshititelnoe_plate_prilegayushego_silueta', 'Восхитительное платье прилегающего силуэта', NULL, 18, 'Восхитительное платье прилегающего силуэта из трикотажного полотна . Фигурный вырез изделия обработан окантовкой. Планка переда дополнена сутажной застежкой.  Линия плеча укорочена и дополнена верхними складками по окату рукава. На юбке заложены крупные складки.Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 95-104 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-2946', NULL, 4050, NULL, 1900, '2017-09-21 14:31:41', '2017-09-21 14:31:41', NULL, 0, 1, '', '', '', '', '', ''),
(661, 0, 10, 0, 'trikotazhnoe_plate_s_otdelkoj_iz_ekokozhi', 'Трикотажное платье с отделкой из экокожи', NULL, 18, 'Трендовое платье полуприлегающего силуэта из трикотажного полотна черно-серебряного цвета. V-образный вырез изделия обработан обтачкой. Низ втачных рукавов и обтачка горловины выполнены из трикотажного полотна имитирующего кожу.  Нижние части рукавов дополнены молниями серебристого цвета. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 98-103 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3526/2-3', NULL, 3850, NULL, 1800, '2017-09-21 14:39:42', '2017-09-21 14:39:42', NULL, 0, 1, '', '', '', '', '', ''),
(662, 0, 10, 0, 'roskoshnoe_plate_s_odnotonnymi_vstavkami', 'Роскошное платье с однотонными вставками', NULL, 18, 'Роскошное платье полуприлегающего силуэта из текстильного  полотна бордового цвета. Круглый вырез изделия обработна внешней обтачкой. Перед изделия дополнен однотонными вставками и украшен металлизированным элементом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —93-98 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%.', 'ВА-П3-3126/2-3', NULL, 4050, NULL, 1900, '2017-09-21 14:45:48', '2017-09-21 14:46:56', NULL, 0, 1, '', '', '', '', '', ''),
(663, 0, 10, 0, 'teploe_plate_s_figurnym_vyrezom', 'Теплое платье с фигурным вырезом', NULL, 18, 'Обворожительное платье полуприлегающего силуэта из теплого текстильного полотна с добавлением ангорки. Фигурный вырез изделия и низ рукавов обработан контрастным кантом. Платье с втачными рукавами. Благородный серый цвет в сочетании с ажурной фактурой ткани создает утонченный и романтичный образ. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100-110 см.\r\nСостав: Шерсть 80%, Акрил 20%.', 'ВА-П4-3430/2-3', NULL, 4450, NULL, 2100, '2017-09-21 14:50:32', '2017-09-21 14:50:32', NULL, 0, 1, '', '', '', '', '', ''),
(664, 0, 10, 0, 'naryadnoe_plate_s_relefnoj_fakturoj', 'Нарядное платье с рельефной фактурой', NULL, 18, 'Очаровательное платье прямого силуэта из трикотажного полотна с рельефной фактурой. Круглый вырез изделия обработан внутренней обтачкой. Низ рукавов-реглан дополнен складками и обработан окантовкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 110-115 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-3423/0-5', NULL, 3570, NULL, 1660, '2017-09-21 14:57:29', '2017-11-20 11:33:13', NULL, 0, 1, '', '', '', '', '', ''),
(665, 0, 10, 0, 'trikotazhnoe_plate_so_spushennoj_liniej_projmy', 'Трикотажное платье со спущенной линией проймы', NULL, 18, 'Интересное платье полуприлегающего силуэта из трикотажного полотна. V-образный вырез изделия. Платье со спущенной линией проймы и втачными рукавами. Перед изделия украшен металлическим элементом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 106-110 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3525/0-3', NULL, 3850, NULL, 1800, '2017-09-21 15:05:51', '2017-09-21 15:05:51', NULL, 0, 1, '', '', '', '', '', ''),
(666, 0, 10, 0, 'korotkoe_seroe_plate_s_kruzhevom', 'Короткое серое платье с кружевом', NULL, 18, 'Стильное платье прямого силуэта из плотного плательного полотна серого цвета. Круглый вырез изделия обработан внутренней обтачкой и украшен декоративным элементом из страз. Втачные рукава дополнены складками и украшены широким контрастным кружевом. По низу изделия широкое полупрозрачное кружево. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 94-100 см.\r\nСостав: 	Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-П4-3562', NULL, 3650, NULL, 1700, '2017-09-21 15:18:50', '2017-09-21 15:18:50', NULL, 0, 1, '', '', '', '', '', ''),
(667, 0, 10, 0, 'pryamoe_plate_s_otlozhnym_vorotnichkom', 'Прямое платье с отложным воротничком', NULL, 18, 'Великолепное платье прямого силуэта из текстильного полотна черно-коричневого цвета. Фигурный вырез изделия обработан отложным воротничком. Верхняя часть переда изделия дополнена застежкой на пуговицы. Платье со спущенной линией проймы. Низ втачных рукавов обработан манжетами. Отложной воротничок, манжеты и накладные карманы выполнены из кожи. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 96-105 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%.', 'ВА-П4-3457', NULL, 4250, NULL, 2000, '2017-09-21 15:23:55', '2017-09-21 15:23:55', NULL, 0, 1, '', '', '', '', '', ''),
(668, 0, 10, 0, 'elegantnoe_plate_serogo_cveta', 'Элегантное платье  серого цвета', NULL, 18, 'Элегантное платье прямого силуэта из трикотажного полотна серо-черного цвета. Круглый вырез изделия обработан внутренней обтачкой и украшен декоративным элементом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 95-102 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-2815', NULL, 4050, NULL, 1900, '2017-09-21 15:25:58', '2017-09-21 15:25:58', NULL, 0, 1, '', '', '', '', '', ''),
(669, 0, 10, 0, 'trikotazhnoe_plate_s_dekorativnoj_koketkoj', 'Трикотажное платье с декоративной кокеткой', NULL, 18, 'Эффектное платье свободного силуэта из трикотажного полотна бежево-черного цвета. Фигурный вырез обработан внешней контрастной обтачкой и дополнен разрезом. Перед изделия украшен декоративной кокеткой. Втачные рукава обработаны контрастной окантовкой. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 103 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3542', NULL, 3850, NULL, 1800, '2017-09-21 15:36:56', '2017-09-21 15:36:56', NULL, 0, 1, '', '', '', '', '', ''),
(670, 0, 10, 0, 'povsednevnoe_plate_s_otlozhnym_vorotnikom', 'Повседневное платье с отложным воротником', NULL, 19, 'Восхитительное платье полуприлегающего силуэта из плотного трикотажного полотна. Фигурный вырез изделия обработан внутренней обтачкой и дополнен отложным воротничком контрастного цвета. Втачные рукава обработаны внутренней обтачкой и дополнены манжетами. Отложной воротничок и манжеты пришиты одной машинной строчкой, поэтому, при желании, можно их снять. Верхняя часть изделия дополнена застежкой на пуговицы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —103 см.', 'ВА-П4-3450', NULL, 4450, NULL, 2100, '2017-09-21 15:39:16', '2017-09-21 15:43:02', NULL, 0, 1, '', '', '', '', '', ''),
(671, 0, 10, 0, 'izyashnoe_trikotazhnoe_plate_s_kontrastnymi_kantami', 'Изящное трикотажное платье с контрастными кантами', NULL, 18, 'Изящное платье прилегающего силуэта из трикотажного полотна серого цвета. Круглый вырез изделия обработан внутренней обтачкой. Перед изделия дополнен контрастными кантами. Платье с втачными рукавами. По спинке изделия застежка на потайную молнию. Аксессуары в комплект не входят.\r\nДлина изделия по спинке  от плечевого шва до низа изделия — 98-106 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3451', NULL, 4050, NULL, 1900, '2017-09-21 15:41:30', '2017-09-21 15:41:30', NULL, 0, 1, '', '', '', '', '', ''),
(672, 0, 10, 0, 'sine_beloe_ofisnoe_plate', 'Сине-белое офисное платье', NULL, 18, 'Стильное платье полуприлегающего силуэта из трикотажного полотна сине-белого цвета. Круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. Перед изделия дополнен ажурным элементов в виде совы. По спинке изделия застежка на потайную молнию. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —96-102 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3437', NULL, 4050, NULL, 1900, '2017-09-21 15:46:17', '2017-09-21 15:46:17', NULL, 0, 1, '', '', '', '', '', ''),
(673, 0, 10, 0, 'plate_iz_trikotazha_sine_belogo_cveta', 'Платье из трикотажа сине-белого цвета', NULL, 18, 'Очаровательное платье полуприлегающего силуэта из трикотажного полотна сине-белого цвета. Круглый вырез изделия обработан внутренней обтачкой. Платье со спущенной линией проймы. Втачные рукава обработаны окантовкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 97 -105 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-2192', NULL, 3450, NULL, 1600, '2017-09-21 15:57:54', '2017-09-21 15:57:54', NULL, 0, 1, '', '', '', '', '', ''),
(674, 0, 10, 0, 'trikotazhnoe_plate_s_cvetnoj_vstavkoj', 'Трикотажное платье с цветной вставкой', NULL, 18, 'Восхитительное платье полуприлегающего силуэта из трикотажного полотна черно-желтого цвета. Круглый вырез изделия обработан внешней обтачкой.  Платье с втачными рукавами. Перед изделия выполнен из яркого цветного полотна. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —100-105 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3454', NULL, 4050, NULL, 1900, '2017-09-21 15:59:17', '2017-09-21 15:59:17', NULL, 0, 1, '', '', '', '', '', ''),
(675, 0, 10, 0, 'plate_prilegayushego_silueta_cherno_belogo_cveta', 'Платье прилегающего силуэта черно-белого цвета', NULL, 18, 'Изысканное платье прилегающего силуэта из трикотажного полотна черно-белого цвета. Круглый вырез изделия обработан внутренней обтачкой и украшен декоративным элементом. По спинке изделия потайная молния. Платье отрезное по линии талии. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 93-102 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-2929', NULL, 4050, NULL, 1900, '2017-09-21 16:04:35', '2017-09-21 16:04:35', NULL, 0, 1, '', '', '', '', '', ''),
(676, 0, 10, 0, 'naryadnoe_plate_s_shifonovymi_rukavami', 'Нарядное платье с шифоновыми рукавами', NULL, 18, 'Эффектное женственное платье прилегающего силуэта - восхитительное сочетание трикотажного полотна и ткани «шифон». Горловина изделия украшена декоративным элементом из страз. Широкие втачные рукава выполнены из шифона с купонным рисунком и припосажены на однотонные манжеты. Линия талии по переду изделия подчеркнута втачным однотонным поясом. По спинке изделия - потайная молния. Низ юбки дополнен шлицей. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия -  95-107 см.\r\nСостав: Вискоза 95%, Эластан 5%. ', 'ВА-П5-3506', NULL, 4050, NULL, 1900, '2017-09-21 16:09:43', '2017-09-21 16:09:43', NULL, 0, 1, '', '', '', '', '', ''),
(677, 0, 10, 0, 'zhenstvennoe_plate_poluprilegayushego_silueta_', 'Женственное платье полуприлегающего силуэта', NULL, 19, 'Женственное платье полуприлегающего силуэта и трикотажного полотна сине-белого цвета.\r\nГорловина изделия обработана внутренней обтачкой. Перед изделия украшен металлическим элементом с застежкой. Платье с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 110 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-2904', NULL, 3650, NULL, 1700, '2017-09-21 16:11:57', '2017-09-21 16:11:57', NULL, 0, 1, '', '', '', '', '', ''),
(678, 0, 10, 0, 'plate_s_figurnym_vyrezom_gorloviny', 'Платье с фигурным вырезом горловины', NULL, 18, 'Эффектное платье полуприлегающего силуэта из трикотажного полотна синего цвета.  Платье с фигурным вырезом горловины. Отрезная кокетка выполнена из кружевного полотна. Перед изделия украшен металлизированным рисунком из страз. Платье с втачными рукавами и со спущенной проймой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 95-100 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3466', NULL, 3850, NULL, 1800, '2017-09-21 16:17:47', '2017-09-21 16:17:47', NULL, 0, 1, '', '', '', '', '', ''),
(679, 0, 10, 0, 'yarkoe_trikotazhnoe_plate_s_kuponnym_risunkom', 'Яркое трикотажное платье с купонным рисунком', NULL, 18, 'Яркое платье прилегающего силуэта из трикотажного полотна сине-красного цвета с купонным рисунком. Перед изделия и цельнокроеные рукава дополнены декоративным кружевом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100-107 см.\r\nСостав: 	Полиэстер 95%, Эластан 5%.', 'ВА-П4-2959/2-3', NULL, 3850, NULL, 1800, '2017-09-21 16:19:38', '2017-09-21 16:19:38', NULL, 0, 1, '', '', '', '', '', ''),
(680, 0, 10, 0, 'trikotazhnoe_plate_tunika_s_homutom', 'Трикотажное платье-туника с хомутом', NULL, 18, 'Ультра-модное платье-туника из трикотажного полотна. Втачные рукава платья из трикотажного полотна — лапша. Горловина-хомут и рукава со спущенной линией проймы — создают уютный образ платья, которое не хочется снимать. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 98-107 см.\r\nСостав: 	Вискоза 95%, Эластан 5%.', 'ВА-П4-3507/2-7', NULL, 3850, NULL, 1800, '2017-09-21 16:25:52', '2017-09-21 16:25:52', NULL, 0, 1, '', '', '', '', '', ''),
(681, 0, 10, 0, 'ocharovatelnoe_plate_polupritalennogo_silueta', 'Очаровательное платье полуприталенного силуэта', NULL, 18, 'Очаровательное платье полуприталенного силуэта из текстильного полотна красно-зеленого цвета. Верхняя часть переда выполнена из кружевного полотна и дополнена трикотажным подкладом контрастного черного цвета. Втачные рукава выполнены из кружева. Горловина изделия обработана внутренней обтачкой. Платье отрезное по линии талии. Юбка дополнена складками. По спинке изделия потайная молния. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 122-125 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3374/2-3', NULL, 4250, NULL, 2000, '2017-09-21 16:36:16', '2017-09-21 16:36:16', NULL, 0, 1, '', '', '', '', '', '');
