(682, 0, 10, 0, 'stilnoe_plate_maksi_s_kuponnym_risunkom', 'Стильное платье-макси с купонным рисунком', NULL, 18, 'Стильное платье-макси полуприлегающего силуэта из трикотажного полотна черно-серого цвета с купонным рисунком. Круглый вырез изделия обработан обтачкой. Верхняя часть переда декорирована роскошным кружевом. Платье отрезное по линии талии. Юбка дополнена конструктивным горизонтальным швом и складками. По спинке изделия - потайная молния. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 130-133 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П3-3080/1-2', NULL, 4250, NULL, 2000, '2017-09-21 16:42:12', '2017-09-21 16:42:12', NULL, 0, 1, '', '', '', '', '', ''),
(683, 0, 10, 0, 'zhenstvennoe_plate_midi_s_baskoj', 'Женственное платье миди с баской', NULL, 19, 'Обаятельное платье прилегающего силуэта из трикотажного полотна. Круглый вырез изделия и низ втачных рукавов обработаны контрастной окантовкой. Линия талии эффектно подчеркнута баской и металлическим декоративным элементом. В боковом шве платья — потайная молния. Юбка изделия дополнена шлицей. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 101 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-3425', NULL, 4930, NULL, 2340, '2017-09-21 16:43:34', '2017-09-21 16:43:34', NULL, 0, 1, '', '', '', '', '', ''),
(684, 0, 10, 0, 'cvetochnoe_plate_s_kozhanoj_vstavkoj', 'Цветочное платье с кожаной вставкой', NULL, 18, 'Очаровательное платье полуприлегающего силуэта из текстильного полотна синего цвета. Круглый вырез изделия обработан внутренней обтачкой. Платье со спущенной линией проймы и втачными рукавами. Линию талии эффектно подчеркивает вставка из перфорированной кожи. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 117-120 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3361/3-4', NULL, 4050, NULL, 1900, '2017-09-21 16:47:06', '2017-09-21 16:47:06', NULL, 0, 1, '', '', '', '', '', ''),
(685, 0, 10, 0, 'zhenstvennoe_plate_kuponnym_risunkom', 'Женственное платье купонным рисунком', NULL, 18, 'Женственное платье А-силуэта из трикотажного полотна синего цвета с купонным рисунком.  Круглый вырез изделия обработан внутренней обтачкой.  Отрезная кокетка изделия и втачные рукава выполнены из кружевной ткани. Аксессуары в комплект не входят.\r\nДлина изделия по спинке  от плечевого шва до низа изделия — 100 -104 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-П4-2894', NULL, 3850, NULL, 1800, '2017-09-21 16:55:21', '2017-09-21 16:55:21', NULL, 0, 1, '', '', '', '', '', ''),
(686, 0, 10, 0, 'plate_maksi_iz_plotnogo_zhakkarda', 'Платье-макси из плотного жаккарда', NULL, 18, 'Восхитительное платье полуприлегающего силуэта из плотного трикотажного полотна-жаккард серого цвета. Круглый вырез изделия обработан внутренней обтачкой. Рукава-реглан с акцентом из перфориванной кожи по линии плеч. На юбке сзади — эффектный разрез. Платье отлично сидит и выгодно подчеркивает фигуру. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 116-120 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3508', NULL, 4450, NULL, 2100, '2017-09-21 16:56:16', '2017-09-21 16:56:16', NULL, 0, 1, '', '', '', '', '', ''),
(687, 0, 10, 0, 'stilnoe_ofisnoe_plate_pritalennogo_silueta', 'Стильное офисное платье приталенного силуэта', NULL, 18, 'Стильное офисное платье приталенного силуэта из трикотажного полотна синего цвета. Круглый вырез изделия обработан внутренней обтачкой и дополнен металлическим элементом. Верхняя часть платья дополнена складками. Платье с цельнокроеными рукавами и отрезное по линии талии. По бокам юбки вставки из трикотажного полотна и ажурного кружева синего цвета. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 98-104 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-2827', NULL, 4050, NULL, 1900, '2017-09-21 17:01:51', '2017-09-21 17:01:51', NULL, 0, 1, '', '', '', '', '', ''),
(688, 0, 10, 0, 'izyashnoe_plate_iz_plotnogo_kruzhevnogo_polotna', 'Изящное платье из плотного кружевного полотна', NULL, 19, 'Изящное платье полуприлегающего силуэта из плотного кружевного полотна синего цвета. Горловина изделия украшена декоративной кокеткой. Рукава изделия втачные. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-2850', NULL, 3850, NULL, 1800, '2017-09-21 17:04:44', '2017-10-02 18:55:09', NULL, 0, 1, '', '', '', '', '', ''),
(689, 0, 10, 0, 'stilnoe_plate_pryamogo_silueta_iz_tekstilnogo_polotna', 'Стильное платье прямого силуэта из текстильного полотна', NULL, 18, 'Стильное платье прямого силуэта из текстильного полотна, имитирующего кожу. Круглый вырез изделия обработан внешней обтачкой и украшен металлическим элементом. По низу втачных рукавов — разрезы. По спинке изделия застежка на молнию. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —106-109 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3365', NULL, 5250, NULL, 2500, '2017-09-21 17:07:08', '2017-09-21 17:07:08', NULL, 0, 1, '', '', '', '', '', ''),
(690, 0, 10, 0, 'elegantnoe_ofisnoe_plate_iz_plotnogo_trikotazha', 'Элегантное офисное платье из плотного трикотажа', NULL, 19, 'Элегантное офисное платье приталенного силуэта из плотного трикотажного полотна сине-коричневого цвета. Горловина изделия обработана внутренней обтачкой. Платье с втачными рукавами три четверти. Перед и линия талии дополнены декоративными кантами черного цвета. Низ юбки по спинке дополнен шлицей. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 105 см.\r\nСостав: Вискоза 95%, Эластан 5%. ', 'ВА-П4-3521/1', NULL, 3950, NULL, 1850, '2017-09-21 17:17:59', '2017-09-21 17:17:59', NULL, 0, 1, '', '', '', '', '', ''),
(691, 0, 10, 0, 'plate_s_vstavkami_iz_krasnogo_kruzheva', 'Платье с вставками из красного кружева', NULL, 18, 'Элегантное платье прилегающего силуэта из трикотажного полотна синего цвета. Верхняя часть переда выполнена из кружевного полотна. Втачные рукава. Перед изделия дополнен вставками из красного кружева. Удобное и романтичное платье, подходит как для праздничного выхода, так и для ваших красивых будних дней.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 95-100 см\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-3499', NULL, 4050, NULL, 1900, '2017-09-21 17:21:45', '2017-09-21 17:21:45', NULL, 0, 1, '', '', '', '', '', ''),
(692, 0, 10, 0, 'modnoe_plate_pryamogo_silueta_iz_trikotazha', 'Модное платье прямого силуэта из трикотажа', NULL, 19, 'Модное платье прямого силуэта из трикотажного полотна синего цвета с принтом "птички". Круглый вырез обработан внутренней обтачкой. Линия плеча украшена декоративным элементом и дополнена складками. Изделие с втачными рукавами со спущенной линией проймы. По низу рукавов манжеты. Линия талии подчеркнута боковым втачным поясом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 109 см. \r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%.', 'ВА-П4-3471', NULL, 4050, NULL, 1900, '2017-09-21 17:22:47', '2017-09-21 17:22:47', NULL, 0, 1, '', '', '', '', '', ''),
(693, 0, 10, 0, 'chernyj_sarafan_poluprilegayushego_silueta', 'Черный сарафан полуприлегающего силуэта', NULL, 7, 'Очаровательный сарафан полуприлегающего силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан внутренней обтачкой. Перед сарафана украшен декоративными молниями. По спинке изделия металлическая молния.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —95 см.\r\nСостав:	Полиэстер 95%, Эластан 5%.', 'ВА-П2-3415/2', NULL, 3650, NULL, 1700, '2017-09-21 17:28:49', '2017-11-23 15:19:45', NULL, 0, 1, '', '', '', '', '', ''),
(694, 0, 10, 0, 'plate_sinego_cveta_s_relefnym_risunkom', 'Платье синего цвета с рельефным рисунком', NULL, 18, 'Элегантное платье прилегающего силуэта из трикотажного полотна синего цвета с рельефным рисунком. Платье с фигурным вырезом.  Втачные рукава выполнены из кружева. Перед изделия дополнен вставками из кружевного полотна. По спинке изделия - потайная молния. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 96-100 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П3-2964/4-5', NULL, 4250, NULL, 2000, '2017-09-21 17:29:19', '2017-11-15 14:49:48', NULL, 0, 1, '', '', '', '', '', ''),
(695, 0, 10, 0, 'trikotazhnyj_sarafan_s_azhurnym_kruzhevom', 'Трикотажный сарафан с ажурным кружевом', NULL, 19, 'Очаровательный сарафан полуприлегающего силуэта из трикотажного полотна серого цвета. Круглый вырез изделия обработан внутренней обтачкой. Перед сарафана украшен ажурным кружевом. По спинке изделия металлическая молния.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —100 см.\r\nСостав: 	Вискоза 95%, Эластан 5%.', 'ВА-П2-3415/1', NULL, 3850, NULL, 1800, '2017-09-21 17:31:45', '2017-09-21 17:31:45', NULL, 0, 1, '', '', '', '', '', ''),
(696, 0, 10, 0, 'teplyj_sarafan_s_karmanami', 'Теплый сарафан с карманами', NULL, 18, 'Очаровательный сарафан полуприлегающего силуэта из текстильного полотна серого цвета. Круглый вырез изделия обработан внутренней обтачкой. Теплая ткань с ангорой прекрасно оттеняет силуэт платья своей ажурной текстурой.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 94-103 см.\r\nСостав: Шерсть 80%, Акрил 20%.', 'ВА-П2-3415/4-5', NULL, 3650, NULL, 1700, '2017-09-21 17:35:28', '2017-09-21 17:35:28', NULL, 0, 1, '', '', '', '', '', ''),
(697, 0, 10, 0, 'sine_chernyj_sarafan_na_molnii', 'Сине-черный сарафан на молнии', NULL, 18, 'Стильный сарафан полуприлегающего силуэта из трикотажного полотна сине-черного цвета. Круглый вырез изделия обработан внутренней обтачкой. По переду изделия застежка на молнию. Сарафан  с карманами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —95-105 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П2-3403', NULL, 4050, NULL, 1900, '2017-09-21 17:39:41', '2017-09-21 17:39:41', NULL, 0, 1, '', '', '', '', '', ''),
(698, 0, 10, 0, 'plate_relefnym_uzorom_iz_barhata', 'Платье рельефным узором из бархата', NULL, 18, 'Элегантное платье прилегающего силуэта из текстильного полотна. Круглый вырез изделия и низ баски обработаны контрастной окантовкой. Втачные кружевные рукава добавляют образу утонченности. Верх платья выполнен из флока с роскошным рельефным узором из бархата  Спинка украшена кокеткой из черного кружева. Линия талии эффектно подчеркнута баской. В боковом шве платья — потайная молния. Юбка изделия дополнена шлицей. Легко разнообразить свой образ с этим платьем, дополнив его ремнем. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 98 -102 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П3-2337', NULL, 4450, NULL, 2100, '2017-09-21 17:42:34', '2017-11-19 23:12:00', NULL, 0, 1, '', '', '', '', '', ''),
(699, 0, 10, 0, 'uyutnoe_teploe_plate_iz_sherstyanogo_trikotazha', 'Уютное теплое платье из шерстяного трикотажа', NULL, 18, 'Уютное теплое платье полуприлегающего силуэта из шерстяного трикотажного полотна. Платье со спущенной линией проймы. Кокетка и втачные рукава однотонного цвета, выполнены в технике «ручного вязания». Кокетка дополнена ажурной тесьмой. В боковых швах изделия - карманы. По низу спинки изделия — разрез. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 95-105 см.\r\nСостав: Шерсть 80%, Акрил 20%.', 'ВА-П4-3529', NULL, 4250, NULL, 2000, '2017-09-21 17:52:46', '2017-09-21 17:52:46', NULL, 0, 1, '', '', '', '', '', ''),
(700, 0, 10, 0, 'plate_poluprilegayushego_silueta_iz_viskozy', 'Платье полуприлегающего силуэта из вискозы', NULL, 18, 'Романтичное двухслойное платье полуприлегающего силуэта. Нижний слой выполнен из приятной к телу вискозы. Верхний слой — эластичное французское кружево.  Круглый вырез изделия обработан внешней обтачкой и имеет декор, имитирующий ожерелье. Втачные рукава из прозрачного кружева добавляют образу игривости. \r\nБлагодаря своей двухслойности и хорошей эластичности платье прекрасно сидит на фигуре, выгодно подчеркивая её. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке  от плечевого шва до низа изделия — 104-108 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-3495', NULL, 4850, NULL, 2300, '2017-09-21 17:58:27', '2017-11-19 23:05:38', NULL, 0, 1, '', '', '', '', '', ''),
(701, 0, 10, 0, 'romantichnoe_plate_nezhnogo_rozovogo_cveta', 'Романтичное платье нежного розового цвета', NULL, 18, 'Романтичное платье полуприлегающего силуэта  из трикотажного полотна нежного розового цвета. Круглый вырез обработан внутренней обтачкой. Перед изделия двойной, на трикотажной основе нежное кружево. Платье с втачными рукавами. По спинке изделия потайная молния и разрез. Аксессуары в комплект не входят.  \r\nДлина изделия по спинке от плечевого шва до низа изделия — 94-100 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П3-3567/0-1', NULL, 3850, NULL, 1800, '2017-09-21 17:58:59', '2017-10-18 16:36:20', NULL, 0, 1, '', '', '', '', '', ''),
(702, 0, 10, 0, 'stilnoe_plate_iz_barhata', 'Стильное платье из бархата', NULL, 19, 'Стильное платье полуприлегающего силуэта из текстильного полотна (бархат) глубокого синего цвета. Круглый вырез обработан внутренней обтачкой. Втачные рукава немного расклешены к низу. По низу спинки - разрез. В спинке изделия — потайная молния.\r\nБлагородный бархат — подчеркнёт вашу элегантность и осведомлённость об актуальных модных тенденциях. \r\n Жемчужные бусы входят в комплект.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 106 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3497/1', NULL, 4250, NULL, 2000, '2017-09-21 18:03:31', '2017-11-20 11:04:26', NULL, 0, 1, '', '', '', '', '', ''),
(703, 0, 10, 0, 'naryadnoe_plate_s_neobychnym_dekorom_vyreza', 'Нарядное платье с необычным декором выреза', NULL, 19, 'Торжественное платье полуприлегающего силуэта из текстильного полотна (кружево на текстильной основе) синего цвета с цветочным узором. Фигурный вырез изделия украшен декоративным элементом. Рукава реглан дополнены декоративными складками.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 110 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%.', 'ВА-П3-3480/1', NULL, 4450, NULL, 2100, '2017-09-21 18:07:17', '2017-09-21 18:07:17', NULL, 0, 1, '', '', '', '', '', ''),
(704, 0, 10, 0, 'izyskannoe_vechernee_plate_s_baskoj', 'Изысканное вечернее платье с баской', NULL, 18, 'Изысканное вечернее платье  приталенного силуэта. Верхняя часть платья выполнена из полотна с эффектом «мокрой кожи». Линия талии подчеркнута баской. Рекомендуем сочетать платье с подвесом и серьгами.Аксессуары в комплект не входят. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 98-102 см.\r\nСостав: 	Полиэстер 95%, Эластан 5%.', 'ВА-П3-1797', NULL, 4850, NULL, 2300, '2017-09-21 18:14:27', '2017-09-21 18:14:27', NULL, 0, 1, '', '', '', '', '', ''),
(705, 0, 10, 0, 'plate_midi_s_cvetochnym_printom', 'Платье миди с цветочным принтом', NULL, 18, 'Необыкновенное платье полуприлегающего силуэта из трикотажного полотна синего цвета с цветочным принтом. V-образный вырез обработан окантовкой из полотна, имитирующего "кожу". Изделие с цельнокроеными рукавами. Втачной пояс выполнен из полотна, имитирующего "кожу". Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 102 -109 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3470', NULL, 4050, NULL, 1900, '2017-09-21 18:17:12', '2017-09-21 18:17:12', NULL, 0, 1, '', '', '', '', '', ''),
(706, 0, 10, 0, 'naryadnoe_sinee_plate_v_pol', 'Нарядное синее платье в пол', NULL, 18, 'Роскошное, женственное платье полуприлегающего силуэта из трикотажного полотна синего цвете.  Втачные рукава и кокетка выполнены из цветного рельефного трикотажа. Перед изделия дополнен декоративным "перекрутом", который создает мягкие вертикальные складки. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия -  145 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П5-2310', NULL, 4450, NULL, 2100, '2017-09-21 18:20:52', '2017-09-21 18:20:52', NULL, 0, 1, '', '', '', '', '', ''),
(707, 0, 10, 0, 'elegantnoe_plate_s_kontrastnymi_kantami', 'Элегантное платье с контрастными кантами', NULL, 18, 'Элегантное платье прилегающего силуэта из текстильного полотна.\r\nКруглый вырез, перед изделия и втачные рукава обработаны контрастными кантами. Спинка изделия дополнена потайной молнией и шлицей. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100-105 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%.', 'ВА-П3-3599', NULL, 4250, NULL, 2000, '2017-09-21 18:26:00', '2017-11-23 15:19:32', NULL, 0, 1, '', '', '', '', '', ''),
(708, 0, 10, 0, 'plate_svobodnogo_silueta_fioletovogo_cveta', 'Платье свободного силуэта фиолетового цвета', NULL, 18, 'Очаровательное платье свободного силуэта из трикотажного полотна фиолетового цвета с рельефной фактурой. Фигурный вырез изделия украшен яркой кокеткой. Платье с цельнокроеными рукавами и со спущенной линией проймы. По переду изделия - карманы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 97 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3353', NULL, 4050, NULL, 1900, '2017-09-21 18:28:10', '2017-09-21 18:28:10', NULL, 0, 1, '', '', '', '', '', ''),
(709, 0, 10, 0, 'potryasayushee_plate_prilegayushego_silueta', 'Потрясающее платье прилегающего силуэта', NULL, 19, 'Потрясающее платье прилегающего силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан окантовкой. Перед изделия двойной на трикотажной основе - кружевное полотно. Платье с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 103 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-П4-2834', NULL, 4050, NULL, 1900, '2017-09-21 18:36:22', '2017-09-21 18:36:22', NULL, 0, 1, '', '', '', '', '', ''),
(710, 0, 10, 0, 'uyutnyj_kostyum_iz_trikotazha_sero_chernogo_cveta', 'Уютный костюм из трикотажа серо-черного цвета', NULL, 18, 'Уютный костюм из трикотажного полотна серо-черного цвета. Костюм состоит из полуприлегающего жакета и прямой юбки. Фигурный вырез жакета, втачные рукава и перед изделия — обработаны контрастной окантовкой. Горловина изделия украшена однотонной кокеткой. Жакет дополнен планкой с застежкой на пуговицы. Юбка с застежкой на потайную молнию. Низ юбки по спинке дополнен шлицей.  Аксессуары в комплект не входят.\r\nДлина жакета от плечевого шва по спинке до низа изделия — 58-62 см.\r\nДлина юбки от линии пояса до низа изделия — 55 см.\r\nСостав: 	Вискоза 95%, Эластан 5%.', 'ВА-К4-3524/2-3', NULL, 4850, NULL, 2300, '2017-09-21 18:39:46', '2017-09-21 18:39:46', NULL, 0, 1, '', '', '', '', '', ''),
(711, 0, 10, 0, 'elegantnyj_kostyum_poluprilegayushego_silueta', 'Элегантный костюм полуприлегающего силуэта', NULL, 18, 'Элегантный костюм полуприлегающего силуэта из трикотажного полотна. Костюм состоит из прилегающего жакета и прямой юбки.  Фигурный вырез жакета, рукава, перед и низ изделия — обработаны контрастной окантовкой. Жакет дополнен планкой с застежкой на пуговицы. По низу прямой юбки контрастная окантовка. Юбка с застежкой на потайную молнию. Аксессуары в комплект не входят.  \r\nДлина жакета от плечевого шва по спинке до низа изделия — 60-63 см.\r\nДлина юбки от линии пояса до низа изделия — 55-60 см.\r\nСостав: 	Вискоза 95%, Эластан 5%.', 'ВА-К4-3524/4-7', NULL, 4650, NULL, 2200, '2017-09-21 18:44:34', '2017-09-21 18:44:34', NULL, 0, 1, '', '', '', '', '', ''),
(712, 0, 10, 0, 'stilnoe_plate_iz_plotnogo_trikotazha', 'Стильное платье из плотного трикотажа', NULL, 14, 'Стильное платье полуприлегающего силуэта из плотного трикотажного полотна. Круглый вырез изделия подчеркнут внешней обтачкой. Перед изделия и цельнокроеные рукава украшены кружевом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 96 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П5-2371', NULL, 3650, NULL, 1700, '2017-09-21 18:45:16', '2017-09-21 18:45:16', NULL, 0, 1, '', '', '', '', '', ''),
(713, 0, 10, 0, 'elegantnyj_kostyum_sine_belogo_cveta', 'Элегантный костюм сине-белого цвета', NULL, 18, 'Элегантный костюм из трикотажного полотна сине-белого цвета. Костюм состоит из прилегающего жакета и прямой юбки. Фигурный вырез жакета, рукава, перед и низ изделия — обработаны контрастной окантовкой. Жакет дополнен планкой с застежкой на пуговицы. По низу прямой юбки контрастная окантовка. Юбка с застежкой на потайную молнию. Аксессуары в комплект не входят.  \r\nДлина жакета от плечевого шва по спинке до низа изделия — 66 см.\r\nДлина юбки от линии пояса до низа изделия — 59 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-К4-3360/3-4', NULL, 4650, NULL, 2200, '2017-09-21 18:53:41', '2017-09-21 18:53:41', NULL, 0, 1, '', '', '', '', '', ''),
(714, 0, 10, 0, 'elegantnoe_plate_s_zhaketom_s_karmanami', 'Элегантное платье с жакетом с карманами', NULL, 18, 'Элегантный костюм, состоящий из платья и жакета. Потрясающее сочетание изысканных полотен, однотонного с рельефным рисунком и цветного с металлизированной нитью.  Жакет прямого силуэта, круглый вырез изделия обработан внутренней обтачкой. По планке переда застежка на сутажные застежки. Перед изделия дополнен накладными карманами. Платье полуприлегающего силуэта, круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина жакета по спинке от плечевого шва до низа изделия - 50-55 см.\r\nДлина платья по спинке от плечевого шва до низа изделия - 98-105 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-К4-3467', NULL, 6450, NULL, 3100, '2017-09-21 18:59:30', '2017-09-21 19:02:53', NULL, 0, 1, '', '', '', '', '', ''),
(715, 0, 10, 0, 'stilnyj_yubochnyj_kostyum_s_cvetami', 'Стильный юбочный костюм с цветами', NULL, 18, 'Стильный костюм из текстильного полотна синего цвета. Костюм состоит из блузы свободного силуэта и юбки длины midi прилегающего силуэта. Круглый вырез блузы обработан внутренней обтачкой. Втачные рукава по низу обработаны манжетами и дополнены патами. Перед блузы по низу дополнен декоративным узлом. Юбка с высокой посадкой и застежкой на потайную молнию по верху обработана широкой резинкой. Снизу изделия шлица. \r\nАксессуары в комплект не входят.\r\nДлина блузы от плечевого шва по спинке до низа изделия —  60-63 см.\r\nДлина юбки от линии пояса до низа изделия — 80 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-К4-3646', NULL, 4450, NULL, 2100, '2017-09-21 19:05:11', '2017-09-21 19:05:11', NULL, 0, 1, '', '', '', '', '', ''),
(716, 0, 10, 0, 'yubka_iz_plissirovannogo_vyazanogo_polotna_', 'Юбка из плиссированного вязаного полотна', NULL, 18, 'Потрясающая юбка свободного силуэта из плиссированного вязаного полотна. Юбка выполнена в технике «ручного вязания» из нитей с содержанием шерсти. Верхняя часть юбки обработана широким поясом с эластичной резинкой.\r\nАксессуары в комплект не входят.\r\nДлина от пояса до низа изделия — 89 см.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%', 'ВА-Ю5-200', NULL, 3450, NULL, 1600, '2017-09-21 19:08:49', '2017-09-21 19:08:49', NULL, 0, 1, '', '', '', '', '', ''),
(717, 0, 10, 0, 'zhenstvennyj_yubochnyj_kostyum_s_soderzhaniem_shersti', 'Женственный юбочный костюм с содержанием шерсти', NULL, 18, 'Женственный костюм полуприлегающего силуэта состоящий из жакета и юбки, выполнен в технике «ручного вязания» из нитей с содержанием шерсти . Круглый вырез горловины обработан двусторонней бейкой. По планке переда застежка на пуговицы. Жакет дополнен имитацией карманов. Юбка прямого силуэта дополнена поясом-резинкой, что обеспечивает идеальную посадку на фигуре. Низ юбки дополнен шлицей. Аксесуары в комплект не входят.\r\nДлина жакета по спинке  от плечевого шва до низа изделия — 65-70 см.\r\nДлина юбки — 65-70 см.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%.', 'ВА-Кв4-195', NULL, 4650, NULL, 2200, '2017-09-21 19:09:46', '2017-09-21 19:09:46', NULL, 0, 1, '', '', '', '', '', ''),
(718, 0, 10, 0, 'stilnyj_zhilet_pryamogo_silueta', 'Стильный жилет прямого силуэта', NULL, 18, 'Стильный жилет прямого силуэта . Жилет выполнен в технике «ручного вязания» резинкой 1*1 из натуральных нитей с содержанием шерсти. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 59-62 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %', 'ВА-Ж1-194', NULL, 1350, NULL, 550, '2017-09-21 19:22:48', '2017-09-21 19:22:48', NULL, 0, 1, '', '', '', '', '', ''),
(719, 0, 10, 0, 'stilnyj_dzhemper_poluprilegayushego_silueta', 'Стильный джемпер полуприлегающего силуэта', NULL, 18, 'Стильный джемпер полуприлегающего силуэта. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием шерсти. Круглый вырез, низ  рукавов и низ изделия обработаны контрастной двусторонней лицевой бейкой.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —61-66 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %.', 'ВА-Др5-140/0-5', NULL, 2010, NULL, 880, '2017-09-21 19:23:30', '2017-09-21 19:24:11', NULL, 0, 1, '', '', '', '', '', ''),
(720, 0, 10, 0, 'chernyj_odnotonnyj_dzhemper', 'Черный однотонный джемпер', NULL, 18, 'Стильный джемпер полуприлегающего силуэта черно цвета. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием шерсти. Круглый вырез, низ  рукавов и низ изделия обработаны двусторонней лицевой бейкой.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —63-66 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %.', 'ВА-Др5-140/6-7', NULL, 2010, NULL, 880, '2017-09-21 19:30:13', '2017-09-21 19:30:13', NULL, 0, 1, '', '', '', '', '', ''),
(721, 0, 10, 0, 'svobodnyj_dzhemper_iz_hlopka_raznyh_cvetov', 'Свободный джемпер из хлопка разных цветов', NULL, 18, 'Стильный джемпер свободного силуэта с цельнокроеными рукавами. Джемпер выполнен в технике ручного вязания из нитей с содержанием хлопка. Круглый вырез изделия обработан двусторонней лицевой бейкой. По низу изделия и рукавов — манжеты.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —64-66 см.\r\nСостав: Хлопок 100%.', 'ВА-Др5-141', NULL, 2150, NULL, 950, '2017-09-21 19:39:00', '2017-09-21 19:39:00', NULL, 0, 1, '', '', '', '', '', ''),
(722, 0, 10, 0, 'tunika_svobodnogo_silueta_cherno_belogo_cveta', 'Туника свободного силуэта черно-белого цвета', NULL, 18, 'Стильная туника свободного силуэта черно-белого цвета. Туника  выполнена в технике ручного вязания  из нитей с добавлением шерсти. Круглый вырез обработан лицевой бейкой. Туника со спущенной проймой, рукава отвязаны резинкой 2*2. \r\nМодель имеет совмещенные размеры:\r\n42-44, 46-48.Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 77-78 см\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%', 'ВА-Др5-201', NULL, 3250, NULL, 1500, '2017-09-21 19:42:45', '2017-09-21 19:42:45', NULL, 0, 1, '', '', '', '', '', ''),
(723, 0, 10, 0, 'stilnaya_tunika_svobodnogo_silueta', 'Стильная туника свободного силуэта', NULL, 18, 'Стильная туника свободного силуэта серого цвета. Туника  выполнена в технике ручного вязания  из нитей с добавлением шерсти. Круглый вырез обработан двусторонней лицевой бейкой. Туника со спущенной проймой, рукава отвязаны резинкой 1*1. \r\nМодель имеет совмещенные размеры: 42-44, 46-48 Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 76 -82 см.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%', 'ВА-Др5-196', NULL, 3250, NULL, 1500, '2017-09-21 19:53:03', '2017-09-21 19:53:03', NULL, 0, 1, '', '', '', '', '', ''),
(724, 0, 10, 0, 'uyutnyj_dzhemper_svobodnogo_silueta', 'Уютный джемпер свободного силуэта', NULL, 18, 'Уютный джемпер свободного силуэта. Джемпер выполнен в технике ручного вязания из нитей с содержанием шерсти. Воротник - «хомут». Низ рукавов и низ изделия обработаны манжетами вывязанными в технике «резинка». Джемпер с втачными рукавами со спущенной линией проймы. В боковых швах изделия разрезы. Спинка джемпера  удлиненна. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 60-66 см.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%', 'ВА-Др5-199', NULL, 2850, NULL, 1300, '2017-09-21 20:04:39', '2017-09-21 20:04:39', NULL, 0, 1, '', '', '', '', '', ''),
(725, 0, 10, 0, 'uyutnyj_dzhemper_s_vorotnikom_homut', 'Уютный джемпер с воротником хомут', NULL, 18, 'Очаровательный джемпер прямого силуэта. Горловина обработана объемным воротником «хомут» с ажурным рисунком. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Низ изделия и рукавов обработаны двусторонней лицевой бейкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 62-66 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %.', 'ВА-ДР5-143', NULL, 2010, NULL, 880, '2017-09-21 20:33:05', '2017-09-21 20:33:05', NULL, 0, 1, '', '', '', '', '', ''),
(726, 0, 10, 0, 'sinij_dzhemper_s_soderzhaniem_shersti', 'Синий джемпер с содержанием шерсти', NULL, 18, 'Стильный джемпер полуприлегающего силуэта синего цвета. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти.  Круглый вырез, низ втачных рукавов и низ изделия обработаны контрастной двусторонней лицевой бейкой. По переду изделия планка с застежкой на пуговицы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 64-67 см.\r\nСостав: 	Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%.', 'ВА-ДР5-146', NULL, 2350, NULL, 1050, '2017-09-21 20:45:34', '2017-09-21 20:45:34', NULL, 0, 1, '', '', '', '', '', ''),
(727, 0, 10, 0, 'svobodnyj_teplyj_dzhemper_s_homutom', 'Свободный теплый джемпер с хомутом', NULL, 18, 'Нежный джемпер свободного силуэта. Джемпер выполнен в технике ручного вязания. Воротник «хомут». Джемпер с углубленной проймой и втачными рукавами. Низ рукавов и низ изделия обработаны двухсторонней лицевой бейкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 65-74 см.\r\nСостав: Акрил 70%, Мохер 20%, Шерсть 10%.', 'ВА-ДР5-76', NULL, 2210, NULL, 980, '2017-09-21 20:49:50', '2017-09-21 20:49:50', NULL, 0, 1, '', '', '', '', '', ''),
(728, 0, 10, 0, 'stilnyj_dzhemper_s_dekorativnymi_elementami', 'Стильный джемпер с декоративными элементами', NULL, 18, 'Стильный джемпер прямого силуэта серо-голубого цвета. Изделие с втачными рукавами. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием хлопка. Круглый вырез изделия обработан двусторонней лицевой бейкой. Перед дополнен декоративным элементом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 65-68 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %.', 'ВА-ДР4-190', NULL, 3050, NULL, 1400, '2017-09-21 20:55:13', '2017-09-21 20:55:13', NULL, 0, 1, '', '', '', '', '', '');
