(729, 0, 10, 0, 'yarkij_dzhemper_s_dobavleniem_mohera', 'Яркий джемпер с добавлением мохера', NULL, 18, 'Очаровательный джемпер свободного силуэта. Джемпер выполнен в технике ручного вязания  из нитей с добавлением мохера. Изделие вывязано «английской» резинкой. Круглый вырез изделия, манжеты рукавов и низа изделия вывязаны резинкой 1*1. По переду изделия вывязан рисунок «коса». \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —  64-68 см.\r\nСостав: Акрил 70%, Мохер 20%, шерсть 10%.', 'ВА-ДР5-197', NULL, 2850, NULL, 1300, '2017-09-21 21:01:39', '2017-09-21 21:01:39', NULL, 0, 1, '', '', '', '', '', ''),
(730, 0, 10, 0, 'dvuhcvetnyj_hlopkovyj_dzhemper', 'Двухцветный хлопковый джемпер', NULL, 18, 'Роскошный джемпер прямого силуэта. Джемпер выполнен в технике ручного вязания из нитей с содержанием хлопка. Круглый вырез изделия обработан «чулочной» гладью. Джемпер с рукавами-реглан. По низу изделия и рукавов — манжеты.\r\nПеред изделия дополнен декоративным элементом  «коса» черного цвета. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 62-68 см.\r\nСостав: Хлопок 100%.', 'ВА-Др5-192', NULL, 3050, NULL, 1400, '2017-09-21 21:06:09', '2017-09-21 21:06:09', NULL, 0, 1, '', '', '', '', '', ''),
(731, 0, 10, 0, 'bezhevyj_kardigan_s_vyshivkoj', 'Бежевый кардиган с вышивкой', NULL, 7, 'Роскошный кардиган полуприлегающего силуэта бежевого цвета. Круглый вырез обработан двусторонней лицевой бейкой. Кардиган с втачными рукавами. По переду изделия вывязана планка с застежкой на пуговицы. Манжеты рукавов и низа изделия отвязаны резинкой 1*1. Перед изделия двойной, поверх цельновязаной основы кружевная вышивка на прозрачной сетке. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 64 см.\r\nСостав:	Акрил 70%, Мохер 20%, шерсть 10%.', 'ВА-Кн5-198', NULL, 2850, NULL, 1300, '2017-09-21 21:12:02', '2017-09-21 21:12:02', NULL, 0, 1, '', '', '', '', '', ''),
(732, 0, 10, 0, 'vyazanaya_tunika_s_nakladnymi_karmanami', 'Вязаная туника с накладными карманами', NULL, 18, 'Обворожительная туника полуприлегающего силуэта. Туника выполнена в технике ручного вязания. Круглый вырез изделия обработан «чулочной» гладью. Туника с углубленной проймой и втачными рукавами. Перед изделия дополнен накладными карманами. По низу изделия и рукавов — манжеты.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 74-80 см.\r\nСостав: Акрил 70%, Мохер 20%, Шерсть 10%.', 'ВА-ДР5-74', NULL, 2650, NULL, 1200, '2017-09-21 21:29:53', '2017-09-21 21:29:53', NULL, 0, 1, '', '', '', '', '', ''),
