(747, 0, 10, 0, 'kardigan_sine_rozovogo_cveta', 'Кардиган сине-розового цвета', NULL, 18, 'Роскошный кардиган прямого силуэта сине-розового цвета. Кардиган выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез изделия обработан двусторонней лицевой бейкой. По переду изделия планка с застежкой на пуговицы. По низу изделия и рукавов — манжеты. Кардиган украшен декоративной  вышивкой. Аксессуары в комплект не входят. Длина изделия по спинке от плечевого шва до низа изделия-62-66 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %', 'ВА-Кн5-162', NULL, 2950, NULL, 1350, '2017-09-25 11:49:41', '2017-09-25 11:49:41', NULL, 0, 1, '', '', '', '', '', ''),
