(749, 0, 10, 0, 'dzhemper_svobodnogo_silueta_bezhevogo_cveta', 'Джемпер свободного силуэта бежевого цвета', NULL, 18, 'Роскошный джемпер свободного силуэта бежевого цвета. Джемпер выполнен в технике «ручного вязания». По низу цельновязанных рукавов и низу изделия — манжеты. По переду изделия вывязан декоративный рисунок. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 69-73 см.\r\nСостав:Акрил 70%, Мохер 20%, Шерсть 10%', 'ВА-Др5-70', NULL, 2350, NULL, 1050, '2017-09-25 12:32:35', '2017-09-25 12:32:35', NULL, 0, 1, '', '', '', '', '', ''),
