(753, 0, 10, 0, 'modnyj_dzhemper_pryamogo_silueta', 'Модный джемпер прямого силуэта', NULL, 18, 'Обоятельный джемпер прямого силуэта. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. По переду, спинке и рукавам изделия вывязан интересный орнамент. Круглый вырез изделия обработан "резинкой". Джемпер с рукавами - реглан. По низу рукавов и низу изделия — манжеты. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —65-69 см.', 'ВА-Др5-156', NULL, 2890, NULL, 1320, '2017-09-25 13:42:52', '2017-09-25 13:42:52', NULL, 0, 1, '', '', '', '', '', ''),
