(766, 0, 10, 0, 'bezhevo_sinij_sviter_s_ornamentom', 'Бежево-синий свитер с орнаментом', NULL, 18, 'Стильный джемпер полуприлегающего силуэта бежево-синего цвета. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти.  Круглый вырез изделия обработан двусторонней лицевой бейкой. Джемпер с рукавами реглан. Вывязанный рисунок подчеркивает оригинальность образа. Низ рукавов и низ изделия обработаны двухсторонней лицевой бейкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 62-65 см.\r\nСостав: 	Шерсть 45%, Полиамид 16%, Акрил 39%.', 'ВА-Др5-79', NULL, 2650, NULL, 1200, '2017-09-25 18:00:19', '2017-09-25 18:00:19', NULL, 0, 1, '', '', '', '', '', ''),
