(768, 0, 10, 0, 'uyutnyj_dzhemper_pryamogo_silueta_bezhevo_zelenogo_cveta', 'Уютный джемпер прямого силуэта бежево-зеленого цвета', NULL, 19, 'Уютный джемпер прямого силуэта бежево-зеленого цвета. Джемпер выполнен в технике ручного вязания. Перед изделия свзязан из ниток фантазийной окраски, поэтому расположение полос может отличаться от фото, цветовая гамма неизменна. Джемпер с круглым вырезом и втачными рукавами. Аксессуары в комплект не входят. \r\nДлина изделия по спинке  от плечевого шва до низа изделия — 72 см.\r\nСостав: Акрил 70%, Мохер 30%.', 'ВА-Др5-87', NULL, 1950, NULL, 850, '2017-09-25 19:06:20', '2017-09-25 19:06:20', NULL, 0, 1, '', '', '', '', '', ''),
(769, 0, 10, 0, 'izyskannyj_dzhemper_cherno_zelenogo_cveta', 'Изысканный джемпер черно-зеленого цвета', NULL, 18, 'Изысканный джемпер полуприлегающего силуэта черно-зеленого цвета. Джемпер выполнен в технике ручного вязания из нитей с содержанием шерсти. Круглый вырез изделия обработан «чулочной» гладью. Туника с углубленной проймой и втачными рукавами. По низу изделия и рукавов — манжеты. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 70-78 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %\r\n', 'ВА-Др5-85', NULL, 2650, NULL, 1200, '2017-09-25 19:09:59', '2017-09-25 19:09:59', NULL, 0, 1, '', '', '', '', '', ''),
(770, 0, 10, 0, 'hlopkovyj_dzhemper_s_dekorativnymi_elementami', 'Хлопковый джемпер с декоративными элементами', NULL, 18, 'Романтичный джемпер полуприлегающего силуэта голубого цвета. Изделие выполнено в технике «ручного вязания» из нитей с содержанием хлопка. Круглый вырез и низ втачных рукавов обработаны двусторонней лицевой бейкой. Перед изделия дополнен декоративными элементами. Низ изделия выполнен в технике «резинка».  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 58-68 см.\r\nСостав: Хлопок 100%.', 'ВА-Др4-191', NULL, 2150, NULL, 950, '2017-09-25 19:15:30', '2017-09-25 19:15:30', NULL, 0, 1, '', '', '', '', '', ''),
(771, 0, 10, 0, 'svobodnyj_dzhemper_s_raznocvetnym_ornamentom', 'Свободный джемпер с разноцветным орнаментом', NULL, 18, 'Молодежный джемпер свободного силуэта черного цвета. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. По низу изделия и рукавов вывязан разноцветных орнамент. По переду изделия вывязан декоративный рисунок. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 66-70 см.\r\nСостав: Шерсть 45%, Полиамид 16%, Акрил 39%.', 'ВА-Др4-53', NULL, 2350, NULL, 1050, '2017-09-25 20:09:02', '2017-09-25 20:09:02', NULL, 0, 1, '', '', '', '', '', ''),
(772, 0, 10, 0, 'effektnyj_dzhemper_poluprilegayushego_silueta', 'Эффектный джемпер полуприлегающего силуэта', NULL, 18, 'Эффектный джемпер полуприлегающего силуэта. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез изделия обработан двусторонней лицевой бейкой. Низ рукавов реглан и низ изделия обработан двусторонней лицевой бейкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 68 см.\r\nСостав: Шерсть 45%, Полиамид 16%, Акрил 39%.', 'ВА-Др4-72', NULL, 2510, NULL, 1130, '2017-09-25 20:14:58', '2017-09-25 20:14:58', NULL, 0, 1, '', '', '', '', '', ''),
(773, 0, 10, 0, 'cherno_belaya_tunika_s_korotkim_rukavom', 'Черно-белая туника с коротким рукавом', NULL, 18, 'Изящная туника  полуприлегающего силуэта белого-черного цвета с втачными рукавами. Джемпер выполнен в технике «ручного вязания» из натуральных хлопковых нитей. Круглый вырез, низ рукавов и низ изделия обработаны двусторонней лицевой бейкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 79-87 см.\r\nСостав: 	Хлопок 100%.', 'ВА-Др3-122', NULL, 2450, NULL, 1100, '2017-09-25 20:22:06', '2017-09-25 20:22:06', NULL, 0, 1, '', '', '', '', '', ''),
(774, 0, 10, 0, 'belo_sinij_sviter_s_polosku_s_kruzhevom', 'Бело-синий свитер с полоску с кружевом', NULL, 18, 'Очаровательный джемпер прямого силуэта  бело-синего цвета. Джемпер выполнен в технике ручного вязания из нитей с содержанием хлопка. Круглый вырез изделия обработан «чулочной» гладью.  По низу рукавов — манжеты выполненные в технике «резинка». По низу в боковых швах — разрезы. Низ переда и спинки имеет «резинку» высотой 1 см. По переду низ джемпера дополнен ажурным кружевом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 61-71 см.\r\nСостав: 	Хлопок 100%.', 'ВА-Др3-175', NULL, 2550, NULL, 1150, '2017-09-25 20:29:01', '2017-09-25 20:29:01', NULL, 0, 1, '', '', '', '', '', ''),
(775, 0, 10, 0, 'dzhemper_sinego_korichnevogo_cveta', 'Джемпер синего-коричневого цвета', NULL, 18, 'Стильный джемпер прямого силуэта синего-коричневого цвета в морском стиле, с полосатыми рукавами «реглан». Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием хлопка. Круглый вырез и низ изделия обработаны двусторонней лицевой бейкой. По низу рукавов однотонный манжет. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 57-64 см.\r\nСостав:Хлопок 100%', 'ВА-Др3-28/8-9', NULL, 2350, NULL, 1050, '2017-09-26 10:36:48', '2017-09-26 10:36:48', NULL, 0, 1, '', '', '', '', '', ''),
(776, 0, 10, 0, 'yarkij_dzhemper_pryamogo_silueta', 'Яркий джемпер прямого силуэта', NULL, 18, 'Яркий джемпер прямого силуэта с в морском стиле, с полосатыми рукавами «реглан». Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием хлопка. Круглый вырез и низ изделия обработаны двусторонней лицевой бейкой. По низу рукавов однотонный манжет. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —57-64 см.\r\nСостав: Хлопок 100%', 'ВА-Др3-28/4-7', NULL, 2150, NULL, 950, '2017-09-26 10:57:11', '2017-09-26 11:22:17', NULL, 0, 1, '', '', '', '', '', '');
