(778, 0, 10, 0, 'izyashnyj_dzhemper_pryamogo_silueta', 'Изящный джемпер прямого силуэта', NULL, 18, 'Изящный джемпер прямого силуэта. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с добавлением мохера. Круглый вырез, низ втачных рукавов и низ изделия обработаны двухсторонней лицевой бейкой.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —62-69 см.\r\nСостав: Акрил 70%, Мохер 20%, Шерсть 10%', 'ВА-Др3-111', NULL, 2350, NULL, 1050, '2017-09-26 11:25:31', '2017-09-26 11:25:31', NULL, 0, 1, '', '', '', '', '', ''),
(779, 0, 10, 0, 'uyutnaya_tunika_poluprilegayushego_silueta_platochnoj_vyazki', 'Уютная туника полуприлегающего силуэта платочной вязки', NULL, 18, 'Уютная туника полуприлегающего силуэта . Туника выполнена в технике ручного вязания «платочная вязка» из нитей с добавлением хлопка.. V-образной вырез изделия обработан двусторонней лицевой бейкой. Туника с втачными рукавами. По низу изделия и рукавов — манжеты. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 71-74 см.\r\nСостав: 	Хлопок 100%.', 'ВА-Др4-169', NULL, 2650, NULL, 1200, '2017-09-26 11:37:37', '2017-09-26 11:37:37', NULL, 0, 1, '', '', '', '', '', ''),
(780, 0, 10, 0, 'dzhemper_belo_golubogo_cveta', 'Джемпер бело-голубого цвета', NULL, 18, 'Восхитительный джемпер свободного силуэта бело-голубого цвета. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием хлопка. Круглый вырез изделия обработан двусторонней бейкой в технике «английская резинка». По низу цельнокроеных рукавов рукавов и низу джемпера — манжеты.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 62-70 см.\r\nСостав: Хлопок 100%', 'ВА-Др3-137', NULL, 2350, NULL, 1050, '2017-09-26 11:59:46', '2017-09-26 11:59:46', NULL, 0, 1, '', '', '', '', '', ''),
(781, 0, 10, 0, 'dzhemper_belo_sinego_cveta_s_celnokroenymi_rukavami', 'Джемпер бело-синего цвета с цельнокроеными рукавами', NULL, 18, 'Изысканный джемпер прямого силуэта бело-синего цвета с цельнокроеными рукавами. Джемпер выполнен в технике «ручного вязания» из натуральных хлопковых нитей. Круглый вырез изделия обработан двусторонней бейкой в технике «английская резинка». Низ рукавов и низ изделия обработаны манжетами, выполненные в технике «резинка». Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —64-70 см.\r\nСостав: Хлопок 100%', 'ВА-Др3-139', NULL, 2350, NULL, 1050, '2017-09-26 12:08:40', '2017-09-26 12:08:40', NULL, 0, 1, '', '', '', '', '', ''),
(782, 0, 10, 0, 'uyutnaya_tunika_s_vyvyazannym_uzorom', 'Уютная туника с вывязанным узором', NULL, 18, 'Уютная туника прямого силуэта. Туника выполнена в технике ручного вязания  из нитей с добавлением хлопка. По переду и спинке изделия вывязан рисунок.  По низу рукавов-реглан - манжеты. Манжет рукавов, резинка низа изделия - «английская» резинка 2*2. Круглый вырез изделия обработан бейкой в технике «чулочная гладь». \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 73-83 см.\r\nСостав: Хлопок 100%.', 'ВА-Др4-176', NULL, 2850, NULL, 1300, '2017-09-26 12:13:25', '2017-09-26 12:13:25', NULL, 0, 1, '', '', '', '', '', ''),
(783, 0, 10, 0, 'ocharovatelnyj_dzhemper_pryamogo_silueta', 'Очаровательный джемпер прямого силуэта', NULL, 18, 'Очаровательный джемпер прямого силуэта. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием вискозы. Круглый вырез изделия обработан двусторонней лицевой бейкой. Втачные рукава со спущенной проймой вывязаны ажурным рисунком. По переду изделия вывязан декоративный рисунок. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —60-65 см.\r\nСостав: Акрил 70%, Мохер 20%, Шерсть 10%', 'ВА-Др4-102', NULL, 2650, NULL, 1200, '2017-09-26 12:24:20', '2017-09-26 12:24:20', NULL, 0, 1, '', '', '', '', '', ''),
(784, 0, 10, 0, 'oranzhevaya_tunika_s_azhurnym_uzorom', 'Оранжевая туника с ажурным узором', NULL, 18, 'Изумительная туника прямого силуэта оранжевого цвета. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием мохера. Круглый вырез изделия и  низ втачных рукавов обработаны двухсторонней лицевой бейкой. Джемпер со спущенной линией проймы. По переду изделия вывязан ажурный рисунок. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия 72-81 см.\r\nСостав:	Акрил 70%, Мохер 20%, Шерсть 10%.', 'ВА-Др3-107', NULL, 2350, NULL, 1050, '2017-09-26 12:25:11', '2017-09-26 12:25:11', NULL, 0, 1, '', '', '', '', '', ''),
(785, 0, 10, 0, 'dzhemper_belo_kremovogo_cveta', 'Джемпер  бело-кремового цвета', NULL, 18, 'Приятный джемпер полуприлегающего силуэта бело-кремового цвета. Изделие выполнено в технике «ручного вязания» из нитей с содержанием хлопка. Круглый вырез обработан двусторонней лицевой бейкой. По низу рукавов-реглан и низу изделия — манжеты. По переду и рукавам джемпера вывязан цветочный рисунок. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 71-74 см.\r\nСостав: Хлопок 100%', 'ВА-Др3-167', NULL, 3050, NULL, 1400, '2017-09-26 12:36:11', '2017-09-26 12:36:11', NULL, 0, 1, '', '', '', '', '', ''),
(786, 0, 10, 0, 'belo_chernyj_dzhemper_s_soderzhaniem_shersti', 'Бело-черный джемпер с содержанием шерсти', NULL, 18, 'Очаровательный джемпер полуприлегающего силуэта бело-черного цвета с рукавами реглан. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез, низ рукавов и низ по спинке изделия обработаны двусторонней лицевой бейкой  контрастного цвета. На рукавах вывязан рисунок - горох. Перед изделия украшен декоративным элементом из шифонового полотна в виде цветов. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 66-71 см.\r\nСостав: 	Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %', 'ВА-Др3-117/0-1', NULL, 2650, NULL, 1200, '2017-09-26 12:39:26', '2017-09-26 12:39:26', NULL, 0, 1, '', '', '', '', '', ''),
(787, 0, 10, 0, 'belo_chernyj_dzhemper_s_soderzhaniem_hlopka', 'Бело-черный джемпер с содержанием хлопка', NULL, 18, 'Очаровательный джемпер полуприлегающего силуэта бело-черного цвета с рукавами реглан. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием хлопка. Круглый вырез, низ рукавов и низ по спинке изделия обработаны двусторонней лицевой бейкой  контрастного цвета. На рукавах вывязан рисунок - горох. Перед изделия украшен декоративным элементом из шифонового полотна в виде цветов. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 71 см.\r\nСостав: Хлопок 100%.\r\n', 'ВА-Др3-117/2-3', NULL, 2650, NULL, 1200, '2017-09-26 12:43:23', '2017-09-26 12:43:23', NULL, 0, 1, '', '', '', '', '', ''),
(788, 0, 10, 0, 'dzhemper_iz_hlopka_svetlo_serogo_cveta', 'Джемпер из хлопка светло-серого цвета', NULL, 18, 'Очаровательный джемпер прямого силуэта светло-серого цвета. Джемпер выполнен в технике ручного вязания из нитей с содержанием хлопка. Круглый вырез изделия обработан «чулочной» гладью. Джемпер с рукавами-реглан. По низу изделия и рукавов — манжеты. По переду и рукавам джемпера вывязан рисунок. По низу в боковых швах — разрезы.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 60-65 см.\r\nСостав: Хлопок 100%\r\n', 'ВА-Др4-187', NULL, 2850, NULL, 1300, '2017-09-26 12:49:41', '2017-09-26 12:49:41', NULL, 0, 1, '', '', '', '', '', ''),
(789, 0, 10, 0, 'voshititelnyj_kardigan_svobodnogo_silueta_', 'Восхитительный кардиган свободного силуэта', NULL, 18, 'Восхитительный кардиган свободного силуэта. Изделие выполнено в технике ручного вязания. Кардиган с V-образным вырезом, широким отложным воротником и втачными рукавами. Низ рукавов дополнен широкими манжетами.Модель свободного кроя с совмещенными размерами:42-44, 46-48,50-52, 54-56, 58-60. Аксессуары в комплект не входят. Длина изделия по спинке от плечевого шва до низа изделия — 98 см. \r\nСостав: Акрил 70%, Мохер 20%, Шерсть 10%', 'ВА-Кн4-193', NULL, 3850, NULL, 1800, '2017-09-26 13:02:58', '2017-09-26 13:16:33', NULL, 0, 1, '', '', '', '', '', ''),
(790, 0, 10, 0, 'kardigan_svobodnogo_silueta_cherno_belogo_cveta', 'Кардиган свободного силуэта черно-белого цвета', NULL, 18, 'Стильный кардиган свободного силуэта черно-белого цвета с геометричным рисунком. Изделие выполнено в технике ручного вязания из нитей с добавлением хлопка. Борта переда и горловины изделия обработаны кожаной окантовкой черного цвета. Низ спинки состоит из двух частей -  «в нахлест». По боковым швам изделия  - карманы.Модель свободного кроя с совмещенными размерами:42-44, 46-48. 50-52, 54-56, 58-60\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —  85 см.\r\nСостав: Хлопок 100%', 'ВА-Кн4-177', NULL, 4250, NULL, 2000, '2017-09-26 13:13:42', '2017-09-26 13:13:42', NULL, 0, 1, '', '', '', '', '', ''),
(791, 0, 10, 0, 'izyskannyj_kardigan_pryamogo_silueta', 'Изысканный кардиган прямого силуэта', NULL, 18, 'Изысканный кардиган прямого силуэта.  Кардиган выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез изделия обработан окантовкой из полотна имитирующего «кожу». По переду изделия застежка на металлическую молнию. Перед изделия дополнен накладными карманами, обработанными  полотном имитирующим «кожу». Аксессуары в комплект не входят. Длина изделия по спинке от плечевого шва до низа изделия-61-65 см.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%', 'ВА-Кн4-160', NULL, 3050, NULL, 1400, '2017-09-26 13:37:50', '2017-09-26 13:37:50', NULL, 0, 1, '', '', '', '', '', ''),
(792, 0, 10, 0, 'dzhemper_pryamogo_silueta_iz_hlopka', 'Джемпер прямого силуэта из хлопка', NULL, 18, 'Джемпер прямого силуэта  с втачными рукавами. Джемпер выполнен в технике «ручного вязания» из натуральных нитей  с содержанием хлопка.  Круглый вырез обработан двусторонней лицевой бейкой. Перед изделия и низ рукавов дополнены широкой вязаной косой. Перед дополнен аппликацией. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 66-70 см. \r\nСостав: Хлопок 100%', 'ВА-Др4-181', NULL, 3050, NULL, 1400, '2017-09-26 13:51:05', '2017-09-26 13:51:05', NULL, 0, 1, '', '', '', '', '', ''),
(793, 0, 10, 0, 'hlopkovyj_sviter_s_yarkim_uzorom', 'Хлопковый свитер с ярким узором', NULL, 18, 'Восхитительный джемпер свободного силуэта красно-черного цвета. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием хлопка. Круглый вырез изделия обработан двусторонней лицевой бейкой. По низу втачных рукавов и низу джемпера — манжеты. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 63-67 см.\r\nСостав: Хлопок 100%.', 'ВА-Др3-131', NULL, 2210, NULL, 980, '2017-09-26 14:03:19', '2017-09-26 14:03:19', NULL, 0, 1, '', '', '', '', '', ''),
(794, 0, 10, 0, 'belyj_dzhemper_s_risunkom_v_vide_koshki', 'Белый джемпер с рисунком в виде кошки', NULL, 18, 'Стильный джемпер прямого силуэта бело-черного цвета. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием шерсти. Круглый вырез, низ втачных рукавов и низ изделия обработаны контрастной двухсторонней лицевой бейкой. По переду изделия вывязан рисунок в виде «кошки». Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —63-70 см.\r\nСостав: 	Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %', 'ВА-ДР3-109', NULL, 2150, NULL, 950, '2017-09-26 14:07:16', '2017-09-26 14:07:16', NULL, 0, 1, '', '', '', '', '', ''),
(795, 0, 10, 0, 'dzhemper_sero_sirenevogo_cveta', 'Джемпер серо-сиреневого цвета', NULL, 19, 'Очаровательный джемпер прямого силуэта серо-сиреневого цвета. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез изделия и низ рукавов - реглаг обработаны двусторонней лицевой бейкой. По переду изделия вывязан декоративный рисунок. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —67 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %', 'ВА-Др4-106', NULL, 2350, NULL, 1050, '2017-09-26 14:12:23', '2017-09-26 14:12:23', NULL, 0, 1, '', '', '', '', '', ''),
