(797, 0, 10, 0, 'dzhemper_v_polosku_s_yarkim_dekorativnym_elementom', 'Джемпер в полоску с ярким декоративным элементом', NULL, 18, 'Стильный джемпер свободного силуэта черно-белого цвета.  Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез изделия обработан двусторонней лицевой бейкой. Перед изделия украшен декоративный элементом со стразами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия- 65-67 см.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%.', 'ВА-ДР4-161', NULL, 2450, NULL, 1100, '2017-09-26 14:14:57', '2017-09-26 14:14:57', NULL, 0, 1, '', '', '', '', '', ''),
