(800, 0, 10, 0, 'dzhemper_poluprilegayushego_silueta_krasnogo_cveta', 'Джемпер полуприлегающего силуэта красного цвета', NULL, 18, 'Обворожительный джемпер полуприлегающего силуэта красного цвета. Джемпер выполнен в технике ручного вязания. Воротник «хомут» и низ изделия вывязаны ажурным рисунком. Низ рукавов обработан двухсторонней лицевой бейкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —68-74см.\r\nСостав: Мохер 60%, Акрил 40%\r\n', 'ВА-Др3-91', NULL, 2850, NULL, 1300, '2017-09-26 14:29:28', '2017-09-26 14:29:28', NULL, 0, 1, '', '', '', '', '', ''),
(801, 0, 10, 0, 'dzhemper_iz_hlopka_s_tyulpanami', 'Джемпер из хлопка с тюльпанами', NULL, 18, 'Восхитительный джемпер прямого силуэта. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием хлопка. Круглый вырез изделия обработан двусторонней лицевой бейкой. Низ рукавов и низ изделия обработаны манжетами, выполненные в технике «резинка». По переду изделия вывязан рисунок — тюльпаны. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 58-65 см.\r\nСостав: Хлопок 100%.', 'ВА-Др3-134', NULL, 2350, NULL, 1050, '2017-09-26 14:30:54', '2017-09-26 14:38:00', NULL, 0, 1, '', '', '', '', '', ''),
(803, 0, 10, 0, 'hlopkovyj_dzhemper_s_kontrastnoj_okantovkoj', 'Хлопковый джемпер с контрастной окантовкой', NULL, 18, 'Стильный джемпер полуприлегающего силуэта. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием хлопка. Круглый вырез, низ  рукавов и низ изделия обработаны контрастной двусторонней лицевой бейкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 63-68 см.\r\nСостав: Хлопок 100%.', 'ВА-Др3-174', NULL, 1950, NULL, 850, '2017-09-26 14:37:43', '2017-09-26 14:37:43', NULL, 0, 1, '', '', '', '', '', ''),
(804, 0, 10, 0, 'ocharovatelnoe_plate_a_silueta', 'Очаровательное платье А-силуэта', NULL, 18, 'Очаровательное платье А-силуэта. Платье выполнено в технике «ручного вязания» из натуральных нитей с содержанием хлопка. V-образный вырез горловины и низ изделия дополнены ажурным кружевом. Втачные рукава, длиной три четверти, вывязаны ажурным рисунком, по низу обработаны лицевой бейкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —105 см.\r\nСостав: Хлопок 100%', 'ВА-Пв4-183', NULL, 3850, NULL, 1800, '2017-09-26 14:42:05', '2017-09-26 14:42:05', NULL, 0, 1, '', '', '', '', '', ''),
(805, 0, 10, 0, 'belyj_dzhemper_s_dobavleniem_mohera', 'Белый джемпер с добавлением мохера', NULL, 18, 'Очаровательный джемпер полуприлегающего силуэта белого цвета. Изделие выполнено в технике ручного вязания. Круглый вырез изделия обработан двусторонней лицевой бейкой. По низу изделия и втачных рукавов — манжеты. По переду изделия вывязан декоративный орнамент. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 64-68 см.\r\nСостав: Акрил 70%, Мохер 20%, Шерсть 10%.', 'ВА-Др4-90', NULL, 2150, NULL, 950, '2017-09-26 14:45:52', '2017-09-26 14:45:52', NULL, 0, 1, '', '', '', '', '', ''),
(806, 0, 10, 0, 'roskoshnyj_dzhemper_svobodnogo_silueta_s_dekorativnym_risunkom', 'Роскошный джемпер свободного силуэта с декоративным рисунком', NULL, 18, 'Роскошный джемпер свободного силуэта белого цвета. Джемпер выполнен в технике «ручного вязания». Круглый вырез, низ рукавов и низ изделия обработаны двусторонней лицевой бейкой. По переду изделия вывязан декоративный рисунок. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 55-62 см.\r\nСостав: Акрил 70%, Мохер 20%, шерсть 10%.', 'ВА-Др4-98', NULL, 2350, NULL, 1050, '2017-09-26 14:50:44', '2017-09-26 14:59:50', NULL, 0, 1, '', '', '', '', '', ''),
(807, 0, 10, 0, 'svobodnyj_sviter_s_dobavleniem_shersti', 'Свободный свитер с добавлением шерсти', NULL, 18, 'Нежный джемпер свободного силуэта выполнен в технике ручного вязания из нитей белого цвета с добавлением шерсти. Круглый вырез изделия обработан двусторонней лицевой бейкой. По переду изделия вывязан декоративный рисунок. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —74-82 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %.', 'ВА-Др4-94', NULL, 2650, NULL, 1200, '2017-09-26 14:54:23', '2017-09-26 14:54:23', NULL, 0, 1, '', '', '', '', '', ''),
(808, 0, 10, 0, 'vyazanoe_trikotazhnoe_plate_s_rukavom_reglan', 'Вязаное трикотажное платье с рукавом реглан', NULL, 18, 'Очаровательное платье прямого силуэта с ажурным рисунком «косы». Изделие выполнено в технике «ручного вязания» из натуральных нитей с добавлением шерсти. Круглый вырез изделия обработан двусторонней лицевой бейкой. Круглый вырез изделия обработан бейкой - «чулочная гладь». Низ рукавов — реглан и низ изделия обработаны манжетами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 90-95 см.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%', 'ВА-Пв4-166', NULL, 3850, NULL, 1800, '2017-09-26 14:59:42', '2017-10-02 19:03:54', NULL, 0, 1, '', '', '', '', '', ''),
(809, 0, 10, 0, '_dzhemper_pryamogo_silueta_s_rukavom_reglan_i_izyashnoj_gorlovinoj', 'Джемпер прямого силуэта с рукавом реглан и изящной горловиной', NULL, 18, 'Изящный джемпер прямого силуэта светло-розового цвета. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с добавлением мохера. Низ рукавов — реглан и низ изделия обработаны манжетами. По переду и на рукавах вывязан ажурный рисунок. По боковым швам - разрезы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —63-70 см.\r\nСостав: Акрил 70%, Мохер 20%, Шерсть 10%.', 'ВА-Др4-113', NULL, 2350, NULL, 1050, '2017-09-26 15:03:06', '2017-09-26 15:14:31', NULL, 0, 1, '', '', '', '', '', ''),
(810, 0, 10, 0, 'rozovyj_poluprozrachnyj_dzhemper', 'Розовый полупрозрачный джемпер', NULL, 19, 'Обаятельный джемпер полуприлегающего силуэта розового цвета. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием вискозы.  Круглый вырез изделия обработан двусторонней лицевой бейкой. По низу втачных рукавов-манжеты. Джемпер полупрозрачный, на фото представлен с однотонным черным топом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 70 см.\r\nСостав: 	Вискоза 95%, Эластан 5%.', 'ВА-Др5-49/1', NULL, 2050, NULL, 900, '2017-09-26 15:05:29', '2017-09-26 15:05:29', NULL, 0, 1, '', '', '', '', '', ''),
(811, 0, 10, 0, 'zhilet_pryamogo_silueta_bordovogo_cveta', 'Жилет прямого силуэта бордового цвета', NULL, 18, 'Роскошный жилет прямого силуэта бордового цвета. Жилет выполнен в технике «ручного вязания» из натуральных нитей с содержанием вискозы. Вывязанный вертикальный рисунок визуально удлиняет силуэт. Застежка по переду на металлические крючки. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —76-84 см.', 'ВА-Ж1-97', NULL, 2150, NULL, 950, '2017-09-26 15:07:59', '2017-09-26 15:07:59', NULL, 0, 1, '', '', '', '', '', ''),
(812, 0, 10, 0, 'vyazanyj_mnogocvetnyj_dzhemper', 'Вязаный многоцветный джемпер', NULL, 18, 'Очаровательный джемпер прямого силуэта с втачными рукавами. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием хлопка. Круглый вырез, низ втачных рукавов и низ изделия обработаны двусторонней лицевой бейкой.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 60-69 см.\r\nСостав: Хлопок 100%.', 'ВА-Др5-138', NULL, 2350, NULL, 1050, '2017-09-26 15:10:11', '2017-09-26 15:10:11', NULL, 0, 1, '', '', '', '', '', ''),
(813, 0, 10, 0, 'roskoshnaya_tunika_s_uglublennoj_projmoj_i_vtachnymi_rukavami', 'Роскошная туника с углубленной проймой и втачными рукавами', NULL, 18, 'Роскошная туника свободного силуэта . Туника выполнена в технике ручного вязания из нитей с содержанием мохера. Круглый вырез изделия обработан «чулочной» гладью. Туника с углубленной проймой и втачными рукавами. По низу изделия и рукавов — манжеты. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 66-74 см.\r\nСостав: Мохер 60%, Акрил 40%.\r\n', 'ВА-Др5-80', NULL, 2650, NULL, 1200, '2017-09-26 15:14:41', '2017-09-26 15:26:02', NULL, 0, 1, '', '', '', '', '', ''),
(814, 0, 10, 0, 'ocharovatelnoe_plate_pryamogo_silueta', 'Очаровательное платье прямого силуэта', NULL, 18, 'Очаровательное платье прямого силуэта. Платье выполнено в технике «ручного вязания» из натуральных нитей с добавлением шерсти. Круглый вырез изделия обработан «чулочной гладью». Платье со спущенной линией проймы. Них втачных рукавов обработан «английской резинкой». Низ изделия дополнен ажурным кружевом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —96 -102 см.\r\nСостав: 	Акрил 70%, Мохер 20%, Шерсть 10%', 'ВА-Пв4-154', NULL, 3850, NULL, 1800, '2017-09-26 15:19:33', '2017-09-26 15:19:33', NULL, 0, 1, '', '', '', '', '', ''),
(815, 0, 10, 0, 'nezhnyj_dzhemper_pryamogo_silueta', 'Нежный джемпер прямого силуэта', NULL, 18, 'Нежный джемпер прямого силуэта.  Джемпер выполнен в технике «ручного вязания» из нитей с содержанием вискозы. Круглый вырез изделия обработан двусторонней лицевой бейкой. Низу рукавов обработан двусторонней лицевой бейкой.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —64-70 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%.', 'ВА-Др4-99', NULL, 2150, NULL, 950, '2017-09-26 15:21:49', '2017-09-26 15:21:49', NULL, 0, 1, '', '', '', '', '', ''),
(816, 0, 10, 0, 'voshititelnoe_plate_pryamogo_silueta', 'Восхитительное платье прямого силуэта', NULL, 18, 'Восхитительное платье прямого силуэта. Платье выполнено в технике «ручного вязания» из натуральных нитей с добавлением шерсти. Круглый вырез изделия обработан «чулочной гладью». Платье со спущенной линией проймы и втачными однотонными рукавами. По низу изделия — манжет.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —93-99 см.\r\nСостав:Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %', 'Ва-Пв4-153', NULL, 3870, NULL, 1810, '2017-09-26 15:28:37', '2017-09-26 15:28:37', NULL, 0, 1, '', '', '', '', '', ''),
(817, 0, 10, 0, 'teplyj_sviter_s_olenem', 'Теплый свитер с оленем', NULL, 18, 'Забавный джемпер прямого силуэта. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез изделия обработан "резинкой". Джемпер со спущенной проймой и втачными рукавами. По низу рукавов и низу изделия — манжеты. По переду изделия вывязан рисунок — олень. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 69-72 см.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%.', 'ВА-Др5-151', NULL, 2750, NULL, 1250, '2017-09-26 15:31:23', '2017-09-26 15:31:23', NULL, 0, 1, '', '', '', '', '', ''),
(818, 0, 10, 0, 'ocharovatelnyj_dzhemper_pryamogo_silueta_so_skandinavskim_risunkom', 'Очаровательный джемпер прямого силуэта со скандинавским рисунком', NULL, 18, 'Очаровательный джемпер прямого силуэта. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез изделия обработан "резинкой". Джемпер со спущенной проймой и втачными рукавами. По низу рукавов и низу изделия — манжеты. По переду изделия и на рукавах вывязан рисунок. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 63-69 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %.', 'ВА-Др5-152', NULL, 2550, NULL, 1150, '2017-09-26 15:39:26', '2017-09-26 15:39:26', NULL, 0, 1, '', '', '', '', '', ''),
(819, 0, 10, 0, 'bordovyj_dzhemper_s_metallizirovannym_risunokom', 'Бордовый джемпер с металлизированным рисуноком', NULL, 18, 'Очаровательный джемпер прямого силуэта бордового цвета. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием хлопка. Круглый вырез изделия обработан двусторонней лицевой бейкой. Низ рукавов обработаны манжетами, выполненные в технике «резинка». По переду изделия металлизированный рисунок. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 58-62 см.\r\nСостав: Хлопок 100%.', 'ВА-Др3-133/6-7', NULL, 2150, NULL, 950, '2017-09-26 15:43:54', '2017-09-26 15:43:54', NULL, 0, 1, '', '', '', '', '', ''),
(820, 0, 10, 0, 'dzhemper_pryamogo_silueta_korichnevogo_cveta', 'Джемпер прямого силуэта коричневого цвета', NULL, 19, 'Обворожительный джемпер прямого силуэта коричневого цвета. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием мохера. Джемпер с круглым вырезом и рукавами реглан. По переду изделия вывязан ажурный рисунок. По низу рукавов — манжеты. Низ изделия обработан двухсторонней лицевой бейкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —67 см.\r\nСостав: Акрил 70%, Мохер 20%, Шерсть 10%', 'ВА-Др4-110', NULL, 2350, NULL, 1050, '2017-09-26 15:43:56', '2017-09-26 15:43:56', NULL, 0, 1, '', '', '', '', '', ''),
(821, 0, 10, 0, 'stilnyj_letnij_dzhemper_s_dekorativnym_ornamentom', 'Стильный летний джемпер с декоративным орнаментом', NULL, 18, 'Стильный летний джемпер прямого силуэта. Перед изделия выполнен в технике ручного вязания из натуральных нитей с содержанием хлопка. Круглый вырез изделия и глубокая пройма рукавов «реглан» обработаны контрастной бейкой.  По переду изделия вывязан декоративный орнамент. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 70-78 см.\r\nСостав: 	Вискоза 53%, Хлопок 47%.', 'ВА-Др3-19', NULL, 2350, NULL, 1050, '2017-09-26 15:51:46', '2017-09-26 16:05:45', NULL, 0, 1, '', '', '', '', '', ''),
(822, 0, 10, 0, 'uyutnaya_tunika_poluprilegayushego_silueta_', 'Уютная туника полуприлегающего силуэта', NULL, 18, 'Уютная туника полуприлегающего силуэта розового цвета. Туника выполнена в технике ручного вязания из нитей с содержанием мохера. Круглый вырез изделия обработан «чулочной» гладью. Туника с углубленной проймой и втачными рукавами. По низу изделия и рукавов — манжеты. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 78 -84 см\r\nСостав:Мохер 60%, Акрил 40%', 'ВА-Др4-81', NULL, 2650, NULL, 1200, '2017-09-26 15:53:02', '2017-09-26 15:53:02', NULL, 0, 1, '', '', '', '', '', ''),
(823, 0, 10, 0, 'belyj_hlopkovyj_dzhemper_s_vyrezom_lodochka', 'Белый хлопковый джемпер с вырезом лодочка', NULL, 18, 'Стильный джемпер прямого силуэта белого цвета. Изделие выполнено в технике "ручного вязания" из нитей с содержанием хлопка. Вырез горловины изделия в форме "лодочка". По рукавам вывязан рисунок "косы", перед и спинка имеют рисунок - "лапша". Низ рукавов и низ изделия обработаны манжетами в технике "резинка". Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия - 64-66 см.\r\nСостав: 	Хлопок 100%.', 'ВА-Др5-178', NULL, 2650, NULL, 1200, '2017-09-26 15:55:25', '2017-09-26 15:55:25', NULL, 0, 1, '', '', '', '', '', ''),
(824, 0, 10, 0, 'izyashnyj_hlopkovyj_kardigan', 'Изящный хлопковый кардиган', NULL, 18, 'Потрясающий кардиган прямого силуэта. Изделие выполнено в технике «ручного вязания» из натуральных нитей с содержанием хлопка. Круглый вырез изделия обработан двусторонней лицевой бейкой и дополнен застежкой на пуговицу. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 83-89 см.\r\nСостав: Хлопок 100%.', 'ВА-Кн4-43', NULL, 2850, NULL, 1300, '2017-09-26 16:04:22', '2017-09-26 16:04:22', NULL, 0, 1, '', '', '', '', '', '');
