(825, 0, 10, 0, 'obayatelnyj_dzhemper_pryamogo_silueta', 'Обаятельный джемпер прямого силуэта', NULL, 18, 'Обаятельный джемпер прямого силуэта. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием хлопка. V-образный вырез изделия обработан «чулочной гладью». По низу рукавов-реглан — манжеты. По переду изделия вывязан рисунок — ромбы.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —66-70 см.\r\nСостав: Хлопок 100%', 'ВА-Др5-145', NULL, 2150, NULL, 950, '2017-09-26 16:05:16', '2017-09-26 16:05:16', NULL, 0, 1, '', '', '', '', '', ''),
(826, 0, 10, 0, 'dzhemper_pryamogo_silueta_yarko_golubogo_cveta', 'Джемпер прямого силуэта ярко-голубого цвета', NULL, 18, 'Обаятельный джемпер прямого силуэта ярко-голубого цвета. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез изделия обработан двусторонней лицевой бейкой. Низ втачных рукавов и низ  изделия обработаны двусторонней лицевой бейкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —61-67 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-Др5-55', NULL, 2350, NULL, 1050, '2017-09-26 16:13:46', '2017-09-26 16:13:46', NULL, 0, 1, '', '', '', '', '', ''),
(827, 0, 10, 0, '_dzhemper_pryamogo_silueta_biryuzovogo_cveta', 'Джемпер прямого силуэта бирюзового цвета', NULL, 19, 'Эффектный джемпер прямого силуэта бирюзового цвета. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием вискозы. Круглый вырез изделия обработан двусторонней лицевой бейкой. Джемпер с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —70 см.\r\nСостав: Акрил 70%, Мохер 20%, Шерсть 10%', 'ВА-Др3-101', NULL, 2150, NULL, 950, '2017-09-26 16:22:53', '2017-09-26 16:22:53', NULL, 0, 1, '', '', '', '', '', ''),
(828, 0, 10, 0, 'azhurnyj_kardigan_poluprilegayushego_silueta_s_zastezhkoj', 'Ажурный кардиган полуприлегающего силуэта с застежкой', NULL, 18, 'Изысканный кардиган полуприлегающего силуэта . Кардиган выполнен в технике «ручного вязания» из натуральных нитей с содержанием вискозы. Круглый вырез, низ рукавов и планки изделия обработаны двусторонней лицевой бейкой. По переду изделия планка с застежкой на пуговицы. Кардиган вывязан ажурным рисунком.Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 66-71 см.\r\nСостав:Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%.', 'ВА-Кн4-188', NULL, 2850, NULL, 1300, '2017-09-26 16:27:14', '2017-09-26 16:37:35', NULL, 0, 1, '', '', '', '', '', ''),
(829, 0, 10, 0, 'stilnyj_ukorochennyj_zhaket_iz_trikotazhnogo_polotna_s_paetkami_i_bahromoj', 'Стильный укороченный жакет из трикотажного полотна с паетками и бахромой', NULL, 18, 'Стильный укороченный жакет прямого силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан внутренней обтачкой. По переду жакета планка с застежкой на пуговицы. Перед по низу и низ втачных рукавов изделия выполнены из полотна имитирующего кожу и дополнены тесьмой расшитой паетками и декоративной бахромой.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 67 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-М4-3681', NULL, 3250, NULL, 1500, '2017-09-26 16:51:59', '2017-09-26 18:27:05', NULL, 0, 1, '', '', '', '', '', ''),
(830, 0, 10, 0, 'ukorochennyj_zhaket_s_roskoshnoj_kuponnoj_vyshivkoj_i_probivnym_kruzhevom', 'Укороченный жакет с роскошной купонной вышивкой и пробивным кружевом', NULL, 18, 'Великолепный укороченный жакет прямого силуэта из полотна имитирующего кожу черного цвета. Круглый вырез изделия обработан внутренней обтачкой. По переду жакета планка с застежкой на молнию. Низ переда изделия дополнен роскошной купонной вышивкой и пробивным кружевом. Втачные рукава жакета по низу дополнены заворотами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 59-60 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-М4-3682', NULL, 3450, NULL, 1600, '2017-09-26 17:01:50', '2017-09-26 18:34:03', NULL, 0, 1, '', '', '', '', '', ''),
(831, 0, 10, 0, 'stilnyj_udlinennyj_zhaket_pryamogo_silueta', 'Стильный удлиненный жакет прямого силуэта', NULL, 18, 'Стильный удлиненный жакет прямого силуэта из трикотажного полотна с рельефным рисунком. Отложной воротник и втачные рукава украшены кружевом. По переду изделия планка с застежкой на пуговицы. Прорезные карманы дополнены пуговицами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —96- 98 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3669', NULL, 4450, NULL, 2100, '2017-09-26 17:16:51', '2017-09-26 17:16:51', NULL, 0, 1, '', '', '', '', '', ''),
(832, 0, 10, 0, 'kardigan_iz_vyazannogo_trikotazhnogo_polotna_s_vtachnymi_rukavami', 'Кардиган из вязанного трикотажного полотна с втачными рукавами', NULL, 18, 'Незаменимый кардиган свободного силуэта из вязанного трикотажного полотна . Вырез и полы изделия обработаны широкой двусторонней обтачкой. Кардиган с втачными рукавами со спущенной линией проймы. Перед изделия дополнен накладными карманами. Кардиган дополнен широким поясом на завязках. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 107-113 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П5-3680', NULL, 3650, NULL, 1700, '2017-09-26 17:20:14', '2017-11-03 13:29:12', NULL, 0, 1, '', '', '', '', '', ''),
(833, 0, 10, 0, 'bluzka_iz_trikotazhnogo_polotna_s_legkim_metallicheskim_bleskom', 'Блузка из трикотажного полотна с легким металлическим блеском', NULL, 18, 'Обаятельная блузка прямого силуэта из трикотажного полотна  с легким металлическим блеском. Фигурный вырез изделия обработан внутренней обтачкой и дополнен кружевом. Блузка с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —70- 73 см.', 'ВА-М5-3664', NULL, 2950, NULL, 1350, '2017-09-26 17:35:23', '2017-09-26 18:30:31', NULL, 0, 1, '', '', '', '', '', ''),
(834, 0, 10, 0, 'ocharovatelnaya_tunika_svobodnogo_silueta_iz_tekstilnogo_polotna', 'Очаровательная туника свободного силуэта из текстильного полотна', NULL, 18, 'Очаровательная туника свободного силуэта из текстильного полотна имитирующего замшу. V-образный вырез изделия обработан внутренней обтачкой и украшен декоративной аппликацией. Низ втачных рукавов со спущенной линией проймы дополнен манжетами. Перед туники дополнен воланами. Спинка изделия удлиненна. Аксессуары в комплект не входят.\r\nДлина изделия от плечевого шва по спинке до низа изделия — 67-72 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-М4-3674', NULL, 3450, NULL, 1600, '2017-09-26 17:36:45', '2017-09-26 19:35:28', NULL, 0, 1, '', '', '', '', '', ''),
(835, 0, 10, 0, 'bluza_svobodnogo_silueta_iz_viskoznogo_trikotazhnogo_polotna_s_razrezami', 'Блуза свободного силуэта из вискозного трикотажного полотна с разрезами', NULL, 18, 'Восхитительная блуза свободного силуэта из трикотажного полотна. Круглый вырез изделия обработан внутренней обтачкой. Низ втачных рукавов со спущенной линией проймы дополнен манжетами. В боковых швах блузы разрезы. Изделие по спинке удлиненно.Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 59- 62 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-М4-3673', NULL, 2850, NULL, 1300, '2017-09-26 17:53:16', '2017-10-09 12:24:25', NULL, 0, 1, '', '', '', '', '', ''),
(836, 0, 10, 0, 'zhenstvennaya_bluza_s_azhurnym_kruzhevom_i_kantami', 'Женственная блуза с ажурным кружевом и кантами', NULL, 20, 'Женственная блуза полуприлегающего силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан окантовкой. Перед блузы дополнен ажурным кружевом и кантами. В боковых швах изделия разрезы. Спинка блузы удлиненна. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия  — 68 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3675', NULL, 2850, NULL, 1300, '2017-09-26 18:03:35', '2017-10-18 20:59:41', NULL, 0, 1, '', '', '', '', '', ''),
(837, 0, 10, 0, 'bluzka_sero_chernogo_cveta', 'Блузка  серо-черного цвета', NULL, 19, 'Обаятельная блузка свободного силуэта из трикотажного полотна серо-черного цвета. Фигурный вырез украшен декоративным кружевом. Цельнокроеные рукава и низ изделия — обработаны манжетами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 73см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М4-3662', NULL, 2850, NULL, 1300, '2017-09-26 18:08:08', '2017-09-26 18:08:08', NULL, 0, 1, '', '', '', '', '', ''),
(838, 0, 10, 0, 'stilnyj_zhaket_iz_trikotazhnogo_polotna_s_relefnoj_fakturoj_na_molnii', 'Стильный жакет из трикотажного полотна с рельефной фактурой на молнии', NULL, 7, 'Стильный жакет прямого силуэта из трикотажного полотна белого цвета с рельефной фактурой. Круглый вырез изделия обработан внутренней обтачкой. Перед изделия дополнен декоративной молнией и контрастными лентами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке  от плечевого шва до низа изделия — 62 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М5-3185', NULL, 2850, NULL, 1300, '2017-09-26 18:20:45', '2017-09-26 18:24:20', NULL, 0, 1, '', '', '', '', '', ''),
(839, 0, 10, 0, 'udlinennyj_zhilet_pryamogo_silueta_iz_ekokozhi', 'Удлиненный жилет прямого силуэта из экокожи', NULL, 19, 'Роскошный удлиненный жилет прямого силуэта из «кожи». V-образный вырез обработан внешней обтачкой. Цельнокроеные рукава обработаны окантовкой. По низу изделия ажурная перфорация.Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 78 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М2-2279', NULL, 2670, NULL, 1210, '2017-09-26 18:25:30', '2017-09-26 18:25:30', NULL, 0, 1, '', '', '', '', '', ''),
(840, 0, 10, 0, 'trikotazhnaya_tunika_sine_serogo_cveta_v_krugi', 'Трикотажная туника сине-серого цвета в круги', NULL, 18, 'Чудесная туника прямого силуэта из трикотажного полотна сине-серого цвета. Круглый вырез изделия обработан внутренней обтачкой. Цельнокроеные рукава и низ изделия по переду дополнены вставками из перфорированной кожи синего цвета.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 74-80 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%.', 'ВА-М4-3420/8-9', NULL, 2850, NULL, 1300, '2017-09-26 18:42:16', '2017-09-26 18:42:16', NULL, 0, 1, '', '', '', '', '', ''),
(841, 0, 10, 0, 'trikotazhnaya_tunika_sine_krasnogo_cveta_v_kletku', 'Трикотажная туника сине-красного цвета в клетку', NULL, 18, 'Ослепительная туника прямого силуэта из трикотажного полотна сине-красного цвета. Круглый вырез изделия обработан внутренней обтачкой. Цельнокроеные рукава и низ изделия по переду дополнены вставкой из перфорированной кожи. В боковых швах изделия — карманы. Перед изделия по низу дополнен металлическим элементом.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке  от плечевого шва до низа изделия — 73-80 см.\r\nСостав:	Вискоза 30%, Полиэстер 65%, Эластан 5%.', 'ВА-М4-3420/2-3', NULL, 3250, NULL, 1500, '2017-09-26 18:50:38', '2017-09-26 18:50:45', NULL, 0, 1, '', '', '', '', '', ''),
(842, 0, 10, 0, 'nezhnaya_tunika_svobodnogo_silueta', 'Нежная туника свободного силуэта', NULL, 18, 'Нежная туника свободного силуэта из трикотажного полотна. Круглый вырез изделия и низ втачных рукавов обработаны контрастной окантовкой. Перед и спинка изделия украшены декоративной аппликацией. Спинка изделия удлинена.Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 80-83 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-М4-3449/2-7', NULL, 2650, NULL, 1200, '2017-09-26 18:52:20', '2017-10-18 20:39:19', NULL, 0, 1, '', '', '', '', '', ''),
(843, 0, 10, 0, 'trikotazhnaya_vodolazka_molochnogo_cveta', 'Трикотажная водолазка молочного цвета', NULL, 7, 'Уютная блузка из мягкого трикотажного полотна прямого силуэта с втачными рукавами и воротником «хомут». Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 68 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-В5-2818', NULL, 1550, NULL, 650, '2017-09-26 19:00:28', '2017-09-26 19:00:28', NULL, 0, 1, '', '', '', '', '', ''),
(844, 0, 10, 0, 'temno_sinyaya_vodolazka_s_risunkom', 'Темно-синяя водолазка с рисунком', NULL, 18, 'Идеальная водолазка на каждый день из легкого трикотажного полотна. Водолазка с узким воротником и втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 65-68 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-В5-2818/19-20', NULL, 1550, NULL, 650, '2017-09-26 19:08:09', '2017-09-26 19:08:09', NULL, 0, 1, '', '', '', '', '', ''),
(845, 0, 10, 0, 'chernaya_vodolazka_s_kruzhevom', 'Черная водолазка с кружевом', NULL, 18, 'Замечательная блузка прямого силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан воротником «хомут». Низ втачных рукавов обработан манжетом и дополнен кружевом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 60-70 см.\r\nСостав: 	Полиэстер 95%, Эластан 5%.', 'ВА-В5-2818/23-24', NULL, 2210, NULL, 980, '2017-09-26 19:11:54', '2017-09-26 19:11:54', NULL, 0, 1, '', '', '', '', '', ''),
(846, 0, 10, 0, 'zhaket_pryamogo_silueta_iz_dzhinsovogo_polotna', 'Жакет прямого силуэта из джинсового полотна', NULL, 18, 'Модный жакет прямого силуэта из джинсового полотна с вышивкой.  Застежка по переду на втачную молнию. По линии переда удобные карманы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 73 -76 см.\r\nСостав: Хлопок 95%, Эластан 5%', 'ВА-М4-3534/2-5', NULL, 3450, NULL, 1600, '2017-09-26 19:13:47', '2017-09-27 17:39:22', NULL, 0, 1, '', '', '', '', '', ''),
(847, 0, 10, 0, 'naryadnaya_bluza_s_kruzhevnymi_rukavami', 'Нарядная блуза с кружевными рукавами', NULL, 18, 'Милая блуза прямого силуэта из трикотажного полотна цвета. Круглый вырез блузы обработан внутренней обтачкой. Втачные рукава изделия выполнены из тонкого воздушного кружева и обработаны по низу резинкой. Аксессуары в комплект не входят. \r\nДлина блузки от плечевого шва по спинке до низа изделия — 60-65 см.\r\nСостав: 	Вискоза 95%, Эластан 5%.', 'ВА-М5-3580', NULL, 2850, NULL, 1300, '2017-09-26 19:19:37', '2017-09-26 19:19:37', NULL, 0, 1, '', '', '', '', '', ''),
(848, 0, 10, 0, 'zhenstvennaya_sine_belaya_tunika', 'Женственная сине-белая туника', NULL, 18, 'Женственная туника свободного силуэта из трикотажного полотна синего-белого цвета. Круглый вырез изделия обработан внутренней обтачкой. Туника с втачными рукавами.\r\nАксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 74-81 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-М4-3396/33-34', NULL, 2550, NULL, 1150, '2017-09-26 22:38:18', '2017-09-26 22:38:18', NULL, 0, 1, '', '', '', '', '', ''),
(849, 0, 10, 0, 'trikotazhnaya_tunika_s_cvetnym_kruzhevom', 'Трикотажная туника с цветным кружевом', NULL, 20, 'Романтичная туника свободного силуэта из трикотажного полотна. Круглый вырез изделия обработан внутренней обтачкой. Блуза с втачными рукавами. По низу изделия и рукавам блуза дополнена широким кружевом. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 77 см.\r\nСостав: 	Вискоза 95%, Эластан 5%.', 'ВА-М4-3396/29-32', NULL, 2650, NULL, 1200, '2017-09-26 22:56:16', '2017-09-26 22:56:16', NULL, 0, 1, '', '', '', '', '', ''),
(850, 0, 10, 0, 'roskoshnaya_tunika_iz_trikotazhnogo_polotna', 'Роскошная туника из трикотажного полотна', NULL, 18, 'Роскошная туника свободного силуэта из трикотажного полотна "3D-Digital" с цветочным принтом. Отличительной особенностью "3D-Digital" ткани является непосредственное нанесение рисунка на нити, что позволяет сохранить яркость и контрастность цвета на длительное время. Круглый вырез изделия обработан внутренней обтачкой. Туника с втачными рукавами. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 74-81 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-М4-3396/35-38', NULL, 2550, NULL, 1150, '2017-09-26 23:27:12', '2017-09-26 23:27:12', NULL, 0, 1, '', '', '', '', '', ''),
(851, 0, 10, 0, 'stilnyj_udlinennyj_zhilet_pryamogo_silueta', 'Стильный удлиненный жилет прямого силуэта', NULL, 18, 'Стильный жилет прямого силуэта из текстильного полотна. Вырез изделия обработан отложным воротничком Перед изделия дополнен планкой с застежкой на пуговицы и  втачными карманами с застежкой на пуговицы. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 92-95 см\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-П2-3530', NULL, 3850, NULL, 1800, '2017-09-27 11:02:10', '2017-10-02 19:02:17', NULL, 0, 1, '', '', '', '', '', ''),
(852, 0, 10, 0, 'zhenstvennyj_kardigan_s_rukavami_3_4', 'Женственный кардиган с рукавами 3/4', NULL, 18, 'Женственный кардиган прямого силуэта из вязаного трикотажного полотна. Вырез, полы изделия и низ втачных рукавов длиной 3/4 обработаны внутренней загибкой. Аксессуары в комплект не входят.\r\nДлина изделия от плечевого шва по спинке до низа изделия — 85 -95 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М4-3657', NULL, 3050, NULL, 1400, '2017-09-27 11:18:21', '2017-09-27 11:18:21', NULL, 0, 1, '', '', '', '', '', ''),
(853, 0, 10, 0, 'roskoshnyj_dzhemper_svobodnogo_silueta', 'Роскошный джемпер свободного силуэта', NULL, 18, 'Роскошный джемпер свободного силуэта из трикотажного полотна . Джемпер с V-образным вырезом и цельновязаными рукавами. Низ рукавов дополнен широкими манжетами. В боковых швах джемпера разрезы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 70-78 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-М4-3655', NULL, 3050, NULL, 1400, '2017-09-27 11:30:07', '2017-09-27 11:30:07', NULL, 0, 1, '', '', '', '', '', ''),
(854, 0, 10, 0, 'naryadnaya_bluza_poluprilegayushego_silueta', 'Нарядная блуза полуприлегающего силуэта', NULL, 18, 'Нарядная блуза полуприлегающего силуэта из трикотажного полотна. Горловина изделия дополнена ажурной кокеткой. Низ втачных рукавов обработан окантовкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа —  58-65 см.\r\nСостав:Вискоза 95%, Эластан 5%', 'ВА-М5-3554/1-3', NULL, 2850, NULL, 1300, '2017-09-27 11:42:04', '2017-10-09 11:22:16', NULL, 0, 1, '', '', '', '', '', ''),
(855, 0, 10, 0, 'naryadnaya_bluza_pryamogo_silueta', 'Нарядная блуза прямого силуэта', NULL, 18, 'Нарядная блуза прямого силуэта из легкого текстильного полотна . Передняя часть блузы по горловине дополнена сборками и обработана окантовкой. Широкие втачные рукава обработаны манжетами на резинке и украшены декоративными кружевными вставками по линии плеча. Низ изделия обработан резинкой.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа — 67-70 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М5-3536', NULL, 3250, NULL, 1500, '2017-09-27 11:58:15', '2017-09-27 11:58:15', NULL, 0, 1, '', '', '', '', '', ''),
(856, 0, 10, 0, 'zhaket_s_nabivnym_cvetochnym_risunkom', 'Жакет с набивным цветочным рисунком', NULL, 18, 'Роскошный жакет полуприлегающего силуэта из трикотажного полотна  с набивным цветочным рисунком. Изделие с двойным отложным воротником и втачными рукавами длины три-четверти. Перед изделия дополнен планкой с застежкой на пуговицы. Борта изделия по низу закруглены. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 60-63 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-М4-3600', NULL, 3450, NULL, 1600, '2017-09-27 12:25:23', '2017-09-27 12:25:23', NULL, 0, 1, '', '', '', '', '', ''),
(857, 0, 10, 0, 'kruzhevnoj_kardigan_svobodnogo_silueta', 'Кружевной кардиган свободного силуэта', NULL, 18, 'Великолепный кардиган свободного силуэта из кружевного полотна. V-образный вырез изделия обработан обтачкой. Изделие с втачными рукавами. По переду блузки планка с застежкой на пуговицы.\r\nАксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 67 см.', 'ВА-М5-3460/0-7', NULL, 3450, NULL, 1600, '2017-09-27 12:51:57', '2017-09-27 13:00:42', NULL, 0, 1, '', '', '', '', '', ''),
(858, 0, 10, 0, 'tunika_iz_tonkogo_kruzhevnogo_polotna_', 'Туника из тонкого кружевного полотна', NULL, 18, 'Роскошная туника прямого силуэта из тонкого кружевного полотна. Круглый вырез и проймы изделия обработаны внутренней окантовкой. В боковых швах туники — разрезы.\r\nАксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа — 105 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П2-3653', NULL, 2850, NULL, 1300, '2017-09-27 12:59:50', '2017-09-27 12:59:50', NULL, 0, 1, '', '', '', '', '', ''),
(859, 0, 10, 0, 'vyazanyj_kardigan_s_romantichnym_uzorom', 'Вязаный кардиган с романтичным узором', NULL, 18, 'Чудесный кардиган свободного силуэта из вязаного трикотажного полотна с романтичным узором. Круглый вырез, низ втачных рукавов и низ изделия обработаны двусторонней бейкой. По переду блузки планка с застежкой на пуговицы. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 61-68 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%.', 'ВА-М5-3460/8-11', NULL, 2850, NULL, 1300, '2017-09-27 13:00:33', '2017-09-27 13:00:33', NULL, 0, 1, '', '', '', '', '', ''),
(860, 0, 10, 0, 'stilnaya_rubashka_s_cvetochnym_printom', 'Стильная рубашка с цветочным принтом', NULL, 18, 'Стильная деловая рубашка полуприлегающего силуэта из текстильного полотна с цветочным купонным принтом. Круглый вырез изделия обработан отложным воротничком. Втачные рукава обработаны манжетами с застежкой на пуговицу. Перед изделия дополнен планкой с застежкой на пуговицы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа — 76 см.\r\nСостав: 	Полиэстер 95%, Эластан 5%.', 'ВА-М5-3358', NULL, 3050, NULL, 1400, '2017-09-27 13:09:05', '2017-09-27 13:09:05', NULL, 0, 1, '', '', '', '', '', ''),
(861, 0, 10, 0, 'vozdushnyj_kardigan_svobodnogo_silueta', 'Воздушный кардиган свободного силуэта', NULL, 18, 'Воздушная накидка свободного силуэта персикового цвета. Перед изделия выполнен из трикотажного кружевного полотна. Спинка изделия выполнена из однотонного трикотажного полотна персикового цвета. Края блузы и обработаны кантом в тон изделия. Втачной рукав со спущенной линией проймы.Аксессуары в комплект не входят. \r\nДлина изделия от плечевого шва по спинке до низа изделия — 78-83 см\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-М4-3422', NULL, 2950, NULL, 1350, '2017-09-27 13:11:06', '2017-09-27 13:11:06', NULL, 0, 1, '', '', '', '', '', ''),
(862, 0, 10, 0, 'svobodnaya_trikotazhnaya_bluza_sinego_cveta', 'Свободная трикотажная блуза синего цвета', NULL, 20, 'Незаменимая блуза свободного силуэта из трикотажного полотна «масло» синего цвета. V-образный вырез изделия обработан внутренней обтачкой. Блуза с рукавами-реглан. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 69 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-М3-3149/36', NULL, 1950, NULL, 850, '2017-09-27 13:15:57', '2017-09-27 13:15:57', NULL, 0, 1, '', '', '', '', '', ''),
(863, 0, 10, 0, 'romantichnaya_bluzka_pryamogo_silueta', 'Романтичная блузка прямого силуэта', NULL, 18, 'Романтичная блузка прямого силуэта из текстильного полотна. Перед изделия украшен декоративной кокеткой из ажурного кружева черного цвета. Круглый вырез изделия обработан окантовкой. Низ изделия и втачных рукавов обработаны манжетами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 60- 65 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М5-3551', NULL, 3050, NULL, 1400, '2017-09-27 13:22:45', '2017-09-27 13:29:02', NULL, 0, 1, '', '', '', '', '', ''),
(864, 0, 9, 0, 'vyazanaya_yubka_s_dobavleniem_shersti', 'Вязаная юбка с добавлением шерсти', NULL, 12, 'Юбка вязанная жаккардовая. Благодаря составу пряжи  и формы сплетения, юбка отлично сохраняет тепло и форму. Длина изделия по спинке около 55 см (44 р), около 58 см (50 р). \r\nСостав: шерсть 50%, акрил 50%.', 'ФЛА-940', NULL, 2150, NULL, 950, '2017-09-27 13:23:01', '2017-09-28 14:14:08', NULL, 0, 1, '', '', '', '', '', ''),
(865, 0, 10, 0, 'elegantnaya_bluza_iz_tekstilnogo_polotna_', 'Элегантная блуза из текстильного полотна', NULL, 18, 'Элегантная блуза из текстильного полотна.  Круглый вырез горловины обработан внутренней обтачкой. Втачные рукава три четверти. По боковым швам блузы располагаются втачные карманы. Аксессуары в комплект не входят.\r\nДлина блузки от плечевого шва по спинке до низа изделия — 60-70 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-М3-3572', NULL, 3050, NULL, 1400, '2017-09-27 13:33:49', '2017-09-27 13:33:49', NULL, 0, 1, '', '', '', '', '', ''),
(866, 0, 10, 0, 'elegantnaya_bluza_svetlo_serogo_cveta', 'Элегантная блуза светло-серого цвета', NULL, 18, 'Элегантная удлиненная блуза свободного силуэта из легкого текстильного полотна светло-серого цвета с контрастными элементами. Блуза по переду декорированна роскошным кружевным элементом. Воротник стойка обработан контрастным кантом черного цвета. Втачные рукава три-четверти обработаны контрастным кантом черного цвета. На спинке изделия потайная застежка на молнию. Завышенная линия талии подчеркнута контрастным кантом и мелкими складочками. Аксессуары в комплект не входят. \r\nДлина блузки от плечевого шва по спинке до низа изделия —68- 71 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-М4-3578', NULL, 3050, NULL, 1400, '2017-09-27 13:42:08', '2017-10-10 01:53:59', NULL, 0, 1, '', '', '', '', '', ''),
(867, 0, 10, 0, 'ocharovatelnyj_svitshot_pryamogo_silueta', 'Очаровательный свитшот прямого силуэта', NULL, 18, 'Очаровательный свитшот прямого силуэта из трикотажного полотна с рельефной фактурой. Круглый вырез изделия обработан обтачкой. Рукава-реглан и низ изделия обработаны манжетами. Перед изделия дополнен декоративным элементом.Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 64-68 см.\r\nСостав:Вискоза 95%, Эластан 5%', 'ВА-М4-3445', NULL, 3070, NULL, 1410, '2017-09-27 13:54:19', '2017-09-27 13:54:19', NULL, 0, 1, '', '', '', '', '', ''),
(868, 0, 10, 0, 'stilnaya_tunika_svobodnogo_silueta_iz_trikotozha', 'Стильная туника свободного силуэта из трикотожа', NULL, 18, 'Стильная туника свободного силуэта из трикотажного буклированного полотна имитирующего ручную вязку. Изделие с втачными рукавами со спущенной линией проймы и с разрезами в боковых швах по низу изделия. Перед изделия дополнен металлическим элементом. Передняя часть туники до линии талии и низ рукавов выполнены из чёрной перфорированной кожи. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 84 -88 см.\r\nСостав: Вискоза 95%, Эластан 5%\r\n', 'ВА-М4-3516', NULL, 3310, NULL, 1530, '2017-09-27 15:30:47', '2017-09-27 15:30:47', NULL, 0, 1, '', '', '', '', '', ''),
(869, 0, 10, 0, 'elegantnaya_tunika_svobodnogo_silueta', 'Элегантная туника свободного силуэта', NULL, 18, 'Элегантная туника свободного силуэта из трикотажного полотна. Круглый вырез изделия обработан внутренней обтачкой. Перед изделия укращен декоративными апликациями. В боковых швах туники — карманы. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия —82- 87 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М4-3066', NULL, 2850, NULL, 1300, '2017-09-27 15:42:43', '2017-09-27 15:42:43', NULL, 0, 1, '', '', '', '', '', ''),
(870, 0, 10, 0, 'stilnaya_bluzka_s_vorotnikom_homut', 'Стильная блузка с воротником хомут', NULL, 19, 'Незаменимая блуза полуприлегающего силуэта. Блузка с воротником хомут и втачными рукавами из шифонового полотна. Перед и спинка изделия выполнены из однотонного трикотажного полотна. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 64 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3170', NULL, 2350, NULL, 1050, '2017-09-27 16:01:35', '2017-09-27 16:01:35', NULL, 0, 1, '', '', '', '', '', ''),
(871, 0, 10, 0, 'elegantnyj_zhaket_poluprilegayushego_silueta', 'Элегантный жакет полуприлегающего силуэта', NULL, 18, 'Элегантный жакет полуприлегающего силуэта, выполненный из потрясающего текстильного полотна-жаккард с рельефным рисунком и металлизированным блеском-акцентом. Фигурный отложной воротник также выполнен из рельефного жаккарда . По переду — застежка на пуговицы. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 60-63 см.', 'ВА-М4-3510', NULL, 3450, NULL, 1600, '2017-09-27 16:32:38', '2017-09-27 16:32:38', NULL, 0, 1, '', '', '', '', '', ''),
(872, 0, 10, 0, 'stilnaya_tunika_svobodnogo_silueta_iz_trikotazha', 'Стильная туника свободного силуэта из трикотажа', NULL, 18, 'Стильная туника свободного силуэта из трикотажного полотна - шерстяной жаккард, имитирующего ручную вязку. V-образный вырез изделия, низ рукавов и накладные карманы выполнены из чёрной перфорированной кожи. Рукава-втачные. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —70-73 см\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-3513', NULL, 3250, NULL, 1500, '2017-09-27 16:42:03', '2017-09-27 16:42:03', NULL, 0, 1, '', '', '', '', '', ''),
(873, 0, 10, 0, 'effektnaya_bluzka_chernogo_cveta', 'Эффектная блузка черного цвета', NULL, 18, 'Эффектная блузка полуприлегающего силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан внутренней обтачкой. Блузка со спущенной проймой и втачными рукавами. Перед изделия украшен декоративной аппликацией со стразами.Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 61-69 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-2915', NULL, 2150, NULL, 950, '2017-09-27 16:49:15', '2017-09-27 16:49:15', NULL, 0, 1, '', '', '', '', '', ''),
(874, 0, 10, 0, 'zhenstvennaya_bluzka_pryamogo_silueta', 'Женственная блузка прямого силуэта', NULL, 20, 'Женственная блузка прямого силуэта из вязаного трикотажного полотна. Круглый вырез, втачные рукава и перед изделия дополнены контрастными окантовками. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 67 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-2110', NULL, 2090, NULL, 920, '2017-09-27 17:00:24', '2017-09-27 17:00:24', NULL, 0, 1, '', '', '', '', '', ''),
(875, 0, 10, 0, 'stilnaya_tunika_sine_bezhevogo_cveta', 'Стильная туника сине-бежевого цвета', NULL, 20, 'Стильная туника полуприлегающего силуэта из плотного трикотажного полотна сине-бежевого цвета с купонным рисунком. Круглый вырез изделия обработан внутренней обтачкой и украшен металлизированным рисунком. Туника с втачными рукавами. Перед изделия дополнен втачным поясом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 74 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-2940', NULL, 2550, NULL, 1150, '2017-09-27 17:04:29', '2017-09-27 17:04:29', NULL, 0, 1, '', '', '', '', '', ''),
(877, 0, 10, 0, 'stilnaya_tunika_s_dekorativnoj_applikaciej_', 'Стильная туника с декоративной аппликацией', NULL, 18, 'Стильная туника свободного силуэта из трикотажного полотна черно-белого цвета. V-образный вырез обработан внутренней обтачкой. Туника со спущенной проймой и втачными рукавами. По боковым швам изделия карманы. Перед туники украшен декоративной аппликацией — пингвин. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 75-82 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М5-2930', NULL, 3090, NULL, 1420, '2017-09-27 17:12:53', '2017-09-27 17:12:53', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(878, 0, 10, 0, 'stilnaya_bluzka_bezhevogo_cveta', 'Стильная блузка бежевого цвета', NULL, 19, 'Стильная блузка свободного силуэта из трикотажного полотна бежевого цвета. Круглый вырез изделия обработан окантовкой.  Перед изделия выполнен из текстильного атласного полотна с рисунком «клетка» и дополнен декоративными элементами в форме бантиков. Рукава реглан обработаны окантовкой.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 68 см\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-2848', NULL, 2150, NULL, 950, '2017-09-27 17:19:44', '2017-09-27 17:19:44', NULL, 0, 1, '', '', '', '', '', ''),
(879, 0, 10, 0, '_zhaket_pryamogo_silueta_iz_ekokozhi', 'Жакет прямого силуэта из экокожи', NULL, 18, 'Стильный жакет прямого силуэта из трикотажного полотна , имитирующего кожу. Круглый вырез, низ изделия и них рукавов обработаны двойной английской резинкой. Застежка по переду на молнию. Спинка изделия украшена декоративной аппликацией. В боковых швах — карманы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 62-67 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М5-3424', NULL, 4550, NULL, 2150, '2017-09-27 17:30:06', '2017-09-27 17:30:06', NULL, 0, 1, '', '', '', '', '', ''),
(880, 0, 10, 0, 'modnyj_zhaket_pryamogo_silueta', 'Модный жакет прямого силуэта', NULL, 7, 'Модный жакет прямого силуэта из трикотажного полотна с рельефной фактурой цвета какао. Рукава-реглан и низ изделия обработаны манжетами. Воротник-стойка переходит в планку, застежка по переду на втачную молнию. По линии переда карманы на молниях. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 73 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3534', NULL, 3650, NULL, 1700, '2017-09-27 17:41:45', '2017-11-11 16:56:33', NULL, 0, 1, '', '', '', '', '', ''),
(881, 0, 10, 0, 'stilnyj_zhaket_chernogo_cveta_', 'Стильный жакет  черного цвета.', NULL, 19, 'Стильный жакет прямого силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан внутренней обтачкой. Перед изделия украшен металлизированным рисунком. По низу декоративная резинка со стразами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке  от плечевого шва до низа изделия — 64 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М5-2831', NULL, 3450, NULL, 1600, '2017-09-27 17:49:20', '2017-09-27 17:49:20', NULL, 0, 1, '', '', '', '', '', ''),
(882, 0, 10, 0, 'obvorozhitelnyj_kardigan_svobodnogo_silueta', 'Обворожительный кардиган свободного силуэта', NULL, 18, 'Обворожительный кардиган свободного силуэта . Кардиган выполнен в технике «ручного вязания» с добавлением натуральной нити шерсти. Фигурный вырез, перед изделия и втачные рукава обработаны окантовками. По переду изделия две сутажные застежки и накладные карманы из полотна, имитирующего кожу.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —70-73 см.', 'ВА-М5-3461', NULL, 3650, NULL, 1700, '2017-09-27 17:57:42', '2017-09-27 17:57:42', NULL, 0, 1, '', '', '', '', '', ''),
(883, 0, 10, 0, 'roskoshnoe_palto_svobodnogo_silueta', 'Роскошное пальто свободного силуэта', NULL, 18, 'Роскошное пальто свободного силуэта из трикотажного полотна  с рельефной фактурой. Круглый вырез изделия обработан внутренней обтачкой. Пальто с цельнокроеными рукавами и с карманами. Перед изделия и карманы украшены металлическими элементами. Пальто с застежкой на кнопки по переду. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —95-97см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3354', NULL, 4450, NULL, 2100, '2017-09-27 18:15:22', '2017-09-27 18:27:48', NULL, 0, 1, '', '', '', '', '', ''),
(884, 0, 10, 0, 'palto_chernogo_cveta_s_relefnoj_fakturoj', 'Пальто черного цвета с рельефной фактурой', NULL, 18, 'Стильное легкое пальто свободного силуэта из трикотажного полотна черного цвета с рельефной фактурой. Круглый вырез изделия обработан внутренней обтачкой. Пальто с цельнокроеными рукавами и внутренними карманами. Перед изделия украшен декоративным элементом. По планке переда застежка на пуговицы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 95-97 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3354/14-15', NULL, 3650, NULL, 1700, '2017-09-27 18:22:26', '2017-11-23 15:38:44', NULL, 0, 1, '', '', '', '', '', ''),
(885, 0, 10, 0, 'ocharovatelnaya_tunika_svobodnogo_silueta', 'Очаровательная туника свободного силуэта', NULL, 18, 'Очаровательная туника свободного силуэта из текстильного полотна . Круглый вырез изделия обработан внутренней обтачкой. Перед изделия двойной, кружево на текстильной основе. Низ изделия и втачные рукава дополнены вставками из легкого шифонового полотна.Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 65-70 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М3-3474', NULL, 3250, NULL, 1500, '2017-09-27 18:30:43', '2017-09-27 18:30:43', NULL, 0, 1, '', '', '', '', '', ''),
(886, 0, 10, 0, 'tunika_pryamogo_silueta_iz_tekstilya_v_kletku_', 'Туника прямого силуэта из текстиля в клетку', NULL, 18, 'Милая туника прямого силуэта из текстильного полотна в клетку . По переду изделие отрезное по линии талии и украшено кружевной тесьмой черного цвета. Круглый вырез туники обработан широким контрастным кантом и дополнен планкой с застежкой на пуговицы. Втачной рукав со спущенной линией проймы понизу обработан манжетом контрастного черного цвета с застежкой на пуговицу. По боковым швам блуза дополнена разрезами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 78-83 см.\r\nСостав: Хлопок 100%', 'ВА-М4-3593', NULL, 3250, NULL, 1500, '2017-09-27 18:39:00', '2017-09-27 18:39:00', NULL, 0, 1, '', '', '', '', '', ''),
(887, 0, 10, 0, 'zhenskaya_majka_klassicheskogo_kroya', 'Женская майка классического кроя', NULL, 18, 'Женская майка классического кроя. Майка на широких бретелях с круглым вырезом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 61-65 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М1-2532', NULL, 1010, NULL, 380, '2017-09-27 18:47:05', '2017-09-27 18:47:05', NULL, 0, 1, '', '', '', '', '', ''),
(888, 0, 8, 0, 'molodezhnoe_plate_cvetochnoj_rascvtki', 'Молодежное платье цветочной расцвтки', NULL, 10, 'Стильное платье средней длины из текстиля. Платье с длинным рукавом. Платье украшено модным цветочным принтом. Идеально подойдет для офиса и похода с подружками в кафе после тяжелого рабочего дня. Будь стильной вместе с нами! ', 'СПЛ-9', NULL, 3450, NULL, 1600, '2017-09-28 10:50:27', '2017-09-28 13:07:44', NULL, 0, 1, '', '', '', '', '', ''),
(889, 0, 8, 0, 'yubochnyj_kostyum_s_yubkoj_iz_ekokozhi', 'Юбочный костюм с юбкой из экокожи', NULL, 10, 'Стильный юбочный костюм для настоящих модниц. Жакет с рукавом 3/4 дополнен модной баской. Идеальным дополнением служит узкая юбка из экокожи. Комплект можно носить раздельно. ', 'СЮК-5', NULL, 3850, NULL, 1800, '2017-09-28 10:57:30', '2017-09-28 13:17:55', NULL, 0, 1, '', '', '', '', '', ''),
(890, 0, 8, 0, 'stilnyj_trikotazhnyj_zhenskij_kostyum', 'Стильный трикотажный женский костюм', NULL, 10, 'Костюм из трикотажного полотна с жакетом на завязках. Брюки прямого кроя с контрастными подворотами. Брюки с карманами, удобные в носке. Отличное дополнение любого гардероба.', 'СБК-9', NULL, 3850, NULL, 1800, '2017-09-28 11:07:19', '2017-09-28 13:29:32', NULL, 0, 1, '', '', '', '', '', ''),
(891, 0, 8, 0, 'modnaya_zhenskaya_tolstovka_s_kapyushonom', 'Модная женская толстовка с капюшоном', NULL, 10, 'Стильная толстовка с капюшоном. Яркие принты делают толстовку стильным дополнением любого гардероба.', 'СТО-1', NULL, 2650, NULL, 1200, '2017-09-28 11:20:24', '2017-09-28 13:34:11', NULL, 0, 1, '', '', '', '', '', ''),
(892, 0, 8, 0, 'yubochnyj_kostyum_s_printom_iz_busin', 'Юбочный костюм с принтом из бусин', NULL, 10, 'Юбочный трикотажный костюм для любого случая. Джемпер украшен принтом из бусин. По низу джемпера и юбки резинка, довязанная бахромой. Юбка средней длины на эластичном поясе. Все части костюма можно носить отдельно.', 'СЮК-6', NULL, 3450, NULL, 1600, '2017-09-28 11:32:37', '2017-09-28 13:38:36', NULL, 0, 1, '', '', '', '', '', ''),
(894, 0, 8, 0, '_zhenstvennoe_molodezhnoe_plate_s_rukavami_3_4_', 'Женственное молодежное платье с рукавами 3/4', NULL, 10, 'Яркое платье из плотного неопрена с расклешенной юбкой. Глубокий круглый вырез дополнен молнией. Обтягивающий рукав 3/4. Отличный наряд, чтобы подчеркнуть фигуру.', 'СПЛ-13', NULL, 3450, NULL, 1600, '2017-09-28 11:42:04', '2017-09-28 13:44:56', NULL, 0, 1, '', '', '', '', '', ''),
(895, 0, 8, 0, 'stilnyj_kostyum_s_elementami_velyura', 'Стильный костюм с элементами велюра', NULL, 10, 'Спортивный костюм с вставками из велюра. Брюки прямого покроя с эластичным поясом на кулиске. Брюки дополнены карманами. Джемпер прямого кроя с плотными резинками по манжетам и низу изделия.', 'ССК-13', NULL, 3450, NULL, 1600, '2017-09-28 11:48:17', '2017-09-28 13:54:33', NULL, 0, 1, '', '', '', '', '', ''),
(896, 0, 8, 0, 'elegantnoe_plate_iz_tekstilya_s_kruzhevom', 'Элегантное платье из текстиля с кружевом', NULL, 10, 'Платье средней длины. Верх изделия выполнен из плотного трикотажа. Ворот дополнен небольшой стойкой. Низ изделия дополнен пришитой кружевной юбкой прямого покроя. Необычный наряд для стильных!', 'СПЛ-11', NULL, 2650, NULL, 1200, '2017-09-28 11:55:42', '2017-09-28 13:57:02', NULL, 0, 1, '', '', '', '', '', ''),
(897, 0, 8, 0, 'elegantnoe_bandazhnoe_plate_midi', 'Элегантное бандажное платье миди', NULL, 10, 'Стильное и эффектное платье для уверенных в себе девушек! Платье, на молнии средней длины с эффектным разрезом по переду. Ярким элементом являются металлические заклепки, рассыпанные по всему платью. Воротник-стойка. ', 'СПЛ-12', NULL, 3650, NULL, 1700, '2017-09-28 12:02:12', '2017-09-28 14:03:57', NULL, 0, 1, '', '', '', '', '', ''),
(898, 0, 10, 0, 'azhurnyj_poyas_kushak_belogo_cveta', 'Ажурный пояс-кушак белого цвета', NULL, 9, 'Ажурный пояс-кушак с завязками. Материал - искусственная кожа и кружево . Цвет белый.\r\nРазмер: ширина: 10 см. Длина 80 см + завязки длиной по 75 см.', 'ВА-Р-21/65', NULL, 770, NULL, 260, '2017-09-28 12:25:34', '2017-09-28 12:25:34', NULL, 0, 1, '', '', '', '', '', ''),
(899, 0, 10, 0, 'azhurnyj_poyas_kushak_sinego_cveta', 'Ажурный пояс-кушак синего цвета', NULL, 9, 'Ажурный пояс-кушак с завязками. Материал - искусственная кожа и кружево . Цвет синий.\r\nРазмер: ширина: 10 см. Длина 80 см + завязки длиной по 75 см.', 'ВА-Р-21/61', NULL, 770, NULL, 260, '2017-09-28 12:38:18', '2017-10-23 11:52:17', NULL, 0, 0, '', '', '', '', '', ''),
(900, 0, 10, 0, 'azhurnyj_poyas_kushak_chernogo_cveta', 'Ажурный пояс-кушак черного цвета', NULL, 9, 'Ажурный пояс-кушак с завязками. Материал - искусственная кожа и кружево . Цвет черный.\r\nРазмер: ширина: 10 см. Длина 80 см + завязки длиной по 75 см.', 'ВА-Р-21/72', NULL, 770, NULL, 260, '2017-09-28 12:43:20', '2017-10-23 11:56:47', NULL, 0, 0, '', '', '', '', '', ''),
(901, 0, 10, 0, 'remen_s_matovoj_poverhnostyu_krasnogo_cveta', 'Ремень с матовой поверхностью красного цвета', NULL, 9, 'Ремень с матовой поверхностью и тиснением под натуральную кожу. Металлическая пряжка матового серебрянного цвета украшена кожанной кисточкой. Цвет - красный.  \r\nРазмер: ширина 2,3 см. длина ремня 102 см.\r\nПряжка: серебристая.', 'ВА-Р-72/1', NULL, 730, NULL, 240, '2017-09-28 12:58:32', '2017-09-28 13:06:00', NULL, 0, 1, '', '', '', '', '', ''),
(902, 0, 10, 0, 'krasnyj_remen_s_matovoj_poverhnostyu', 'Красный ремень с матовой поверхностью', NULL, 9, 'Ремень с матовой поверхностью и тиснением под натуральную кожу. Отделочная строчка. Пряжка выполнена из металла золотого цвета и пластика в тон ремня. Цвет - красный.  \r\nРазмер: ширина 1,8 см. длина ремня 104 см.\r\nПряжка: золотистая.', 'ВА-Р-72/4', NULL, 670, NULL, 210, '2017-09-28 13:10:19', '2017-09-28 13:10:19', NULL, 0, 1, '', '', '', '', '', ''),
(903, 0, 10, 0, 'remen_iz_plastikovoj_cepochki_zolotogo_cveta', 'Ремень из пластиковой цепочки золотого цвета', NULL, 9, 'Ремень из пластиковой цепочки золотого цвета с завязочками из шифонового полотна. Цвет: золотой, черный.\r\nРазмер: Ширина: 3,5 см. Общая длина: 140 см. (42 см. + 49 см. + 49 см.)', 'ВА-Р-2/97', NULL, 850, NULL, 300, '2017-09-28 14:06:08', '2017-09-28 14:06:08', NULL, 0, 1, '', '', '', '', '', ''),
(904, 0, 10, 0, 'remen_rezinka_chernogo_cveta', 'Ремень-резинка черного цвета', NULL, 9, 'Ремень-резина с металлической пряжкой в виде веточки золотого цвета, декорированной искусственной кожей. Цвет: черный\r\nРазмер: Ширина: 3,5 см.\r\nПряжка: золотистая.', 'ВА-Р-21/54', NULL, 650, NULL, 200, '2017-09-28 14:16:13', '2017-09-28 14:16:13', NULL, 0, 1, '', '', '', '', '', ''),
(905, 0, 10, 0, 'remen_rezinka_sinego_cveta', 'Ремень-резинка синего цвета', NULL, 9, 'Ремень-резина с металлической пряжкой в виде веточки золотого цвета, декорированной искусственной кожей. Цвет: синий\r\nРазмер: Ширина: 3,5 см.\r\nПряжка: золотистая.', 'ВА-Р-21/52', NULL, 650, NULL, 200, '2017-09-28 14:26:37', '2017-10-23 11:57:53', NULL, 0, 0, '', '', '', '', '', ''),
(906, 0, 10, 0, 'remen_rezinka_s_pryazhkoj_zolotogo_cveta', 'Ремень - резинка с пряжкой золотого цвета', NULL, 9, 'Прекрасный ремень - резина с металлической пряжкой золотого цвета, декорированной искусственной кожей. Цвет: черный\r\nРазмер: Ширина: 3 см.\r\nПряжка: золотистая.', 'ВА-Р-21/44', NULL, 770, NULL, 260, '2017-09-28 14:35:08', '2017-09-28 14:35:08', NULL, 0, 1, '', '', '', '', '', ''),
(907, 0, 10, 0, 'remen_rezina_s_metallicheskoj_pryazhkoj_krasnogo_cveta', 'Ремень-резина с металлической пряжкой красного цвета', NULL, 9, 'Ремень-резина с металлической пряжкой золотого цвета, декорированной стразами и искусственной кожей, Ширина: 2,5 см.\r\nСостав: Иск.кожа, текстиль,металл.', 'ВА-Р-21/57', NULL, 650, NULL, 200, '2017-09-28 14:35:25', '2017-09-28 14:41:52', NULL, 0, 1, '', '', '', '', '', ''),
(908, 0, 10, 0, 'remen_rezinka_s_metallicheskoj_pryazhkoj_chernogo_cveta', 'Ремень-резинка с металлической пряжкой черного цвета', NULL, 9, 'Ремень-резинка с металлической пряжкой, декорированной искусственной кожей. Ширина: 1,5 см.\r\nСостав: Иск.кожа, текстиль,металл.', 'ВА-Р-21/28', NULL, 650, NULL, 200, '2017-09-28 14:39:51', '2017-09-28 14:39:51', NULL, 0, 1, '', '', '', '', '', ''),
