(1026, 0, 10, 0, 'korichnevyj_remen_s_azhurnym_risunkom', 'Коричневый ремень с ажурным рисунком', NULL, 9, 'Ремень узкий с матовой  поверхностью и ажурным рисунком. Металлическая  пряжка цвета темного серебра.\r\nЦвет - рыжий. Материал - искусственная кожа. \r\nШирина 1 см. Длина ремня 102 - 104 см.', 'ВА-Р-71/98', NULL, 610, NULL, 180, '2017-09-29 12:52:55', '2017-09-29 12:52:55', NULL, 0, 1, '', '', '', '', '', ''),
(1027, 0, 10, 0, 'zhenstvennyj_palantin_s_dvuhcvetnym_kruzhevom', 'Женственный палантин с двухцветным кружевом', NULL, 9, 'Потрясающий женственный палантин станет универсальным дополнением к наряду в любой обстановке. Благородный цвет кофе с молоком дополнен двухцветным кружевом бежевого и кремового оттенков. Материал - мягкое плотное трикотажное полотно.\r\nДлина 168 см. Ширина 61 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П-97/81', NULL, 1350, NULL, 550, '2017-09-29 12:54:28', '2017-09-29 12:54:28', NULL, 0, 1, '', '', '', '', '', ''),
(1028, 0, 10, 0, 'remen_myatnogo_cveta_s_pryazhkoj_so_strazami', 'Ремень мятного цвета с пряжкой со стразами', NULL, 9, 'Ремень с металлической пряжкой , украшенной стразами. Цвет ментол.\r\nШирина 1.4 см.  Длина 102-104 см.\r\nСостав: Иск. кожа, металл, стразы', 'ВА-Р-71/71', NULL, 610, NULL, 180, '2017-09-29 12:55:19', '2017-09-29 12:55:19', NULL, 0, 1, '', '', '', '', '', ''),
(1029, 0, 10, 0, 'zelenyj_remen_s_azhurnym_risunkom', 'Зеленый ремень с ажурным рисунком', NULL, 9, 'Ремень узкий с матовой  поверхностью и ажурным рисунком. Металлическая  пряжка серебрянного цвета.\r\nЦвет - зеленый. Материал - искусственная кожа. \r\nШирина 1 см. Длина ремня 102 - 104 см.', 'ВА-Р-71/88', NULL, 570, NULL, 160, '2017-09-29 12:55:32', '2017-09-29 12:55:32', NULL, 0, 1, '', '', '', '', '', ''),
(1030, 0, 10, 0, 'zelenyj_remen_s_metallicheskoj_pryazhkoj_zolotogo_cveta', 'Зеленый ремень с металлической пряжкой золотого цвета', NULL, 9, 'Зеленый ремень с металлической пряжкой золотого цвета. Материал - искусственная кожа. Ширина: 1,3 см. Длина: 77+22 см.\r\n\r\n1\r\n', 'ВА-Р-71/30', NULL, 570, NULL, 160, '2017-09-29 12:57:40', '2017-09-29 12:57:40', NULL, 0, 1, '', '', '', '', '', ''),
(1031, 0, 10, 0, 'uzkij_remen_persikovogo_cveta_', 'Узкий ремень персикового цвета', NULL, 9, 'Ремень с пряжкой золотого цвета. Ширина: 2 см. Максимальная длина: 102 см.\r\nСостав: Ремень с пряжкой золотого цвета. Ширина: 2 см. Максимальная длина: 102 см.', 'ВА-Р-7/79', NULL, 650, NULL, 200, '2017-09-29 13:01:10', '2017-09-29 13:01:10', NULL, 0, 1, '', '', '', '', '', ''),
(1032, 0, 10, 0, 'uyutnyj_sinij_trikotazhnyj_palantin_s_kruzhevom', 'Уютный синий трикотажный палантин с кружевом', NULL, 9, 'Уютный и красивый палантин выполнен из мягкого плотного трикотажного полотна спокойного синего цвета. Отделка - широкое кружево.\r\nДлина 160 см. Ширина 61 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П-97/80', NULL, 1350, NULL, 550, '2017-09-29 13:05:20', '2017-09-29 13:05:20', NULL, 0, 1, '', '', '', '', '', ''),
(1033, 0, 10, 0, 'lakovyj_chernyj_remeshok_s_metallicheskoj_pryazhkoj', 'Лаковый черный ремешок с металлической пряжкой', NULL, 9, 'Лаковый черный ремень с металлической пряжкой. Материал - искусственная кожа. Ширина: 1,3 см. Длина: 105+26 см.\r\nСостав: 	Иск.кожа, металл', 'ВА-Р-71/54', NULL, 610, NULL, 180, '2017-09-29 13:08:12', '2017-10-02 19:10:28', NULL, 0, 1, '', '', '', '', '', ''),
(1034, 0, 10, 0, 'stilnyj_chernyj_palantin_s_dekorativnoj_tesmoj_i_kruzhevom', 'Стильный черный палантин с декоративной тесьмой и кружевом', NULL, 9, 'Стильный палантин черного цвета выполнен из трикотажного полотна, украшен декоративной тесьмой и дополнен ажурным кружевом. Дополните ваш идеальный образ!\r\nРазмер: 60*150 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-Пл-9/33', NULL, 1350, NULL, 550, '2017-09-29 13:11:41', '2017-09-29 13:11:41', NULL, 0, 1, '', '', '', '', '', ''),
(1035, 0, 10, 0, 'lakovyj_uzkij_remen_chernogo_cveta', 'Лаковый узкий ремень черного цвета', NULL, 9, 'Лаковый узкий ремень с металлической пряжкой золотого цвета.  Цвет - черный. Материал - искусственная кожа. \r\nШирина 1 см. Длина ремня 110-112 см.\r\nСостав: Иск.кожа, металл\r\n', 'ВА-Р-71/79', NULL, 530, NULL, 140, '2017-09-29 13:12:24', '2017-09-29 13:12:24', NULL, 0, 1, '', '', '', '', '', ''),
(1036, 0, 10, 0, 'snud_bordovo_serogo_cveta', 'Снуд бордово-серого цвета', NULL, 9, 'Роскошный «снуд» (съемный воротник-капюшон) бордового цвета.  Снуд выполнен в технике ручного вязания из нитей с содержанием шерсти. \r\nСостав: 	Шерсть 80%, Акрил 20%.', 'ВА-Сн-1/4', NULL, 1050, NULL, 400, '2017-09-29 13:14:35', '2017-09-29 13:14:35', NULL, 0, 1, '', '', '', '', '', ''),
(1037, 0, 10, 0, 'lakovyj_uzkij_remen_sinego_cveta', 'Лаковый узкий ремень синего цвета', NULL, 9, 'Ремень узкий лаковый с металлической пряжкой золотого цвета\r\nЦвет - синий. Материал - искусственная кожа. \r\nШирина 1 см. Длина ремня 104-108 см.\r\nСостав: Иск.кожа, металл', 'ВА-Р-71/95', NULL, 570, NULL, 160, '2017-09-29 13:16:24', '2017-09-29 13:16:24', NULL, 0, 1, '', '', '', '', '', ''),
(1038, 0, 10, 0, 'stilnyj_chernyj_palantin_s_kruzhevom_i_pajetkami', 'Стильный черный палантин с кружевом и пайетками', NULL, 9, 'Стильный палантин черного цвета выполнен из трикотажного полотна, украшен декоративной тесьмой и дополнен ажурным кружевом. Дополните ваш идеальный образ!\r\nРазмер: 60*150 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-Пл-9/35', NULL, 1350, NULL, 550, '2017-09-29 13:18:59', '2017-09-29 13:20:56', NULL, 0, 1, '', '', '', '', '', ''),
(1039, 0, 10, 0, 'lakovyj_uzkij_remen_salatovogo_cveta', 'Лаковый узкий ремень салатового цвета', NULL, 9, 'Ремень узкий лаковый с металлической пряжкой золотого цвета\r\nЦвет - зеленый неон. Материал - искусственная кожа. \r\nШирина 1 см. Длина ремня 108-110 см.\r\nСостав: Иск.кожа, металл', 'ВА-Р-71/93', NULL, 570, NULL, 160, '2017-09-29 13:20:31', '2017-09-29 13:20:31', NULL, 0, 1, '', '', '', '', '', ''),
(1040, 0, 10, 0, 'lakovyj_uzkij_remen_rozovogo_cveta', 'Лаковый узкий ремень розового цвета', NULL, 9, 'Ремень лаковый с металлической пряжкой. Минимальная длина: 78 см., максимальная 90 см.\r\nСостав: Иск.кожа, текстиль,металл', 'ВА-Р-7/56-2', NULL, 550, NULL, 150, '2017-09-29 13:24:32', '2017-09-29 13:24:32', NULL, 0, 1, '', '', '', '', '', ''),
(1041, 0, 10, 0, 'uzkij_sinij_matovyj_remen', 'Узкий синий матовый ремень', NULL, 9, 'Ремень узкий с матовой рельефной поверхностью. Металлическая  пряжка серебрянного цвета. \r\nЦвет - темно-синий. Материал - искусственная кожа. \r\nШирина 1 см. Длина ремня 102-104 см.\r\nСостав: Иск.кожа, металл', 'ВА-Р-71/83', NULL, 570, NULL, 160, '2017-09-29 13:29:29', '2017-09-29 13:29:29', NULL, 0, 1, '', '', '', '', '', ''),
(1042, 0, 10, 0, 'uzkij_remen_sinego_cveta', 'Узкий ремень синего цвета', NULL, 9, 'Ремень узкий с матовой  поверхностью. Металлическая  пряжка золотого цвета.\r\nЦвет - синий. Материал - искусственная кожа. \r\nШирина 1 см. Длина ремня 102 - 104 см.\r\nСостав: Иск.кожа, металл', 'ВА-Р-71/89', NULL, 570, NULL, 160, '2017-09-29 13:34:21', '2017-09-29 13:34:21', NULL, 0, 0, '', '', '', '', '', ''),
(1043, 0, 10, 0, 'stilnyj_sero_chernyj_palantin_s_kruzhevom', 'Стильный серо-черный палантин с кружевом', NULL, 9, 'Стильный палантин серо-черного цвета выполнен из трикотажного полотна, украшен декоративной тесьмой и дополнен ажурным кружевом.Дополните ваш идеальный образ!\r\nРазмер: 60*150 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-Пл-9/34', NULL, 1350, NULL, 550, '2017-09-29 13:37:26', '2017-09-29 13:37:26', NULL, 0, 1, '', '', '', '', '', ''),
(1044, 0, 10, 0, 'stilnaya_sumka_izumrudnogo_cveta', 'Стильная сумка изумрудного цвета', NULL, 9, 'Стильная сумка - клатч на ремешке средней длины. Дополнительно длинный ремешок. Материал верха - искусственная кожа. Отделка - лазерное теснение. Материал подкладки - полиэстр. 3 отделения, среднее отделение на молнии. Внутри 5 карманчиков для мелочей и карточек. Два внешних кармана. Две магнитные застежки.\r\nРамер 25 см х 15 см.\r\nСостав: Иск.кожа', 'ВА-СМ-1/1-5', NULL, 3450, NULL, 1600, '2017-09-29 13:39:59', '2017-09-29 13:49:44', NULL, 0, 1, '', '', '', '', '', ''),
(1045, 0, 10, 0, 'blagorodnyj_palantin_s_francuzskim_kruzhevom', 'Благородный палантин с французским кружевом', NULL, 9, 'Благородный палантин выполнен из трикотажного полотна и украшен французским кружевом. \r\nИдеально дополнит любой ваш наряд!\r\nСостав: 	Полиэстер 95%, Эластан 5%.', 'ВА-Пл-9/22', NULL, 1250, NULL, 500, '2017-09-29 13:49:26', '2017-09-29 13:49:26', NULL, 0, 1, '', '', '', '', '', ''),
(1046, 0, 10, 0, 'chernyj_palantin_s_kruzhevom_i_tesmoj', 'Черный палантин с кружевом и тесьмой', NULL, 9, 'Стильный палантин черного цвета выполнен из трикотажного полотна, украшен декоративной тесьмой и дополнен ажурным кружевом. Дополните ваш идеальный образ!\r\nРазмер: 60*150 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-Пл-9/32', NULL, 1350, NULL, 550, '2017-09-29 13:54:41', '2017-09-29 13:54:41', NULL, 0, 1, '', '', '', '', '', ''),
(1047, 0, 10, 0, 'snud_bezhevo_krasnogo_cveta', 'Снуд бежево-красного цвета', NULL, 9, 'Роскошный «снуд» (съемный воротник-капюшон) бежево-красного цвета.  Снуд выполнен в технике ручного вязания из нитей с содержанием шерсти. \r\nСостав: Шерсть 80%, Акрил 20%', 'ВА-СН-1/1', NULL, 1050, NULL, 400, '2017-09-29 14:12:05', '2017-09-29 14:12:05', NULL, 0, 1, '', '', '', '', '', ''),
(1048, 0, 10, 0, 'platok_so_strazami_i_seribristo_sinim_kruzhevom', 'Платок со стразами и серибристо-синим кружевом', NULL, 9, 'Платок, выполненным из трикотажного полотна белого цвета. Один угол украшен россыпью цветных страз и ажурным кружевом серебристого и синего цвета. Аксессуары в комплект не входят.\r\nРазмер: 80 см х 80 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%.', 'ВА-П-96/39', NULL, 1290, NULL, 520, '2017-09-29 14:17:25', '2017-09-29 14:30:27', NULL, 0, 1, '', '', '', '', '', ''),
(1049, 0, 10, 0, 'snud_bordovo_sinego_cveta', 'Снуд бордово-синего цвета', NULL, 9, 'Роскошный «снуд» (съемный воротник-капюшон) бордово-синего цвета. Снуд выполнен в технике ручного вязания из нитей с содержанием шерсти. \r\nСостав: Шерсть 80%, Акрил 20%', 'ВА-Сн-1/2', NULL, 1050, NULL, 400, '2017-09-29 14:19:10', '2017-09-29 15:20:27', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1050, 0, 10, 0, 'platok_so_strazami_i_biryuzovo_sinim_kruzhevom', 'Платок со стразами и   бирюзово-синим кружевом', NULL, 9, 'Белоснежный платок выполнен из трикотажного полотна. Один угол украшен россыпью цветных страз и ажурным кружевом бирюзового и синего цвета. Дополните свой образ оригинальным шарфом!\r\nАксессуары в комплект не входят.\r\nРазмер: 80 см х 80 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-П-96/40', NULL, 1290, NULL, 520, '2017-09-29 14:26:03', '2017-09-29 14:26:03', NULL, 0, 1, '', '', '', '', '', ''),
(1051, 0, 10, 0, 'komfortnyj_i_teplyj_dvustoronnij_palantin', 'Комфортный и теплый двусторонний палантин', NULL, 9, 'Комфортный и теплый двусторонний палантин выполнен из трикотажного полотна меланжевого серого и светлого молочного цветов. Отлично дополнит образ с пуховиком, классическим пальто или спортивной курткой. Асессуары в комплект не входят.\r\nДлина 70 см, ширина 60 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%\r\n', 'ВА-Сн-2/48', NULL, 1290, NULL, 520, '2017-09-29 14:26:51', '2017-09-29 14:26:51', NULL, 0, 1, '', '', '', '', '', ''),
(1052, 0, 10, 0, 'snud_sine_bezhevogo_cveta', 'Снуд сине-бежевого цвета', NULL, 9, 'Дорогое кружево белого цвета в сочетании с ярким синим трикотажем выглядит очаровательно. \r\nСнуд отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Асессуары в комплект не входят.\r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nСостав: Вискоза 52%, Полиэстер 45%, Эластан 3%', 'ВА-Сн-2/43', NULL, 1530, NULL, 640, '2017-09-29 14:34:37', '2017-09-29 14:34:37', NULL, 0, 1, '', '', '', '', '', ''),
(1053, 0, 10, 0, 'utonchennyj_platok_serogo_s_applikaciej', 'Утонченный платок серого с аппликацией', NULL, 9, 'Дополните свой образ оригинальным шарфом! Утонченный платок из трикотажного полотна серого цвета, украшен аппликацией.\r\nРазмер: 72*72 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%.', 'ВА-П-96/49', NULL, 1290, NULL, 520, '2017-09-29 14:36:04', '2017-09-29 14:36:04', NULL, 0, 1, '', '', '', '', '', ''),
(1054, 0, 10, 0, 'dvustoronnij_snud_cherno_belogo_cveta', 'Двусторонний снуд черно-белого цвета', NULL, 9, 'Дорогое кружево белого цвета с черным рисунком выглядит благородно и женственно.  Двусторонний снуд подбит тонким трикотажным полотном серого цвета. Изделие отлично дополнит Ваш образ с классическим пальто, пуховиком или шубкой. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. Асессуары в комплект не входят.\r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nСостав: Вискоза 50%, Полиэстер 50%', 'ВА-Сн-2/49', NULL, 1530, NULL, 640, '2017-09-29 14:39:31', '2017-09-29 14:42:45', NULL, 0, 1, '', '', '', '', '', ''),
(1060, 0, 10, 0, 'utonchennyj_fioletovyj_platok_so_strazami', 'Утонченный фиолетовый платок со стразами', NULL, 9, 'Утонченный весенний платок фиолетового цвета, выполнен из трикотажного полотна, украшен рисунком из страз.\r\nРазмер: 70*70 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%.', 'ВА-П-96/48', NULL, 950, NULL, 350, '2017-09-29 15:48:08', '2017-09-29 15:48:08', NULL, 0, 1, '', '', '', '', '', ''),
(1061, 0, 10, 0, 'sinij_platok_s_fakturnym_kruzhevom_i_strazami', 'Синий платок с фактурным кружевом и стразами', NULL, 9, 'Платок из мягкого и плотного трикотажного полотна темного синего цвета в сочетании с широким фактурным кружевом. Отделка - рисунок из страз.\r\nВ комплекте, с платьем, пальто или кожанной курткой этот аксессуар сделает Ваш образ роскошным. \r\nЗакрепить платок можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 80 см х 80 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-97/66', NULL, 1290, NULL, 520, '2017-09-29 15:57:09', '2017-09-29 15:57:09', NULL, 0, 1, '', '', '', '', '', ''),
(1062, 0, 10, 0, 'temno_sinij_platok_s_golubym_kruzhevom_i_strazami', 'Тёмно синий платок с  голубым кружевом и стразами', NULL, 9, 'Платок из мягкого и плотного трикотажного полотна темного синего цвета в сочетании с широким фактурным кружевом. Отделка - рисунок из страз.\r\nВ комплекте, с платьем, пальто или кожанной курткой этот аксессуар сделает Ваш образ роскошным. \r\nЗакрепить платок можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 85 см х 85 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-97/60', NULL, 1290, NULL, 520, '2017-09-29 16:05:48', '2017-09-29 16:06:53', NULL, 0, 1, '', '', '', '', '', ''),
(1063, 0, 10, 0, 'snud_sero_persikovogo_cveta', 'Снуд серо-персикового цвета', NULL, 9, 'Дорогое кружево персикового цвета с выглядит благородно и женственно.  Двусторонний снуд подбит тонким трикотажным полотном серого цвета. Изделие отлично дополнит Ваш образ с классическим пальто, пуховиком или шубкой. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Вискоза 50%, Полиэстер 50%', 'ВА-Сн-2/50', NULL, 1530, NULL, 640, '2017-10-02 11:17:41', '2017-11-10 11:28:22', NULL, 0, 1, '', '', '', '', '', ''),
(1064, 0, 10, 0, 'snud_sine_korallovogo_cveta', 'Снуд сине- кораллового цвета', NULL, 9, 'Роскошное кружево кораллового цвета будет к лицу каждой женщине! Двусторонний снуд подбит тонким трикотажным полотном темного синего цвета. Изделие отлично дополнит Ваш образ с классическим пальто, пуховиком или шубкой. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Вискоза 50%, Полиэстер 50%', 'ВА-сн-2/51', NULL, 1530, NULL, 640, '2017-10-02 11:24:56', '2017-10-02 11:24:56', NULL, 0, 1, '', '', '', '', '', ''),
(1065, 0, 10, 0, 'dvustoronnij_snud_sine_korallovogo_cveta_', 'Двусторонний снуд сине-кораллового цвета', NULL, 9, 'Ажурное кружево кораллового цвета будет к лицу каждой женщине! Двусторонний снуд подбит тонким трикотажным полотном темного синего цвета. Изделие отлично дополнит Ваш образ с классическим пальто, пуховиком или шубкой. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав:Вискоза 50%, Полиэстер 50%', 'ВА-Сн-2/52', NULL, 1530, NULL, 640, '2017-10-02 11:37:55', '2017-10-02 11:37:55', NULL, 0, 1, '', '', '', '', '', ''),
(1066, 0, 10, 0, 'snud_sine_myatnogo_cveta', 'Снуд сине-мятного цвета', NULL, 9, 'Двусторонний снуд выполнен из ажурного кружева бирюзового цвета, подбит тонким трикотажным полотном темного синего цвета. Изделие отлично дополнит Ваш образ с классическим пальто, пуховиком или шубкой. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Вискоза 50%, Полиэстер 50%', 'ВА-Сн-2/53', NULL, 1530, NULL, 640, '2017-10-02 11:47:34', '2017-10-02 11:47:34', NULL, 0, 1, '', '', '', '', '', ''),
(1067, 0, 10, 0, 'snud_cherno_biryuzovogo_cveta', 'Снуд черно-бирюзового цвета', NULL, 9, 'Красивый двусторонний снуд выполнен из эластичного кружева бирюзового цвета. Подбит тонким трикотажным полотном черного цвета с содержанием вискозы .\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. \r\nДлина 67 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-Сн-2/45', NULL, 1530, NULL, 640, '2017-10-02 11:54:50', '2017-10-02 11:54:50', NULL, 0, 1, '', '', '', '', '', ''),
(1068, 0, 10, 0, 'stilnyj_snud_leopardovoj_rascvetki', 'Стильный снуд леопардовой  расцветки', NULL, 9, 'В наши дни дикий принт стал практически классикой. Создать дерзкий и яркий образ способен снуд из эластичного трикотажного полотна леопардовой  расцветки. Снуд подбит тонким трикотажным полотном с содержанием вискозы.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем нейтральных цветов.\r\nДлина 68 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-Сн-2/31', NULL, 1050, NULL, 400, '2017-10-02 12:00:00', '2017-10-02 12:00:00', NULL, 0, 1, '', '', '', '', '', ''),
(1069, 0, 10, 0, 'snud_v_cherno_bordovoj_gamme', 'Снуд в черно - бордовой гамме', NULL, 9, 'Практичный аксессуар - двусторонний снуд выполнен из трикотажного полотна с содержанием вискозы. Сдержанный мелкий рисунок в черно - бордовой гамме.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем.\r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Вискоза 52%, Полиэстер 45%, Эластан 3%', 'ВА-Сн-2/42', NULL, 1050, NULL, 400, '2017-10-02 12:15:59', '2017-10-02 12:15:59', NULL, 0, 1, '', '', '', '', '', ''),
(1070, 0, 10, 0, 'snud_sinego_cveta_v_belyj_goroshek', 'Снуд синего цвета в белый горошек', NULL, 9, 'Популярный аксессуар - двусторонний снуд выполнен из плотного трикотажного полотна темного синего цвета в белый горошек. Вторая сторона - однотонный трикотаж в тон.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем.\r\nДлина 75 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: 	Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-Сн-2/56', NULL, 1050, NULL, 400, '2017-10-02 12:23:23', '2017-11-21 13:24:36', NULL, 0, 0, '', '', '', '', '', ''),
(1071, 0, 10, 0, 'platok_slivovogo_cveta_s_bezhevym_kruzhevom', 'Платок сливового цвета с бежевым кружевом', NULL, 9, 'Платок из мягкого и плотного трикотажного полотна сливового цвета в сочетании с широким фактурным кружевом благородного бежевого оттенка. Отделка - рисунок из страз. В комплекте, с платьем, пальто или кожанной курткой этот аксессуар сделает Ваш образ роскошным. Закрепить платок можно подходящей по цвету брошью, выбранной в разделе аксессуары.Аксессуары в комплект не входят.\r\nРазмер: 85 см х 85 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-97/59', NULL, 1290, NULL, 520, '2017-10-02 12:25:05', '2017-10-02 12:25:05', NULL, 0, 1, '', '', '', '', '', ''),
(1072, 0, 10, 0, 'roskoshnyj_zhelto_persikovyj_palantin_iz_zhatogo_hlopka_', 'Роскошный желто-персиковый палантин из жатого хлопка', NULL, 9, 'Роскошный палантин из слегка жатого хлопка выполнен в технике "деградэ" -  переход цвета от желто - персикового в рыжий цвет. Идеальное качество, благородный цвет и большой размер делают это изделие ручной работы универсальным. Используйте его, как парео, накиньте  на плечи или завяжите красивым узлом. Все восхищенные взгляды и комплименты будут только Ваши! Аксессуары в комплект не входят.\r\nДлина 186 см. Ширина 125 см.\r\nСостав: 100 % хлопок.  ', 'ВА-П-97/84', NULL, 1970, NULL, 860, '2017-10-02 12:31:57', '2017-10-02 12:36:37', NULL, 0, 1, '', '', '', '', '', ''),
(1073, 0, 10, 0, 'snud_temnogo_sinego_cveta_s_cvetochnym_printom', 'Снуд темного-синего цвета с цветочным принтом', NULL, 9, 'Популярный аксессуар - двусторонний снуд выполнен из плотного трикотажного полотна темного синего цвета с цветочным принтом. Вторая сторона - однотонный трикотаж в тон.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем.\r\nДлина 72 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%\r\n', 'ВА-Сн-2/54', NULL, 1050, NULL, 400, '2017-10-02 12:35:30', '2017-11-21 13:25:03', NULL, 0, 0, '', '', '', '', '', ''),
(1074, 0, 10, 0, 'roskoshnyj_bezhevo_korichnevyj_palantin_iz_zhatogo_hlopka_', 'Роскошный бежево-коричневый палантин из жатого хлопка', NULL, 9, 'Роскошный палантин из слегка жатого хлопка выполнен в технике "деградэ" -  переход цвета от бежевого в коричневый цвет. Идеальное качество, благородный цвет и большой размер делают это изделие ручной работы универсальным. Используйте его, как парео, накиньте  на плечи или завяжите красивым узлом. Все восхищенные взгляды и комплименты будут только Ваши!\r\nАксессуары в комплект не входя .\r\nДлина 186 см. Ширина 125 см.\r\nСостав: 100 % хлопок.\r\n\r\n', 'ВА-П-97/85', NULL, 1970, NULL, 860, '2017-10-02 12:40:26', '2017-10-02 12:40:26', NULL, 0, 1, '', '', '', '', '', ''),
(1075, 0, 10, 0, 'dvustoronnij_snud_serogo_cveta_s_kletochnym_printom', 'Двусторонний снуд серого цвета с клеточным принтом', NULL, 9, 'Клетчатый принт Barberry придает Вашему образу элегантности. \r\nНежный на ощупь, полупрозрачный шифон струится и чудесно ложится складками. Двусторонний снуд подбит тонким трикотажным полотном серого цвета. Изделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 75 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Вискоза 50%, Полиэстер 50%', 'ВА-Сн-2/13', NULL, 1050, NULL, 400, '2017-10-02 12:43:11', '2017-10-02 12:43:11', NULL, 0, 1, '', '', '', '', '', ''),
(1076, 0, 10, 0, 'dvustoronnij_snud_serogo_cveta_s_kletochnym_printom', 'Двусторонний снуд серого цвета с клеточным принтом', NULL, 9, 'Клетчатый принт Barberry придает Вашему образу элегантности. \r\nНежный на ощупь, полупрозрачный шифон струится и чудесно ложится складками. Двусторонний снуд подбит тонким трикотажным полотном серого цвета. Изделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 75 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Вискоза 50%, Полиэстер 50%', 'ВА-Сн-2/13', NULL, 1050, NULL, 400, '2017-10-02 12:43:11', '2017-10-02 12:43:11', NULL, 0, 1, '', '', '', '', '', ''),
(1077, 0, 10, 0, 'roskoshnyj_vishnevo_chernyj_palantin_iz_zhatogo_hlopka_', 'Роскошный вишнево-черный палантин из жатого хлопка', NULL, 9, 'Роскошный палантин из слегка жатого хлопка выполнен в технике "деградэ" -  переход цвета от вишневого в черный цвет. Идеальное качество, благородный цвет и большой размер делают это изделие ручной работы универсальным. Используйте его, как парео, накиньте  на плечи или завяжите красивым узлом. Все восхищенные взгляды и комплименты будут только Ваши! Аксессуары в комплект не входят.\r\nДлина 186 см. Ширина 125 см.\r\nСостав: 100 % хлопок.', 'ВА-П-97/86', NULL, 1970, NULL, 860, '2017-10-02 12:44:41', '2017-10-02 12:44:41', NULL, 0, 1, '', '', '', '', '', ''),
(1078, 0, 10, 0, 'roskoshnyj_sero_chernyj_palantin_iz_zhatogo_hlopka', 'Роскошный серо-черный палантин из жатого хлопка', NULL, 9, 'Роскошный палантин из слегка жатого хлопка выполнен в технике "деградэ" -  переход цвета из серого в черный цвет. Идеальное качество, благородный цвет и большой размер делают это изделие ручной работы универсальным. Используйте его, как парео, накиньте  на плечи или завяжите красивым узлом. Все восхищенные взгляды и комплименты будут только Ваши! Аксессуары в комплект не входят.\r\nДлина 186 см. Ширина 125 см.\r\nСостав: 100 % хлопок.', 'ВА-П-97/87', NULL, 1970, NULL, 860, '2017-10-02 12:53:53', '2017-10-02 12:54:06', NULL, 0, 1, '', '', '', '', '', ''),
(1079, 0, 10, 0, 'snud_s_cvetochnym_uzorom_na_chernom_fone', 'Снуд с цветочным узором на черном фоне', NULL, 9, 'Очаровательный двусторонний снуд выполнен из нежного шифона с цветочным узором на черном фоне. Подбит тонким трикотажным полотном черного цвета с содержанием вискозы.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. \r\nДлина 73 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%', 'ВА-Сн-2/44', NULL, 1290, NULL, 520, '2017-10-02 12:56:49', '2017-10-02 12:56:49', NULL, 0, 1, '', '', '', '', '', ''),
(1080, 0, 10, 0, 'snud_s_cvetochnym_uzorom_na_chernom_fone', 'Снуд с цветочным узором на черном фоне', NULL, 9, 'Очаровательный двусторонний снуд выполнен из нежного шифона с цветочным узором на черном фоне. Подбит тонким трикотажным полотном черного цвета с содержанием вискозы.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. \r\nДлина 73 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%', 'ВА-Сн-2/44', NULL, 1290, NULL, 520, '2017-10-02 12:56:49', '2017-10-02 12:56:49', NULL, 0, 1, '', '', '', '', '', ''),
(1081, 0, 10, 0, 'zhemchuzhno_rozovyj_palantin_iz_naturalnogo_volokna', 'Жемчужно-розовый палантин из натурального волокна', NULL, 9, 'Роскошный палантин из слегка жатого натурального волокна выткан в виде гладких и фактурных полос. Прохладный жемчужно - розовый цвет подойдет любому цветотипу. Идеальное качество, благородный цвет и большой размер делают это изделие ручной работы универсальным. Используйте его, как парео, накиньте  на плечи или завяжите красивым узлом. Все восхищенные взгляды и комплименты будут только Ваши! Аксессуары в комплект не входят.\r\nДлина 200 см. Ширина 90 см.\r\nСостав: Хлопок 50 %, вискоза 50 %.', 'ВА-П-97/88', NULL, 1490, NULL, 620, '2017-10-02 12:59:29', '2017-10-02 12:59:29', NULL, 0, 1, '', '', '', '', '', ''),
(1082, 0, 10, 0, 'sero_chernyj_palantin_iz_naturalnogo_volokna', 'Серо-черный палантин из натурального волокна', NULL, 9, 'Роскошный палантин из слегка жатого натурального волокна выткан в виде гладких и фактурных полос. Популярное сочетание серого и черного цветов. Идеальное качество, благородный цвет и большой размер делают это изделие ручной работы универсальным. Используйте его, как парео, накиньте  на плечи или завяжите красивым узлом. Все восхищенные взгляды и комплименты будут только Ваши!\r\nАксессуары в комплект не входят.\r\nДлина 200 см. Ширина 90 см. \r\nСостав: Хлопок 50 %, вискоза 50 %.', 'ВА-П-97/89', NULL, 1490, NULL, 620, '2017-10-02 13:04:13', '2017-10-02 13:04:58', NULL, 0, 1, '', '', '', '', '', ''),
(1083, 0, 10, 0, 'sine_gorchichnyj_palantin_iz_naturalnogo_volokna', 'Сине-горчичный палантин из натурального волокна', NULL, 9, 'Роскошный палантин из слегка жатого натурального волокна выткан в виде гладких и фактурных полос. Сочетание популярных темно -синего и горчичного цветов. Идеальное качество, благородный цвет и большой размер делают это изделие ручной работы универсальным. Используйте его, как парео, накиньте  на плечи или завяжите красивым узлом. Все восхищенные взгляды и комплименты будут только Ваши! Аксессуары в комплект не входят.\r\nДлина 200 см. Ширина 90 см.\r\nСостав: Хлопок 50 %, вискоза 50 %.', 'ВА-П-97/90', NULL, 1490, NULL, 620, '2017-10-02 13:09:50', '2017-10-02 13:09:50', NULL, 0, 1, '', '', '', '', '', ''),
(1084, 0, 10, 0, 'snud_rozovo_chernogo_cveta', 'Снуд розово-черного цвета', NULL, 9, 'Роскошный весенний «снуд» (съемный воротник-капюшон) Розово-черного цвета из трикотажного полотна.\r\nРазмер: 60*73 см.\r\nБроши в комплект не входят.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-Сн-2/11', NULL, 1050, NULL, 400, '2017-10-02 13:10:54', '2017-10-02 13:10:54', NULL, 0, 1, '', '', '', '', '', ''),
(1085, 0, 10, 0, 'platok_s_shelkom_v_terrakotovo_sine_sirenevyh_ottenkah', 'Платок с шелком в терракотово-сине-сиреневых оттенках', NULL, 9, 'Восхитительный платок из смесовой ткани , украшенный кисточками по двум сторонам. Абстрактный рисунок в  пастельных тонах (неярко выраженный бирюзово - синий, сиреневые и терракотовые оттенки).\r\nИдеальное качество, благородный цвет и большой размер делают это изделие ручной работы универсальным. Используйте его, как парео, головной убор, накиньте  на плечи или завяжите красивым узлом. Подарите себе роскошь, комфорт и нежность! Аксессуары в комплект не входят.\r\nРазмер 120 см х 120 см.\r\nСостав: 30 % шелк, 70 % хлопок.', 'ВА-П-97/27', NULL, 2250, NULL, 1000, '2017-10-02 13:16:10', '2017-10-02 13:16:10', NULL, 0, 1, '', '', '', '', '', ''),
(1086, 0, 10, 0, 'snud_sinego_cveta_s_cvetochnym_printom', 'Снуд синего цвета с цветочным принтом', NULL, 9, 'Цветочный принт выглядит завораживающе! Нежный на ощупь, полупрозрачный шифон струится и чудесно ложится складками. Двусторонний снуд подбит тонким трикотажным полотном темного синего цвета. Изделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 72 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав:Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-Сн-2/46', NULL, 1290, NULL, 520, '2017-10-02 13:20:06', '2017-10-02 13:20:06', NULL, 0, 1, '', '', '', '', '', ''),
(1087, 0, 10, 0, 'platok_s_shelkom_v_zhelto_bezhevo_terrakotovovyh_ottenkah', 'Платок с шелком в желто- бежево-терракотововых оттенках', NULL, 9, 'Восхитительный платок из смесовой ткани  украшенный кисточками по двум сторонам. Абстрактный рисунок в теплых пастельных тонах (терракотовый, бежево - желтый, оливковый). Идеальное качество, благородный цвет и большой размер делают это изделие ручной работы универсальным. Используйте его, как парео, головной убор, накиньте на плечи или завяжите красивым узлом. Подарите себе роскошь, комфорт и нежность! Аксессуары в комплект не входят.\r\nРазмер 120 см х 120 см. \r\nСостав: 30 % шелк, 70 % хлопок.', 'ВА-П-97/25', NULL, 2250, NULL, 1000, '2017-10-02 13:23:47', '2017-10-02 13:23:47', NULL, 0, 1, '', '', '', '', '', ''),
(1088, 0, 10, 0, 'snud_izumrudnogo_cveta_s_cvetochnym_printom', 'Снуд изумрудного цвета с цветочным принтом', NULL, 9, 'Цветы в пастельных тонах на изумрудном фоне выглядят завораживающе! Нежный на ощупь, полупрозрачный шифон струится и чудесно ложится складками. Двусторонний снуд подбит тонким трикотажным полотном серого цвета. Изделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 75 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав:Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-Сн-2/12', NULL, 1290, NULL, 520, '2017-10-02 13:27:05', '2017-10-02 13:27:05', NULL, 0, 1, '', '', '', '', '', ''),
(1089, 0, 10, 0, 'voshititelnyj_platok_s_cvetushej_vishnej_i_ejfelevoj_bashnej_', 'Восхитительный платок с цветущей вишней и Эйфелевой башней', NULL, 9, 'Восхитительный платок из смесовой ткани, украшенный кисточками по двум сторонам. Цветущая вишня на  фоне Эйфелевой башни  в пастельных тонах (небесно - синий, лососевый  и серо - бежевый цвета).\r\nИдеальное качество, благородный цвет и большой размер делают это изделие ручной работы универсальным. Используйте его, как парео, головной убор, накиньте  на плечи или завяжите красивым узлом. Подарите себе роскошь, комфорт и нежность! Аксессуары в комплект не входят.\r\nРазмер 120 см х 120 см.\r\nСостав: 30 % шелк, 70 % хлопок.', 'ВА-П-97/28', NULL, 2250, NULL, 1000, '2017-10-02 13:30:08', '2017-10-02 13:30:08', NULL, 0, 1, '', '', '', '', '', ''),
(1090, 0, 10, 0, 'elegantnyj_sinij_palantin_iz_batista_', 'Элегантный синий палантин из батиста', NULL, 9, 'Элегантный палантин выполнен из хлопкового батиста темного синего цвета. Отделка - ажурное кружево.\r\nЗакрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 180 см х 60 см.\r\nСостав: Хлопок 100%.', 'ВА-П-97/65', NULL, 1290, NULL, 520, '2017-10-02 13:34:33', '2017-10-02 13:34:33', NULL, 0, 1, '', '', '', '', '', ''),
(1091, 0, 10, 0, 'snud_biryuzovogo_cveta_s_cvetochnym_printom', 'Снуд бирюзового цвета с цветочным принтом', NULL, 9, 'Цветочный принт выглядит завораживающе! Нежный на ощупь, полупрозрачный шифон струится и чудесно ложится складками. Двусторонний снуд подбит тонким трикотажным полотном бирюзового цвета. Изделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 72 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав:Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-Сн-2/16', NULL, 1290, NULL, 520, '2017-10-02 13:35:05', '2017-10-02 13:35:05', NULL, 0, 1, '', '', '', '', '', ''),
(1092, 0, 10, 0, 'krugovoj_dvojnoj_sharf_so_vstavkoj_iz_trehcvetnogo_kruzheva_', 'Круговой двойной шарф со вставкой из трехцветного кружева', NULL, 9, 'Потрясающий аксессуар - круговой двойной шарф со вставкой из трехцветного кружева выполнен из трикотажного полотна серого цвета. Закрепить шарф на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары. Аксессуары в комплект не входят.\r\nРазмер: 150 см х 30 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%.', 'ВА-П-97/46', NULL, 1290, NULL, 520, '2017-10-02 13:42:29', '2017-10-02 13:42:29', NULL, 0, 1, '', '', '', '', '', ''),
(1093, 0, 10, 0, 'snud_v_sirenevyh_i_biryuzovyh_tonah', 'Снуд в сиреневых и бирюзовых тонах', NULL, 9, 'Стилизованный цветочный ажурный принт в сиреневых и бирюзовых тонах . Снуд из нежного шелковистого шифона подбит тонким трикотажным полотном мятного цвета. Изделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 72 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав:Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-Сн-2/21', NULL, 1290, NULL, 520, '2017-10-02 13:43:07', '2017-10-02 13:43:07', NULL, 0, 1, '', '', '', '', '', ''),
(1094, 0, 10, 0, 'seryj_shelkovyj_palantin_s_sero_rozovym_kruzhevom', 'Серый шелковый палантин с серо-розовым кружевом', NULL, 9, 'Палантин выполнен из однотонного шелка пыльного серо - голубого цвета.  Украшен великолепным широким кружевом серого и розового цвета. Закрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары. Аксессуары в комплект не входят.\r\nРазмер: 160 см х 60 см.\r\nСостав: Шелк 100%.\r\n', 'ВА-П-97/55', NULL, 1290, NULL, 520, '2017-10-02 13:48:18', '2017-10-02 13:48:18', NULL, 0, 1, '', '', '', '', '', ''),
(1095, 0, 10, 0, 'snud_sine_bordovogo_cveta', 'Снуд сине-бордового цвета', NULL, 9, 'Элегантный аксессуар - двусторонний снуд подбит тонким трикотажным полотном крепового переплетения. Эффектное сочетание глубокого темного терракотового цвета и чернильного шифона. Нежный прозрачный шифон с редким цветочным принтом в пастельных тонах.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем.\r\nДлина 72 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-Сн-2/41', NULL, 1290, NULL, 520, '2017-10-02 13:51:09', '2017-10-02 13:51:09', NULL, 0, 1, '', '', '', '', '', ''),
(1096, 0, 10, 0, 'shifonovyj_palantin_s_ogurechnym_i_zverinym_printom', 'Шифоновый палантин с "огуречным" и "звериным" принтом', NULL, 9, 'Дивный палантин выполнен из легкого прозрачного шифона. "Огуречный" и "звериный" принт на бирюзово - зеленом фоне. Нежная ткань великолепно струится и чудесно ложится складками. Отделка - великолепное кружево. Закрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары. Аксессуары в комплект не входят.\r\nРазмер: 156 см х 60 см.\r\nСостав: Полиэстер 100%.\r\n', 'ВА-П-97/56', NULL, 1290, NULL, 520, '2017-10-02 13:58:13', '2017-10-02 13:58:13', NULL, 0, 1, '', '', '', '', '', ''),
(1097, 0, 10, 0, 'snud_s_cvetochnym_printom_na_serom_fone', 'Снуд с цветочным принтом на сером фоне', NULL, 9, 'Элегантный палантин сделает Ваш образ незабываемым. Чудесные цветы на нежном жемчужно - сером фоне. Снуд подбит тонким трикотажным полотном цвета маренго (черный с серым отливом) с содержанием вискозы.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем нейтральных цветов.\r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав:Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-Сн-2/38', NULL, 1290, NULL, 520, '2017-10-02 13:59:38', '2017-10-02 13:59:38', NULL, 0, 1, '', '', '', '', '', ''),
(1098, 0, 10, 0, 'shifonovyj_palantin_v_sipenevo_golubyh_tonah', 'Шифоновый палантин в сипенево-голубых тонах', NULL, 9, 'Чудесный палантин выполнен из легкого прозрачного шифона. Сложный принтовый градиент на сиренево - голубом фоне. Нежная ткань великолепно струится и чудесно ложится складками. Отдела - великолепное кружево. Закрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары. Аксессуары в комплект не входят.\r\nРазмер: 170 см х 60 см.\r\nСостав: Полиэстер 100%.\r\n', 'ВА-П-97/57', NULL, 1290, NULL, 520, '2017-10-02 14:04:36', '2017-10-02 14:04:36', NULL, 0, 1, '', '', '', '', '', ''),
(1099, 0, 10, 0, 'potryasayushij_prozrachnyj_palantin_s_cvetochnym_printom', 'Потрясающий прозрачный палантин с цветочным принтом', NULL, 9, 'Потрясающий палантин выполнен из легкого прозрачного шифона. Чудесный цветочный принт на мягком жемчужно - сером фоне.Нежная ткань великолепно струится и чудесно ложится складками. Закрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары. Аксессуары в комплект не входят.\r\nРазмер: 152 см х 70 см.\r\nСостав: Полиэстер 100%.\r\n', 'ВА-П-97/58', NULL, 1090, NULL, 420, '2017-10-02 14:09:49', '2017-11-22 22:49:00', NULL, 0, 1, '', '', '', '', '', ''),
(1100, 0, 10, 0, 'snud_persikovogo_cveta_s_cvetochnym_printom', 'Снуд персикового цвета с цветочным принтом', NULL, 9, 'Чудесный палантин сделает Ваш образ незабываемым. Чудесные маки на нежном персиковом фоне. Снуд подбит тонким трикотажным вискозным полотном серого цвета.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем нейтральных цветов.\r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Вискоза 50%, Полиэстер 50%', 'ВА-Сн-2/47', NULL, 1290, NULL, 520, '2017-10-02 14:11:21', '2017-10-02 14:11:21', NULL, 0, 1, '', '', '', '', '', ''),
(1101, 0, 10, 0, 'dvustoronnij_palantin_s_cvetami_na_bordovom_fone', 'Двусторонний палантин с цветами на бордовом фоне', NULL, 9, 'Очаровательный двусторонний палантин выполнен из шелка с классическим цветочным узором на бордовом фоне. Подбит шелком черного цвета. Изделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Брошь поможет закрепить палантин на плечах. Аксессуары в комплект не входят.\r\nДлина 145 см, ширина 60 см.\r\nСостав: Полиэстер 100%.\r\n', 'ВА-П-97/72', NULL, 1330, NULL, 540, '2017-10-02 14:17:22', '2017-10-02 14:17:22', NULL, 0, 1, '', '', '', '', '', ''),
(1102, 0, 10, 0, 'shifonovyj_palantin_s_ogurcami_v_krasno_sinih_tonah', 'Шифоновый палантин с "огурцами" в красно-синих тонах', NULL, 9, 'Изысканный палантин выполнен из легкого прозрачного шифона. Популярный " огуречный" принт в темных красных и синих тонах. Нежная ткань великолепно струится и чудесно ложится складками. Отдела - великолепное кружево чернильного цвета. Закрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары. Аксессуары в комплект не входят.\r\nРазмер: 145 см х 62 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-97/54', NULL, 1290, NULL, 520, '2017-10-02 14:22:27', '2017-10-02 14:22:27', NULL, 0, 1, '', '', '', '', '', ''),
(1103, 0, 10, 0, 'shifonovyj_palantin_s_ogurechnym_printom_i_kruzhevom_', 'Шифоновый палантин с "огуречным" принтом и кружевом', NULL, 9, 'Легкий палантин выполнен из легкого прозрачного шифона. Популярный " огуречный" принт в бордовых и серых тонах. Нежная ткань великолепно струится и чудесно ложится складками. Отделка - великолепное кружево черного цвета. Закрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары. Аксессуары в комплект не входят.\r\nРазмер: 160 см х 60 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-97/69', NULL, 1290, NULL, 520, '2017-10-02 14:27:29', '2017-10-02 14:27:29', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1104, 0, 10, 0, 'snud_s_ogurechnym_printom_bordovogo_ottenka', 'Снуд с огуречным принтом бордового оттенка', NULL, 9, 'Снуд из бархата прочно занимает лидирующие позиции по популярности в коллекциях мировых брендов. Мраморный бархат бордового цвета эффектно переливается в драпировке, мерцает крошечными пайетками в тон. Снуд подбит нежным шифоном, "огуречный" принт в бордовых, сиреневых и горчичных тонах.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. \r\nДлина 66 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%', 'ВА-Сн-2/27', NULL, 1290, NULL, 520, '2017-10-02 14:27:58', '2017-10-02 14:27:58', NULL, 0, 1, '', '', '', '', '', ''),
(1105, 0, 10, 0, 'chernyj_shifonovyj_palantin_s_melkimi_cvetami', 'Черный шифоновый палантин с мелкими цветами', NULL, 9, 'Изысканный палантин выполнен из легкого прозрачного шифона. Стилизованные розы на черном фоне. Нежная ткань великолепно струится и чудесно ложится складками. Отдела - великолепное кружево.\r\nЗакрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 145 см х 62 см.\r\nСостав: Полиэстер 100%.\r\n', 'ВА-П-97/51', NULL, 1290, NULL, 520, '2017-10-02 14:32:51', '2017-10-02 14:40:02', NULL, 0, 1, '', '', '', '', '', ''),
(1106, 0, 10, 0, 'chernyj_shifonovyj_palantin_s_krupnymi_cvetami_', 'Черный шифоновый палантин с крупными цветами', NULL, 9, 'Изысканный палантин выполнен из легкого прозрачного шифона. Цветочный принт на черном фоне. Нежная ткань великолепно струится и чудесно ложится складками. Отдела - великолепное кружево чернильного цвета. Закрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары. Аксессуары в комплект не входят.\r\nРазмер: 145 см х 62 см.\r\nСостав: Полиэстер 100%\r\n\r\n\r\n', 'ВА-П-97/53', NULL, 1290, NULL, 520, '2017-10-02 14:37:30', '2017-10-02 14:37:30', NULL, 0, 1, '', '', '', '', '', ''),
(1107, 0, 10, 0, 'snud_iz_barhata_cveta_kofe', 'Снуд из бархата  цвета кофе', NULL, 9, 'Снуд из бархата прочно занимает лидирующие позиции по популярности в коллекциях мировых брендов. Мраморный бархат цвета кофе с молоком эффектно переливается в драпировке, мерцает крошечными пайетками в тон. Снуд подбит нежным шифоном, стилизованные розы на черном фоне.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. \r\nДлина 66 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%', 'ВА-СН-2/30', NULL, 1290, NULL, 520, '2017-10-02 14:41:19', '2017-10-02 14:41:19', NULL, 0, 1, '', '', '', '', '', ''),
(1108, 0, 10, 0, 'yarkij_palantin_s_cvetami', 'Яркий палантин с цветами', NULL, 9, 'Яркий палантин привлечет восхищенные взгляды. Цветочный принт создает переход цвета от золотистого хаки к черному. Прозрачный шифон легко ложится плавными складками. Аксессуары в комплект не входят.\r\nДлина 210 см. Ширина 60 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-97/7', NULL, 1290, NULL, 520, '2017-10-02 14:43:49', '2017-10-02 14:43:49', NULL, 0, 1, '', '', '', '', '', ''),
(1109, 0, 10, 0, 'ultramarinovyj_sharf', 'Ультрамариновый шарф', NULL, 9, 'Яркий шарф сделает нарядным Ваш строгий городской образ и защитит от ветра на загородной прогулке. Шелк ультрамаринового цвета подбит белым трикотажным полотном. Аксессуары в комплект не входят.\r\nДлина 145 см. Ширина 40 см.\r\nСостав:Вискоза 30%, Полиэстер 70%.', 'ВА-П-97/19', NULL, 970, NULL, 360, '2017-10-02 14:48:33', '2017-10-02 14:48:33', NULL, 0, 1, '', '', '', '', '', ''),
(1110, 0, 10, 0, 'snud_iz_barhata_korichnevogo_cveta', 'Снуд из бархата коричневого цвета', NULL, 9, 'Снуд из бархата прочно занимает лидирующие позиции по популярности в коллекциях мировых брендов. Мраморный бархат цвета кофе с молоком эффектно переливается в драпировке, мерцает крошечными пайетками в тон. Снуд подбит нежным шифоном, сложный принт в серых и розовых тонах\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. \r\nДлина 66 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%', 'ВА-Сн-2/29', NULL, 1290, NULL, 520, '2017-10-02 14:48:37', '2017-10-02 14:48:37', NULL, 0, 1, '', '', '', '', '', ''),
(1111, 0, 10, 0, 'yarkij_palantin_s_cvetochnym_printom_i_krasnym_kruzhevom', 'Яркий палантин с цветочным принтом и красным кружевом', NULL, 9, 'Яркий палантин с цветочным принтом, дополнен изящным французским кружевом красного цвета. \r\nАксессуары в комплект не входят.\r\nРазмер: 150 см х 60 см.\r\nСостав: Вискоза 65%, Полиэстер 30%.', 'ВА-П-96/55', NULL, 1290, NULL, 520, '2017-10-02 14:53:42', '2017-10-02 14:53:42', NULL, 0, 1, '', '', '', '', '', ''),
(1112, 0, 10, 0, 'snud_iz_barhata_s_pajetkami_v_ton', 'Снуд из бархата с пайетками в тон', NULL, 9, 'Снуд из бархата прочно занимает лидирующие позиции по популярности в коллекциях мировых брендов. Мраморный бархат цвета кофе с молоком эффектно переливается в драпировке, мерцает крошечными пайетками в тон. Снуд подбит нежным шифоном, сложный принт в терракотовых, голубых и бежевых тонах.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. \r\nДлина 66 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%', 'ВА-Сн-2/37', NULL, 1290, NULL, 520, '2017-10-02 14:56:48', '2017-10-02 14:56:48', NULL, 0, 1, '', '', '', '', '', ''),
(1113, 0, 10, 0, 'roskoshnyj_atlasnyj_palantin_s_dorogim_kruzhevom', 'Роскошный атласный палантин с дорогим кружевом', NULL, 9, 'Палантин выполнен из роскошного атласа с чудесным цветочным принтом на черном фоне, украшен дорогим кружевом. Закрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары. Аксессуары в комплект не входят.\r\nРазмер: 150 см х 73 см.\r\nСостав: Полиэстер 100%', 'ВА-П-96/71', NULL, 1290, NULL, 520, '2017-10-02 14:57:50', '2017-10-02 14:57:50', NULL, 0, 1, '', '', '', '', '', ''),
(1114, 0, 10, 0, 'sinij_palantin_s_pticami', 'Синий палантин с птицами', NULL, 9, 'Палантин выполнен из легкого шифона темно-синего цвета с анималистическим узором. Украшен великолепным широким кружевом цвета айвори. Закрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары. Аксессуары в комплект не входят.\r\nРазмер: 192 см х 64 см.\r\nСостав: Полиэстер 100%.\r\n', 'ВА-П-96/73', NULL, 1290, NULL, 520, '2017-10-02 15:02:47', '2017-10-02 15:02:47', NULL, 0, 1, '', '', '', '', '', ''),
(1115, 0, 10, 0, 'snud_iz_barhata_printom_burberry_', 'Снуд из бархата принтом "Burberry"', NULL, 9, 'Снуд из бархата прочно занимает лидирующие позиции по популярности в коллекциях мировых брендов. Мраморный бархат черного цвета эффектно переливается в драпировке, мерцает крошечными пайетками в тон. Снуд подбит нежным шифоном с популярным принтом "Burberry".\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой. \r\nДлина 66 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%', 'ВА-Сн-2/36', NULL, 1290, NULL, 520, '2017-10-02 15:04:19', '2017-10-02 15:04:19', NULL, 0, 1, '', '', '', '', '', ''),
(1116, 0, 10, 0, 'milyj_platochek_s_printom_koshechki_', 'Милый платочек с принтом "кошечки"', NULL, 9, 'Милый платочек с принтом "кошечки" из нежнейшего шифона надевают на запястье в виде браслета, украшают шею или сумочку, используют вместо пояса. Прохладный розово - серый цвет. Аксессуары в комплект не входят.\r\nРазмер 73 см х 73 см.\r\nСостав: Шелк 100%.', 'ВА-П-97/43', NULL, 890, NULL, 320, '2017-10-02 15:07:52', '2017-10-02 15:07:52', NULL, 0, 1, '', '', '', '', '', ''),
(1117, 0, 10, 0, 'korichnevyj_snud_s_pajetkami_v_ton', 'Коричневый снуд с пайетками в тон', NULL, 9, 'Снуд из бархата прочно занимает лидирующие позиции по популярности в коллекциях мировых брендов. Мраморный бархат цвета кофе с молоком эффектно переливается в драпировке, мерцает крошечными пайетками в тон. Снуд подбит нежным шифоном, сложный принт в бежевых, серых и сиренево - голубых тонах.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. \r\nДлина 66 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%\r\n', 'ВА-сн-2/33', NULL, 1290, NULL, 520, '2017-10-02 15:09:51', '2017-10-02 15:15:26', NULL, 0, 1, '', '', '', '', '', ''),
(1118, 0, 10, 0, 'zheltym_platok_s_chudesnymi_makami_', 'Желтым платок с чудесными маками', NULL, 9, 'С этим ярким желтым платочком с чудесными маками лето будет с Вами всегда! Нежный шифон великолепно струится и чудесно ложится складками. Легкий шарфик летом можно надеть с футболкой и джинсами. Попробуйте использовать его как браслет. Аксессуары в комплект не входят.\r\nРазмер 73 см х 73 см.\r\nСостав: Полиэстер 100%', 'ВА-П-97/4', NULL, 750, NULL, 250, '2017-10-02 15:14:21', '2017-10-02 15:14:21', NULL, 0, 1, '', '', '', '', '', ''),
(1119, 0, 10, 0, 'stilnyj_snud_baklazhanovogo_cveta', 'Стильный снуд баклажанового цвета', NULL, 9, 'Снуд из бархата прочно занимает лидирующие позиции по популярности в коллекциях мировых брендов. Мраморный бархат благородного баклажанового цвета эффектно переливается в драпировке, мерцает крошечными пайетками в тон. Снуд подбит нежным шифоном, розовые и бирюзовые цветы на салатовом фоне.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. \r\nДлина 66 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%\r\n\r\n', 'ВА-Сн-2\\26', NULL, 1290, NULL, 520, '2017-10-02 15:17:55', '2017-10-02 15:17:55', NULL, 0, 1, '', '', '', '', '', ''),
(1120, 0, 10, 0, 'nevesomyj_poluprozrachnyj_shejnyj_platok_s_limonchikami', 'Невесомый полупрозрачный шейный платок с лимончиками', NULL, 9, 'Невесомый полупрозрачный шейный платок из шелка. Сочетание  черного и желтых оттенков добавят вашему образу изюминку. Аксессуары в комплект не входят.\r\nРазмер платка: 73 см х 73 см. \r\nСостав: Шелк 100%.', 'ВА-П-96/58', NULL, 750, NULL, 250, '2017-10-02 15:21:14', '2017-10-02 15:21:14', NULL, 0, 1, '', '', '', '', '', ''),
(1121, 0, 10, 0, 'snud_iz_barhata_fioletovogo_cveta', 'Снуд из бархата фиолетового цвета', NULL, 9, 'Снуд из бархата прочно занимает лидирующие позиции по популярности в коллекциях мировых брендов. Мраморный бархат благородного баклажанового цвета эффектно переливается в драпировке, мерцает крошечными пайетками в тон. Снуд подбит нежным шифоном, цветовая гамма которого переходит от фиолетового в терракот.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. \r\nДлина 66 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%\r\n', 'ВА-Сн-2/22', NULL, 1290, NULL, 520, '2017-10-02 15:24:03', '2017-10-02 15:24:03', NULL, 0, 1, '', '', '', '', '', ''),
(1122, 0, 10, 0, 'platochek_s_yablochnym_printom_iz_nezhnejshego_shifona', 'Платочек с яблочным принтом из нежнейшего шифона', NULL, 9, 'Брендовый платочек с яблочным принтом из нежнейшего шифона надевают на запястье в виде браслета, украшают шею или сумочку, используют вместо пояса. Аксессуары в комплект не входят.\r\nРазмер 73 см х 73 см\r\nСостав: Шелк 100%.', 'ВА-П-97/20', NULL, 890, NULL, 320, '2017-10-02 15:24:40', '2017-10-02 15:24:40', NULL, 0, 1, '', '', '', '', '', ''),
(1123, 0, 10, 0, 'nevesomyj_prozrachnyj_platok_v_romanticheskom_stile', 'Невесомый прозрачный платок в романтическом стиле', NULL, 9, 'Невесомый прозрачный шейный платок из шелка. Нежные розовые и зеленые оттенки подчеркнут Ваше романтичное настроение. Аксессуары в комплект не входят.\r\nРазмер платка: 73 см х 73 см. \r\nСостав: Шелк 100%.\r\n', 'ВА-П-96/43', NULL, 750, NULL, 250, '2017-10-02 15:28:39', '2017-10-02 15:28:39', NULL, 0, 1, '', '', '', '', '', ''),
(1124, 0, 10, 0, 'snud_nezhno_rozovogo_cveta', 'Снуд нежно-розового цвета', NULL, 9, 'Восхитительный аксессуар - снуд из нежного шифона с чудесными тюльпанами. Двусторонний снуд подбит тонким трикотажным полотном цвета пыльной розы.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 72 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Вискоза 30%, Полиэстер 70%\r\n', 'ВА-Сн-2/24', NULL, 1290, NULL, 520, '2017-10-02 15:33:37', '2017-10-02 15:33:37', NULL, 0, 1, '', '', '', '', '', ''),
(1125, 0, 10, 0, 'shejnyj_platok_s_zhivopisnymi_rozami_v_stile_pastel', 'Шейный платок с живописными розами в стиле пастель', NULL, 9, 'Шейный платок выполнен из легкого шифона молочного цвета с живописными розами в стиле пастель. \r\nДополните ваш образ романтичным платком!\r\nДлина платка 75 см. Ширина 75 см. \r\nСостав: Полиэстер 100%.', 'ВА-П-96/68', NULL, 750, NULL, 250, '2017-10-02 15:33:53', '2017-10-02 15:33:53', NULL, 0, 1, '', '', '', '', '', ''),
(1126, 0, 10, 0, 'stilnyj_snud_terrakotovogo_cveta', 'Стильный снуд терракотового цвета', NULL, 9, 'Поиграйте с разными фактурами! Дополните любимое пальто или кожанную куртку ярким снудом. Аксессуар из набивного шифона подбит мягким трикотажным полотном терракотового цвета.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nДлина 72 см, ширина 60 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-Сн-2/40', NULL, 1290, NULL, 520, '2017-10-02 15:38:58', '2017-10-02 15:38:58', NULL, 0, 1, '', '', '', '', '', ''),
(1127, 0, 10, 0, 'originalnyj_oranzhevyj_sharf_s_elementami_bizhuterii', 'Оригинальный оранжевый шарф с элементами бижутерии', NULL, 9, 'Оригинальный шарф с элементами бижутерии, выполнен из текстильного полотна. \r\nРазмеры шарфика: длина шарфика: 200 см, \r\nдлина бижутерии: 20 см.\r\nСостав: Вискоза 65%, Полиэстер 35%.', 'ВА-П-94/26', NULL, 1350, NULL, 550, '2017-10-02 15:39:04', '2017-10-02 15:39:04', NULL, 0, 1, '', '', '', '', '', ''),
(1128, 0, 10, 0, 'originalnyj_sireneyj_sharf_s_elementami_bizhuterii', 'Оригинальный сиренеый шарф с элементами бижутерии', NULL, 9, 'Оригинальный шарф с элементами бижутерии, выполнен из текстильного полотна. \r\nРазмеры шарфика: длина шарфика: 200 см, длина бижутерии: 20 см.\r\nСостав: Вискоза 65%, Полиэстер 35%.', 'ВА-П-94/63', NULL, 1350, NULL, 550, '2017-10-02 15:43:25', '2017-10-02 15:43:25', NULL, 0, 1, '', '', '', '', '', ''),
(1129, 0, 10, 0, 'originalnyj_sharf_s_elementami_bizhuterii_v_sinih_tonah', 'Оригинальный шарф с элементами бижутерии в синих тонах', NULL, 9, 'Широкий шарф выполнен из легкой набивной ткани и украшен бижутерной вставкой. Абстрактный рисунок в синих тонах. Украшение индивидуально для каждого изделия.\r\nДлина шарфика 190 см. Ширина 90 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%.', 'ВА-П-97/29', NULL, 1350, NULL, 550, '2017-10-02 15:48:24', '2017-10-02 15:48:24', NULL, 0, 1, '', '', '', '', '', ''),
(1130, 0, 10, 0, 'modnyj_snud_sinego_cveta', 'Модный снуд синего цвета', NULL, 9, 'Модный аксессуар - двусторонний снуд подбит трикотажным полотном синего цвета. Вторая сторона - нежный шифон со сложным рисунком, переходящим от цветочного на ярко - синем фоне через кружевной принт в нежный голубой.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем.\r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%', 'ВА-Сн-2/25', NULL, 1290, NULL, 520, '2017-10-02 15:48:40', '2017-10-02 15:48:40', NULL, 0, 1, '', '', '', '', '', ''),
(1131, 0, 10, 0, 'originalnyj_sharf_s_elementami_bizhuterii_v_sine_biryuzovyh_tonah', 'Оригинальный шарф с элементами бижутерии в сине-бирюзовых тонах', NULL, 9, 'Широкий шарф выполнен из легкой набивной ткани и украшен бижутерной вставкой. Абстрактный рисунок в бирюзовых и фиолетово - синих тонах. Украшение индивидуально для каждого изделия.\r\nДлина шарфика 190 см. Ширина 90 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%', 'ВА-П-97/31', NULL, 1350, NULL, 550, '2017-10-02 15:53:15', '2017-10-02 15:53:15', NULL, 0, 1, '', '', '', '', '', ''),
(1132, 0, 10, 0, 'snud_iz_barhat_chernogo_cveta', 'Снуд из бархат черного цвета', NULL, 9, 'Снуд из бархата прочно занимает лидирующие позиции по популярности в коллекциях мировых брендов. Мраморный бархат черного цвета эффектно переливается в драпировке, мерцает крошечными пайетками в тон. Снуд подбит нежным шифоном, сложный принт в голубых и фисташковых тонах.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой. \r\nДлина 66 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.\r\nСостав: Полиэстер 100%\r\n', 'ВА-Сн-2/35', NULL, 1290, NULL, 520, '2017-10-02 15:55:54', '2017-10-02 15:55:54', NULL, 0, 1, '', '', '', '', '', ''),
(1133, 0, 10, 0, 'elegantnyj_yarko_sinij_dvustoronnij_sharf_kulon', 'Элегантный ярко-синий двусторонний шарф - кулон', NULL, 9, 'Элегантный воздушный двусторонний шарф - кулон  выполнен из струящегося шифона яркого синего цвета с цветочным принтом. Металлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см. Ширина 30 см.\r\nСостав: Полиэстер 100%.\r\n', 'ВА-П-97/75', NULL, 1350, NULL, 550, '2017-10-02 15:57:07', '2017-10-02 15:57:07', NULL, 0, 1, '', '', '', '', '', ''),
(1134, 0, 10, 0, 'povsednevnyj_snud_svetlo_rozovogo_cveta', 'Повседневный снуд светло-розового цвета', NULL, 9, 'Роскошный «снуд» (съемный воротник-капюшон) светло-розового цвета. Снуд выполнен в технике ручного вязания из нитей с содержанием шерсти. \r\nСостав: Мохер 60%, Акрил 40%\r\n', 'ВА-Сн-1/6', NULL, 1150, NULL, 450, '2017-10-02 16:01:12', '2017-10-02 16:01:12', NULL, 0, 1, '', '', '', '', '', ''),
(1135, 0, 10, 0, 'elegantnyj_cherno_zelenyj_shifonovyj_sharf_kulon', 'Элегантный черно-зеленый шифоновый шарф - кулон', NULL, 9, 'Легкий шарф выполнен из струящегося шифона черного цвета. Металлический подвес индивидуален для каждого изделия.\r\nДлина шарфика 140 см. Ширина 35 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-96/75', NULL, 1350, NULL, 550, '2017-10-02 16:01:24', '2017-10-02 16:01:24', NULL, 0, 1, '', '', '', '', '', ''),
(1136, 0, 10, 0, 'dvustoronnij_sharf_homut_s_podveskoj', 'Двусторонний шарф-хомут с подвеской', NULL, 9, 'Двусторонний шарф-хомут выполнен из невесомого шифона темно-синего цвета. Металлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 67 см. Ширина 30 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-96/66', NULL, 1150, NULL, 450, '2017-10-02 16:05:08', '2017-10-02 16:05:08', NULL, 0, 1, '', '', '', '', '', ''),
(1137, 0, 10, 0, 'originalnyj_seryj_sharf_s_podveskoj', 'Оригинальный серый шарф с подвеской', NULL, 9, 'Оригинальный шарф, выполнен из текстильного полотна. Кулон отличается для каждого изделия.\r\nРазмеры шарфика: длина шарфика 200 см, ширина: 50 см.  \r\nКулон: 5 см.\r\nСостав: Вискоза 65%, Полиэстер 35%.', 'ВА-П-91/23', NULL, 1350, NULL, 550, '2017-10-02 16:09:14', '2017-10-02 16:09:14', NULL, 0, 1, '', '', '', '', '', ''),
(1138, 0, 10, 0, 'stilnyj_palantin_s_cvetochnym_printom', 'Стильный палантин с цветочным принтом', NULL, 9, 'Нежнейший палантин с цветочным принтом создан, чтобы дополнить романтичный образ!\r\nРазмер: 150 см х 70 см.\r\nАксессуары в комплект не входят.\r\nСостав: Вискоза 65%, Полиэстер 30%', 'ВА-П-96/56', NULL, 1090, NULL, 420, '2017-10-02 16:26:38', '2017-10-02 16:26:38', NULL, 0, 1, '', '', '', '', '', ''),
(1139, 0, 10, 0, 'romantichnyj_palantin_s_cvetochnym_printom_', 'Романтичный палантин с цветочным принтом,', NULL, 9, 'Нежный романтичный палантин с цветочным принтом, дополнен изящным французским кружевом белого цвета. \r\nРазмер: 150 см х 60 см.\r\nАксессуары в комплект не входят.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-П-96/54', NULL, 1290, NULL, 520, '2017-10-02 16:38:58', '2017-10-02 16:38:58', NULL, 0, 1, '', '', '', '', '', ''),
(1140, 0, 10, 0, 'myagkij_palantin_s_cvetochnym_printom', 'Мягкий палантин с цветочным принтом', NULL, 9, 'Мягкий и нежный палантин дополнен изящным французским кружевом. Цветочный принт в сиреневых тонах  добавит образу романтики.\r\nРазмер: 150 см х 70 см.\r\nАксессуары в комплект не входят.\r\nСостав: Вискоза 65%, Полиэстер 30%', 'ВА-П-96/51', NULL, 1290, NULL, 520, '2017-10-02 16:45:33', '2017-10-02 16:45:33', NULL, 0, 1, '', '', '', '', '', ''),
(1141, 0, 10, 0, 'izyashnyj_sharf_bezhevogo_cveta', 'Изящный шарф бежевого цвета', NULL, 9, 'Изящный шарф выполнен из двух видов текстильного полотна. Такой шарф идеально дополнит любой ваш наряд. Длина: 149 см. Ширина: 28 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-Пл-9/18', NULL, 1250, NULL, 500, '2017-10-02 16:55:28', '2017-10-02 16:55:28', NULL, 0, 1, '', '', '', '', '', ''),
(1142, 0, 10, 0, 'palantin_nezhnogo_persikovogo_cveta', 'Палантин нежного персикового цвета', NULL, 9, 'Палантин из шелкового крепа нежного персикового цвета, украшенный черным кружевом будет к лицу каждой женщине. \r\nШирина 150 см, ширина 62 см.\r\nАксессуары в комплект не входят\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-96/28', NULL, 950, NULL, 350, '2017-10-02 17:02:29', '2017-10-02 17:02:29', NULL, 0, 1, '', '', '', '', '', ''),
(1143, 0, 10, 0, 'zhenstvennyj_platok_rozovogo_cveta', 'Женственный  платок розового цвета', NULL, 9, 'Женственный  платок цвета пыльной розы украшен кружевом и сияющими стразами. Нежный шелк великолепно струится и чудесно ложится складками.\r\nАксессуары в комплект не входят.\r\nРазмер 80 см х 80 см.\r\nСостав: Шелк 100%', 'ВА-П-97/3', NULL, 1210, NULL, 480, '2017-10-02 17:14:19', '2017-10-02 17:14:19', NULL, 0, 1, '', '', '', '', '', ''),
(1144, 0, 10, 0, 'palantin_s_cvetochnym_printom_iz_makov', 'Палантин с цветочным принтом из маков', NULL, 9, 'Яркий и чувственный палантин с цветочным принтом из маков, дополнен изящным французским кружевом красного цвета. \r\nРазмер: 150 см х 60 см.\r\nАксессуары в комплект не входят.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-П-96/52', NULL, 1290, NULL, 520, '2017-10-02 17:19:13', '2017-10-02 17:19:13', NULL, 0, 1, '', '', '', '', '', ''),
(1145, 0, 10, 0, 'palantin_iz_shifona_golubogo_cveta', 'Палантин из  шифона голубого цвета', NULL, 9, 'Палантин выполнен из легкого шифона голубого цвета. \r\nДлина 145 см. Ширина 73 см.\r\nДополните ваш образ романтичным палантином!\r\nСостав: Полиэстер 100%', 'ВА-П-96/69', NULL, 1090, NULL, 420, '2017-10-02 17:26:22', '2017-10-02 17:26:22', NULL, 0, 1, '', '', '', '', '', ''),
(1146, 0, 10, 0, 'stilnyj_palantin_iz_shelkovogo_krepa', 'Стильный палантин из шелкового крепа', NULL, 9, 'Стильный палантин из шелкового крепа, украшенный дорогим кружевом, станет превосходным дополнением к вечернему или коктейльному платью. \r\nРазмер: 160см х 60 см. \r\nЗакрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nСостав: Полиэстер 100%', 'ВА-П-96/61', NULL, 1290, NULL, 520, '2017-10-02 17:39:35', '2017-10-02 17:39:35', NULL, 0, 1, '', '', '', '', '', ''),
(1147, 0, 10, 0, 'stilnyj_sharf_temno_sinego_cveta', 'Стильный шарф темно-синего цвета', NULL, 9, 'Стильный шарфик выполнен из шифонового полотна темно-синего цвета и украшен французским кружевом.\r\nРазмер: 150*60 см.\r\nДополните свой образ интересным шарфом!\r\nСостав: Полиэстер 100%', 'ВА-П-96/37', NULL, 1290, NULL, 520, '2017-10-02 17:43:55', '2017-10-02 17:43:55', NULL, 0, 1, '', '', '', '', '', ''),
(1148, 0, 10, 0, 'izyashnyj_sharf_yarko_rozovogo_cveta', 'Изящный шарф ярко-розового цвета', NULL, 9, 'Изящный шарф выполнен из текстильного полотна ярко-розового цвета. \r\nРазмер: 150 * 60 см.\r\nСостав: Вискоза 65%, Полиэстер 35%', 'ВА-П-94/10', NULL, 750, NULL, 250, '2017-10-02 17:48:28', '2017-10-02 17:48:28', NULL, 0, 1, '', '', '', '', '', ''),
(1149, 0, 10, 0, 'palantin_iz_myagkogo_i_plotnogo_trikotazha', 'Палантин из мягкого и плотного трикотажа', NULL, 9, 'Палантин из мягкого и плотного трикотажного полотна. Благородный синий цвет с белой кружевной отделкой сделает Ваш образ уютным и изысканным. \r\nАксессуары в комплект не входят.\r\nДлина 148 см. Ширина 60 см.\r\nСостав:Вискоза 30%, Полиэстер 70%', 'ВА-П-97/82', NULL, 1350, NULL, 550, '2017-10-02 17:54:38', '2017-10-02 17:54:38', NULL, 0, 1, '', '', '', '', '', ''),
(1150, 0, 10, 0, 'originalnyj_sharf_iz_tekstilnogo_polotna', 'Оригинальный шарф из текстильного полотна', NULL, 9, 'Оригинальный шарф, выполнен из текстильного полотна.  Размеры шарфика: длина шарфика 200 см, ширина: 50 см.  Кулон,: 5 см.\r\nСостав: Вискоза 65%, Полиэстер 35%', 'ВА-П-91/16', NULL, 1350, NULL, 550, '2017-10-02 18:00:45', '2017-10-02 18:00:45', NULL, 0, 1, '', '', '', '', '', ''),
(1151, 0, 10, 0, 'originalnyj_sharf_bezhevogo_cveta', 'Оригинальный шарф бежевого цвета', NULL, 9, 'Оригинальный шарф, выполнен из текстильного полотна.  Размеры шарфика: длина шарфика 200 см, ширина: 50 см.  Кулон,: 5 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-96/10', NULL, 1350, NULL, 550, '2017-10-02 18:06:47', '2017-10-02 18:06:47', NULL, 0, 1, '', '', '', '', '', ''),
(1152, 0, 10, 0, 'originalnyj_sharf_rozovogo_cveta', 'Оригинальный шарф розового цвета', NULL, 9, 'Оригинальный шарф, выполнен из текстильного полотна.  Размеры шарфика: длина шарфика 200 см, ширина: 50 см.  Кулон,: 5 см.\r\nСостав: Вискоза 65%, Полиэстер 35%', 'ВА-П-93/5', NULL, 1350, NULL, 550, '2017-10-02 18:11:22', '2017-10-02 18:11:22', NULL, 0, 1, '', '', '', '', '', ''),
