(1156, 0, 10, 0, 'originalnyj_sharf_yarkih_ottenkov', 'Оригинальный шарф ярких оттенков', NULL, 9, 'Оригинальный шарф, выполнен из текстильного полотна.  Размеры шарфика: длина шарфика 200 см, ширина: 50 см.  Кулон,: 5 см.\r\nСостав: Вискоза 65%, Полиэстер 35%', 'ВА-П-93/4', NULL, 1350, NULL, 550, '2017-10-02 18:30:47', '2017-10-02 18:30:47', NULL, 0, 1, '', '', '', '', '', ''),
(1157, 0, 10, 0, 'originalnyj_chernyj_sharf_s_elementami_bizhuterii', 'Оригинальный черный шарф с элементами бижутерии', NULL, 9, 'Оригинальный шарф с элементами бижутерии, выполнен из текстильного полотна. Бижутерная вставка отличается для каждого изделия.\r\nРазмеры шарфика: длина шарфика: 200 см, ширина 50 см,  длина бижутерии: 20 см.\r\nСостав: Вискоза 65%, Полиэстер 35%.', 'ВА-П-92/39', NULL, 1350, NULL, 550, '2017-10-02 18:55:19', '2017-10-02 18:55:19', NULL, 0, 1, '', '', '', '', '', ''),
(1158, 0, 10, 0, 'originalnyj_cherno_seryj_sharf_s_elementami_bizhuterii', 'Оригинальный черно-серый шарф с элементами бижутерии', NULL, 9, 'Оригинальный шарф с элементами бижутерии, выполнен из текстильного полотна. Бижутерная вставка отличается для каждого изделия.\r\nРазмеры шарфика: длина шарфика: 200 см, длина бижутерии: 20 см.\r\nСостав: Вискоза 65%, Полиэстер 35%.', 'ВА-П-91/48', NULL, 1350, NULL, 550, '2017-10-02 18:58:46', '2017-10-02 18:58:46', NULL, 0, 1, '', '', '', '', '', ''),
(1159, 0, 10, 0, 'originalnyj_sharf_v_sinih_tonah_s_kulonom', 'Оригинальный шарф в синих тонах с кулоном', NULL, 9, 'Оригинальный шарф, выполнен из текстильного полотна. \r\nРазмеры шарфика: Длина шарфика 55 см. Кулон- брошь: 5 см.\r\nСостав: Вискоза 65%, Полиэстер 35%.', 'ВА-П-93/19', NULL, 1350, NULL, 550, '2017-10-02 19:07:02', '2017-10-02 19:07:02', NULL, 0, 1, '', '', '', '', '', ''),
(1160, 0, 10, 0, 'dvustoronnij_sharf_s_kruzhevnym_printom_i_kulonom', 'Двусторонний шарф с кружевным принтом и кулоном', NULL, 9, 'Двусторонний шарф - кулон выполнен из нежного шифона бежевого цвета. Принт в виде изящного кружева и классического гороха. \r\nМеталлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см см. Ширина 38 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-96/95', NULL, 1350, NULL, 550, '2017-10-02 19:12:43', '2017-10-02 19:12:43', NULL, 0, 1, '', '', '', '', '', ''),
(1161, 0, 10, 0, 'originalnyj_sharf_homut_s_elementami_bizhuterii', 'Оригинальный шарф-хомут с элементами бижутерии', NULL, 9, 'Оригинальный шарф-хомут с элементами бижутерии, выполнен из текстильного полотна. \r\nРазмеры: \r\nдлина шарфика 200 см, \r\nдлина бижутерии 20 см.\r\nСостав: Вискоза 65%, Полиэстер 35%.', 'ВА-П-93/35', NULL, 1350, NULL, 550, '2017-10-02 19:25:18', '2017-10-02 19:25:18', NULL, 0, 1, '', '', '', '', '', ''),
(1162, 0, 10, 0, 'originalnyj_sharf_pod_leoparda_s_elementami_bizhuterii', 'Оригинальный шарф  "под леопарда" с элементами бижутерии', NULL, 9, 'Любимый многими звериный принт. Бижутерная вставка индивидуальна для каждого изделия.\r\nДлина 160 см - 170 см. Ширина 90 см. Длина украшения 15 см- 30 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-96/88', NULL, 1350, NULL, 550, '2017-10-02 19:30:34', '2017-10-02 19:30:34', NULL, 0, 1, '', '', '', '', '', ''),
(1163, 0, 10, 0, 'originalnyj_sharf_s_elementami_bizhuterii_v_goroshek', 'Оригинальный шарф с элементами бижутерии в горошек', NULL, 9, 'Классический горошек на фоне, переходящем от коричневого в молочный.\r\nБижутерная вставка индивидуальна для каждого изделия.\r\nДлина 160 см - 170 см. Ширина 90 см. Длина украшения 15 см- 30 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-96/90', NULL, 1350, NULL, 550, '2017-10-02 19:35:23', '2017-10-02 19:35:23', NULL, 0, 1, '', '', '', '', '', ''),
(1164, 0, 10, 0, 'originalnyj_biryuzovo_bezhevyj_sharf_s_elementami_bizhuterii', 'Оригинальный бирюзово-бежевый шарф с элементами бижутерии', NULL, 9, 'Широкий шарф - кулон выполнен из легкой набивной ткани и украшен бижутерной вставкой. Любимый всеми "огуречный" принт бирюзового цвета на бежевом фоне. Украшение индивидуально для каждого изделия.\r\nДлина шарфика 190 см. Ширина 90 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%.', 'ВА-П-97/37', NULL, 1350, NULL, 550, '2017-10-02 19:39:22', '2017-10-02 19:39:22', NULL, 0, 1, '', '', '', '', '', ''),
(1165, 0, 10, 0, 'sharf_v_nezhnuyu_korallovo_sero_bordovuyu_polosku', 'Шарф в нежную кораллово-серо-бордовую полоску', NULL, 9, 'Сочетание нежного кораллового цвета с темными серыми и бордовыми полосами сделает этот шарф Вашим любимым аксессуаром. Бижутерная вставка индивидуальна для каждого изделия.\r\nДлина 160 см - 170 см. Ширина 90 см. Длина украшения 15 см- 30 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-96/93', NULL, 1350, NULL, 550, '2017-10-02 19:43:57', '2017-10-02 19:43:57', NULL, 0, 1, '', '', '', '', '', ''),
(1166, 0, 10, 0, 'sharf_v_persikovyh_tonah_s_bizhuternoj_vstavkoj', 'Шарф в персиковых тонах с бижутерной вставкой', NULL, 9, 'Модный аксессуар  персикового цвета придаст шарма Вашему весеннему образу.\r\nБижутерная вставка индивидуальна для каждого изделия.\r\nДлина 160 см - 170 см. Ширина 90 см. Длина украшения 15 см- 30 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-96/85', NULL, 1350, NULL, 550, '2017-10-02 19:49:05', '2017-10-02 19:49:05', NULL, 0, 1, '', '', '', '', '', ''),
(1167, 0, 10, 0, 'dvustoronnij_sharf_kulon_bezhevogo_cveta', 'Двусторонний шарф - кулон бежевого цвета', NULL, 9, 'Двусторонний шарф - кулон выполнен из легкого прозрачного шифона бежевого цвета. Цветочный принт в пастельных тонах.\r\nМеталлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см см. Ширина 38 см.\r\nСостав: Вискоза 30%, Полиэстер 70%.', 'ВА-П-96/96', NULL, 1350, NULL, 550, '2017-10-02 19:54:48', '2017-10-02 19:54:48', NULL, 0, 1, '', '', '', '', '', ''),
(1168, 0, 10, 0, 'sharf_s_populyarnym_printom_burberry_i_podveskoj', 'Щарф с популярным принтом Burberry и подвеской', NULL, 9, 'Брендовый шарф выполнен из невесомого шифона бежевого цвета с популярным принтом Burberry. Клетка в сочетании с жатым шифоном молочного цвета освежит любой образ. Подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 140 см. Ширина 30 см. Кулон 9 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-97/17', NULL, 1350, NULL, 550, '2017-10-02 19:58:53', '2017-10-02 19:58:53', NULL, 0, 1, '', '', '', '', '', ''),
(1169, 0, 10, 0, 'dvustoronnij_sharf_kulon_molochnogo_cveta_s_kruzhevom', 'Двусторонний шарф - кулон молочного цвета с кружевом', NULL, 9, 'Оригинальный двусторонний шарф - кулон  выполнен из струящегося шифона молочного цвета. Отделка - французское кружево черного цвета. Металлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см. Ширина 30 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-97/64', NULL, 1350, NULL, 550, '2017-10-02 20:04:13', '2017-10-02 20:04:13', NULL, 0, 1, '', '', '', '', '', '');
