(1170, 0, 10, 0, 'sharf_kulon_s_printom_v_vide_kotyat', 'Шарф-кулон с принтом в виде котят', NULL, 9, 'Шарф-кулон с милым принтом в виде котят поднимет настроение Вам и окружающим. Нежный шифон великолепно струится и чудесно ложится складками. Металлический кулон индивидуален для каждого изделия.\r\nДлина 70 см. Ширина 30 см.\r\nСостав; Полиэстер 100%.', 'ВА-П-97/83', NULL, 1350, NULL, 550, '2017-10-02 20:09:09', '2017-10-02 20:09:09', NULL, 0, 1, '', '', '', '', '', ''),
(1171, 0, 10, 0, 'dvustoronnij_sharf_kulon_s_rozami_v_stile_pastel_', 'Двусторонний шарф - кулон с розами в стиле пастель.', NULL, 9, 'Двусторонний шарф - кулон  выполнен из струящегося шифона молочного цвета с живописными розами в стиле пастель. Металлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см. Ширина 30 см.\r\nСостав: Полиэстер 100%.\r\n', 'ВА-П-97/61', NULL, 1350, NULL, 550, '2017-10-02 20:13:15', '2017-10-02 20:13:15', NULL, 0, 1, '', '', '', '', '', ''),
(1172, 0, 10, 0, 'elegantnyj_dvustoronnij_sharf_kulon_salatovogo_cveta', 'Элегантный двусторонний шарф - кулон салатового цвета', NULL, 9, 'Элегантный воздушный двусторонний шарф - кулон  выполнен из струящегося шифона нежного салатового цвета с цветочным принтом. Металлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см. Ширина 30 см.\r\nСостав: Полиэстер 100%.', 'ВА-П-97/76', NULL, 1350, NULL, 550, '2017-10-02 20:21:11', '2017-10-02 20:21:11', NULL, 0, 1, '', '', '', '', '', ''),
(1173, 0, 10, 0, 'shirokij_bordovyj_sharf_kulon', 'Широкий бордовый шарф - кулон', NULL, 9, 'Широкий шарф - кулон выполнен из легкой набивной ткани и украшен бижутерной вставкой. Любимый всеми горошек светлого розового цвета на бордовом фоне. Украшение индивидуально для каждого изделия.\r\nДлина шарфика 190 см. Ширина 90 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%.', 'Ва-П-97/38', NULL, 1350, NULL, 550, '2017-10-02 20:26:42', '2017-10-02 20:26:42', NULL, 0, 1, '', '', '', '', '', ''),
(1174, 0, 10, 0, 'shirokij_sharf_s_bizhuternoj_vstavkoj_v_temnyh_krasnyh_tonah', 'Широкий шарф с бижутерной вставкой в темных красных тонах', NULL, 9, 'Широкий шарф выполнен из легкой набивной ткани и украшен бижутерной вставкой. Абстрактный рисунок в темных красных тонах. Украшение индивидуально для каждого изделия.\r\nДлина шарфика 190 см. Ширина 90 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%.', 'ВА-П-97/30', NULL, 1350, NULL, 550, '2017-10-02 20:29:52', '2017-10-02 20:29:52', NULL, 0, 1, '', '', '', '', '', ''),
(1175, 0, 10, 0, 'elegantnyj_bordovyj_dvustoronnij_sharf_kulon_', 'Элегантный бордовый двусторонний шарф - кулон', NULL, 9, 'Элегантный воздушный двусторонний шарф - кулон  выполнен из струящегося шифона бордового цвета с цветочным принтом. Металлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см. Ширина 30 см.\r\nСостав: Полиэстер 100%', 'ВА-П-97/74', NULL, 1350, NULL, 550, '2017-10-02 20:34:26', '2017-10-02 20:34:26', NULL, 0, 1, '', '', '', '', '', ''),
(1176, 0, 10, 0, 'shirokij_sharf_kulon_v_bordovo_gorchichnyh_tonah', 'Широкий шарф - кулон в бордово-горчичных тонах', NULL, 9, 'Широкий шарф - кулон выполнен из легкой набивной ткани и украшен бижутерной вставкой. Абстрактный рисунок в бордовых и горчичных цветах. Украшение индивидуально для каждого изделия.\r\nДлина шарфика 190 см. Ширина 90 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%.', 'ВА-П-97/33', NULL, 1350, NULL, 550, '2017-10-02 20:38:15', '2017-10-02 20:39:45', NULL, 0, 1, '', '', '', '', '', ''),
(1177, 0, 10, 0, 'shirokij_sharf_kulon_s_abstraktnym_risunkom', 'Широкий шарф - кулон с абстрактным рисунком', NULL, 9, 'Широкий шарф - кулон выполнен из легкой набивной ткани и украшен бижутерной вставкой. Абстрактный рисунок в вишневых, синих, зеленых и бежевых цветах. Украшение индивидуально для каждого изделия.\r\nДлина шарфика 190 см. Ширина 90 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%.', 'ВА-П-97/35', NULL, 1350, NULL, 550, '2017-10-02 20:44:33', '2017-10-02 20:44:33', NULL, 0, 1, '', '', '', '', '', ''),
(1178, 0, 10, 0, 'izyskannyj_sharf_s_ogurechnym_printom', 'Изысканный шарф  с огуречным принтом', NULL, 9, 'Изысканный шарф - кулон выполнен из легкого прозрачного шифона. \r\nПопулярный " огуречный" принт в темных красных и синих тонах. Нежная ткань великолепно струится и чудесно ложится складками. \r\nМеталлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см см. Ширина 30 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-97/71', NULL, 1350, NULL, 550, '2017-10-03 10:19:23', '2017-10-03 10:19:23', NULL, 0, 1, '', '', '', '', '', ''),
(1179, 0, 10, 0, 'shirokij_sharf_ukrashenyj_bizhuternoj_vstavkoj', 'Широкий шарф украшеный бижутерной вставкой', NULL, 9, 'Широкий шарф - кулон выполнен из легкой набивной ткани и украшен бижутерной вставкой. Абстрактный рисунок. Черный, белый, красный и зеленый цвета. Украшение индивидуально для каждого изделия.\r\nДлина шарфика 190 см. Ширина 90 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%', 'ВА-П-97/32', NULL, 1350, NULL, 550, '2017-10-03 10:28:49', '2017-10-03 10:28:49', NULL, 0, 1, '', '', '', '', '', ''),
(1180, 0, 10, 0, 'shirokij_sharf_kulon_iz_legkoj_tkani', 'Широкий шарф - кулон  из легкой ткани', NULL, 9, 'Широкий шарф - кулон выполнен из легкой набивной ткани и украшен бижутерной вставкой. Абстрактный рисунок в вишневых, синих, горчичных и бежевых цветах. Украшение индивидуально для каждого изделия.\r\nДлина шарфика 190 см. Ширина 90 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%', 'ВА-П-97/34', NULL, 1350, NULL, 550, '2017-10-03 10:33:58', '2017-10-03 10:33:58', NULL, 0, 1, '', '', '', '', '', ''),
(1181, 0, 10, 0, 'shirokij_sharf_kulon_iz_legkoj_tkani', 'Широкий шарф - кулон  из легкой ткани', NULL, 9, 'Широкий шарф - кулон выполнен из легкой набивной ткани и украшен бижутерной вставкой. Абстрактный рисунок в вишневых, синих, горчичных и бежевых цветах. Украшение индивидуально для каждого изделия.\r\nДлина шарфика 190 см. Ширина 90 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%', 'ВА-П-97/34', NULL, 1350, NULL, 550, '2017-10-03 10:33:59', '2017-10-03 10:33:59', NULL, 0, 1, '', '', '', '', '', ''),
(1182, 0, 10, 0, 'dvustoronnij_sharf_iz_yarkogo_shifona', 'Двусторонний шарф из яркого шифона', NULL, 9, 'Двусторонний шарф - кулон  выполнен из струящегося шифона. Сложный принт и цвет переходит от бирюзового через желто - зеленый в горчичный. Универсальная расветка подойдет ко многим Вашим образам. \r\nМеталлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см см. Ширина 30 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-97/70', NULL, 1350, NULL, 550, '2017-10-03 10:38:22', '2017-10-03 10:38:22', NULL, 0, 1, '', '', '', '', '', ''),
(1183, 0, 10, 0, 'nezhnyj_sharf_iz_shifon_zheltogo_cveta', 'Нежный шарф из шифон желтого цвета', NULL, 9, 'С этим ярким желтым шарфом лето будет с Вами всегда! Нежный шифон великолепно струится и чудесно ложится складками. Легкий шарфик летом можно надеть с футболкой и джинсами.\r\nМеталлический кулон индивидуален для каждого изделия.\r\nДлина 70 см. Ширина 36 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-96/99', NULL, 1350, NULL, 550, '2017-10-03 10:45:13', '2017-10-03 10:45:13', NULL, 0, 1, '', '', '', '', '', ''),
(1184, 0, 10, 0, 'shirokij_sharf_cveta_morskoj_volny', 'Широкий шарф цвета морской волны', NULL, 9, 'Широкий шарф - кулон выполнен из легкой набивной ткани и украшен бижутерной вставкой. Рисунок в виде слоников на насыщенном цвета морской волны фоне. Украшение индивидуально для каждого изделия.\r\nДлина шарфика 190 см. Ширина 90 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%', 'ВА-П-97/36', NULL, 1350, NULL, 550, '2017-10-03 10:53:37', '2017-10-03 10:53:37', NULL, 0, 1, '', '', '', '', '', ''),
(1185, 0, 10, 0, 'originalnyj_sharf_s_elementami_bizhuterii', 'Оригинальный шарф с элементами бижутерии', NULL, 9, 'Оригинальный шарф с элементами бижутерии, выполнен из текстильного полотна. Бижутерная вставка отличается для каждого изделия.\r\nРазмеры шарфика: длина шарфика: 200 см, ширина 90 см, длина бижутерии: 20 см.\r\nСостав: Вискоза 65%, Полиэстер 35%', 'ВА-П-92/50', NULL, 1350, NULL, 550, '2017-10-03 10:57:04', '2017-10-03 10:57:04', NULL, 0, 1, '', '', '', '', '', ''),
(1186, 0, 10, 0, 'legkij_sharf_svetlogo_serogo_cveta', 'Легкий шарф светлого серого цвета', NULL, 9, 'Легкий шарф светлого серого цвета легко впишется в любой образ.\r\nЭлементы бижутерии различны для каждого изделия\r\nДлина 160 см-170 см. Ширина 90 см. Длина украшения 15 см - 30 см.\r\nСостав: Полиэстер 100%', 'ВА-П-96/77', NULL, 1350, NULL, 550, '2017-10-03 11:01:54', '2017-10-03 11:01:54', NULL, 0, 1, '', '', '', '', '', ''),
(1187, 0, 10, 0, 'sharf_s_cvetochnym_printom_v_zelenyh_ottenkah', 'Шарф с цветочным принтом в зеленых оттенках', NULL, 9, 'Дивный воздушный двусторонний шарф - кулон  выполнен из струящегося шифона с цветочным принтом в зеленых оттенках.\r\nМеталлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см. Ширина 30 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-97/77', NULL, 1350, NULL, 550, '2017-10-03 11:06:53', '2017-10-03 11:06:53', NULL, 0, 1, '', '', '', '', '', ''),
(1188, 0, 10, 0, 'klassicheskij_vozdushnyj_dvustoronnij_sharf', 'Классический воздушный двусторонний шарф', NULL, 9, 'Классический воздушный двусторонний шарф - кулон  выполнен из струящегося шифона со сложным орнаментом в бежевых и черных тонах.\r\nМеталлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см. Ширина 30 см.\r\nСостав: Полиэстер 100%', 'ВА-П-97/79', NULL, 1350, NULL, 550, '2017-10-03 11:11:14', '2017-10-03 11:11:14', NULL, 0, 1, '', '', '', '', '', ''),
(1189, 0, 10, 0, 'sharf_kulon_serogo_cveta_', 'Шарф - кулон серого цвета', NULL, 9, 'Шарф - кулон серого цвета выполнен из легкой  ткани , украшен бижутерной вставкой молочного цвета. Необработанный край создает эффект короткой бахромы.\r\nДлина шарфика 180 см. Ширина 40 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%', 'ВА-П-97/42', NULL, 1410, NULL, 580, '2017-10-03 11:15:25', '2017-10-03 11:15:25', NULL, 0, 1, '', '', '', '', '', ''),
(1190, 0, 10, 0, 'udlinennye_sergi_v_vide_rubinovoj_kapli_', 'Удлиненные серьги в виде рубиновой капли', NULL, 9, 'Удлиненные серьги в виде капли рубинового цвета украшены бахромой из цепочек черного цвета.\r\nДлина 7 см. Размер кристалла 2 см х 1,7 см.\r\nСостав: Металл, стразы.', 'ВА-С-322/2', NULL, 750, NULL, 250, '2017-10-03 11:21:00', '2017-10-03 11:21:00', NULL, 0, 1, '', '', '', '', '', ''),
(1191, 0, 10, 0, 'seryj_sharf_ukrashenyj_bizhuternoj_vstavkoj_', 'Серый шарф украшеный бижутерной вставкой', NULL, 9, 'Серый шарф - кулон выполнен из легкой  ткани с едва заметными поблескивающими пайетками, украшен бижутерной вставкой молочного цвета. Необработанный край создает эффект короткой бахромы.\r\nДлина шарфика 180 см. Ширина 40 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%', 'ВА-П-97/39', NULL, 1410, NULL, 580, '2017-10-03 11:35:07', '2017-10-03 11:35:07', NULL, 0, 1, '', '', '', '', '', ''),
(1192, 0, 10, 0, 'udlinennye_sergi_serebristogo_cveta_s_krasnym_strazom', 'Удлиненные серьги серебристого цвета с красным стразом', NULL, 9, 'Удлиненные серьги в виде капли красного цвета украшены бахромой из цепочек серебристого цвета.\r\nДлина 7 см. Размер кристалла 2 см х 1,7 см.\r\nСостав: Металл, стразы. ', 'ВА-С-322/1', NULL, 870, NULL, 310, '2017-10-03 11:39:44', '2017-10-03 11:39:44', NULL, 0, 1, '', '', '', '', '', ''),
(1193, 0, 10, 0, 'bezhevyj_sharf_kulon_iz_legkoj_tkani_', 'Бежевый шарф - кулон из легкой  ткани', NULL, 9, 'Бежевый шарф - кулон выполнен из легкой  ткани с едва заметными поблескивающими пайетками, украшен бижутерной вставкой молочного цвета. Необработанный край создает эффект короткой бахромы.\r\nДлина шарфика 180 см. Ширина 40 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%', 'ВА-П-97/40', NULL, 1410, NULL, 580, '2017-10-03 11:40:16', '2017-10-03 11:40:16', NULL, 0, 1, '', '', '', '', '', ''),
(1194, 0, 10, 0, 'udlinennye_sergi_v_vide_kapli_sinego_cveta', 'Удлиненные серьги в виде капли синего цвета', NULL, 9, 'Удлиненные серьги в виде капли кобальтово - синего цвета украшены бахромой из цепочек.\r\nДлина 7 см. Размер кристалла 2 см х 1,7 см.\r\nСостав: Металл, стразы.', 'ВА-С-322/9', NULL, 870, NULL, 310, '2017-10-03 11:44:17', '2017-10-03 11:44:17', NULL, 0, 1, '', '', '', '', '', ''),
(1195, 0, 10, 0, 'sharf_kulon_biryuzovo_zelenogo_cveta', 'Шарф- кулон бирюзово - зеленого цвета', NULL, 9, 'Шарф - кулон бирюзово - зеленого цвета выполнен из легкой  ткани с едва заметными поблескивающими пайетками, украшен бижутерной вставкой молочного цвета. Необработанный край создает эффект короткой бахромы.\r\nДлина шарфика 180 см. Ширина 40 см. Бижутерная вставка 20 см.\r\nСостав: Вискоза 30%, Полиэстер 70%', 'ВА-П-97/41', NULL, 1410, NULL, 580, '2017-10-03 11:45:57', '2017-10-03 11:45:57', NULL, 0, 1, '', '', '', '', '', ''),
(1196, 0, 10, 0, 'dlinnye_serezhki_s_bahromoj_iz_chernyh_shelkovyh_nitej', 'Длинные сережки с бахромой из черных шелковых нитей', NULL, 9, 'Благодаря серьгам - кисточкам ваша шея станет лебединой!\r\nДлинные сережки - кисточки с бахромой из шелковых нитей к подчеркнут стройность шеи. Черные сережки - кисточки немного колышутся при ходьбе, привлекая взгляды к их владелице.\r\nКрепление и дужка из металла золотого цвета. Кристалл черного цвета.\r\nДлина 11 см.\r\nСостав: Металл, текстиль, страз.', 'ВА-С-333/85', NULL, 730, NULL, 240, '2017-10-03 11:50:51', '2017-10-03 11:50:51', NULL, 0, 1, '', '', '', '', '', ''),
(1197, 0, 10, 0, 'dvustoronnij_sharf_s_metallicheskoj_podveskoj', 'Двусторонний шарф с металлической подвеской', NULL, 9, 'Сдержанный воздушный двусторонний шарф - кулон  выполнен из струящегося шифона со стилизованным орнаментом.\r\nМеталлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см. Ширина 30 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-97/78', NULL, 1350, NULL, 550, '2017-10-03 11:50:58', '2017-11-23 15:43:30', NULL, 0, 1, '', '', '', '', '', ''),
(1198, 0, 10, 0, 'dlinnye_zelenye_serezhki_s_bahromoj_iz_shelkovyh_nitej_', 'Длинные зеленые сережки с бахромой из шелковых нитей', NULL, 9, 'Благодаря серьгам - кисточкам ваша шея станет лебединой!\r\nДлинные сережки - кисточки с бахромой из шелковых нитей к подчеркнут стройность шеи. Изумрудные сережки - кисточки немного колышутся при ходьбе, привлекая взгляды к их владелице.\r\nКрепление и дужка из металла золотого цвета. Кристалл изумрудного цвета.\r\nДлина 11 см.\r\nСостав: Металл, текстиль, страз.\r\n', 'ВА-С-333/84', NULL, 730, NULL, 240, '2017-10-03 11:54:51', '2017-10-03 11:54:51', NULL, 0, 1, '', '', '', '', '', ''),
(1199, 0, 10, 0, 'sharf_bezhevogo_cveta_s_korallovymi_pyatnami', 'Шарф бежевого цвета с коралловыми  пятнами', NULL, 9, 'Эффектно дополнит Ваш образ шарф бежевого цвета с коралловыми  пятнами.\r\nБижутерная вставка индивидуальна для каждого изделия. \r\nДлина 160 см - 170 см. Ширина 90 см. Длина украшения 15 см- 30 см.\r\nСостав: Полиэстер 100%', 'ВА-П-96/80', NULL, 1350, NULL, 550, '2017-10-03 11:56:31', '2017-10-03 11:56:31', NULL, 0, 1, '', '', '', '', '', ''),
(1200, 0, 10, 0, 'dlinnye_serezhki_kistochki_iz_sinih_shelkovyh_nitej', 'Длинные сережки - кисточки из синих шелковых нитей', NULL, 9, 'Благодаря серьгам - кисточкам ваша шея станет лебединой!\r\nДлинные сережки - кисточки с бахромой из шелковых нитей к подчеркнут стройность шеи. Темные синие сережки - кисточки немного колышутся при ходьбе, привлекая взгляды к их владелице.\r\nКрепление и дужка из металла золотого цвета. Украшены стразами.\r\nДлина кисточки 6,5 см.\r\nСостав: Металл, текстиль,стразы.', 'ВА-С-333/86', NULL, 730, NULL, 240, '2017-10-03 11:58:58', '2017-10-03 11:58:58', NULL, 0, 1, '', '', '', '', '', ''),
(1201, 0, 10, 0, 'sharf_sochetanie_bezhevogo_cveta_s_korallovym_', 'Шарф сочетание бежевого цвета с коралловым.', NULL, 9, 'Популярное сочетание бежевого цвета с коралловым.\r\nБижутерная вставка индивидуальна для каждого изделия. \r\nДлина 160 см - 170 см. Ширина 90 см. Длина украшения 15 см- 30 см.\r\nСостав: Полиэстер 100%', 'ВА-П-96/81', NULL, 1350, NULL, 550, '2017-10-03 12:01:37', '2017-10-03 12:01:37', NULL, 0, 1, '', '', '', '', '', ''),
(1202, 0, 10, 0, 'sergi_gvozdiki_s_emalyu_i_cvetnymi_strazami', 'Серьги - гвоздики с эмалью и цветными стразами', NULL, 9, 'Оригинальные серьги - гвоздики из металла золотого цвета. Подвески в виде полосок украшены черной эмалью. Крепление сверкает прозрачными и цветными стразинками.\r\nМеталл - бижутерный сплав, не содержащий никель. \r\nРазмер 3,5 см х 2 см.\r\nСостав: Металл, эмаль,стразы.', 'ВА-С-333/11', NULL, 530, NULL, 140, '2017-10-03 12:06:39', '2017-10-03 12:06:39', NULL, 0, 1, '', '', '', '', '', ''),
(1203, 0, 10, 0, 'originalnyj_sharf_s_elementami_bizhuteriii', 'Оригинальный шарф с элементами бижутерии', NULL, 9, 'Оригинальный шарф с элементами бижутерии, выполнен из текстильного полотна. Размеры шарфика: длина шарфика: 200 см, длина бижутерии: 20 см.\r\nСостав: Вискоза 65%, Полиэстер 35%', 'ВА-П-94/38', NULL, 1350, NULL, 550, '2017-10-03 12:09:24', '2017-10-03 12:09:24', NULL, 0, 1, '', '', '', '', '', ''),
(1204, 0, 10, 0, 'sergi_gvozdiki_s_emalyu_i_strazami', 'Серьги - гвоздики с эмалью и стразами', NULL, 9, 'Оригинальные серьги - гвоздики из металла золотого цвета. Подвески в виде полосок украшены черной эмалью. Крепление сверкает прозрачными стразинками.\r\nМеталл - бижутерный сплав, не содержащий никель. \r\nРазмер 3,5 см х 2 см.\r\nСостав: Металл, эмаль,стразы.', 'ВА-С-333/12', NULL, 530, NULL, 140, '2017-10-03 12:10:55', '2017-10-03 12:10:55', NULL, 0, 1, '', '', '', '', '', ''),
(1205, 0, 10, 0, 'sharf_rozovogo_cveta_s_printom_burberry_', 'Шарф розового цвета с принтом Burberry.', NULL, 9, 'Брендовый шарф выполнен из невесомого шифона розового цвета с популярным принтом Burberry. \r\nМеталлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 146 см. Ширина 30 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-96/76', NULL, 1350, NULL, 550, '2017-10-03 12:21:02', '2017-10-03 12:21:02', NULL, 0, 1, '', '', '', '', '', ''),
(1206, 0, 10, 0, 'sharf_rozovogo_cveta_s_cvetochnym_printom', 'Шарф розового цвета с цветочным принтом', NULL, 9, 'Нежный воздушный двусторонний шарф - кулон  выполнен из струящегося шифона розового цвета с цветочным принтом в пастельных тонах.\r\nМеталлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см. Ширина 30 см.\r\nСостав: Полиэстер 100%', 'ВА-П-97/63', NULL, 1350, NULL, 550, '2017-10-03 12:25:30', '2017-10-03 12:25:30', NULL, 0, 1, '', '', '', '', '', ''),
(1207, 0, 10, 0, 'modnyj_yarkij_rozovyj_sharf', 'Модный яркий розовый шарф', NULL, 9, 'Подчеркнет вашу романтичность и женственность яркий розовый шарф.\r\nБижутерная вставка индивидуальна для каждого изделия.\r\nДлина 160 см - 170 см. Ширина 90 см. Длина украшения 15 см- 30 см.\r\nСостав: Полиэстер 100%', 'ВА-П-96/91', NULL, 1350, NULL, 550, '2017-10-03 12:29:34', '2017-10-03 12:29:34', NULL, 0, 1, '', '', '', '', '', ''),
(1208, 0, 10, 0, 'elegantnye_ovalnye_sergi_s_prozrachnymi_strazami', 'Элегантные овальные серьги с прозрачными стразами', NULL, 9, 'Элегантные золотистые серьги, украшенные прозрачными стразами. Длина: 2 см.\r\nСостав: Пластик, металл, стразы.', 'ВА-С-35/3', NULL, 650, NULL, 200, '2017-10-03 12:30:44', '2017-10-03 12:30:44', NULL, 0, 1, '', '', '', '', '', ''),
(1209, 0, 10, 0, 'effektnye_sergi_v_vide_cvetochkov_s_emalyu', 'Эффектные серьги в виде цветочков с эмалью', NULL, 9, 'Эффектные серьги в виде цветочков выполнены из металла золотого цвета. \r\nУкрашены черной эмалью и сверкающими стразинками.\r\nМеталл - бижутерный сплав, не содержащий никель. \r\nРазмер 2,5 см х 2,5 см.\r\nСостав: Металл, эмаль,стразы.', 'ВА-С-333/10', NULL, 530, NULL, 140, '2017-10-03 12:34:23', '2017-10-03 12:34:23', NULL, 0, 1, '', '', '', '', '', ''),
(1210, 0, 10, 0, 'rozovyj_sharf_s_elementami_bizhuterii', 'Розовый шарф с элементами бижутерии', NULL, 9, 'Оригинальный шарф с элементами бижутерии, выполнен из текстильного полотна. Размеры шарфика: длина шарфика: 200 см, длина бижутерии: 20 см.\r\nСостав: Вискоза 65%, Полиэстер 35%', 'ВА-П-91/66', NULL, 1350, NULL, 550, '2017-10-03 12:39:58', '2017-10-03 12:39:58', NULL, 0, 1, '', '', '', '', '', ''),
(1211, 0, 10, 0, 'elegantnye_sergi_geometricheskoj_formy_so_strazami', 'Элегантные серьги геометрической формы со стразами', NULL, 9, 'Элегантные серьги интересной геометрической формы, украшенные стразами. Длина: 2 см.\r\nСостав; Пластик, металл,стразы.', 'ВА-С-35/4', NULL, 670, NULL, 210, '2017-10-03 12:40:12', '2017-10-03 12:40:12', NULL, 0, 1, '', '', '', '', '', ''),
(1212, 0, 10, 0, 'elegantnye_sergi_geometricheskoj_formy_so_strazami', 'Элегантные серьги геометрической формы со стразами', NULL, 9, 'Элегантные серьги интересной геометрической формы, украшенные стразами. Длина: 2 см.\r\nСостав; Пластик, металл,стразы.', 'ВА-С-35/4', NULL, 670, NULL, 210, '2017-10-03 12:40:16', '2017-10-03 12:40:16', NULL, 0, 1, '', '', '', '', '', ''),
(1213, 0, 10, 0, 'zhenstvennye_sergi_s_zhemchugom_i_strazami', 'Женственные серьги с жемчугом и стразами', NULL, 9, 'Блеск страз и сияние жемчуга подарят Вам эффектные серьги из металла золотого цвета. Оденьте их обираясь на прогулку или романтическое свидание и будьте уверены в своей неотразимости!\r\nДиаметр 2,8 см.\r\nСостав: Металл, стразы, жемчуг.', 'ВА-С-36/78', NULL, 730, NULL, 240, '2017-10-03 12:44:18', '2017-10-03 12:44:18', NULL, 0, 1, '', '', '', '', '', ''),
(1214, 0, 10, 0, 'stilnyj_sharf_zelenogo_cveta', 'Стильный шарф зеленого цвета', NULL, 9, 'У этого зеленого шарфа не будет конкурентов.\r\nБижутерная вставка индивидуальна для каждого изделия.\r\nДлина 160 см - 170 см. Ширина 90 см. Длина украшения 15 см- 30 см.\r\nСостав: Полиэстер 100%', 'ВА-П-96/86', NULL, 1350, NULL, 550, '2017-10-03 12:44:31', '2017-10-03 12:44:31', NULL, 0, 1, '', '', '', '', '', ''),
(1215, 0, 10, 0, 'stilnyj_sharf_zelenogo_cveta', 'Стильный шарф зеленого цвета', NULL, 9, 'У этого зеленого шарфа не будет конкурентов.\r\nБижутерная вставка индивидуальна для каждого изделия.\r\nДлина 160 см - 170 см. Ширина 90 см. Длина украшения 15 см- 30 см.\r\nСостав: Полиэстер 100%', 'ВА-П-96/86', NULL, 1350, NULL, 550, '2017-10-03 12:44:31', '2017-10-03 12:44:31', NULL, 0, 1, '', '', '', '', '', ''),
(1216, 0, 10, 0, 'sergi_s_lunnym_kamnem_i_strazami', 'Серьги с лунным камнем и стразами', NULL, 9, 'Благородные серьги из металла золотого цвета, украшены крупным лунным камнем и прозрачными стразами. Металл - бижутерный сплав, не содержащий никель. \r\nДлина 4 см. Камень 2 см х 1.5 см.\r\nСостав: Металл, стразы.', 'ВА-С-36/43', NULL, 630, NULL, 190, '2017-10-03 12:49:05', '2017-10-03 13:03:20', NULL, 0, 1, '', '', '', '', '', ''),
(1217, 0, 10, 0, 'yarko_zelenyj_sharf_s_bizhuternoj_vstavkoj_', 'Ярко-зеленый шарф с бижутерной вставкой', NULL, 9, 'Необыкновенный ярко-зеленый шарф с бижутерной вставкой привлечет к Вам все взгляды.\r\nУкрашение может отличаться для каждого изделия. \r\nДлина 160 см - 170 см. Ширина 90 см. Длина украшения 15 см- 30 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-96/82', NULL, 1350, NULL, 550, '2017-10-03 12:52:29', '2017-10-03 12:52:29', NULL, 0, 1, '', '', '', '', '', ''),
(1218, 0, 10, 0, 'dvustoronnij_sharf_izumrudnogo_cveta', 'Двусторонний шарф изумрудного цвета', NULL, 9, 'Двусторонний шарф - кулон  выполнен из струящегося шифона изумрудного  цвета. Нежные розы в пастельных тонах.\r\nМеталлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см см. Ширина 38 см.\r\nСостав: Вискоза 30%, Полиэстер 70%', 'ВА-П-96/97', NULL, 1350, NULL, 550, '2017-10-03 12:58:23', '2017-10-03 12:58:23', NULL, 0, 1, '', '', '', '', '', ''),
(1219, 0, 10, 0, 'sharf_iz_shifona_salatovogo_cveta', 'Шарф из шифона салатового цвета', NULL, 9, 'Нежный воздушный двусторонний шарф - кулон  выполнен из струящегося шифона салатового цвета с цветочным принтом в пастельных тонах.\r\nМеталлическая подвеска индивидуальна для каждого изделия.\r\nДлина шарфика 73 см. Ширина 30 см.\r\nСостав: Полиэстер 100%', 'ВА-П-97/62', NULL, 1350, NULL, 550, '2017-10-03 13:03:59', '2017-10-03 13:03:59', NULL, 0, 1, '', '', '', '', '', ''),
(1220, 0, 10, 0, 'bordovyj_sharf_s_elementami_bizhuterii', 'Бордовый шарф с элементами бижутерии', NULL, 9, 'Оригинальный шарф с элементами бижутерии, выполнен из текстильного полотна. Размеры шарфика: длина шарфика: 200 см, длина бижутерии: 20 см.\r\nСостав: Вискоза 65%, Полиэстер 35%', 'ВА-П-94/50', NULL, 1350, NULL, 550, '2017-10-03 13:08:11', '2017-10-03 13:08:11', NULL, 0, 1, '', '', '', '', '', ''),
(1221, 0, 10, 0, 'elegantnye_sergi_gvozdiki_so_strazami', 'Элегантные серьги - гвоздики со стразами', NULL, 9, 'Элегантные серьги - гвоздики из металла золотого цвета, украшены лунным камнем и прозрачными стразами. Металл - бижутерный сплав, не содержащий никель. \r\nДлина 3,5 см. Камень 1.5 см.\r\nСостав: Металл, кристаллы.', 'ВА-С-333/1', NULL, 530, NULL, 140, '2017-10-03 13:08:48', '2017-10-03 13:08:48', NULL, 0, 1, '', '', '', '', '', ''),
(1222, 0, 10, 0, 'izyskannye_serezhki_s_dorozhkoj_sverkayushih_strazov', 'Изысканные сережки с дорожкой сверкающих стразов', NULL, 9, 'Изысканные сережки, обнимающие мочку уха, украшены длинными подвесками с дорожкой сверкающих стразов. Металл золотого цвета. Качественный бижутерный сплав без содержания никеля.\r\nДлина 5,5 см.\r\nСостав: Металл, стразы.', 'ВА-С-333/59', NULL, 1290, NULL, 520, '2017-10-03 13:13:20', '2017-10-03 13:13:20', NULL, 0, 1, '', '', '', '', '', ''),
(1223, 0, 10, 0, 'palantin_iz_shifona_cveta_rozovogo_kvarca', 'Палантин из шифона цвета розового кварца', NULL, 9, 'Нежный весенний палантин выполнен из шифона цвета розового кварца и украшен ажурным кружевом.\r\nРазмер: 60*150 см.\r\nДополните свой образ изысканным шарфом!\r\nСостав: Вискоза 65%, Полиэстер 35%', 'ВА-П-96/50', NULL, 1150, NULL, 450, '2017-10-03 13:14:53', '2017-10-03 13:14:53', NULL, 0, 1, '', '', '', '', '', ''),
(1224, 0, 10, 0, 'modnye_serezhki_s_dlinnymi_podveskami_iz_cirkonov', 'Модные сережки с длинными подвесками из цирконов', NULL, 9, 'Модные сережки, украшены длинными подвесками и сверкающими цирконами. Металл золотого цвета.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина 8 см.\r\nСостав: Металл, кристаллы.', 'ВА-С-333/60', NULL, 1090, NULL, 420, '2017-10-03 13:16:40', '2017-10-03 13:16:40', NULL, 0, 1, '', '', '', '', '', ''),
(1225, 0, 10, 0, 'prekrasnye_i_ochen_neobychnye_sergi_iz_metalla', 'Прекрасные и очень необычные серьги из металла', NULL, 9, 'Прекрасные и очень необычные серьги из металла желтого цвета. \r\nДлина: 4 см.\r\nСостав: Металл.', 'ВА-С-36/26', NULL, 770, NULL, 260, '2017-10-03 13:20:11', '2017-10-03 13:20:11', NULL, 0, 1, '', '', '', '', '', ''),
(1226, 0, 10, 0, 'palantin_iz_shelka_pylnogo_rozovogo_cveta_', 'Палантин из шелка пыльного розового цвета.', NULL, 9, 'Палантин выполнен из однотонного шелка пыльного розового цвета.  Украшен великолепным широким кружевом салатового и персикового цвета. \r\nЗакрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 160 см х 60 см.\r\nСостав: Шелк 100%\r\n', 'ВА-П-97/45', NULL, 1290, NULL, 520, '2017-10-03 13:20:12', '2017-10-03 13:20:12', NULL, 0, 1, '', '', '', '', '', ''),
(1227, 0, 10, 0, 'topovye_serezhki_s_dlinnymi_podveskami_i_strazami', 'Топовые сережки с  длинными подвесками и стразами', NULL, 9, 'Топовые сережки с  длинными подвесками. Украшены цирконами. Металл золотого цвета.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина 8 см.\r\nСостав: Металл, стразы.', 'ВА-С-333/62', NULL, 810, NULL, 280, '2017-10-03 13:24:02', '2017-10-03 13:24:02', NULL, 0, 1, '', '', '', '', '', ''),
(1228, 0, 10, 0, 'palantin_s_cvetochnym_printom_na_biryuzovom_fone', 'Палантин с цветочным принтом на бирюзовом фоне', NULL, 9, 'Изысканный палантин выполнен из легкого прозрачного шифона. \r\nЦветочный принт на бирюзово - зеленом фоне. Нежная ткань великолепно струится и чудесно ложится складками. Отдела - великолепное кружево.\r\nЗакрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 145 см х 62 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-97/52', NULL, 1290, NULL, 520, '2017-10-03 13:26:19', '2017-11-23 15:43:04', NULL, 0, 1, '', '', '', '', '', ''),
(1229, 0, 10, 0, 'udlinennye_sergi_v_vide_piramidki_so_strazami', 'Удлиненные серьги в виде пирамидки со стразами', NULL, 9, 'Удлиненные серьги в виде пирамидки сияют бриллиантовым блеском. Металл золотого цвета. Качественный бижутерный сплав без содержания никеля.\r\nДлина: 3,8 см.\r\nСостав: Металл, стразы.', 'ВА-С-333/81', NULL, 1250, NULL, 500, '2017-10-03 13:29:35', '2017-10-03 13:29:35', NULL, 0, 1, '', '', '', '', '', ''),
(1230, 0, 10, 0, 'stilnyj_palantin_iz_plotnogo_shifona_', 'Стильный палантин из плотного шифона', NULL, 9, 'Изысканный палантин выполнен из легкого, но плотного шифона - браш. Сложный принт и цвет переходит от бирюзового через желто - зеленый в горчичный. Универсальная расветка подойдет ко многим Вашим образам. Нежная эластичная ткань великолепно струится и чудесно ложится складками. Отдела - великолепное кружево.\r\nЗакрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 145 см х 62 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-97/50', NULL, 1290, NULL, 520, '2017-10-03 13:32:07', '2017-10-03 13:32:07', NULL, 0, 1, '', '', '', '', '', ''),
(1231, 0, 10, 0, 'udlinennye_sergi_v_vide_dorozhki_iz_serdechek', 'Удлиненные серьги в виде дорожки из сердечек', NULL, 9, 'Удлиненные серьги в виде дорожки из сердечек сияют бриллиантовым блеском. Металл золотого цвета.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина: 3,5 см.\r\nСостав: Металл, стразы.', 'ВА-С-333/79', NULL, 1250, NULL, 500, '2017-10-03 13:32:50', '2017-10-03 13:32:50', NULL, 0, 1, '', '', '', '', '', ''),
(1232, 0, 10, 0, 'izyskannye_serezhki_s_dlinnymi_podveskami_i_cherno_belymi_strazami', 'Изысканные сережки с  длинными подвесками и черно-белыми стразами', NULL, 9, 'Изысканные сережки с  длинными подвесками. Украшены черными и белыми кристаллами. Металл серебряного цвета.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина 11,5 см.\r\nСостав: Металл, стразы.', 'ВА-С-333/65', NULL, 830, NULL, 290, '2017-10-03 13:36:25', '2017-10-03 13:36:25', NULL, 0, 1, '', '', '', '', '', ''),
(1233, 0, 10, 0, 'izyskannyj_palantin_iz_plotnogo_shifona', 'Изысканный палантин из плотного шифона', NULL, 9, 'Изысканный палантин выполнен из легкого, но плотного шифона - браш. Сложный принт и цвет переходит от бирюзового через желто - зеленый в голубой. Универсальная расветка подойдет ко многим Вашим образам. Нежная эластичная ткань великолепно струится и чудесно ложится складками. Отделка - дорогое кружево.\r\nЗакрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 145 см х 62 см.\r\nСостав: Полиэстер 100%', 'ВА-П-97/49', NULL, 1290, NULL, 520, '2017-10-03 13:42:14', '2017-10-03 13:42:14', NULL, 0, 1, '', '', '', '', '', ''),
(1234, 0, 10, 0, 'cherno_belye_kruglye_sergi_s_rozoj', 'Черно-белые круглые серьги с розой', NULL, 9, 'Черно - белый тренд представлен в виде крупных легких серег из металла. Гипоаллергенный бижутерный сплав.\r\nДиаметр круглой подвески 5 см.\r\nСостав: Металл.\r\n', 'ВА-С-36/56', NULL, 530, NULL, 140, '2017-10-03 13:43:47', '2017-10-03 13:43:47', NULL, 0, 1, '', '', '', '', '', ''),
(1235, 0, 10, 0, 'palantin_s_risunkom_na_yarkom_sinem_fone', 'Палантин с рисунком на ярком синем фоне', NULL, 9, 'Изысканный палантин выполнен из легкого, но плотного шифона - браш. Сложный рисунок переходит от цветочного на на ярком синем фоне через кружевной принт в голубой. Универсальная расветка подойдет ко многим Вашим образам. Нежная эластичная ткань великолепно струится и чудесно ложится складками. Отделка - дорогое кружево.\r\nЗакрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 145 см х 62 см.\r\nСостав: Полиэстер 100%', 'ВА-П-97/48', NULL, 1290, NULL, 520, '2017-10-03 13:47:38', '2017-10-03 13:47:38', NULL, 0, 1, '', '', '', '', '', ''),
(1236, 0, 10, 0, 'naryadnye_sergi_s_cirkonami_sinego_cveta', 'Нарядные серьги с цирконами синего цвета', NULL, 9, 'Нарядные серьги украшены цирконами синего цвета. Фигурная дужка в виде из золотистого металла петли сверкает  прозрачными стразами. \r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина: 3 см.\r\nСостав: Металл, стразы.', 'ВА-С-333/76', NULL, 1130, NULL, 440, '2017-10-03 13:48:19', '2017-10-03 13:48:19', NULL, 0, 1, '', '', '', '', '', ''),
(1237, 0, 10, 0, 'krasivyj_palantin_iz_legkogo_shifona', 'Красивый палантин из легкого шифона', NULL, 9, 'Красивый палантин выполнен из легкого, но плотного шифона - браш. Сложный рисунок переходит от цветочного на фиолетовом фоне через кружевной принт в горчичный. Нежная эластичная ткань великолепно струится и чудесно ложится складками. Отделка - дорогое кружево.\r\nЗакрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 145 см х 62 см.\r\nСостав: Полиэстер 100%', 'ВА-П97/47', NULL, 1290, NULL, 520, '2017-10-03 13:51:59', '2017-10-03 13:51:59', NULL, 0, 1, '', '', '', '', '', '');
