(1238, 0, 10, 0, 'naryadnye_sergi_s_cirkonami_biryuzovogo_cveta', 'Нарядные серьги с цирконами бирюзового цвета', NULL, 9, 'Элегантные серьги украшены цирконом бирюзового цвета. Дужка из золотистого металла выполнена в виде цветка и украшена прозрачными стразами. Качественный бижутерный сплав без содержания никеля.\r\nДлина: 3 см.\r\nСостав: Металл, стразы.', 'ВА-С-333/38', NULL, 1090, NULL, 420, '2017-10-03 13:55:49', '2017-10-03 13:55:49', NULL, 0, 1, '', '', '', '', '', ''),
(1239, 0, 10, 0, 'palantin_iz_salatovogo_i_sirenevogo_cvetov_', 'Палантин из салатового и сиреневого цветов', NULL, 9, 'Палантин выполнен из легкого шифона салатового и сиреневого цветов со стилезованным цветочным узором. Украшен великолепным широким кружевом салатового цвета. \r\nЗакрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 160 см х 60 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-97/44', NULL, 1290, NULL, 520, '2017-10-03 13:56:46', '2017-10-03 13:56:46', NULL, 0, 1, '', '', '', '', '', ''),
(1240, 0, 10, 0, 'izyashnye_udlinennye_sergi_s_cirkonami_biryuzovogo_cveta', 'Изящные удлиненные серьги с цирконами бирюзового цвета', NULL, 9, 'Изящные удлиненные серьги из золотистого металла украшены цирконами бирюзового цвета и прозрачными стразами. Качественный бижутерный сплав без содержания никеля.\r\nДлина: 4 см.\r\nСостав: Металл, стразы.', 'ВА-С-333/74', NULL, 1050, NULL, 400, '2017-10-03 13:59:48', '2017-10-03 13:59:48', NULL, 0, 1, '', '', '', '', '', ''),
(1241, 0, 10, 0, 'palantin_iz_shifona_yarkogo_sinego_cveta', 'Палантин из шифона яркого синего цвета', NULL, 9, 'Роскошный палантин из шифона яркого синего цвета украшен блогородным кружевом. Такой аксессуар сделает Ваш образ еще более женственным и притягательным.\r\nАксессуары в комплект не входят.\r\nДлина 160 см. Ширина 64 см.\r\nСостав: Полиэстер 100%', 'ВА-П-97/12', NULL, 1290, NULL, 520, '2017-10-03 14:02:53', '2017-10-03 14:02:53', NULL, 0, 1, '', '', '', '', '', ''),
(1242, 0, 10, 0, 'ocharovatelnye_klassicheskie_sergi_s_rubinovo_krasnymi_strazami', 'Очаровательные классические серьги с рубиново-красными стразами', NULL, 9, 'Очаровательные классические серьги из золотистого металла, украшенные рубиново-красными стразами. \r\nДлина: 3 см.\r\nСостав: Металл, стразы.\r\n', 'ВА-С-33/75', NULL, 830, NULL, 290, '2017-10-03 14:03:49', '2017-10-03 14:03:49', NULL, 0, 1, '', '', '', '', '', ''),
(1243, 0, 10, 0, 'izumitelnye_sergi_s_prozrachno_krasnymi_strazami', 'Изумительные серьги с прозрачно-красными стразами', NULL, 9, 'Изумительные серьги из качественного металла золотого цвета, украшенные красными кристаллами и прозрачными стразами. Длина: 3 см.\r\nСостав: Металл, стразы.', 'ВА-С-333/45', NULL, 1130, NULL, 440, '2017-10-03 14:07:02', '2017-10-03 14:07:02', NULL, 0, 1, '', '', '', '', '', ''),
(1244, 0, 10, 0, 'naryadnyj_palantin_iz_poluprozrachnogo_krepa', 'Нарядный палантин из полупрозрачного крепа', NULL, 9, 'Нарядный палантин из полупрозрачного крепа. На белом фоне яркие стилизованные букетики. Такой аксессуар станет Вашим любимым вне зависимости от сезона.\r\nАксессуары в комплект не входят.\r\nДлина 146 см. Ширина 61 см.\r\nСостав: Полиэстер 100%', 'ВА-П-97/5', NULL, 1090, NULL, 420, '2017-10-03 14:07:08', '2017-10-03 14:07:08', NULL, 0, 1, '', '', '', '', '', ''),
(1245, 0, 10, 0, 'palantin_iz_legkogo_shifona_nezhnogo_persikovogo_cveta', 'Палантин из легкого шифона нежного персикового цвета', NULL, 9, 'Палантин из легкого шифона нежного персикового цвета с живописными розами в стиле пастель. Украшен сиреневым кружевом в тон принта. \r\nЗакрепить палантин на плечах можно подходящей по цвету брошью, выбранной в разделе аксессуары.\r\nАксессуары в комплект не входят.\r\nРазмер: 160 см х 64 см.\r\nСостав: Полиэстер 100%\r\n', 'ВА-П-96/72', NULL, 1290, NULL, 520, '2017-10-03 14:11:34', '2017-10-03 14:11:34', NULL, 0, 1, '', '', '', '', '', ''),
