(1320, 0, 10, 0, 'izyashnye_serezhki_so_sverkayushimi_cirkonami', 'Изящные сережки со сверкающими цирконами', NULL, 9, 'Изящные сережки, обнимающие мочку уха, украшены сверкающими цирконами. Металл золотого цвета.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина 2,8 см. Размер подвески 1 см х 1 см.\r\nСостав: Металл, стразы.', 'ВА-С-333/57', NULL, 730, NULL, 240, '2017-10-04 10:00:45', '2017-10-04 10:00:45', NULL, 0, 1, '', '', '', '', '', ''),
(1321, 0, 10, 0, 'elegantnye_serezhki_s_drozhashej_kapelkoj_cirkona', 'Элегантные сережки с дрожащей капелькой циркона', NULL, 9, 'Элегантные сережки, обнимающие мочку уха украшены сверкающими цирконами. Металл золотого цвета. Качественный бижутерный сплав без содержания никеля.\r\nДлина 2,8 см. Размер подвески 1 см х 1 см.\r\nСостав: Металл, стразы.', 'ВА-С-333/56', NULL, 670, NULL, 210, '2017-10-04 10:03:41', '2017-10-04 10:03:41', NULL, 0, 1, '', '', '', '', '', ''),
(1322, 0, 10, 0, 'miniatyurnye_serezhki_s_siyayushimi_strazami', 'Миниатюрные сережки с сияющими стразами', NULL, 9, 'Миниатюрные сережки, обнимающие мочку уха украшены сверкающими цирконами. Дужку из металла серебряного цвета украшают крошечные стразинки.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина 2,5 см. Диаметр подвески 1 см.\r\nСостав: Металл, стразы.\r\n', 'ВА-С-333/55', NULL, 730, NULL, 240, '2017-10-04 10:06:23', '2017-10-04 10:06:23', NULL, 0, 1, '', '', '', '', '', ''),
(1323, 0, 10, 0, 'prekrasnye_sergi_iz_metalla_serebristogo_cveta', 'Прекрасные серьги из металла серебристого цвета', NULL, 9, 'Прекрасные серьги из серебристого металла. Необычная подвеска украшена прозрачными сияющими стразами. \r\nДлина: 3 см.\r\nСостав: Металл, стразы.', 'ВА-С-36/16', NULL, 630, NULL, 190, '2017-10-04 10:09:56', '2017-10-09 20:17:57', NULL, 0, 1, '', '', '', '', '', '');
