(1324, 0, 9, 0, 'svobodnaya_zhenskaya_kurtka_iz_barhata', 'Свободная женская куртка из бархата', NULL, 12, 'Утепленная куртка на подкладке и синтепоне. Незаменимая вещь в гардеробе любой модницы. \r\nСостав: верх - полиэстер 100%; подклад: полиэстер 100%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: воротник-стойка\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 67 см (44 р.), 68 см (48 р.)\r\n• Карманы: прорезные\r\n• Застежка: молния\r\n• Особенности: утеплитель - синтепон', 'ФЛА-307', NULL, 5830, NULL, 2790, '2017-10-04 10:12:40', '2017-10-04 10:12:40', NULL, 0, 1, '', '', '', '', '', ''),
(1325, 0, 10, 0, 'prekrasnye_sergi_v_vide_oslepitelnoj_dorozhki_iz_strazov', 'Прекрасные серьги в виде ослепительной дорожки из стразов', NULL, 9, 'Прекрасные серьги из металла серебристого цвета в виде ослепительной дорожки, украшенные прозрачными стразами. \r\nДлина: 3 см.\r\nСостав: Металл, стразы.', 'ВА-С-36/22', NULL, 790, NULL, 270, '2017-10-04 10:13:34', '2017-10-04 10:13:34', NULL, 0, 1, '', '', '', '', '', ''),
(1326, 0, 9, 0, 'udlinennyj_zhenskij_zhilet_s_poyasom', 'Удлиненный женский жилет с поясом', NULL, 12, 'Удлиненный женский жилет с поясом. Будь модной вместе с нами.\r\nСостав: полиэстер 65%, вискоза 30%, спандекс 5%\r\n• Длина рукава: без рукавов\r\n• Тип горловины: V-образная\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 91 см (44, 48 р.)\r\n• Пояс: в комплекте\r\n• Карманы: накладные\r\n• Застежка: нет', 'ФЛА-324', NULL, 5130, NULL, 2440, '2017-10-04 10:42:13', '2017-10-04 10:42:13', NULL, 0, 1, '', '', '', '', '', ''),
(1327, 0, 8, 0, 'modnyj_molodezhnyj_dzhemper_s_dyrkami', 'Модный молодежный джемпер с дырками', NULL, 10, 'Стильный джемпер для модниц. Широкая резинка низа и широкие манжеты дополнены имитацией порванности, что придает изделию эффектный вид. Будь стильной вместе с Dressyshop!', 'СДЖ-3', NULL, 2050, NULL, 900, '2017-10-06 13:47:00', '2017-10-06 15:27:52', NULL, 0, 1, '', '', '', '', '', ''),
(1328, 0, 8, 0, 'elegantnaya_zhenskaya_bluza_s_baskoj', 'Элегантная женская блуза с баской', NULL, 10, 'Элегантная женская блузка на молнии. Модель выполнена из ажурного трикотажного кружева. Особенностью модели является стильная баска. Модель станет идеальным дополнением классического гардероба.', 'СБУ-1', NULL, 2150, NULL, 950, '2017-10-06 13:53:40', '2017-10-06 15:33:24', NULL, 0, 1, '', '', '', '', '', ''),
(1329, 0, 8, 0, 'zhenskoe_palto_s_asimmetrichnym_vorotnikom', 'Женское пальто с асимметричным воротником', NULL, 7, 'Пальто на кнопках с карманами. Объемный ворот служит прекрасной защитой от снега и ветра. Удобство должно быть стильным!', 'СПА-18', NULL, 5850, NULL, 2800, '2017-10-06 14:02:04', '2017-10-06 15:36:29', NULL, 0, 1, '', '', '', '', '', ''),
(1330, 0, 8, 0, 'stilnaya_zhenskaya_parka_s_mehom', 'Стильная женская парка с мехом', NULL, 7, 'Стильная женская парка на молнии и кулиске, украшенная ярким искусственным мехом. Объемный капюшон дополнен меховой отделкой. Рукава также дополнены крупными меховыми манжетами.', 'СКУ-21', NULL, 9850, NULL, 4800, '2017-10-06 14:09:24', '2017-10-06 15:39:58', NULL, 0, 1, '', '', '', '', '', ''),
(1331, 0, 8, 0, 'steganoe_zhenskoe_palto_s_mehom', 'Стеганое женское пальто с  мехом', NULL, 7, 'Женское стеганое пальто на молнии. Капюшон украшен искусственным мехом. Пальто с карманами на молнии. Удобное и теплое дополнение любого гардероба!', 'СПА-19', NULL, 4050, NULL, 1900, '2017-10-06 14:16:37', '2017-10-06 15:42:15', NULL, 0, 1, '', '', '', '', '', ''),
(1332, 0, 10, 0, 'yubka_iz_gofrirovannogo_tekstilnogo_polotna_', 'Юбка из гофрированного текстильного полотна', NULL, 18, 'ТРЕНД СЕЗОНА- ЛЕТЯЩАЯ ЮБКА В СКЛАДКУ! ПОЛЕТАЕМ!\r\nЮбки-гофре: изготовление на специализированном высокоточном собственном оборудовании.\r\nРоскошные складочки эффектно подчеркнут Вашу индивидуальность.Идеальная посадка на любой фигуре.\r\nВосхитительная юбка полуприлегающего силуэта из гофрированного текстильного полотна . Верхний край изделия обработан поясом с резинкой. В боковом шве юбки застежка на молнию. Нижний край юбки обработан термическим способом.Аксессуары в комплект не входят.\r\nДлина от пояса до низа изделия — 71 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-Ю4-3691/0-5', NULL, 2650, NULL, 1200, '2017-10-06 14:37:44', '2017-10-06 14:37:44', NULL, 0, 1, '', '', '', '', '', ''),
(1333, 0, 10, 0, 'voshititelnaya_yubka_iz_gofrirovannogo_tekstilya_', 'Восхитительная юбка из гофрированного текстиля', NULL, 18, 'ТРЕНД СЕЗОНА- ЛЕТЯЩАЯ ЮБКА В СКЛАДКУ! ПОЛЕТАЕМ!\r\nЮбки-гофре: изготовление на специализированном высокоточном собственном оборудовании.\r\nРоскошные складочки эффектно подчеркнут Вашу индивидуальность. Идеальная посадка на любой фигуре.\r\nВосхитительная юбка полуприлегающего силуэта из гофрированного текстильного полотна имитирующего кожу синего цвета. Верхний край изделия обработан поясом с резинкой. В боковом шве юбки застежка на молнию. Нижний край юбки обработан термическим способом. Аксессуары в комплект не входят.\r\nДлина от пояса до низа изделия — 56 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-Ю4-3691/6-9', NULL, 3050, NULL, 1400, '2017-10-06 14:53:31', '2017-10-06 14:53:31', NULL, 0, 1, '', '', '', '', '', ''),
(1334, 0, 10, 0, 'kostyum_iz_platya_i_ukorochennogo_zhaketa', 'Костюм  из платья и укороченного жакета', NULL, 18, 'Очаровательный костюм состоящий из платья и укороченного жакета. Платье прилегающего силуэта из трикотажного полотна серого цвета. V-образный вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. Спинка изделия дополнена шлицей. Стильный укороченный жакет полуприлегающего силуэта из трикотажного полотна черно-белого цвета. Изделие с втачным воротником «хомут». Низ изделия и низ цельнокроеных рукавов обработаны окантовкой из ткани, имитирующей кожу. Спинка жакета удлиненна.Аксессуары в комплект не входят.\r\nДлина жакета по спинке от плечевого шва до низа изделия —  31 -33 см.\r\nДлина платья по спинке от плечевого шва до низа изделия — 116-118 см\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-К4-3690', NULL, 4050, NULL, 1900, '2017-10-06 15:06:10', '2017-10-06 15:06:10', NULL, 0, 1, '', '', '', '', '', ''),
(1335, 0, 10, 0, 'plate_sine_serogo_cveta', 'Платье сине-серого цвета', NULL, 18, 'Чудесное платье полуприлегающего силуэта из трикотажного полотна сине-серого цвета. V-образный вырез изделия обработан внутренней обтачкой и дополнен декоративным элементом. Низ цельнокроеных рукавов обработан манжетами. Платье отрезное по линии талии. В боковых швах изделия втачной пояс.\r\nАксессуары в комплект не входят.\r\nДлина платья по спинке от плечевого шва до низа изделия — 120-123 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-П4-3638/4-5', NULL, 3850, NULL, 1800, '2017-10-06 15:13:58', '2017-10-18 16:17:27', NULL, 0, 1, '', '', '', '', '', ''),
(1336, 0, 10, 0, 'stilnoe_plate_s_otlozhnym_vorotnichkom', 'Стильное платье с отложным воротничком', NULL, 18, 'Стильное платье прилегающего силуэта из плотного текстильного полотна черного цвета. V-образный вырез изделия дополнен отложным воротничком с кружевом белого цвета. Платье отрезное по линии талии. Перед изделия дополнен планкой с застежкой на пуговицы и декоративными карманами с кружевом. Низ спинки изделия дополнен шлицей. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 105 -113 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-П4-3519', NULL, 4250, NULL, 2000, '2017-10-06 15:23:00', '2017-10-06 15:23:00', NULL, 0, 1, '', '', '', '', '', ''),
(1337, 0, 10, 0, 'trikotazhnyj_kostyum_s_dlinnoj_yubkoj', 'Трикотажный костюм  с длинной юбкой', NULL, 18, 'Чудесный костюм состоящий из блузы и юбки .\r\nБлуза свободного силуэта из трикотажного полотна . Круглый вырез изделия обработан внутренней обтачкой. Низ втачных рукавов со спущенной линией проймы дополнены манжетами. В боковых швах блузы разрезы. Изделие удлинено по спинке. Стильная юбка полуприлегающего силуэта из трикотажного полотна красно-кирпичного цвета. Изделие с высокой посадкой. Верх юбки обработан поясом на резинке и дополнен кулиской с завязками. Снизу в боковых швах изделия разрезы. Аксессуары в комплект не входят.\r\nДлина блузы по спинке от плечевого шва до низа изделия —  65 см.\r\nДлина юбки от пояса до низа — 75 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-К4-3678/0-3', NULL, 4450, NULL, 2100, '2017-10-06 15:50:37', '2017-10-06 15:50:37', NULL, 0, 1, '', '', '', '', '', ''),
(1338, 0, 10, 0, 'plate_pryamogo_silueta_sero_rozovogo_cveta', 'Платье прямого силуэта серо-розового цвета', NULL, 18, 'Чудесное платье прямого силуэта серо-розового цвета. Платье выполнено в технике «ручного вязания» из натуральных нитей с добавлением шерсти. Круглый вырез изделия обработан «чулочной гладью». Низ втачных рукавов обработан двустороней бейкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 96 -100 см.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%', 'ВА-П4-202', NULL, 3250, NULL, 1500, '2017-10-06 16:00:33', '2017-10-06 16:00:33', NULL, 0, 1, '', '', '', '', '', ''),
(1339, 0, 10, 0, 'zhenstvennoe_plate_sine_serogo_cveta', 'Женственное платье сине-серого цвета', NULL, 18, 'Женственное платье прилегающего силуэта из плотного трикотажного полотна сине-серого цвета. Круглый вырез изделия обработан внутреней обтачкой. Платье с втачными рукавами. Перед изделия дополнен декоративным элементом и вставками из ткани, имитирующей кожу. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100-112 см.\r\nСостав:Вискоза 95%, Эластан 5%', 'ВА-П4-3689', NULL, 3850, NULL, 1800, '2017-10-06 16:16:51', '2017-10-06 16:16:51', NULL, 0, 1, '', '', '', '', '', ''),
(1340, 0, 10, 0, 'miloe_plate_serogo_cveta', 'Милое платье серого цвета', NULL, 18, 'Милое платье полуприлегающего силуэта из трикотажного полотна серого цвета. Круглый вырез изделия  и втачные рукава выполнены в технике «чулочная» гладь. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —101- 103 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-3527/12-13', NULL, 3250, NULL, 1500, '2017-10-06 16:24:19', '2017-10-06 16:24:19', NULL, 0, 1, '', '', '', '', '', ''),
(1342, 0, 10, 0, 'povsednevnoe_plate_poluprilegayushego_silueta', 'Повседневное платье полуприлегающего силуэта', NULL, 18, 'Повседневное платье полуприлегающего силуэта из трикотажного полотна . Круглый вырез изделия дополнен планкой с застежкой на пуговицы. Низ цельнокроеных рукавов и горловина изделия обработаны двусторонней бейкой выполненной в технике "ручного вязания". Аксессуары в комплект не входят.\r\nДлина платья по спинке от плечевого шва до низа изделия — 112 -116 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-3688', NULL, 3650, NULL, 1700, '2017-10-06 16:31:21', '2017-10-06 16:31:21', NULL, 0, 1, '', '', '', '', '', ''),
(1343, 0, 10, 0, 'roskoshnaya_bluza_poluprilegayushego_silueta', 'Роскошная блуза полуприлегающего силуэта', NULL, 18, 'Роскошная блуза полуприлегающего силуэта из плотного трикотажного полотна . Круглый вырез изделия обработан внутренней обтачкой. Блуза с втачными рукавами. Перед изделия по низу дополнен широкой тесьмой из великолепного пайеточного полотна «хамелеона» ,меняющего цвета. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —  61-66 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3683', NULL, 3050, NULL, 1400, '2017-10-09 10:52:34', '2017-10-09 10:52:34', NULL, 0, 1, '', '', '', '', '', ''),
(1344, 0, 10, 0, 'zhenstvennaya_bluza_svobodnogo_silueta', 'Женственная блуза свободного силуэта', NULL, 18, 'Женственная блуза свободного силуэта из мягкого трикотажного полотна. Круглый вырез изделия обработан внутренней обтачкой. Блуза с втачными рукавами. Перед изделия по низу дополнен кружевом и разрезами в боковых швах. Блуза удлиннена по спинке. Аксессуары в комплект не входят.\r\nДлина блузы по спинке от плечевого шва до низа изделия —  65 -67 см.', 'ВА-М4-3675/2-5', NULL, 2850, NULL, 1300, '2017-10-09 11:12:52', '2017-10-09 11:12:52', NULL, 0, 1, '', '', '', '', '', ''),
(1345, 0, 10, 0, 'naryadnaya_bluza_belogo_cveta', 'Нарядная блуза  белого цвета', NULL, 18, 'Нарядная блуза полуприлегающего силуэта из трикотажного полотна белого цвета. Горловина изделия обработана окантовкой и дополнена ажурной кокеткой. Низ втачных рукавов обработан окантовкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа — 65- 67 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-3554/4-5', NULL, 2650, NULL, 1200, '2017-10-09 11:30:34', '2017-10-09 11:30:34', NULL, 0, 1, '', '', '', '', '', ''),
(1346, 0, 10, 0, 'naryadnaya_bluza_pryamogo_silueta_', 'Нарядная блуза прямого силуэта', NULL, 18, 'Нарядная блуза прямого силуэта из легкого текстильного полотна. Круглый вырез изделия обработан атласной бейкой. Втачные рукава по низу дополнены манжетами с застежкой на пуговицу. В боковых швах изделия - разрезы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа —68- 72 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М5-3393/6-9', NULL, 2650, NULL, 1200, '2017-10-09 11:45:35', '2017-10-09 11:45:35', NULL, 0, 1, '', '', '', '', '', ''),
(1347, 0, 10, 0, 'zhenstvennaya_bluza_v_krupnuyu_kletku', 'Женственная блуза в крупную клетку', NULL, 18, 'Женственная блуза прилегающего силуэта из текстильного полотна синего цвета. Круглый вырез изделия обработан внутренней обтачкой. Блуза с цельнокроеными рукавами. Перед изделия дополнен декоративным элементом. По спинке блузы застежка на молнию. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 59- 66 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-М4-3687', NULL, 2850, NULL, 1300, '2017-10-09 11:57:08', '2017-10-09 11:57:08', NULL, 0, 1, '', '', '', '', '', ''),
(1348, 0, 10, 0, 'bluza_s_volanami_iz_trikotazhnoj_setki', 'Блуза с воланами из трикотажной сетки', NULL, 18, 'Стильная блуза свободного силуэта из трикотажного полотна серого цвета. Круглый вырез изделия обработан внутренней обтачкой. Низ блузы и втачных рукавов дополнен широкими воланами из трикотажной сетки. Перед изделия дополнен декоративным карманом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 64- 68 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М4-3684', NULL, 2850, NULL, 1300, '2017-10-09 12:15:32', '2017-10-09 12:15:32', NULL, 0, 1, '', '', '', '', '', ''),
(1349, 0, 10, 0, 'romantichnaya_bluza_v_melkij_goroh', 'Романтичная блуза в мелкий горох', NULL, 18, 'Романтичная блуза свободного силуэта из трикотажного полотна синего цвета. Круглый вырез изделия обработан внутренней обтачкой. Низ втачных рукавов со спущенной линией проймы дополнен ажурным кружевом белого цвета и обработан окантовкой. Аксессуары в комплект не входят. \r\nДлина изделия по спинке  от плечевого шва до низа изделия —  69 -71 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3225/10-11', NULL, 2650, NULL, 1200, '2017-10-09 12:40:34', '2017-11-03 14:11:43', NULL, 0, 1, '', '', '', '', '', ''),
(1350, 0, 10, 0, 'effektnaya_bluza_cherno_golubogo_cveta', 'Эффектная блуза черно-голубого цвета', NULL, 18, 'Эффектная блуза свободного силуэта из трикотажного полотна черного-голубого цвета. Круглый вырез изделия обработан внутренней обтачкой. Блуза с втачными рукавами. По низу изделия в боковых швах разрезы.  Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 69-74 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3396/40-41', NULL, 2850, NULL, 1300, '2017-10-09 12:50:05', '2017-10-09 12:50:05', NULL, 0, 1, '', '', '', '', '', ''),
(1351, 0, 10, 0, 'uyutnaya_tunika_sinego_cveta', 'Уютная туника синего цвета', NULL, 18, 'Уютная туника свободного силуэта из вязаного трикотажного полотна синего цвета. Круглый вырез изделия обработан двусторонней бейкой. Туника с втачными руквами. Перед изделия по низу дополнен ажурной вставкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа —87- 90см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-3685', NULL, 3250, NULL, 1500, '2017-10-09 12:58:59', '2017-10-09 12:58:59', NULL, 0, 1, '', '', '', '', '', ''),
(1352, 0, 10, 0, 'roskoshnyj_zhaket_poluprilegayushego_silueta', 'Роскошный жакет полуприлегающего силуэта', NULL, 18, 'Роскошный жакет полуприлегающего силуэта, выполненный из трикотажного полотна . Фигурный вырез жакета обработан отложным воротником. Низ втачных рукавов, перед и низ изделия — обработаны окантовкой.  Перед жакета дополнен планкой с застежкой на пуговицы. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 61 - 64 см.\r\nСостав: 	Вискоза 95%, Эластан 5%', 'ВА-М4-3212', NULL, 3250, NULL, 1500, '2017-10-09 13:10:05', '2017-10-09 13:14:58', NULL, 0, 1, '', '', '', '', '', ''),
(1353, 0, 10, 0, 'interesnaya_tunika_svobodnogo_silueta', 'Интересная туника свободного силуэта', NULL, 18, 'Интересная туника свободного силуэта из трикотажного полотна сине-белого цвета. Круглый вырез изделия дополнен капюшоном. Туника с втачными рукавами со спущенной линией проймы. Перед изделия дополнен накладным карманом. Талия подчеркнута кулиской на завязках. Низ изделия по переду и спинке дополнен запахом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа —  84-86 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-3686', NULL, 3250, NULL, 1500, '2017-10-09 13:19:45', '2017-10-09 13:19:45', NULL, 0, 1, '', '', '', '', '', ''),
(1354, 0, 10, 0, 'tunika_pryamogo_silueta_s_relefnoj_fakturoj', 'Туника прямого силуэта  с рельефной фактурой', NULL, 18, 'Романтичная туника прямого силуэта из трикотажного полотна с рельефной фактурой . Перед изделия выполнен из замши. Круглый вырез изделия обработан внутренней обтачкой. Туника со спущенной линей проймы, втачными рукавами и с разрезами в боковых швах по низу изделия. Передняя часть туники дополнена декоративной молнией и принтом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 75-80 см.', 'ВА-М4-3532', NULL, 2650, NULL, 1200, '2017-10-09 13:39:03', '2017-10-09 13:39:03', NULL, 0, 1, '', '', '', '', '', ''),
(1355, 0, 10, 0, 'yarkaya_bluza_rubashka_svobodnogo_silueta', 'Яркая блуза-рубашка свободного силуэта', NULL, 18, 'Яркая блуза-рубашка свободного силуэта из трикотажного полотна. Актуальное сочетание цветного трикотажа и бежевой эко-замши создает запоминающийся образ. Круглый вырез изделия и втачные рукава со спущенной линией проймы обработаны внешней обтачкой. По переду изделия — планка с застежкой на пуговицы. В боковых швах блузы разрезы.Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 78-81 см.\r\nСостав:  Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-М5-3511', NULL, 3450, NULL, 1600, '2017-10-09 14:16:34', '2017-10-09 14:16:34', NULL, 0, 1, '', '', '', '', '', ''),
(1356, 0, 10, 0, 'povsednevnyj_dzhemper_poluprilegayushego_silueta', 'Повседневный джемпер полуприлегающего силуэта', NULL, 18, 'Уютный джемпер полуприлегающего силуэта. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез обработан двусторонней лицевой бейкой. Низ изделия и втачных рукавов — манжеты.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 62 -65 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %', 'ВА-Др5-203', NULL, 1750, NULL, 750, '2017-10-09 14:44:09', '2017-10-09 14:44:09', NULL, 0, 1, '', '', '', '', '', ''),
(1357, 0, 10, 0, 'stilnyj_kardigan_svobodnogo_silueta', 'Стильный кардиган свободного силуэта', NULL, 18, 'Стильный кардиган свободного силуэта .Кардиган выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Втачные рукава и низ изделия вывязаны ажурным рисунком.\r\nМодель с совмещенными размерами: 42-44, 46-48,50-52, 54-56, 58-60. Аксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия - 57 см.\r\nСостав: Акрил 70%, Мохер 20%, Шерсть 10%', 'ВА-Кн5-206', NULL, 3050, NULL, 1400, '2017-10-09 17:22:26', '2017-10-09 17:22:26', NULL, 0, 1, '', '', '', '', '', ''),
(1358, 0, 10, 0, 'stilnaya_yubka_s_vysokoj_posadkoj', 'Стильная юбка с высокой посадкой', NULL, 18, 'Стильная юбка полуприлегающего силуэта из трикотажного полотна. Изделие с высокой посадкой. Верх юбки обработан внутренней обтачкой и дополнен застежкой на молнию. По заднему шву изделия шлица. Аксессуары в комплект не входят.\r\nДлина юбки от пояса до низа — 62- 65 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-Ю4-3089/20-23', NULL, 2550, NULL, 1150, '2017-10-09 17:46:43', '2017-10-09 17:46:43', NULL, 0, 1, '', '', '', '', '', ''),
(1359, 0, 10, 0, 'stilnaya_yubka_serogo_cveta', 'Стильная юбка серого цвета', NULL, 18, 'Стильная юбка полуприлегающего силуэта из трикотажного полотна серого цвета. Изделие с высокой посадкой. Верх юбки обработан поясом на резинке и дополнен кулиской с завязками. Снизу в боковых швах изделия разрезы. Аксессуары в комплект не входят.\r\nДлина юбки от пояса до низа — 75 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-Ю4-3089/18-19', NULL, 2210, NULL, 980, '2017-10-09 17:57:05', '2017-10-09 17:57:05', NULL, 0, 1, '', '', '', '', '', ''),
(1360, 0, 10, 0, 'kostyum_iz_trikotazhnogo_polotna_temno_sinego_cveta', 'Костюм из трикотажного полотна темно-синего цвета', NULL, 20, 'Незаменимый костюм из трикотажного полотна темно-синего цвета в мелкий белый горошек. Костюм состоит из блузы и юбки. Горловина блузы обработана внутренней обтачкой и дополнена ажурной кокеткой белого цвета. Низ цельнокроенных рукавов и низ блузы дополнены манжетом. Свободная юбка длины midi по верху обработана поясом-резинкой. Юбка с высокой посадкой.\r\nАксессуары в комплект не входят.\r\nДлина блузы от плечевого шва по спинке до низа изделия — 65 см.\r\nДлина юбки от линии пояса до низа изделия — 80 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-К4-3652', NULL, 4050, NULL, 1900, '2017-10-09 18:05:10', '2017-10-09 20:18:30', NULL, 0, 1, '', '', '', '', '', ''),
(1361, 0, 10, 0, 'kardigan_poluprilegayushego_silueta_cherno_belogo_cveta', 'Кардиган полуприлегающего силуэта черно-белого цвета', NULL, 18, 'Роскошный кардиган полуприлегающего силуэта черно-белого цвета. Круглый вырез обработан двусторонней лицевой бейкой. Кардиган с втачными рукавами. По переду изделия вывязана планка с застежкой на пуговицы. Манжеты рукавов и низа изделия отвязаны резинкой 1*1. Перед изделия двойной, поверх цельновязнной основы кружевная вышивка. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 64 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %', 'ВА-Кн5-198/2-3', NULL, 3050, NULL, 1400, '2017-10-10 11:31:08', '2017-10-10 11:31:08', NULL, 0, 1, '', '', '', '', '', ''),
(1362, 0, 10, 0, 'tunika_sinego_cveta_s_risunkom', 'Туника  синего цвета с рисунком', NULL, 19, 'Чудесная туника свободного силуэта из трикотажного полотна синего цвета с рисунком. Круглый вырез изделия обработан внутренней обтачкой. Туника с втачными рукавами со спущенной линией проймы. Линия бедра эффектно подчеркнута кулиской. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 90 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3553', NULL, 2210, NULL, 980, '2017-10-10 11:57:44', '2017-10-10 11:57:44', NULL, 0, 1, '', '', '', '', '', ''),
(1363, 0, 10, 0, 'tunika_iz_trikotazhnogo_polotna_sinego_cveta_', 'Туника из трикотажного полотна синего цвета', NULL, 19, 'Чудесная туника свободного силуэта из трикотажного полотна синего цвета с рисунком. Круглый вырез изделия обработан кружевной кокеткой. Туника с втачными рукавами со спущенной линией проймы. Линия бедра эффектно подчеркнута кулиской. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 72 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3553/1', NULL, 2550, NULL, 1150, '2017-10-10 12:03:40', '2017-10-10 12:03:40', NULL, 0, 1, '', '', '', '', '', ''),
(1364, 0, 10, 0, 'bluzka_svobodnogo_silueta_serogo_cveta', 'Блузка свободного силуэта серого цвета', NULL, 18, 'Нежная туника свободного силуэта из трикотажного полотна серого цвета. Круглый вырез и низ изделия обработаны окантовкой. Перед блузы выполнен из ажурного полотна. Изделие с втачными рукавами со спущенной линией проймы. Спинка изделия удлиненна.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 77 -82 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-М4-3449/8-9', NULL, 2350, NULL, 1050, '2017-10-10 12:13:58', '2017-10-10 12:13:58', NULL, 0, 1, '', '', '', '', '', ''),
(1366, 0, 10, 0, 'yarkij_braslet_iz_plastikovyh_busin', 'Яркий браслет из пластиковых бусин', NULL, 9, 'Яркий браслет из крупных пластиковых бусин - хит сезона! Изделие на резинке не нуждается в застежке и подходит на запястье любой полноты. \r\nДиаметр бусин 1,8 см.\r\nСостав: Пластик.', 'ВА-Бс-21/58-59', NULL, 590, NULL, 170, '2017-10-10 12:25:09', '2017-10-10 14:56:02', NULL, 0, 1, '', '', '', '', '', ''),
(1367, 0, 10, 0, 'ocharovatelnyj_metallicheskij_braslet_s_risunkom_i_mtrazami', 'Очаровательный металлический браслет с рисунком и мтразами', NULL, 9, 'Очаровательный браслет из металла, украшенный стразами. \r\nШирина: 5 см.\r\nСостав: Металл, стразы.', 'ВА-Бс-202/40', NULL, 930, NULL, 340, '2017-10-10 12:28:41', '2017-10-10 12:28:41', NULL, 0, 1, '', '', '', '', '', ''),
(1368, 0, 10, 0, 'zamechatelnyj_braslet_so_strazami_sinego_cveta', 'Замечательный браслет со стразами синего цвета', NULL, 9, 'Замечательный браслет из металла золотого цвета, украшенный стразами синего и прозрачного цвета. Длина: 21 см.\r\nСостав: Металл, стразы.', 'ВА-Бс-221/41', NULL, 830, NULL, 290, '2017-10-10 12:33:18', '2017-10-10 12:33:18', NULL, 0, 1, '', '', '', '', '', ''),
(1369, 0, 10, 0, 'ocharovatelnyj_braslet_so_strazami_i_zhemchugom', 'Очаровательный браслет со стразами и жемчугом', NULL, 9, 'Очаровательный браслет из металла золотистого цвета, украшенный стразами и жемчугом. \r\nДлина: 16 +5 см.\r\nСостав: Металл, стразы, бусины.', 'ВА-Бс-221/36', NULL, 870, NULL, 310, '2017-10-10 12:37:11', '2017-10-10 12:37:11', NULL, 0, 1, '', '', '', '', '', ''),
