(1375, 0, 10, 0, 'braslet_cveta_chernennogo_serebra_so_strazami', 'Браслет цвета черненного серебра со стразами', NULL, 9, 'Привлечет внимание к запястьям массивный браслет цвета черненного серебра. Дорожки из страз чередуются с рисунком металлической основы. Центр изделия украшают стразы черного и серого цветов. Ширина: 4.5 см.\r\nСостав: Металл, стразы.', 'ВА-Бс-202/49', NULL, 770, NULL, 260, '2017-10-10 12:52:16', '2017-10-10 12:52:16', NULL, 0, 1, '', '', '', '', '', ''),
(1376, 0, 10, 0, 'voshititelnyj_braslet_s_kamnyami_krasnogo_cveta', 'Восхитительный браслет с камнями красного цвета', NULL, 9, 'Восхитительный браслет из металла золотого цвета, украшенный кристаллами и стразами. Длина: 19 см.\r\nСостав:Металл, кристаллы. стразы', 'ВА-Бс-221/44', NULL, 950, NULL, 350, '2017-10-10 12:52:38', '2017-10-10 12:52:38', NULL, 0, 1, '', '', '', '', '', ''),
(1377, 0, 10, 0, 'braslet_na_rezinke_s_krasno_zolotymi_businami', 'Браслет на резинке с красно-золотыми бусинами', NULL, 9, 'Браслет на резинке украшенный стразами.  Бусины темного красного цвета с золотистыми прожилками.\r\nВ промежутках между бусинами вставки со стразами. \r\nДиаметр бусин: 1,1 см.\r\nСостав: Пластик, стразы.', 'ВА-Бс-240/39', NULL, 610, NULL, 180, '2017-10-10 12:57:11', '2017-10-10 12:57:11', NULL, 0, 1, '', '', '', '', '', ''),
(1378, 0, 10, 0, 'nezhnyj_braslet_na_rezinke_s_krasnymi_strazami', 'Нежный браслет на резинке с красными стразами', NULL, 9, 'Очень нежный браслет на резинке из бусин белого цвета "под жемчуг", украшенный красными стразами.\r\nДиаметр бусин: 1 см.\r\nСостав: Пластик, стразы.', 'ВА-Бс-240/33', NULL, 610, NULL, 180, '2017-10-10 13:01:23', '2017-10-10 13:01:23', NULL, 0, 1, '', '', '', '', '', ''),
(1379, 0, 10, 0, 'nezhnyj_braslet_na_rezinke_s_sinimi_strazami', 'Нежный браслет на резинке с синими стразами', NULL, 9, 'Очень нежный браслет на резинке из бусин белого цвета "под жемчуг", украшенный синими стразами.\r\nДиаметр бусин: 1 см.\r\nСостав: Пластик, стразы.', 'ВА-Бс-240/32', NULL, 610, NULL, 180, '2017-10-10 13:04:42', '2017-10-10 13:04:42', NULL, 0, 1, '', '', '', '', '', ''),
(1380, 0, 10, 0, 'neveroyatno_krasivy_braslet_pod_bronzu_s_biryuzoj', 'Невероятно красивы браслет "под бронзу" с бирюзой', NULL, 9, 'Невероятно красивый браслет на пружинках украшен камнями и стразами бирюзового цвета. Металл цвета бронзы. \r\nШирина: 3,5 см. Диаметр 6 см.\r\nСостав: Металл, камень.', 'ВА-Бс-202/50', NULL, 970, NULL, 360, '2017-10-10 13:11:04', '2017-10-10 13:11:04', NULL, 0, 1, '', '', '', '', '', ''),
