(1382, 0, 10, 0, 'neobychnyj_skruchennyj_braslet_v_krasno_zolotyh_tonah', 'Необычный скрученный браслет в красно-золотых тонах', NULL, 9, 'Необычный гибкий браслет из скрученной в пружину проволочки, на которую нанизаны бусинки в красно-золотых тонах.\r\nСостав: Металл, бусины.', 'ВА-Бс-22/95', NULL, 650, NULL, 200, '2017-10-10 13:17:17', '2017-10-10 13:17:17', NULL, 0, 1, '', '', '', '', '', ''),
(1383, 0, 10, 0, 'interesnyj_braslet_iz_zamshi_so_strazami', 'Интересный браслет из замши  со стразами', NULL, 9, 'Интересный браслет из замши с застежкой-кнопка, украшен золотой цепочкой,  прозрачными и серыми стразами.  \r\nШирина: 2 см. Длина: 40 см.\r\nСостав: Металл, стразы, текстиль.', 'ВА-Бс-23/29-31', NULL, 690, NULL, 220, '2017-10-10 13:21:36', '2017-10-10 15:05:15', NULL, 0, 1, '', '', '', '', '', ''),
(1384, 0, 10, 0, 'gibkij_braslet_s_zhemchuzhnymi_buinami', 'Гибкий браслет с жемчужными буинами', NULL, 9, 'Гибкий браслет из скрученной в пружину проволочки,  на которую нанизаны жемчужные бусинки и стразы.  Браслет выполнен виз металла серебрянного цвета. Гибкий браслет подойдет на любой размер запястья.\r\nСостав: Камень', 'ВА-Бс-230/28', NULL, 550, NULL, 150, '2017-10-10 13:28:17', '2017-10-10 13:28:17', NULL, 0, 1, '', '', '', '', '', ''),
