(1387, 0, 10, 0, 'ochen_stilnyj_skruchennyj_braslet_mnogocvete', 'Очень стильный скрученный браслет- многоцветье', NULL, 9, 'Гибкий браслет из скрученной в пружину проволочки,  на которую нанизаны бусинки разного цвета и дизайна из камня и пластика или металла.  Гибкий браслет подойдет на любой размер запястья. Размер и форма бусин отличаются для каждого изделия.\r\nПорадуйте себя стильным аксессуаром!\r\nСостав: Металл, пластик, камень.\r\n\r\n', 'ВА-Бс-230/18-27', NULL, 690, NULL, 220, '2017-10-10 13:38:55', '2017-10-10 15:09:29', NULL, 0, 1, '', '', '', '', '', ''),
(1388, 0, 10, 0, 'ochen_krasivyj_braslet_s_korichnevo_bezhevymi_strazami', 'Очень красивый браслет с коричнево-бежевыми стразами', NULL, 9, 'Очень красивый гибкий браслет  из металла золотого цвета, украшенный коричнево-бежевыми стразами. \r\nДлина: 21 + 5 см.\r\nСостав: Металл, стразы.', 'ВА-Бс-221/12', NULL, 930, NULL, 340, '2017-10-10 13:49:50', '2017-10-10 13:49:50', NULL, 0, 1, '', '', '', '', '', ''),
(1389, 0, 10, 0, 'krupnyj_braslet_so_strazami_neveroyatno_krasivogo_dizajna', 'Крупный браслет со стразами невероятно красивого дизайна', NULL, 9, 'Невероятно красивый дизайн  металлического оформления этого гибкого и очень красивого   браслета делает его современным. Крупные кристаллы красного цвета дополняют изумрудные стразы. Длина 21 см. Ширина 3 см.\r\nСостав: Металл, стразы.', 'ВА-Бс-221/56', NULL, 890, NULL, 320, '2017-10-10 13:55:30', '2017-10-10 13:58:12', NULL, 0, 1, '', '', '', '', '', ''),
(1390, 0, 10, 0, 'sverkayushij_zhenskij_braslet_na_rezinke', 'Сверкающий женский браслет на резинке', NULL, 9, 'Сверкающий браслет на резинке выглядит великолепно! Изделие на резинке не нуждается в застежке и подходит на запястье любой полноты. \r\nШирина: 1,8 см.\r\nСостав: Металл', 'ВА-Бс-21/57', NULL, 610, NULL, 180, '2017-10-10 13:55:33', '2017-10-10 13:55:33', NULL, 0, 1, '', '', '', '', '', ''),
(1391, 0, 10, 0, 'gibkij_braslet_so_strazami_neveroyatnogo_dizajna', 'Гибкий браслет со стразами невероятного дизайна', NULL, 9, 'Невероятно красивый дизайн  металлического оформления этого гибкого и очень красивого   браслета делает его современным. Крупные кристаллы красного цвета дополняют изумрудные стразы. Длина 21 см. Ширина 3 см.\r\nСостав: Металл, стразы.', 'ВА-Бс-221/57', NULL, 890, NULL, 320, '2017-10-10 13:59:56', '2017-10-10 13:59:56', NULL, 0, 1, '', '', '', '', '', ''),
(1392, 0, 10, 0, 'ochen_izyashnyj_gibkij_braslet_cveta_matovoe_serebro', 'Очень изящный  гибкий браслет цвета матовое серебро', NULL, 9, 'Очень изящный  и модный гибкий браслет цвета матовое серебро. \r\nДлина 15 см + 4 см. Ширина 3 см.\r\nСостав: Металл.', 'ВА-Бс-221/50', NULL, 830, NULL, 290, '2017-10-10 14:02:56', '2017-10-10 14:02:56', NULL, 0, 1, '', '', '', '', '', ''),
(1393, 0, 10, 0, 'zhenskij_braslet_iz_iskusstvennoj_kozhi', 'Женский браслет из искусственной кожи', NULL, 9, 'Роскошный браслет из искуственной кожи с застежкой-магнит, украшен прозрачными стразами.\r\nШирина: 3,5 см см. Длина 19,5 см.\r\nСостав: Иск.кожа, металл', 'ВА-Бс-23/8-9', NULL, 1070, NULL, 410, '2017-10-10 14:08:56', '2017-10-10 14:08:56', NULL, 0, 1, '', '', '', '', '', ''),
(1394, 0, 10, 0, 'massivnyj_gibkij_braslet_na_zastezhke', 'Массивный гибкий браслет на застежке', NULL, 9, '"Скифский " дерзкий дизайн этого массивного гибкого браслета  из металла золотого цвета не сможет никого оставить равнодушным!. \r\nДлина 16 см + 4 см.\r\nСостав: Металл.', 'ВА-Бс-221/49', NULL, 930, NULL, 340, '2017-10-10 14:09:25', '2017-10-10 15:27:07', NULL, 0, 1, '', '', '', '', '', ''),
(1395, 0, 10, 0, 'shirokij_zolotoj_braslet_na_rezinke', 'Широкий золотой браслет на резинке', NULL, 9, 'Строгий, практичный браслет из металла цвета матового золота выглядит великолепно. Изделие на резинке не нуждается в застежке и подходит на запястье любой полноты. \r\nШирина: 3,5 см.\r\nСостав: Металл.', 'ВА-Бс-21/56', NULL, 690, NULL, 220, '2017-10-10 14:11:59', '2017-10-10 15:25:51', NULL, 0, 1, '', '', '', '', '', ''),
(1396, 0, 10, 0, 'oslepitelnyj_braslet_iz_metalla_na_rezinke', 'Ослепительный браслет из металла на резинке', NULL, 9, 'Ослепительный браслет из металла золотого цвета выглядит великолепно. Изделие на резинке не нуждается в застежке и подходит на запястье любой полноты. \r\nШирина: 3,5 см.\r\nСостав: Металл.', 'ВА-Бс-21/60-61', NULL, 690, NULL, 220, '2017-10-10 14:14:55', '2017-10-10 15:18:17', NULL, 0, 1, '', '', '', '', '', ''),
(1397, 0, 10, 0, 'braslet_iz_iskusstvennoj_kozhi_s_zastezhkoj_magni', 'Браслет из искусственной кожи с застежкой - магни', NULL, 9, 'Ультрамодный браслет из искусственной кожи с застежкой - магнит, украшен прозрачными стразами и черным кристаллом в оправе из металла золотого цвета.  \r\nРазмер застежки 2 см х 1,5 см. Длина 19,5 см.\r\nСостав: Иск.кожа, металл', 'ВА-Бс-23/5', NULL, 1070, NULL, 410, '2017-10-10 14:15:18', '2017-10-10 14:15:18', NULL, 0, 1, '', '', '', '', '', ''),
(1398, 0, 10, 0, 'chudesnyj_braslet_so_strazami_i_emalyu', 'Чудесный браслет со стразами и эмалью', NULL, 9, 'Чудесный браслет из металла золотого цвета украшен сверкающими стразами. Вставка в виде цветка покрыта черной эмалью. \r\nДлина: 15 см + 4 см. Диаметр вставки  1,8 см.\r\nСостав: Металл, стразы, эмаль.', 'ВА-Бс-221/64', NULL, 790, NULL, 270, '2017-10-10 14:18:05', '2017-10-10 14:18:05', NULL, 0, 1, '', '', '', '', '', ''),
(1399, 0, 10, 0, 'chernyj_braslet_iz_zamshi_s_zolotoj_cepochkoj', 'Черный браслет из замши с золотой цепочкой', NULL, 9, 'Черный браслет из замши с застежкой-кнопка, украшен золотой цепочкой,  прозрачными и черными стразами.  \r\nШирина: 2 см. Длина: 40 см.\r\nСостав: Стразы, текстиль', 'ВА-Бс-23/32', NULL, 690, NULL, 220, '2017-10-10 14:21:46', '2017-10-10 14:21:46', NULL, 0, 1, '', '', '', '', '', ''),
(1400, 0, 10, 0, 'ochen_izyashnyj_zamechatelnyj_braslet_s_krasnymi_strazami', 'Очень изящный замечательный браслет с красными стразами', NULL, 9, 'Очень изящный замечательный браслет из металла золотистого цвета, украшенный красными и прозрачными стразами. \r\nДлина: 15+5 см.\r\nСостав: Металл, стразы.', 'ВА-Бс-221/39', NULL, 850, NULL, 300, '2017-10-10 14:22:12', '2017-10-10 14:22:12', NULL, 0, 1, '', '', '', '', '', ''),
(1401, 0, 10, 0, 'ultramodnyj_braslet_iz_iskusstvennoj_kozhi', 'Ультрамодный браслет из искусственной кожи', NULL, 9, 'Ультрамодный браслет из искусственной кожи с застежкой - магнит, украшен  стразами в оправе из металла золотого цвета.  Оборачивается 2 раза вокруг запястья.\r\nРазмер застежки 1,7 см х 0,7 см. Длина 36 см.\r\nСостав: Иск.кожа, металл', 'ВА-Бс-23/7', NULL, 950, NULL, 350, '2017-10-10 14:26:52', '2017-10-10 14:26:52', NULL, 0, 1, '', '', '', '', '', ''),
(1402, 0, 10, 0, 'klassicheskij_po_dizajnu_prekrasnyj_braslet_so_strazami', 'Классический по дизайну прекрасный браслет со стразами', NULL, 9, 'Классический по дизайну этот прекрасный браслет из металла золотистого цвета станет Вашим любимым на все случаи жизни! Украшен сияющими стразами. \r\nДлина: 18 см.\r\nСостав: Металл, стразы.', 'ВА-Бс-221/38', NULL, 910, NULL, 330, '2017-10-10 14:26:54', '2017-10-10 14:26:54', NULL, 0, 1, '', '', '', '', '', ''),
(1403, 0, 10, 0, 'braslet_so_strazami_v_vide_cvetka', 'Браслет со стразами в виде цветка', NULL, 9, 'Сама нежность! Милый браслет из металла серебряного цвета украшен сверкающими стразами.  \r\nДлина: 16 см + 5 см.\r\nСостав: Металл, стразы.', 'Ва-Бс-221/66', NULL, 850, NULL, 300, '2017-10-10 14:29:55', '2017-10-10 15:23:20', NULL, 0, 1, '', '', '', '', '', ''),
(1404, 0, 10, 0, 'stilnyj_trehcvetnyj_braslet', 'Стильный трехцветный  браслет', NULL, 9, 'Универсальный браслет, выполненный из металла, придаст шарма многим Вашим нарядам. Синий, черный и золотой цвет.\r\nДлина: 18 см. + 5 см.\r\nСостав: Металл', 'ВА-Бс-221/72', NULL, 650, NULL, 200, '2017-10-10 14:32:46', '2017-10-10 14:32:46', NULL, 0, 1, '', '', '', '', '', ''),
(1405, 0, 10, 0, 'ocharovatelnyj_braslet_so_strazami_v_neobychnoj_oprave', 'Очаровательный браслет со стразами в необычной оправе', NULL, 9, 'Очаровательный браслет из металла серебряного цвета украшен вставкой со сверкающими стразами в необычной оправе.  \r\nДлина: 16 см + 5 см.\r\nСостав: Металл, стразы.', 'ВА-Бс-221/65', NULL, 930, NULL, 340, '2017-10-10 14:33:03', '2017-10-10 14:33:03', NULL, 0, 1, '', '', '', '', '', ''),
(1406, 0, 10, 0, 'izyashnyj_braslet_s_dorozhkoj_iz_strazov', 'Изящный браслет с дорожкой из стразов', NULL, 9, 'Изящный браслет из металла серебристого цвета , украшенный дорожкой из сияющих стразов. \r\nДлина: 16 см. + 3 см.\r\nСостав: Металл, стразы.', 'ВА-Бс-22/70', NULL, 890, NULL, 320, '2017-10-10 14:37:00', '2017-10-10 14:37:00', NULL, 0, 1, '', '', '', '', '', ''),
(1407, 0, 10, 0, 'braslet_s_raznocvetnymi_cirkonami_i_cvetochkami_iz_kamnya', 'Браслет с разноцветными цирконами и цветочками из камня', NULL, 9, 'Романтичный браслет сделает вашу руку более изящной, подчеркнет Ваш изысканный вкус и стильный наряд. Жесткий браслет с боковыми шарнирами и замком из качественного бижутерного сплава класса люкс цвета золота, украшен разноцветными цирконами и цветочками из камня.\r\nВнутренний размер 5,5 см х 5 см. Ширина 1,3 см.\r\nСостав: Металл, циркон', 'ВА-Бс-20/38', NULL, 1490, NULL, 620, '2017-10-10 14:37:41', '2017-10-10 14:37:41', NULL, 0, 1, '', '', '', '', '', ''),
(1408, 0, 10, 0, 'gibkij_braslet_so_vstavkoj_iz_straza', 'Гибкий браслет со вставкой из страза', NULL, 9, 'Браслет гибкий из металла серебряного цвета, украшенный необычной по дизайну вставкой с ослепительным стразом. \r\nДлина: 17 см + 4 см. Размер оправы в виде квадрата 1см х 1 см.\r\nСостав: Металл, стразы.', 'ВА-Бс-221/62', NULL, 930, NULL, 340, '2017-10-10 14:41:12', '2017-10-10 14:41:12', NULL, 0, 1, '', '', '', '', '', ''),
(1409, 0, 10, 0, 'zhestkij_braslet_s_bokovymi_sharnirami_', 'Жесткий браслет с боковыми шарнирами', NULL, 9, 'Ослепительный браслет сделает вашу руку более изящной, подчеркнет Ваш изысканный вкус и стильный наряд. Жесткий браслет с боковыми шарнирами и замком из качественного бижутерного сплава класса люкс цвета золота инкрустирован цирконами. Центральнй кристалл дымчатого цвета.\r\nВнутренний размер 5,5 см х 5 см. Ширина 0,7 см.\r\nСостав: Металл, циркон', 'ВА-Бс-20/37', NULL, 1490, NULL, 620, '2017-10-10 14:41:52', '2017-10-10 14:41:52', NULL, 0, 1, '', '', '', '', '', ''),
(1411, 0, 10, 0, 'kozhanyj_braslet_s_zolotoj_metallicheskoj_vstavkoj', 'Кожаный браслет с золотой металлической вставкой', NULL, 9, 'Топовый браслет выполнен из искусственной кожи с золотой металлической вставкой.\r\nРазмер вставки 4,5 см х 4,5 см. Длина: 17 см. +  3 см.\r\nСостав: Металл, текстиль', 'ВА-Бс-23/35-36', NULL, 850, NULL, 300, '2017-10-10 14:54:49', '2017-10-10 14:54:49', NULL, 0, 1, '', '', '', '', '', ''),
(1413, 0, 10, 0, 'myagkij_plastichnyj_braslet_so_strazami', 'Мягкий пластичный браслет  со стразами', NULL, 9, 'Мягкий пластичный браслет выполнен на основе из искусственной замши и украшен стразами.\r\nМагнитная застежка.\r\nДлина: 19 см. Ширина браслета 3 см.\r\nСостав: Стразы, текстиль', 'ВА-Бс-23/42-44', NULL, 890, NULL, 320, '2017-10-10 15:02:59', '2017-10-10 15:02:59', NULL, 0, 1, '', '', '', '', '', ''),
(1414, 0, 10, 0, 'plastichnyj_braslet_iz_iskusstvennoj_zamshi_so_strazami', 'Пластичный  браслет из искусственной замши со стразами', NULL, 9, 'Мягкий пластичный браслет выполнен на основе из искусственной замши и украшенный яркими стразами . Застежка на замке из металла серебристого цвета.\r\nДлина: 21 см. Ширина браслета 3 см.\r\nСостав: Металл, текстиль, стразы.\r\n', 'ВА-Бс-23/47-48', NULL, 890, NULL, 320, '2017-10-10 15:05:28', '2017-10-10 15:05:28', NULL, 0, 1, '', '', '', '', '', ''),
(1415, 0, 10, 0, 'chernyj_braslet_iz_iskusstvennoj_kozhi', 'Черный браслет из искусственной кожи', NULL, 9, 'Черный браслет выполнен из искусственной кожи, украшен золотой металлической вставкой.\r\nДиаметр  вставки 6 см. Длина: 21 см. Ширина браслета 4 см.\r\nСостав: Металл, текстиль', 'ВА-Бс-23/39', NULL, 890, NULL, 320, '2017-10-10 15:12:37', '2017-10-10 15:12:37', NULL, 0, 1, '', '', '', '', '', ''),
(1416, 0, 10, 0, 'braslet_iz_ekokozhi_zheltogo_cveta', 'Браслет из экокожи желтого цвета', NULL, 9, 'Яркий браслет выполнен из искусственной кожи цвета желтка с золотой металлической вставкой.\r\nДиаметр  вставки 6 см. Длина: 21 см. Ширина браслета 4 см.\r\nСостав: Металл, текстиль', 'ВА-Бс-23/37', NULL, 890, NULL, 320, '2017-10-10 15:19:08', '2017-10-10 15:19:08', NULL, 0, 1, '', '', '', '', '', ''),
(1417, 0, 10, 0, 'chasy_s_kozhanym_brasletom_krasnogo_cveta', 'Часы с кожаным браслетом красного цвета', NULL, 9, 'Кожаные браслеты остаются по-прежнему актуальными, они уже в течение нескольких лет подряд уверенно занимают лидирующие позиции среди модной бижутерии.\r\nБраслет - часы выполнен из искусственной кожи красных оттенков, металл серебрянного цвета.\r\nДиаметр цифеблата 3,2 см. Длина: 19,5 см.', 'ВА-Бс-23/10', NULL, 1290, NULL, 520, '2017-10-10 15:39:21', '2017-10-10 15:39:21', NULL, 0, 1, '', '', '', '', '', ''),
(1418, 0, 10, 0, 'chasy_s_kozhanym_brasletom_serogo_cveta', 'Часы с кожаным браслетом серого цвета', NULL, 9, 'Кожаные браслеты остаются по-прежнему актуальными, они уже в течение нескольких лет подряд уверенно занимают лидирующие позиции среди модной бижутерии.\r\nБраслет - часы выполнен из искусственной кожи серых оттенков. металл серебрянного цвета.\r\nДиаметр цифеблата 3,2 см. Длина: 19,5 см.', 'ВА-Бс-23/11', NULL, 1290, NULL, 520, '2017-10-10 15:47:50', '2017-10-10 15:47:50', NULL, 0, 1, '', '', '', '', '', ''),
(1419, 0, 10, 0, 'chasy_s_kozhanym_brasletom_korichnevogo_cveta', 'Часы с кожаным браслетом коричневого цвета', NULL, 9, 'Кожаные браслеты остаются по-прежнему актуальными, они уже в течение нескольких лет подряд уверенно занимают лидирующие позиции среди модной бижутерии.\r\nБраслет - часы выполнен из искусственной кожи коричневых оттенков. \r\nОборачивается 2 раза вокруг запястья.\r\nДиаметр цифеблата 2,5 см. Длина: 39см.', 'ВА-Бс-23/12', NULL, 1290, NULL, 520, '2017-10-10 15:50:29', '2017-10-10 15:50:29', NULL, 0, 1, '', '', '', '', '', ''),
