(1437, 0, 10, 0, 'velikolepnyj_komplekt_iz_treh_elementov_so_strazami', 'Великолепный комплект из трех элементов со стразами', NULL, 9, 'Великолепный комплект (Колье + браслет + серьги), украшен стразами. Длина колье: 50 см. + 5 см. Браслет-резинка. Серьги: 4 см..\r\nСостав: Металл, стразы, жемчуг\r\n', 'ВА-К-740/25', NULL, 850, NULL, 300, '2017-10-11 15:09:46', '2017-10-11 15:09:46', NULL, 0, 1, '', '', '', '', '', ''),
(1438, 0, 10, 0, 'stilnyj_komplekt_so_strazami_i_businoj', 'Стильный комплект со стразами и бусиной', NULL, 9, 'Комплект (серьги  и колье), выполнен в модной черно-белой гамме. Украшен стразами и бусиной - каплей  с фарфоровым блеском. Металл золотого цвета.\r\nПодберите украшение на руку в разделе браслеты! \r\nДлина: 36 + 5 см. Размер кулона и серег 4,0 см х 1,3 см.\r\nСостав: Металл, стразы', 'ВА-К-760/32', NULL, 930, NULL, 340, '2017-10-11 15:16:28', '2017-10-11 15:16:28', NULL, 0, 1, '', '', '', '', '', ''),
(1439, 0, 10, 0, 'komplekt_so_strazami_i_krupnoj_polubusinoj_', 'Комплект со стразами и крупной полубусиной', NULL, 9, 'Комплект (серьги - клипсы и колье), выполнен в модной черно-белой гамме. Украшен стразами и крупной полубусиной с фарфоровым блеском. Металл серебрянного цвета. \r\nДлина: 36 + 5 см. Диаметр кулона и серег 2,0 см.\r\nСостав: Металл, стразы', 'ВА-К-760/31', NULL, 930, NULL, 340, '2017-10-11 15:21:13', '2017-10-11 15:21:13', NULL, 0, 1, '', '', '', '', '', ''),
(1440, 0, 10, 0, 'komplekt_s_krupnym_krasnym_kristallom', 'Комплект с  крупным красным кристаллом', NULL, 9, 'Яркий комплект выполнен из металла золотого цвета и украшен сверкающими стразами и крупным красным кристаллом.\r\nПодберите украшение на руку в разделе браслеты.\r\nДлина: 44 см + 6 см. Размер подвески и сережек 2,5 см х 1,7 см.\r\nСостав: Металл, стразы', 'ВА-К-760/46', NULL, 770, NULL, 260, '2017-10-11 15:25:39', '2017-10-11 15:25:39', NULL, 0, 1, '', '', '', '', '', ''),
(1441, 0, 10, 0, 'klassicheskij_komplekt_v_vide_kulona_na_tonkoj_cepochke', 'Классический комплект в виде кулона на тонкой цепочке', NULL, 9, 'Классический комплект (ожерелье + сережки) в виде кулона на тонкой цепочке цвета черненого серебра. Кулон и сережки украшены крупными сверкающими кристаллами.\r\nДлина цепочки  48 см + 6 см. Размер подвески и сережек 2,5 см х 1,7 см.\r\nСостав: Металл, кристаллы', 'ВА-К-760/49-50', NULL, 770, NULL, 260, '2017-10-11 15:31:15', '2017-10-11 15:31:15', NULL, 0, 1, '', '', '', '', '', ''),
(1442, 0, 10, 0, 'effektnyj_komplekt_iz_ozherele_i_sergi', 'Эффектный  комплект из  ожерелье и серьги', NULL, 9, 'Эффектный и вместе с тем универсальный комплект (ожерелье + серьги). выполнен из металла  цвета желтого и белого золота с матовым блеском. Комплект декорован стразами. Подойдет и к открытому вечернему платью и однотонной блузке или скромному платью с вырезом.\r\nДлина цепочки  48 см + 6 см. Диаметр подвески 4 см, сережек 2,5 см.\r\nСостав: Металл, стразы\r\n', 'ВА-К-760/51', NULL, 1070, NULL, 410, '2017-10-11 15:49:18', '2017-10-11 15:49:18', NULL, 0, 1, '', '', '', '', '', ''),
(1443, 0, 10, 0, 'komplekt_iz_metalla_cveta_zheltogo_i_belogo_zolota', 'Комплект  из металла  цвета желтого и белого золота', NULL, 9, 'Эффектный и вместе с тем универсальный комплект (ожерелье + серьги). выполнен из металла  цвета желтого и белого золота. Подойдет и к открытому вечернему платью и однотонной блузке или скромному платью с вырезом.\r\nДлина цепочки  48 см + 6 см. Диаметр подвески 4 см, сережек 2,5 см.\r\nСостав: Металл', 'ВА-К-760/52', NULL, 1070, NULL, 410, '2017-10-11 15:56:09', '2017-10-11 15:56:09', NULL, 0, 1, '', '', '', '', '', ''),
