(1473, 0, 10, 0, 'komplekt_s_sinimi_kamnyami_ovalnoj_formy', 'Комплект с синими камнями овальной формы', NULL, 9, 'Комплект (серьги, браслет и бусы), украшенный вставками из каменя. Длина: 60 см. Серьги:  3 см.\r\nСостав: камни, металл.', 'ВА-К-720/87', NULL, 1350, NULL, 550, '2017-10-11 18:52:49', '2017-10-11 18:52:49', NULL, 0, 1, '', '', '', '', '', ''),
(1474, 0, 10, 0, 'komplekt_s_korichnevymi_kamnyami_pryamougolnoj_formy', 'Комплект с коричневыми камнями прямоугольной формы', NULL, 9, 'Шикарный комплект (подвес + браслет + серьги) выполнен из металла серебряного цвета с вставкой из камня. Длина: 60 см.\r\nСостав: камни, металл.', 'ВА-К-395', NULL, 1350, NULL, 550, '2017-10-11 18:55:13', '2017-10-11 19:02:42', NULL, 0, 1, '', '', '', '', '', ''),
(1475, 0, 10, 0, 'komplekt_s_korichnevymi_kamnyami_ovalnoj_formy', 'Комплект с коричневыми камнями овальной формы', NULL, 9, 'Комплект (серьги, браслет и бусы), украшенный вставками из камня. Длина: 60 см. Серьги:  3 см.\r\nСостав: камни, металл.', 'ВА-К-720/93', NULL, 1350, NULL, 550, '2017-10-11 19:02:13', '2017-10-11 19:03:18', NULL, 0, 1, '', '', '', '', '', ''),
(1476, 0, 10, 0, 'komplekt_iz_metalla_s_perlamutrovymi_vstavkami', 'Комплект из металла с перламутровыми вставками', NULL, 9, 'Лаконичнный комплект (ожерелье и серьги) из металла серебристого цвета. Украшен перламутровыми вставками белого цвета. \r\nБусы: 50 см. Серьги: 3 см.\r\nСостав: Пластик, металл.', 'ВА-К-750/38', NULL, 1670, NULL, 710, '2017-10-11 19:05:31', '2017-10-11 19:05:31', NULL, 0, 1, '', '', '', '', '', ''),
(1477, 0, 10, 0, 'komplekt_iz_3_h_predmetov_s_belymi_kamnyami', 'Комплект из 3-х предметов с белыми камнями', NULL, 9, 'Шикарный комплект (подвес + браслет + серьги) выполнен из металла серебряного цвета с вставкой из камня. Длина: 60 см.\r\nСостав: камни, металл.', 'ВА-К-396', NULL, 1350, NULL, 550, '2017-10-11 19:09:26', '2017-10-11 19:09:26', NULL, 0, 1, '', '', '', '', '', ''),
(1478, 0, 10, 0, 'vorotnichok_iz_busin_belogo_cveta', 'Воротничок из бусин белого цвета', NULL, 9, 'Колье нашивное выполнено из бусин. Длина: 50 см.\r\nСостав: Пластик, металл', 'ВА-Бу-610/98', NULL, 950, NULL, 350, '2017-10-12 19:42:32', '2017-10-12 19:42:32', NULL, 0, 1, '', '', '', '', '', ''),
(1479, 0, 10, 0, 'sinee_kole_iz_plastika_i_metalla', 'Синее колье из пластика и металла', NULL, 9, 'Очаровательный подвес из пластика и металла на текстильном шнурке. Немного страз и жемчужин. Металлические детали цвета темного золота подчеркивают его красоту. Цвет темный синий.\r\nДлина 38 см + 5 см. Диаметр кулона 10 см.\r\nСостав: Пластик, текстиль, металл.', 'ВА-П-84/88', NULL, 1450, NULL, 600, '2017-10-12 19:46:47', '2017-10-12 19:46:47', NULL, 0, 1, '', '', '', '', '', ''),
(1480, 0, 10, 0, 'vorotnichok_iz_busin_rozovogo_cveta', 'Воротничок из бусин розового цвета', NULL, 9, 'Шикарный нашивной воротничок из бусинок. Длина: 35 см. Ширина: 4 см.\r\nСостав: Пластик, металл\r\n', 'ВА-Вр-801/1', NULL, 790, NULL, 270, '2017-10-12 19:53:18', '2017-10-12 19:53:18', NULL, 0, 1, '', '', '', '', '', ''),
(1481, 0, 10, 0, 'massivnoe_kole_iz_plastika', 'Массивное колье из пластика', NULL, 9, 'Выдающееся украшение из пластика, с имитацией муранского стекла, привлечет внимание перламутровым сиянием и блеском металлических деталей.\r\nРазмер 36 см + 5 см. Размер центрального элемента 7 см х 2 см.\r\nСостав: Пластик, металл.', 'ВА-П-84/53-55', NULL, 1470, NULL, 610, '2017-10-12 19:54:26', '2017-10-12 19:54:26', NULL, 0, 1, '', '', '', '', '', ''),
(1482, 0, 10, 0, 'ob_emnoe_ozherele_v_avangardnom_stile', 'Объемное ожерелье в авангардном стиле', NULL, 9, 'Объемное ожерелье в авангардном стиле выполнено из пластика.\r\nШнурок - репсовая лента.\r\nДлина лент 50 см. Диаметр колец 5 см.\r\nСостав: пластик, текстиль.', 'ВА-П-84/49-51', NULL, 1470, NULL, 610, '2017-10-12 20:01:49', '2017-10-12 20:01:49', NULL, 0, 1, '', '', '', '', '', ''),
(1483, 0, 10, 0, 'belyj_vorotnichok_iz_busin_', 'Белый воротничок из бусин', NULL, 9, 'Колье нашивное выполнено из бусин. Длина: 50 см.\r\nСостав: Пластик, металл', 'ВА-Бу-610/97', NULL, 950, NULL, 350, '2017-10-12 20:03:04', '2017-10-12 20:03:04', NULL, 0, 1, '', '', '', '', '', ''),
(1484, 0, 10, 0, 'stilnyj_vorotnik_iz_busin_belogo_cveta', 'Стильный воротник из бусин белого цвета', NULL, 9, 'Обворожительное ажурное колье. Длина: 40 см. + 15 см.\r\nСостав: Пластик, металл', 'ВА-Бу-610/87', NULL, 950, NULL, 350, '2017-10-12 20:09:30', '2017-10-12 20:09:30', NULL, 0, 1, '', '', '', '', '', ''),
(1485, 0, 10, 0, 'stilnoe_kole_cherno_zolotogo_cveta', 'Стильное колье черно-золотого цвета', NULL, 9, 'Стильное колье. Длина: 55 см. + 5 см.\r\nСостав: пластик, металл.', 'ВА-П-3/80', NULL, 1450, NULL, 600, '2017-10-12 20:11:46', '2017-10-12 20:11:46', NULL, 0, 1, '', '', '', '', '', ''),
(1486, 0, 10, 0, 'shirokie_busy_belogo_cveta', 'Широкие бусы белого цвета', NULL, 9, 'Колье выполнено из бусин. Длина: 50 см.\r\nСостав: Пластик, металл ', 'ВА-Бу-611/7', NULL, 950, NULL, 350, '2017-10-12 20:17:16', '2017-10-12 20:17:16', NULL, 0, 1, '', '', '', '', '', ''),
(1487, 0, 10, 0, 'kozhanoe_kole_s_zolotymi_aksessuarami', 'Кожаное колье с золотыми аксессуарами', NULL, 9, 'Стильное колье из кожи и металла. Яркие элементы из переплетений и камней привлекают внимание и придают образу загадочности и шарма.\r\nСостав: металл, экокожа.', 'ВА-П-82/27-27-2', NULL, 1450, NULL, 600, '2017-10-12 20:20:25', '2017-10-12 20:20:25', NULL, 0, 1, '', '', '', '', '', ''),
(1488, 0, 10, 0, 'kole_chernogo_cveta_s_bahromoj', 'Колье черного цвета с бахромой', NULL, 9, 'Трендовый подвес из кожи черного цвета украшен крупным кристаллом и модной бахромой. Шнурки из кожи разного цвета.\r\nДлина 40 см. Бахрома 8 см.\r\nСостав: Металл, текстиль, стразы', 'ВА-П-84/87', NULL, 1450, NULL, 600, '2017-10-12 20:23:27', '2017-10-12 21:05:51', NULL, 0, 1, '', '', '', '', '', ''),
(1489, 0, 10, 0, 'stilnaya_podveska_s_krupnym_kristallom', 'Стильная подвеска с крупным кристаллом', NULL, 9, 'Стильный короткий подвес из пластика (имитация муранского стекла) и металла на металлической цепочке. Крупный голубой кристалл переливается золотыми бликами.\r\nДлина 36 см + 6 см. Диаметр кулона 6 см.\r\nСостав: пластик, металл.', 'ВА-П-84/70', NULL, 1070, NULL, 410, '2017-10-12 20:26:03', '2017-10-12 20:26:03', NULL, 0, 1, '', '', '', '', '', ''),
(1490, 0, 10, 0, 'stilnaya_podveska_geometricheskoj_formy', 'Стильная подвеска геометрической формы', NULL, 9, 'Стильный короткий подвес из пластика (имитация муранского стекла) и металла геометрической формы на кожанной тесьме. Красивый рисунок белого цвета на черных элементах создает иллюзию натурального камня.\r\nДлина 42 см + 6 см. Длина кулона 14 см.', 'ВА-П-84/71', NULL, 1170, NULL, 460, '2017-10-12 20:30:41', '2017-10-12 20:30:41', NULL, 0, 1, '', '', '', '', '', ''),
(1491, 0, 10, 0, 'stilnoe_kole_na_zamshevom_shnurke', 'Стильное колье на замшевом шнурке', NULL, 9, 'Этот изумительный подвес - модная стилизация этнического стиля. Замшевый шнурок, металл серебрянного цвета. \r\nДлина 40 см. Диаметр кулона 6,5 см.\r\nСостав: Металл, текстиль', 'ВА-П-24/32-33', NULL, 1290, NULL, 520, '2017-10-12 20:31:12', '2017-10-12 21:03:06', NULL, 0, 1, '', '', '', '', '', ''),
(1492, 0, 10, 0, 'modnoe_kole_iz_iskusstvennoj_kozhi', 'Модное колье из искусственной кожи', NULL, 9, 'Изумительный подвес из кожи украшен бахромой. Украшен крупным кристаллом. \r\nДлина 38 см + 5 см. Длина кулона 11 см.\r\nСостав: Металл, текстиль, стразы', 'ВА-П-84/85-86', NULL, 1290, NULL, 520, '2017-10-12 20:39:15', '2017-10-12 21:05:01', NULL, 0, 1, '', '', '', '', '', ''),
(1493, 0, 10, 0, 'effektnoe_kole_iz_plastika', 'Эффектное колье из пластика', NULL, 9, 'Эффектный подвес из пластика (имитация муранского стекла) и металла геометрической формы на вощеных текстильных шнурках. Красивый рисунок на круглых элементах бордовых оттенков создает иллюзию натурального камня.\r\nДлина шнурка 80 см.Диаметр кулона 6 см.\r\nСостав: Металл, текстиль', 'ВА-П-24/55', NULL, 1370, NULL, 560, '2017-10-12 20:50:06', '2017-10-12 21:04:10', NULL, 0, 1, '', '', '', '', '', ''),
(1494, 0, 10, 0, 'stilnaya_podveska_na_tekstilnom_shnurke', 'Стильная подвеска на текстильном шнурке', NULL, 9, 'Изящный подвес  на вощеном текстильном шнурке.\r\nДлина шнурка 66 см.Длина кулона 14 см.\r\nСостав: Металл, текстиль, стразы', 'ВА-П-24/47', NULL, 1130, NULL, 440, '2017-10-12 20:57:08', '2017-10-12 21:23:41', NULL, 0, 1, '', '', '', '', '', ''),
(1495, 0, 10, 0, 'stilnaya_svetlaya_podveska_na_kozhanoj_tesme', 'Стильная светлая подвеска на кожаной тесьме', NULL, 9, 'Стильный короткий подвес из пластика (имитация муранского стекла) и металла геометрической формы на кожанной тесьме. Красивый рисунок бежевого цвета на элементах карамельного оттенка создает иллюзию натурального камня.\r\nДлина 42 см + 6 см. Длина кулона 14 см.\r\nСостав: пластик, металл.', 'ВА-П-84/73', NULL, 1170, NULL, 460, '2017-10-12 21:24:37', '2017-10-12 21:24:37', NULL, 0, 1, '', '', '', '', '', ''),
(1496, 0, 10, 0, 'stilnaya_podveska_na_kozhanoj_tesme_belogo_cveta', 'Стильная подвеска на кожаной тесьме белого цвета', NULL, 9, 'Стильный короткий подвес из пластика (имитация муранского стекла) и металла на кожанной тесьме белого цвета. Красивый рисунок молочного цвета на круглой бежевой бусине создает иллюзию натурального камня.\r\nДлина 42 см + 6 см. Диаметр кулона 5 см.\r\nСостав: металл, экокожа.', 'ВА-П-84/72', NULL, 1170, NULL, 460, '2017-10-12 21:30:22', '2017-10-12 21:30:22', NULL, 0, 1, '', '', '', '', '', ''),
(1497, 0, 10, 0, 'massivnoe_geometricheskoe_ozherele_v_avangardnom_stile', 'Массивное геометрическое ожерелье в авангардном стиле', NULL, 9, 'Массивное геометрическое ожерелье в авангардном стиле на вощеных текстильных шнурках. Металлические элементы золотого цвета с фактурной поверхностью.\r\nДлина 40 см + 9 см.\r\nСостав: металл, текстиль.', 'ВА-П-84/74-76', NULL, 1170, NULL, 460, '2017-10-12 21:53:51', '2017-10-12 21:53:51', NULL, 0, 1, '', '', '', '', '', ''),
(1498, 0, 10, 0, 'originalnaya_podveska_v_avangardnom_stile', 'Оригинальная подвеска в авангардном стиле', NULL, 9, 'Оригинальное ожерелье в авангардном стиле на вощеных текстильных шнурках. Металлический кулон украшен дорожкой сияющих страз.\r\nДлина 42 см + 5 см. Диаметр кулона 6 см.\r\nСостав: текстиль, металл.', 'ВА-П-84/77-78', NULL, 890, NULL, 320, '2017-10-12 21:58:47', '2017-10-12 21:58:47', NULL, 0, 1, '', '', '', '', '', ''),
(1499, 0, 10, 0, 'podveska_s_kulonom_iz_metalla_i_dereva', 'Подвеска с кулоном из металла и дерева', NULL, 9, 'Оригинальное ожерелье в авангардном стиле на вощеных текстильных шнурках черного цвета. Металлический кулон серебрянного цвета украшен вставкой из дерева, окрашенной в бордовый цвет.\r\nДлина 42 см + 5 см. Диаметр кулона 6 см.\r\nСостав: металл, текстиль, дерево.', 'ВА-П-84/79', NULL, 890, NULL, 320, '2017-10-12 22:03:27', '2017-10-12 22:03:27', NULL, 0, 1, '', '', '', '', '', ''),
(1500, 0, 10, 0, 'podveska_v_avangardnom_stile', 'Подвеска в авангардном стиле', NULL, 9, 'Оригинальное ожерелье в авангардном стиле на вощеных текстильных шнурках черного цвета. Кулон из дерева украшен металлическим элементом и серыми жемчужинками.\r\nДлина 42 см + 5 см. Диаметр кулона 6 см.\r\nСостав: металл, дерево, текстиль.', 'ВА-П-84/80-81', NULL, 870, NULL, 310, '2017-10-12 22:10:10', '2017-10-12 22:10:10', NULL, 0, 1, '', '', '', '', '', ''),
(1501, 0, 10, 0, 'podveska_so_strazami_i_kristallom', 'Подвеска со стразами и кристаллом', NULL, 9, 'Оригинальное ожерелье в авангардном стиле на вощеных текстильных шнурках черного цвета. Кулон из дерева, окрашенного в бордовый цвет, украшен серыми стразами и кристаллом.\r\nДлина 42 см + 5 см. Диаметр кулона 6 см.\r\nСостав: металл, дерево, текстиль, стразы, камни.', 'ВА-П-84/82', NULL, 870, NULL, 310, '2017-10-12 22:13:45', '2017-10-12 22:13:45', NULL, 0, 1, '', '', '', '', '', ''),
(1502, 0, 10, 0, 'cepochka_s_vstavkami_iz_chernoj_emali', 'Цепочка с вставками из черной эмали', NULL, 9, 'Практичное ожерелье в городском стиле выполнено из металла серебрянного цвета. Украшено вставками из черной эмали.\r\nДлина 50 см. Ширина 0,5 см.\r\nСостав: металл, эмаль.', 'ВА-П-84/83', NULL, 890, NULL, 320, '2017-10-12 22:16:38', '2017-10-12 22:16:38', NULL, 0, 1, '', '', '', '', '', ''),
(1503, 0, 10, 0, 'bordovoe_kole_iz_plastika_i_tekstilya', 'Бордовое колье из пластика и текстиля', NULL, 9, 'Ожерелье из пластика и текстиля способно создать образ женственный, спортивный, динамичный, романтичный.\r\nХорошо сочетается с одеждой в стиле кэжуал, с однотонным трикотажем, изделиями из кожи. Цвет бордовый.\r\nДлина шнурка 46 см. Размер центральной подвески 4 см х 2см.\r\nСостав: пластик, текстиль, металл.', 'ВА-П-24/38', NULL, 1090, NULL, 420, '2017-10-12 22:19:43', '2017-10-12 22:19:43', NULL, 0, 1, '', '', '', '', '', ''),
(1504, 0, 10, 0, 'ozherele_na_tekstilnyh_shnurkah_korichnevogo_cveta', 'Ожерелье на текстильных шнурках коричневого цвета', NULL, 9, 'Ожерелье из пластика, металла и текстиля способно создать образ женственный, спортивный, динамичный, романтичный.\r\nХорошо сочетается с одеждой в стиле кэжуал, с однотонным трикотажем, изделиями из кожи. Цвет бордовый и коричневый.\r\nДлина шнурка 46 см. Размер центральной подвески 7 см х 4,5 см.\r\nСостав: пластик, текстиль, металл.', 'ВА-П-24/39', NULL, 1070, NULL, 410, '2017-10-12 22:23:11', '2017-10-12 22:23:11', NULL, 0, 1, '', '', '', '', '', ''),
(1505, 0, 10, 0, 'podveska_na_shelkovom_shnurke_s_imitaciej_zhemchuga', 'Подвеска на шелковом шнурке с имитацией жемчуга', NULL, 9, 'Изящный подвес - имитация жемчуга, украшен сверкающими стразами. Универсальное украшение будет уместно и днем и вечером.\r\nШелковый шнурок, приятный к телу.\r\nДлина 44 см + 5 см.\r\nСостав: пластик, текстиль, стразы.', 'ВА-П-84/44', NULL, 930, NULL, 340, '2017-10-12 22:26:38', '2017-10-12 22:26:38', NULL, 0, 1, '', '', '', '', '', ''),
(1506, 0, 10, 0, 'podveska_iz_naturalnogo_perlamutra_i_straz', 'Подвеска из натурального перламутра и страз', NULL, 9, 'Роскошный подвес из переливчатого натурального перламутра и сверкающих страз завораживает и приковывает внимание к его обладательнице.\r\nШелковый шнурок, приятный к телу.\r\nДлина 44 см + 5 см.\r\n', 'ВА-П-84/43', NULL, 930, NULL, 340, '2017-10-12 22:29:30', '2017-10-12 22:29:30', NULL, 0, 1, '', '', '', '', '', ''),
(1507, 0, 10, 0, 'ocharovatelnoe_kole_v_marokanskom_stile', 'Очаровательное колье в мароканском стиле', NULL, 9, 'Очаровательное колье в мароканском стиле, украшеное стразами различного размера.  Длина: 55+5 см.', 'ВА-П-31/6-8', NULL, 1390, NULL, 570, '2017-10-13 10:51:52', '2017-10-13 12:16:04', NULL, 0, 1, '', '', '', '', '', ''),
