(1522, 0, 10, 0, 'ekstravagantnaya_podveska_na_tolstom_kozhanom_shnurke', 'Экстравагантная подвеска на толстом кожаном шнурке', NULL, 9, 'Экстравагантная подвеска на толстом плетеном кожаном шнурке смотрится очень эффектно. Такой кулон из камня с сияющими стразами хорошо сочетается с одеждой в стиле кэжуал, с однотонным трикотажем, изделиями из кожи. А элементы из золотистого металла делают его очень нарядным.\r\nДлина шнурка 64 см. Размер кулона 6,5 см х 3,5 см.\r\nСостав: 	Металл, стразы, камень.\r\n', 'ВА-П-24/37', NULL, 870, NULL, 310, '2017-10-13 13:01:56', '2017-10-13 13:01:56', NULL, 0, 1, '', '', '', '', '', ''),
(1523, 0, 10, 0, 'effektnaya_podveska_iz_metalla_s_matovym_bleskom', 'Эффектная подвеска из металла с матовым блеском', NULL, 9, 'Эффектная и вместе с тем универсальная подвеска. выполнена из металла  цвета желтого и белого золота с матовым блеском. Декорирована сверкающими стразами. Подойдет и к открытому вечернему платью и однотонной блузке или скромному платью с вырезом.\r\nДлина цепочки  48 см + 6 см. Диаметр подвески 4 см.\r\nСостав: Металл, стразы.', 'ВА-П-84/84', NULL, 770, NULL, 260, '2017-10-13 13:08:01', '2017-10-13 13:08:01', NULL, 0, 1, '', '', '', '', '', ''),
(1524, 0, 10, 0, 'kole_na_tekstilnom_shnurke_so_strazami', 'Колье на текстильном шнурке со стразами', NULL, 9, 'Очаровательный подвес на текстильном шнурке, украшен стразами. Длина: 60 см. + 5 см.', 'ВА-П-82/47', NULL, 950, NULL, 350, '2017-10-13 13:09:58', '2017-10-13 13:09:58', NULL, 0, 1, '', '', '', '', '', ''),
(1525, 0, 10, 0, 'interesnaya_podveska_pod_chernoe_derevo', 'Интересная подвеска под черное дерево', NULL, 9, 'Интересная подвеска из черного пластика, имитирующего дерево,  и металла серебристого цвета смотрится просто, необычно и оригинально. \r\nХорошо сочетается с одеждой в стиле кэжуал, с однотонным трикотажем, изделиями из кожи. \r\nДлина шнурка 76 см.Диаметр центральной подвески 6 см.\r\nСостав: Пластик, металл.', 'ВА-П-24/43', NULL, 870, NULL, 310, '2017-10-13 13:14:17', '2017-10-13 13:14:17', NULL, 0, 1, '', '', '', '', '', ''),
(1526, 0, 10, 0, 'zhenstvennoe_kole_na_tekstilnom_shnurke', 'Женственное колье на текстильном шнурке', NULL, 9, 'Очаровательный подвес на текстильном шнурке, украшен стразами. Длина: 60 см. + 5 см.', 'ВА-П-82/48', NULL, 950, NULL, 350, '2017-10-13 13:16:13', '2017-10-13 13:16:13', NULL, 0, 1, '', '', '', '', '', ''),
(1527, 0, 10, 0, 'podveska_v_etno_stile_iz_kozhi_i_zamshi', 'Подвеска в этно стиле из кожи и замши', NULL, 9, 'Подвеска в этно стиле из кожи и замши черного цвета украшена черными и серыми бусинами. Чашечки для бусин из металла бронзового цвета покрыты эмалью мятного цвета.\r\nДлина 80 см. Длина кулона 18 см.\r\nСостав: Пластик, текстиль, эмаль.', 'ВА-П-24/30', NULL, 1290, NULL, 520, '2017-10-13 13:17:50', '2017-10-13 13:17:50', NULL, 0, 1, '', '', '', '', '', ''),
(1528, 0, 10, 0, 'krasivaya_podveska_s_peryami_marabu', 'Красивая подвеска с перьями марабу', NULL, 9, 'Эта красивая подвеска - модная стилизация этнического стиля. Перья марабу, натуральный камень белого цвета, черная замша и бахрома из металлической серебристой цепочки.\r\nДлина 80 см. Длина кулона 20 см.\r\nСостав: Пластик, текстиль, перья, металл.', 'ВА-П-24/31', NULL, 1290, NULL, 520, '2017-10-13 13:24:44', '2017-10-13 13:24:44', NULL, 0, 1, '', '', '', '', '', ''),
(1529, 0, 10, 0, 'metallicheskoe_kole_zolotogo_cveta', 'Металлическое колье золотого цвета', NULL, 9, 'Очаровательный подвес на текстильном шнурке, украшен стразами. Длина: 60 см. + 5 см.', 'ВА-П-7/79-1', NULL, 1050, NULL, 400, '2017-10-13 13:25:39', '2017-10-13 13:25:39', NULL, 0, 1, '', '', '', '', '', ''),
(1530, 0, 10, 0, 'izyskannaya_udlinennaya_podveska', 'Изысканная удлинённая подвеска', NULL, 9, 'Изысканная удлинённая подвеска  с сияющим стразом гармонично сочетает белое и черное с матовым золотом.\r\nДлина 70 см. Кулон 11 см. Диаметр бархатной черной основы 3,5 см.\r\nСостав: 	Металл, стразы, бархат, бусины.\r\n', 'ВА-П-23/64', NULL, 890, NULL, 320, '2017-10-13 13:30:17', '2017-10-13 13:31:57', NULL, 0, 1, '', '', '', '', '', ''),
(1531, 0, 10, 0, 'izumitelnoe_kole_so_strazami_i_kristallami', 'Изумительное колье со стразами и кристаллами', NULL, 9, 'Изумительное колье , украшеное стразами и кристаллами. Длина: 22 см. + 5 см.', 'ВА-П-82/52-53', NULL, 950, NULL, 350, '2017-10-13 13:31:21', '2017-10-13 13:31:21', NULL, 0, 1, '', '', '', '', '', ''),
(1532, 0, 10, 0, 'izyashnaya_podveska_s_chernymi_businami', 'Изящная подвеска с черными бусинами', NULL, 9, 'Изящная подвеска выполнена с использованием различных техник. Крупный сверкающий кристалл, черные бусины разной формы. Кулон декорирован искусственной кожей. Металлическая основа золотого цвета.\r\nДлина 70 см. Кулон 6 см.\r\nСостав: Металл, текстиль, пластик, стразы.', 'ВА-П-23/25', NULL, 890, NULL, 320, '2017-10-13 13:35:26', '2017-10-13 13:35:26', NULL, 0, 1, '', '', '', '', '', ''),
(1533, 0, 10, 0, 'stilnoe_kole_ukrashennoe_strazami', 'Стильное колье украшенное стразами', NULL, 9, 'Великолепный подвес, украшенный стразами.\r\nДлина: 50 см. + 5 см.', 'ВА-П-82/81-82', NULL, 850, NULL, 300, '2017-10-13 13:37:05', '2017-10-13 13:48:34', NULL, 0, 1, '', '', '', '', '', ''),
(1534, 0, 10, 0, 'stilnaya_podveska_na_vse_vremena', 'Стильная подвеска на все времена', NULL, 9, 'Стильная подвеска на все времена  может стать Вашей любимой как раз из-за своей простоты! Выполнена из черной кожи на вощеном шнурке с металлическим элементом крепления золотистого цвета.\r\nДлина 60 см. Кулон 15 см.\r\nСостав: Металл, текстиль.', 'ВА-П-24/17', NULL, 850, NULL, 300, '2017-10-13 13:42:48', '2017-10-13 13:42:48', NULL, 0, 1, '', '', '', '', '', ''),
(1535, 0, 10, 0, 'neobychnaya_i_izyskannaya_podveska_iz_metalla_', 'Необычная и изысканная подвеска из металла', NULL, 9, 'Изысканное и вместе с тем простое украшение - подвеска из металла золотистого цвета и черной искусственной кожи создаст легкий, но экстравагантный образ.\r\nДлина шнурка 92 см. Длина подвески 8 см.\r\nСостав: Металл, текстиль.', 'ВА-П-24/41', NULL, 1090, NULL, 420, '2017-10-13 13:47:06', '2017-10-13 13:47:06', NULL, 0, 1, '', '', '', '', '', ''),
(1536, 0, 10, 0, 'neobychnaya_podveska_reguliruemoj_dliny', 'Необычная подвеска регулируемой длины', NULL, 9, 'Сочетание необычного и оригинального - подвеска из металла золотистого цвета и черной искусственной кожи. Изюминка подвески - регулируемая длина!\r\nДлина шнурка 60 см. Длина кисточек 9,5 см.\r\nСостав: Металл, текстиль.', 'ВА-П-24/40', NULL, 1090, NULL, 420, '2017-10-13 13:51:23', '2017-10-13 13:54:40', NULL, 0, 1, '', '', '', '', '', ''),
(1537, 0, 10, 0, 'kole_s_raznocvetnymi_strazami', 'Колье с разноцветными стразами', NULL, 9, 'Великолепный подвес, украшенный стразами.\r\nДлина: 50 см. + 5 см.', 'ВА-П-82/84', NULL, 790, NULL, 270, '2017-10-13 13:52:04', '2017-10-13 13:52:04', NULL, 0, 1, '', '', '', '', '', ''),
