(1539, 0, 10, 0, 'neobychajno_yarkaya_krasnaya_podveska', 'Необычайно яркая красная подвеска', NULL, 9, 'Необычайно яркая подвеска из искусственной кожи веселого красного цвета создает контраст с черными кожаными шнурами, на которых она висит. Она обязательно поднимет Вам настроение! Крепление из металла золотистого цвета. \r\nДлина 60 см. Кулон 16 см.\r\nСостав: металл, искусственная кожа.', 'ВА-П-22/29', NULL, 850, NULL, 300, '2017-10-13 13:59:31', '2017-10-13 14:01:37', NULL, 0, 1, '', '', '', '', '', ''),
(1540, 0, 10, 0, 'velikolepnoe_kole_s_temnymi_strazami', 'Великолепное колье  с темными стразами', NULL, 9, 'Великолепное колье из металла золотого цвета, украшенное стразами.  \r\nДлина: 50 см. + 5 см.', 'ВА-П-83/6-7', NULL, 910, NULL, 330, '2017-10-13 14:06:33', '2017-11-23 16:00:38', NULL, 0, 1, '', '', '', '', '', ''),
(1541, 0, 10, 0, 'kulon_iz_shirokoj_bahromy_belogo_cveta_na_chernom_shnure', 'Кулон из широкой бахромы белого цвета на черном шнуре', NULL, 9, 'Актуальный кожаный тренд. Кулон из широкой бахромы белого цвета закреплена в золотом металле с выработкой и необычайно красиво оттеняется черный шнуром из искусственной кожи.\r\nДлина 60 см. Кулон 16 см.\r\nСостав: Металл, искусственна я кожа.', 'ВА-П-23/38', NULL, 850, NULL, 300, '2017-10-13 14:09:05', '2017-10-13 14:11:53', NULL, 0, 1, '', '', '', '', '', ''),
(1542, 0, 10, 0, 'kulon_iz_bahromy_belogo_cveta_na_chernom_shnure', 'Кулон из бахромы белого цвета на черном шнуре', NULL, 9, 'Актуальный кожаный тренд. Кулон из бахромы белого цвета закреплена в золотом металле с выработкой и необычайно красиво оттеняется черный шнуром из искусственной кожи.\r\nДлина 60 см. Кулон 16 см.\r\nСостав: Металл, искусственна я кожа.', 'ВА-П-23/39', NULL, 850, NULL, 300, '2017-10-13 14:13:51', '2017-10-13 14:13:51', NULL, 0, 1, '', '', '', '', '', ''),
