(1545, 0, 10, 0, 'prekrasnaya_igrivaya_mehovaya_podveska', 'Прекрасная игривая меховая подвеска', NULL, 9, 'Прекрасная игривая меховая подвеска в трех цветах. Интересное крепление выполнено из металла такого же серебристого цвета, как и цепочка, на которой висит подвеска.\r\nРазмер: 80 см. + 5 см.\r\nСостав: Металл, искусственный мех.', 'ВА-П-23/4-6', NULL, 930, NULL, 340, '2017-10-13 14:23:50', '2017-10-13 14:25:06', NULL, 0, 1, '', '', '', '', '', ''),
