(1548, 0, 10, 0, 'velikolepnaya_podveska_iz_metalla', 'Великолепная подвеска из металла', NULL, 9, 'Очаровательный  металлический подвес, украшен стразами. \r\nДлина: 60 см. + 5 см.', 'ВА-П-22/75', NULL, 790, NULL, 270, '2017-10-13 14:37:57', '2017-10-13 14:37:57', NULL, 0, 1, '', '', '', '', '', ''),
(1549, 0, 10, 0, 'metallicheskaya_podveska_s_sinem_kamnem', 'Металлическая подвеска с синем камнем', NULL, 9, 'Великолепный металлический подвес. Длина: 80 см. + 5 см.', 'ВА-П-22/77', NULL, 790, NULL, 270, '2017-10-13 14:42:32', '2017-10-13 14:42:32', NULL, 0, 1, '', '', '', '', '', ''),
(1550, 0, 10, 0, 'prekrasnaya_dlinnaya_mehovaya_podveska', 'Прекрасная длинная меховая подвеска', NULL, 9, 'Прекрасная бордовая меховая подвеска с болтающимися бусинами. Крепление выполнено из зачерненного металла ,как и цепочка, на которой висит подвеска.\r\nРазмер: 80 см. + 5 см.\r\nСостав: Металл, искусственный мех.', 'ВА-П-23/7', NULL, 930, NULL, 340, '2017-10-13 14:44:00', '2017-10-13 14:44:00', NULL, 0, 1, '', '', '', '', '', ''),
(1551, 0, 10, 0, 'yarkie_busy_s_businami_krugloj_formy', 'Яркие бусы с бусинами круглой формы', NULL, 9, 'Яркие бусы , создающие веселое настроение. Бусины круглой формы, на которых отчетливо видны характерные для камня прожилки.\r\nДлина: 40 см. Диаметр бусин 14 мм.\r\nСостав: Камень.', 'ВА-Бу-641/48-49', NULL, 830, NULL, 290, '2017-10-13 14:51:30', '2017-10-13 16:12:24', NULL, 0, 1, '', '', '', '', '', ''),
(1552, 0, 10, 0, 'podveska_v_vide_cvetka_vasilkovogo_cveta', 'Подвеска в виде цветка василькового цвета', NULL, 9, 'Чудесный подвес в виде цветка василькового цвета. Серебристый металл.\r\nДлина регулируется Диаметр цветка 3 см.', 'ВА-П-23/66', NULL, 870, NULL, 310, '2017-10-13 14:55:00', '2017-10-13 14:55:00', NULL, 0, 1, '', '', '', '', '', ''),
(1553, 0, 10, 0, 'izyashnoe_kole_s_kulonom_v_vide_babochki_', 'Изящное колье с кулоном в виде бабочки', NULL, 9, 'Изящное колье с кулоном в виде бабочки привнесет яркое лето в Ваш повседневный образ. Бронзовое металлическое основание украшают бусины из натурального камня огненного красного цвета. Коричневый атласный витой шнурок.\r\nДлина 42 см. Размер бабочки 4,5 см х 3 см.\r\nСостав: Металл, камень, текстиль.', 'ВА-П-84/31', NULL, 1110, NULL, 430, '2017-10-13 14:58:18', '2017-10-13 14:59:57', NULL, 0, 1, '', '', '', '', '', ''),
(1554, 0, 10, 0, 'divnaya_podveska_v_vide_cvetka_iz_naturalnogo_kamnya_', 'Дивная подвеска в виде цветка из натурального камня', NULL, 9, 'Дивная  подвеска в виде цветка  из натурального камня двух цветов на плетеном кожаном черном шнурке.\r\nДлина 74 см. Диаметр цветка 6 см.\r\nСостав: Камень, текстиль.', 'ВА-П-24/26-27', NULL, 1490, NULL, 620, '2017-10-13 15:04:20', '2017-10-13 15:04:20', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1555, 0, 10, 0, 'ochen_stilnaya_dlinnaya_podveska_v_vide_cvetka', 'Очень стильная длинная подвеска в виде цветка', NULL, 9, 'Очень стильная длинная подвеска выполнена в виде одного крупного красивого цветка и нескольких маленьких из натуральной кожи. Дизайн цветка немного отличается в зависимости от цвета. Металлическая цепь темного коричневого цвета.\r\nДлина 76 см. Диаметр цветка 7 см.\r\nСостав: Металл, текстиль.', 'ВА-П-24/20-23', NULL, 1310, NULL, 530, '2017-10-13 15:14:19', '2017-10-13 15:22:45', NULL, 0, 1, '', '', '', '', '', ''),
(1556, 0, 10, 0, 'effektnaya_podveska_s_kristallom_sinego_cveta', 'Эффектная подвеска с кристаллом синего цвета', NULL, 9, 'Эффектный подвес выполнен из металла цвета черненного серебра. Большой кристалл густого синего цвета закреплен в основу, украшенную прозрачными стразами.\r\nДлина шнурка 70 см. Кулон 6 см х 4 см.', 'ВА-П-23/46', NULL, 930, NULL, 340, '2017-10-13 15:18:45', '2017-10-13 15:25:22', NULL, 0, 1, '', '', '', '', '', ''),
(1557, 0, 10, 0, 'podveska_v_vide_pera_zhar_pticy', 'Подвеска в виде пера жар-птицы', NULL, 9, 'Сказочный подвес в виде пера жар-птицы. Украшен крупным, прозрачным  кристаллом и стразами. Металл серебряного цвета.\r\nДлина 76 см. Размер кулона 8 см х 4 см.\r\n', 'ВА-П-23/58', NULL, 830, NULL, 290, '2017-10-13 15:27:22', '2017-10-13 15:27:22', NULL, 0, 1, '', '', '', '', '', ''),
(1558, 0, 10, 0, 'ocharovatelnaya_podveska_cvetok_na_dlinnom_shnure', 'Очаровательная подвеска-цветок на длинном шнуре', NULL, 9, 'Очаровательная подвеска выполнена в виде цветка из кожи на длинном кожаном шнуре такого же цвета, как цветок.. Длина кожаного шнурка регулируется.Для украшения добавлен металлический элемент серебристого цвета.\r\nДиаметр цветка 6 см.\r\nСостав: Металл, пластик, текстиль.', 'ВА-П-24/88-90', NULL, 1310, NULL, 530, '2017-10-13 15:31:45', '2017-10-13 15:32:52', NULL, 0, 1, '', '', '', '', '', ''),
(1559, 0, 10, 0, 'podveska_s_krupnymi_prozrachnymi_kristallami', 'Подвеска с крупными прозрачными кристаллами', NULL, 9, 'Универсальное украшение! Крупные прозрачные кристаллы обрамлены  в металлическую основу цвета светлого золота.\r\nДлина 70 см. Кулон 12 см.', 'ВА-П-23/23', NULL, 890, NULL, 320, '2017-10-13 15:33:55', '2017-10-13 15:33:55', NULL, 0, 1, '', '', '', '', '', ''),
(1560, 0, 10, 0, 'kozhanaya_podveska_v_vide_cvetka_s_bozhej_korovkoj', 'Кожаная подвеска в виде цветка с божьей коровкой', NULL, 9, 'Кожаная подвеска в виде красивого цветка из натуральной черной кожи. Красная божья коровка вносит яркий акцент. Металлическая цепь темного коричневого цвета. \r\nДлина 76 см. Диаметр цветка 7 см.\r\nСостав: Металл, текстиль, пластик.\r\n', 'ВА-П-24/28', NULL, 1310, NULL, 530, '2017-10-13 15:40:32', '2017-10-13 15:40:32', NULL, 0, 1, '', '', '', '', '', ''),
(1561, 0, 10, 0, 'podveska_v_vide_banta_iz_busin_molochnogo_cveta', 'Подвеска в виде банта из бусин молочного цвета', NULL, 9, 'Милый подвес выполнен в виде банта из бусин молочного цвета. Украшен прозрачными стразами. \r\nМеталл золотого цвета.\r\nДлина 70 см. Размер  кулона 8 см х 5,5 см.', 'ВА-П-23/52', NULL, 890, NULL, 320, '2017-10-13 15:45:47', '2017-10-13 15:45:47', NULL, 0, 1, '', '', '', '', '', ''),
(1562, 0, 10, 0, 'divnaya_podveska_v_vide_belogo_cvetka', 'Дивная подвеска в виде белого цветка', NULL, 9, 'Дивная подвеска выполнена из натуральной кожи белого цвета. \r\nМеталлическая цепь темного коричневого цвета, к которой прикреплены бусины разной формы.\r\nДлина 76 см. Диаметр цветка 6 см.\r\nСостав: Металл, пластик, текстиль.', 'ВА-П-24/24', NULL, 1310, NULL, 530, '2017-10-13 15:46:30', '2017-10-13 15:46:30', NULL, 0, 1, '', '', '', '', '', ''),
(1563, 0, 10, 0, 'ocharovatelnaya_podveska_v_vide_lisy', 'Очаровательная подвеска в виде лисы', NULL, 9, 'Очаровательный подвес в виде лисы. На хвосте жечужные стразы. Голова лисички украшена прозрачными, черными и красными стразами.\r\nМеталл золотого цвета.\r\nДлина 60 см. Диаметр кулона 5 см.', 'ВА-П-23/54', NULL, 890, NULL, 320, '2017-10-13 15:53:02', '2017-10-13 15:53:02', NULL, 0, 1, '', '', '', '', '', ''),
(1564, 0, 10, 0, 'podveska_v_vide_prelestnogo_cvetka_bronzovogo_cveta', 'Подвеска  в виде прелестного цветка бронзового цвета', NULL, 9, 'Подвеска  выполнена в виде прелестного цветка  из натуральной кожи бронзового цвета. Металлическая цепь темного коричневого цвета, к которой прикреплены бусины золотисто-коричневого цвета.\r\nДлина 76 см. Диаметр цветка 6 см.\r\nСостав: Металл, пластик, текстиль.', 'ВА-П-24/29', NULL, 1310, NULL, 530, '2017-10-13 15:53:37', '2017-10-13 15:55:12', NULL, 0, 1, '', '', '', '', '', ''),
(1565, 0, 10, 0, 'kole_iz_muranskogo_stekla_v_gorchichno_sinih_tonah', 'Колье из муранского стекла в горчично-синих тонах', NULL, 9, 'От этого элегантного колье из чудесного стекла мурано веет теплом и солнцем Венеции. Текстильный шнурок коричневого цвета позволит вам менять длину в соответствии с вырезом платья. Горчичный и темный синий цвет.\r\nДлина шнурка 58 см. Длина подвески 13 см.\r\nСостав: Металл, стекло, текстиль.', 'ВА-П-24/11', NULL, 670, NULL, 210, '2017-10-13 16:00:45', '2017-10-13 16:19:17', NULL, 0, 1, '', '', '', '', '', ''),
(1566, 0, 10, 0, 'podveska_v_vide_cvetka_iz_metalla_temnogo_serebra', 'Подвеска в виде цветка  из металла  темного серебра', NULL, 9, 'Очаровательный подвес в виде цветка выполнен из металла цвета темного серебра. Украшен крупной темно-красной бусиной с металлическим блеском и стразами.\r\nДлина 70 см. Кулон 12 см.', 'ВА-П-23/62', NULL, 890, NULL, 320, '2017-10-13 16:08:11', '2017-10-13 16:08:11', NULL, 0, 1, '', '', '', '', '', ''),
(1567, 0, 10, 0, 'kole_iz_muranskogo_stekla_v_izumrudno_terrakotovyh_tonah', 'Колье из муранского стекла в  изумрудно-терракотовых тонах', NULL, 9, 'От этого элегантного колье из восхитительного стекла мурано веет теплом и солнцем Венеции. Текстильный шнурок коричневого цвета позволит вам менять длину в соответствии с вырезом платья. Изумрудный и терракотовый цвета. Чудесные ажурные металлические вставки.\r\nДлина шнурка 58 см. Длина подвески 8 см.\r\nСостав: Металл, текстиль, стекло.', 'ВА-П-24/13', NULL, 670, NULL, 210, '2017-10-13 16:08:23', '2017-10-13 16:20:51', NULL, 0, 1, '', '', '', '', '', ''),
(1568, 0, 10, 0, 'podveska_s_krasnym_kristallom_i_beloj_businoj', 'Подвеска с красным кристаллом и белой бусиной', NULL, 9, 'Изящный подвес выполнен из серебристого металла. Украшен крупным красным кристаллом и белой бусиной.\r\nДлина 70 см. Диаметр кулона 4,5 см.', 'ВА-П-23/55', NULL, 830, NULL, 290, '2017-10-13 16:13:55', '2017-10-13 16:13:55', NULL, 0, 1, '', '', '', '', '', ''),
(1569, 0, 10, 0, 'podveska_iz_serebristogo_metalla_v_vide_lebedya', 'Подвеска из серебристого металла в виде лебедя', NULL, 9, 'Яркий подвес выполнен из серебристого металла. Украшен цветными кристаллами и прозрачными стразами.\r\nДлина 70 см. Диаметр кулона 4,5 см х 3,5 см.', 'ВА-П-23/56-57', NULL, 830, NULL, 290, '2017-10-13 16:20:57', '2017-10-13 16:20:57', NULL, 0, 1, '', '', '', '', '', ''),
(1570, 0, 10, 0, 'ukrashenie_iz_kozhi_na_tekstilnom_shnurke', 'Украшение из кожи на текстильном шнурке', NULL, 9, 'Если Вы устали от гламурности или строгой формальности - этот подвес для Вас. Легкое, комфортное украшение из кожи на текстильном шнурке сделает Ваш образ непринужденным и стильным. \r\nКулон можно снять со шнурка и использовать, как брошь.\r\nДлина шнурка 48 см + 6 см. Размер кулона 7 см х 7 см.\r\nСостав: металл, текстиль, экокожа.', 'ВА-П-24/65-66', NULL, 770, NULL, 260, '2017-10-13 16:25:20', '2017-10-13 17:07:57', NULL, 0, 1, '', '', '', '', '', ''),
(1571, 0, 10, 0, 'podveska_v_vide_cvetka_s_lepestkami_zhemchuzhnogo_cveta', 'Подвеска в виде цветка с лепестками жемчужного цвета', NULL, 9, 'Нежный подвес выполнен в виде цветка с лепестками жемчужного цвета. Украшен бирюзовым кристаллом и прозрачными стразами.\r\nМеталл золотого цвета.\r\nДлина 60 см. Диаметр 5 см.', 'ВА-П-23/53', NULL, 890, NULL, 320, '2017-10-13 16:25:45', '2017-10-13 16:25:45', NULL, 0, 1, '', '', '', '', '', ''),
(1572, 0, 10, 0, 'elegantnoe_kole_iz_stekla_murano_v_golubyh_tonah', 'Элегантное колье из стекла мурано в голубых тонах', NULL, 9, 'От этого элегантного колье из чудесного стекла мурано веет теплом и солнцем Венеции. В центре кулона удивительной красоты подвеска. Текстильный коричневый шнурок позволит вам менять длину колье в соответствии с вырезом платья. Голубой и терракотовый цвета.\r\nДлина шнурка 58 см. Длина подвески 8 см.\r\nСостав: Стекло, текстиль, металл.', 'ВА-П-24/16', NULL, 670, NULL, 210, '2017-10-13 16:26:49', '2017-10-13 16:26:49', NULL, 0, 1, '', '', '', '', '', ''),
(1573, 0, 10, 0, 'ukrashenie_iz_kozhi_na_tekstilnom_shnurke_mnogocvetnoe', 'Украшение из кожи на текстильном шнурке многоцветное', NULL, 9, 'Если Вы устали от гламурности или строгой формальности - этот подвес для Вас. Легкое, комфортное украшение из кожи на текстильном шнурке сделает Ваш образ непринужденным и стильным. Цвета серый, коричневый.\r\nКулон можно снять со шнурка и использовать, как брошь.\r\nДлина шнурка 48 см + 6 см. Размер кулона 7 см х 7 см.', 'ВА-П-24/69-70', NULL, 770, NULL, 260, '2017-10-13 16:28:54', '2017-10-13 16:28:54', NULL, 0, 1, '', '', '', '', '', ''),
(1574, 0, 10, 0, 'podveska_s_kristallom_zelenogo_cveta_', 'Подвеска с кристаллом зеленого цвета', NULL, 9, 'Лаконичный подвес выполнен из металла серебрянного цвета. Большой кристалл зеленого цвета закреплен в оправу, украшенуую цветком со стразинками.\r\nДлина 84 см. Кулон 6 см х 4 см.', 'ВА-П-23/47', NULL, 930, NULL, 340, '2017-10-13 16:33:23', '2017-10-13 16:33:23', NULL, 0, 1, '', '', '', '', '', ''),
(1575, 0, 10, 0, 'elegantnoe_kole_iz_stekla_murano_v_zelenyh_tonah', 'Элегантное колье из стекла мурано в зелёных тонах', NULL, 9, 'От этого элегантного колье из чудесного стекла мурано веет теплом и солнцем Венеции. Черный текстильный шнурок позволит вам менять длину колье в соответствии с вырезом платья. Темный изумрудный и белый цвет.\r\nДлина шнурка 58 см. Длина подвески 8 см.\r\nСостав: Стекло, текстиль, металл.', 'ВА-П-24/12', NULL, 670, NULL, 210, '2017-10-13 16:38:05', '2017-10-13 16:39:24', NULL, 0, 1, '', '', '', '', '', ''),
(1576, 0, 10, 0, 'ukrashenie_iz_kozhi_na_tekstilnom_shnurke_dvuhcvetnoe', 'Украшение из кожи на текстильном шнурке двухцветное', NULL, 9, 'Если Вы устали от гламурности или строгой формальности - этот подвес для Вас. Легкое, комфортное украшение из кожи на текстильном шнурке сделает Ваш образ непринужденным и стильным. Цвета черный, коричневый, темный синий.\r\nКулон можно снять со шнурка и использовать, как брошь.\r\nДлина шнурка 48 см + 6 см. Размер кулона 7 см х 7 см.', 'ВА-П-24/76', NULL, 770, NULL, 260, '2017-10-13 16:41:12', '2017-10-13 16:41:12', NULL, 0, 1, '', '', '', '', '', ''),
(1577, 0, 10, 0, 'elegantnoe_kole_iz_stekla_murano_v_smnih_tonah', 'Элегантное колье из стекла мурано в смних тонах', NULL, 9, 'От этого элегантного колье из чудесного стекла мурано веет теплом и солнцем Венеции. Черный текстильный шнурок позволит вам менять длину колье в соответствии с вырезом платья. Бусины синего и белого цвета.\r\nДлина шнурка 58 см. Длина подвески 8 см.\r\nСостав: Стекло, текстиль, металл.', 'ВА-П-24/7', NULL, 670, NULL, 210, '2017-10-13 16:42:14', '2017-10-13 16:42:14', NULL, 0, 1, '', '', '', '', '', ''),
(1578, 0, 10, 0, 'podveska_s_tekstilnym_bantikom_i_cvetkom_', 'Подвеска с текстильным бантиком и цветком', NULL, 9, 'Сверкающий подвес украшен текстильным бантиком и цветком. Кулон в виде  крупного кристалла цвета топаза.\r\nЦепочка черная с золотом.\r\nДлина цепочки 70 см. Размер кулона 6 см х 4 см.', 'ВА-П-23/98-99', NULL, 830, NULL, 290, '2017-10-13 16:42:23', '2017-10-13 16:42:23', NULL, 0, 1, '', '', '', '', '', ''),
(1579, 0, 10, 0, 'ukrashenie_iz_metalla_i_kozhi', 'Украшение из металла и кожи', NULL, 9, 'Если Вы устали от гламурности или строгой формальности - этот подвес для Вас. Легкое, комфортное украшение из кожи на текстильном шнурке сделает Ваш образ непринужденным и стильным. Цвета черный, коричневый, бежевый.\r\nКулон можно снять со шнурка и использовать, как брошь.\r\nДлина шнурка 48 см + 6 см. Размер кулона 7 см х 7 см.', 'ВА-П-24/71-73', NULL, 770, NULL, 260, '2017-10-13 16:44:29', '2017-10-13 16:44:29', NULL, 0, 1, '', '', '', '', '', ''),
(1580, 0, 10, 0, 'krasivoe_kole_s_krasnymi_kamnyami', 'Красивое колье с красными камнями', NULL, 9, 'Красивое колье в металлической оправе серебристого цвета. Интересно обработанный камень красного цвета. \r\nДлина: 50 см. + 5 см.\r\nСостав: Металл, камень.', 'ВА-П-8/94', NULL, 1270, NULL, 510, '2017-10-13 16:47:37', '2017-10-13 16:47:37', NULL, 0, 1, '', '', '', '', '', ''),
(1582, 0, 10, 0, 'podveska_iz_kamnya_na_cepochke_', 'Подвеска из камня на цепочке', NULL, 9, 'Нарочито массивный кулон выполнен из камня. Оправлен в ажурную метталическую основу золотого цвета. Украшен прозрачными стразами. Золотисто-черная металлическая цепочка.\r\nДлина 78 см. Кулон 6 см х 3 см.', 'ВА-П-23/44-45', NULL, 930, NULL, 340, '2017-10-13 16:50:33', '2017-10-13 16:50:33', NULL, 0, 1, '', '', '', '', '', ''),
(1583, 0, 10, 0, 'ocharovatelnye_busy_izmenyaemoj_formy', 'Очаровательные бусы изменяемой формы', NULL, 9, 'Очаровательные бусы изменяемой формы. Металл идеально подчеркивает красоту черно-белых бусин. Украшены мерцающими стразами.\r\nДлина: 60 см.\r\nСостав: Металл, пластик, стразы.', 'ВА-Бу-611/36', NULL, 970, NULL, 360, '2017-10-13 16:52:39', '2017-10-13 16:52:39', NULL, 0, 1, '', '', '', '', '', ''),
(1584, 0, 10, 0, 'podveska_v_vide_cvetka_chernogo_cveta', 'Подвеска в виде цветка черного цвета', NULL, 9, 'Великолепный металлический подвес, украшен стразами. Длина регулируется кулоном. Длина: 80 см. Кулон: 4 см.', 'ВА-П-22/61', NULL, 890, NULL, 320, '2017-10-13 16:58:40', '2017-10-13 16:58:40', NULL, 0, 1, '', '', '', '', '', ''),
(1585, 0, 10, 0, 'legkoe_ukrashenie_iz_kozhi_na_tekstilnom_shnurke', 'Легкое украшение из кожи на текстильном шнурке', NULL, 9, 'Если Вы устали от гламурности или строгой формальности - этот подвес для Вас. Легкое, комфортное украшение из кожи на текстильном шнурке сделает Ваш образ непринужденным и стильным. \r\nКулон можно снять со шнурка и использовать, как брошь.\r\nДлина шнурка 48 см + 6 см. Размер кулона 7 см х 7 см.', 'ВА-П-24/74-75', NULL, 770, NULL, 260, '2017-10-13 17:01:52', '2017-10-13 17:01:52', NULL, 0, 1, '', '', '', '', '', ''),
(1586, 0, 10, 0, 'podveska_chernogo_cveta_v_vide_cvetka_', 'Подвеска черного цвета  в виде цветка', NULL, 9, 'Очаровательный подвес черного цвета на кожанном шнурке. Кулон в виде цветка выполнен из металла.\r\nДлина регулируется.\r\nДлина шнурка 80 см.Диаметр цветка 6 см.', 'ВА-П-24/49', NULL, 1130, NULL, 440, '2017-10-13 17:06:53', '2017-10-13 17:06:53', NULL, 0, 1, '', '', '', '', '', ''),
(1587, 0, 10, 0, 'chernoe_kole_iz_kozhi_i_dereva', 'Черное колье из кожи и дерева', NULL, 9, 'Роскошный подвес из кожи и дерева. Металлические детали цвета темного золота подчеркивают его красоту. \r\nДлина 34 см. Диаметр кулона 10 см.', 'ВА-П-84/28', NULL, 1450, NULL, 600, '2017-10-13 17:10:13', '2017-10-13 17:10:13', NULL, 0, 1, '', '', '', '', '', ''),
(1588, 0, 10, 0, 'podveska_korichnevogo_cveta_v_vide_cvetka', 'Подвеска коричневого цвета  в виде цветка', NULL, 9, 'Очаровательный подвес в шоколадных оттенках на кожанном шнурке. Кулон в виде цветка выполнен из металла.\r\nДлина регулируется.\r\nДлина шнурка 80 см.Диаметр цветка 6 см.', 'ВА-П-24/51', NULL, 1130, NULL, 440, '2017-10-13 17:11:09', '2017-10-13 17:11:09', NULL, 0, 1, '', '', '', '', '', ''),
(1589, 0, 10, 0, 'podveska_s_kulonom_ukrashenym_cvetami_i_pchelkoj', 'Подвеска с кулоном украшеным цветами и пчелкой', NULL, 9, 'Милый подвес  на текстильном и замшевом шнурках. Круглый кулон украшен цветами и пчелкой.\r\nДлина шнурка 80 см.Диаметр кулона 6 см.', 'ВА-П-24/53-54', NULL, 1130, NULL, 440, '2017-10-13 17:17:02', '2017-10-13 17:17:02', NULL, 0, 1, '', '', '', '', '', ''),
(1590, 0, 10, 0, 'chernoe_kole_iz_plastika_i_metalla_na_tekstilnom_shnurke', 'Черное колье из пластика и металла на текстильном шнурке', NULL, 9, 'Изумительный подвес из пластика и металла на текстильном шнурке. Немного страз и жемчужин. Металлические детали цвета темного золота подчеркивают его красоту. \r\nДлина 38 см + 5 см. Диаметр кулона 10 см.', 'ВА-П-84/29', NULL, 1450, NULL, 600, '2017-10-13 17:20:37', '2017-10-13 17:23:11', NULL, 0, 1, '', '', '', '', '', ''),
(1591, 0, 10, 0, 'podveska_iz_shnurkov_i_metallicheskih_elementov_', 'Подвеска из шнурков и металлических элементов,', NULL, 9, 'Подвес, выполненный из плоских вощеных шнурков и металлических элементов, добавит контраст и сделает оригинальным самый лаконичный наряд.\r\nДлина шнурка 56 см.Длина кулона 22 см.', 'ВА-П-24/56', NULL, 970, NULL, 360, '2017-10-13 17:24:47', '2017-10-13 17:24:47', NULL, 0, 1, '', '', '', '', '', ''),
(1592, 0, 10, 0, 'bordovoe_kole_iz_plastika_i_metalla_na_tekstilnom_shnurke', 'Бордовое колье из пластика и металла на текстильном шнурке', NULL, 9, 'Изумительный подвес из пластика и металла на текстильном шнурке. Немного страз и жемчужин. Металлические детали цвета темного золота подчеркивают его красоту. Цвет бордовый.\r\nДлина 38 см + 5 см. Диаметр кулона 10 см.', 'ВА-П-84/68', NULL, 1450, NULL, 600, '2017-10-13 17:26:01', '2017-10-13 17:26:01', NULL, 0, 1, '', '', '', '', '', ''),
(1593, 0, 10, 0, 'podveska_iz_metalla_na_tonkom_kozhanom_shnurke', 'Подвеска из металла на тонком кожаном шнурке', NULL, 9, 'Длинный подвес из металла на тонком кожанном шнурке подчеркнет стройность Вашей фигуры. \r\nДлина шнурка 82 см.Диаметр кулона 6 см', 'ВА-П-24/57', NULL, 1070, NULL, 410, '2017-10-13 17:30:21', '2017-10-13 17:30:21', NULL, 0, 1, '', '', '', '', '', ''),
(1594, 0, 10, 0, 'beloe_kole_iz_plastika_i_metalla_na_tekstilnom_shnurke', 'Белое колье из пластика и металла на текстильном шнурке', NULL, 9, 'Изумительный подвес из пластика и металла на текстильном шнурке. Немного страз и жемчужин. Металлические детали цвета темного золота подчеркивают его красоту. Цвет молочный.\r\nДлина 38 см + 5 см. Диаметр кулона 10 см.', 'ВА-П-84/69', NULL, 1450, NULL, 600, '2017-10-13 17:31:57', '2017-10-13 17:31:57', NULL, 0, 1, '', '', '', '', '', ''),
(1595, 0, 10, 0, 'podveska_s_kistochkoj_iz_shelkovyh_nitej', 'Подвеска с кисточкой из шелковых нитей', NULL, 9, 'Длинный подвес из металла и пластика на тонких текстильных шнурках подчеркнет стройность Вашей фигуры. Узор на пластиковом круглом элементе создает иллюзию натурального камня. Кисточка выполнена из шелковых нитей.\r\nДлина шнурка 60 см.Длина кулона 22 см.', 'ВА-П-24/58', NULL, 1070, NULL, 410, '2017-10-13 17:35:01', '2017-10-13 17:35:01', NULL, 0, 1, '', '', '', '', '', ''),
(1596, 0, 10, 0, 'podveska_s_kulon_v_vide_listka', 'Подвеска с кулон в виде листка', NULL, 9, 'Длинный подвес на тонком кожаном шнурке подчеркнет стройность Вашей фигуры. Кулон в виде листка из металла серебряного цвета украшен бронзовой стрекозой.\r\nДлина шнурка 60 см.Длина кулона 22 см.', 'ВА-П-24/59', NULL, 1070, NULL, 410, '2017-10-13 17:40:13', '2017-10-13 17:40:13', NULL, 0, 1, '', '', '', '', '', ''),
(1597, 0, 10, 0, 'krasno_belye_busy_na_dvuh_nitkah', 'Красно-белые бусы на двух нитках', NULL, 9, 'Великолепные бусы. \r\nДлина: 70 см. + 5 см.\r\nСостав: металл, жемчуг.', 'ВА-Бу-611/39', NULL, 750, NULL, 250, '2017-10-13 17:43:23', '2017-10-13 17:43:23', NULL, 0, 1, '', '', '', '', '', ''),
(1598, 0, 10, 0, 'stilnaya_podveska_iz_kozhi_i_kamnya_', 'Стильная подвеска  из кожи и камня', NULL, 9, 'Если Вы устали от гламурности или строгой формальности - этот подвес для Вас. Легкое, комфортное украшение из кожи и камня сделает Ваш образ непринужденным и стильным.\r\nКулон можно снять со шнурка и использовать, как брошь. \r\nДлина шнурка 48 см + 6 см. Размер кулона 8 см х 6 см.', 'ВА-П-24/62-64', NULL, 770, NULL, 260, '2017-10-13 17:45:36', '2017-10-13 17:45:36', NULL, 0, 1, '', '', '', '', '', ''),
(1599, 0, 10, 0, 'milaya_podveska_v_vide_vishenok', 'Милая подвеска в виде вишенок', NULL, 9, 'Милый подвес в виде вишенок. Красные бусины размером 1,8 см. Листочки из зеленых кристаллов. Металл цвета темного серебра.\r\nДлина 40 см. Диаметр кулона 6,5 см.', 'ВА-П-24/34', NULL, 970, NULL, 360, '2017-10-13 17:46:08', '2017-10-13 17:46:08', NULL, 0, 1, '', '', '', '', '', ''),
(1600, 0, 10, 0, 'mnogocvetnaya_podveska_s_krupnym_kristallom', 'Многоцветная подвеска с крупным кристаллом', NULL, 9, 'Благородное сочетание матовых и прозрачных бусин взрывает яркий красный кристалл. Цепочка черная с золотом.\r\nДлина цепочки 70 см. Длина кулона с подвеской 8 см. Размер красного кристалла 2 см х 1,5 см.\r\n', 'ВА-П-23/90', NULL, 950, NULL, 350, '2017-10-13 17:56:35', '2017-10-13 17:56:35', NULL, 0, 1, '', '', '', '', '', ''),
(1601, 0, 10, 0, 'seraya_sverkayushaya_podveska_s_kristallami', 'Серая сверкающая подвеска с кристаллами', NULL, 9, 'Сверкающий подвес украшен гроздью граненых бусин и кристаллом цвета топаза.\r\nЦепочка черная с золотом.\r\nДлина цепочки 70 см. Длина кулона 7 см.\r\nСостав: металл, кристаллы.', 'ВА-П-23/97', NULL, 830, NULL, 290, '2017-10-13 18:02:05', '2017-10-13 18:05:39', NULL, 0, 1, '', '', '', '', '', ''),
(1602, 0, 10, 0, 'chernaya_sverkayushaya_podveska_s_kristallami', 'Черная сверкающая подвеска с кристаллами', NULL, 9, 'Изящный подвес украшен гроздью черных граненных бусин. Кулон в виде кристалла цвета топаза.\r\nЦепочка черная с золотом.\r\nДлина цепочки 70 см. Размер кулона 6 см х 2 см.\r\nСостав: металл, кристаллы.', 'ВА-П-24/1', NULL, 830, NULL, 290, '2017-10-13 18:06:33', '2017-10-13 18:06:33', NULL, 0, 1, '', '', '', '', '', ''),
(1603, 0, 10, 0, 'podveska_iz_busin_v_vide_kapli', 'Подвеска из бусин в виде капли', NULL, 9, 'Элегантный подвес из сверкающих граненых бусин в виде капли.\r\nЦепочка черная с серебром.\r\nДлина цепочки 70 см. Длина кулона 11 см.', 'ВА-П-23/96', NULL, 910, NULL, 330, '2017-10-13 20:34:24', '2017-10-13 20:34:24', NULL, 0, 1, '', '', '', '', '', ''),
(1604, 0, 10, 0, 'podveska_s_chernoj_emalyu_na_cepochke_serebryanogo_cveta', 'Подвеска с черной эмалью на цепочке серебряного цвета', NULL, 9, 'Эксклюзивное украшение в виде стилизованного цветка. Кулон покрыт черной эмалью с двух сторон. Металл серебрянного цвета.\r\nДлина цепочки 70 см. Размер кулона 3 см х 3 см.', 'ВА-П-24/3', NULL, 850, NULL, 300, '2017-10-13 20:38:13', '2017-10-14 18:20:47', NULL, 0, 1, '', '', '', '', '', ''),
(1605, 0, 10, 0, 'podveska_iz_matovyh_i_blestyashih_busin', 'Подвеска из матовых и блестящих бусин', NULL, 9, 'Элегантный подвес из матовых и блестящих бусин разного цвета и формы. Подвеска украшена сияющим кристаллом. \r\nЦепочка черная с золотом.\r\nДлина цепочки 70 см. Длина кулона 7 см.', 'ВА-П-23/93', NULL, 890, NULL, 320, '2017-10-13 20:41:03', '2017-10-13 20:41:03', NULL, 0, 1, '', '', '', '', '', ''),
(1606, 0, 10, 0, 'podveska_iz_matovyh_i_blestyashih_raznocvetnyh_busin', 'Подвеска из матовых и блестящих разноцветных бусин', NULL, 9, 'Эффектный подвес из матовых и блестящих бусин разного цвета и формы. Подвеска с кисточкой из цепочки украшена сияющим кристаллом в виде цветка. \r\nЦепочка черная с золотом.\r\nДлина цепочки 70 см. Длина кулона 12 см. Размер подвески 2 см х 2 см.', 'ВА-П-23/91', NULL, 870, NULL, 310, '2017-10-13 20:45:29', '2017-10-13 20:45:29', NULL, 0, 1, '', '', '', '', '', ''),
(1607, 0, 10, 0, 'podveska_s_matovymi_kvadratnymi_businami', 'Подвеска с матовыми квадратными бусинами', NULL, 9, 'Стильный подвес из матовых и блестящих бусин. Подвеска - кристалл цвета топаза.\r\nЦепочка черная с золотом.\r\nДлина цепочки 70 см. Длина кулона 5,5 см.', 'ВА-П-23/94-95', NULL, 870, NULL, 310, '2017-10-13 20:49:40', '2017-10-13 20:49:40', NULL, 0, 1, '', '', '', '', '', ''),
(1608, 0, 10, 0, 'kruglaya_matovaya_metallicheskaya_podveska', 'Круглая матовая металлическая подвеска', NULL, 9, 'Великолепный металлический подвес из металла цвета матового золота.. Длина: 80 см.', 'ВА-П-22/67', NULL, 850, NULL, 300, '2017-10-13 20:54:25', '2017-10-13 20:54:25', NULL, 0, 1, '', '', '', '', '', ''),
(1609, 0, 10, 0, 'kole_s_krupnymi_cvetami_na_magnitnoj_zastezhke', 'Колье с крупными цветами на магнитной застежке', NULL, 9, 'Потрясающее колье создает иллюзию настоящего цветка. Цветы из окрашенного металла украшены гранеными бусинками. Шелковый шнурок. Магнитная застежка.\r\nДлина: 42 см. Диаметр цветка 7 см.', 'ВА-П-83/91-96', NULL, 1390, NULL, 570, '2017-10-13 21:01:44', '2017-10-13 21:01:44', NULL, 0, 1, '', '', '', '', '', ''),
(1610, 0, 10, 0, 'zhenstvennoe_kole_na_tekstilnyh_shnurkah', 'Женственное колье на текстильных шнурках', NULL, 9, 'Женственный и элегантный аксессуар выполнен  в виде жемчужных гроздьев на текстильных шнурках из люрекса.\r\nДлина 38 см. Диаметр бусин 1,2 см - 1,4 см.', 'ВА-П-84/7-12', NULL, 1330, NULL, 540, '2017-10-13 21:36:48', '2017-10-13 21:36:48', NULL, 0, 1, '', '', '', '', '', ''),
(1611, 0, 10, 0, 'dlinnye_busy_raznyh_cvetov', 'Длинные бусы разных цветов', NULL, 9, 'Длинные бусы разных цветов. Длина позволяет надевать их по-разному абсолютно с любой одеждой.\r\nДлина: 80 см.\r\nСостав: Пластик.', 'ВА-Бу-611/16-25', NULL, 530, NULL, 140, '2017-10-13 21:37:49', '2017-10-13 21:37:49', NULL, 0, 1, '', '', '', '', '', ''),
(1612, 0, 10, 0, 'busy_s_perehodom_cveta', 'Бусы с переходом цвета', NULL, 9, 'Модный тренд: градиент – переход цвета. Серебряный цвет- жемчужины белого, св.серого, серого, черного цвета. Золотой цвет-жемчужины кремового, бежевого, темного коричневого цвета. Металл золотого цвета.\r\nДлина 50 см. Диаметр бусин 0,8 - 1,2 см.', 'ВА-Бу-611/41-42', NULL, 1050, NULL, 400, '2017-10-13 21:46:24', '2017-10-13 21:46:24', NULL, 0, 1, '', '', '', '', '', ''),
(1613, 0, 10, 0, 'podveska_s_businami_i_strazami', 'Подвеска с бусинами и стразами', NULL, 9, 'Великолепные бусы. украшенный стразами. \r\nДлина: 50 см. + 5 см.\r\nСостав: 	Металл, жемчуг.', 'ВА-Бу-611/38', NULL, 1030, NULL, 390, '2017-10-13 21:52:13', '2017-10-13 21:52:13', NULL, 0, 1, '', '', '', '', '', ''),
(1614, 0, 10, 0, 'klassicheskie_busy_krasnogo_cveta', 'Классические бусы красного цвета', NULL, 9, 'Классическая нитка красных бус.\r\nДлина: 40 см + 5 см. Диаметр бусин 0,8 см.\r\nСостав: Пластик, металл.', 'ВА-Бу-611/11', NULL, 430, NULL, 90, '2017-10-13 21:57:42', '2017-10-13 21:57:42', NULL, 0, 1, '', '', '', '', '', ''),
(1615, 0, 10, 0, 'klassicheskie_rozovo_krasnye_busy', 'Классические розово- красные бусы', NULL, 9, 'Классическая нитка розово- красных бус.\r\nДлина: 40 см + 5 см. Диаметр бусин 0,8 см.\r\nСостав: Пластик, металл.', 'ВА-Бу-611/44', NULL, 430, NULL, 90, '2017-10-13 22:01:19', '2017-10-13 22:01:19', NULL, 0, 1, '', '', '', '', '', ''),
(1616, 0, 10, 0, 'klassicheskie_krasno_rozovye_busy', 'Классические красно-розовые бусы', NULL, 9, 'Классическая нитка красно-розовых бус. Размер бусин увеличивается к центру. Диаметр бусин 0,5 см - 1,0 см.\r\nСостав: Пластик, металл.', 'ВА-Бу-611/45', NULL, 430, NULL, 90, '2017-10-13 22:06:34', '2017-10-13 22:06:34', NULL, 0, 1, '', '', '', '', '', ''),
(1617, 0, 10, 0, 'izumitelnaya_podveska_v_vide_kresta_na_shnurke', 'Изумительная подвеска в виде креста на шнурке', NULL, 9, 'Изумительная подвеска в виде креста на шнурке интересной выработки. \r\nДлина 70+5см.\r\nСостав: Металл, текстиль.', 'ВА-П-22/19-20', NULL, 590, NULL, 170, '2017-10-13 22:12:58', '2017-10-14 17:45:20', NULL, 0, 1, '', '', '', '', '', ''),
(1618, 0, 10, 0, 'serebristaya_podveska_v_vide_kresta_na_cepochke_', 'Серебристая подвеска в виде креста на цепочке', NULL, 9, 'Подвеска в виде креста  из металла серебристого цвета, украшенная  стразами на такого же цвета металлической цепочке\r\nДлина: 60 см. Кулон: 10 см.\r\nСостав: Металл, стразы.', 'ВА-П-4/17', NULL, 550, NULL, 150, '2017-10-13 22:21:46', '2017-10-13 22:21:46', NULL, 0, 1, '', '', '', '', '', ''),
(1619, 0, 10, 0, 'podveska_v_vide_kresta_bronzovo_zolotogo_cveta', 'Подвеска в виде креста  бронзово-золотого цвета', NULL, 9, 'Подвеска в виде креста  из металла бронзово-золотого цвета, украшенная  стразами на такого же цвета металлической цепочке\r\nДлина: 60 см. Кулон: 10 см.\r\nСостав: Металл, стразы.', 'ВА-П-22/22', NULL, 590, NULL, 170, '2017-10-13 22:26:05', '2017-10-13 22:26:05', NULL, 0, 1, '', '', '', '', '', ''),
(1620, 0, 10, 0, 'izumitelnaya_podveska_v_vide_azhurnogo_kresta', 'Изумительная подвеска в виде ажурного креста', NULL, 9, 'Изумительная подвеска в виде ажурного креста  из металла золотого цвета, украшенная  стразами на такого же цвета металлической цепочке.\r\nДлина 70+5см.\r\nСостав: Металл, стразы.', 'ВА-П-22/23', NULL, 630, NULL, 190, '2017-10-13 22:29:49', '2017-10-13 22:29:49', NULL, 0, 1, '', '', '', '', '', ''),
(1621, 0, 10, 0, 'izumitelnye_busy_nezhnogo_priglushennogo_cveta', 'Изумительные бусы нежного приглушенного цвета', NULL, 9, 'Изумительные бусы нежного приглушенного, словно выбеленного, цвета. Текстильные цветы и некоторые бусины отличаются по оттенкам. Использованы бусины разного размера и формы. Шнурок из бисера.\r\nДлина 48 см + 5 см. Диаметр цветка 2,5 см.\r\nСостав: Пластик, текстиль.', 'ВА-Бу-650/24-26', NULL, 1450, NULL, 600, '2017-10-13 22:37:31', '2017-10-13 22:37:31', NULL, 0, 1, '', '', '', '', '', ''),
(1622, 0, 10, 0, 'kole_iz_krupnyh_plastikovyh_cvetov', 'Колье из крупных пластиковых цветов', NULL, 9, 'Колье -нежное облако из  цветов! Пластиковые цветы удивительной красоты.. Металлическая цепочка золотого цвета. В середину каждого цветка вставлена граненая бусинка.\r\nДлина 40 см + 7 см. Диаметр цветка 5 см.\r\nСостав: Пластик, металл, бусины.\r\n', 'ВА-П-83/63-64', NULL, 1170, NULL, 460, '2017-10-13 22:53:22', '2017-10-14 17:44:57', NULL, 0, 1, '', '', '', '', '', ''),
(1623, 0, 10, 0, 'voshititelnoe_persikovoe_kole', 'Восхитительное персиковое колье', NULL, 9, 'Восхитительное персиковое колье-ожерелье сделает незабываемым Ваш весенний образ! Пластиковые цветы смотрятся восхитительно!.\r\nДлина 42 см + 7 см. Диаметр цветков 4 см - 6 см.\r\nСостав: Пластик, металл.', 'ВА-П-83/69', NULL, 1050, NULL, 400, '2017-10-13 23:06:18', '2017-10-13 23:06:59', NULL, 0, 1, '', '', '', '', '', ''),
(1624, 0, 10, 0, 'oslepitelnoe_yarkoe_mnogocvetnoe_kole', 'Ослепительное яркое многоцветное колье', NULL, 9, 'Ослепительно яркое многоцветное колье не оставит Вас незамеченной! Оно подойдет ко многим Вашим нарядам. Сделает ярче однотонный наряд и подчеркнет цвета набивного.\r\nДлина 42 см + 5 см. Диаметр цветков 4 см - 6 см.\r\nСостав: Пластик,металл.', 'ВА-П-83/70', NULL, 1050, NULL, 400, '2017-10-13 23:11:38', '2017-10-14 17:39:02', NULL, 0, 1, '', '', '', '', '', ''),
(1625, 0, 10, 0, 'legkoe_kole_iz_cvetov_na_atlasnoj_lente', 'Легкое колье из цветов на атласной ленте', NULL, 9, 'Легкое колье-ожерелье из цветов очень красивой формы на атласной тесьме.\r\nУкрашено стеклярусом и кристаллами.\r\nДлина атласных завязок 40 см. Диаметр цветков 6 см.\r\nСостав: Пластик, текстиль, стразы.', 'ВА-П-83/87-90', NULL, 930, NULL, 340, '2017-10-13 23:18:23', '2017-10-15 23:35:32', NULL, 0, 1, '', '', '', '', '', ''),
(1626, 0, 10, 0, 'zhenstvennoe_kole_dvuh_cvetov', 'Женственное колье двух цветов', NULL, 9, 'Поклонницы женственного и романтичного стиля будут в восторге от этих колье. Крупные цветы из пластмассы украшены искрящимися кристаллами. Шнурок выполненный из искусственной замши, комфортно ложится по шее.\r\nДлина 40 см + 5 см. Диаметр цветка 6 см.\r\nСостав: Пластик, текстиль, стразы.', 'ВА-П-83/98-99', NULL, 1210, NULL, 480, '2017-10-13 23:27:29', '2017-10-14 17:44:02', NULL, 0, 1, '', '', '', '', '', ''),
(1627, 0, 10, 0, 'zhenstvennoe_kole_ozherele_iz_plastmassy', 'Женственное колье-ожерелье из пластмассы', NULL, 9, 'Эти женственные колье-ожерелья из  пластмассы, имитирующей узорчатый камень, нежных цветов, очаровывают с первого взгляда. Шнурок, выполненный из искусственной замши, комфортно ложится по шее. Просто - не значит скучно!\r\nДлина 40 см + 5 см. Размер центрального элемента 6 см х 4 см.\r\nСостав: Пластик, текстиль.\r\n', 'ВА-П-84/1-5', NULL, 1210, NULL, 480, '2017-10-13 23:35:28', '2017-10-14 17:34:45', NULL, 0, 1, '', '', '', '', '', ''),
(1628, 0, 10, 0, 'miloe_kole_iz_busin_raznoj_formy_i_cvetov', 'Милое колье из бусин разной формы и цветов', NULL, 9, 'Милое колье-ожерелье из пластиковых бусин разной формы и цветов, удивительно сочетающихся между собой. Вокруг шеи черный текстильный шнурок. Крепления бусин из металла золотистого цвета.\r\nДлина 42 см. Диаметр центральной подвески 3 см.\r\nСостав: Пластик, текстиль.', 'ВА-П-84/19', NULL, 830, NULL, 290, '2017-10-13 23:43:17', '2017-10-13 23:45:42', NULL, 0, 1, '', '', '', '', '', ''),
(1629, 0, 10, 0, 'raznocvetnoe_ob_emnoe_kole_ozherele', 'Разноцветное объемное колье-ожерелье', NULL, 9, 'Разноцветное объемное колье-ожерелье. Выполнено на металлической цепочке золотистого цвета и украшено пластиковыми кольцами, замшевыми кисточками и бусинами.\r\nДлина 42 см. Диаметр колец 3,2 см.\r\nСостав: Пластик, металл, текстиль.\r\n', 'ВА-П-84/23', NULL, 1030, NULL, 390, '2017-10-13 23:54:33', '2017-10-13 23:54:33', NULL, 0, 1, '', '', '', '', '', ''),
(1630, 0, 10, 0, 'veselye_busy_iz_matovyh_busin_raznogo_cveta', 'Веселые бусы из матовых бусин разного цвета', NULL, 9, 'Веселые бусы из матовых пластиковых бусин разного цвета. Хорошо сочетаясь между собой, они отлично поднимают настроение! Металлическая цепочка серебристого цвета. Модели немного отличаются между собой по цвету, особенно центральной бусины.\r\nДлина 50 см. Диаметр бусин 2 см.\r\nСостав: Металл, пластик.', 'ВА-П-84/21-22', NULL, 830, NULL, 290, '2017-10-14 09:48:10', '2017-10-14 09:52:33', NULL, 0, 1, '', '', '', '', '', ''),
(1631, 0, 10, 0, 'interesnoe_cherno_zolotoe_kole', 'Интересное черно-золотое колье', NULL, 9, 'Интересное колье на толстом кожаном ремешке.  Сочетание черных бусин и пластин с металлом золотистого цвета смотрится очень нарядно.\r\nДиаметр бусин: 3 см. Длина: 20 см.\r\nСостав: Металл, пластик, текстиль.', 'ВА-П-82/94', NULL, 870, NULL, 310, '2017-10-14 10:05:30', '2017-10-14 10:05:30', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1632, 0, 10, 0, 'podveska_v_forme_okruglogo_listika_s_siyayushim_strazom', 'Подвеска в форме округлого листика с сияющим стразом', NULL, 9, 'Подвеска в форме округлого листика с сияющим стразом! Мягкий мерцающий блеск натурального перламутра сочетается  в этом украшении с бусинами сливового цвета и в этническом стиле. Цепочка черная с золотом. Металлические элементы золотистого цвета.\r\nДлина 72 см. Размер перламутрового кулона 5 см х 4 см.\r\nСостав: Металл, стразы, камень.\r\n', 'ВА-П-23/48', NULL, 770, NULL, 260, '2017-10-14 10:16:41', '2017-10-14 10:16:41', NULL, 0, 1, '', '', '', '', '', ''),
(1633, 0, 10, 0, 'podveska_v_forme_vytyanutogo_listika_s_siyayushim_strazom', 'Подвеска в форме вытянутого листика с сияющим стразом', NULL, 9, 'Подвеска в форме вытянутого листика с сияющим стразом! Мягкий мерцающий блеск натурального перламутра сочетается  в этом украшении с бусинами сливового цвета. Цепочка черная с золотом. Металлические элементы золотистого цвета.\r\nДлина 72 см. Размер перламутрового кулона 7 см х 3 см.\r\nСостав: Металл, стразы, камень.', 'ВА-П-23/49', NULL, 770, NULL, 260, '2017-10-14 10:22:12', '2017-10-14 10:22:12', NULL, 0, 1, '', '', '', '', '', ''),
(1634, 0, 10, 0, 'podveska_v_forme_perlamutrovogo_listika_s_siyayushim_strazom', 'Подвеска в форме перламутрового листика с сияющим стразом', NULL, 9, 'Подвеска в форме вытянутого листика из натурального перламутра с сияющим стразом, закрепленным в металлическую оправу серебристого цвета  ! Мягкий мерцающий блеск натурального перламутра сочетается  в этом украшении с бусинами сливового цвета. Цепочка черная с золотом.\r\nДлина 70 см. Размер  кулона 7 см х 3 см.\r\nСостав: Металл, стразы, камень.', 'ВА-П-23/51', NULL, 770, NULL, 260, '2017-10-14 10:28:47', '2017-10-14 10:28:47', NULL, 0, 1, '', '', '', '', '', ''),
(1636, 0, 10, 0, 'izyashnoe_kole_s_siyayushimi_strazami', 'Изящное колье с сияющими стразами', NULL, 9, 'Колье-ожерелье, изящно обвивающее шею,  выполнено из металла золотого цвета. Украшено сияющими кристаллами замечательной огранки, вставленными в ажурную оправу.\r\nДлина: 42 см. + 5 см. Размер золотого элемента 1,3 см х 1,3 см.\r\nСостав: Металл, стразы.', 'ВА-П-83/77-78', NULL, 730, NULL, 240, '2017-10-14 10:40:04', '2017-10-14 17:43:40', NULL, 0, 1, '', '', '', '', '', ''),
(1637, 0, 10, 0, 'stilnaya_kruglaya_podveska_na_cepochke', 'Стильная круглая подвеска на цепочке', NULL, 9, 'Необычайно простая, но очень стильная подвеска на металлической цепочке золотистого цвета. Белый шар соседствует с маленькими шариками и звёздочкой.. Длина: 80 см. +  6 см.\r\nСостав: Металл, пластик.', 'ВА-П-21/52', NULL, 870, NULL, 310, '2017-10-14 10:46:53', '2017-10-14 10:46:53', NULL, 0, 1, '', '', '', '', '', ''),
(1638, 0, 10, 0, 'ocharovatelnoe_kole_iz_provoloki_zolotogo_cveta', 'Очаровательное колье  из проволоки золотого цвета', NULL, 9, 'Очаровательное колье, словно из скифского кургана,  выполнено из металлической проволоки золотого цвета. Украшено восхитительными искрящимися  кристаллами разной формы и  размера. \r\nДлина 36 см + 6 см. Кулон 6 см.\r\nСостав: Металл, стразы.', 'ВА-П-83/25', NULL, 1330, NULL, 540, '2017-10-14 10:51:52', '2017-10-14 17:32:30', NULL, 0, 1, '', '', '', '', '', ''),
(1639, 0, 10, 0, 'ochen_izyskannoe_kole_iz_matovogo_metalla', 'Очень изысканное колье из матового металла', NULL, 9, 'Очень изысканное колье! Это шейное украшение выполнено в стиле минимализма, что не умаляет его красоты. Цвет металла - матовое серебро. \r\nДлина 40см + 5 см.\r\nСостав: Металл.', 'ВА-П-83/15', NULL, 890, NULL, 320, '2017-10-14 13:33:54', '2017-10-14 13:33:54', NULL, 0, 1, '', '', '', '', '', ''),
(1640, 0, 10, 0, 'stilnaya_i_yarkaya_podveska_so_strazami', 'Стильная и яркая подвеска со стразами', NULL, 9, 'Очень стильная и яркая подвеска выполнена из металла золотого цвета и украшена искрящимися стразами цвета топаз. Цепочка такого же цвета, что и подвеска,достаточно крупного плетения.\r\nДлина 34 см + 5 см. \r\nСостав: Металл, стразы.', 'ВА-П-83/29', NULL, 550, NULL, 150, '2017-10-14 13:40:31', '2017-10-14 17:38:30', NULL, 0, 1, '', '', '', '', '', ''),
(1641, 0, 10, 0, 'effektnye_krupnye_busy', 'Эффектные крупные бусы', NULL, 9, 'Очень эффектные крупные бусы . Цвет и способ обработки бусин из пластика создает полную иллюзию дорогого металла. В зависимости от индивидуального предпочтения, есть возможность выбора цвета: либо серебро-золото, либо золото.\r\nДиаметр бусин 2,2 см - 3,5 см. Длина 60 см.\r\nСостав: Пластик.', 'ВА-Бу-641/21-22', NULL, 1470, NULL, 610, '2017-10-14 13:48:04', '2017-10-14 17:43:02', NULL, 0, 1, '', '', '', '', '', ''),
(1642, 0, 10, 0, 'krasivaya_podveska_s_krupnym_izumrudnym_kristallom', 'Красивая подвеска с крупным изумрудным кристаллом', NULL, 9, 'Красивая подвеска сложной формы с крупным изумрудным кристаллом и прозрачными стразами. Цепочка и крепление кулона выполнены из металла серебристого цвета.\r\nДлина 70 см. Кулон 7 см. Размер кристалла в виде капли 3 см х 2 см.\r\nСостав: Металл, кристаллы, стразы.', 'ВА-П-23/65', NULL, 890, NULL, 320, '2017-10-14 13:55:23', '2017-10-14 13:55:23', NULL, 0, 1, '', '', '', '', '', ''),
(1643, 0, 10, 0, 'interesnaya_podveska_ochen_slozhnoj_formy', 'Интересная подвеска очень сложной формы', NULL, 9, 'Интересная подвеска очень сложной формы выполнена с использованием различных техник. Бахрома из замши, крупный сверкающий кристалл, черная бусина гармонично сочетаются в этом украшении. Металлическая основа цвета светлого золота.\r\nДлина 70 см. Кулон 12 см.\r\nСостав: Металл, стразы, текстиль.', 'ВА-П-23/24', NULL, 910, NULL, 330, '2017-10-14 14:00:13', '2017-10-14 14:00:13', NULL, 0, 1, '', '', '', '', '', ''),
(1644, 0, 10, 0, 'busy_s_derevyannymi_businami_i_strazami', 'Бусы с деревянными бусинами и стразами', NULL, 9, 'Удивительное сочетание в этих необычных бусах делает их одновременно и простыми и сложными. Объемные бусины из дерева и  сверкающие стразы объединяет между собой цепочка-шнурок сложного плетения затемненного, почти черного цвета.\r\nДлина 80 см. Кулон: 5 см.\r\nСостав: Металл, дерево, стразы.\r\n\r\n', 'ВА-П-22/47-49', NULL, 870, NULL, 310, '2017-10-14 14:10:01', '2017-10-14 14:10:01', NULL, 0, 1, '', '', '', '', '', ''),
(1645, 0, 10, 0, 'kole_s_metallicheskimi_elementami_na_shnurah', 'Колье с металлическими элементами на шнурах', NULL, 9, 'Оригинальное колье выполнено из металлических элементов приглушенного золотого цвета, скользящих  на черных шнурках из искусственной кожи. \r\nДлина: 40 см. + 5 см.\r\nСостав: Металл, текстиль.', 'ВА-П-83/16', NULL, 930, NULL, 340, '2017-10-14 14:16:00', '2017-10-14 14:16:00', NULL, 0, 1, '', '', '', '', '', ''),
(1646, 0, 10, 0, 'ocharovatelnoe_kole_s_kistochkoj_iz_cepochek', 'Очаровательное колье с кисточкой из цепочек', NULL, 9, 'Очаровательное колье, вьющееся вокруг шеи, выполнено из  металла золотистого цвета. Сочетание круглых небольших шариков и очень длинной кисточки из цепочек делают это колье просто неповторимым . \r\nДлина: 50 см. + 5 см. \r\nСостав: Металл.', 'ВА-П-7/98', NULL, 810, NULL, 280, '2017-10-14 14:22:43', '2017-10-14 14:22:43', NULL, 0, 1, '', '', '', '', '', ''),
(1647, 0, 10, 0, 'modnaya_podveska_iz_zabavnyh_kistochek', 'Модная подвеска из забавных кисточек', NULL, 9, 'Модная подвеска из забавных кисточек трех цветов висящих на цепочках чуть затемненного серебристого цвета. \r\nДлина 80 см. Кулон: 10 см.\r\nСостав: Металл.', 'ВА-П-22/42', NULL, 1050, NULL, 400, '2017-10-14 14:29:53', '2017-10-14 14:29:53', NULL, 0, 1, '', '', '', '', '', ''),
(1648, 0, 10, 0, 'modnaya_podveska_s_yarkimi_elementami', 'Модная подвеска с яркими элементами', NULL, 9, 'Модная забавная подвеска, напоминающая женскую фигурку. Черная цепочка оттеняется бордово-сине-зелеными элементами. А маленькие стразики в золотой оправе привлекают внимание своей игрой.\r\nДлина 80 см. Кулон: 10 см.\r\nСостав: Металл, стразы.', 'ВА-П-22/41', NULL, 890, NULL, 320, '2017-10-14 14:35:52', '2017-10-14 17:36:23', NULL, 0, 1, '', '', '', '', '', ''),
(1649, 0, 10, 0, 'velikolepnaya_cherno_zolotaya_metallicheskaya_podveska', 'Великолепная черно-золотая металлическая подвеска', NULL, 9, 'Великолепная металлическая подвеска на черном шнуре-цепочке интересна сочетанием черного и золотого цвета и геометрических форм.\r\nДлина: 80 см.\r\nСостав: Металл.', 'ВА-П-22/68', NULL, 770, NULL, 260, '2017-10-14 14:42:37', '2017-10-14 14:42:37', NULL, 0, 1, '', '', '', '', '', ''),
(1650, 0, 10, 0, 'velikolepnaya_lakonichnaya_podveska_v_cherno_sinih_tonah', 'Великолепная лаконичная подвеска в черно-синих тонах', NULL, 9, 'Великолепная лаконичная подвеска на черном шнуре-цепочке. Различной геометрической формы черно-синие бусины из дерева и металла очень гармонично сочетаются между собой.\r\nДлина: 80 см. + 5 см.\r\nСостав: Металл, дерево.', 'ВА-П-22/91', NULL, 890, NULL, 320, '2017-10-14 14:47:38', '2017-10-14 14:48:40', NULL, 0, 1, '', '', '', '', '', ''),
(1651, 0, 10, 0, 'molodezhnoe_ochen_miloe_kole_v_vide_bantika', 'Молодежное очень милое колье в виде бантика', NULL, 9, 'Молодежное очень милое колье в виде бантика из золотистого металла на черном замшевом шнурке. Кулон украшают сверкающие прозрачные стразы. \r\nДлина 36 см + 9 см. Кулон 3,5 см.\r\nСостав: Металл, текстиль, стразы.', 'ВА-П-83/32', NULL, 630, NULL, 190, '2017-10-14 14:52:44', '2017-10-14 14:52:44', NULL, 0, 1, '', '', '', '', '', ''),
(1652, 0, 10, 0, 'kole_ozherele_choker_s_krasnym_kristallom', 'Колье ожерелье - чокер с красным кристаллом', NULL, 9, ' Колье ожерелье - чокер на пике популярности. Выполнен на черной замшевой основе, украшен подвеской в виде крупного красного кристалла в оправе из металла золотого цвета.\r\nДлина: 30 см + 5 см. Диаметр кристалла 1,4 см.\r\nСостав: Металл, стразы, текстиль.', 'ВА-П-84/32', NULL, 550, NULL, 150, '2017-10-14 14:59:29', '2017-10-14 14:59:29', NULL, 0, 1, '', '', '', '', '', ''),
(1653, 0, 10, 0, 'zamechatelnoe_kole_s_siyayushim_kristallom', 'Замечательное колье с сияющим кристаллом', NULL, 9, 'Замечательное колье ожерелье - чокер на замшевой основе черного цвета декорировано мерцающими стразами . В центре на их фоне сверкает крупный прозрачный циркон.\r\nДлина: 28 см + 6 см. Диаметр кристалла 0,8 см.\r\nСостав: Стразы, текстиль.', 'ВА-П-84/59-61', NULL, 770, NULL, 260, '2017-10-14 15:05:17', '2017-10-14 15:05:28', NULL, 0, 1, '', '', '', '', '', ''),
(1654, 0, 10, 0, 'kole_s_prozrachnym_kristallom_i_strazami', 'Колье с прозрачным кристаллом и стразами', NULL, 9, 'Колье ожерелье - чокер на черном замшевом шнурке. Подвеска из металла золотого цвета в виде головы лисички. Крепление подвески украшено сверкающими стразами. Прозрачный циркон переливается "алмазным" блеском.\r\nДлина: 28 см + 5 см. Диаметр циркона 0.8 см.', 'ВА-П-84/14', NULL, 570, NULL, 160, '2017-10-14 15:14:04', '2017-10-14 15:14:04', NULL, 0, 1, '', '', '', '', '', ''),
(1655, 0, 10, 0, 'kole_s_rombovidnoj_podveskoj_v_uzkoj_oprave', 'Колье  с ромбовидной подвеской в узкой оправе', NULL, 9, 'Колье ожерелье - чокер на черном замшевом шнурке. Подвеска из металла серебряного  цвета с узкой оправой. Крепление подвески украшено сверкающими стразами. Прозрачный циркон переливается "алмазным" блеском.\r\nДлина: 28 см + 5 см. Диаметр циркона 0.8 см.\r\nСостав: Металл, текстиль, стразы.', 'ВА-П-84/15', NULL, 570, NULL, 160, '2017-10-14 15:20:08', '2017-10-14 15:20:25', NULL, 0, 1, '', '', '', '', '', ''),
(1656, 0, 10, 0, 'izyashnoe_kole_s_siyayushim_strazom_v_shirokoj_oprave', 'Изящное колье с сияющим стразом в широкой оправе', NULL, 9, 'Изящное колье  ожерелье - чокер на черном замшевом шнурке. Подвеска из металла серебряного  цвета в широкой оправе. Крепление подвески украшено сверкающими стразами. Прозрачный циркон переливается "алмазным" блеском.\r\nДлина: 28 см + 5 см. Диаметр циркона 0.8 см.\r\nСостав: Металл, стразы, текстиль.', 'ВА-П-84/16', NULL, 570, NULL, 160, '2017-10-14 15:24:58', '2017-10-14 15:24:58', NULL, 0, 1, '', '', '', '', '', ''),
(1657, 0, 10, 0, 'shirokoe_kruzhevnoe_kole_s_businami', 'Широкое кружевное колье с бусинами', NULL, 9, 'Романтические натуры выберут в качестве колье сложный чокер из невероятного черного кружева  , украшенное цепочками из серебристого металла и гранеными черными бусинками. Украшение подойдет как для особых случаев так и в сочетании с трикотажными майками, джинсовой одеждой и с другими элементами повседневного гардероба.\r\nРазмер 32 см + 7 см. Ширина 7 см.\r\nСостав: Пластик, текстиль, металл.', 'ВА-П-84/66', NULL, 690, NULL, 220, '2017-10-14 15:32:52', '2017-10-14 15:32:52', NULL, 0, 1, '', '', '', '', '', ''),
(1658, 0, 10, 0, 'izumitelnoe_kruzhevnoe_kole_s_kulonom', 'Изумительное кружевное колье с кулоном', NULL, 9, 'Романтические натуры выберут сложное колье чокер из черного кружева , украшенное цепочками приглушенного бронзового цвета и гранеными черными бусинками. В центре расположен кулон из черного кристалла в оправе бронзового цвета. Украшение подойдет как для особых случаев так и в сочетании с трикотажными майками, джинсовой одеждой и с другими элементами повседневного гардероба.\r\nРазмер 32 см + 7 см. Ширина 3 см.\r\nСостав: Пластик, текстиль, металл.', 'ВА-П-84/67', NULL, 690, NULL, 220, '2017-10-14 15:39:16', '2017-10-14 15:39:16', NULL, 0, 1, '', '', '', '', '', ''),
(1659, 0, 10, 0, 'elegantnoe_kruzhevnoe_kole_s_cepochkami', 'Элегантное кружевное колье с цепочками', NULL, 9, 'Элегантнное колье из тонкого черного кружева, украшенное черными  бусинками висящими на длинных цепочках золотистого цвета.\r\nДлина: 40 см. + 5 см.\r\nСостав: Металл, стразы, текстиль.', 'ВА-П-81/91', NULL, 710, NULL, 230, '2017-10-14 15:45:10', '2017-10-14 15:45:10', NULL, 0, 1, '', '', '', '', '', ''),
(1660, 0, 10, 0, 'elegantnoe_kruzhevnoe_kole_s_kulonom_cvetochkom', 'Элегантное кружевное колье с кулоном-цветочком', NULL, 9, 'Элегантное колье ожерелье - чокер на черной кружевной эластичной тесьме. Подвеска из металла серебряного цвета в виде маленького цветка с серединкой - стразинкой.\r\nДлина: 24 см + 5 см. Диаметр цветка 1,5 см.\r\nСостав: Металл, текстиль, стразы.\r\n', 'ВА-П-84/13', NULL, 530, NULL, 140, '2017-10-14 15:49:12', '2017-10-14 15:50:32', NULL, 0, 1, '', '', '', '', '', ''),
(1661, 0, 10, 0, 'elegantnoe_kole_choker_s_bolshim_kruglym_kulonom', 'Элегантное колье-чокер с большим круглым кулоном', NULL, 9, 'Элегантное колье-чокер, выполнено на черной текстильной основе с большим круглым кулоном из серебристого металла.  \r\nДлина: 40 см. + 5 см.\r\nСостав: Металл, текстиль.', 'ВА-П-83/2', NULL, 770, NULL, 260, '2017-10-14 15:53:33', '2017-10-14 15:53:33', NULL, 0, 1, '', '', '', '', '', ''),
(1662, 0, 10, 0, '_elegantnoe_kole_choker_s_2_kulonami', 'Элегантное колье-чокер с 2 кулонами', NULL, 9, 'Элегантное колье-чокер, выполнено на текстильной основе черного цвета с кулоном в виде большого сияющего страза и с кулоном в виде креста из металла серебристого цвета, украшенного стразами.  \r\nДлина: 40 см. + 5 см.\r\nСостав: Металл, текстиль, стразы.', 'ВА-П-82/96', NULL, 550, NULL, 150, '2017-10-14 15:59:44', '2017-10-14 15:59:44', NULL, 0, 1, '', '', '', '', '', ''),
(1663, 0, 10, 0, 'prostoe_i_elegantnoe_kole_s_2_podveskami', 'Простое и элегантное колье  с 2 подвесками', NULL, 9, 'Простое и элегантное колье ожерелье - чокер на тонком черном шнурке украшено металлической цепочкой золотистого цвета  и подвесками, одна их которых крестик.\r\nДлина: 32 см + 5 см. Размер кристалла 1,5 см х 1,2 см.\r\nСостав: Металл, текстиль, стразы.', 'ВА-П-83/47', NULL, 550, NULL, 150, '2017-10-14 16:04:05', '2017-10-14 16:04:05', NULL, 0, 1, '', '', '', '', '', ''),
(1664, 0, 10, 0, 'miloe_kole_s_podveskoj_v_vide_serdca', 'Милое колье с подвеской в виде сердца', NULL, 9, 'Милое колье ожерелье - чокер выполнено на текстильном черном шнуре и украшено подвеской в виде сердца из серебристого металла, внутри которой и нп её креплении сияют восхитительные стразы.\r\nДлина: 33 см + 5 см. Стразы 0,7 см и 1,5 см.\r\nСостав: Металл, текстиль, стазы.', 'ВА-П-83/45', NULL, 550, NULL, 150, '2017-10-14 16:09:32', '2017-10-14 16:09:32', NULL, 0, 1, '', '', '', '', '', ''),
(1665, 0, 10, 0, 'kole_na_tonkoj_cepochke_s_businami', 'Колье на тонкой цепочке с бусинами', NULL, 9, 'Великолепные бусы. украшенный стразами. Длина: 50 см. + 5 см.\r\nСостав: Пластик, металл.', 'ВА-Бу-611/34', NULL, 890, NULL, 320, '2017-10-14 16:15:04', '2017-10-14 16:15:04', NULL, 0, 1, '', '', '', '', '', ''),
(1666, 0, 10, 0, 'ozherele_zolotogo_cveta_s_businami_i_strazami', 'Ожерелье золотого цвета с бусинами и стразами', NULL, 9, 'Великолепные бусы, украшенные стразами. Длина: 80 см. + 5 см.\r\nСостав: Металл, стразы.', 'ВА-Бу-611/28', NULL, 1110, NULL, 430, '2017-10-14 16:19:08', '2017-10-14 16:19:08', NULL, 0, 1, '', '', '', '', '', ''),
(1667, 0, 10, 0, 'ozherele_iz_raznocvetnyh_busin', 'Ожерелье из разноцветных бусин', NULL, 9, 'Это ожерелье привлечет к себе внимание блеском разноцветных бусин и золотых элементов розоватого оттенка. Выполнено из пластика.\r\nДлина 40 см + 5 см.', 'ВА-П-84/33', NULL, 830, NULL, 290, '2017-10-14 16:25:28', '2017-10-14 16:25:28', NULL, 0, 1, '', '', '', '', '', ''),
(1668, 0, 10, 0, 'ozherele_bronzovogo_cveta_s_kamnyami', 'Ожерелье бронзового цвета с камнями', NULL, 9, 'Массивную бронзовую цепь фантазийного рисунка украшают крупные камни геометрической формы приглушенных оттенков. Камни с характерным для натуральных камней рисунком.\r\nОжерелье хорошо сочетается с одеждой в стиле кэжуал, с однотонным трикотажем, изделиями из кожи.\r\nДлина 36 см + 7 см\r\nСостав: камни, металл.', 'ВА-П-84/34-36', NULL, 1070, NULL, 410, '2017-10-14 16:29:18', '2017-10-14 16:29:18', NULL, 0, 1, '', '', '', '', '', ''),
(1669, 0, 10, 0, 'massivnoe_ozherele_bronzovogo_cveta_s_zhemchuzhinami', 'Массивное ожерелье бронзового цвета с жемчужинами', NULL, 9, 'Массивную бронзовую цепь фантазийного рисунка украшают стилизованные элементы в виде цветов. Очарование ожерелью придает нежное сияние серых жемчужин и стразинок.\r\nДлина 36 см + 7 см.', 'ВА-П-84/37', NULL, 1130, NULL, 440, '2017-10-14 16:36:36', '2017-10-14 16:36:36', NULL, 0, 1, '', '', '', '', '', ''),
(1670, 0, 10, 0, 'ozherele_iz_shifonovyh_cvetov_svetlogo_serogo_cveta', 'Ожерелье из шифоновых цветов светлого серого цвета', NULL, 9, 'Ожерелье из шифоновых цветов светлого серого цвета смотрится изысканно и броско. Выразительности добавляет центральный медальон, украшенный кристаллами и жемчугом.\r\nШелковый шнурок, приятный к телу.\r\nДлина 40 см + 7 см. Диаметр центрального цветка 9 см.', 'ВА-П-84/47', NULL, 1470, NULL, 610, '2017-10-14 16:41:05', '2017-10-14 16:41:05', NULL, 0, 1, '', '', '', '', '', ''),
(1671, 0, 10, 0, 'cvetochnoe_ozherele_iz_temnogo_serogo_i_chernogo_shifona', 'Цветочное ожерелье из темного серого и черного шифона', NULL, 9, 'Цветочное ожерелье из темного серого и черного шифона смотрится изысканно и броско. Выразительности добавляет центральный медальон, украшенный кристаллами и бисером.\r\nЧерный шелковый шнурок, приятный к телу.\r\nДлина 40 см + 7 см. Диаметр центрального цветка 9 см.', 'ВА-П-84/48', NULL, 1470, NULL, 610, '2017-10-14 16:44:40', '2017-10-14 16:44:40', NULL, 0, 1, '', '', '', '', '', ''),
(1672, 0, 10, 0, 'ozherele_iz_shifonovyh_cvetov', 'Ожерелье из шифоновых цветов', NULL, 9, 'Ожерелье из шифоновых цветов смотрится изысканно и броско. Выразительности добавляет центральный медальон, украшенный кристаллами и бисером.\r\nШелковый шнурок, приятный к телу.\r\nДлина 40 см + 7 см. Диаметр центрального цветка 9 см.', 'ВА-П-84/45-46', NULL, 1470, NULL, 610, '2017-10-14 16:48:10', '2017-10-14 16:48:10', NULL, 0, 1, '', '', '', '', '', ''),
(1673, 0, 10, 0, 'ozherele_iz_shelkovyh_cvetov_zelenogo_cveta_', 'Ожерелье из шелковых цветов зеленого цвета', NULL, 9, 'Ожерелье из шелковых цветов темного изумрудно - зеленого цвета смотрится изысканно и броско. Крупные жемчужины подчеркнут Вашу женственность и элегантность. Шелковый шнурок, приятный к телу.\r\nДлина 40 см + 7 см.', 'ВА-П-84/40', NULL, 1470, NULL, 610, '2017-10-14 16:56:49', '2017-10-14 16:56:49', NULL, 0, 1, '', '', '', '', '', ''),
(1674, 0, 10, 0, 'velikolepnoe_kole_temno_krasnogo_cveta', 'Великолепное колье темно-красного цвета', NULL, 9, 'Великолепное колье темного красного цвета. Пуговицы из перламутра диаметром 3,5 см. Металлические элементы золотого цвета.\r\nДлина: 42 см + 5 см.', 'ВА-П-31/14', NULL, 1390, NULL, 570, '2017-10-14 18:01:25', '2017-10-14 18:01:25', NULL, 0, 1, '', '', '', '', '', ''),
(1675, 0, 10, 0, 'yarkoe_ozherele_sinego_cveta', 'Яркое ожерелье синего цвета', NULL, 9, 'Подчеркнет вашу красоту яркое ожерелье синего цвета . Пуговицы из перламутра диаметром 3,5 см. Металлические элементы золотого цвета.\r\nДлина: 42 см + 5 см.\r\nСостав: камни, бусины, металл.', 'ВА-П-83/97', NULL, 1390, NULL, 570, '2017-10-14 18:04:24', '2017-11-23 16:01:29', NULL, 0, 1, '', '', '', '', '', ''),
(1676, 0, 10, 0, 'stilnoe_ozherele_iz_naturalno_perlamutra', 'Стильное ожерелье из натурально перламутра', NULL, 9, 'Стильное ожерелье из натурального перламутра. Пуговицы диаметром 3,5 см. Граненые бусинки. Металлические элементы золотого цвета. Крупная металлическая цепочка.\r\nДлина: 42 см + 5 см.', 'ВА-П-84/57-58', NULL, 1390, NULL, 570, '2017-10-14 18:06:59', '2017-10-14 18:11:51', NULL, 0, 1, '', '', '', '', '', ''),
(1677, 0, 10, 0, 'ozherele_serebryanogo_cveta_s_agatom', 'Ожерелье серебряного цвета с агатом', NULL, 9, 'Металлический подвес, украшен камнем Агат. Длина: 60 см. + 5 см.\r\nСостав: Металл, натуральный камень.', 'ВА-П-8/87', NULL, 1370, NULL, 560, '2017-10-14 18:17:45', '2017-10-14 18:17:45', NULL, 0, 1, '', '', '', '', '', ''),
(1678, 0, 10, 0, 'ozherele_serebryanogo_cveta_s_krasnymi_kamnyami', 'Ожерелье серебряного цвета с красными камнями', NULL, 9, 'Прекрасное колье с камнями коралл. Длина 60+5см.\r\nСостав: камни, металл.', 'ВА-П-22/11', NULL, 1150, NULL, 450, '2017-10-14 18:23:47', '2017-10-14 18:23:47', NULL, 0, 1, '', '', '', '', '', ''),
(1679, 0, 10, 0, 'ozherele_serebryanogo_cveta_s_zelenymi_kamnyami', 'Ожерелье серебряного цвета с зелеными камнями', NULL, 9, 'Металлический подвес, украшен камнем - Малахит. Длина: 60 см. + 5 см.\r\nСостав: Металл, натуральный камень.', 'ВА-П-8/92', NULL, 1450, NULL, 600, '2017-10-14 18:26:34', '2017-10-14 18:26:34', NULL, 0, 1, '', '', '', '', '', ''),
(1680, 0, 10, 0, 'massivnoe_ozherele_s_krasnymi_kamnyami', 'Массивное ожерелье с красными камнями', NULL, 9, 'Металлический подвес, украшен натуральным камнем - Кораллом темного красного цвета. Металл цвета черненного серебра.\r\nДлина: 40 см. + 7 см. Размер кулона 6 см х 5 см.', 'ВА-П-83/79', NULL, 1370, NULL, 560, '2017-10-14 18:28:50', '2017-10-14 18:28:50', NULL, 0, 1, '', '', '', '', '', ''),
(1681, 0, 10, 0, 'massivnoe_ozherele_s_malahitom', 'Массивное ожерелье с малахитом', NULL, 9, 'Металлический подвес, украшен малахитом. \r\nМеталл цвета черненного серебра.\r\nДлина: 40 см. + 7 см. Размер кулона 4,5 см х 5 см.', 'ВА-П-83/85', NULL, 1450, NULL, 600, '2017-10-14 18:31:03', '2017-10-14 18:31:03', NULL, 0, 1, '', '', '', '', '', ''),
(1682, 0, 10, 0, 'ozherele_s_naturalnym_kamnem_i_perlamutrom', 'Ожерелье с натуральным камнем и перламутром', NULL, 9, 'Металлический подвес, украшен натуральным камнем - Гелиотис. Натуральный перламутр переливается коричневыми, зелеными и синими оттенками. Металл цвета черненного серебра.\r\nДлина: 40 см. + 7 см. Диаметр кулона 4 см.', 'ВА-П-83/80', NULL, 1290, NULL, 520, '2017-10-14 18:33:03', '2017-10-14 18:33:03', NULL, 0, 1, '', '', '', '', '', ''),
(1683, 0, 10, 0, 'kole_s_naturalnym_kamnem_i_kulonom_v_vide_babochki', 'Колье с натуральным камнем и кулоном в виде бабочки', NULL, 9, 'Потрясающее колье из металла серябрянного цвета с эффектом состаренности (чернение). Кулон в виде бабочки оформлен с использованием натурального камня  - гелиотиса, вставленного в ажурную оправу.\r\nРазмер 36 см + 5 см. Размер бабочки 6 см х 4,5 см.', 'ВА-П-84/56', NULL, 1370, NULL, 560, '2017-10-14 18:35:27', '2017-10-14 18:35:27', NULL, 0, 1, '', '', '', '', '', ''),
(1684, 0, 10, 0, 'kole_s_naturalnym_kamnem_i_kulonom_v_vide_sovy', 'Колье с натуральным камнем и кулоном в виде совы', NULL, 9, 'Металлический подвес, украшен камнем - Гелиотис. \r\nДлина: 60 см. + 5 см.', 'ВА-П-81/72', NULL, 1370, NULL, 560, '2017-10-14 18:37:26', '2017-10-14 18:37:26', NULL, 0, 1, '', '', '', '', '', ''),
(1685, 0, 10, 0, 'massivnoe_ozherele_s_biryuzoj', 'Массивное ожерелье с бирюзой', NULL, 9, 'Металлический подвес, украшен  бирюзовым камнем. \r\nМеталл цвета черненного серебра.\r\nДлина: 40 см. + 7 см. Размер кулона 5,5 см х 4,5 см.\r\n', 'ВА-П-83/84', NULL, 1370, NULL, 560, '2017-10-14 18:39:53', '2017-10-14 18:39:53', NULL, 0, 1, '', '', '', '', '', ''),
(1686, 0, 10, 0, 'massivnoe_ozherele_s_naturalnym_kamnem_avantyurinom', 'Массивное ожерелье с натуральным камнем авантюрином', NULL, 9, 'Металлический подвес, украшен натуральным камнем - Авантюрин. Камень коричневого цвета с эффектом мерцания. \r\nМеталл цвета черненного серебра.\r\nДлина: 40 см. + 7 см. Размер кулона 6 см х 5 см.', 'ВА-П-83/82-83', NULL, 1290, NULL, 520, '2017-10-14 18:43:42', '2017-10-14 18:46:01', NULL, 0, 1, '', '', '', '', '', ''),
(1687, 0, 10, 0, 'massivnoe_ozherele_s_naturalnym_kamnem_tigrovyj_glaz', 'Массивное ожерелье с натуральным камнем тигровый глаз', NULL, 9, 'Потрясающее колье из металла серябрянного цвета с эффектом состаренности (чернение). Кулон оформлен с использованием натурального камня - тигровый глаз, вставленного в ажурную оправу.\r\nРазмер 36 см + 5 см. Диаметр кулона 5 см.', 'ВА-П-84/65', NULL, 1170, NULL, 460, '2017-10-14 18:47:55', '2017-10-14 18:47:55', NULL, 0, 1, '', '', '', '', '', ''),
(1688, 0, 10, 0, 'cherno_zolotoe_kole_s_krupnymi_businami', 'Черно-золотое колье с крупными бусинами', NULL, 9, 'Очаровательный подвес. Длина: 50 см. + 5 см.\r\nСостав: текстиль, пластик.', 'ВА-П-82/44', NULL, 1050, NULL, 400, '2017-10-14 18:53:57', '2017-10-14 18:53:57', NULL, 0, 1, '', '', '', '', '', ''),
(1689, 0, 10, 0, 'universalnoe_kole_s_raznocvetnymi_businami', 'Универсальное колье с разноцветными бусинами', NULL, 9, 'Универсальный подвес подойдет ко многим вещам из Вашего гардероба. Серый, синий, черный, сливовый и зеленый цвета!\r\nДлина 38 см + 5 см. Диаметр цветных бусин 1,3 см- 2 см.\r\nСостав: 	Пластик, текстиль.', 'ВА-П-83/60', NULL, 1050, NULL, 400, '2017-10-14 18:56:11', '2017-10-14 18:56:11', NULL, 0, 1, '', '', '', '', '', ''),
(1690, 0, 10, 0, 'podveska_s_emalyu_i_strazami', 'Подвеска с эмалью и стразами', NULL, 9, 'Популярный подвес "Совушка" украшен прозрачными стразами. Глазки из синих кристаллов. Животик покрыт эмалью чернильного цвета.\r\nДлина 70 см. Диаметр кулона 3 см.\r\nСостав: Металл, кристаллы. стразы.', 'ВА-П-23/67', NULL, 830, NULL, 290, '2017-10-14 19:03:58', '2017-10-14 19:03:58', NULL, 0, 1, '', '', '', '', '', ''),
(1691, 0, 10, 0, 'podveska_s_kristallami_i_strazami_v_vide_sovy', 'Подвеска с кристаллами и стразами в виде совы', NULL, 9, 'Подвес в виде фигурки совы выполнен из кристаллов серо - синего и рубинового цветов. Металлическая оправа сербрянного цвета инкрустирована сияющими прозрачными стразами.\r\nДлина 76 см.Кулон 4,5 см х 3,5 см.', 'ВА-П-24/36', NULL, 870, NULL, 310, '2017-10-14 19:07:26', '2017-10-14 19:07:26', NULL, 0, 1, '', '', '', '', '', ''),
(1692, 0, 10, 0, 'podveska_s_krupnym_kulonom_v_vide_sovy', 'Подвеска с крупным кулоном в виде совы', NULL, 9, 'Подвес из металла. Длина: 60 см. Кулон: 6 см.', 'ВА-П-4/77', NULL, 610, NULL, 180, '2017-10-14 19:10:01', '2017-10-14 19:10:01', NULL, 0, 1, '', '', '', '', '', ''),
(1693, 0, 10, 0, 'podveska_so_strazami_i_kulonom_v_vide_slona', 'Подвеска со стразами и кулоном в виде слона', NULL, 9, 'Металлический подвес, украшенный стразами. Длина: 65 см. Кулон: 5 см.', 'ВА-П-2/34', NULL, 610, NULL, 180, '2017-10-14 19:12:24', '2017-10-14 19:12:24', NULL, 0, 1, '', '', '', '', '', ''),
(1694, 0, 10, 0, 'podveska_serebryanogo_cveta_s_kulonom_v_vide_sovy', 'Подвеска серебряного цвета с кулоном в виде совы', NULL, 9, 'Современный аксессуар - подвес с кулоном сова отлично сочетается с большенством стилей одежды от кежуал до этники. Популярное сочетание -черная и белая эмаль. Красное сердечко. Металл серебрянного цвета.\r\nДлина 76 см. Крупный кулон 7 см х 5 см.', 'ВА-П-23/73', NULL, 630, NULL, 190, '2017-10-14 19:15:48', '2017-10-14 19:15:48', NULL, 0, 1, '', '', '', '', '', ''),
(1695, 0, 10, 0, 'ocharovatelnaya_podveska_s_kulonom_v_vide_sovy', 'Очаровательная подвеска с кулоном в виде совы', NULL, 9, 'Очаровательный аксессуар - подвес с кулоном сова отлично сочетается с большенством стилей одежды от кежуал до этники. Эмаль молочного и черного цвета. Немного страз. Металл серебрянного цвета.\r\nДлина 76 см. Крупный кулон 8 см х 4 см.', 'ВА-П-24/19', NULL, 630, NULL, 190, '2017-10-14 19:23:49', '2017-10-14 19:23:49', NULL, 0, 1, '', '', '', '', '', ''),
(1696, 0, 10, 0, 'podveska_s_kulonom_v_vide_sovy_s_cvetnoj_emalyu', 'Подвеска с кулоном в виде совы с цветной эмалью', NULL, 9, 'Модный аксессуар - подвес с кулоном сова отлично сочетается с большинством стилей одежды от кежуал до этники. Цвета фиксированные: серебряный с голубым, золотой с серым, золотой с фиолетовым.\r\nДлина 70 см. Крупный кулон 9,5 см х 6 см.', 'ВА-П-23/70-72', NULL, 630, NULL, 190, '2017-10-14 19:26:22', '2017-10-14 19:29:41', NULL, 0, 1, '', '', '', '', '', ''),
(1697, 0, 10, 0, 'podveska_iz_kozhi_v_vide_sovy_na_tekstilnom_shnurke', 'Подвеска из кожи в виде совы на текстильном шнурке', NULL, 9, 'Стильный подвес в виде совы выполнен из искусственной кожи на текстильном шнурке. Теснение кожи имитирует оперение и индивидуально для каждого изделия. Украшен гранеными пластиковыми стразами. \r\nДлина 70 см.  Кулон 9,5 см х 5,5 см.', 'ВА-П-23/40-43', NULL, 930, NULL, 340, '2017-10-14 19:34:22', '2017-10-14 19:34:47', NULL, 0, 1, '', '', '', '', '', ''),
(1698, 0, 10, 0, 'nezhnoe_kole_na_shnurke_iz_busin', 'Нежное колье на шнурке из бусин', NULL, 9, 'Нежное колье на шнурке из пластиковых бусин. В этом дизайне удивительно сочетаются бусины, текстильный цветок, стразы и легкая кисочка, крепление которой выполнено из металла золотистого цвета.\r\nДлина шнурка 54 см. Длина кулона 11 см.\r\nСостав: Металл, пластик, текстиль, стразы.', 'ВА-П-24/8-9', NULL, 1030, NULL, 390, '2017-10-15 22:10:26', '2017-10-15 22:10:26', NULL, 0, 1, '', '', '', '', '', ''),
(1699, 0, 10, 0, 'sochetanie_dvuh_izyashnyh_podvesok_v_vide_krylev', 'Сочетание двух изящных подвесок в виде крыльев', NULL, 9, 'Сочетание двух изящных подвесок в виде крыльев на цепочках, выполненных из металла серебристого цвета. Из этого же металла выполнены и сами подвески, но в разной технике. Украшением служат сверкающие стразы.\r\nДлина 42 см. Размер подвески 3,5 см х 1,7 см.\r\nСостав: Металл, стразы.', 'ВА-П-84/27', NULL, 590, NULL, 170, '2017-10-15 22:23:01', '2017-10-15 22:23:01', NULL, 0, 1, '', '', '', '', '', ''),
(1700, 0, 10, 0, 'sochetanie_dvuh_izyashnyh_podvesok_raznoj_formy', 'Сочетание двух изящных подвесок разной формы', NULL, 9, 'Сочетание двух изящных подвесок разной формы на цепочках, выполненных из металла серебристого цвета. Из этого же металла выполнены и сами подвески и украшены сверкающими стразами и черной эмалью.\r\nДлина 42 см. диаметр круглой подвески 2,8 см.\r\nСостав: Металл, стразы, эмаль.', 'ВА-П-84/26', NULL, 590, NULL, 170, '2017-10-15 22:27:20', '2017-10-15 22:27:20', NULL, 0, 1, '', '', '', '', '', ''),
(1701, 0, 10, 0, 'sochetanie_dvuh_izyashnyh_podvesok_pryamougolnoj_i_ovalnoj_formy', 'Сочетание двух изящных подвесок прямоугольной и овальной формы', NULL, 9, 'Сочетание двух изящных подвесок разной геометрической формы на цепочках, выполненных из металла серебристого цвета. Из этого же металла выполнены и сами подвески и украшены сверкающими стразами и черной эмалью.\r\nДлина 42 см. Размер крупной подвески 3 см х 2 см.\r\nСостав: Металл, стразы, эмаль.', 'ВА-П-84/25', NULL, 590, NULL, 170, '2017-10-15 22:31:37', '2017-10-15 22:31:37', NULL, 0, 1, '', '', '', '', '', ''),
(1702, 0, 10, 0, 'sochetanie_dvuh_izyashnyh_podvesok_s_listikami_klevera', 'Сочетание двух изящных подвесок с листиками клевера', NULL, 9, 'Сочетание двух изящных подвесок с листиками клевера на цепочках, выполненных из металла серебристого цвета. Из этого же металла выполнены и сами подвески, украшенные сверкающими стразами.\r\nДлина 42 см. Размер крупной подвески 3 см х 1,8 см.\r\nСостав: Металл, стразы.', 'ВА-П-84/24', NULL, 590, NULL, 170, '2017-10-15 22:36:29', '2017-10-15 22:36:29', NULL, 0, 1, '', '', '', '', '', ''),
(1703, 0, 10, 0, 'izyskannoe_kole_iz_dvuhcvetnogo_bisera', 'Изысканное колье из двухцветного бисера', NULL, 9, 'Изысканное колье , подчеркивающее шею. Состоит  из нескольких десятков нитей бисера в красно-бордовых тонах. Любая горловина будет смотреться с ним особенно нарядно.\r\nДлина: 46 см + 5 см.\r\nСостав: Металл, пластик.', 'ВА-Бу-641/36', NULL, 1010, NULL, 380, '2017-10-15 22:52:36', '2017-10-15 22:52:36', NULL, 0, 1, '', '', '', '', '', ''),
(1704, 0, 10, 0, 'fakturnye_busy_s_melanzhevym_shnurom', 'Фактурные бусы с меланжевым шнуром', NULL, 9, 'Фактурные бусы выполнены с использованием текстильного меланжевого шнура. Крупные круглые бусины соседствуют с плоскими однотонными . Этот необычный дизайн и удивительное сочетание цветов непременно привлечет к Вам внимание!\r\nДлина 50 см. Диаметр бусин 3,5 см.\r\nСостав: Пластик, текстиль.', 'ВА-П-83/50-58', NULL, 1210, NULL, 480, '2017-10-15 23:01:16', '2017-10-15 23:13:00', NULL, 0, 1, '', '', '', '', '', ''),
(1705, 0, 10, 0, 'kole_iz_cvetov_s_granenoj_businoj_v_centre', 'Колье из цветов с гранёной бусиной в центре', NULL, 9, 'Как живые смотрятся цветы в этом изящном колье. Серединка каждого цветка украшена прозрачной  граненной бусинкой. Цепочка выполнена из металла золотистого цвета.\r\nДлина 40 см + 7 см. Диаметр цветка 5 см.\r\nСостав: Пластик, металл, стразы.', 'ВА-П-83/65-67', NULL, 1170, NULL, 460, '2017-10-15 23:23:24', '2017-10-15 23:23:24', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1706, 0, 10, 0, 'nezhnoe_kole_iz_cvetov', 'Нежное колье из цветов', NULL, 9, 'Необыкновенно нежные цветы из пластика в этом колье выглядят воздушными и хрупкими! И как капельки росы в центре цветка сияют стразы! Металлическая цепь выполнена из металла золотистого цвета.\r\nДлина 40 см + 7 см. Диаметр цветка 5 см.\r\nСостав: Пластик, металл, стразы.\r\n  ', 'ВА-П-83/61-62', NULL, 1170, NULL, 460, '2017-10-15 23:45:46', '2017-10-16 12:38:29', NULL, 0, 1, '', '', '', '', '', ''),
(1707, 0, 10, 0, 'cvetochnoe_kole_voshititelnogo_zelenogo_cveta', 'Цветочное колье восхитительного зелёного цвета', NULL, 9, 'Цветочное колье в зеленых тонах.Пластиковые цветы смотрятся \r\nДлина 42 см + 5 см. Диаметр цветков 4 см - 6 см.\r\nСостав: Пластик, металл.', 'ВА-П-83/75', NULL, 1050, NULL, 400, '2017-10-15 23:54:11', '2017-10-15 23:56:17', NULL, 0, 1, '', '', '', '', '', ''),
(1708, 0, 10, 0, 'cvetochnoe_kole_v_zelenyh_tonah', 'Цветочное колье в зеленых тонах', NULL, 9, 'Цветочное колье, в котором использованы два замечательных оттенка зеленого цвета. Пластиковые цветы смотрятся \r\nДлина 42 см + 5 см. Диаметр цветков 4 см - 6 см.\r\nСостав: Пластик, металл.', 'ВА-П-83/86', NULL, 1050, NULL, 400, '2017-10-16 00:00:16', '2017-10-16 00:00:16', NULL, 0, 1, '', '', '', '', '', ''),
(1709, 0, 10, 0, 'kole_iz_cvetnyh_grozdev', 'Колье из цветных гроздьев', NULL, 9, 'Стиль «металлик» - модный тренд этого года. Яркие грозди из цветных пластиковых бусин сделают Ваш образ ослепительным. Цепочка, выполненная из металла золотистого цвета, является дополнительным украшением этого колье.\r\nДлина: 50 см. + 5 см. Диаметр бусин 1,0 см.\r\nСостав: Пластик, металл.\r\n ', 'ВА-Бу-650/22-23', NULL, 1410, NULL, 580, '2017-10-16 00:08:32', '2017-10-16 00:08:32', NULL, 0, 1, '', '', '', '', '', ''),
(1710, 0, 10, 0, 'yarkie_krasnye_busy_s_temnymi_prozhilkami', 'Яркие красные бусы с темными прожилками', NULL, 9, 'Яркие красные бусы с темными прожилками из бусин удлиненной формы.\r\nВыполнены из натурального камня.\r\nДлина 52 см см. Размер бусин 1,4 см х 1,0 см.\r\nСостав: Камень.', 'ВА-Бу-641/28', NULL, 830, NULL, 290, '2017-10-16 00:18:22', '2017-10-16 00:18:22', NULL, 0, 1, '', '', '', '', '', ''),
(1711, 0, 10, 0, 'klassicheskie_busy_iz_zelenogo_kamnya_', 'Классические бусы из зеленого камня', NULL, 9, 'Классические бусы из натурального камня насыщенного зеленого цвета выгодно выделяются благодаря натуральному узору.\r\nДлина 40 см. Диаметр бусин 1 см.\r\nСостав: Камень.', 'ВА-Бу-641/25', NULL, 790, NULL, 270, '2017-10-16 00:21:58', '2017-10-16 00:21:58', NULL, 0, 1, '', '', '', '', '', ''),
(1712, 0, 10, 0, 'milye_melkie_krasnye_busy', 'Милые мелкие красные бусы', NULL, 9, 'Эти бусы из натурального камня собраны как будто из маленьких красных зернышек.\r\nОни могут пригодиться абсолютно для любого случая. \r\nДлина: 40 см.\r\nСостав: Камень.', 'ВА-Бу-64/56', NULL, 750, NULL, 250, '2017-10-16 00:26:26', '2017-10-16 00:27:41', NULL, 0, 1, '', '', '', '', '', ''),
(1713, 0, 10, 0, 'ocharovatelnoe_kole_slozhnogo_pleteniya', 'Очаровательное колье сложного плетения', NULL, 9, 'Очаровательное колье сложного плетения выполнено из граненых бусин красного цвета. Украсит собой даже самый скромный наряд!\r\nДлина: 50 см.\r\nСостав: Пластик.', 'ВА-Бу-650/21', NULL, 1270, NULL, 510, '2017-10-16 00:31:54', '2017-10-16 00:31:54', NULL, 0, 1, '', '', '', '', '', ''),
(1714, 0, 10, 0, 'izumitelnoe_cherno_krasnoe_kole_', 'Изумительное черно-красное колье', NULL, 9, 'Изумительное колье из металла, украшенное стразами. Очень красивое сочетание черно-красного цвета.Тонкий черный шнур придает  дополнительный шарм в сочетании с массивными подвесками.\r\nДлина: 60 см. + 5 см.\r\nСостав: Металл, стразы.', 'ВА-П-82/73', NULL, 850, NULL, 300, '2017-10-16 09:49:33', '2017-10-16 09:55:39', NULL, 0, 1, '', '', '', '', '', ''),
(1715, 0, 10, 0, 'izumitelnoe_chernoe_kole_iz_metalla', 'Изумительное черное колье из металла', NULL, 9, 'Изумительное колье из металла, украшенное стразами. Тонкий черный шнур придает  дополнительный шарм в сочетании с массивными черными подвесками.\r\nДлина: 60 см. + 5 см.\r\nСостав: Металл, стразы.', 'ВА-П-82/76', NULL, 790, NULL, 270, '2017-10-16 09:55:03', '2017-10-16 09:56:08', NULL, 0, 1, '', '', '', '', '', ''),
(1716, 0, 10, 0, 'naryadnoe_kole_s_krupnymi_podveskami', 'Нарядное колье с крупными подвесками', NULL, 9, 'Нарядное колье на текстильном черном шнурке. Крупные подвески прямоугольной формы  со светлыми прожилками удивительно похожи на натуральные камни! Украшены черными граненными бусинами и стразами, закрепленными в металл золотистого цвета.\r\nДлина 46 см. Размер камней 4 см х 2 см.\r\nСостав: Пластик, текстиль, металл, стразы.', 'ВА-П-83/55-57', NULL, 890, NULL, 320, '2017-10-16 11:13:04', '2017-10-16 11:14:18', NULL, 0, 1, '', '', '', '', '', ''),
(1717, 0, 10, 0, 'zolotistoe_kole_s_chernymi_businkami', 'Золотистое колье с черными бусинками', NULL, 9, 'Колье из металла золотистого цвета, украшенное черными бусинками и золотистыми коническими маленькими подвесками, имитирующими бахрому. Длина может меняться по Вашему желанию.\r\nДлина: 55 см. + 5 см.\r\nСостав: Металл, пластик.', 'ВА-Бу-620/70', NULL, 970, NULL, 360, '2017-10-16 11:20:30', '2017-10-16 11:22:28', NULL, 0, 1, '', '', '', '', '', ''),
(1718, 0, 10, 0, 'stilnoe_metallicheskoe_kole_na_chernom_shnurke', 'Стильное металлическое колье на черном шнурке', NULL, 9, 'Стильное металлическое колье на черном текстильном шнурке.  Крупные подвески округлой формы закреплены в металле золотистого цвета. Их эффектно отделяют друг от друга вставки с искрящимися стразами.\r\nДлина: 60 см. + 5 см.\r\nСостав: Металл, пластик, стразы, текстиль.', 'ВА-П-81/90', NULL, 910, NULL, 330, '2017-10-16 11:26:03', '2017-10-16 11:26:50', NULL, 0, 1, '', '', '', '', '', ''),
(1719, 0, 10, 0, 'chudesnoe_kole_s_podveskami_interesnoj_formy', 'Чудесное колье с подвесками интересной формы', NULL, 9, 'Чудесное колье на черном текстильном шнурке. Подвески очень интересной формы, увеличивающиеся к середине, выполнены с использованием металла золотистого цвета. Выемка в центре каждой подвески окантована дорожкой из сияющих стразов!\r\nподвес золотого цвета, украшенной стразами. \r\nДлина: 25+5 см.\r\nСостав: Металл, текстиль, пластик, стразы.', 'ВА-П-82/57-58', NULL, 890, NULL, 320, '2017-10-16 11:34:40', '2017-10-16 11:35:15', NULL, 0, 1, '', '', '', '', '', ''),
(1720, 0, 10, 0, 'kole_iz_metalla_v_stile_minimalizma', 'Колье из металла в стиле минимализма', NULL, 9, 'Модный  дизайн этого колье никого не оставит равнодушным! Стиль минимализма подчеркнут приглушенными стразами и матированным металлом. \r\nДлина: 60 см. + 5 см.\r\nСостав: Металл, стразы.', 'ВА-П-82/74', NULL, 830, NULL, 290, '2017-10-16 11:45:12', '2017-10-16 11:45:12', NULL, 0, 1, '', '', '', '', '', ''),
(1721, 0, 10, 0, 'interesnoe_kole_na_massivnoj_vitoj_osnove', 'Интересное колье на массивной витой основе', NULL, 9, 'Это интересное  колье, выполненное из металла серебристого цвета, выглядит и современным и старинным одновременно. Как в старинных колье в стиле "ошейник", \r\nв нем использована металлическая круглая массивная витая основа.  На ней крепятся интересной огранки черные подвески, между которыми закреплены бусины и вставки с сияющими стразами. \r\nДлина : 60 см. + 5 см.\r\nСостав: Металл, пластик, стразы.', 'ВА-П-82/75', NULL, 790, NULL, 270, '2017-10-16 11:55:08', '2017-10-16 11:55:08', NULL, 0, 1, '', '', '', '', '', ''),
(1722, 0, 10, 0, 'interesnoe_kole_s_ostrougolnymi_krasnymi_vstavkami', 'Интересное колье с остроугольными красными вставками', NULL, 9, 'Интересное колье на толстом кожаном ремешке.  Строгие геометрические формы дизайна напоминают украшения египетских цариц. Металл золотистого цвет\r\nоттеняется черными бусинами и еще больше привлекает внимание к необычным остроугольным красным вставкам. \r\nДиаметр бусин: 3 см. Длина: 20 см.\r\nСостав: Металл, текстиль, пластик.', 'ВА-П-82/93', NULL, 870, NULL, 310, '2017-10-16 12:02:27', '2017-10-16 12:37:32', NULL, 0, 1, '', '', '', '', '', ''),
(1723, 0, 10, 0, 'podveska_s_mnogosostavnym_kulonom', 'Подвеска с многосоставным кулоном', NULL, 9, 'Великолепный металлический подвес. \r\nДлина: 80 см. + 5 см.\r\nСостав: Пластик, металл, стразы.', 'ВА-П-22/82', NULL, 830, NULL, 290, '2017-10-16 12:43:22', '2017-10-16 12:43:22', NULL, 0, 1, '', '', '', '', '', ''),
(1724, 0, 10, 0, 'dlinnaya_podveska_s_businami', 'Длинная подвеска с бусинами', NULL, 9, 'Великолепный подвес. \r\nДлина: 80 см. + 5 см.\r\nСостав: Пластик, металл.', 'ВА-П-22/96', NULL, 890, NULL, 320, '2017-10-16 12:50:10', '2017-10-16 12:50:10', NULL, 0, 1, '', '', '', '', '', ''),
(1725, 0, 10, 0, 'lakonichnaya_podveska_s_krupnoj_businoj', 'Лаконичная подвеска с крупной бусиной', NULL, 9, 'Великолепный металлический подвес.Длина: 80 см. Кулон : 1,5 см.', 'ВА-П-22/53', NULL, 890, NULL, 320, '2017-10-16 12:52:39', '2017-10-16 12:52:39', NULL, 0, 1, '', '', '', '', '', ''),
(1726, 0, 10, 0, 'metallicheskaya_podveska_s_krupnym_kulonom', 'Металлическая подвеска с крупным кулоном', NULL, 9, 'Великолепный металлический подвес, украшенный стразами. \r\nДлина: 80 см. + 5 см.\r\n', 'ВА-П-22/90', NULL, 830, NULL, 290, '2017-10-16 12:56:21', '2017-10-16 12:56:21', NULL, 0, 1, '', '', '', '', '', ''),
(1727, 0, 10, 0, 'stilnye_busy_zolotogo_cveta', 'Стильные бусы золотого цвета', NULL, 9, 'Стильные бусы. Длина: 50 см.\r\nСостав: Пластик, металл.', 'ВА-Бу-611/5', NULL, 810, NULL, 280, '2017-10-16 12:59:46', '2017-10-16 12:59:46', NULL, 0, 1, '', '', '', '', '', ''),
(1728, 0, 10, 0, 'shikarnye_busy_s_melkimi_businami', 'Шикарные бусы с мелкими бусинами', NULL, 9, 'Шикарный подвес, украшен бусинками. Длина: 100 см.', 'ВА-П-21/90', NULL, 610, NULL, 180, '2017-10-16 13:02:46', '2017-10-16 13:02:46', NULL, 0, 1, '', '', '', '', '', ''),
(1729, 0, 10, 0, 'podveska_zolotogo_cveta_s_raznymi_elementami', 'Подвеска золотого цвета с разными элементами', NULL, 9, 'Великолепный металлический подвес. Длина: 80 см. + 5 см.', 'ВА-П-22/71', NULL, 890, NULL, 320, '2017-10-16 13:08:47', '2017-10-16 13:08:47', NULL, 0, 1, '', '', '', '', '', ''),
(1730, 0, 10, 0, 'velikolepnoe_kole_iz_metalla_serebryanogo_cveta', 'Великолепное колье из металла серебряного цвета', NULL, 9, 'Великолепное колье из металла серебряного цвета, украшенное камнями. Длина: 50 см. + 5 см.', 'ВА-П-83/5', NULL, 910, NULL, 330, '2017-10-16 13:13:45', '2017-10-16 13:13:45', NULL, 0, 1, '', '', '', '', '', ''),
(1731, 0, 10, 0, 'podveska_iz_emali_na_zamshevom_shnurke', 'Подвеска из эмали на замшевом шнурке', NULL, 9, 'Подвес на замшевом шнурке выполнен на кожаной основе.  Центральная вставка из эмали  декорирована бусинами и бисером. \r\nДополните светлый наряд этим оригинальным украшением. Роскошный образ готов!\r\nДлина шнурка 65 см. Длина кулона с подвесками 11 см, ширина 6 см.\r\nСостав: Эмаль, пластик, текстиль.', 'ВА-П-23/75', NULL, 770, NULL, 260, '2017-10-16 13:18:34', '2017-10-16 13:18:34', NULL, 0, 1, '', '', '', '', '', ''),
(1732, 0, 10, 0, 'divnaya_podveska_na_zamshevom_shnurke', 'Дивная подвеска на замшевом шнурке', NULL, 9, 'Дивный подвес на замшевом шнурке выполнен на кожаной основе.  Центральная вставка из эмали  декорирована бусинами и бисером. \r\nДополните летний наряд этим оригинальным украшением. Роскошный образ готов!\r\nДлина шнурка 65 см. Длина кулона с подвесками 11 см, ширина 6 см.', 'ВА-П-23/78', NULL, 770, NULL, 260, '2017-10-16 13:25:22', '2017-10-16 13:25:22', NULL, 0, 1, '', '', '', '', '', ''),
(1733, 0, 10, 0, 'podveska_na_tekstilnom_shnurke_s_biserom_i_businami', 'Подвеска на текстильном шнурке с бисером и бусинами', NULL, 9, 'Этот подвес на текстильном шнурке хочется разглядывать снова и снова. Вставки из эмали на кожаной основе декорированы бусинами и бисером. \r\nУкрашение станет изюминкой вашего образа в стиле casual. \r\nДлина шнурка 65 см. Длина кулона с подвесками 13 см, ширина 6 см.', 'ВА-П-23/88', NULL, 850, NULL, 300, '2017-10-16 13:29:48', '2017-10-16 13:29:48', NULL, 0, 1, '', '', '', '', '', ''),
(1734, 0, 10, 0, 'tekstilnaya_brosh_bulavka_stalnogo_cveta', 'Текстильная брошь-булавка стального цвета', NULL, 9, 'Текстстильныая роза украшает брошь - булавку прохладного стального цвета. Жемчужная бусинка придает выразительности. Металл серебрянного цвета. \r\nДиаметр цветка 7 см. Длина броши 9 см.\r\nСостав: Металл, текстиль.', 'ВА-Бр-150/6', NULL, 570, NULL, 160, '2017-10-16 13:35:33', '2017-10-16 13:35:33', NULL, 0, 1, '', '', '', '', '', ''),
(1735, 0, 10, 0, 'tekstilnaya_brosh_bulavka_pylnogo_bordovogo_cveta', 'Текстильная брошь-булавка пыльного бордового цвета', NULL, 9, 'Очаровательный пион украшает текстильную брошь - булавку пыльного бордового цвета. Жемчужная бусинка придает нежности. Металл серебрянного цвета. \r\nДиаметр цветка 4,5 см. Длина броши 9 см.\r\nСостав: 	Металл, текстиль.', 'ВА-Бр-150/2', NULL, 570, NULL, 160, '2017-10-16 13:42:23', '2017-10-16 13:42:23', NULL, 0, 1, '', '', '', '', '', ''),
(1736, 0, 10, 0, 'brosh_v_vide_dereva_s_krupnym_kamnem', 'Брошь в виде дерева с крупным камнем', NULL, 9, 'Брошь в виде дерева выполнена из металла цвета под старинное серебро.\r\nУкрашена крупным камнем искрящегося оранжевого цвета.\r\nРазмер 6,5 см х 4 см.', 'ВА-Бр-131/36', NULL, 770, NULL, 260, '2017-10-16 13:46:53', '2017-10-16 13:46:53', NULL, 0, 1, '', '', '', '', '', ''),
(1737, 0, 10, 0, 'stilnaya_lakonichnaya_brosh_serebryanogo_cveta', 'Стильная лаконичная брошь серебряного цвета', NULL, 9, 'Стильная лаконичная брошь в виде стрекозы из металла серебрянного цвета.\r\nМожет использоваться  как кулон.\r\nРазмер 8 см х 5 см.', 'ВА-Бр-101/26', NULL, 770, NULL, 260, '2017-10-16 13:53:59', '2017-10-16 13:53:59', NULL, 0, 1, '', '', '', '', '', ''),
(1738, 0, 10, 0, 'brosh_bronzovogo_cveta_s_kamnyami', 'Брошь бронзового цвета с камнями', NULL, 9, 'Брошь из антикварной коллекции можно использовать и как кулон. Великолепное металлическое основание бронзового цвета в виде цветка инкрустировано стразами и украшено очаровательным рисунком. В центре крупный кристалл сливового цвета.\r\nРазмер 7 см х 4 см.', 'ВА-Бр-130/89', NULL, 1370, NULL, 560, '2017-10-16 13:57:36', '2017-10-16 13:57:36', NULL, 0, 1, '', '', '', '', '', ''),
(1739, 0, 10, 0, 'assimetrichnaya_brosh_v_vide_buketa', 'Ассиметричная брошь в виде букета', NULL, 9, 'Ассиметричная брошь в виде букета из металла золотого цвета. Украшена красными и золотыми  стразами. Размер 7 см х 4 см.', 'ВА-Бр-130/70', NULL, 970, NULL, 360, '2017-10-16 13:59:42', '2017-10-16 13:59:42', NULL, 0, 1, '', '', '', '', '', ''),
(1740, 0, 10, 0, 'brosh_v_vide_snezhinki_zolotogo_cveta', 'Брошь в виде снежинки золотого цвета', NULL, 9, 'Брошь в виде снежинки можно использовать и как кулон. Металлическое основание золотого цвета инкрустировано стразами и цветными кристаллами. \r\nДиаметр 6 см.', 'ВА-Бр-131/29', NULL, 1370, NULL, 560, '2017-10-16 14:12:44', '2017-10-16 14:12:44', NULL, 0, 1, '', '', '', '', '', ''),
(1741, 0, 10, 0, 'brosh_v_vide_cvetka_bronzovogo_cveta', 'Брошь в виде цветка бронзового цвета', NULL, 9, 'Богатство и роскошь Вашего наряда подчеркнет  брошь в виде цветка. Золотистые стразы в металле бронзового цвета. Диаметр 5 см.', 'ВА-Бр-130/86', NULL, 1090, NULL, 420, '2017-10-16 14:15:36', '2017-10-16 14:18:10', NULL, 0, 1, '', '', '', '', '', ''),
(1742, 0, 10, 0, 'glamurnaya_brosh_iz_metalla_bronzovogo_cveta', 'Гламурная  брошь из металла бронзового цвета', NULL, 9, 'Гламурная  брошь из металла бронзового цвета, украшенная стразами и кристаллами оттенков морской волны. Размер 7,5 см х 2,5 см.', 'ВА-Бр-130/76', NULL, 870, NULL, 310, '2017-10-16 14:19:40', '2017-10-16 14:19:40', NULL, 0, 1, '', '', '', '', '', ''),
(1743, 0, 10, 0, 'brosh_zolotogo_cveta_so_strazami_i_zhemchugom', 'Брошь золотого цвета со стразами и жемчугом', NULL, 9, 'Надоела рубашка? Эта брошь на воротник придаст вашей любимой  одежде свежее дыхание!  Выполнена из металла золотого цвета, украшена стразами и жемчугом. Длина 18 см.', 'ВА-Бр-130/79', NULL, 770, NULL, 260, '2017-10-16 14:49:38', '2017-10-16 14:49:38', NULL, 0, 1, '', '', '', '', '', ''),
(1744, 0, 10, 0, 'brosh_s_businami_iz_naturalnogo_kamnya', 'Брошь с бусинами из натурального камня', NULL, 9, 'Брошь выполнена из металла цвета состаренного серебра.\r\nУкрашена бусинами из натурального камня.\r\nНабор цветов бусин индивидуален для каждого изделия.\r\nМожет использоваться, как кулон.\r\nДиаметр 4.5 см.', 'ВА-Бр-131/11', NULL, 770, NULL, 260, '2017-10-16 14:56:38', '2017-10-16 14:56:38', NULL, 0, 1, '', '', '', '', '', ''),
(1745, 0, 10, 0, 'brosh_serebryanogo_cveta_s_zhemchuzhinoj', 'Брошь серебряного цвета с жемчужиной', NULL, 9, 'Брошь выполнена из металла цвета под старинное серебро.\r\nУкрашена жемчужиной и дорожками серых стразинок.\r\nДиаметр 5 см.', 'ВА-Бр-131/19', NULL, 770, NULL, 260, '2017-10-16 15:06:51', '2017-10-16 15:06:51', NULL, 0, 1, '', '', '', '', '', ''),
(1746, 0, 10, 0, 'ocharovatelnaya_brosh_iz_metalla_v_vide_dereva', 'Очаровательная брошь из металла в виде дерева', NULL, 9, 'Очаровательная брошь из металла цвета светлого серебра, в виде цветущего дерева, украшена розовыми и голубыми прозрачными и матовыми стразами. Ствол дерева инкрустирован сияющими кристаллами.\r\nРазмер 4 см х 3,5 см.', 'ВА-Бр-131/27-28', NULL, 750, NULL, 250, '2017-10-16 15:12:07', '2017-10-16 15:12:38', NULL, 0, 1, '', '', '', '', '', ''),
(1747, 0, 10, 0, 'brosh_pod_starinnoe_serebro_v_vide_dereva', 'Брошь под старинное серебро в виде дерева', NULL, 9, 'Брошь в виде дерева выполнена из металла цвета под старинное серебро.\r\nУкрашена бусинами из натурального камня. Набор цветов бусин индивидуален для каждого изделия.\r\nРазмер 5,5 см х 5,5 см.', 'ВА-Бр-131/32', NULL, 770, NULL, 260, '2017-10-16 15:20:28', '2017-10-16 15:20:28', NULL, 0, 1, '', '', '', '', '', ''),
(1748, 0, 10, 0, 'brosh_v_vide_dereva_s_businami_iz_naturalnogo_kamnya', 'Брошь в виде дерева с бусинами из натурального камня', NULL, 9, 'Брошь в виде дерева выполнена из металла цвета под старинное серебро.\r\nУкрашена бусинами из натурального камня и жемчужинами. Набор цветов бусин индивидуален для каждого изделия.\r\nРазмер 5,5 см х 5,5 см.', 'ВА-Бр-131/13', NULL, 770, NULL, 260, '2017-10-16 15:24:35', '2017-10-16 15:24:35', 290, 0, 1, '', '', '', '', '', ''),
(1749, 0, 10, 0, 'stilnaya_brosh_perlamutrovogo_cveta_', 'Стильная брошь перламутрового цвета,', NULL, 9, 'Брошь перламутрового цвета в виде цветка, украшенная стразами. Диаметр: 4 см.', 'ВА-Бр-130/39-40', NULL, 580, NULL, 165, '2017-10-16 15:26:43', '2017-10-16 15:42:25', NULL, 0, 1, '', '', '', '', '', ''),
(1750, 0, 10, 0, 'brosh_v_vide_cvetov_serebryanogo_cveta', 'Брошь в виде цветов серебряного цвета', NULL, 9, 'Брошь выполнена из металла цвета состаренного серебра.\r\nУкрашена бусинами из натурального камня. Набор цветов бусин индивидуален для каждого изделия.\r\nРазмер 6 см х 4 см.', 'ВА-Бр-131/10', NULL, 770, NULL, 260, '2017-10-16 15:27:24', '2017-10-16 15:27:24', NULL, 0, 1, '', '', '', '', '', ''),
