(1772, 0, 10, 0, 'bulavka_zazhim_v_golubyh_i_rozovyh_ottenkah', 'Булавка-зажим в голубых и розовых оттенках', NULL, 9, 'Цветочные композиции прочно поселились в летнем женственном гардеробе. Настроение весны и нежности подарит Вам брошь из ткани и пластика в голубых и розовых оттенках.\r\nБрошь может быть использована как аксессуар для волос.\r\nРазмер 13 см х 11 см. Крепление универсальное (булавка+зажим).\r\nСостав: Пластик, текстиль', 'ВА-Бр-678/24', NULL, 610, NULL, 180, '2017-10-16 16:30:27', '2017-10-16 16:30:27', NULL, 0, 1, '', '', '', '', '', ''),
