(1935, 0, 10, 0, 'stilnoe_plate_rubashka_svobodnogo_silueta', 'Стильное платье-рубашка свободного силуэта', NULL, 19, 'Стильное платье свободного силуэта из трикотажного полотна сине-белого цвета. Круглый вырез обработан воротником «стойка». По переду изделия планка с застежкой на пуговицы. Втачные рукава выполнены из однотонного полотна и обработаны манжетами с застежкой на пуговицы. Перед изделия по низу украшен декоративной аппликацией.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 98 см.\r\nДлина рукава 58 см.\r\nШирина рукава 17 см.\r\nГлубина проймы 26.5 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%.', 'ВА-П5-3388/3', NULL, 3450, NULL, 1600, '2017-10-18 15:07:19', '2017-10-18 15:07:19', NULL, 0, 1, '', '', '', '', '', ''),
(1936, 0, 10, 0, 'chudesnoe_plate_rubashka_pryamogo_silueta', 'Чудесное платье-рубашка прямого силуэта', NULL, 18, 'Чудесное платье-рубашка прямого силуэта из трикотажного полотна черно-белого цвета. Горловина изделия обработана отложным воротничком из полотна имитирующего кожу. По переду изделия планка с застежкой на пуговицы. Перед платья-рубашки дополнен декоративным цветком. Низ втачных рукавов обработан манжетом из полотна имитирующего кожу. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 102-106 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3414/12-13', NULL, 3650, NULL, 1700, '2017-10-18 15:18:17', '2017-10-18 15:18:17', NULL, 0, 1, '', '', '', '', '', ''),
(1937, 0, 10, 0, 'roskoshnoe_plate_chernogo_cveta', 'Роскошное платье черного цвета', NULL, 18, 'Роскошное платье свободного А-силуэта из кружевного полотна черного цвета. Круглый вырез изделия обработан косой бейкой и дополнен кружевной кокеткой. Платье двойное: верхняя часть выполнена из легкой сетки в горошек черного цвета. Снизу однотонный подклад из трикотажного полотна черного цвета. Платье с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 113-117 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П5-3692', NULL, 4250, NULL, 2000, '2017-10-18 15:30:46', '2017-10-18 16:10:11', NULL, 0, 1, '', '', '', '', '', ''),
(1938, 0, 10, 0, 'zhenstvennoe_plate_s_rukavami_letuchaya_mysh', 'Женственное платье с  рукавами летучая мышь', NULL, 18, 'Стильное утепленное платье свободного силуэта из трикотажного полотна черного цвета.  Изделие с цельнокроеными рукавами - "летучая мышь". Круглая горловина обработана однотонной окантовкой. В боковых швах изделия карманы. Низ переда дополнен декоративным цветком из страз. Спинка изделия дополнена шлицей. На модели платье надето по верх белой рубашки. Рубашка в комплект не входит. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 112-117 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П3-3693', NULL, 3650, NULL, 1700, '2017-10-18 15:47:53', '2017-11-20 12:00:30', NULL, 0, 1, '', '', '', '', '', ''),
(1939, 0, 10, 0, 'stilnoe_rozovo_chernogo_cveta', 'Стильное розово-черного цвета', NULL, 18, 'Стильное платье прилегающего силуэта из трикотажного полотна розово-черного цвета. Верх платья выполнен из бархата с цветочным рисунком. Фигурный вырез изделия обработан окантовкой из кожи и дополнен кружевом. Изделие с втачными рукавами. Платье отрезное по линии талии и эффектно подчеркнуто баской. Спинка платья дополнена потайной молнией и разрезом. Юбка изделия выполнена из ткани имитирующей кожу. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 107 -110 см.', 'ВА-П3-3312/2-3', NULL, 4050, NULL, 1900, '2017-10-18 16:06:19', '2017-10-18 16:06:19', NULL, 0, 1, '', '', '', '', '', ''),
(1940, 0, 10, 0, 'modnoe_sine_beloe_plate_poluprilegayushego_silueta', 'Модное сине-белое платье полуприлегающего силуэта', NULL, 20, 'Модное платье полуприлегающего силуэта из трикотажного полотна бело-синего цвета. Круглый вырез изделия обработан внутренней обтачкой. Низ рукавов-реглан обработан окантовкой. Платье по линии талии отрезное и дополнено сборками. \r\nАксессуары в комплект не входят.\r\nДлина платья по спинке от плечевого шва до низа изделия — 115 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3698', NULL, 3650, NULL, 1700, '2017-10-18 16:12:54', '2017-10-18 16:12:54', NULL, 0, 1, '', '', '', '', '', ''),
(1941, 0, 10, 0, 'elegantnoe_plate_cherno_belogo_cveta', 'Элегантное платье  черно-белого цвета', NULL, 18, 'Элегантное платье приталенного силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан косой бейкой. Кокетка и втачные рукава выполнены из кружевного полотна белого цвета. Спинка изделия дополнена застежкой на молнию и разрезом по низу. Аксессуары в комплект не входят.\r\nДлина изделия по спинке  от плечевого шва до низа изделия — 101-104 см\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-3234/4-5', NULL, 3850, NULL, 1800, '2017-10-18 16:21:30', '2017-11-19 22:23:11', NULL, 0, 1, '', '', '', '', '', ''),
(1942, 0, 10, 0, 'zhenstvennoe_plate_s_zavyshennoj_taliej', 'Женственное платье с завышенной талией', NULL, 18, 'Женственное платье полуприлегающего силуэта из текстильного полотна синего цвета. Круглый вырез изделия обработан внутренней обтачкой и дополнен декоративным бантом. Низ цельнокроенных рукавов обработан манжетом. Платье отрезное по линии талии. Линия талии завышена. В боковых швах изделия широкий втачной пояс.\r\nАксессуары в комплект не входят.\r\nДлина платья по спинке от плечевого шва до низа изделия — 101-110 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П4-3638/6-9', NULL, 3850, NULL, 1800, '2017-10-18 16:24:11', '2017-10-18 16:24:11', NULL, 0, 1, '', '', '', '', '', ''),
(1943, 0, 10, 0, 'stilnoe_plate_s_otlozhnym_vorotnichkom_sine_serogo_cveta', 'Стильное платье с отложным воротничком сине-серого цвета', NULL, 18, 'Стильное платье прилегающего силуэта из плотного текстильного полотна сине-серого цвета. V-образный вырез изделия дополнен отложным воротничком. Платье отрезное по линии талии. Перед изделия дополнен планкой с застежкой на пуговицы и декоративными карманами Отложной воротник, декоративные карманы и низ втачных рукавов дополнены окантовкой. Низ спинки изделия дополнен шлицей.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 103-107 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П4-3519/4-5', NULL, 3850, NULL, 1800, '2017-10-18 16:32:18', '2017-10-18 16:32:18', NULL, 0, 1, '', '', '', '', '', ''),
(1944, 0, 10, 0, 'izyashnoe_plate_svobodnogo_a_silueta', 'Изящное платье свободного А силуэта', NULL, 18, 'Изящное платье свободного А-силуэта из трикотажного полотна сине-розового цвета. Круглый вырез изделия обработан косой бейкой. Платье двойное: верхняя часть выполнена из кружевного полотна и посажена на тонкий однотонный трикотажный подклад. Платье с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 101-105 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3259/29-32', NULL, 4250, NULL, 2000, '2017-10-18 16:32:42', '2017-10-18 16:32:42', NULL, 0, 1, '', '', '', '', '', ''),
(1945, 0, 10, 0, 'sine_beloe_plate_s_karmanami_na_molnii', 'Сине-белое платье с карманами на молнии', NULL, 18, 'Интересное платье прямого силуэта из трикотажного полотна бело-синего цвета. Круглый вырез изделия обработан внутренней обтачкой. Кокетка и низ втачных рукавов дополнены декоративным кружевом. Изделие отрезное по линии ниже талии. Перед платья дополнен втачными карманами с застежками на молнию.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 102-106 см.\r\nСостав: 	Вискоза 95%, Эластан 5%.', 'ВА-П3-3567/4-5', NULL, 3850, NULL, 1800, '2017-10-18 16:38:42', '2017-10-18 16:38:42', NULL, 0, 1, '', '', '', '', '', ''),
(1946, 0, 10, 0, 'effektnoe_plate_cherno_krasnogo_cveta', 'Эффектное платье черно-красного цвета', NULL, 18, 'Эффектное платье прилегающего силуэта из трикотажного полотна черно-красного цвета. Круглый вырез изделия обработан окантовкой. Отрезная кокетка (имитирующей болеро) дополнена изящным вырезом. Втачные рукава изделия выполнены из шифона с купонным рисунком и обработаны манжетами.Аксессуары в комплект не входят. \r\nДлина изделия по спинке  от плечевого шва до низа изделия — 96-103 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П5-3027', NULL, 4050, NULL, 1900, '2017-10-18 16:40:24', '2017-10-18 16:40:24', NULL, 0, 1, '', '', '', '', '', ''),
(1947, 0, 10, 0, 'sero_rozovoe_plate_s_karmanami_na_molnii', 'Серо-розовое платье с карманами на молнии', NULL, 18, 'Интересное платье прямого силуэта из трикотажного полотна серого цвета. Круглый вырез изделия обработан внутренней обтачкой. Кокетка и низ втачных рукавов дополнены декоративной вышивкой на сетке. Изделие отрезное по линии ниже талии. Перед платья дополнен втачными карманами с застежками на молнию.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 102-106 см.\r\nСостав: Вискоза 95%, Эластан 5%.', 'ВА-П3-3567/2-3', NULL, 4250, NULL, 2000, '2017-10-18 16:43:38', '2017-10-18 16:43:38', NULL, 0, 1, '', '', '', '', '', ''),
(1948, 0, 10, 0, 'effektnyj_kostyum_sostoyashij_iz_platya_i_zhaketa', 'Эффектный костюм состоящий из платья и жакета', NULL, 20, 'Эффектный костюм, состоящий из платья прилегающего силуэта и прямого короткого жакета. Платье выполнено из плотного трикотажного полотна черного цвета, хорошо держащего форму. Круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. Спинка платья дополнена кружевной кокеткой. Жакет выполнен из трикотажного полотна черного цвета с декоративной «вытравкой» рисунка. Круглый вырез изделия обработан внешней обтачкой. Жакет застегивается по переду на внутренний крючок. Изделие с втачными рукавами.Аксессуары в комплект не входят.\r\nДлина платья по спинке от плечевого шва до низа изделия — 109 см.\r\nДлина жакета по спинке от плечевого шва до низа изделия — 54 см.', 'ВА-К3-2993/3', NULL, 5250, NULL, 2500, '2017-10-18 16:46:54', '2017-10-18 16:46:54', NULL, 0, 1, '', '', '', '', '', ''),
(1949, 0, 10, 0, 'voshititelnoe_plate_s_imitaciej_nakidki', 'Восхитительное платье с имитацией накидки', NULL, 18, 'Восхитительное платье полуприлегающего силуэта с изумительным сочетанием контрастных полотен разного состава. Нижняя часть платья выполнена из трикотажного полотна серого цвета, а верх имитирующий накидку, из кружевного полотна. Круглый вырез изделия обработан внешней обтачкой и дополнен декоративным элементом. Платье с втачными рукавами. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 105-112 см.\r\nСостав:Вискоза 95%, Эластан 5%.', 'ВА-П4-3695/0-3', NULL, 4250, NULL, 2000, '2017-10-18 16:50:14', '2017-10-18 16:50:14', NULL, 0, 1, '', '', '', '', '', ''),
(1950, 0, 10, 0, 'plate_serogo_cveta_s_geometricheskim_risunkom', 'Платье серого цвета с геометрическим рисунком', NULL, 18, 'Стильное платье прямого силуэта из трикотажного полотна серого цвета с геометрическим рисунком. Круглый вырез изделия дополнен воротником-хомут. Платье с отрезное по линии талии и дополнено кулиской на завязках. Изделие с втачными рукавами со спущенной линией проймы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 115-125 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П5-3694', NULL, 3650, NULL, 1700, '2017-10-18 16:53:15', '2017-10-18 16:53:15', NULL, 0, 1, '', '', '', '', '', ''),
(1951, 0, 10, 0, 'plate_sine_biryuzovogo_cveta', 'Платье сине-бирюзового цвета', NULL, 18, 'Чудесное платье полуприлегающего силуэта из трикотажного полотна сине-бирюзового цвета. V-образный вырез изделия обработан внутренней обтачкой и дополнен декоративным кружевным элементом. Платье с втачными рукавами длиной 3/4. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 119-122 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-П4-3670/6-7', NULL, 3850, NULL, 1800, '2017-10-18 17:01:25', '2017-10-18 17:01:25', NULL, 0, 1, '', '', '', '', '', ''),
(1952, 0, 10, 0, 'kardigan_pryamogo_silueta_serogo_cveta', 'Кардиган прямого силуэта серого цвета', NULL, 18, 'Милый кардиган прямого силуэта серого цвета. Кардиган выполнен в технике «ручного вязания» из натуральных нитей с содержанием шерсти. Круглый вырез горловины, манжеты рукавов и низа изделия - обработаны двусторонней лицевой бейкой. Перед изделия дополнен планкой с застежкой на пуговицы и кружевными аппликациями, в виде бантиков с жемчужными бусинами. Низ вывязан узором "косы". Кардиган с втачными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 67-68 см.', 'ВА-Кн-204', NULL, 3050, NULL, 1400, '2017-10-18 18:18:24', '2017-10-18 18:18:24', NULL, 0, 1, '', '', '', '', '', ''),
(1953, 0, 10, 0, 'stilnyj_dzhemper_svobodnogo_silueta', 'Стильный джемпер свободного силуэта', NULL, 18, 'Стильная джемпер свободного силуэта из трикотажного полотна . Круглый вырез и низ изделия обработаны двусторонней вязаной бейкой бордового цвета. Низ цельнокроеных рукавов обработаны широкими вязаными манжетами бордового цвета. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 68 - 71 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-М4-3449/10-13', NULL, 2850, NULL, 1300, '2017-10-18 18:34:02', '2017-10-18 18:38:59', NULL, 0, 1, '', '', '', '', '', ''),
(1954, 0, 10, 0, 'zhaket_chernogo_cveta_v_melkuyu_beluyu_tochku', 'Жакет черного цвета в мелкую белую точку', NULL, 18, 'Модный жакет прилегающего силуэта из плотного трикотажного фактурного полотна черного цвета в мелкую белую точку. V-образный вырез изделия обработан двойным отложным воротничком. Жакет с короткими втачными рукавами. Перед изделия двубортный с застежкой на пуговицы. Талия подчеркнута поясом на завязках.\r\nАксессуары в комплект не входят.\r\nДлина изделия от плечевого шва по спинке до низа изделия — 68-72 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М2-3699', NULL, 3050, NULL, 1400, '2017-10-18 18:49:52', '2017-10-18 18:49:52', NULL, 0, 1, '', '', '', '', '', ''),
(1955, 0, 10, 0, 'dzhemper_iz_vyazanogo_polotna_s_azhurnym_risunkom', 'Джемпер из вязаного полотна с ажурным рисунком', NULL, 18, 'Повседневный джемпер полуприлегающего силуэта из трикотажного полотна. Круглый вырез горловины, планка и низ втачных рукавов обработаны двухсторонней вязаной бейкой. Перед блузы дополнен планкой с застежкой на пуговицы. Низ переда изделия выполнен из вязаного полотна с ажурным рисунком. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —69- 72 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-3696/0-3', NULL, 3050, NULL, 1400, '2017-10-18 19:05:25', '2017-10-18 19:06:07', NULL, 0, 1, '', '', '', '', '', ''),
(1956, 0, 10, 0, 'povsednevnaya_tunika_sinego_cveta', 'Повседневная туника синего цвета', NULL, 20, 'Повседневная туника свободного силуэта из трикотажного полотна синего цвета. Круглый вырез изделия обработан внутренней обтачкой. Туника с втачными рукавами. В боковых швах изделия разрезы. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 79 см', 'ВА-М4-3396/42', NULL, 1950, NULL, 850, '2017-10-18 19:14:52', '2017-10-18 19:16:51', NULL, 0, 1, '', '', '', '', '', ''),
(1957, 0, 10, 0, 'bluza_bezhevo_bordovogo_cveta', 'Блуза бежево-бордового цвета', NULL, 18, 'Женственная блуза полуприлегающего силуэта из трикотажного полотна бежево-бордового цвета. Круглый вырез изделия обработан внутренней обтачкой. Перед блузы дополнен планкой с застежкой на пуговицы. Низ цельнокроеных рукавов и низ переда изделия дополнен ажурным кружевом бордового цвета.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 70-74 см.\r\nСостав: Шерсть 80%, Акрил 20%\r\n', 'ВА-М4-3697', NULL, 3050, NULL, 1400, '2017-10-18 19:23:00', '2017-10-18 19:23:00', NULL, 0, 1, '', '', '', '', '', ''),
(1958, 0, 10, 0, 'dzhemper_iz_trikotazhnogo_polotna_serogo_cveta', 'Джемпер из трикотажного полотна серого цвета', NULL, 18, 'Замечательный джемпер свободного силуэта из трикотажного полотна серого цвета. Круглый вырез горловины обработан в технике ручного вязания «чулочной» гладью. Втачные рукава выполнены в технике ручного вязания с декоративным рисунком «косы». Низ изделия обработан в технике «резинка». \r\nАксессуары в комплект не входят.\r\nДлина изделия от плечевого шва по спинке до низа изделия — 70-73 см\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-М5-3659/2', NULL, 3050, NULL, 1400, '2017-10-18 19:47:09', '2017-10-18 19:47:09', NULL, 0, 1, '', '', '', '', '', ''),
(1959, 0, 10, 0, 'priyatnaya_tunika_svobodnogo_silueta', 'Приятная туника свободного силуэта', NULL, 18, 'Приятная туника свободного силуэта из трикотажного полотна сиреневого цвета. Круглый вырез горловины и низ изделия обработаны окантовкой. Перед изделия дополнен планкой с застежкой на пуговицы. Блуза с втачными рукавами.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 88 -89 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-М4-3594/2-3', NULL, 2350, NULL, 1050, '2017-10-18 20:07:06', '2017-10-18 20:07:06', NULL, 0, 1, '', '', '', '', '', ''),
(1960, 0, 10, 0, 'vyazanyj_kardigan_s_romantichnym_uzorom_raznyh_cvetov', 'Вязаный кардиган с романтичным узором разных цветов', NULL, 18, 'Чудесный кардиган свободного силуэта из вязаного трикотажного полотна с романтичным узором. Круглый вырез, низ втачных рукавов и низ изделия обработаны двусторонней бейкой. По переду кардигана планка с застежкой на пуговицы. \r\nАксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 61-68 см.\r\nДлина рукава 60 см.\r\nШирина рукава 11.5 см.\r\nГлубина проймы 28.7 см.\r\nСостав: 	Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%.', 'ВА-М5-3460/12-23', NULL, 2850, NULL, 1300, '2017-10-18 20:44:49', '2017-10-18 20:44:49', NULL, 0, 1, '', '', '', '', '', ''),
(1961, 0, 10, 0, 'naryadnaya_bluza_s_shirokim_bantom_s_boku', 'Нарядная блуза с широким бантом с боку', NULL, 18, 'Нарядная блуза прямого силуэта из легкого текстильного полотна . Круглый вырез изделия обработан атласной бейкой. Блуза с втачными рукавами. Линия бедра подчеркнута манжетом, переходящим в широкий бант. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа — 65-74  см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3296/3-6', NULL, 2850, NULL, 1300, '2017-10-18 20:49:36', '2017-10-18 20:58:30', NULL, 0, 1, '', '', '', '', '', ''),
(1962, 0, 10, 0, 'privlekatelnaya_bluzka_svobodnogo_silueta', 'Привлекательная блузка свободного силуэта', NULL, 19, 'Привлекательная блузка свободного силуэта из текстильного полотна. Кокетка переда выполнена из кружевного полотна. Линия бедра подчеркнута широким манжетом, переходящим в широкий бант. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 74 см.\r\nСостав Полиэстер 95%, Эластан 5%', 'ВА-М4-3296/1-2', NULL, 3050, NULL, 1400, '2017-10-18 21:05:27', '2017-10-18 21:05:27', NULL, 0, 1, '', '', '', '', '', ''),
(1963, 0, 10, 0, 'svetlo_serye_sergi_kistochki_s_bahromoj', 'Светло-серые серьги кисточки с бахромой', NULL, 9, 'Благодаря серьгам - кисточкам ваша шея станет лебединой!\r\nДлинные сережки - кисточки с бахромой из шелковых нитей к подчеркнут стройность шеи. Светло - серые сережки - кисточки немного колышутся при ходьбе, привлекая взгляды к их владелице.\r\nКрепление и дужка из металла золотого цвета.\r\nДлина 13 см.\r\nСостав: 	Металл, текстиль.', 'ВА-С-333/82', NULL, 730, NULL, 240, '2017-10-18 21:13:29', '2017-10-18 21:13:29', NULL, 0, 1, '', '', '', '', '', ''),
(1964, 0, 10, 0, 'stilnaya_yubka_chernogo_cveta_v_melkuyu_tochku', 'Стильная юбка черного цвета в мелкую точку', NULL, 18, 'Стильная юбка из плотного трикотажного фактурного полотна черного цвета в мелкую белую точку. Юбка с высокой посадкой и застежкой на потайную молнию. По низу изделия шлица. \r\nАксессуары в комплект не входят.\r\nДлина от пояса до низа изделия — 70- 75 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-Ю4-3089/24-25', NULL, 2650, NULL, 1200, '2017-10-18 21:16:01', '2017-10-18 21:17:08', NULL, 0, 1, '', '', '', '', '', ''),
(1965, 0, 10, 0, 'temno_sinie_sergi_kistochki_s_bahromoj', 'Темно-синие серьги кисточки с бахромой', NULL, 9, 'Благодаря серьгам - кисточкам ваша шея станет лебединой!\r\nДлинные сережки - кисточки с бахромой из шелковых нитей к подчеркнут стройность шеи. Темно - синие сережки - кисточки немного колышутся при ходьбе, привлекая взгляды к их владелице.\r\nКрепление и дужка из металла золотого цвета.\r\nДлина 13 см.\r\nСостав: Металл, текстиль.', 'ВА-С-333/83', NULL, 730, NULL, 240, '2017-10-18 21:18:45', '2017-10-18 21:18:45', NULL, 0, 1, '', '', '', '', '', ''),
(1966, 0, 10, 0, 'teplyj_uyutnyj_palantin', 'Теплый уютный палантин', NULL, 9, 'Теплый уютный палантин выполнен в технике "ручного вязяния" из нитей с содержанием мохера. Используют палантин как шарф, головной убор или накидку.\r\nДлина: 128 см. Ширина: 48 см.\r\nСостав: Мохер 60%, Акрил 40%\r\n', 'ВА-Пл-9/37-39', NULL, 1450, NULL, 600, '2017-10-18 21:31:02', '2017-10-18 21:31:02', NULL, 0, 1, '', '', '', '', '', ''),
(1967, 0, 9, 0, 'stilnaya_tunika_pryamogo_kroya', 'Стильная туника прямого кроя', NULL, 17, 'Стильная туника прямого кроя. Незаменимая вещь в гардеробе любой девушки.\r\nСостав: хлопок 70%, полиэстер 27%, эластан 3%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 84 см (52 р.), 85 см (58 р.)\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: декоративный лампас по рукаву', 'ФЛА-2-518', NULL, 3030, NULL, 1390, '2017-10-19 11:40:31', '2017-10-19 11:55:15', NULL, 0, 1, '', '', '', '', '', ''),
(1968, 0, 9, 0, 'modnaya_tunika_pryamogo_silueta_', 'Модная туника прямого силуэта', NULL, 17, 'Модная туника прямого силуэта. Повседневная туника.\r\nСостав: хлопок 70%, полиэстер 27%, эластан 3%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 70 см (52 р.), 71 см (58 р.)\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: декоративные швы', 'ФЛА-2-513', NULL, 3010, NULL, 1380, '2017-10-19 11:52:15', '2017-10-19 11:55:32', NULL, 0, 1, '', '', '', '', '', ''),
(1969, 0, 9, 0, 'zhenstvennaya_bluza_s_kruzhevnymi_rukavami', 'Женственная блуза с кружевными рукавами', NULL, 17, 'Женственная блуза с кружевными рукавами. Данная блуза сделает Ваш образ неотразимым.\r\nСостав: вискоза 70%, полиэстер 25%, эластан 5%\r\n• Длина рукава: 3/4, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 75 см (52 р.), 76 см (58 р.)\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: кружевная отделка', 'ФЛА-2-516', NULL, 2630, NULL, 1190, '2017-10-19 12:03:18', '2017-10-19 12:03:18', NULL, 0, 1, '', '', '', '', '', ''),
(1970, 0, 9, 0, 'tunika_pryamogo_kroya_s_zavyazkami_na_poyase', 'Туника прямого кроя с завязками на поясе', NULL, 17, 'Туника прямого кроя с завязками на поясе.\r\nСостав: хлопок 70%, полиэстер 27%, эластан 3%\r\n• Длина рукава: 3/4, втачной\r\n• Тип горловины: V-образный\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 97 см (52 р.), 99 см (58 р.)\r\n• Карманы: нет\r\n• Застежка: нет', 'ФЛА-2-215', NULL, 3830, NULL, 1790, '2017-10-19 12:33:33', '2017-10-19 12:33:33', NULL, 0, 1, '', '', '', '', '', '');
