(1971, 0, 10, 0, 'molodezhnaya_bluzka_iz_legkoj_tkani', 'Молодежная блузка из легкой ткани', NULL, 10, 'Молодежная блузка из легкой ткани. \r\nСостав: полиэстер 90%, эластан 10%\r\n• Длина рукава: длинный\r\n• Тип горловины: округлая\r\n• Тип проймы: втачной\r\n• Длина изделия: по спинке 64 см (44, 50 р)\r\n• Застежка: нет\r\n• Особенности: двухцветный верх изделия', 'ФЛА-262', NULL, 2630, NULL, 1190, '2017-10-19 13:03:44', '2017-10-19 13:03:44', NULL, 0, 1, '', '', '', '', '', ''),
(1972, 0, 9, 0, 'stilnyj_trench_v_razmere_oversajz', 'Стильный тренч в размере оверсайз', NULL, 12, 'Стильный тренч в размере оверсайз.\r\nСостав: верх -  полиэстер 100%,  подклад - вискоза 60%, полиэстер 40%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: отложной воротник\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 100 см (42-44 р.)\r\n• Силуэт: оверсайз\r\n• Карманы: прорезные\r\n• Застежка: пуговицы, петли\r\n', 'ФЛА-2-307', NULL, 6230, NULL, 2990, '2017-10-19 13:31:37', '2017-10-19 13:31:37', NULL, 0, 1, '', '', '', '', '', ''),
(1973, 0, 9, 0, 'naryadnoe_plate_s_otkrytoj_spinoj', 'Нарядное платье с открытой спиной', NULL, 12, 'Нарядное платье с открытой спиной.\r\nСостав: полиэстер 100%\r\n• Длина рукава: 3/4\r\n• Покрой рукава: втачной \r\n• Стиль: вечерний \r\n• Тип горловины: округлый\r\n• Линия плеча: на естественном месте\r\n• Длина платья/юбки: мини\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: глубокий вырез по спинке', 'ФЛА-178.1', NULL, 5030, NULL, 2390, '2017-10-19 13:47:36', '2017-10-19 13:47:36', NULL, 0, 1, '', '', '', '', '', ''),
(1974, 0, 9, 0, 'vechernee_plate_s_raskleshennoj_yubkoj', 'Вечернее  платье с расклешенной юбкой', NULL, 10, 'Вечернее  платье с расклешенной юбкой.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Стиль: вечерний \r\n• Тип горловины: округлый\r\n• Линия плеча: на естественном месте\r\n• Длина платья/юбки: миди\r\n• Карманы: в боковых швах\r\n• Застежка: молния\r\n• Особенности: платье с расклешенной юбкой с защипами по талии', 'ФЛА-154.1', NULL, 4510, NULL, 2130, '2017-10-19 13:58:13', '2017-10-19 13:58:13', NULL, 0, 1, '', '', '', '', '', ''),
(1975, 0, 9, 0, 'vechernee_plate_iz_iskusstvennoj_zamshi', 'Вечернее платье из искусственной замши', NULL, 12, 'Вечернее платье из искусственной замши. Прекрасно дополнит Ваш гардероб.\r\nСостав: полиэстер 100%\r\n• Стиль: вечерний \r\n• Тип горловины: округлый\r\n• Линия плеча: на естественном месте\r\n• Длина платья/юбки: миди\r\n• Карманы: нет\r\n• Застежка: молния\r\n• Особенности: фигурные вытачки', 'ФЛА-132.1', NULL, 3430, NULL, 1590, '2017-10-19 14:11:06', '2017-10-19 14:11:06', NULL, 0, 1, '', '', '', '', '', ''),
(1976, 0, 9, 0, 'stilnoe_plate_midi_iz_barhata', 'Стильное платье миди  из бархата', NULL, 12, 'Стильное платье миди  из бархата.\r\nТкань: бархат принт\r\nСостав: полиэстер 100%\r\nЦвет: принт на темно-зеленом\r\n• Длина рукава: 3/4\r\n• Покрой рукава: втачной\r\n• Стиль: вечерний \r\n• Тип горловины: V-образный\r\n• Линия плеча: на естественном месте\r\n• Карманы: нет\r\n• Застежка: молния\r\n• Особенности: декоративный воротник-стойка', 'ФЛА-140-01', NULL, 3430, NULL, 1590, '2017-10-19 14:18:56', '2017-11-16 12:01:22', NULL, 0, 1, '', '', '', '', '', ''),
(1977, 0, 9, 0, 'modnoe_plate_raskleshennoe_knizu', 'Модное платье расклешенное книзу', NULL, 12, 'Модное платье расклешенное книзу.\r\nСостав: полиэстер 67%, вискоза 30%, эластан 3%\r\nЦвет: темно-синий\r\n• Длина рукава: 3/4, втачной\r\n• Тип горловины: округлый\r\n• Длина изделия: 92 см (44 р), 98 см (50 р)\r\n• Застежка: на  молнию в среднем шве', 'ФЛА-793.1', NULL, 3030, NULL, 1390, '2017-10-19 14:37:07', '2017-10-19 14:37:07', NULL, 0, 1, '', '', '', '', '', ''),
