(1981, 0, 9, 0, 'trikotazhnaya_tunika_s_zavyazkoj_na_uzel', 'Трикотажная туника с завязкой на узел', NULL, 12, 'Трикотажная туника с завязкой на узел.\r\nСостав: хлопок 98%, эластан 2%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: округлый\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 76 см (44 р.), 78 см (48 р.)\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: завязки на узел', 'ФЛА-528', NULL, 3170, NULL, 1460, '2017-10-19 15:29:03', '2017-10-19 15:29:03', NULL, 0, 1, '', '', '', '', '', ''),
(1982, 0, 9, 0, 'svobodnaya_tunika_iz_trikotazhnogo_zhakkarda', 'Свободная туника из трикотажного жаккарда', NULL, 12, 'Свободная туника из трикотажного жаккарда\r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: длинный, втачной\r\n• Тип горловины: воротник-стойка\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 80 см (44, 48 р.)\r\n• Карманы: нет\r\n• Застежка: нет', 'ФЛА-516', NULL, 2990, NULL, 1370, '2017-10-19 15:38:42', '2017-10-19 15:38:42', NULL, 0, 1, '', '', '', '', '', ''),
(1983, 0, 9, 0, 'udlinennaya_tunika_svobodnogo_silueta', 'Удлиненная туника свободного силуэта', NULL, 12, 'Удлиненная туника свободного силуэта. Вырез горловины оформлен планкой переходящей в воротник стойку. Удлиненный рукав выполнен на манжете и застегивается на пуговицу. Низ изделия имеет красивую фигурную линию. Длина изделия по спинке 82 см (44 р,50 р). Длина изделия по переду 75 см (44 р.,50 р). Состав: полиэстер 100%', 'ФЛА-224.1', NULL, 2550, NULL, 1150, '2017-10-19 15:47:06', '2017-10-19 15:47:06', NULL, 0, 1, '', '', '', '', '', ''),
(1984, 0, 9, 0, 'zhenstvennaya_plissirovannaya_barhatnaya_yubka', 'Женственная  плиссированная бархатная юбка', NULL, 12, 'Женственная  плиссированная бархатная юбка.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Стиль: вечерний \r\n• Пояс: притачной\r\n• Посадка: средняя\r\n• Длина платья/юбки: миди\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: плиссированная бархатная юбка\r\n', 'ФЛА-429', NULL, 3010, NULL, 1380, '2017-10-20 10:07:20', '2017-10-20 10:07:20', NULL, 0, 1, '', '', '', '', '', ''),
(1985, 0, 9, 0, 'stilnaya_yubka_s_poyasom_na_rezinke', 'Стильная юбка с поясом на резинке', NULL, 12, 'Стильная юбка с поясом на резинке.\r\nСостав: полиэстер 100%\r\n• Пояс: пояс-резинка\r\n• Посадка: средняя\r\n• Длина платья/юбки: миди\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: юбка с металлизированнованным поясом-резинкой', 'ФЛА-430', NULL, 2230, NULL, 990, '2017-10-20 10:19:53', '2017-10-20 11:01:09', NULL, 0, 1, '', '', '', '', '', ''),
(1986, 0, 9, 0, 'stilnaya_yubka_karandash_s_zavyshennoj_taliej', 'Стильная юбка карандаш с завышенной талией', NULL, 12, 'Стильная юбка карандаш с завышенной талией.\r\nСостав: полиэстер 100%\r\n• Пояс: притачной\r\n• Посадка: высокая (на линии талии)\r\n• Длина платья/юбки: миди\r\n• Застежка: молния\r\n• Особенности: фигурные вытачки, разрез', 'ФЛА-423.1', NULL, 3030, NULL, 1390, '2017-10-20 10:33:40', '2017-10-20 10:33:40', NULL, 0, 1, '', '', '', '', '', ''),
(1987, 0, 9, 0, 'elegantnaya_yubka_s_razrezom_speredi_', 'Элегантная юбка с разрезом спереди', NULL, 12, 'Элегантная юбка с разрезом спереди.\r\nСостав: полиэстер 67%, вискоза 30%, эластан 3%\r\n• Тип верха: фигурный, обработан обтачкой\r\n• Длина изделия: по спинке 65 см (44, 48 р)\r\n• Застежка: молния\r\n• Особенности: разрез по переду', 'ФЛА-420.1', NULL, 2230, NULL, 990, '2017-10-20 10:57:48', '2017-10-20 11:00:45', NULL, 0, 1, '', '', '', '', '', ''),
(1988, 0, 9, 0, 'stilnyj_zhilet_s_neobychnym_dizajnom', 'Стильный жилет с необычным дизайном', NULL, 12, 'Стильный жилет с необычным дизайном.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: без рукавов\r\n• Тип горловины: V-образная\r\n• Пройма плеча: на естественном месте\r\n• Длина изделия: по спинке около 93 см (44, 48 р.)\r\n• Карманы: прорезные\r\n• Застежка: нет', 'ФЛА-325', NULL, 3930, NULL, 1840, '2017-10-20 11:17:57', '2017-10-20 11:17:57', NULL, 0, 1, '', '', '', '', '', ''),
(1989, 0, 9, 0, 'zhenskie_bryuki_iz_kostyumnoj_tkani', 'Женские брюки  из костюмной ткани', NULL, 12, 'Классические женские брюки  из костюмной ткани.\r\nСостав: полиэстер 67%, вискоза 30%, эластан 3%\r\n• Тип верха: притачной пояс\r\n• Длина изделия: по внешнему шву 97 см (44, 48 р.)\r\n• Застежка: потайная молния\r\n• Особенности: карманы, декоративный кант', 'ФЛА-462.1', NULL, 3830, NULL, 1790, '2017-10-20 11:29:43', '2017-10-20 11:29:43', NULL, 0, 1, '', '', '', '', '', ''),
(1990, 0, 9, 0, 'udlinennyj_zhilet_pryamogo_silueta', 'Удлиненный жилет прямого силуэта', NULL, 7, 'Удлиненный жилет прямого силуэта с разрезами и углубленной проймой выполнен фактурной вязкой из смесовой пряжи. Горловина изделия оформлена двойным  воротником "стойка". Длина изделия по спинке около 89 см (44, 48 р.)\r\nСостав: акрил 50%, шерсть 25%, хлопок 25%', 'ФЛА-9214', NULL, 3030, NULL, 1390, '2017-10-20 11:58:56', '2017-10-20 11:58:56', NULL, 0, 1, '', '', '', '', '', ''),
(1991, 0, 9, 0, 'kardigan_svobodnogo_silueta_bez_zastezhki', 'Кардиган свободного силуэта без застежки', NULL, 12, 'Вязаный легкий кардиган свободного силуэта без застежки. Полочки кардигана оформлены широкой бейкой. Рукава длинные, прямые. Особенностью изделия служат глубокие разрезы в боковых швах, регулирующиеся завязками. Длина изделия по спинке около 107 см (44р), около 110 (48р).\r\nСостав: акрил 50%, шерсть 25%, хлопок 25%', 'ФЛА-9204', NULL, 3810, NULL, 1780, '2017-10-20 12:09:20', '2017-10-20 12:09:20', NULL, 0, 1, '', '', '', '', '', ''),
(1992, 0, 9, 0, 'vyazanyj_dvuhcvetnyj_kardigan', 'Вязаный двухцветный кардиган', NULL, 12, 'Вязаный двухцветный кардиган свободного силуэта без застежки в стиле "колор блок". Рукава длинные, со спущенной проймой. Полочки кардигана оформлены широкой бейкой. В боковых швах изделия выполнены карманы. Рукава и низ изделия оформлены резинкой в рубчик. Длина изделия по спинке около 102 см (44, 48 р).\r\nСостав: шерсть 50%, акрил 50%', 'ФЛА-9210', NULL, 3830, NULL, 1790, '2017-10-20 12:26:05', '2017-10-20 12:26:05', NULL, 0, 1, '', '', '', '', '', ''),
(1993, 0, 9, 0, 'kardigan_svobodnogo_silueta_s_karmanami', 'Кардиган свободного силуэта с карманами', NULL, 12, 'Кардиган-бойфренд свободного силуэта. Рукав со спущенной проймой, по низу оформлен резинкой в рубчик. Полочки кардигана оформлены широкой бейкой. По переду изделия выполнены большие накладные карманы. Длина изделия по спинке около 72 см (44, 48 р).\r\nСостав: шерсть 50%, акрил 50%', 'ФЛА-9211', NULL, 3310, NULL, 1530, '2017-10-20 12:32:02', '2017-10-20 12:32:02', NULL, 0, 1, '', '', '', '', '', ''),
(1994, 0, 9, 0, 'dzhemper_poluprilegayushego_silueta_s_rukavami_3_4', 'Джемпер полуприлегающего силуэта  с рукавами 3/4', NULL, 12, 'Джемпер полуприлегающего силуэта выполнен фактурной вязкой из смесовой пряжи с добавлением шерсти. Вырез горловины овальный, рукава длиной ¾. Горловина, рукава и низ изделия  оформлены узкой отделкой «закрутка». Длина изделия по спинке около 63 см (44, 48 р).\r\nСостав: акрил 70%, шерсть 30%', 'ФЛА-9208', NULL, 2550, NULL, 1150, '2017-10-20 12:38:42', '2017-10-20 12:38:42', NULL, 0, 1, '', '', '', '', '', ''),
(1995, 0, 9, 0, 'povsednevnyj_vyazanyj_kardigan_', 'Повседневный вязаный кардиган', NULL, 12, 'Кардиган связан фактурным способом, по переду выполнена планка. Изделие украшают большие накладные карманы. Длина изделия по спинке около 80 см (44, 50 р).\r\nСостав: акрил 70%, шерсть 30%', 'ФЛА-9186', NULL, 3630, NULL, 1690, '2017-10-20 12:53:37', '2017-10-20 12:53:37', NULL, 0, 1, '', '', '', '', '', ''),
(1996, 0, 9, 0, 'vyazanyj_kardigan_bez_zastezhki', 'Вязаный кардиган  без застежки', NULL, 12, 'Легкий, струящийся, вязаный кардиган свободного силуэта без застежки. Рукав 7/8, линия плеча спущена. По бокам выполнены накладные карманы. Длина изделия по спинке около 79 см (44, 50 р).\r\nСостав: шерсть 50%, акрил 50%', 'ФЛА-9188', NULL, 3090, NULL, 1420, '2017-10-20 12:59:43', '2017-10-20 12:59:43', NULL, 0, 1, '', '', '', '', '', ''),
(1997, 0, 9, 0, 'ob_emnyj_dzhemper_svobodnogo_silueta', 'Объемный джемпер свободного силуэта', NULL, 12, 'Объемный, удлиненный джемпер свободного, мягкого силуэта в стиле «оверсайз», выполнен фактурной вязкой из смесовой пряжи. Вырез горловины овальный, оформлен двойной резинкой в рубчик. Рукав со спущенной проймой,  по низу оформлен широкой, цельновязанной, отлажной  манжетой. Внимание! Данная модель изготовлена в стиле «оверсайз». Вещь «оверсайз»  всегда больше обычной одежды на 2 размера. Длина изделия по спинке около 68 см (44, 48 р).\r\nСостав: акрил 70%, шерсть 30%', 'ФЛА-9207', NULL, 3290, NULL, 1520, '2017-10-20 13:05:23', '2017-10-20 13:05:23', NULL, 0, 1, '', '', '', '', '', ''),
(1998, 0, 9, 0, 'myagkij_dzhemper_svobodnoj_formy', 'Мягкий джемпер свободной формы', NULL, 10, 'Мягкий вязаный  меланжированный джемпер свободной формы. Яркий  цвет и приятная фактура напомнит любимую кофточку связанную вручную. Длина рукава 3/4. По переду изделия выполнены фигурные разрезы. Длина изделия по спинке около 60 см (44 р.), около 62 см (50 р.).\r\nСостав:  вискоза 40%, шерсть 40%, акрил 20%', 'ФЛА-9131.1', NULL, 2230, NULL, 990, '2017-10-20 13:10:20', '2017-10-20 13:10:20', NULL, 0, 1, '', '', '', '', '', ''),
(1999, 0, 9, 0, 'dzhemper_s_zavyazkami_na_rukavah_', 'Джемпер с завязками на рукавах', NULL, 12, 'Джемпер с завязками на рукавах свободного силуэта выполнен фактурной вязкой из смесовой пряжи. Вырез горловины овальный. Особенностью модели служат расклешенные книзу рукава, имеющие слегка увеличенную длину. Длина изделия по спинке около 69 см (44, 48 р).\r\nСостав: шерсть 50%, акрил 50%', 'ФЛА-9199', NULL, 3030, NULL, 1390, '2017-10-20 13:14:59', '2017-10-20 13:14:59', NULL, 0, 1, '', '', '', '', '', ''),
(2000, 0, 9, 0, 'vyazanyj_kardigan_svobodnogo_silueta_s_karmanami', 'Вязаный кардиган свободного силуэта с карманами', NULL, 12, 'Вязаный кардиган свободного силуэта без застежки. Выполнен фактурной вязкой. Рукава длинные, со спущенной проймой. Полочки кардигана оформлены широкой бейкой. По переду изделия выполнены карманы с фигурной линией входа. Рукава, вход в карман и низ изделия оформлены резинкой в рубчик. Длина изделия по спинке около 76 см (44, 48 р).\r\nСостав: акрил 70%, шерсть 30%', 'ФЛА-9213', NULL, 3010, NULL, 1380, '2017-10-20 13:20:29', '2017-10-24 21:49:03', NULL, 0, 1, '', '', '', '', '', ''),
(2001, 0, 9, 0, 'kardigan_bojfrend_svobodnogo_silueta', 'Кардиган-бойфренд свободного силуэта', NULL, 12, 'Кардиган-бойфренд свободного силуэта имеет глубокий V-образный вырез горловины, фиксирующийся двумя пуговицами. Рукава и низ изделия оформлены узкой резинкой в рубчик. Внимание! Данная модель изготовлена в стиле «оверсайз». Вещь «оверсайз»  всегда больше обычной одежды на 2 размера.  Длина изделия по спинке около 64 см (44 р), 66 см (48 р).', 'ФЛА-9200', NULL, 2950, NULL, 1350, '2017-10-20 13:29:45', '2017-10-20 13:29:45', NULL, 0, 1, '', '', '', '', '', ''),
(2002, 0, 9, 0, 'zhenskaya_rubashka_svobodnogo_silueta', 'Женская рубашка свободного силуэта', NULL, 17, 'Женская рубашка свободного силуэта.\r\nСостав: полиэстер 100%\r\n• Длина рукава: 3/4, «летучая мышь»\r\n• Тип горловины: отложной воротник\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке около 86 см (52 р.), 87 см (58 р.)\r\n• Застежка: пуговицы, петли', 'ФЛА-2-211.1', NULL, 3030, NULL, 1390, '2017-10-23 12:25:10', '2017-10-23 12:27:04', NULL, 0, 1, '', '', '', '', '', ''),
