(2011, 0, 10, 0, 'snud_iz_barhata_zhemchuzhno_serogo_cveta', 'Снуд из бархата жемчужно - серого цвета', NULL, 9, 'Переливающийся бархат жемчужно - серого цвета выглядит благородно и женственно.  Двусторонний снуд подбит нежным шифоном с ажурным принтом в голубых и желтых тонах. Изделие отлично дополнит Ваш образ с классическим пальто или шубкой. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. Длина 68 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.', 'ВА-Сн-2/66', NULL, 1290, NULL, 520, '2017-10-24 11:09:13', '2017-10-24 11:09:13', NULL, 0, 1, '', '', '', '', '', ''),
