(2013, 0, 9, 0, 'stilnyj_zhaket_iz_zhakkardovogo_trikotazha', 'Стильный жакет из жаккардового трикотажа', NULL, 12, 'Состав: хлопок 70%, полиэстер 27%, эластан 3%\r\nСтильный жакет прямого силуэта без подклада из качественного жаккардового трикотажа. Двубортная застежка на две кнопки. Линия борта и горловины обработаны обтачкой. Оформлен большими накладными карманами. Рукав втачной, удлиненный со спущенной проймой. Длина изделия по спинке около 90 см (44 р), 92 см (50 р). ', 'ФЛА-321-01', NULL, 5810, NULL, 2780, '2017-10-24 18:33:21', '2017-10-24 18:33:21', NULL, 0, 1, '', '', '', '', '', ''),
