(2032, 0, 9, 0, 'stilnaya_bluza_iz_trikotazha_s_napyleniem', 'Стильная блуза из трикотажа с напылением', NULL, 12, 'Стильная блуза из трикотажа с напылением.\r\nСостав: полиэстер 67%, вискоза 30%, эластан 3%\r\n• Длина рукава: длинный/втачной\r\n• Тип горловины: V-образный\r\n• Линия плеча: спущенная\r\n• Длина изделия: 57см\r\n• Застежка: нет\r\n• Карманы: нет \r\n• Особенности: декоративная стойка', 'ФЛА-532', NULL, 2830, NULL, 1290, '2017-10-30 12:25:09', '2017-10-30 12:27:42', NULL, 0, 1, '', '', '', '', '', ''),
(2033, 0, 10, 0, 'brosh_bulavka_v_vide_cvetka', 'Брошь - булавка в виде цветка', NULL, 9, 'Текстильный пион украшает брошь - булавку темного серо - синего цвета. Жемчужная бусинка придает выразительности. Металл серебряного цвета. \r\nДиаметр цветка 4,5 см. Длина броши 9 см.', 'ВА-Бр-150/4', NULL, 570, NULL, 160, '2017-10-30 12:53:18', '2017-10-30 12:53:18', NULL, 0, 1, '', '', '', '', '', ''),
(2034, 0, 10, 0, 'brosh_v_vide_dereva_s_kamnem_golubogo_cveta', 'Брошь в виде дерева с камнем голубого цвета', NULL, 9, 'Брошь в виде дерева выполнена из металла цвета под старинное серебро.\r\nУкрашена крупным камнем серо - голубого цвета.\r\nРазмер 6,5 см х 4 см.', 'ВА-Бр-131/33', NULL, 770, NULL, 260, '2017-10-30 12:58:59', '2017-10-30 12:58:59', NULL, 0, 1, '', '', '', '', '', ''),
(2035, 0, 8, 0, 'povsednevnoe_plate_odnotonnogo_cveta_', 'Повседневное платье однотонного цвета', NULL, 10, 'Повседневное платье однотонного цвета. Длинные платья на каждый день. Прекрасное платье разбавит Ваш гардероб.', 'СПЛ-16', NULL, 3250, NULL, 1500, '2017-10-30 13:20:32', '2017-10-30 13:32:55', NULL, 0, 1, '', '', '', '', '', ''),
(2036, 0, 8, 0, 'stilnaya_dzhinsovka_s_yarkim_mehom', 'Стильная джинсовка с ярким мехом', NULL, 12, 'Стильная джинсовка с ярким мехом. Джинсовка с мехом - тренд нового зимнего сезона.Оригинальная модель декорирована натуральным мехом. Будь модной вместе с нами.', 'СКУ-23', NULL, 6050, NULL, 2900, '2017-10-30 13:28:31', '2017-10-30 13:28:31', NULL, 0, 1, '', '', '', '', '', ''),
(2037, 0, 9, 0, 'zhenstvennoe_dlinnoe_plate_s_poyasom', 'Женственное длинное платье с поясом', NULL, 16, 'Женственное длинное платье с поясом. Данное платье сделает Вас неотразимой. Будь модной вместе с нами.\r\nСостав: полиэстер 97%, эластан 3%', 'ФЛА-2-119', NULL, 6230, NULL, 2990, '2017-11-01 15:31:55', '2017-11-13 11:53:52', NULL, 0, 1, '', '', '', '', '', ''),
(2038, 0, 9, 0, 'vyazanoe_plate_midi_pryamogo_silueta', 'Вязаное платье - миди прямого силуэта', NULL, 12, 'Вязаное платье - миди,  прямого силуэта с большими накладными карманами,  воротником "стойка" с отворотом. Рукава втачные, имеющие слегка увеличенную длину. Длина изделия по спинке около 117 см (44, 48 р.)\r\nСостав: акрил 50%, шерсть 25%, хлопок 25%', 'ФЛА-9215', NULL, 3830, NULL, 1790, '2017-11-01 15:53:30', '2017-11-20 11:41:17', NULL, 0, 1, '', '', '', '', '', ''),
(2039, 0, 10, 0, 'miloe_plate_svobodnogo_silueta_', 'Милое платье свободного силуэта', NULL, 18, 'Милое платье свободного силуэта из трикотажного полотна синего цвета. Круглый  вырез изделия обработан внутренней обтачкой. Кокетка платья дополнена декоративным элементом «стразы». Низ цельнокроеных рукавов и низ изделия дополнены широкими воланами из роскошного кружева. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 101-108 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3703/0-1', NULL, 3850, NULL, 1800, '2017-11-01 16:29:13', '2017-11-01 16:31:47', NULL, 0, 1, '', '', '', '', '', ''),
(2040, 0, 10, 0, 'koketlivoe_plate_svobodnogo_silueta', 'Кокетливое платье свободного силуэта', NULL, 18, 'Кокетливое платье свободного силуэта из трикотажного полотна. Круглый вырез изделия обработан косой бейкой. Низ втачных рукавов и низ платья дополнены воланом из сетки в мелкий горошек. Платье двойное: верхняя часть выполнена из вышитого кружевного полотна и посажена на однотонный трикотажный подклад. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 101-105 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3703/2-5', NULL, 5650, NULL, 2700, '2017-11-01 16:40:54', '2017-11-01 16:40:54', NULL, 0, 1, '', '', '', '', '', '');
INSERT INTO `model` (`id`, `menu_id`, `brand_id`, `category_id`, `slug`, `name`, `badge_id`, `sizerange`, `description`, `vendorcode`, `сalculated_price`, `final_price`, `fixed_price`, `purchase_price`, `added`, `lastmodifed`, `sort`, `viewed`, `active`, `delivery_details`, `payment_details`, `model_type`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(2041, 0, 10, 0, 'plate_cherno_zolotogo_cveta', 'Платье черно-золотого цвета', NULL, 18, 'Восхитительное платье свободного силуэта из трикотажного полотна черно-золотого цвета. Круглый вырез изделия обработан косой бейкой. Низ втачных рукавов и низ платья дополнены воланом из сетки. Платье двойное: верхняя часть выполнена из золотого кружевного полотна, нижнее платье выполнено из однотонного трикотажного полотна черного цвета. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 89 - 105 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3703/6-7', NULL, 4250, NULL, 2000, '2017-11-01 16:55:04', '2017-11-01 16:55:04', NULL, 0, 1, '', '', '', '', '', ''),
(2042, 0, 10, 0, 'romantichnoe_plate_poluprilegayushego_silueta_', 'Романтичное платье полуприлегающего силуэта', NULL, 18, 'Романтичное платье полуприлегающего силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан внутренней обтачкой. Платье с цельнокроеными рукавами. Изделие отрезное по линии талии. Линия талии завышена. Перед платья двойной, верхний слой выполнен из сетки с роскошной вышивкой. В боковых швах платья втачные карманы.Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 105-107 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3672/0-1', NULL, 4250, NULL, 2000, '2017-11-01 17:06:24', '2017-11-15 12:30:49', NULL, 0, 1, '', '', '', '', '', ''),
(2043, 0, 10, 0, 'zhenstvennoe_plate_iz_plissirovannogo_kruzheva', 'Женственное платье из плиссированного кружева', NULL, 20, 'Женственное платье полуприлегающего силуэта из трикотажного полотна серого цвета. Круглый вырез изделия обработан внутренней обтачкой. Платье с цельнокроеными рукавами. Изделие отрезное по линии талии. Линия талии завышена. Низ платья двойной, верхний слой выполнен из роскошного плиссированного кружева. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 116 см.\r\nСостав: Шерсть 16%, Акрил 48%, Вискоза 31%, Эластан 5%', 'ВА-П4-3672/3', NULL, 4050, NULL, 1900, '2017-11-01 17:19:31', '2017-11-01 17:19:31', NULL, 0, 1, '', '', '', '', '', ''),
(2044, 0, 10, 0, 'ocharovatelnoe_plate_s_cvetochnoj_vyshivkoj', 'Очаровательное платье с цветочной вышивкой', NULL, 18, 'Очаровательное платье полуприлегающего силуэта из трикотажного полотна черного цвета. Фигурный вырез изделия обработан внутренней обтачкой. Втачные рукава-крылышки выполнены из тонкой вышитой сетки. Изделие отрезное по линии талии. Низ платья двойной, верхний слой выполнен из роскошного кружева с цветочной вышивкой. Спинка изделия дополнена застежкой на потайную молнию. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 141-145 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П5-3705/10-13', NULL, 5650, NULL, 2700, '2017-11-01 17:37:00', '2017-11-01 17:37:00', NULL, 0, 1, '', '', '', '', '', ''),
(2045, 0, 10, 0, 'zhenstvennoe_plate_s_shirokimi_rukavami', 'Женственное платье с широкими рукавами', NULL, 18, 'Женственное платье полуприлегающего силуэта из трикотажного полотна . Фигурный вырез изделия обработан внутренней обтачкой. Широкие втачные рукава выполнены из вышитой сетки и по низу дополнены эластичными манжетами. Изделие отрезное по линии талии. Низ платья двойной, верхний слой выполнен из роскошной вышивки на сетке. Спинка изделия дополнена застежкой на потайную молнию.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 123 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П5-3705/0-3', NULL, 6250, NULL, 3000, '2017-11-01 17:53:58', '2017-11-01 17:59:45', NULL, 0, 1, '', '', '', '', '', ''),
(2046, 0, 10, 0, 'naryadnoe_plate_s_shirokimi_rukavami', 'Нарядное платье с широкими рукавами', NULL, 18, 'Нарядное платье полуприлегающего силуэта из трикотажного полотна черного цвета. Фигурный вырез изделия обработан внутренней обтачкой. Широкие втачные рукава выполнены из тонкой сетки и по низу дополнены эластичными манжетами. Изделие отрезное по линии талии. Низ платья двойной, верхний слой выполнен из роскошного кружева с вышивкой. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 123 см', 'ВА-П5-3705/4-9', NULL, 6250, NULL, 3000, '2017-11-01 18:05:47', '2017-11-01 18:05:47', NULL, 0, 1, '', '', '', '', '', ''),
(2047, 0, 10, 0, 'plate_dvojka_pryamogo_silueta', 'Платье-двойка прямого силуэта', NULL, 18, 'Великолепное платье-двойка прямого силуэта из кружевного полотна синего цвета. Круглый вырез изделия обработан косой бейкой. Платье двойное: верхняя часть выполнена из легкой сетки с вышивкой по низу. Нижнее однотонное платье выполнено из трикотажного полотна синего цвета. Низ платья и втачных рукавов дополнен кружевом. Спинка изделия по низу дополнена разрезом.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —132- 134 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П3-3708/0-1', NULL, 5650, NULL, 2700, '2017-11-01 18:15:14', '2017-11-01 18:15:31', NULL, 0, 1, '', '', '', '', '', ''),
(2048, 0, 10, 0, 'naryadnoe_plate_s_cvetkom_iz_pajetok', 'Нарядное платье с  цветком из пайеток', NULL, 18, 'Роскошное платье полуприлегающего силуэта из трикотажного полотна с рельефным рисунком. Круглый вырез обработан внутренней обтачкой. Втачные рукава и низ изделия обработаны кружевом. Кокетка изделия дополнена декоративным элементом в виде цветка из пайеток. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 97-104 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П3-3478/0-3', NULL, 4050, NULL, 1900, '2017-11-01 18:28:15', '2017-11-01 18:28:15', NULL, 0, 1, '', '', '', '', '', ''),
(2049, 0, 10, 0, 'naryadnoe_plate_s_serebryanymi_pajetkami', 'Нарядное платье с серебряными пайетками', NULL, 18, 'Нарядное платье прямого силуэта из текстильного полотна черного цвета. Круглый вырез изделия обработан косой бейкой. Перед платья двойной: верхняя часть выполнена из легкого шифона расшитого серебряными пайетками. Снизу однотонный подклад из трикотажного полотна черного цвета. Проймы изделия дополнены широкими воланами в несколько ярусов.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 107-110 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П3-3707/0-1', NULL, 4250, NULL, 2000, '2017-11-01 18:39:08', '2017-11-01 18:39:08', NULL, 0, 1, '', '', '', '', '', ''),
(2050, 0, 10, 0, 'effektnoe_maksi_plate_poluprilegayushego_silueta', 'Эффектное макси-платье полуприлегающего силуэта', NULL, 18, 'Эффектное макси-платье полуприлегающего силуэта из трикотажного полотна. Благородное серебро встречается с насыщенным черным и образует яркую деталь в виде зигзага. Круглый вырез изделия обработан внутренней обтачкой и декорирован текстильными розами. Удобное, но, без сомнения, эффектное платье, не оставит вас без внимания.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 135 -144 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П2-3491/0-1', NULL, 3650, NULL, 1700, '2017-11-01 18:47:32', '2017-11-01 18:47:32', NULL, 0, 1, '', '', '', '', '', ''),
(2051, 0, 10, 0, 'stilnoe_plate_poluprilegayushego_silueta', 'Стильное платье полуприлегающего силуэта', NULL, 18, 'Стильное платье полуприлегающего силуэта из текстильного полотна. Круглый  вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами. Изделие отрезное по линии талии. Линия талии подчеркнута декоративным элементом. Низ платья выполнен из гофрированного полотна. В боковом шве изделия застежка на потайную молнию.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 117-119 см\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-П4-3702/0-7', NULL, 4250, NULL, 2000, '2017-11-01 20:03:57', '2017-11-01 20:05:55', NULL, 0, 1, '', '', '', '', '', ''),
(2052, 0, 10, 0, 'sovremennoe_ofisnoe_plate_pryamogo_silueta', 'Современное офисное платье прямого силуэта', NULL, 18, 'Современное офисное платье прямого силуэта из текстильного полотна в фантазийную клетку бордово-синего цвета. Горловина изделия обработана внутренней обтачкой. Платье с со спущенной линией проймы. Втачные рукава и низ изделия по переду выполнены из текстильного полотна с цветочным принтом. Перед изделия дополнен металлическим элементом. В боковых швах изделия - карманы.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —90- 95 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-П4-3522/0-1', NULL, 3130, NULL, 1440, '2017-11-02 11:43:19', '2017-11-02 11:52:02', NULL, 0, 1, '', '', '', '', '', ''),
(2053, 0, 10, 0, 'plate_cherno_serogo_cveta_s_rukavami_3_4', 'Платье черно-серого цвета с рукавами 3/4', NULL, 18, 'Очаровательное платье полуприлегающего силуэта из трикотажного полотна черно-серого цвета. Перед изделия двухслойный. Нижний слой выполнен из приятной телу вискозы светло-серого цвета. Верхний слой из перфорированного трикотажного полотна имитирующего кожу. Горловина изделия обработана атласной бейкой. Платье с цельнокроеными рукавами. Спинка изделия выполнена из однотонного трикотажного полотна.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 96 -107 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3522/2-3', NULL, 4450, NULL, 2100, '2017-11-02 11:48:43', '2017-11-02 11:48:43', NULL, 0, 1, '', '', '', '', '', ''),
(2054, 0, 10, 0, 'roskoshnoe_plate_sine_krasnogo_cveta', 'Роскошное платье сине-красного цвета', NULL, 18, 'Роскошное платье длины макси полуприлегающего силуэта из трикотажного полотна сине-красного цвета. Круглый  вырез изделия обработан внутренней обтачкой. Кокетка изделия и втачные рукава выполнены из фактурного ажурного полотна красного цвета. Перед изделия дополнен декоративным «перекрутом», который создает мягкие вертикальные складки. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке  от плечевого шва до низа изделия — 149 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-2956/2-3', NULL, 4250, NULL, 2000, '2017-11-02 11:56:54', '2017-11-02 11:56:54', NULL, 0, 1, '', '', '', '', '', ''),
(2055, 0, 10, 0, 'plate_iz_barhata_bordovogo_cveta', 'Платье из бархата бордового цвета', NULL, 18, 'Очаровательное платье полуприлегающего силуэта из трикотажного бархата бордового цвета. Фигурный вырез изделия обработан внутренней обтачкой. Втачные рукава дополнены декоративными встречными складками по низу и обработаны манжетами. Перед изделия дополнен декоративным жемчужным элементом. Платье отрезное по линии талии. Линия талии эффектно подчеркнута складками. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 105 -107 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3636', NULL, 4250, NULL, 2000, '2017-11-02 12:21:34', '2017-11-02 12:21:34', NULL, 0, 1, '', '', '', '', '', ''),
(2056, 0, 10, 0, 'plate_iz_barhata_sero_rozovogo_cveta', 'Платье из бархата серо-розового цвета', NULL, 20, 'Роскошное платье полуприлегающего силуэта из трикотажного бархата серо-розового цвета. Круглый вырез изделия обработан внутренней обтачкой. Втачные рукава и перед изделия украшены кружевом розового цвета. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия -  94 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3667/1', NULL, 4250, NULL, 2000, '2017-11-02 12:28:51', '2017-11-02 12:28:51', NULL, 0, 1, '', '', '', '', '', ''),
(2057, 0, 10, 0, 'stilnoe_plate_iz_trikotazhnogo_barhata_', 'Стильное платье из трикотажного бархата', NULL, 18, 'Стильное платье полуприлегающего силуэта из трикотажного бархата. Круглый вырез изделия обработан внутренней обтачкой. Втачные рукава и низ изделия дополнены двойной оборкой из бархата и кружева.  Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 92- 98 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3667/2-5', NULL, 4050, NULL, 1900, '2017-11-02 12:36:13', '2017-11-02 12:36:13', NULL, 0, 1, '', '', '', '', '', ''),
(2058, 0, 10, 0, 'platya_iz_barhata_chernogo_cveta', 'Платья из бархата черного цвета', NULL, 18, 'Изумительное платье А-силуэта  из трикотажного бархата черного цвета. Круглый вырез изделия обработан бейкой. Втачные рукава и кокетка переда выполнены из трикотажной сетки с бархатным рисунком. Перед изделия украшен жемчужным декоративным элементом. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 98-105 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П5-3665/0-1', NULL, 4450, NULL, 2100, '2017-11-02 12:45:05', '2017-11-02 12:45:05', NULL, 0, 1, '', '', '', '', '', ''),
(2059, 0, 10, 0, 'chudesnaya_bluza_s_raskleshennymi_rukavami', 'Чудесная блуза с расклешенными рукавами', NULL, 18, 'Чудесная блуза полуприлегающего силуэта из трикотажного бархатного полотна. Круглый вырез изделия обработан внутренней обтачкой. Низ цельнокроеных рукавов и низ переда блузы дополнены широкими воланами из гофрированного бархата.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 67-71 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3701/0-3', NULL, 3250, NULL, 1500, '2017-11-02 12:54:32', '2017-11-23 15:40:04', NULL, 0, 1, '', '', '', '', '', ''),
(2060, 0, 9, 0, 'plate_midi_s_dekorativnoj_otdelkoj', 'Платье миди  с декоративной отделкой', NULL, 17, 'Платье миди  с декоративной отделкой.\r\nСостав: полиэстер 100%\r\n• Длина рукава: короткие, втачной\r\n• Тип горловины: округлый\r\n• Линия плеча: на естественном месте\r\n• Длина изделия: 96см\r\n• Карманы: нет\r\n• Застежка: молния\r\n• Особенности: декоративная вставка и отделка по низу рукавов из кружева', 'ФЛА-2-117', NULL, 4090, NULL, 1920, '2017-11-03 11:50:54', '2017-11-03 11:50:54', NULL, 0, 1, '', '', '', '', '', ''),
(2061, 0, 9, 0, 'trikotazhnoe_plate_s_nebolshimi_razrezami', 'Трикотажное платье с небольшими разрезами', NULL, 17, 'Трикотажное платье с небольшими разрезами.\r\nСостав: полиэстер 100%\r\n•     Длина рукава: 3/4\r\n•     Тип горловины: округлый\r\n•     Тип проймы: спущенный\r\n•     Длина изделия: по спинке 98 см (50, 58 р.)\r\n•     Застежка: нет\r\n•     Особенности: кокетка по плечу, разрезы\r\n', 'ФЛА-2-106.1', NULL, 4130, NULL, 1940, '2017-11-03 11:58:58', '2017-11-03 11:58:58', NULL, 0, 1, '', '', '', '', '', ''),
(2062, 0, 9, 0, 'molodezhnyj_dzhemper_svobodnogo_silueta', 'Молодежный джемпер свободного силуэта', NULL, 12, 'Молодежный джемпер свободного силуэта.\r\nСостав: полиэстер 100%\r\n• Длина рукава: 3/4\r\n• Тип горловины: округлый, с притачной бейкой\r\n• Пройма плеча: спущенная\r\n• Длина изделия: по спинке 68 см (44, 50 р)\r\n• Застежка: нет\r\n', 'ФЛА-506.1', NULL, 3310, NULL, 1530, '2017-11-03 12:10:31', '2017-11-03 12:10:31', NULL, 0, 1, '', '', '', '', '', ''),
(2063, 0, 10, 0, 'zhenskaya_majka_sinego_cveta', 'Женская майка  синего цвета', NULL, 7, 'Женская майка классического кроя синего цвета. Майка на широких бретелях с круглым вырезом. Аксессуары в комплект не входят. Длина изделия по спинке от плечевого шва до низа изделия — 62 см.\r\nСостав: Полиэстер 95%, Эластан 5%\r\n', 'ВА-М1-2532/9', NULL, 1350, NULL, 550, '2017-11-03 12:25:31', '2017-11-03 12:25:31', NULL, 0, 1, '', '', '', '', '', ''),
(2064, 0, 10, 0, 'zhenskaya_bluza_bezhevogo_cveta', 'Женская блуза бежевого цвета', NULL, 20, 'Женская майка классического кроя бежевого цвета. Майка на широких бретелях с круглым вырезом. Аксессуары в комплект не входят. Длина изделия по спинке от плечевого шва до низа изделия — 71 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М1-2532/10', NULL, 1450, NULL, 600, '2017-11-03 12:38:46', '2017-11-03 12:38:46', NULL, 0, 1, '', '', '', '', '', ''),
(2065, 0, 10, 0, 'izyashnaya_bluzka_s_metallicheskim_napyleniem', 'Изящная блузка с металлическим напылением', NULL, 19, 'Изящная блузка свободного силуэта из трикотажного полотна  с металлическим напылением. Круглый вырез изделия украшен декоративной цепочкой. Блузка с цельнокроенными рукавами. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 70 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М4-3034/0-1', NULL, 2650, NULL, 1200, '2017-11-03 12:49:42', '2017-11-03 12:51:43', NULL, 0, 1, '', '', '', '', '', ''),
(2066, 0, 10, 0, 'bluzka_svobodnogo_silueta_s_relefnoj_fakturoj_', 'Блузка свободного силуэта  с рельефной фактурой', NULL, 19, 'Обворожительная блузка свободного силуэта из трикотажного полотна с рельефной фактурой серого цвета. Круглый вырез изделия украшен металлизированным рисунком. Блузка с цельнокроенными рукавами. Верхняя часть спинки до линии талии выполнена из кружевного полотна. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —80 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-М4-3029/0-1', NULL, 2850, NULL, 1300, '2017-11-03 13:02:41', '2017-11-03 13:02:41', NULL, 0, 1, '', '', '', '', '', ''),
(2067, 0, 10, 0, 'naryadnaya_tunika_sine_zolotogo_cveta', 'Нарядная туника  сине-золотого цвета', NULL, 18, 'Нарядная туника свободного силуэта из трикотажного полотна сине-золотого цвета. Круглый вырез изделия обработан внутренней обтачкой. Втачные рукава туники по низу дополнены воланом из кружева. Перед изделия двойной: верхняя часть выполнена из ажурного кружева золотого цвета. Снизу однотонный подклад из трикотажного полотна синего цвета. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 83-87 см\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3709', NULL, 3850, NULL, 1800, '2017-11-03 13:13:18', '2017-11-03 13:13:18', NULL, 0, 1, '', '', '', '', '', ''),
(2068, 0, 10, 0, 'potryasayushaya_tunika_chernogo_cveta', 'Потрясающая туника черного цвета', NULL, 20, 'Потрясающая туника полуприлегающего силуэта из трикотажного полотна черного цвета. Круглый вырез изделия обработан внутренней обтачкой. Верхняя часть изделия двойная кружево на трикотажной основе. По линии талии декоративное кружево. Втачные рукава выполнены их кружева и обработаны декоративным швом закрутка. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 84 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-2981', NULL, 3050, NULL, 1400, '2017-11-03 13:20:18', '2017-11-03 13:20:18', NULL, 0, 1, '', '', '', '', '', ''),
(2069, 0, 10, 0, 'bluzka_iz_tesmy_s_pajetkami_v_vide_sovy', 'Блузка из тесьмы с пайетками в виде совы', NULL, 19, 'Роскошная блузка прямого силуэта из трикотажного полотна. Круглый вырез изделия обработан внутренней обтачкой. Блузка с цельнокроенными рукавами. Спереди низ изделия дополнен воланом. Перед изделия украшен декоративными элементом из тесьмы и пайеток в виде совы. Спинка выполнена из однотонного полотна. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —75 см.\r\nСостав: Вискоза 30%, Полиэстер 65%, Эластан 5%', 'ВА-М4-3030/0-1', NULL, 2450, NULL, 1100, '2017-11-03 13:43:32', '2017-11-03 13:43:32', NULL, 0, 1, '', '', '', '', '', ''),
(2070, 0, 10, 0, 'oslepitelnaya_bluzka_svobodnogo_silueta', 'Ослепительная блузка свободного силуэта', NULL, 18, 'Ослепительная блузка свободного силуэта из трикотажного полотна. Круглый вырез изделия дополнен металлическим элементом. Блузка двойная по переду: верхняя часть выполненная из кружевного полотна и посажена на тонкий однотонный подклад. Блузка с втачными рукавами.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 73 см.', 'ВА-М4-3406', NULL, 3250, NULL, 1500, '2017-11-03 13:56:05', '2017-11-03 13:56:05', NULL, 0, 1, '', '', '', '', '', ''),
(2071, 0, 10, 0, 'bluzka_iz_kruzhevnogo_polotna_yarko_sinego_cveta', 'Блузка из кружевного полотна ярко-синего цвета', NULL, 16, 'Нарядная блуза свободного силуэта из трикотажного кружевного полотна ярко-синего цвета. Круглый вырез изделия обработан внутренней обтачкой. Блуза с втачными рукавами. Перед изделия двойной — дополнен ажурным кружевом.\r\nАксессуары в комплект не входят.\r\nДлина блузки по спинке от плечевого шва до низа изделия — 68 см.', 'ВА-М4-3654/1', NULL, 3050, NULL, 1400, '2017-11-03 14:07:53', '2017-11-03 14:07:53', NULL, 0, 1, '', '', '', '', '', ''),
(2072, 0, 10, 0, 'izyskannaya_bluzka_svobodnogo_silueta', 'Изысканная блузка свободного силуэта', NULL, 20, 'Изысканная блузка свободного силуэта из трикотажного полотна. Круглый вырез изделия обработан бейкой. Перед дополнен разрезом-капелькой с застежкой на пуговицу. Цельнокроеные рукава изделия по низу дополнены широким кружевом и обработаны манжетом. По боковым швам блузы декоративные сборки.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 83 см', 'ВА-М4-3225/12', NULL, 2850, NULL, 1300, '2017-11-03 14:15:09', '2017-11-03 14:15:09', NULL, 0, 1, '', '', '', '', '', ''),
(2073, 0, 10, 0, 'romantichnaya_bluza_bezhevo_sinego_cveta', 'Романтичная блуза бежево-синего цвета', NULL, 18, 'Романтичная блуза свободного силуэта из трикотажного полотна бежево-синего цвета. Круглый вырез изделия обработан двухсторонним воротником «хомут». Блуза с втачными рукавами. Перед изделия двойной из трикотажа и шифона с цветочным узором. Аксессуары в комплект не входят.\r\nДлина изделия от плечевого шва по спинке до низа изделия — 70 - \r\n 73 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-3660/10-11', NULL, 3050, NULL, 1400, '2017-11-03 14:24:17', '2017-11-03 14:24:17', NULL, 0, 1, '', '', '', '', '', ''),
(2074, 0, 10, 0, 'brosh_s_matovym_effektom_s_kamnyami', 'Брошь с матовым эффектом с камнями', NULL, 9, 'Брошь выполнена из металла цвета под старинное серебро с матовым эффектом. Украшена крупной вставкой изумрудно - зеленого цвета и бусинками из натурального камня.\r\nНабор цветов бусин индивидуален для каждого изделия.\r\nРазмер 6,5 см х 5,5 см.\r\nСостав: 	Металл, натуральный камень.', 'ВА-Бр-131/21', NULL, 770, NULL, 260, '2017-11-03 14:28:16', '2017-11-03 14:28:16', NULL, 0, 1, '', '', '', '', '', ''),
(2075, 0, 10, 0, 'romantichnaya_bluza_sinego_rozovogo_cveta', 'Романтичная блуза синего-розового цвета', NULL, 18, 'Романтичная блуза свободного силуэта из трикотажного полотна синего-розового цвета. Круглый вырез изделия обработан двухсторонним воротником «хомут». Блуза с втачными рукавами. Перед изделия двойной из трикотажа и шифона с узором в контрастную полоску.\r\nАксессуары в комплект не входят.\r\nДлина изделия от плечевого шва по спинке до низа изделия —70- 73 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-3660/8-9', NULL, 3050, NULL, 1400, '2017-11-03 14:33:17', '2017-11-03 14:33:17', NULL, 0, 1, '', '', '', '', '', ''),
(2076, 0, 10, 0, 'naryadnyj_komplekt_s_strazami_i_kristallami', 'Нарядный комплект с стразами и кристаллами', NULL, 9, 'Изумительный  комплект выполнен из металла серебряного цвета и украшен стразами и кристаллами.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина: 48 см + 9 см. Длина сережек 6 см.\r\nСостав: Металл, стразы.', 'ВА-К-760/41/43', NULL, 1530, NULL, 640, '2017-11-03 14:36:31', '2017-11-03 14:36:31', NULL, 0, 1, '', '', '', '', '', ''),
(2077, 0, 10, 0, 'romantichnaya_bluza_svetlo_bezhevogo_cveta', 'Романтичная блуза светло-бежевого цвета', NULL, 18, 'Романтичная блуза свободного силуэта из трикотажного полотна светло-бежевого цвета. \r\nКруглый вырез изделия обработан двухсторонним воротником «хомут». Блуза с втачными рукавами. Перед изделия двойной. \r\nАксессуары в комплект не входят.\r\nДлина изделия от плечевого шва по спинке до низа изделия — 70 -73 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-3660/0-1', NULL, 3050, NULL, 1400, '2017-11-03 14:41:34', '2017-11-03 14:41:34', NULL, 0, 1, '', '', '', '', '', ''),
(2078, 0, 10, 0, 'yarkij_komplekt_so_strazami', 'Яркий комплект со стразами', NULL, 9, 'Дивный комплект выполнен из металла серебрянного цвета и украшен стразами и кристаллами зеленого, бирюзового и изумрудного цветов.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина: 48 см + 9 см. Длина сережек 6 см.\r\nСостав: Металл, стразы.', 'ВА-К-760/39-40', NULL, 1530, NULL, 640, '2017-11-03 14:47:26', '2017-11-03 14:47:26', NULL, 0, 1, '', '', '', '', '', ''),
(2079, 0, 10, 0, 'romantichnaya_bluza_bezhevogo_cveta', 'Романтичная блуза бежевого цвета', NULL, 18, 'Романтичная блуза свободного силуэта из трикотажного полотна бежевого цвета. Круглый вырез изделия обработан двухсторонним воротником «хомут». Блуза с втачными рукавами. Перед изделия двойной из трикотажа и шифона с анималистическим узором.\r\nАксессуары в комплект не входят.\r\nДлина изделия от плечевого шва по спинке до низа изделия — 70-73 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-3660/6-7', NULL, 3050, NULL, 1400, '2017-11-03 14:50:20', '2017-11-03 14:50:20', NULL, 0, 1, '', '', '', '', '', ''),
(2080, 0, 10, 0, 'romantichnaya_bluza_serogo_cveta_', 'Романтичная блуза  серого цвета.', NULL, 12, 'Романтичная блуза свободного силуэта из трикотажного полотна серого цвета. Круглый вырез изделия обработан двухсторонним воротником «хомут». Блуза с втачными рукавами. Перед изделия двойной из трикотажа и шифона с цветочным рисунком.\r\nАксессуары в комплект не входят. Длина изделия от плечевого шва по спинке до низа изделия — 70 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-М5-3660/4', NULL, 2850, NULL, 1300, '2017-11-03 14:55:56', '2017-11-03 14:55:56', NULL, 0, 1, '', '', '', '', '', ''),
(2081, 0, 10, 0, 'modnye_ukorochennye_bryuki_iz_tekstilnogo_polotna', 'Модные укороченные брюки из текстильного полотна', NULL, 18, 'Модные укороченные брюки из текстильного полотна черного цвета. \r\nПеред изделия сверху дополнен поясом с застежкой на пуговицу и молнию по переду. По бокам брюк декоративные лампасы. По линии талии изделия выполнены декоративные складки, благодаря которым формируются вертикальные линии визуально удлиняющие силуэт.\r\nАксессуары в комплект не входят.\r\nДлина изделия от линии пояса до низа изделия - 99 см.\r\nСостав: Вискоза 65%, Полиэстер 30%, Эластан 5%.', 'ВА-Б5-3700/0-1', NULL, 2850, NULL, 1300, '2017-11-03 15:02:38', '2017-11-03 15:02:38', NULL, 0, 1, '', '', '', '', '', ''),
(2082, 0, 10, 0, 'vyazannyj_dzhemper_pryamogo_silueta', 'Вязанный джемпер прямого силуэта', NULL, 18, 'Очаровательный джемпер прямого силуэта. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез изделия обработан "резинкой". Джемпер со спущенной проймой и втачными рукавами. По низу рукавов и низу изделия — манжеты. По переду изделия вывязан рисунок.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 70-74 см.\r\nСостав: Акрил 48%, Вискоза 31%, Шерсть 16%, Эластан 5%', 'ВА-Др5-209/0-3', NULL, 3050, NULL, 1400, '2017-11-03 15:04:13', '2017-11-03 15:04:13', NULL, 0, 1, '', '', '', '', '', ''),
(2083, 0, 10, 0, 'dzhemper_pryamogo_silueta_temno_sinego_cveta', 'Джемпер прямого силуэта темно-синего цвета', NULL, 18, 'Очаровательный джемпер прямого силуэта темно-синего цвета. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез изделия обработан "резинкой". Джемпер со спущенной проймой и втачными рукавами. По низу рукавов и низу изделия — манжеты. По переду изделия вывязан рисунок.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 71-76 см.\r\nСостав: Акрил 70%, Мохер 20%, шерсть 10%', 'ВА-Др5-207/0-1', NULL, 3050, NULL, 1400, '2017-11-03 15:12:53', '2017-11-03 15:12:53', NULL, 0, 1, '', '', '', '', '', ''),
(2084, 0, 10, 0, 'cherno_krasnoe_plate_s_kruzhevom', 'Черно-красное платье с кружевом', NULL, 18, 'Изящное платье прилегающего силуэта черно-красного цвета. Круглый вырез и проймы изделия обработаны окантовкой. Кокетка платья выполнена из кружевного полотна расшитого пайетками. Платье двойное: верхняя часть выполнена из легкой сетки расшитой розами. Снизу однотонный подклад из трикотажного полотна черного цвета. Спинка изделия дополнена застежкой на потайную молнию и маленькую сутажную застежку. По низу платья разрез.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 106-108 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П2-3706/0-1', NULL, 4650, NULL, 2200, '2017-11-03 15:17:05', '2017-11-03 15:17:05', NULL, 0, 1, '', '', '', '', '', ''),
(2085, 0, 10, 0, 'vyazannyj_dzhemper_temno_sinego_cveta', 'Вязанный джемпер темно-синего цвета', NULL, 18, 'Очаровательный джемпер прямого силуэта темно-синего цвета. Джемпер выполнен в технике «ручного вязания» из нитей с содержанием шерсти. Круглый вырез изделия обработан "резинкой". Джемпер со спущенной проймой и втачными рукавами. По низу рукавов и низу изделия — манжеты. По переду изделия вывязан рисунок.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 71 см.\r\nСостав: Акрил 70%, Мохер 20%, шерсть 10%', 'ВА-Др5-208/0-1', NULL, 3050, NULL, 1400, '2017-11-03 15:20:55', '2017-11-03 15:20:55', NULL, 0, 1, '', '', '', '', '', ''),
(2086, 0, 10, 0, 'naryadnoe_plate_s_dvuhstoronnimi_pajetkami', 'Нарядное платье с двухсторонними пайетками', NULL, 18, 'Изящное платье прилегающего силуэта из трикотажного полотна серо-черного цвета. Круглый вырез и проймы изделия обработаны окантовкой. Кокетка платья выполнена из кружевного полотна расшитого пайетками. Перед платья двойной: верхняя часть выполнена из сетки расшитой двухсторонними  пайетками с голографическим блеском. Снизу однотонный подклад из трикотажного полотна черного цвета. Спинка изделия выполнена из плотного трикотажа черного цвета и дополнена застежкой на потайную молнию и маленькую сутажную застежку. По низу платья разрез.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия -  106-108 см.\r\nСостав: Полиэстер 95%, Эластан 5%.', 'ВА-П2-3706/2-3', NULL, 4650, NULL, 2200, '2017-11-03 15:25:10', '2017-11-03 15:25:10', NULL, 0, 1, '', '', '', '', '', ''),
(2088, 0, 10, 0, 'kardigan_na_pugovichkah_s_odnotonnymi_rukavami', 'Кардиган на пуговичках с однотонными рукавами', NULL, 18, 'Роскошный кардиган полуприлегающего силуэта. Круглый вырез обработан двусторонней лицевой бейкой. Кардиган с втачными рукавами. По переду изделия вывязана планка с застежкой на пуговицы. Манжеты рукавов и низа изделия отвязаны резинкой 1*1. Перед изделия двойной, поверх цельновязнной основы кружевная вышивка. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 64 см.\r\nРост фотомодели — 165 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %.', 'ВА-Кн5-198/4-7', NULL, 3050, NULL, 1400, '2017-11-03 15:43:42', '2017-11-03 15:43:42', NULL, 0, 1, '', '', '', '', '', ''),
(2089, 0, 10, 0, 'stilnyj_dzhemper_bezhevogo_cveta', 'Стильный джемпер  бежевого цвета', NULL, 18, 'Стильный джемпер полуприлегающего силуэта бежевого цвета. Джемпер выполнен в технике «ручного вязания» из натуральных нитей с содержанием шерсти. Круглый вырез изделия обработан контрастной двусторонней лицевой бейкой. Низ  рукавов и низ спинки изделия выполнен вязкой "резинка". Низ перед изделия дополнен широким ажурным кружевом. Спинка изделия удлинена. Аксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —56 см.\r\nСостав: Акрил 70%, Мохер 20%, шерсть 10%', 'ВА-Др5-210', NULL, 2650, NULL, 1200, '2017-11-03 15:45:27', '2017-11-03 15:45:27', NULL, 0, 1, '', '', '', '', '', '');
