(2090, 0, 10, 0, 'kardigan_serogo_cveta_na_pugovichkah', 'Кардиган серого цвета на пуговичках', NULL, 18, 'Роскошный кардиган полуприлегающего силуэта серого цвета. Круглый вырез обработан двусторонней лицевой бейкой. Кардиган с втачными рукавами. По переду изделия вывязана планка с застежкой на пуговицы. Манжеты рукавов и низа изделия отвязаны резинкой 1*1. Перед изделия двойной, поверх цельновязнной основы кружевная вышивка. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 64 см.\r\nРост фотомодели — 165 см.\r\nСостав: Шерсть 35%, Хлопок 20%, Акрил 35%, Полиамид 10 %.', 'ВА-Кн5-198/8-11', NULL, 3050, NULL, 1400, '2017-11-03 15:48:37', '2017-11-03 15:48:37', NULL, 0, 1, '', '', '', '', '', ''),
(2091, 0, 9, 0, 'barhatnoe_plate_maksi_s_vysokim_razrezom', 'Бархатное платье макси с высоким разрезом', NULL, 12, 'Бархатное платье макси с высоким разрезом.\r\nСостав: полиэстер 100%\r\n• Длина рукава: длинные\r\n• Покрой рукава: втачной\r\n• Стиль: вечерний \r\n• Тип горловины: округлый\r\n• Линия плеча: на естественном месте\r\n• Длина платья/юбки: макси\r\n• Длина изделия: 145см\r\n• Карманы: нет\r\n• Застежка: нет\r\n• Особенности: бархатное платье макси с сетчатой вставкой и высоким разрезом', 'ФЛА-135.1', NULL, 4070, NULL, 1910, '2017-11-08 10:28:10', '2017-11-08 10:28:10', NULL, 0, 1, '', '', '', '', '', ''),
(2092, 0, 10, 0, 'sergi_iz_kristallov_rubinovogo_cveta_', 'Серьги из кристаллов рубинового цвета.', NULL, 9, 'Дивные серьги удлиненной овальной формы украшены россыпью сверкающих страз и кристаллов рубинового цвета. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nМеталл серебряного цвета.\r\nДлина 5,5 см.\r\nСостав: Металл, кристаллы. стразы', 'ВА-С-36/86', NULL, 1010, NULL, 380, '2017-11-09 11:34:19', '2017-11-09 11:34:19', NULL, 0, 1, '', '', '', '', '', ''),
(2093, 0, 10, 0, 'sergi_udlinennoj_ovalnoj_formy_', 'Серьги удлиненной овальной формы', NULL, 9, 'Дивные серьги удлиненной овальной формы украшены россыпью сверкающих страз и кристаллов рубинового цвета. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nМеталл серебряного цвета. Длина 7 см.\r\nСостав: Металл, кристаллы. стразы', 'ВА-С-36/85', NULL, 1010, NULL, 380, '2017-11-09 11:39:16', '2017-11-09 11:39:16', NULL, 0, 1, '', '', '', '', '', ''),
(2094, 0, 10, 0, 'sergi_v_oprave_iz_metalla_chernogo_cveta', 'Серьги в оправе из металла черного цвета', NULL, 9, 'Изумительные серьги сделают Вас звездой любого праздника. Удлиненная форма, изящный рисунок, стразы в оправе из металла черного цвета.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина 7, 5 см.\r\nСостав: Металл, кристаллы. стразы', 'ВА-С-334/3-4', NULL, 1010, NULL, 380, '2017-11-09 11:51:30', '2017-11-09 14:08:59', NULL, 0, 1, '', '', '', '', '', ''),
(2095, 0, 10, 0, 'udlinennye_sergi_s_krasnymi_strazami', 'Удлиненные серьги с красными стразами', NULL, 9, 'Нарядные удлиненные серьги выполнены из металла цвета бронзы, украшены красными стразами.\r\nДлина 6,5 см.\r\nСостав: Металл, стразы', 'ВА-С-322/12', NULL, 1010, NULL, 380, '2017-11-09 11:57:40', '2017-11-09 11:57:40', NULL, 0, 1, '', '', '', '', '', ''),
(2096, 0, 10, 0, 'udlinennye_serezhki_s_krasnymi_businami', 'Удлиненные сережки с красными бусинами', NULL, 9, 'Удлиненные сережки , украшенные красными бусинами, подчеркнут стройность шеи, колышутся и мерцают при ходьбе, привлекая взгляды к их владелице.\r\nМеталл серебряного цвета. Длина 10 см.\r\nСостав: Металл, стразы, бусины', 'ВА-С-334/15', NULL, 630, NULL, 190, '2017-11-09 12:03:01', '2017-11-09 12:03:01', NULL, 0, 1, '', '', '', '', '', ''),
(2097, 0, 10, 0, 'sergi_s_krupnym_krasnym_kristallom_', 'Серьги с крупным красным кристаллом', NULL, 9, 'Красивые серьги украшены крупным красным кристаллом в оправе из сверкающих страз. Оденьте их обираясь на праздник и будьте уверены в своей неотразимости!\r\nРазмер 2,5 см х 1,5 см\r\nСостав: Металл, кристаллы. стразы', 'ВА-С-36/84', NULL, 650, NULL, 200, '2017-11-09 12:09:37', '2017-11-09 12:09:37', NULL, 0, 1, '', '', '', '', '', ''),
(2098, 0, 10, 0, 'dlinnye_sergi_iz_metalla_zolotogo_cveta_', 'Длинные серьги из металла золотого цвета', NULL, 9, 'Длинные чудесные серьги будут к лицу каждой женщине. Классическое сочетание металла золотого цвета и прозрачных страз делает этот аксессуар универсальным.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина 7 см.\r\nСостав: Металл, кристаллы. стразы', 'ВА-С-334/1', NULL, 1010, NULL, 380, '2017-11-09 12:18:22', '2017-11-09 12:18:22', NULL, 0, 1, '', '', '', '', '', ''),
(2099, 0, 10, 0, 'dlinnye_so_strazami_i_zhemchuzhinam', 'Длинные со стразами и жемчужинам', NULL, 9, 'Удлиненные серьги как у снегурочки! Подарите себе новогоднее настроение! \r\nСерьги выполнены из металла серебрянного цвета, украшены сверкающими стразами и жемчужинами.\r\nДлина 8 см.\r\nСостав: Металл, стразы', 'ВА-С-322/10', NULL, 1010, NULL, 380, '2017-11-09 12:39:06', '2017-11-09 12:39:06', NULL, 0, 1, '', '', '', '', '', ''),
(2100, 0, 10, 0, 'sergi_iz_metalla_cveta_bronzy', 'Серьги из металла цвета бронзы', NULL, 9, 'Нарядные удлиненные серьги выполнены из металла цвета бронзы, украшены прозрачными стразами.\r\nДлина 6,5 см..\r\nСостав: Металл, стразы', 'ВА-С-322/11', NULL, 1010, NULL, 380, '2017-11-09 12:46:21', '2017-11-09 12:46:21', NULL, 0, 1, '', '', '', '', '', ''),
(2101, 0, 10, 0, 'sergi_s_kristallami_chernogo_cveta', 'Серьги с кристаллами черного цвета', NULL, 9, 'Потрясающие серьги выполнены из металла бронзового цвета, украшены  стразами и кристаллом черного цвета.\r\nДлина 5 см.\r\nСостав: Металл, стразы', 'ВА-С-322/14', NULL, 1010, NULL, 380, '2017-11-09 12:55:00', '2017-11-09 12:55:00', NULL, 0, 1, '', '', '', '', '', ''),
(2102, 0, 10, 0, 'sergi_iz_kristallov_chernogo_cveta', 'Серьги из кристаллов черного цвета', NULL, 9, 'Вечерние серьги удлиненной формы в виде грозди сверкающих кристаллов черного цвета. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nМеталл черного цвета. Длина 8 см.\r\nСостав: Металл, кристаллы', 'ВА-С-36/87', NULL, 1010, NULL, 380, '2017-11-09 12:59:28', '2017-11-09 12:59:28', NULL, 0, 1, '', '', '', '', '', ''),
(2103, 0, 10, 0, 'sergi_udlinennoj_formy_chernogo_cveta', 'Серьги удлиненной формы черного цвета', NULL, 9, 'Восхитительные серьги удлиненной формы в виде грозди сверкающих кристаллов черного цвета. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nМеталл черного цвета. Длина 8 см\r\nСостав: Металл, кристаллы. стразы', 'ВА-С-36/89', NULL, 1010, NULL, 380, '2017-11-09 13:07:36', '2017-11-09 13:07:36', NULL, 0, 1, '', '', '', '', '', ''),
(2104, 0, 10, 0, 'sverkayushie_sergi_udlinennoj_formy', 'Сверкающие серьги удлиненной формы', NULL, 9, 'Сверкающие серьги удлиненной формы выполнены из кристаллов и страз черного цвета. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nМеталл черного цвета. Длина 8 см.\r\nСостав: Металл, кристаллы. стразы\r\n', 'ВА-С-36/91', NULL, 1010, NULL, 380, '2017-11-09 13:19:57', '2017-11-09 13:19:57', NULL, 0, 1, '', '', '', '', '', ''),
(2105, 0, 10, 0, 'sergi_iz_kristallov_i_straz_izumrudnogo_cveta', 'Серьги из кристаллов и страз изумрудного цвета', NULL, 9, 'Восхитительные ажурные серьги удлиненной формы выполнены из кристаллов и страз изумрудного цвета. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nМеталл черного цвета. Длина 7 см\r\nСостав: Металл, кристаллы. стразы', 'ВА-С-36/93', NULL, 1010, NULL, 380, '2017-11-09 13:23:56', '2017-11-09 13:23:56', NULL, 0, 1, '', '', '', '', '', ''),
(2106, 0, 10, 0, 'azhurnye_sergi_udlinennoj_formy', 'Ажурные серьги удлиненной формы', NULL, 9, 'Ажурные серьги удлиненной формы выполнены из кристаллов и страз черного цвета. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nМеталл серебряного цвета. Длина 6 см.\r\nСостав: Металл, кристаллы. стразы', 'ВА-С-36/90', NULL, 1010, NULL, 380, '2017-11-09 13:29:26', '2017-11-09 13:29:26', NULL, 0, 1, '', '', '', '', '', ''),
(2107, 0, 10, 0, 'sergi_s_kristallom_v_oprave_iz_sverkayushih_straz', 'Серьги с кристаллом в оправе из сверкающих страз', NULL, 9, 'Потрясающие серьги украшены крупным черным кристаллом в оправе из сверкающих страз. Оденьте их обираясь на праздник и будьте уверены в своей неотразимости!\r\nРазмер 2,3 см х 1,7 см.\r\nСостав Металл, кристаллы. стразы', 'ВА-С-36/83', NULL, 650, NULL, 200, '2017-11-09 13:34:38', '2017-11-09 13:34:38', NULL, 0, 1, '', '', '', '', '', ''),
(2108, 0, 10, 0, 'udlinennye_serezhki_s_kristallami_chernogo_cveta', 'Удлиненные сережки с кристаллами черного цвета', NULL, 9, 'Удлиненные сережки , украшенные кристаллами черного цвета, подчеркнут стройность шеи, колышутся и мерцают при ходьбе, привлекая взгляды к их владелице.\r\nМеталл серебряного цвета. Длина 10 см\r\nСостав: Металл, стразы, бусины', 'ВА-С-334/13', NULL, 830, NULL, 290, '2017-11-09 13:39:02', '2017-11-09 13:39:02', NULL, 0, 1, '', '', '', '', '', ''),
(2109, 0, 10, 0, 'originalnye_sergi_chernogo_cveta', 'Оригинальные серьги  черного цвета', NULL, 9, 'Оригинальные серьги удлиненной формы в виде грозди сверкающих кристаллов черного цвета. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nМеталл серебряного цвета. Длина 10 см.\r\nСостав: Металл, кристаллы. стразы', 'ВА-С-36/88', NULL, 1010, NULL, 380, '2017-11-09 13:50:25', '2017-11-09 13:50:25', NULL, 0, 1, '', '', '', '', '', ''),
(2110, 0, 10, 0, 'udlinennye_serezhki_s_temno_sinimi_businami', 'Удлиненные сережки с темно-синими бусинами', NULL, 9, 'Удлиненные сережки , украшенные кристаллами темного синего цвета с металлическим блеском, подчеркнут стройность шеи, колышутся и мерцают при ходьбе, привлекая взгляды к их владелице.\r\nМеталл золотого цвета. Длина 10 см.\r\nСостав: Металл, стразы, бусины\r\n', 'ВА-С-334/14', NULL, 830, NULL, 290, '2017-11-09 13:54:54', '2017-11-09 13:54:54', NULL, 0, 1, '', '', '', '', '', ''),
(2111, 0, 10, 0, 'shikarnye_sergi_s_izumrudnymi_strazami', 'Шикарные серьги с изумрудными стразами', NULL, 9, 'Шикарные серьги сделают Вас звездой любого праздника. Удлиненная форма, изящный рисунок, изумрудные стразы и кристаллы в оправе из металла черного цвета.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина 7 см.\r\nСостав: Металл, кристаллы. стразы', 'ВА-С-334/2', NULL, 1010, NULL, 380, '2017-11-09 14:01:38', '2017-11-09 14:01:38', NULL, 0, 1, '', '', '', '', '', ''),
(2112, 0, 10, 0, 'oslepitelnye_sergi_udlinennoj_formy', 'Ослепительные серьги удлиненной формы', NULL, 9, 'Ослепительные серьги удлиненной формы выполнены из кристаллов изумрудного цвета. Украшены прозрачными сверкающими стразами. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nМеталл золотого цвета.\r\nДлина 7 см.\r\nСостав: 	Металл, кристаллы. стразы', 'ВА-С-36/92', NULL, 1010, NULL, 380, '2017-11-09 14:05:17', '2017-11-09 14:05:17', NULL, 0, 1, '', '', '', '', '', ''),
(2113, 0, 10, 0, 'sergi_so_strazami_glubokogo_sinego_cveta', 'Серьги со  стразами глубокого синего цвета', NULL, 9, 'Нарядные удлиненные серьги выполнены из металла серебряного цвета, украшены  стразами глубокого синего цвета.\r\nДлина 6,5 см\r\nСостав: Металл, стразы\r\n', 'ВА-С-322/13', NULL, 1010, NULL, 380, '2017-11-09 14:13:06', '2017-11-09 14:13:06', NULL, 0, 1, '', '', '', '', '', ''),
(2114, 0, 10, 0, 'sergi_s_krupnym_sinim_kristallom', 'Серьги с крупным синим кристаллом', NULL, 9, 'Потрясающие серьги украшены крупным синим кристаллом в оправе из сверкающих страз. Оденьте их обираясь на праздник и будьте уверены в своей неотразимости!\r\nРазмер 2,3 см х 1,7 см.\r\nСостав: Металл, кристаллы. стразы\r\n', 'ВА-С-36/82', NULL, 650, NULL, 200, '2017-11-09 14:16:59', '2017-11-09 14:16:59', NULL, 0, 1, '', '', '', '', '', ''),
(2115, 0, 10, 0, 'serezhki_kistochki_so_sverkayushim_kristallom', 'Сережки-кисточки со  сверкающим кристаллом', NULL, 9, 'Благодаря серьгам - кисточкам ваша шея станет лебединой!\r\nЧерные сережки - кисточки с бахромой из шелковых нитей колышутся при ходьбе и привлекают внимание к своей обладательнице. \r\nКрепление из металла серебряного цвета украшено сверкающим кристаллом.\r\nДлина 10 см.\r\nСостав: Металл, текстиль, стразы', 'ВА-С-334/16', NULL, 810, NULL, 280, '2017-11-09 14:23:14', '2017-11-09 14:23:14', NULL, 0, 1, '', '', '', '', '', ''),
(2116, 0, 10, 0, 'chernye_serezhki_kistochki_s_bahromoj', 'Черные сережки-кисточки с бахромой', NULL, 9, 'Благодаря серьгам - кисточкам ваша шея станет лебединой!\r\nЧерные сережки - кисточки с бахромой из шелковых нитей колышутся при ходьбе и привлекают внимание к своей обладательнице. \r\nКрепление из металла  украшено жемчужиной в окружении сверкающих стразинок.\r\nДлина 8 см', 'ВА-С-334/17-18', NULL, 810, NULL, 280, '2017-11-09 14:28:13', '2017-11-09 15:53:46', NULL, 0, 1, '', '', '', '', '', ''),
(2117, 0, 10, 0, 'sergi_s_podveskami_serebryanogo_cveta', 'Серьги с подвесками серебряного цвета', NULL, 9, 'Благодаря серьгам с подвесками ваша шея станет лебединой! \r\nДлинные сережки  подчеркнут стройность шеи,  немного колышутся при ходьбе, привлекая взгляды к их владелице.\r\nВыполнены из металла серебряного цвета. Украшены прозрачными кристаллами.\r\nДлина 11 см.\r\n', 'ВА-С-333/87', NULL, 870, NULL, 310, '2017-11-09 14:35:22', '2017-11-09 14:35:22', NULL, 0, 1, '', '', '', '', '', ''),
(2118, 0, 10, 0, 'dlinnye_sergi_cherno_zolotogo_cveta', 'Длинные серьги черно-золотого цвета', NULL, 9, 'Благодаря серьгам с подвесками ваша шея станет лебединой! \r\nДлинные сережки  подчеркнут стройность шеи, немного колышутся при ходьбе, привлекая взгляды к их владелице.\r\nМеталлические цепочки черно - золотого цвета. \r\nДлина 8 см.\r\n', 'ВА-С-333/88', NULL, 750, NULL, 250, '2017-11-09 14:39:47', '2017-11-09 15:53:30', NULL, 0, 1, '', '', '', '', '', ''),
(2119, 0, 10, 0, 'serezhki_cepochki_cherno_zolotogo_cveta', 'Сережки-цепочки черно - золотого цвета', NULL, 9, 'Благодаря серьгам с подвесками ваша шея станет лебединой! \r\nДлинные сережки  подчеркнут стройность шеи, немного колышутся при ходьбе, привлекая взгляды к их владелице.\r\nМеталлические цепочки черно - золотого цвета, крупные прозрачные кристаллы.\r\nДлина 8 см.', 'ВА-С-333/89', NULL, 830, NULL, 290, '2017-11-09 14:45:47', '2017-11-09 14:45:47', NULL, 0, 1, '', '', '', '', '', ''),
(2120, 0, 10, 0, 'dlinnye_sergi_s_krupnymi_kristallami', 'Длинные серьги с крупными  кристаллами', NULL, 9, 'Длинные сережки  подчеркнут стройность шеи, немного колышутся при ходьбе, привлекая взгляды к их владелице.\r\nМеталлические цепочки серебряного цвета, крупные прозрачные кристаллы.\r\nДлина 10 см.', 'ВА-С-333/90', NULL, 970, NULL, 360, '2017-11-09 14:50:27', '2017-11-09 14:50:27', NULL, 0, 1, '', '', '', '', '', ''),
(2121, 0, 10, 0, 'dlinnye_serezhki_serebryanogo_cveta', 'Длинные сережки серебряного цвета', NULL, 9, 'Длинные сережки  подчеркнут стройность шеи, немного колышутся при ходьбе, привлекая взгляды к их владелице.\r\nМеталлические цепочки серебряного цвета\r\nДлина 13 см.', 'ВА-С-333/91', NULL, 1130, NULL, 440, '2017-11-09 14:53:59', '2017-11-09 14:53:59', NULL, 0, 1, '', '', '', '', '', ''),
(2122, 0, 10, 0, 'dlinnye_serezhki_v_vide_bantov', 'Длинные сережки в виде бантов', NULL, 9, 'Длинные сережки  подчеркнут стройность шеи, немного колышутся при ходьбе, привлекая взгляды к их владелице.\r\nМеталлические цепочки золотого цвета завязаны бантиками.\r\nДлина 10,5 см.\r\n', 'ВА-С-333/92', NULL, 1130, NULL, 440, '2017-11-09 15:54:15', '2017-11-09 15:54:15', NULL, 0, 1, '', '', '', '', '', ''),
(2123, 0, 10, 0, 'dlinnye_serezhki_so_strazami', 'Длинные сережки  со стразами', NULL, 9, 'Длинные сережки  подчеркнут стройность шеи, колышутся и мерцают при ходьбе, привлекая взгляды к их владелице.\r\nДлина 8 см.', 'ВА-С-334/10-11', NULL, 830, NULL, 290, '2017-11-09 15:59:27', '2017-11-09 15:59:27', NULL, 0, 1, '', '', '', '', '', ''),
(2124, 0, 10, 0, 'stilnye_dlinnye_serezhki_transformery', 'Стильные длинные сережки трансформеры', NULL, 9, 'Длинные сережки  подчеркнут стройность шеи, колышутся и мерцают при ходьбе, привлекая взгляды к их владелице.\r\nГвоздики - жемчужины можно носить отдельно.. Длина 6,5 см.', 'ВА-С-334/8-9', NULL, 830, NULL, 290, '2017-11-09 16:08:31', '2017-11-09 16:33:54', NULL, 0, 1, '', '', '', '', '', ''),
(2125, 0, 10, 0, 'udlinennye_sergi_iz_metalla_s_zhemchuzhinami', 'Удлиненные серьги из металла с жемчужинами', NULL, 9, 'Очаровательные удлиненные серьги из металла серебряного цвета украшены жемчужинами.\r\nДиаметр жемчужин 8 мм. Длина серьги 8 см.', 'ВА-С-330/91', NULL, 1010, NULL, 380, '2017-11-09 16:13:23', '2017-11-09 16:13:23', NULL, 0, 1, '', '', '', '', '', ''),
(2126, 0, 10, 0, 'nezhnye_udlinennye_sergi_iz_metalla', 'Нежные удлиненные серьги из металла', NULL, 9, 'Нежные удлиненные серьги из металла серебряного цвета украшены жемчужиной.\r\nДиаметр жемчужины 8 мм. Длина серьги 3,5 см', 'ВА-С-330/90', NULL, 730, NULL, 240, '2017-11-09 16:20:31', '2017-11-09 16:20:31', NULL, 0, 1, '', '', '', '', '', ''),
(2127, 0, 10, 0, 'prelestnye_zhemchuzhnye_serezhki_pusety', 'Прелестные жемчужные сережки - пусеты', NULL, 9, 'Прелестные жемчужные сережки - пусеты диаметром 0,5 см, с обратной стороны мочки они имеют декоративную жемчужину диаметром 1,5 см.  \r\nСережки изящно подчеркивают не только красоту мочки уха, но и изящность изгиба шеи.', 'ВА-С-330/88-89', NULL, 390, NULL, 70, '2017-11-09 16:26:20', '2017-11-09 16:26:20', NULL, 0, 1, '', '', '', '', '', ''),
(2128, 0, 10, 0, 'sergi_v_vide_pchelki_so_st_razami', 'Серьги в виде пчелки со ст разами', NULL, 9, 'Очаровательные серьги в виде пчелки украшены стразами и жемчужиной серо - розового цвета.\r\nРазмер 2 см х 1,5 см. Диаметр бусины 1,0 см.', 'ВА-С-330/87', NULL, 1010, NULL, 380, '2017-11-09 16:31:08', '2017-11-09 16:31:08', NULL, 0, 1, '', '', '', '', '', ''),
(2129, 0, 10, 0, 'oslepitelnye_sergi_s_kristallami', 'Ослепительные серьги с кристаллами', NULL, 9, 'Ослепительный блеск кристалла подарят Вам длинные серьги из металла серебряного цвета. Оденьте их обираясь на праздник или романтическое свидание и будьте уверены в своей неотразимости!\r\nДлина 4 см.', 'ВА-С-36/79', NULL, 850, NULL, 300, '2017-11-09 16:42:51', '2017-11-09 16:42:51', NULL, 0, 1, '', '', '', '', '', ''),
(2130, 0, 10, 0, 'elegantnye_sergi_s_kristallami', 'Элегантные серьги с кристаллами', NULL, 9, 'Ослепительный блеск кристалла и страз подарят Вам удлиненные серьги из металла серебряного цвета. Оденьте их обираясь на праздник или романтическое свидание и будьте уверены в своей неотразимости!\r\nДлина 5 см.', 'ВА-С-36/80', NULL, 850, NULL, 300, '2017-11-09 16:50:17', '2017-11-09 16:50:17', NULL, 0, 1, '', '', '', '', '', ''),
(2131, 0, 10, 0, 'sergi_v_vide_cvetka_iz_metalla_zolotogo_cveta', 'Серьги в виде цветка из металла золотого цвета', NULL, 9, 'Ослепительный блеск кристалла подарят Вам удлиненные серьги в виде цветка из металла золотого цвета. Оденьте их собираясь на праздник или романтическое свидание и будьте уверены в своей неотразимости!\r\nДлина 4 см.', 'ВА-С-36/81', NULL, 850, NULL, 300, '2017-11-09 16:53:23', '2017-11-09 16:53:23', NULL, 0, 1, '', '', '', '', '', ''),
(2132, 0, 10, 0, 'sergi_s_rossypyu_sverkayushih_straz', 'Серьги с россыпью сверкающих страз', NULL, 9, 'Восхитительные женственные серьги выполнены из металла золотого цвета и украшены россыпью сверкающих страз. Будьте неотразимы и сделайте Ваш образ незабываемым!\r\nКруглые серьги с английской застежкой. Бижутерный сплав без содержания никеля.\r\nДиаметр 1,8 см.', 'ВА-С-36/94', NULL, 1330, NULL, 540, '2017-11-09 16:57:38', '2017-11-09 16:57:38', NULL, 0, 1, '', '', '', '', '', ''),
(2133, 0, 10, 0, 'elegantnye_zhenstvennye_sergi', 'Элегантные женственные серьги', NULL, 9, 'Элегантные женственные серьги выполнены из металла золотого цвета и украшены сияющим кристаллом и дорожкой из страз. Будьте неотразимы и сделайте Ваш образ незабываемым!\r\nБижутерный сплав без содержания никеля.\r\nДлина 1,8 см.', 'ВА-С-36/95', NULL, 930, NULL, 340, '2017-11-09 17:01:17', '2017-11-09 17:01:17', NULL, 0, 1, '', '', '', '', '', ''),
(2134, 0, 10, 0, 'sergi_gvozdiki_iz_naturalnogo_meha_', 'Серьги - гвоздики из натурального меха', NULL, 9, 'Оригинальные серьги - гвоздики из натурального меха и металла золотого цвета.\r\nДлина 9 см.', 'ВА-С-36/96', NULL, 870, NULL, 310, '2017-11-09 17:08:52', '2017-11-09 17:08:52', NULL, 0, 1, '', '', '', '', '', ''),
(2135, 0, 10, 0, 'originalnye_sergi_gvozdiki_iz_naturalnogo_meha', 'Оригинальные серьги - гвоздики из натурального меха', NULL, 9, 'Оригинальные серьги - гвоздики из натурального меха, металла золотого цвета, дерева и маленьких страз. Милое, легкое украшение!\r\nДлина 9 см.', 'ВА-С-36/97', NULL, 870, NULL, 310, '2017-11-09 17:13:17', '2017-11-09 17:13:17', NULL, 0, 1, '', '', '', '', '', ''),
(2136, 0, 10, 0, 'sergi_gvozdiki_ukrasheny_barhatnoj_lentoj', 'Серьги - гвоздики украшены бархатной лентой', NULL, 9, 'Оригинальные серьги - гвоздики украшены бархатной лентой, валяной бусиной и металлической фурнитурой золотого цвета.\r\nДлина 8 см. Диаметр бусины 2,2 см.', 'ВА-С-36/98', NULL, 870, NULL, 310, '2017-11-09 17:16:42', '2017-11-09 17:16:42', NULL, 0, 1, '', '', '', '', '', ''),
(2137, 0, 10, 0, 'sergi_iz_meha_s_furnituroj_zolotogo_cveta', 'Серьги из меха с фурнитурой золотого цвета', NULL, 9, 'Оригинальные серьги - гвоздики выполнены из искусственного меха, дополнены фурнитурой золотого цвета.\r\nДлина 6 см. Диаметр подвески 3,8 см.', 'ВА-С-36/99', NULL, 870, NULL, 310, '2017-11-09 17:20:47', '2017-11-09 17:20:47', NULL, 0, 1, '', '', '', '', '', ''),
(2138, 0, 10, 0, 'sergi_gvozdiki_iz_tekstilya_s_kristallom', 'Серьги - гвоздики из текстиля с кристаллом', NULL, 9, 'Оригинальные серьги - гвоздики выполнены из текстиля, дополнены фурнитурой и кристаллом.\r\nДлина 8 см. Диаметр подвески 3 см.', 'ВА-С-360/1-3', NULL, 870, NULL, 310, '2017-11-09 17:30:03', '2017-11-09 17:30:03', NULL, 0, 1, '', '', '', '', '', ''),
(2139, 0, 10, 0, 'oslepitelnyj_komplekt_biryuzovyh_ottenkov', 'Ослепительный комплект бирюзовых оттенков', NULL, 9, 'Ослепительный комплект выполнен из металла серебряного цвета и украшен стразами и кристаллами бирюзовых оттенков.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина: 48 см + 9 см. Длина сережек 6 см.', 'ВА-К-760/40', NULL, 1530, NULL, 640, '2017-11-09 17:41:57', '2017-11-09 17:41:57', NULL, 0, 1, '', '', '', '', '', ''),
(2140, 0, 10, 0, 'stilnyj_platok_v_tonkuyu_kletku', 'Стильный платок в тонкую клетку', NULL, 9, 'Красивый платок  в тонкую клетку. Состав волокон: 80 % шерсть, 20 % вискоза.\r\nИдеальное качество, благородный цвет и большой размер делают это изделие Вашим любимым аксессуаром. Используйте его, как головной убор, шарф, накиньте  на плечи или завяжите красивым узлом. Аксессуары в комплект не входят.\r\nРазмер 135 см х 135 см.', 'ВА-П-98/1-4', NULL, 1650, NULL, 700, '2017-11-09 18:34:40', '2017-11-09 18:34:40', NULL, 0, 1, '', '', '', '', '', ''),
(2141, 0, 10, 0, 'palantin_s_prodolnymi_poloskami_', 'Палантин с продольными полосками', NULL, 9, 'Популярный палантин  с продольными полосками . Состав волокон: 50 % шерсть, 50 % хлопок.\r\nИдеальное качество, благородный цвет и большой размер делают это изделие Вашим любимым аксессуаром. Используйте его, как головной убор, шарф, накиньте  на плечи или завяжите красивым узлом.\r\nАксессуары в комплект не входят.\r\nРазмер 205 см х 68 см.', 'ВА-П-98/11-14', NULL, 1450, NULL, 600, '2017-11-09 18:42:36', '2017-11-09 18:42:36', NULL, 0, 1, '', '', '', '', '', ''),
(2142, 0, 10, 0, 'roskoshnyj_palantin_v_polosku', 'Роскошный палантин в полоску', NULL, 9, 'Роскошный палантин в полоску. Состав волокон 50 % хлопок, 50 % шерсть.\r\nИдеальное качество, благородный цвет и большой размер делают это изделие Вашим любимым аксессуаром. Используйте его, как головной убор, шарф, накиньте  на плечи или завяжите красивым узлом. Аксессуары в комплект не входят.\r\nДлина 208 см. Ширина 70 см.', 'ВА-П-97/98-99', NULL, 1850, NULL, 800, '2017-11-09 18:48:40', '2017-11-09 18:48:40', NULL, 0, 1, '', '', '', '', '', ''),
(2143, 0, 10, 0, 'dvustoronnyaya_kosynka_iz_myagkogo_polotna', 'Двусторонняя косынка из мягкого полотна', NULL, 9, 'Двусторонняя косынка из мягкого плотного полотна. Одна сторона - крупный яркий цветочный принт, вторая - мелкие цветы на темном синем фоне.\r\nЗауженные концы украшены пластиковыми бусинами золотого цвета.\r\nСостав: хлопок 50%, шерсть 50%\r\nДлина 225 см, максимальная ширина 62 см.', 'ВА-П-98/21', NULL, 1850, NULL, 800, '2017-11-09 18:53:08', '2017-11-09 18:53:08', NULL, 0, 1, '', '', '', '', '', ''),
(2144, 0, 10, 0, 'dvustoronnyaya_kosynka_iz_myagkogo_plotnogo_polotna', 'Двусторонняя косынка из мягкого плотного полотна', NULL, 9, 'Двусторонняя косынка из мягкого плотного полотна. Одна сторона - цветочный принт на светлом сером фоне, вторая - мелкий абстрактный рисунок.\r\nЗауженные концы украшены пластиковыми бусинами золотого цвета.\r\nСостав: хлопок 50%, шерсть 50%\r\nДлина 225 см, максимальная ширина 62 см.', 'ВА-П-98/20', NULL, 1850, NULL, 800, '2017-11-09 18:58:25', '2017-11-09 18:58:25', NULL, 0, 1, '', '', '', '', '', ''),
(2145, 0, 10, 0, 'stilnaya_dvustoronnyaya_kosynka', 'Стильная двусторонняя косынка', NULL, 9, 'Двусторонняя косынка из мягкого плотного полотна. Одна сторона - цветочный принт на бирюзовом фоне, вторая - мелкий огуречный рисунок.\r\nЗауженные концы украшены пластиковыми бусинами золотого цвета.\r\nСостав: хлопок 50%, шерсть 50%\r\nДлина 225 см, максимальная ширина 62 см.', 'ВА-П-98/19', NULL, 1850, NULL, 800, '2017-11-09 19:02:20', '2017-11-09 19:02:20', NULL, 0, 1, '', '', '', '', '', ''),
(2146, 0, 10, 0, 'uyutnyj_palantin_iz_buklirovannogo_polotna', 'Уютный палантин из буклированного полотна', NULL, 9, 'Большой, теплый, уютный палантин из буклированного полотна. Короткая сторона выполнена в виде скошенного угла.\r\nСостав волокон: 70 % хлопок, 30 % шерсть.\r\nРазмер:190 см х 66 ', 'ВА-П-98/22-24', NULL, 1810, NULL, 780, '2017-11-09 19:07:46', '2017-11-09 19:07:46', NULL, 0, 1, '', '', '', '', '', ''),
(2147, 0, 10, 0, 'modnyj_dvuhcvetnyj_palantin', 'Модный двухцветный палантин', NULL, 9, 'Благородный двухцветный палантин соткан из двух полос.  Состав волокон: 30 % шерсть, 70 % хлопок.\r\nИдеальное качество, классический цвет и большой размер делают это изделие Вашим любимым аксессуаром. Используйте его как головной убор, шарф, накиньте  на плечи или завяжите красивым узлом.\r\nАксессуары в комплект не входят.\r\nРазмер 170 см х 68 см.', 'ВА-П-98/15-18', NULL, 1450, NULL, 600, '2017-11-09 19:15:01', '2017-11-09 19:15:01', NULL, 0, 1, '', '', '', '', '', ''),
(2148, 0, 10, 0, 'vozdushnyj_palantin_s_vyshivkoj_', 'Воздушный палантин с вышивкой', NULL, 9, 'Тончайший воздушный палантин украшен изящной вышивкой. Состав волокон: 50 % шерсть, 50 % шелк.\r\nИдеальное качество, благородный цвет и большой размер делают это изделие Вашим любимым аксессуаром. Используйте его, как головной убор, шарф, накиньте  на плечи или завяжите красивым узлом.\r\nАксессуары в комплект не входят.\r\nРазмер 260 см х 120 см.', 'ВА-П-98/5-10', NULL, 2650, NULL, 1200, '2017-11-09 19:24:32', '2017-11-09 19:50:25', NULL, 0, 1, '', '', '', '', '', ''),
(2149, 0, 10, 0, 'yarkij_snud_kapyushon_s_krasivym_printom', 'Яркий снуд - капюшон с красивым принтом', NULL, 9, 'Яркий снуд - капюшон с красивым принтом способен разнообразить любой, самый строгий повседневный образ. Несколько интересных снудов позволят освежить любимое пальто или украсить яркими красками самый обычный однотонный пуховик.\r\nДлина 77 см. Ширина 25 см. Глубина 33 см.', 'ВА-Сн-2/69', NULL, 2650, NULL, 1200, '2017-11-10 10:02:38', '2017-11-10 10:02:38', NULL, 0, 0, '', '', '', '', '', ''),
(2150, 0, 10, 0, 'snud_kapyushon_s_modnym_printom', 'Снуд - капюшон с модным принтом', NULL, 9, 'Красивый снуд - капюшон с модным принтом способен разнообразить любой, самый строгий повседневный образ. Несколько интересных снудов позволят освежить любимое пальто или украсить яркими красками самый обычный однотонный пуховик.\r\nДлина 77 см. Ширина 25 см. Глубина 33 см.', 'ВА-Сн-2/72', NULL, 2650, NULL, 1200, '2017-11-10 10:11:12', '2017-11-10 10:11:12', NULL, 0, 1, '', '', '', '', '', ''),
