(2152, 0, 10, 0, 'yarkij_snud_s_krasivym_printom', 'Яркий снуд  с красивым принтом', NULL, 9, 'Яркий снуд - капюшон с красивым принтом способен разнообразить любой, самый строгий повседневный образ. Несколько интересных снудов позволят освежить любимое пальто или украсить яркими красками самый обычный однотонный пуховик.\r\nДлина 77 см. Ширина 25 см. Глубина 33 см.', 'ВА-Сн-2/73', NULL, 2650, NULL, 1200, '2017-11-10 10:19:41', '2017-11-10 10:19:41', NULL, 0, 1, '', '', '', '', '', ''),
(2153, 0, 10, 0, 'yarkij_snud_s_cvetnym_printom', 'Яркий снуд с цветным принтом', NULL, 9, 'Яркий снуд - капюшон с красивым принтом способен разнообразить любой, самый строгий повседневный образ. Несколько интересных снудов позволят освежить любимое пальто или украсить яркими красками самый обычный однотонный пуховик.\r\nДлина 77 см. Ширина 25 см. Глубина 33 см.', 'ВА-Сн-2/71', NULL, 2650, NULL, 1200, '2017-11-10 10:23:26', '2017-11-10 10:23:26', NULL, 0, 1, '', '', '', '', '', ''),
(2154, 0, 10, 0, 'stilnyj_snud_s_yarkim_printom', 'Стильный снуд с ярким принтом', NULL, 9, 'Яркий снуд - капюшон с красивым принтом способен разнообразить любой, самый строгий повседневный образ. Несколько интересных снудов позволят освежить любимое пальто или украсить яркими красками самый обычный однотонный пуховик.\r\nДлина 77 см. Ширина 25 см. Глубина 33 см.', 'ВА-Сн-2/74', NULL, 2650, NULL, 1200, '2017-11-10 10:26:41', '2017-11-10 10:26:41', NULL, 0, 1, '', '', '', '', '', ''),
(2155, 0, 10, 0, 'ocharovatelnyj_snud_molochnogo_cveta_', 'Очаровательный снуд молочного цвета', NULL, 9, 'Очаровательный снуд молочного цвета выполнен из кружева и трикотажного полотна.    \r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАксессуары в комплект не входят.', 'ВА-Сн-2/82', NULL, 1530, NULL, 640, '2017-11-10 10:31:54', '2017-11-10 10:31:54', NULL, 0, 1, '', '', '', '', '', ''),
(2156, 0, 10, 0, 'ocharovatelnyj_snud_sero_rozovogo_cveta', 'Очаровательный снуд серо-розового цвета', NULL, 9, 'Очаровательный снуд выполнен из шикарного кружева пыльного розового цвета и светлого серого вискозного трикотажного полотна. \r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАксессуары в комплект не входят.', 'ВА-Сн-2/84', NULL, 1530, NULL, 640, '2017-11-10 10:36:40', '2017-11-10 10:36:40', NULL, 0, 1, '', '', '', '', '', ''),
(2157, 0, 10, 0, 'ocharovatelnyj_snud_belo_chernogo_cveta', 'Очаровательный снуд бело-черного цвета', NULL, 9, 'Дорогое кружево белого цвета выглядит благородно и женственно.  Двусторонний снуд подбит вискозным трикотажным полотном черного цвета. Изделие отлично дополнит Ваш образ с классическим пальто, пуховиком или шубкой. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.', 'ВА-Сн-2/89', NULL, 1530, NULL, 640, '2017-11-10 10:41:20', '2017-11-10 10:41:20', NULL, 0, 1, '', '', '', '', '', ''),
(2158, 0, 9, 0, 'bluza_iz_barhata_v_polosku', 'Блуза из бархата в полоску', NULL, 17, 'Блуза из бархата в полоску. Будь модной вместе с нами.\r\nСостав: полиэстер 100%\r\n• Длина рукава: 3/4, втачной\r\n• Тип горловины: округлый\r\n• Линия плеча: на естественном месте\r\n• Длина изделия: 65 см\r\n• Силуэт: свободный\r\n• Карманы: нет\r\n• Застежка: нет\r\n', 'ФЛА-2-520', NULL, 2550, NULL, 1150, '2017-11-10 10:58:17', '2017-11-21 13:56:30', NULL, 0, 1, '', '', '', '', '', ''),
(2159, 0, 9, 0, 'povsednevnyj_dzhemper_pryamogo_silueta', 'Повседневный джемпер прямого силуэта', NULL, 17, 'Повседневный джемпер прямого силуэта. Будь модной вместе с нам.\r\nСостав: полиэстер 100%', 'ФЛА-2-526', NULL, 3130, NULL, 1440, '2017-11-13 11:28:52', '2017-11-13 11:28:52', NULL, 0, 0, '', '', '', '', '', ''),
(2160, 0, 9, 0, 'plate_midi_s_nebolshim_razrezom_', 'Платье миди с небольшим разрезом', NULL, 17, 'Платье миди с небольшим разрезом. Незаменимая вещь в гардеробе каждой женщины.\r\nСостав: полиэстер 100%', 'ФЛА-2-120', NULL, 3970, NULL, 1860, '2017-11-13 11:42:11', '2017-11-13 11:42:11', NULL, 0, 1, '', '', '', '', '', ''),
(2161, 0, 9, 0, 'stilnaya_bluza_v_pizhamnom_stile', 'Стильная блуза в пижамном стиле', NULL, 7, 'Стильная блуза в пижамном стиле.\r\nСостав: полиэстер 97%, эластан 3%\r\n• Длина рукава: длинный\r\n• Длина изделия: блуза - 60, топ - 53\r\n• Покрой рукава: втачной \r\n• Стиль: вечерний \r\n• Тип горловины: V-образный\r\n• Линия плеча: на естественном месте\r\n• Карманы: накладные\r\n• Застежка: пуговицы, петли\r\n• Особенности: блуза в пижамном стиле в комплекте с топом', 'ФЛА-237.1', NULL, 4050, NULL, 1900, '2017-11-13 12:04:52', '2017-11-23 15:00:45', NULL, 0, 1, '', '', '', '', '', ''),
(2162, 0, 9, 0, 'stilnyj_zhaket_iz_dvustoronnej_zamshi', 'Стильный жакет из двусторонней замши', NULL, 12, 'Стильный жакет из двусторонней замши. Будь модной вместе с нами.\r\nСостав: полиэстер 100%', 'ФЛА-301.1', NULL, 3790, NULL, 1770, '2017-11-13 12:22:52', '2017-11-13 12:22:52', NULL, 0, 1, '', '', '', '', '', '');
