(2163, 0, 10, 0, 'braslet_sinego_cveta_v_oprave_iz_metalla', 'Браслет синего цвета в оправе из металла', NULL, 9, 'Восхитительный браслет выполнен из кристаллов и страз глубокого синего цвета в оправе из металла цвета темного сербра. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nДлина 17,5 см. Ширина центрального элемента 2,5 см.', 'ВА-Бс-221/76', NULL, 1090, NULL, 420, '2017-11-14 18:56:52', '2017-11-14 18:58:05', NULL, 0, 1, '', '', '', '', '', ''),
(2164, 0, 10, 0, 'braslet_iz_kristallov_temnogo_sinego_cveta', 'Браслет из кристаллов темного синего цвета', NULL, 9, 'Восхитительный браслет выполнен из кристаллов и страз темного синего цвета в оправе из металла цвета темного сербра. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nДлина 17,5 см. Ширина центрального элемента 2,5 см.', 'ВА-Бс-221/75', NULL, 1090, NULL, 420, '2017-11-14 19:05:23', '2017-11-14 19:05:23', NULL, 0, 1, '', '', '', '', '', ''),
(2165, 0, 10, 0, 'braslet_iz_sverkayushih_kristallov_v_oprave_', 'Браслет из сверкающих кристаллов в оправе', NULL, 9, 'Ослепительный браслет выполнен из сверкающих кристаллов в оправе из металла золотого цвета. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nДлина 17,5 см + 5 см. Ширина 3 см.', 'ВА-Бс-221/80', NULL, 870, NULL, 310, '2017-11-14 19:09:45', '2017-11-14 19:09:45', NULL, 0, 1, '', '', '', '', '', ''),
(2166, 0, 10, 0, 'braslet_v_oprave_iz_metalla_serebryanogo_cveta', 'Браслет в оправе из металла серебряного цвета', NULL, 9, 'Ослепительный браслет выполнен из сверкающих кристаллов в оправе из металла серебряного цвета. Будьте неотразимы и сделайте Ваш праздник незабываемым!\r\nДлина 18 см + 5 см. Ширина 2,5 см.', 'ВА-Бс-221/77', NULL, 870, NULL, 310, '2017-11-14 19:14:53', '2017-11-14 19:14:53', NULL, 0, 1, '', '', '', '', '', ''),
(2167, 0, 10, 0, 'braslet_so_strazami_granatovogo_cveta', 'Браслет со стразами гранатового цвета', NULL, 9, 'Роскошный браслет из искусственной кожи с застежкой - магнит, украшен стразами гранатового цвета.\r\nЦвет темный красный. Металл серебряного цвета.\r\nШирина: 3 см см. Длина 19,5 см.', 'ВА-Бс-23/58', NULL, 1070, NULL, 410, '2017-11-14 19:17:44', '2017-11-14 19:17:44', NULL, 0, 1, '', '', '', '', '', ''),
(2168, 0, 10, 0, 'effektnoe_kole_s_bahromoj_iz_busin', 'Эффектное колье с бахромой из бусин', NULL, 9, 'Эффектный подвес на текстильном шнурке украшен бахромой из нитей сверкающих  бусин.\r\nДлина 40 см + 5 см. Длина бахромы 11 см.', 'ВА-П-84/89-91', NULL, 1650, NULL, 700, '2017-11-14 19:27:22', '2017-11-14 19:30:44', NULL, 0, 1, '', '', '', '', '', ''),
(2169, 0, 10, 0, 'nezhnyj_komplekt_iz_metalla_serebryanogo_cveta', 'Нежный комплект из металла серебряного цвета', NULL, 9, 'Нежный комплект (серьги + колье), выполненный из металла серебряного цвета, выглядит воздушным и невесомым. Украшен сверкающими стразами и милыми крохотными розочками серого цвета. \r\nДлина: 40 см + 5 см. Длина сережек - гвоздиков 4 см.', 'ВА-К-700/60', NULL, 1290, NULL, 520, '2017-11-14 19:51:38', '2017-11-14 19:51:38', NULL, 0, 1, '', '', '', '', '', ''),
(2170, 0, 10, 0, 'komplekt_s_krohotnymi_krasnymi_rozochkami', 'Комплект с крохотными красными розочками', NULL, 9, 'Восхитительный комплект (серьги + колье), выполненный из металла серебряного цвета, выглядит воздушным и невесомым. Украшен сверкающими стразами и милыми крохотными красными розочками.\r\nДлина: 40 см + 5 см. Длина сережек - гвоздиков 4 см.', 'ВА-К-700/61', NULL, 1290, NULL, 520, '2017-11-14 19:58:27', '2017-11-14 19:58:27', NULL, 0, 1, '', '', '', '', '', ''),
(2171, 0, 10, 0, 'elegantnyj_komplekt_iz_metalla_chernogo_cveta', 'Элегантный комплект  из металла черного цвета', NULL, 9, 'Деликатный комплект (серьги + колье), выполненный из металла черного цвета, выглядит воздушным и невесомым. Украшен стразами. \r\nДлина: 40 + 5 см. Длина сережек - гвоздиков 7 см.', 'ВА-К-700/55-59', NULL, 1210, NULL, 480, '2017-11-14 20:56:21', '2017-11-15 14:52:32', NULL, 0, 1, '', '', '', '', '', ''),
(2172, 0, 10, 0, 'roskoshnoe_plate_iz_tekstilya_yarko_krasnogo_cveta', 'Роскошное платье из текстиля ярко-красного цвета', NULL, 18, 'Роскошное платье из текстильного полотна "март" ярко-красного цвета. Круглый вырез изделия обработан внутренней обтачкой и дополнен декоративным воротничком из жемчуга. Платье с втачными рукавами «крылышками», выполненными из гофрированного полотна. Спинка изделия дополнена застежкой на потайную молнию.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100 см.\r\nСостав: 	Вискоза 65%, Полиэстер 30%, Эластан 5%', 'ВА-П4-3710', NULL, 4450, NULL, 2100, '2017-11-15 11:15:51', '2017-11-15 14:50:10', NULL, 0, 1, '', '', '', '', '', ''),
(2173, 0, 10, 0, 'izyashnoe_plate_poluprilegayushego_silueta_', 'Изящное платье полуприлегающего силуэта', NULL, 18, 'Изящное платье полуприлегающего силуэта из текстильного полотна. Круглый вырез изделия обработан внутренней обтачкой. Платье двойное: верхняя часть выполненная из тонкого кружевного полотна черного цвета и посажена на однотонную подкладку из атласного полотна контрастного цвета. Платье с втачными рукавами.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 95 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П4-3227/26-33', NULL, 4250, NULL, 2000, '2017-11-15 11:32:15', '2017-11-19 20:30:22', NULL, 0, 1, '', '', '', '', '', ''),
(2174, 0, 10, 0, 'stilnoe_plate_maksi_poluprilegayushego_silueta', 'Стильное платье-макси полуприлегающего силуэта', NULL, 18, 'Стильное платье-макси полуприлегающего силуэта из трикотажного полотна. Круглый вырез изделия обработан обтачкой. Платье с втачными рукавами. Верхняя часть переда выполнена из роскошного расшитого пайетками кружева. Платье отрезное по линии талии. Юбка дополнена встречными складками.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 120 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П5-3712/0-3', NULL, 4850, NULL, 2300, '2017-11-15 11:44:41', '2017-11-15 11:44:41', NULL, 0, 1, '', '', '', '', '', ''),
(2175, 0, 10, 0, 'plate_bezhevo_zolotogo_cveta_', 'Платье бежево-золотого цвета', NULL, 18, 'Изящное платье прилегающего силуэта из трикотажного полотна бежево-золотого цвета с легким металлическим блеском. V-образный вырез обработан косой бейкой. Платье без рукавов.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия - 103 см.\r\nСостав: Полиэстер 65%, Эластан 5%', 'ВА-П2-3477/2-3', NULL, 3050, NULL, 1400, '2017-11-15 11:57:05', '2017-11-15 11:57:05', NULL, 0, 1, '', '', '', '', '', ''),
(2176, 0, 10, 0, 'ocharovatelnoe_plate_prilegayushego_silueta', 'Очаровательное платье прилегающего силуэта', NULL, 18, 'Очаровательное платье прилегающего силуэта из трикотажного полотна черного цвет. Платье с фигурным вырезом горловины. Втачные рукава выполнены из кружева. Перед изделия дополнен вставками из кружевного полотна. \r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 96 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-П3-2964/6-7', NULL, 4450, NULL, 2100, '2017-11-15 12:04:28', '2017-11-15 12:04:28', NULL, 0, 1, '', '', '', '', '', ''),
(2177, 0, 10, 0, 'plate_serogo_cveta_v_melkuyu_kletku', 'Платье серого цвета в мелкую клетку', NULL, 18, 'Кокетливое платье прямого силуэта из трикотажного полотна серого цвета в мелкую клетку. Круглый вырез горловины обработан внутренней обтачкой. Низ втачных рукавов и перед платья дополнены узкими рюшами. Спинка изделия дополнена V-образным вырезом с завязками.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 95 см.\r\nСостав: 	Вискоза 95%, Эластан 5%', 'ВА-П3-3713/0-1', NULL, 3650, NULL, 1700, '2017-11-15 12:20:09', '2017-11-15 12:20:09', NULL, 0, 1, '', '', '', '', '', ''),
(2178, 0, 10, 0, 'plate_svetlo_serogo_cveta_v_chernyj_goroh', 'Платье светло-серого цвета в черный горох', NULL, 18, 'Женственное платье полуприлегающего силуэта из трикотажного полотна светло-серого цвета в черный «горох». Круглый вырез изделия обработан внутренней обтачкой. Платье с цельнокроеными рукавами. Изделие отрезное по линии талии. Линия талии завышена. Низ платья двойной, верхний слой выполнен из роскошного плиссированного кружева.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —  100 см.\r\nСостав: 	Вискоза 95%, Эластан 5%', 'ВА-П4-3672/4-5', NULL, 4050, NULL, 1900, '2017-11-15 12:28:27', '2017-11-15 12:28:27', NULL, 0, 1, '', '', '', '', '', ''),
(2179, 0, 10, 0, 'chudesnyj_kostyum_iz_bluzy_i_yubki', 'Чудесный костюм из блузы и юбки', NULL, 18, 'Чудесный костюм, состоящий из блузы и юбки.\r\nБлуза свободного силуэта из трикотажного полотна сине-розового цвета с геометрическим узором. Круглый вырез изделия обработан внутренней обтачкой. Низ втачных рукавов со спущенной линией проймы дополнен манжетами. В боковых швах блузы разрезы. Изделие удлинено по спинке. Стильная юбка полуприлегающего силуэта из трикотажного полотна синего цвета. Изделие с высокой посадкой. Верх юбки обработан поясом на резинке и дополнен кулиской с завязками. Снизу в боковых швах изделия разрезы. \r\nАксессуары в комплект не входят.\r\nДлина блузы по спинке от плечевого шва до низа изделия —  63 см. Длина юбки от пояса до низа — 75 см.\r\nСостав: Вискоза 95%, Эластан 5%', 'ВА-К4-3678/6-11', NULL, 4450, NULL, 2100, '2017-11-15 12:41:28', '2017-11-15 12:41:28', NULL, 0, 1, '', '', '', '', '', ''),
(2180, 0, 10, 0, 'plate_serogo_sinego_cveta_s_geometricheskim_risunkom', 'Платье серого-синего цвета с геометрическим рисунком', NULL, 18, 'Стильное платье прямого силуэта из трикотажного полотна серого-синего цвета с геометрическим рисунком. Круглый вырез изделия дополнен воротничком-хомут. Платье отрезное по линии талии, дополнено кулиской на завязках. Изделие с втачными рукавами со спущенной линией проймы.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100 см.', 'ВА-П5-3694/2-3', NULL, 3650, NULL, 1700, '2017-11-15 12:53:54', '2017-11-15 12:53:54', NULL, 0, 1, '', '', '', '', '', ''),
(2181, 0, 10, 0, 'plate_sinego_cveta_s_shirokimi_rukavami', 'Платье синего цвета с широкими рукавами', NULL, 18, 'Чудесное платье полуприлегающего силуэта из трикотажного полотна синего цвета. Круглый вырез изделия обработан внутренней обтачкой. Широкие втачные рукава со спущенной линией проймы по низу дополнены ажурным кружевом и манжетами.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100 см.', 'ВА-П5-3711', NULL, 3650, NULL, 1700, '2017-11-15 12:59:54', '2017-11-15 12:59:54', NULL, 0, 1, '', '', '', '', '', ''),
(2182, 0, 10, 0, 'chudesnoe_plate_a_silueta', 'Чудесное платье А-силуэта', NULL, 18, 'Чудесное платье А-силуэта из трикотажного полотна. Круглый вырез изделия обработан внутренней обтачкой. Платье с втачными рукавами длиной три четверти. Перед изделия украшен кружевом. В боковых швах платья — карманы.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —  95 см.', 'ВА-П4-3605/6-13', NULL, 4050, NULL, 1900, '2017-11-15 13:17:37', '2017-11-19 20:08:36', NULL, 0, 1, '', '', '', '', '', ''),
(2183, 0, 10, 0, 'koketlivoe_plate_a_silueta', 'Кокетливое платье А-силуэта', NULL, 20, 'Кокетливое платье А-силуэта из текстильного хлопкового полотна синего цвета. Круглый вырез изделия обработан внутренней обтачкой. Втачные рукава длиной три четверти по низу дополнен яркой вышивкой. Перед изделия дополнен вышитым декоративным элементом.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия — 100 см.', 'ВА-П4-3605/5', NULL, 3850, NULL, 1800, '2017-11-15 13:28:56', '2017-11-15 13:28:56', NULL, 0, 1, '', '', '', '', '', ''),
(2184, 0, 10, 0, 'stilnaya_bluza_sine_zolotogo_cveta', 'Стильная блуза  сине-золотого цвета', NULL, 18, 'Стильная блуза свободного силуэта из трикотажного полотна сине-золотого цвета. Круглый вырез изделия обработан двусторонней вязаной бейкой синего цвета. Низ цельнокроеных рукавов обработан широкими вязаными манжетами синего цвета. Низ изделия дополнен широким манжетом в технике ручного вязания с узором «косы». На фото блуза представлена с топом М1-2532/1, топ в комплект не входит.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —  80 см.', 'ВА-М4-3449/14-15', NULL, 3450, NULL, 1600, '2017-11-15 13:42:38', '2017-11-15 13:42:38', NULL, 0, 1, '', '', '', '', '', ''),
(2185, 0, 10, 0, 'stilnaya_udlinennaya_rubashka_poluprilegayushego_silueta_', 'Стильная удлиненная рубашка полуприлегающего силуэта', NULL, 18, 'Стильная удлиненная рубашка полуприлегающего силуэта из текстильного  полотна. Круглый вырез изделия обработан отложным воротничком. Втачные рукава обработаны манжетами с застежкой на пуговицу. Перед изделия дополнен планкой с застежкой на пуговицы и по низу дополнен кружевом. В боковых швах блузы разрезы.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа —  85 см.', 'ВА-М5-3714/0-3', NULL, 3250, NULL, 1500, '2017-11-15 13:49:58', '2017-11-15 13:49:58', NULL, 0, 1, '', '', '', '', '', ''),
(2186, 0, 10, 0, 'udobnaya_tunika_imitiruyushego_kozhu', 'Удобная туника имитирующего кожу', NULL, 18, 'Удобная туника из полотна, имитирующего кожу . Круглый вырез изделия обработан окантовкой. Рукава-реглан по низу обработаны манжетом с застежкой на пуговицу. Рукава выполнены из трикотажного полотна. В боковых швах блузы втачные карманы. По низу изделия разрезы.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа — 75 см.', 'ВА-М5-3715/1-5', NULL, 3650, NULL, 1700, '2017-11-15 14:01:11', '2017-11-15 14:01:11', NULL, 0, 1, '', '', '', '', '', ''),
(2187, 0, 10, 0, 'roskoshnyj_zhaket_temno_sinego_cveta', 'Роскошный жакет темно-синего цвета', NULL, 18, 'Роскошный жакет полуприлегающего силуэта, выполненный из трикотажного полотна темно-синего цвета. Круглый вырез жакета обработан внутренней обтачкой. Перед жакета выполнен из жаккарда и дополнен  планкой с застежкой на пуговицы и декоративными элементами.\r\nАксессуары в комплект не входят. \r\nДлина изделия по спинке от плечевого шва до низа изделия — 60 см.\r\nСостав: Вискоза 95%, Эластан 5%\r\n', 'ВА-М4-3212/10-11', NULL, 3250, NULL, 1500, '2017-11-15 14:09:56', '2017-11-15 14:09:56', NULL, 0, 1, '', '', '', '', '', ''),
(2188, 0, 10, 0, 'tunika_s_krupnymi_pugovicami_v_retro_stile', 'Туника с крупными пуговицами в ретро стиле', NULL, 18, 'Романтичная туника прямого силуэта из трикотажного полотна сине-белого цвета. Круглый вырез изделия обработан обтачкой. Перед дополнен крупными пуговицами в ретро стиле. Туника со спущенной линией проймы и втачными рукавами.\r\nВ боковых швах изделия — разрезы.\r\nАксессуары в комплект не входят.\r\nДлина изделия по спинке от плечевого шва до низа изделия —80 см.\r\nСостав: Полиэстер 95%, Эластан 5%', 'ВА-М4-3416/4-7', NULL, 2850, NULL, 1300, '2017-11-15 14:20:52', '2017-11-15 14:20:52', NULL, 0, 1, '', '', '', '', '', ''),
(2189, 0, 9, 0, 'plotnyj_dzhemper_iz_polusherstyanoj_pryazhi', 'Плотный  джемпер из полушерстяной пряжи', NULL, 12, 'Состав: шерсть 50%, акрил 50%\r\nПлотный  удлиненный джемпер из полушерстяной пряжи. Рукава удлиненные на цельновязанном манжете. Вырез горловины овальный,оформлен резинкой "в рубчик". Спинка длиннее переда. Длина изделия по спинке около 73 см (44 р), около 74 см (48 р).', 'ФЛА-9192', NULL, 3750, NULL, 1750, '2017-11-15 14:30:28', '2017-11-15 14:30:28', NULL, 0, 1, '', '', '', '', '', ''),
(2190, 0, 10, 0, 'ocharovatelnyj_obodok_s_ushkami', 'Очаровательный ободок с ушками', NULL, 9, 'Очаровательный ободок с ушками выполнен из пластика, украшен жемчужинками и сверкающими стразами.\r\nОбодки с ушками прекрасно подойдут для вечеринки, похода в ночной клуб, маскарадного вечера.\r\nСостав: Пластик, текстиль, бусины.', 'ВА-О-55/30', NULL, 670, NULL, 210, '2017-11-15 14:58:43', '2017-11-15 14:58:43', NULL, 0, 1, '', '', '', '', '', ''),
(2191, 0, 10, 0, 'simpatichnyj_obodok_s_ushkami', 'Симпатичный ободок с ушками', NULL, 9, 'Симпатичный ободок с ушками выполнен из пластика, украшен кружевом, ажурной тесьмой и бусинками.\r\nОбодки с ушками прекрасно подойдут для вечеринки, похода в ночной клуб, маскарадного вечера.\r\nСостав: Пластик, текстиль.', 'ВА-О-55/29', NULL, 750, NULL, 250, '2017-11-15 15:01:39', '2017-11-15 15:01:39', NULL, 0, 1, '', '', '', '', '', ''),
(2192, 0, 9, 0, 'bluza_pryamogo_silueta_iz_pajetochnogo_trikotazha', 'Блуза прямого силуэта из пайеточного трикотажа', NULL, 12, 'Состав: полиэстер 100%\r\n• Длина рукава: короткие, втачной\r\n• Тип горловины: округлый\r\n• Линия плеча: на естественном месте\r\n• Длина изделия: 51см\r\n• Застежка: нет\r\n• Карманы: нет\r\n• Особенности: Блуза прямого силуэта из пайеточного трикотажа.', 'ФЛА-272-11', NULL, 2910, NULL, 1330, '2017-11-16 11:28:49', '2017-11-16 11:28:49', NULL, 0, 1, '', '', '', '', '', ''),
