(2232, 0, 10, 0, 'braslet_chasy_iz_iskusstvennoj_kozhi', 'Браслет - часы из искусственной кожи', NULL, 9, 'Кожаные браслеты остаются по-прежнему актуальными, они уже в течение нескольких лет подряд уверенно занимают лидирующие позиции среди модной бижутерии.\r\nБраслет - часы выполнен из искусственной кожи. Металл серебряного цвета.\r\nОборачивается 2 раза вокруг запястья.\r\nДиаметр циферблата 3 см. Длина: 39 см.', 'ВА-Бс-23/49-50', NULL, 1290, NULL, 520, '2017-11-20 13:20:29', '2017-11-20 13:20:29', NULL, 0, 1, '', '', '', '', '', ''),
