(2240, 0, 9, 0, 'vyazanaya_vodolazka_prilegayushego_silueta', 'Вязаная водолазка прилегающего силуэта', NULL, 12, 'Вязаная водолазка прилегающего силуэта из смесовой пряжи с содержанием хлопка и шерсти. Изделие выполнено комбинированной вязкой. Вырез горловины оформлен отлажным воротником "стойка" с разрезом, создающим асимметричный эффект. Воротник и манжеты рукавов оформлены резинкой в рубчик. Спинка длиннее переда на 5 см. Длина изделия по спинке около 67 см (44 р.),  70 см (48 р.)\r\nСостав: акрил 50%, шерсть 25%, хлопок 25%', 'ФЛА-9217', NULL, 2750, NULL, 1250, '2017-11-21 14:13:41', '2017-11-21 14:13:41', NULL, 0, 1, '', '', '', '', '', ''),
(2241, 0, 9, 0, 'vyazanaya_yubka_midi_pryamogo_silueta', 'Вязаная юбка - миди прямого силуэта', NULL, 12, 'Состав: акрил 50%, шерсть 25%, хлопок 25%\r\nВязаная юбка - миди,  прямого силуэта выполнена фактурной вязкой из смесовой пряжи с содержанием хлопка и шерсти. Спинка длиннее переда на 11 см. Длина изделия по спинке около 83 см (44, 48 р.)', 'ФЛА-9216', NULL, 2790, NULL, 1270, '2017-11-21 14:25:34', '2017-11-21 14:25:34', NULL, 0, 1, '', '', '', '', '', ''),
(2242, 0, 10, 0, 'remen_so_vstavkoj_iz_reziny_i_bahromy_', 'Ремень со вставкой из резины и бахромы', NULL, 9, 'Ремень выполнен из искусственной кожи со вставкой из резины шириной 6 см. Декорирован бахромой длиной 14 см. \r\nМеталлическая пряжка на 2 прокола  цвета матового серебра 5,5 см х 4 см.\r\nДлина ремня 89 см.', 'ВА-Р-21', NULL, 830, NULL, 290, '2017-11-21 14:33:51', '2017-11-21 14:33:51', NULL, 0, 1, '', '', '', '', '', ''),
(2243, 0, 10, 0, 'oslepitelnyj_komplekt_iz_metalla_zolotogo_cveta', 'Ослепительный комплект из металла золотого цвета', NULL, 9, 'Ослепительный комплект выполнен из металла золотого цвета и украшен прозрачными стразами и кристаллами.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина: 40см + 5 см. Длина сережек 4,5 см.', 'ВА-К-760/57', NULL, 1810, NULL, 780, '2017-11-21 14:38:02', '2017-11-21 14:38:02', NULL, 0, 1, '', '', '', '', '', ''),
(2244, 0, 10, 0, 'komplekt_so_strazami_i_kristallami_temnogo_sinego_cveta', 'Комплект со  стразами и кристаллами темного синего цвета', NULL, 9, 'Благородный  комплект выполнен из металла золотого цвета и украшен стразами и кристаллами темного синего цвета.\r\nКачественный бижутерный сплав без содержания никеля.\r\nДлина: 48 см + 6 см. Длина сережек 6 см.', 'ВА-К-760/58', NULL, 1690, NULL, 720, '2017-11-21 14:41:43', '2017-11-21 14:41:43', NULL, 0, 1, '', '', '', '', '', ''),
