(2254, 0, 10, 0, 'modnyj_podves_na_shnurke_iz_metallicheskoj_cepochki', 'Модный подвес на шнурке из металлической цепочки', NULL, 9, 'Стильный модный подвес на шнурке из металлической цепочки. Кулон в виде текстильных лент украшен кольцами и бусинами. \r\nПримерьте его с белой рубашкой и подтяжками!\r\nДлина цепочки 76 см. см. Длина кулона 14 см.', 'ВА-П-25/1', NULL, 1070, NULL, 410, '2017-11-23 12:20:43', '2017-11-23 12:20:43', NULL, 0, 1, '', '', '', '', '', ''),
