(2256, 0, 10, 0, 'busy_iz_bisera_i_granennyh_busin', 'Бусы из бисера и граненных бусин', NULL, 9, 'Классические бусы черного цвета выполнены из бисера и граненных бусин .\r\nДлина 40 см + 5 см.', 'ВА-Бу-650/27', NULL, 1210, NULL, 480, '2017-11-23 13:01:37', '2017-11-23 13:01:37', NULL, 0, 1, '', '', '', '', '', ''),
