(2258, 0, 10, 0, 'klassicheskie_busy_cepochki_chernogo_cveta', 'Классические бусы - цепочки черного цвета', NULL, 9, 'Классические бусы - цепочки выполнены из металла черного цвета, украшены сверкающими гранеными бусинками.\r\nДлина 90 см.', 'ВА-Бу-611/46', NULL, 890, NULL, 320, '2017-11-23 13:30:23', '2017-11-23 13:30:23', NULL, 0, 1, '', '', '', '', '', ''),
