(2260, 0, 10, 0, 'podves_iz_matovyh_i_blestyashih_busin_raznogo_cveta', 'Подвес из матовых и блестящих бусин разного цвета', NULL, 9, 'Эффектный подвес из матовых и блестящих бусин разного цвета и формы. Подвеска с кисточкой из цепочки украшена сияющим кристаллом и стразинками. \r\nЦепочка черная с золотом. Бусины синего, черного и золотого цвета.\r\nДлина цепочки 70 см. Длина кулона 12', 'ВА-П-24/98', NULL, 1270, NULL, 510, '2017-11-23 13:40:26', '2017-11-23 13:40:26', NULL, 0, 1, '', '', '', '', '', ''),
(2261, 0, 10, 0, 'stilnye_busy_na_metallicheskih_cepochkah_', 'Стильные бусы на металлических цепочках', NULL, 9, 'Красивые бусы  в виде крупных жемчужных бусин  на тонких металлических цепочках серебряного и золотого цвета.\r\nДлина цепочек 88 см  + 5 см. Диаметр бусин 2,5 см.', 'ВА-П-24/96-97', NULL, 1270, NULL, 510, '2017-11-23 13:47:15', '2017-11-23 13:47:15', NULL, 0, 1, '', '', '', '', '', ''),
(2262, 0, 10, 0, 'busy_v_vide_krupnyh_busin_na_tonkih_cepochkah', 'Бусы в виде крупных бусин на тонких  цепочках', NULL, 9, 'Бусы в виде крупных бусин на тонких металлических цепочках разной длины. Цвет серебро и черный.\r\nДлина цепочек 50 см - 88 см  + 5 см. Диаметр бусин 2,5 см.', 'ВА-П-24/95', NULL, 1270, NULL, 510, '2017-11-23 14:00:28', '2017-11-23 14:00:28', NULL, 0, 1, '', '', '', '', '', ''),
(2263, 0, 10, 0, 'busy_na_cepochkah_raznoj_dliny', 'Бусы на цепочках разной длины', NULL, 9, 'Бусы в виде крупных бусин на тонких металлических цепочках разной длины. Один ряд цепочки - в виде дорожки из сверкающих страз. Цвет серебро и черный.\r\nДлина цепочек 56 см и 88 см  + 5 см. Диаметр бусин 3,5 см.', 'ВА-П-24/94', NULL, 1270, NULL, 510, '2017-11-23 14:05:21', '2017-11-23 14:05:21', NULL, 0, 1, '', '', '', '', '', ''),
(2264, 0, 10, 0, 'podves_v_vide_zvezd_so_strazami', 'Подвес в виде звезд со стразами', NULL, 9, 'Популярный подвес в виде звезд, украшенных стразами, выполнен из металла серебряноо цвета. \r\nДлина цепочки 70 см.', 'ВА-П-24/93', NULL, 970, NULL, 360, '2017-11-23 14:10:15', '2017-11-23 14:10:15', NULL, 0, 1, '', '', '', '', '', ''),
(2265, 0, 10, 0, 'kole_s_chernymi_matovymi_businami', 'Колье с черными матовыми бусинами', NULL, 9, 'Стильное колье можно носить с чем угодно. Это украшение станет идеальным дополнением как делового образа, так и городского casual, \r\nМеталлическая цепь золотого цвета, вставка из матовых черных бусин.\r\nДлина 44 см.', 'ВА-П-85/6', NULL, 1270, NULL, 510, '2017-11-23 14:13:54', '2017-11-23 14:13:54', NULL, 0, 1, '', '', '', '', '', ''),
(2266, 0, 10, 0, 'stilnoe_kole_s_krupnymi_businami', 'Стильное колье с крупными бусинами', NULL, 9, 'Стильное колье можно носить с чем угодно. Это украшение станет идеальным дополнением как делового образа, так и городского casual, \r\nМатовая металлическая цепь черного цвета, вставка из крупных золотых бусин.\r\nДлина 44 см.\r\n', 'ВА-П-85/5', NULL, 1270, NULL, 510, '2017-11-23 14:20:14', '2017-11-23 14:20:14', NULL, 0, 1, '', '', '', '', '', ''),
(2267, 0, 10, 0, 'kole_cveta_temnogo_serebra', 'Колье цвета темного серебра', NULL, 9, 'Стильное колье можно носить с чем угодно. Это украшение станет идеальным дополнением как делового образа, так и городского casual, \r\nМеталл цвета темного серебра.\r\nДлина 44 см.', 'ВА-П-85/4', NULL, 1270, NULL, 510, '2017-11-23 14:23:20', '2017-11-23 14:23:20', NULL, 0, 1, '', '', '', '', '', ''),
(2268, 0, 10, 0, 'stilnoe_kole_s_massivnoj_vstavkoj_', 'Стильное колье с массивной вставкой', NULL, 9, 'Стильное колье можно носить с чем угодно. Это украшение станет идеальным дополнением как делового образа, так и городского casual, \r\nМеталл цвета темного серебра, массивная вставка покрыта эмалью. Длина 44 см.', 'ВА-П-85/1-3', NULL, 1270, NULL, 510, '2017-11-23 14:30:48', '2017-11-23 14:30:48', NULL, 0, 1, '', '', '', '', '', ''),
(2269, 0, 10, 0, 'kole_glubokogo_sinego_cveta', 'Колье глубокого синего цвета', NULL, 9, 'Завораживающее ожерелье привлечет внимание сверканием кристаллов глубокого синего цвета. Металлическая оправа из металла серебряного цвета украшена сияющими прозрачными стразами. Это восхитительное украшение идеально подходит для особых случаев.', 'ВА-П-84/96', NULL, 1070, NULL, 410, '2017-11-23 14:38:32', '2017-11-23 14:38:32', NULL, 0, 1, '', '', '', '', '', ''),
(2270, 0, 10, 0, 'busy_s_imitaciej_lunnogo_kamnya', 'Бусы с имитацией лунного камня', NULL, 9, 'Женственный подвес на текстильном шнурке украшен декоративными элементами, имитацией лунного камня. Привлекательности добавляют стразы и металл золотого цвета.\r\nДлина 42 см + 5 см. Размер центрального элемента 3,5 см х 2,5 см.', 'ВА-П-84/92', NULL, 1050, NULL, 400, '2017-11-23 14:51:43', '2017-11-23 14:51:43', NULL, 0, 1, '', '', '', '', '', ''),
(2271, 0, 10, 0, 'snud_iz_nabivnogo_shifona_izumrudnogo_cveta', 'Снуд из набивного шифона изумрудного цвета', NULL, 9, 'Поиграйте с разными фактурами! Дополните любимое пальто или кожаную куртку ярким снудом. Аксессуар из набивного шифона подбит мягким трикотажным полотном изумрудного цвета. Брошь поможет закрепить снуд на плечах.\r\nАксессуары в комплект не входят.\r\nДлина 73 см, ширина 57 см.', 'ВА-Сн-2/68', NULL, 1290, NULL, 520, '2017-11-24 11:19:28', '2017-11-24 11:19:28', NULL, 0, 1, '', '', '', '', '', ''),
(2272, 0, 10, 0, 'snud_iz_nezhnogo_shelkovistogo_shifona', 'Снуд из нежного шелковистого шифона', NULL, 9, 'Стилизованный сложный принт в сиреневых, бордовых, серых и горчичных цветах. Снуд из нежного шелковистого шифона подбит тонким трикотажным полотном серого цвета. Изделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 72 см, ширина 60 см. Брошь поможет закрепить снуд на плечах. Асессуары в комплект не входят.', 'ВА-Сн-2/90', NULL, 1290, NULL, 520, '2017-11-24 11:26:28', '2017-11-24 11:26:28', NULL, 0, 1, '', '', '', '', '', ''),
(2273, 0, 10, 0, 'snud_cveta_kofe_s_molokom', 'Снуд цвета кофе с молоком', NULL, 9, 'Элегантный снуд подбит нежным шифоном, кружевной и в горошек принт на фоне цвета кофе с молоком. Вторая сторона - вискозное трикотажное полотно черного цвета.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем.  Длина 70 см, ширина 61 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАксессуары в комплект не входят.', 'ВА-Сн-2/87', NULL, 1290, NULL, 520, '2017-11-24 11:32:55', '2017-11-24 11:32:55', NULL, 0, 1, '', '', '', '', '', ''),
(2274, 0, 10, 0, 'krasivyj_snud_cvetnoj_rascvetki', 'Красивый снуд  цветной расцветки', NULL, 9, 'Красивый снуд подбит нежным шифоном, цветовая гамма которого переходит от фиолетового в терракот.\r\nИзделие отлично дополнит Ваш образ с пальто, пуховиком или шубкой. Длина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах. Аксессуары в комплект не входят.', 'ВА-Сн-2/88', NULL, 1290, NULL, 520, '2017-11-24 11:40:39', '2017-11-24 11:40:39', NULL, 0, 1, '', '', '', '', '', ''),
(2275, 0, 10, 0, 'snud_s_rozami_na_chernom_fone', 'Снуд с розами на черном фоне', NULL, 9, 'Очаровательный снуд из шелка с чудесными розами на черном фоне. Вторая сторона  - вискозное трикотажное полотно в тон шелка, украшенное крошечными металлическими стразинками золотого цвета. Изделие отлично дополнит Ваш образ с классическим пальто или шубкой. \r\nДлина 68 см, ширина 58 см. Брошь поможет закрепить снуд на плечах.\r\nАксессуары в комплект не входят.', 'ВА-Сн-2/85', NULL, 1290, NULL, 520, '2017-11-24 11:50:23', '2017-11-24 11:50:23', NULL, 0, 1, '', '', '', '', '', ''),
(2276, 0, 10, 0, 'chudesnyj_snud_sinego_cveta_s_cvetochnym_printom', 'Чудесный снуд синего цвета с  цветочным принтом', NULL, 9, 'Чудесный снуд из трикотажного полотна темного синего цвета с  цветочным принтом. Вторая сторона  - вискозное трикотажное полотно синего цвета. Изделие отлично дополнит Ваш образ с классическим пальто или шубкой. \r\nДлина 70 см, ширина 60 см. Брошь поможет закрепить снуд на плечах.  Аксессуары в комплект не входят.', 'ВА-Сн-2/80', NULL, 1050, NULL, 400, '2017-11-24 12:04:09', '2017-11-24 12:04:09', NULL, 0, 1, '', '', '', '', '', ''),
(2277, 0, 10, 0, 'snud_v_krasno_chernoj_cvetovoj_gamme', 'Снуд в красно - черной цветовой гамме', NULL, 9, 'Топовый снуд в красно - черной цветовой гамме.\r\nИзделие отлично дополнит Ваш образ с классическим пальто или шубкой.  Длина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАксессуары в комплект не входят.', 'ВА-Сн-2/86', NULL, 1050, NULL, 400, '2017-11-24 12:08:48', '2017-11-24 12:08:48', NULL, 0, 1, '', '', '', '', '', ''),
(2278, 0, 10, 0, 'ssnud_s_belymi_zavitkami_na_sinem_fone', 'Сснуд с белыми завитками на синем фоне', NULL, 9, 'Дивный снуд с белыми завитками на темном синем фоне выполнен из вискозного трикотажного полотна.    \r\nДлина 70 см, ширина 60 см. Брошь поможет закрепить снуд на плечах. Асессуары в комплект не входят.', 'ВА-Сн-2/83', NULL, 1290, NULL, 520, '2017-11-24 12:14:30', '2017-11-24 12:14:30', NULL, 0, 1, '', '', '', '', '', ''),
(2279, 0, 10, 0, 'klassicheskij_snud_temnogo_sinego_cveta', 'Классический снуд темного синего цвета', NULL, 9, 'Классический снуд из вискозного трикотажного полотна темного синего цвета скомбинирован с клеткой рыжего и синего цветов.  \r\nДлина 72 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАксессуары в комплект не входят.', 'ВА-Сн-2/81', NULL, 1290, NULL, 520, '2017-11-24 12:20:54', '2017-11-24 12:20:54', NULL, 0, 1, '', '', '', '', '', ''),
(2280, 0, 10, 0, 'dvustoronnij_snud_iz_shifona_s_melkim_risunkom', 'Двусторонний снуд из шифона с мелким рисунком', NULL, 9, 'Двусторонний снуд выполнен из шифона с классическим мелким рисунком из трикотажного полотна. Вторая сторона в тон цветочкам - красивого коричневого цвета. \r\nИзделие отлично дополнит Ваш образ с классическим пальто или шубкой.  Длина 72 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАксессуары в комплект не входят.', 'ВА-Сн-2/77-78', NULL, 1290, NULL, 520, '2017-11-24 12:33:23', '2017-11-24 12:33:23', NULL, 0, 1, '', '', '', '', '', ''),
(2281, 0, 10, 0, 'ssnud_iz_shelka_so_stilizovannym_cvetochnym_printom_', 'Сснуд из шелка со стилизованным цветочным принтом', NULL, 9, 'Оригинальный снуд из шелка со стилизованным цветочным принтом на черном фоне. Вторая сторона  - вискозное трикотажное полотно черного цвета Изделие отлично дополнит Ваш образ с классическим пальто или шубкой. \r\nДлина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАксессуары в комплект не входят.', 'ВА-Сн-2/79', NULL, 1290, NULL, 520, '2017-11-24 12:38:30', '2017-11-24 12:38:30', NULL, 0, 1, '', '', '', '', '', ''),
(2282, 0, 10, 0, 'snud_s_cvetochnym_printom_na_bordovom_fone', 'Снуд с  цветочным принтом на бордовом фоне', NULL, 9, 'Очаровательный снуд из шелка с чудесным цветочным принтом на бордовом фоне. Вторая сторона  - вискозное трикотажное полотно в тон шелка, украшенное крошечными металлическими стразинками золотого цвета. Изделие отлично дополнит Ваш образ с классическим пальто или шубкой. \r\nДлина 68 см, ширина 58 см. Брошь поможет закрепить снуд на плечах.\r\nАксессуары в комплект не входят.', 'ВА-Сн-2/76', NULL, 1290, NULL, 520, '2017-11-24 12:45:01', '2017-11-24 12:45:01', NULL, 0, 1, '', '', '', '', '', ''),
(2283, 0, 10, 0, 'snud_iz_shelka_s_cvetochnym_printom_na_bordovom_fone', 'Снуд из шелка с  цветочным принтом на бордовом фоне', NULL, 9, 'Переливающийся бархат жемчужно - серого цвета выглядит благородно и женственно. Снуд подбит шелком с чудесным цветочным принтом на бордовом фоне. Цветы серого цвета гармонично сочетаются с цветом бархата. Изделие отлично дополнит Ваш образ с классическим пальто или шубкой. \r\nДлина 68 см, ширина 58 см.\r\nБрошь поможет закрепить снуд на плечах. Аксессуары в комплект не входят.', 'ВА-Сн-2/75', NULL, 1290, NULL, 520, '2017-11-24 12:56:36', '2017-11-24 12:56:36', NULL, 0, 1, '', '', '', '', '', ''),
(2284, 0, 10, 0, 'snud_iz_nezhnogo_shifona_s_tyulpanami', 'Снуд из нежного шифона с тюльпанами', NULL, 9, 'Восхитительный аксессуар - снуд из нежного шифона с чудесными тюльпанами. Двусторонний снуд подбит трикотажным полотном серого цвета.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 72 см, ширина 58 см. Брошь поможет закрепить снуд на плечах. Аксессуары в комплект не входят.', 'ВА-Сн-2/67', NULL, 1290, NULL, 520, '2017-11-24 13:03:21', '2017-11-24 13:03:21', NULL, 0, 1, '', '', '', '', '', ''),
(2285, 0, 10, 0, 'snud_s_cvetochnym_prinom_v_biryuzovyh_i_sirenevyh_tonah', 'Снуд с цветочным прином в бирюзовых и сиреневых тонах', NULL, 9, 'Восхитительный аксессуар - снуд из нежного шифона с чудесным цветочным прином в бирюзовых и сиреневых тонах.  Двусторонний снуд подбит тонким трикотажным полотном сиреневого цвета.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 72 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах. Аксессуары в комплект не входят.', 'ВА-Сн-2/62', NULL, 1290, NULL, 520, '2017-11-24 13:12:58', '2017-11-24 13:12:58', NULL, 0, 1, '', '', '', '', '', ''),
(2286, 0, 10, 0, 'snud_sero_bezhevyh_ottenkah_s_cvetochnym_printom', 'Снуд серо - бежевых оттенках с цветочным принтом', NULL, 9, 'Потрясающий аксессуар - двусторонний снуд из шифона в нежных серо - бежевых оттенках с цветочным принтом. Снуд подбит трикотажным вискозным полотном серого цвета.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем нейтральных цветов. Длина 73 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.Аксессуары в комплект не входят.', 'ВА-Сн-2/58', NULL, 1290, NULL, 520, '2017-11-24 13:34:31', '2017-11-24 13:34:31', NULL, 0, 1, '', '', '', '', '', ''),
(2287, 0, 10, 0, 'snud_rozovo_korichnevogo_cveta', 'Снуд розово - коричневого цвета', NULL, 9, 'Стилизованный сложный принт в сиреневых, бордовых, серых и горчичных цветах. Снуд из нежного шелковистого шифона подбит тонким трикотажным полотном розово - коричневого цвета. Изделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 72 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах.\r\nАсессуары в комплект не входят.', 'ВА-Сн-2/65', NULL, 1290, NULL, 520, '2017-11-24 13:46:25', '2017-11-24 13:46:25', NULL, 0, 1, '', '', '', '', '', ''),
(2288, 0, 10, 0, 'stilnyj_snud_s_printom_barberry', 'Стильный снуд с  принтом Barberry', NULL, 9, 'Клетчатый принт Barberry придает Вашему образу элегантность. \r\nНежный на ощупь, полупрозрачный шифон струится и чудесно ложится складками. Двусторонний снуд подбит тонким трикотажным полотном розово - коричневого цвета. Изделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Большой размер позволяет накинуть его на голову или красиво повязать вокруг шеи. \r\nДлина 75 см, ширина 60 см. Брошь поможет закрепить снуд на плечах. Аксессуары в комплект не входят.', 'ВА-Сн-2/63', NULL, 1290, NULL, 520, '2017-11-24 13:52:36', '2017-11-24 13:52:36', NULL, 0, 1, '', '', '', '', '', ''),
(2289, 0, 10, 0, 'snud_s_yablochnym_printom_na_serom_fone', 'Снуд с яблочным принтом на сером фоне', NULL, 9, 'Эффектный палантин сделает Ваш образ незабываемым. Брендовый яблочный принт на сером фоне. Снуд подбит тонким трикотажным вискозным полотном серого цвета.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем нейтральных цветов.\r\nДлина 73 см, ширина 60 см. Брошь поможет закрепить снуд на плечах. Аксессуары в комплект не входят.', 'ВА-Сн-2/57', NULL, 1290, NULL, 520, '2017-11-24 13:57:27', '2017-11-24 13:57:27', NULL, 0, 1, '', '', '', '', '', ''),
(2290, 0, 10, 0, 'legkij_snud_vypolnen_iz_nezhnogo_shifona', 'Легкий снуд выполнен из нежного шифона', NULL, 9, 'Легкий снуд выполнен из нежного шифона . На черном фоне цветочный принт. Снуд подбит трикотажным вискозным полотном пыльного розово - сиреневого цвета.\r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем нейтральных цветов.\r\nДлина 73 см, ширина 60 см. Брошь поможет закрепить снуд на плечах. Аксессуары в комплект не входят.', 'ВА-Сн-2/59', NULL, 1290, NULL, 520, '2017-11-24 14:01:38', '2017-11-24 14:01:38', NULL, 0, 1, '', '', '', '', '', ''),
(2291, 0, 10, 0, 'snud_temnogo_sinego_cveta_s_ogurechnym_printom', 'Снуд темного синего цвета  с "огуречным" принтом', NULL, 9, 'Популярный аксессуар - двусторонний снуд выполнен из плотного трикотажного полотна темного синего цвета и нежного шифона с "огуречным" принтом. \r\nИзделие отлично дополнит Ваш образ с пальто, кожаной курткой или платьем. Длина 70 см, ширина 60 см.\r\nБрошь поможет закрепить снуд на плечах. Аксессуары в комплект не входят.\r\n', 'ВА-Сн-2/61', NULL, 1050, NULL, 400, '2017-11-24 14:06:42', '2017-11-24 14:06:42', NULL, 0, 1, '', '', '', '', '', ''),
(2292, 0, 9, 0, 'ob_emnyj_vyazanyj_sviter_svobodnogo_silueta', 'Объемный вязаный свитер свободного силуэта', NULL, 12, 'Объемный вязаный свитер свободного мягкого силуэта выполнен фактурной вязкой из полушерстяной пряжи. Вырез горловины  оформлен отложным воротником "стойка" с разрезом, создающим асимметричный эффект. Рукав со спущенной проймой по низу оформлен широкой цельно вязаной манжетой. Спинка длиннее переда на 9 см. Длина изделия по спинке около 72 см (44, 48 р.)', 'ФЛА-9220', NULL, 3030, NULL, 1390, '2017-11-27 12:24:27', '2017-11-27 12:24:27', NULL, 0, 1, '', '', '', '', '', ''),
(2293, 0, 9, 0, 'molodezhnaya_plate_iz_trikotazhnogo_zhakkarda', 'Молодежная платье из трикотажного жаккарда', NULL, 12, 'Молодежная платье из трикотажного жаккарда. Будь модной вместе с нами.\r\nСостав: полиэстер 90%, эластан 10%\r\n', 'ФЛА-181-10', NULL, 3950, NULL, 1850, '2017-11-27 12:47:08', '2017-11-27 12:47:08', NULL, 0, 1, '', '', '', '', '', ''),
(2294, 0, 8, 0, 'modnyj_dzhemper_s_rukavami_iz_ekomeha', 'Модный джемпер с рукавами из экомеха', NULL, 10, 'Модный джемпер с рукавами из экомеха. Женская мода на прохладную осень. Будь модной вместе с нами.', 'СДЖ-5', NULL, 2150, NULL, 950, '2017-11-27 15:55:08', '2017-11-27 15:55:08', NULL, 0, 1, '', '', '', '', '', ''),
(2295, 0, 8, 0, 'molodezhnaya_vyazanaya_tunika_s_vyrezom', 'Молодежная вязаная туника с вырезом', NULL, 10, 'Молодежная вязаная туника с вырезом. Вязаные туники модницы ценят за их удобство и оригинальность. ', 'СТУ-1', NULL, 3250, NULL, 1500, '2017-11-27 16:07:50', '2017-11-27 16:07:50', NULL, 0, 1, '', '', '', '', '', ''),
(2296, 0, 8, 0, 'nezhnoe_zhenstvennoe_plate_iz_shifona', 'Нежное женственное платье из шифона', NULL, 10, 'Нежное женственное платье из шифона. Женственное шифоновое платье, создающее романтический образ. ', 'СПЛ-22', NULL, 2850, NULL, 1300, '2017-11-27 17:08:00', '2017-11-27 17:08:00', NULL, 0, 1, '', '', '', '', '', ''),
(2297, 0, 8, 0, 'elegantnoe_plate_s_otkrytymi_plechami', 'Элегантное платье с открытыми плечами', NULL, 10, 'Элегантное платье с открытыми плечами. Платье с открытыми плечами всегда притягательно и женственно. ', 'СПЛ-23', NULL, 2450, NULL, 1100, '2017-11-27 17:13:56', '2017-11-27 17:13:56', NULL, 0, 1, '', '', '', '', '', ''),
(2298, 0, 8, 0, 'prazdnichnoe_plate_na_bretelyah', 'Праздничное платье на бретелях', NULL, 10, 'Праздничное платье на бретелях. Вечернее платье – это особый вид одежды. Будь модной вместе с нами.', 'СПЛ-24', NULL, 3050, NULL, 1400, '2017-11-27 17:24:45', '2017-11-27 17:24:45', NULL, 0, 1, '', '', '', '', '', ''),
(2299, 0, 8, 0, 'stilnoe_plate_s_dekorativnoj_shnurovkoj', 'Стильное платье с декоративной шнуровкой', NULL, 10, 'Стильное платье с декоративной шнуровкой.  Модное женское платье  отлично сидит по фигуре', 'СПЛ-25', NULL, 3650, NULL, 1700, '2017-11-27 17:31:50', '2017-11-27 17:31:50', NULL, 0, 1, '', '', '', '', '', ''),
(2300, 0, 8, 0, 'yarkoe_plate_dlya_prazdnika', 'Яркое платье для праздника', NULL, 10, 'Яркое платье для праздника. В этом платье Вы не останетесь не замеченной.', 'СПЛ-26', NULL, 3250, NULL, 1500, '2017-11-27 17:37:03', '2017-11-27 17:37:03', NULL, 0, 1, '', '', '', '', '', ''),
(2301, 0, 8, 0, 'naryadnyj_yubochnyj_komplekt_s_ukorochennoj_koftoj', 'Нарядный юбочный комплект с укороченной кофтой', NULL, 10, 'Нарядный юбочный комплект с укороченной кофтой. Стильный комплект,состоящий из юбки и топа.', 'СЮК-7', NULL, 3850, NULL, 1800, '2017-11-27 17:46:24', '2017-11-27 17:46:24', NULL, 0, 1, '', '', '', '', '', ''),
(2302, 0, 9, 0, 'molodezhnoe_plate_midi_iz_trikotazha_', 'Молодежное платье миди из трикотажа', NULL, 10, 'Молодежное платье миди из трикотажа. Прозрачные рукава прекрасно дополняют платье.\r\nСостав: полиэстер 97%, эластан 3%', 'ФЛА-177', NULL, 3550, NULL, 1650, '2017-11-29 11:09:14', '2017-11-29 11:09:14', NULL, 0, 1, '', '', '', '', '', ''),
(2303, 0, 9, 0, 'plate_a_obraznogo_silueta_iz_plotnogo_trikotazha', 'Платье А-образного силуэта из плотного трикотажа', NULL, 10, 'Платье А-образного силуэта из плотного трикотажа.\r\nСостав: вискоза 95%, эластан 5%\r\n• Длина рукава: короткие, втачной\r\n• Тип горловины: округлый\r\n• Линия плеча: на естественном месте\r\n• Длина изделия: по спинке около 82 см (44 р.), 88 см (50 р.)\r\n• Карманы: накладные\r\n• Застежка: нет\r\n• Особенности: Платье А-образного силуэта из плотного трикотажа. Детали: накладные карманы полукруглой формы, горловина обработана обтачкой, рукав втачной длиной до локтя. Без застежки.', 'ФЛА-706.1', NULL, 3030, NULL, 1390, '2017-11-29 11:15:34', '2017-11-29 11:15:34', NULL, 0, 1, '', '', '', '', '', ''),
(2304, 0, 9, 0, 'vyazanyj_dvuhcvetnyj_sviter_poluprilegayushego_silueta', 'Вязаный двухцветный свитер полуприлегающего силуэта', NULL, 12, 'Вязаный двухцветный свитер полуприлегающего силуэта в стиле «color blocking». Вырез горловины оформлен воротником "стойка". Рукава, воротник и низ изделия оформлены резинкой в крупный рубчик. Длина изделия по спинке около 64 см (44 р.), 67 см (48 р.)', 'ФЛА-9222', NULL, 2710, NULL, 1230, '2017-11-29 11:26:59', '2017-11-29 11:26:59', NULL, 0, 1, '', '', '', '', '', '');
