(19, 'tablica_razmerov', 'Таблица размеров', '3', '<h1>Как выбрать размер</h1>\r\n<p>Правильный подбор размера платья или комплекта является залогом не только приятной покупки, но и гарантом того, что выбранный наряд будет носиться долго и с удовольствием. Данное условие особенно важно, если наряд приобретается на праздничное событие, поэтому при выборе нарядного платья или комплекта на корпоратив мы в первую очередь советуем руководствоваться приведенной ниже таблицей. Таблица объединяет размеры лекал разных предприятий России и Белоруссии. Лекала вымеряются в соответствии с ГОСТом. Изделия в зависимости от материала, из которого они выполнены, могут иметь отступления от лекала до 2-х сантиметров.</p>\r\n<p>Измерение стоит проводить в нательном белье по наиболее выступающим точкам окружностей бюста, талии и бедер.</p>\r\n<p>Если Ваш размер попадает между размерами, мы рекомендуем обращать внимание на характеристики заказываемого изделия. Если модель имеет в составе эластичные материалы (например, вискоза, спандекс, эластан и тп.), то стоит ориентироваться на меньший размер. Если же модель из плотного, неэластичного материала, то стоит выбирать бОльший размер.</p>\r\n<p>При сильном расхождении в размере между объемами бюста и бедер мы советуем исходить из типа изделия и его материала. Если Покупатель выбирает платье из эластичного материала, то ориентироваться стоит на объем бюста. Если же выбор пал на юбочный/брючный костюм из плотного не тянущегося материала, то ориентироваться стоит на объем бедер.&nbsp;</p>\r\n<p>Если Вы всё же сомневаетесь с выбором размера, то мы советуем обратиться к менеджерам магазина <a href="../../../../">DressyShop</a> по телефону или в Гостевой книге, которые обязательно помогут Вам более чётко определиться с размером понравившегося Вам товара.&nbsp;&nbsp;</p>\r\n<table class="tablepagesizes" style="height: 240px;" width="100%">\r\n<tbody>\r\n<tr>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3><strong>Размер</strong></h3>\r\n</td>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3><strong>Объем бюста (см)</strong></h3>\r\n</td>\r\n<td style="width: 144.205px; text-align: center;">\r\n<h3><strong>Объем талии (см)</strong></h3>\r\n</td>\r\n<td style="width: 144.205px; text-align: center;">\r\n<h3><strong>Объем бедер (см)</strong></h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3>38</h3>\r\n</td>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3>75-77</h3>\r\n</td>\r\n<td style="width: 144.205px; text-align: center;">\r\n<h3 style="text-align: center;">56-59</h3>\r\n</td>\r\n<td style="width: 144.205px; text-align: center;">\r\n<h3>83-85</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3>40</h3>\r\n</td>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3>79-81</h3>\r\n</td>\r\n<td style="width: 144.205px; text-align: center;">\r\n<h3 style="text-align: center;">60-63</h3>\r\n</td>\r\n<td style="width: 144.205px; text-align: center;">\r\n<h3>87-89</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3>42</h3>\r\n</td>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3>83-85</h3>\r\n</td>\r\n<td style="width: 144.205px; text-align: center;">\r\n<h3 style="text-align: center;">64-67</h3>\r\n</td>\r\n<td style="width: 144.205px; text-align: center;">\r\n<h3>91-93</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3>44</h3>\r\n</td>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3>87-89</h3>\r\n</td>\r\n<td style="width: 144.205px; text-align: center;">\r\n<h3>68-71</h3>\r\n</td>\r\n<td style="width: 144.205px; text-align: center;">\r\n<h3>95-97</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3>46</h3>\r\n</td>\r\n<td style="width: 143.295px; text-align: center;">\r\n<h3>91-93</h3>\r\n</td>\r\n<td style="width: 144.205px; text-align: center;"