(25, 'oformlenie_zakaza', 'Оформление заказа', '2', '<h1>Как сделать заказ</h1>\r\n<p>Добро пожаловать на сайт&nbsp;<a href="../../../../">DressyShop</a>. Мы предлагаем большой ассортимент одежды на разные случаи жизни, учитываем разные возрастные категории и вкусовые предпочтения. Для более удобной навигации по сайту мы реализовали не только возможности выбора желаемой категории по типу продукции, по виду выбранной продукции, но и различные способы сортировки показываемого товара в зависимости от предпочтений клиента. Если у клиента есть еще более четкие пожелния, то и эта функция доступна на нашем сайте. Мы предлагаем поиск продукции по сезону, конкретному размеру или бренду. Если у Вас есть необходимость поиска конкретного товара и Вы знаете его название или артикул, то Вы можете воспользоваться строкой поиск в верхней части сайта.</p>\r\n<table class="tabletablaaaa" style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>Как только Вы окажитесь на карточке подходящего Вам товара, Вы можете увидеть его увеличенную версию, чтобы рассмотреть более мелкие детали, информацию о свойствах данного товара, прочитать мнение других клиентов о товаре, а также задать свой вопрос о нем.&nbsp;</p>\r\n</td>\r\n<td><img src="../../../../web/img/screens/product.jpg" /></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><img src="../../../../web/img/screens/2-product_hover.jpg" /></p>\r\n</td>\r\n<td>&nbsp;Если товар Вам подходит, то в верхней части карточки товара предусмотрена возможность выбора цвета и размера модели. В зависимости от выбранного цвета доступные для заказа размеры могут меняться. На каждой модели указана размерная сетка товара, в котором данная модель прошивается в принципе. Если при нажатии на необходимый размер его цвет меняется на розовый, то модель доступна для заказа. Если размер не выбирается, то на данный момент эта модель в указанном размере/цвете не прошивается. Для более точного определения собственного размера мы всегда рекомендуем пользоваться нашей таблицей размеров, ссылка на которую есть на каждой карточке товара.&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Как только Вы определись с цветом и выбрали подходящий Вам размер необходимо нажать кнопку В корзину, после чего выбранная модель будет добавлена в корзину. Отследить количество добавленных в корзину вещей, их цвет и размер Вы можете в любой момент оформления заказа в правом верхнем углу сайта в разделе Моя Корзина.&nbsp;</p>\r\n</td>\r\n<td><img src="../../../../web/img/screens/3-product_last.jpg" /></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><img src="../../../../web/img/screens/4-opcart.jpg" /></p>\r\n</td>\r\n<td>&nbsp;Как только Вы окончательно определились с выбором моделей для заказа необходимо перейти в Корзину и проверить содержимое заказа. Обязательно проверьте, что верно указаны размер и цвет выбранных изделий. Если все верно, то необохдимо перейти к оформлению заказа.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="tabledropdown" style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td>Если Вы делаете заказ в магазине&nbsp; <a href="../../../../">D</a><span lang="en-US"><a href="../../../../">ressyShop</a>&nbsp;</span> впервые</td>\r\n</tr>\r\n<tr>\r\n<td>Заполните поля на странице оформления заказа, выберите способ доставки и оплаты и нажмите на кнопку "Оформить заказ".</td>\r\n</tr>\r\n<tr>\r\n<td>Если Вы уже являетесь нашим клиентом&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Авторизируйтесь, или нажмите кнопку "У меня уже есть аккаунт" на странице оформления заказа, убедитесь в верности автоматически введенных в форму данных, выберите способ доставки и оплаты и нажмите на кнопку "Оформить заказ".</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Заказы на сайте принимаются круглосуточно. Обработкой заказов менеджеры занимаются в рабочее время. Сроки обработки заказов зависят от наличия той или иной модели на складе магазина или производителя. Новые поступления появляются на нашем сайте каждый день! Поставки товара на наш склад в Москве происходят раз в неделю. В связи с этим обработка заказов может занимать от одного дня до двух недель. Просим обратить Ваше внимание, что в &nbsp;связи с часто меняющимся ассортиментом заказы могут быть укомплектованы не полностью. В случае, если заказ поступил не в полном объеме, менеджер согласует с Вами комплектацию заказа перед отправкой/доставкой. По желанию Покупателя заказ может быть дополнен новыми моделями, но только в случае их наличия на складе в Москве. Неполная комплектация заказа ввиду особенностей предлагаемого ассортимента (небольшие партии прошива, часто меняющиеся коллекции и тд.) не является невыполнением заказа Покупателя и не может являться причиной для отказа от доставки/отправки поступивших на склад моделей. Обращаем Ваше внимание, что в случае систематического заказа моделей и отказа/возврата от них по факту доставки/отправки по личным причинам магазин&nbsp;<a href="../../../../">DressyShop</a>&nbsp;оставляет за собой право отказать в дальнейшем обслуживании такому Покупателю. Надеемся на Ваше понимание.</p>', 1, '', '', '', 0),
(26, 'gostevaya_kniga', 'Гостевая книга', '3', '<h1>Гостевая книга</h1>\r\n<p>В данном разделе Вы можете уточнить все интересующие Вас вопросы по нашему ассортименту, правилам работы, срокам обработки заказов, а также уточнить статус Вашего заказа или внести в него изменения. При обращении по вопросам статуса или изменения уже размещенного заказа просим Вас указывать данные заказа (номер, дату оформления). Если при обращении Вы заполнили поле Ваш email, то ответ магазина на Ваш вопрос будет продублирован на Ваш адрес электронной почты.</p>\r\n<p>Все сообщения проходят предварительную модерацию и появляются в разделе с ответом менеджера магазина. Не публикуются сообщения, которые содержат:</p>\r\n<ul>\r\n<li>ненормативную лексику</li>\r\n<li>оскорбления других пользователей</li>\r\n<li>коммерческие предложения или рекламу</li>\r\n<li>отзывы о товарах</li>\r\n</ul>\r\n<p>Данные сообщения удаляются автоматически без ответа менеджера.</p>', 3, '', '', '', 0),
(27, 'otzyvy', 'Отзывы', '3', '<h1>Отзывы</h1>\r\n<p>В данном разделе Вы можете ознакомиться с отзывами и комментариями наших Покупателей об уже приобретенных в магазине женской одежды <a href="../../../../">Dressyshop</a> товарах. Если у Вас есть сомнения при выборе того или иного платья или костюма, а может Вы сомневаетесь в посадке понравившейся куртки или пальто? Тогда данный раздел поможет Вам определиться с выбором.</p>\r\n<p>Все отзывы проходят предварительную модерацию и появляются на сайте в течении суток после размещения. Не публикуются и автоматически удаляются отзывы, которые содержат:</p>\r\n<ul>\r\n<li>ненормативную лексику</li>\r\n<li>оскорбления других пользователей</li>\r\n<li>коммерческие предложения и рекламу</li>\r\n</ul>\r\n<p>В данном разделе представлены отзывы на все изделия каталога. Ознакомиться с отзывами на определенный понравившийся товар Вы можете на странице карточки товара во вкладке "Отзывы".</p>', 2, '', '', '', 0),
(29, 'brendy', 'Бренды', '4', '<h1>Бренды</h1>\r\n<p>Магазин <a href="../../../../">DressyShop</a> сотрудничает с лучшими предприятиями России, Белоруссии и других стран по пошиву одежды и изготовлению аксессуаров. Мы следим за качеством предлагаемых изделия, выбирая только тех производителей, которые имеют сертификаты качества, безопасности и соответствия всем обязательным в РФ условиям.</p>\r\n<p>Каждый бренд имеет свои особенности и уникальные находки. Наш ассортимент будет интересен и молодым девушкам и статусным дамам. Мы постоянно заботимся об обновлении ассортимента, но и стараемся поддерживать наличие часто заказываемых моделей. Ищете нарядное платье для вечеринки или удобную одежду для летнего отдыха? <a href="../../../../">DressyShop</a> постарается Вам помочь. Большой ассортимент, расширенная размерная сетка, обилие цветов, стилей и фасонов - вот наш девиз!</p>', 2, '', '', '', 0),
(30, 'o_nas', 'О нас', '4', '<h1 style="text-align: center;">Интернет магазин стильной женской одежды в Москве&nbsp;<a href="../../../../">DressyShop</a> рад видеть Вас на страницах своего каталога одежды и аксессуаров.</h1>\r\n<table class="tablepagesizes3" style="height: 107px; width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td style="width: 195px; text-align: center;"><span style="text-decoration: underline;">Кто мы?</span></td>\r\n<td style="width: 864px; text-align: left;">\r\n<p style="text-align: justify;">Интернет магазин стильной женской одежды в Москве&nbsp;<a href="../../../../">Dressyshop</a>&nbsp;это молодая и амбициозная команда, которая ставит задачи и добивается успехов в индустрии стиля и моды. Мы сотрудничаем с лучшими фабриками России, Турции и Белоруссии.</p>\r\n<p style="text-align: justify;">У нас Вы сможете найти для себя не только базовые модели женской одежды интернет магазин недорого Москва, но и уникальные предметы одежды и аксессуаров, которые добавят нотки шарма и загадочности в любой образ. Вы предпочитаете классический деловой стиль? А может образ Вашей жизни предполагает удобный и спортивный гардероб? Для нас абсолютно не важно какого стиля в одежде придерживаются наши клиенты. Интернет магазин&nbsp; женской одежды&nbsp;<a href="../../../../">Dressyshop</a>&nbsp;ставит перед собой задачу порадовать покупкой любого клиента!</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 195px; text-align: center;"><span style="text-decoration: underline;">Наши принципы</span></td>\r\n<td style="width: 864px; text-align: left;">\r\n<p style="text-align: justify;">При формировании каталога интернет магазин&nbsp;<a href="../../../../">Dressyshop</a>&nbsp;руководствуется следующими потребностями клиента:</p>\r\n<ul>\r\n<li style="text-align: justify;">Качество представленной продукции. Все изделия имеют необходимые по законодательству Российской Федерации сертификаты соответствия продукции вне зависимости от страны производства.</li>\r\n<li style="text-align: justify;">Соответствие установленным ГОСТом размерам. Лекала каждого предприятия конечно же отличаются в зависимости от страны производства или типа производимой продукции, но расхождения приведены к минимуму, чтобы как можно больше нарядов радовали своей точной посадкой наших покупательниц.</li>\r\n<li style="text-align: justify;">Разнообразие ассортимента. Женская одежда интернет магазин недорого Москва&nbsp;<a href="../../../../">Dressyshop</a>&nbsp;представлена в различных категориях и позволит наполнить Ваш гардероб стильными вещами. Классические деловые костюмы или нарядные платья? Теплая верхняя одежда, а может удобный домашний комплект? Большой ассортимент аксессуаров и бижутерии.</li>\r\n<li style="text-align: justify;">Широкий размерный ряд. Интернет магазин <a href="../../../../">Dressyshop</a>&nbsp;ставит своей целью порадовать своими нарядами абсолютно всех покупательниц вне зависимости от возраста, предпочтений в стиле и размеров одежды. Ведь настоящий стиль не имеет границ! В числе наших партнеров много предприятий, которые специализируются именно на пошиве одежды для дам с пышными формами, и поэтому мы даем возможность купить женскую одежду в интернет магазине Москва только высокого качества и по приемлемым ценам.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 195px; text-align: center;">&nbsp;<span style="text-decoration: underline;">Наши преимущества</span></td>\r\n<td style="width: 864px; text-align: left;">\r\n<p>При сегодняшнем уровне развития интернет торговли наша команда предлагает купить женскую одежду в интернет магазине<span style="text-align: justify;">&nbsp;Москва&nbsp;</span><a style="text-align: justify;" href="../../../../">Dressyshop</a><span style="text-align: justify;">, и прекрасно понимает, что покупательниц надо радовать не только ассортиментом, но и выгодными предложениями, акциями и скидками. И мы с удовольствием делаем это!</span></p>\r\n<ul>\r\n<li><span style="text-align: justify;">Бесплатная доставка от&nbsp;<span style="text-decoration: underline;">5000 рублей</span>&nbsp;по Москве и от&nbsp;<span style="text-decoration: underline;">7000 рублей</span>&nbsp;по России.</span></li>\r\n<li><span style="text-align: justify;">Персональные скидки до 10% в зависимости от количества выкупленных заказов.</span></li>\r\n<li><span style="text-align: justify;">Раздел Распродажа со скидками до 50%.</span></li>\r\n<li><span style="text-align: justify;">Отсутствие наценок на большие размеры.</span></li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 195px; text-align: center;">&nbsp;<span style="text-decoration: underline;">Наше развитие</span></td>\r\n<td style="width: 864px; text-align: left;">\r\n<p>Команда интернет магазина&nbsp;<a style="text-align: justify;" href="../../../../">Dressyshop</a><span style="text-align: justify;">&nbsp;отслеживает тенденции в мире моды и постоянно обновляет коллекцию одежды и аксессуаров. Мы следим за удобством работы нашего сайта, прислушиваемся к пожеланиям клиентов по ассортименту и качеству товаров. Стараемся зарекомендовать себя как интересный интернет магазин стильной женской одежды в Москве и уверены, что сможем добиться успеха и в этом направлении. В ближайшее время планируем запуск собственной коллекции одежды Dressmarino, в которой постараемся удивить наших покупательниц сочетанием доступной цены и высокого качества.</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="text-align: justify;">Благодарим за выбор интернет магазина женской одежды&nbsp;</span><a style="text-align: justify;" href="../../../../">Dressyshop</a><span style="text-align: justify;">!</span></p>', 1, 'Интернет магазин стильной женской одежды в Москве купить недорого DressyShop', 'интернет магазин стильной женской одежды в москве, купить женскую одежду интернет магазин москва, женская одежда интернет магазин недорого москва', 'Интернет магазин стильной женской одежды DressyShop - это уникальная возможность купить женскую одежду интернет магазин Москва недорого, а также бижутерию и аксессуары', 0),
(31, 'sotrudnichestvo', 'Сотрудничество', '4', '<h1>Сотрудничество</h1>\r\n<p>Магазин стильной одежды для женщин <a href="../../../../">Dressyshop</a>&nbsp;заинтересован в постоянном расширении своего ассортимента одежды и аксессуаров. Мы рады сотрудничать с производителями из разных регионов России, Белоруссии и других стран. Главными критериями при выборе поставщиков для нашего каталога мы считаем качество предлагаемой продукции, а также соответствие её всем требованиям и нормативам законодательства РФ. Если данные условия соблюдены, а поставщик отличается ещё и быстрой обработкой и отправкой поступающих заказов, то мы вдвойне будем рады видеть Вас в числе наших партнеров!&nbsp;&nbsp;</p>\r\n<p>Если Вы хотите, чтобы Ваша продукция была представлена на страницах интернет магазина женской одежды <a href="../../../../">Dressyshop</a>&nbsp;или у Вас есть коммерческое предложение рекламного характера, то Вам необходимо заполнить форму <a class="sotrud_link" href="##">Запроса на сотрудничество</a>. Наши менеджеры по развитию свяжутся с Вами в течении 2-х рабочих дней с момента поступления запроса.&nbsp;</p>\r\n<p style="text-align: center;">Мы будем рады видеть Вас в числе надежных партнеров интернет магазина <a href="../../../../">Dressyshop</a>!</p>', 4, '', '', '', 0);
