(36, 'dostavka_i_oplata', 'Доставка и оплата', '2', '<h1>Доставка и оплата заказа</h1>\r\n<p>Стоимость доставки и способы оплаты заказа меняются в зависимости от способа доставки Вашего заказа, а именно:<br /><br /></p>\r\n<table class="tablepagesizes2" style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td style="text-align: center; width: 22.241%;">Как получить заказ</td>\r\n<td style="text-align: center; width: 37.759%;">Сколько стоит доставка/отправка</td>\r\n<td style="text-align: center; width: 26%;">Как оплатить заказ</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center; width: 22.241%;"><span style="text-decoration: underline;">Курьерская доставка в пределах МКАД.</span></td>\r\n<td style="text-align: center; width: 37.759%;">\r\n<ul>\r\n<li style="text-align: left;"><strong>0 рублей</strong>, если Клиент выкупает заказ на сумму более <span style="text-decoration: underline;">5000</span>&nbsp;рублей.</li>\r\n<li style="text-align: left;"><strong>300 рублей</strong>, если Клиент выкупает заказ на сумму менее <span style="text-decoration: underline;">5000</span>&nbsp;рублей.</li>\r\n<li style="text-align: left;"><strong>300 рублей</strong>, если Клиенту не подходит <span style="text-decoration: underline;">ни одна</span> позиция из доставленного заказа.</li>\r\n</ul>\r\n</td>\r\n<td style="text-align: center; width: 26%;">\r\n<ul>\r\n<li style="text-align: left;">наличными курьеру при доставке заказа.</li>\r\n<li style="text-align: left;">оплата на карточку Сбербанка в момент доставки заказа.</li>\r\n<li style="text-align: left;">полная/частичная предоплата заказа.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center; width: 22.241%;"><span style="text-decoration: underline;">Курьерская доставка за пределы МКАД (до 20км от МКАД).</span></td>\r\n<td style="text-align: center; width: 37.759%;">\r\n<ul>\r\n<li style="text-align: left;"><strong>0 рублей</strong>, если Клиент выкупает заказ на сумму более <span style="text-decoration: underline;">7000</span> рублей.</li>\r\n<li style="text-align: left;"><strong>400 рублей</strong>, если Клиент выкупает заказ на сумму менее <span style="text-decoration: underline;">7000</span> рублей.</li>\r\n<li style="text-align: left;"><strong>400 рублей</strong>, если Клиенту не подходит <span style="text-decoration: underline;">ни одна</span> позиция из доставленного заказа.</li>\r\n</ul>\r\n</td>\r\n<td style="text-align: center; width: 26%;">\r\n<ul>\r\n<li style="text-align: left;">наличными курьеру при доставке заказа.</li>\r\n<li style="text-align: left;">оплата на карточку Сбербанка в момент доставки заказа.</li>\r\n<li style="text-align: left;">полная/частичная предоплата заказа.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center; width: 22.241%;"><span style="text-decoration: underline;">Отправка бандероли/посылки Почтой России (все регионы России).</span></td>\r\n<td style="text-align: center; width: 37.759%;">\r\n<ul>\r\n<li style="text-align: left;"><strong>0 рублей</strong>, если сумма заказа более <span style="text-decoration: underline;">7000</span> рублей.</li>\r\n<li style="text-align: left;"><strong>400 рублей</strong>, если сумма заказа менее <span style="text-decoration: underline;">7000</span> рублей.</li>\r\n<li style="text-align: left;"><strong>0 рублей</strong>, если заказ отправляется по <span style="text-decoration: underline;">100%</span> предоплате.</li>\r\n</ul>\r\n</td>\r\n<td style="text-align: center; width: 26%;">\r\n<ul>\r\n<li style="text-align: left;">наложенный платеж в момент получения посылки на Вашем почтовом отделении (до 15.000 рублей).&nbsp;</li>\r\n<li style="text-align: left;">полная/частичная предоплата перед отправкой сформированного заказа.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center; width: 22.241%;"><span style="text-decoration: underline;">Ускоренная отправка EMSpost Почта России (все регионы России).</span></td>\r\n<td style="width: 37.759%; text-align: left;">\r\n<ul>\r\n<li><strong>900 рублей</strong>&nbsp;вне зависимости от суммы заказа и способа его оплаты.</li>\r\n</ul>\r\n</td>\r\n<td style="text-align: center; width: 26%;">\r\n<ul>\r\n<li style="text-align: left;">наложенный платеж в момент получения посылки на Вашем почтовом отделении или у курьера EMSpost Почта России (зависит от региона). (до 50.000 рублей).</li>\r\n<li style="text-align: left;">полная/частичная предоплата перед отправкой сформированного заказа.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center; width: 22.241%;">\r\n<p><span style="text-decoration: underline;">Ускоренная отправка EMSpost Почта России (за пределы РФ).</span></p>\r\n</td>\r\n<td style="text-align: center; width: 37.759%;">\r\n<ul>\r\n<li style="text-align: left;"><strong>1500 рублей</strong> вне зависимости от суммы заказа и способа его оплаты.</li>\r\n</ul>\r\n</td>\r\n<td style="width: 26%; text-align: left;">\r\n<ul>\r\n<li>100% предоплата перед отправкой сформированного заказа.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center; width: 22.241%;">\r\n<p><span style="text-decoration: underline;">Отправка транспортной компанией (Деловые Линии, СДЭК и тп.) на выбор Покупателя.</span></p>\r\n</td>\r\n<td style="text-align: center; width: 37.759%;">\r\n<ul>\r\n<li style="text-align: left;">по Тарифам выбранной Клиентом транспортной компании.&nbsp;</li>\r\n</ul>\r\n</td>\r\n<td style="width: 26%; text-align: left;">\r\n<ul>\r\n<li>100% предоплата перед отправкой сформированного заказа.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Условия доставки/отправки заказов.</h2>\r\n<table class="tabledropdown" style="width: 913px;">\r\n<tbody>\r\n<tr>\r\n<td style="width: 915px;">\r\n<h3>Курьерская доставка (в пределах МКАД, за пределы МКАД).</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 915px;">\r\n<p>Способ получения заказа "<span style="text-decoration: underline;">Курьерская доставка</span>" позволяет получить заказ с примеркой на дом или в офис. Максимальное количество позиций для примерки <span style="text-decoration: underline;">4 (четыре)</span> единицы. Время ожидания курьера по адресу составляет не более 15 мин. Данные условия устанавливаются курьерской службой и не могут быть изменены. Доставка осуществляется с понедельника по субботу. За час до осуществления доставки курьер обязательно свяжется с Вами и предупредит о своем приезде. В случае, если Покупатель по каким-либо причинам не может принять заказ в оговоренные сроки, доставка переносится на следующий день. О невозможности принять заказ в оговоренные сроки Покупатель должен сообщить курьеру до его выезда по адресу Покупателя. Обращаем Ваше внимание, что без предварительного созвона, курьер по адресу не выезжает.</p>\r\n<p><span style="text-decoration: underline;">Доступные интервалы доставки</span>:</p>\r\n<table class="tablepagesizes2" style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>Утренний интервал</td>\r\n<td>Дневной интервал</td>\r\n<td>Вечерний интервал</td>\r\n<td>Весь день</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;">Москва в пределах МКАД</td>\r\n<td style="text-align: center;">10-16</td>\r\n<td style="text-align: center;">10-18</td>\r\n<td style="text-align: center;">18-22</td>\r\n<td style="text-align: center;">10-22</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;">Москва за пределы МКАД</td>\r\n<td style="text-align: center;">нет</td>\r\n<td style="text-align: center;">10-18</td>\r\n<td style="text-align: center;">15-22</td>\r\n<td style="text-align: center;">10-22</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>*Временной интервал доставки может быть уменьшен по договоренности с курьером, если его маршрут позволяет доставить в более сжатые сроки по Вашему адресу.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 915px;">\r\n<h3>Отправка бандеролей и посылок Почтой России.</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 915px;">\r\n<p>Отправка бандеролей и посылок осуществляется по всей территории РФ. Отправка осуществляется на почтовое отделение, к которому приписан адрес Покупателя, указанный им в заказе. Если Вы не знаете своего точного индекса, адреса почтового отделения или графика его работы, то уточнить эту информацию Вы можете на <a href="https://www.pochta.ru/post-index" target="_blank" rel="noopener">сайте Почты России.</a>&nbsp;Средние сроки доставки по России составляют от 7 до 20 дней в зависимости от отдаленности региона доставки. Все посылки отправляются из Москвы. Посылки и бандероли, отправляемые по Москве и Московской области, имеют средние сроки доставки 3-7 дней.</p>\r\n<p>Заказы, оплаченные по предоплате, отправляются посылками с объявленной ценностью. Остальные заказы отправляются посылками с объявленной ценностью и наложенным платежом. Обращаем Ваше внимание, что при получении посылки с наложенным платежом Почта России взимает комиссию с получателя. Размер комиссии меняется в зависимости от региона и составляет в среднем 2-7% от объявленной стоимости посылки (но не менее 50 рублей). Уточнить более точный процент комиссии для Вашего региона отправки Вы можете обратившись на Ваше почтовое отделение. Магазин <a href="../../../../">DressyShop</a> получает только стоимость объявленной ценности, указанный на посылке.</p>\r\n<p>Перед получением посылки мы настоятельно рекомендуем нашим Покупателям сравнивать вес посылки, указанный на упаковке, с фактическим весом. Если эти цифры не совпадают, то вскрывать посылку необходимо в присутствии сотрудника почтового отделения с обязательным составлением документа о разнице в весе. Также очень важно проверить упаковку на наличие внешних повреждений или следов вскрытия. Обращаем Ваше внимание, что до выкупа посылки проверить комплектность посылки или примерить товар невозможно (по правилам Почты России).</p>\r\n<p>После отправки заказа Покупателю поступает сообщение об отправке на телефон и адрес электронной почты, указанные в заказе. Если в них не указан номер почтового отправления, то мы рекомендуем уточнить его у наших менеджеров, отправив Ваш запрос в <a href="#">Гостевую книгу</a> или на <a href="mailto:dressyshop@yandex.ru">электронную почту</a>. Данный номер почтового отправления (ТРЕК-номер) позволяет отследить Вашу посылку <a href="https://www.pochta.ru/tracking" target="_blank" rel="noopener">по сервису отслеживания Почты России</a>. Также по данному номеру сотрудники почтового отделения обязаны выдать посылку, даже если Вам не поступило извещение о её поступлении. Обращаем Ваше внимание, что посылка будет храниться в почтовом отделении не более 30 календарных дней. Срок бесплатного хранения посылки составляет 5 рабочих дней, не считая даты поступления посылки в почтовое отделение. Стоимость хранения сверх указанного срока Вы можете уточнить на Вашем почтовом отделении. По истечении данного срока посылка будет возвращена по адресу магазина. Магазин <a href="../../../../">DressyShop</a> не требует предоплату в обязательно порядке, но если Покупатель не выкупил свой заказ, то последующий заказ может быть отправлен только по 100% предоплате. Надеемся на Вашу ответственность и понимание.</p>\r\n<p><span style="text-decoration: underline;">Обращаем Ваше внимание, что заказы, стоимостью <strong>более 15000 (пятнадцати тысяч) рублей</strong> отправляются по частичной/полной предоплате заказа. Сумма предоплаты не является фиксированной и согласовывается с Покупателем. Данное правило не распространяется на Покупателей, имеющих 1(один) и более выкупленных заказов в магазине <a href="../../../../">DressyShop</a>.</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 915px;">\r\n<h3>Ускоренная отправка EMSpost по России.</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 915px;">\r\n<p>Данная отправка производится по правилам отправки Почтой России. Различия заключаются в сроках пересылки, которые как правило значительно меньше (за исключением предновогоднего периода). Данным способом можно получить более дорогие и тяжелые заказы. Максимальная стоимость наложенного платежа в данном случае составляет 50000 (пятьдесят тысяч) рублей. Также данный способ отправки выгоден при отправке в отдаленные и труднодоступные регионы России. Более точные сроки доставки и стоимость отправки в Ваш регион Вы можете уточнить на сайте <a href="http://www.emspost.ru/ru/calc/" target="_blank" rel="noopener">EMSpost</a>. Обращаем Ваше внимание, что отправления EMSpost могут доставляться по адресу Покупателя. Данная услуга предоставляется не во всех регионах страны. Если адресная доставка в Вашем регионе не предусмотрена, то забрать заказ Вы сможете на Вашем почтовом отделении. Уточнить о возможности адресной доставки в Вашем регионе можно на Вашем почтовом отделении или у операторов <a href="http://www.emspost.ru/ru/" target="_blank" rel="noopener">EMSpost</a>.</p>\r\n<p>После отправки заказа Покупателю поступает сообщение об отправке на телефон и адрес электронной почты, указанные в заказе. Если в них не указан номер почтового отправления, то мы рекомендуем уточнить его у наших менеджеров, отправив Ваш запрос в&nbsp;<a href="#">Гостевую книгу</a>&nbsp;или на&nbsp;<a href="mailto:dressyshop@yandex.ru">электронную почту</a>. Данный номер почтового отправления (ТРЕК-номер) позволяет отследить Вашу посылку <a href="https://www.pochta.ru/tracking" target="_blank" rel="noopener">по сервису отслеживания EMSpost</a>.</p>\r\n<p><span style="text-decoration: underline;">Обращаем Ваше внимание, что заказы, стоимостью более <strong>15000 (пятнадцати тысяч) рублей</strong> отправляются по частичной/полной предоплате заказа. Сумма предоплаты не является фиксированной и согласовывается с Покупателем. Данное правило не распространяется на Покупателей, имеющих 1(один) и более выкупленных заказов в магазине <a href="../../../../">DressyShop</a>.</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 915px;">\r\n<h3>Ускоренная отправка EMSpost Почта России за пределы РФ.</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 915px;">\r\n<p>Отправка осуществляется после 100% предоплаты за заказ и доставку. Оплату необходимо производить после согласования с менеджером комплектации заказа.</p>\r\n<p>Данный вид доставки доступен Покупателям из ближнего и дальнего зарубежья. Доставка осуществляется до адреса Покупателя.</p>\r\n<p>После отправки заказа Покупателю поступает сообщение об отправке на телефон и адрес электронной почты, указанные в заказе. Если в них не указан номер почтового отправления, то мы рекомендуем уточнить его у наших менеджеров, отправив Ваш запрос в&nbsp;<a href="#">Гостевую книгу</a>&nbsp;или на&nbsp;<a href="mailto:dressyshop@yandex.ru">электронную почту</a>. Данный номер почтового отправления (ТРЕК-номер) позволяет отследить Вашу посылку&nbsp;<a href="https://www.pochta.ru/tracking" target="_blank" rel="noopener">по сервису отслеживания EMSpost</a>.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 915px;">\r\n<h3>Отправка транспортной компанией на выбор Покупателя.</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 915px;">\r\n<p>Отправка осуществляется после 100% предоплаты за заказ и доставку. Оплату необходимо производить после согласования с менеджером комплектации заказа.</p>\r\n<p>Осуществляется по правилам и тарифам выбранной Покупателем транспортной компании. Дополнительные условия и пожелания обговариваются в индивидуальном порядке.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 2, '', '', '', 0),
(37, 'vozvrat_tovara', 'Возврат товара', '2', '<h1>Возврат товара</h1>\r\n<p>По законодательству Российской Федерации Покупатель вправе возвратить в магазин неподошедший ему товар в течение 14 календарных дней*.<br /><span style="color: #707070; font-family: Tahoma, Helvetica, Arial, sans-serif;"><span style="font-size: 12.8px;">*То&shy;вары над&shy;ле&shy;жа&shy;щего каче&shy;ства, которые нельзя обме&shy;нять(вернуть), пере&shy;чис&shy;лены в переч&shy;не, утвер&shy;жден&shy;ном Поста&shy;нов&shy;ле&shy;нием Пра&shy;ви&shy;тель&shy;ства РФ от 19 января 1998 г. № 55.</span></span></p>\r\n<p>Причины возврата:</p>\r\n<ul>\r\n<li>Товар не подошел по цвету, размеру, фасону и подобным характеристикам изделия.</li>\r\n<li>Товар передан с производственным браком.</li>\r\n<li>Заказ укомплектован не верно.</li>\r\n</ul>\r\n<p>Обращаем Ваше внимание, что при неправильной комплектации заказа или передаче товара с производственным браком магазин <a href="../../../../"><span lang="en-US">DressyShop </span></a>компенсирует Покупателю почтовые расходы на отправку такого товара. Во всех других случаях отправка возврата осуществляется за счет Покупателя и компенсации не подлежит.</p>\r\n<p>&nbsp;</p>\r\n<table class="tablepagesizes2" style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td style="width: 48.1025%;">Условия для принятия возврата выполнены.</td>\r\n<td style="width: 47.8975%;">Условия для принятия возврата НЕ выполнены.</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 48.1025%;">С момента приобретения товара прошло <strong>не более 14 календарных дней</strong> (датой приобретения товара считается дата доставки заказа или выкупа посылки в зависимости от способа передачи товара).</td>\r\n<td style="width: 47.8975%;">С момента приобретения товара прошло <strong>15 и более календарных дней</strong> (датой приобретения товара считается дата доставки заказа или выкупа посылки в зависимости от способа передачи товара).</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 48.1025%;">Товарный вид <strong>соблюден</strong> (имеются навесные ярлыки, сохранена упаковка товара и имеющиеся бирки и этикетки).</td>\r\n<td style="width: 47.8975%;">Товарный вид <strong>Не соблюден</strong> (навесной ярлык сорван, упаковка товара испорчена или утеряна).</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 48.1025%;">Товар <strong>не имеет</strong> признаков носки или использования.</td>\r\n<td style="width: 47.8975%;">На товаре <strong>имеются следы</strong> использования (потертости, пятна, следы стирки и тп.).</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 48.1025%;">Товар возвращается в <strong>полной первоначальной</strong> комплектации.</td>\r\n<td style="width: 47.8975%;"><strong>Часть товара</strong> Покупатель хочет оставить себе или <strong>не предоставляет</strong> к возврату.</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 48.1025%;">Покупатель <strong>заполнил</strong> <a href="##">Форму возврата товара на сайте</a>. (Заявление в электронном виде автоматически поступит в отдел возврата магазина <a href="../../../../">DressyShop</a> и будет рассмотрено в течении одного рабочего дня с обязательным ответом на электронный адрес, указанный Покупателем).</td>\r\n<td style="width: 47.8975%;">Покупатель отправил возврат на юридический адрес <strong>без согласования</strong> с менеджером по возврату. (Такие возвраты не забираются и отправляются Почтой России по адресу отправителя по истечении срока хранения).</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>При соблюдении условий принятия возврата возможны следующие способы его принятия магазином:</h2>\r\n<table class="tabledropdown" style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<h3>Товар доставлялся курьером в пределах МКАД</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<ul>\r\n<li>выезд курьера за возвратом в пределах МКАД (оплачивается вне зависимости от того оплачивалась ли изначальная доставка). Стоимость выезда курьера &mdash; 300 рублей.</li>\r\n<li>ценная бандероль/посылка Почтой России (высылается на указанный менеджером по возврату адрес в течение 7 календарных дней после согласования возврата). <span style="text-decoration: underline;">Обязательно без наложенного платежа</span>.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<h3>Товар доставлялся курьером за пределы МКАД (включая отдаленные районы Москвы), курьером в Санкт-Петербург и ЛО</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>ценная бандероль/посылка Почтой России (высылается на указанный менеджером по возврату адрес в течение 7 календарных дней после согласования возврата). <span style="text-decoration: underline;">Обязательно без наложенного платежа</span>.</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<h3>Товар отправлялся бандеролью/посылкой Почтой России, EMS Почта России или любой транспортной компанией</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>ценная бандероль/посылка Почтой России (высылается на указанный менеджером по возврату адрес в течение 7 календарных дней после согласования возврата). <span style="text-decoration: underline;">Обязательно без наложенного платежа</span>.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Денежные средства <strong>не передаются</strong> <strong>в момент получения возврата курьером по адресу</strong>, а перечисляются только после обязательной проверки товара складом <a href="../../../../">DressyShop</a>. Денежные средства за возврат перечисляются в течение <strong>10 рабочих дней</strong> с момента получения складом <a href="../../../../">DressyShop</a> возвращенного товара. Магазин <a href="../../../../">DressyShop</a> <strong>не осуществляет возврат денежных средств в наличной форме</strong>. Перечисление осуществляется почтовым или банковским переводом в зависимости от пожеланий Покупателя, которые будут указаны им в соответствующей графе <a class="return_link" href="##">Формы возврата товара</a>. Просим обратить Ваше внимание, что если товар выкупался с помощью наложенного платежа, то денежный возврат за него возможен <strong>только</strong> почтовым переводом.</p>\r\n<p>Дополнительную информацию по процедуре возврата товара Вы можете получить связавшись с нами по почте vozvrat@dressyshop.ru или в переписке с менеджером по возврату после отправки <a class="return_link" href="##">Формы возврата товара</a>.</p>', 4, '', '', '', 0),
(39, 'skidki_i_akcii', 'Скидки и акции', '2', '<h1>Скидки и акции</h1>\r\n<p>Магазин модной женской одежды <a href="../../../../">DressyShop</a>&nbsp;ценит своих Покупателей и предлагает специальную систему скидок. Скидки предоставляются Покупателю и не могут быть переданы другим Покупателям. Если модель в магазине представлена по сниженной цене (в карточке товара присутствует специальная метка), то персональные скидки не применяются (за исключением скидки БЕСПЛАТНАЯ ДОСТАВКА).</p>\r\n<p>&nbsp;</p>\r\n<table class="tablepagesizes2" style="width: 100%;" cellspacing="0" cellpadding="4"><colgroup><col width="195" /> <col width="98" /> <col width="350" /> </colgroup>\r\n<tbody>\r\n<tr valign="top">\r\n<td>Название скидки&nbsp;</td>\r\n<td>Сумма скидки</td>\r\n<td>Условия скидки</td>\r\n</tr>\r\n<tr valign="top">\r\n<td style="text-align: center;">Скидка &laquo;ВТОРОЙ ЗАКАЗ&raquo;</td>\r\n<td style="text-align: center;">5%</td>\r\n<td style="text-align: center;">Скидка предоставляется на второй заказ Покупателя после выкупа первого заказа. В случае возврата первого заказа скидка не предоставляется. Скидка предоставляется менеджером в ручном режиме на уже размещенный в магазине второй заказ при обязательном указании Покупателем фразы &laquo;ВТОРОЙ ЗАКАЗ&raquo; в поле Комментарий к заказу при его оформлении. Если по каким-либо причинам скидка не была применена на второй заказ, то она может быть применена на следующий заказ. Скидка является единоразовой для каждого Покупателя.</td>\r\n</tr>\r\n<tr valign="top">\r\n<td style="text-align: center;">Скидка &laquo;ПОСТОЯННЫЙ КЛИЕНТ&raquo;</td>\r\n<td style="text-align: center;">10%</td>\r\n<td style="text-align: center;">После 5 выкупленных заказов Покупатель приобретает статус &laquo;Постоянный клиент&raquo; и получает право на скидку на все заказы, начиная с 6(шестого) заказа. Скидка предоставляется от количества выкупленных заказов, а не от их стоимости. Скидка является постоянной и применяется на все последующие заказы автоматически.</td>\r\n</tr>\r\n<tr valign="top">\r\n<td style="text-align: center;">Скидка &laquo;БЕСПЛАТНАЯ ДОСТАВКА&raquo;</td>\r\n<td style="text-align: center;">Цена доставки</td>\r\n<td>\r\n<ul>\r\n<li>При доставке в пределах МКАД и выкупе заказа на сумму более 5000 рублей</li>\r\n<li>При доставке за пределы МКАД и выкупе заказа на сумму более 7000 рублей</li>\r\n<li>При отправке заказа Почтой России на сумму более 7000 рублей и оплате наложенным платежом</li>\r\n<li>При отправке заказа бандеролью/посылкой Почтой России по 100% предоплате.&nbsp;</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 4, '', '', '', 0),
(40, 'fotogalereya', 'Фотогалерея', '3', '<h1>Фотогалерея</h1>\r\n<p>В данном разделе будут представлены фото наших Покупателей в приобретаемых в нашем магазине нарядах. Поделиться фотографиями не только приятно, но и выгодно! Магазин <a href="../../../../">DressyShop</a> будет предоставлять скидки наиболее активным участникам и проводить конкурсы на постоянной основе. Следите за обновлениями данного раздела!</p>', 2, '', '', '', 0),
(41, 'kontakty', 'Контакты', '4', '<table class="tablepagesizes3" style="width: 100%; height: 94px;">\r\n<tbody>\r\n<tr>\r\n<td style="width: 293px;">Телефон:&nbsp;</td>\r\n<td style="width: 293px;">+7 (495) 532-97-70</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 293px;">Время работы:&nbsp;&nbsp;</td>\r\n<td>пн-пт 10.00-19.00</td>\r\n</tr>\r\n<tr>\r\n<td>Прием заказов через сайт:</td>\r\n<td>Круглосуточно и без выходных</td>\r\n</tr>\r\n<tr>\r\n<td>Адрес:</td>\r\n<td>115114, Москва, Павелецкая набережная, д.2 стр.1&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>Реквизиты:</td>\r\n<td>ИП Лисина Л.Н.&nbsp; ОГРНИП&nbsp;310761108200010</td>\r\n</tr>\r\n</tbody>\r\n</table>', 2, '', '', '', 0);
