INSERT INTO `questions` (`id`, `model_id`, `user`, `content`, `email`, `name`, `created`, `answer`, `approved`) VALUES
(18, 2091, 0, 'Уточните модель не маломерит?', '', 'Анна', '2017-11-07 20:42:31', 'Добрый день!\r\nМодель не маломерит, но по задумке должна быть в обтяжку.\r\nС уважением', 0),
(24, 1477, 0, 'Скажите, пожалуйста, какова длина браслета?', '', 'Елена', '2017-11-01 11:07:12', 'Добрый день!\r\nДлина браслета около 24см. С уважением', 0),
(25, 1413, 0, 'Скажите, если мне нравится именно СИНИЙ цвет, достаточно ли будет сделать заказ по интернету, или лучше позвонить по телефону?', '', 'Вера Ивановна', '2017-11-04 11:11:28', 'Добрый день!\r\nВам достаточно выбрать указанный цвет. Заказ поступит к нам именно в таком виде. Если Вы все же переживаете, то Вы можете дописать комментарий к заказу, что Вас интересует только желаемый цвет. С уважением', 0),
(26, 245, 0, 'Здравствуйте! У меня на экране это пальто явно розового цвета, а в описании - бежевого. Скажите какой цвет на самом деле?\r\nСпасибо.', '', 'Ирина Смирнова', '2017-11-07 11:18:25', 'Добрый день!\r\nПальто цвета "Пыльная роза". С уважением', 0),
(27, 317, 0, 'Уточните, пожалуйста, на фото платье, а в описании топ. Как заказать платье?', '', 'Ксюша Веретенко', '2017-10-10 11:24:22', 'Добрый день!\r\nНа фото представлен костюм. Данный артикул это топ и он продается отдельно от юбки. Юбка артикул ФЛА-423-04. Вы можете найти его через поисковую строку в верхней части нашего сайта.\r\nС уважением', 0),
(28, 392, 0, 'Уточните, пожалуйста, цвет красный или как на фото ближе к коралловому?', '', 'Анна Петренко', '2017-09-12 11:30:19', 'Добрый день!\r\nЦвет как на фото. С уважением', 0),
(29, 183, 0, 'Здравствуйте! Скажите, а в рукавах есть какой-то утеплитель?', '', 'Светлана К', '2017-10-03 11:38:40', 'Добрый день!\r\nНет, утеплителя там нет, рукава вязаные. С уважением', 0),
(30, 2071, 0, 'Скажите, пожалуйста, перед у блузки на подкладке или это белье?', '', 'Наталья Владимировна', '2017-11-02 11:42:37', 'Добрый день!\r\nЭто вставка из белого ажурного кружева. С уважением', 0),
(31, 318, 0, 'Хотела бы заказать эту юбку, но в комплекте с топом (ФЛА-2268-04). Это же комплект? Как это правильно сделать?', '', 'Жанна Сергеева', '2017-10-18 11:47:17', 'Добрый день!\r\nМодели составляют комплект, но продаются отдельно. Поэтому необходимо каждый артикул заказать отдельно и обязательно в комментарии к заказу указать, что Вам нужен именно комплект, чтобы не получилось так, что с фабрики поступит один из двух. С уважением\r\n ', 0),
(32, 571, 0, 'Хотела бы такой костюм. Как заказать такую тунику  к брюкам?', '', 'Валерия', '2017-10-25 11:49:42', 'Добрый день!\r\nЗаведите в поисковой строке в верхней части сайта ВА-М3-3572. С уважением', 0),
(33, 2036, 0, 'Не пойму какая там застежка.', '', 'Валентина Павлова', '2017-11-09 11:53:53', 'Добрый день!\r\nМодель на джинсовых металлических пуговицах. С уважением', 0),
(34, 215, 0, 'Скажите, пожалуйста, на фото не очень понятно - это трикотажные рукава или внутри свитер?', '', 'Юлия', '2017-10-08 12:00:45', 'Добрый день! Модель с рукавом 3/4 и дополнена трикотажным рукавом. С уважением', 0),
(35, 1990, 0, 'На фото не понятно, есть ли у жилета застежка на горле?', '', 'Варвара Кудрешова', '2017-10-10 12:15:28', 'Добрый день!\r\nМодель трикотажная, идет без застежки. С уважением', 0),
(36, 436, 0, 'Скажите, пожалуйста, какая у него застежка?', '', 'Светлана Андреевна', '2017-11-11 12:22:24', 'Добрый день!\r\nМодель без застежки. С уважением', 0),
(37, 2122, 0, 'Скажите, а нет таких же только серебряного цвета?', '', 'Яна', '2017-10-17 13:07:23', 'Добрый день!\r\nНа данный момент модель представлена только в золотом цвете. Если предприятие начнет производство в других цветах, то мы добавим этот цвет к выбору.\r\nС уважением', 0),
(38, 2038, 0, 'Не ожидается такой модели больших размеров?', '', 'Екатерина', '2017-10-31 13:09:46', 'Добрый день!\r\nНа данный момент фабрика прошивает модель в указанных размерах. Ваше пожелание о расширении размерного ряда передадим на фабрику.\r\nС уважением', 0),
(39, 626, 0, 'Добрый день. Уточните рост модели на фото, чтобы лучше понять длину платья.', '', 'Анна', '2017-10-22 13:12:52', 'Добрый день!\r\nРост модели 175см.\r\nС уважением', 0),
(40, 706, 0, 'Здравствуйте! Хочу заказать это платье (у подруги скоро свадьба), но не знаю какие сроки доставки. Успеет ли прийти? Живу в Москве.', '', 'Евгения Красавина', '2017-09-02 13:36:37', 'Добрый день!\r\nПривоз товара на склад в Москве происходит раз в неделю. Некоторые модели есть в наличии в Москве. После поступления к нам на склад по Москве заказ доставим за 1-2 дня.\r\nС уважением\r\n', 0),
(41, 308, 0, 'Добрый день! Я покупала у Вас уже 3 платья. Хочу заказать это - четвертое. Предусмотрены ли у Вас какие-либо акции, бонусы постоянным клиентам? Спасибо.', '', 'Ольга', '2017-09-11 13:40:33', 'Добрый день!\r\nСистема скидок у нас зависит от количества выкупленных заказов. У нас есть скидка 5% на второй заказ и 10% на все позиции, кроме распродажных после 5 выкупленных заказов.\r\nС уважением\r\n', 0),
(46, 2162, 0, 'Скажите, а застежка есть?', '', 'Юля', '2017-11-14 15:34:56', 'Добрый день!\r\nМодель без застежки. С уважением\r\n', 0),
(47, 2061, 0, 'Добрый день, скажите  модель идет размер в размер?', '', 'Снежана', '2017-11-15 17:13:58', 'Добрый день!\r\nДанная фабрика прошивает четко по размерной сетке. Модель идет размер в размер.\r\nС уважением', 0),
(48, 296, 0, 'Как оформить заказ?', '', 'Антонина', '2017-11-15 17:17:51', 'Добрый день!\r\nНеобходимо положить модель в корзину и заполнить Ваши данные для заказа.\r\nС уважением', 0),
(49, 2022, 0, 'Добрый день, подскажите какая застежка? Пуговицы?', '', 'Милена', '2017-11-03 17:28:10', 'Добрый день!\r\nМодель застегивается на четыре кнопки.\r\nС уважением', 0),
(50, 2161, 0, 'Скажите, а в розовом цвете такая есть?', '', 'Нелли', '2017-10-30 17:33:16', 'Добрый день!\r\nНа данный момент прошивается только в 3-х цветах. В розовом фабрика шить пока не планирует.\r\nС уважением ', 0),
(51, 1937, 0, 'Добрый день!Скажите какая длина рукава?', '', 'Лариса', '2017-09-16 17:35:10', 'Добрый день!\r\nДлина рукава 61 см.\r\nС уважением', 0),
(52, 1330, 0, 'Скажите мех отстегивается?', '', 'Луиза', '2017-11-06 17:38:00', 'Добрый день!\r\nМех отстегивается только на рукавах.\r\nС уважением', 0),
(53, 549, 0, 'Здравствуйте! Платье отрезное по талии или под грудью?', '', 'Инга', '2017-10-16 17:41:34', 'Добрый день!\r\nШов предусмотрен чуть выше линии талии, но не совсем под грудью.\r\nС уважением', 0),
(54, 2160, 0, 'Помогите с размером, грудь 112 см талия 99 см бедра 122 см. Какой размер мне нужен???', '', 'Валентина', '2017-10-28 17:47:41', 'Добрый день!\r\nМы бы рекомендовали Вам заказывать 56 размер.\r\nС уважением', 0),
(55, 1942, 0, 'Добрый день! скажите длину платья?', '', 'Елена', '2017-11-05 17:49:41', 'Добрый день!\r\nДлина платья по спинке от плечевого шва до низа изделия в размерах 42-50-101 см, в размерах 52-60 — 110 см\r\nС уважением', 0),
(56, 2015, 0, 'Как заказать в 60 размер?', '', 'Роза', '2017-11-14 17:51:00', 'Добрый день!\r\nНа данный момент модель прошивается до 58 размера.\r\nС уважением', 0),
(57, 259, 0, 'Подскажите есть ли такие в 40 размере?', '', 'Юлия', '2017-11-01 16:06:54', 'Добрый день!\r\nНа данный момент есть, Вы можете заказать 42 размер, но в комментарии к заказу указать,что нужен 40 размер и мы закажем на фабрике именно его.\r\nС уважением', 0),
(60, 1334, 0, 'Скажите жакет  как на фото? в других цветах нет?', '', 'Ирина', '2017-10-27 16:12:38', 'Добрый день!\r\nМодель на данный момент прошивается в цвете как на фото.\r\nС уважением', 0),
(61, 2177, 0, 'Подскажите длину платья?', '', 'Арина', '2017-11-04 16:13:58', 'Добрый день!\r\nДлина изделия по спинке от плечевого шва до низа изделия — 95 см.\r\nС уважением', 0),
(62, 195, 0, 'Подскажите на какой рост рассчитан костюм?', '', 'Марта', '2017-10-17 16:15:51', 'Добрый день!\r\nНа рост 164-170 см.\r\nС уважением', 0),
(63, 550, 0, 'На какой сезон рассчитан бомбер?', '', 'Диана', '2017-11-08 16:17:38', 'Добрый день!\r\nНа холодное лето и теплую весну/осень.\r\nС уважением', 0),
(64, 1982, 0, 'Ткань тянется?', '', 'Надежда', '2017-11-02 16:19:01', 'Добрый день!\r\nМодель пошита из очень эластичной ткани.\r\nС уважением', 0),
(65, 2023, 0, 'В каких цветах есть еще?', '', 'Елена', '2017-10-12 16:20:09', 'Добрый день!\r\nНа данный момент модель прошивается только в цвете хаки.\r\nС уважением', 0),
(66, 579, 0, 'Подскажите ширину брюк.', '', 'Олеся', '2017-09-27 16:21:42', 'Добрый день!\r\nШирина брюк по низу изделия — 13 см.\r\nС уважением', 0),
(67, 1943, 0, 'Скажите, пожалуйста, какая длина рукава у этого платья?', '', 'Юлия', '2017-10-30 22:06:46', 'Добрый день!\r\nДлина рукава 60 см.\r\nС уважением', 0),
(68, 1938, 0, 'Это комбинированное платье или платье с блузкой?', '', 'Ксения', '2017-10-26 22:08:29', 'Добрый день!\r\nЭто платье черного цвета. Блуза одета для примера и не в ходит в комплект.\r\nС уважением', 0),
(69, 682, 0, 'Скажите, по низу юбки - это вышивка?', '', 'Светлана Кравченко', '2017-11-12 22:13:25', 'Добрый день!\r\nНет, это купонный рисунок ткани.\r\nС уважением', 0),
(70, 676, 0, 'Какая длина рукава?', '', 'Митрофанова Ирина', '2017-11-05 22:14:39', 'Добрый день!\r\nДлина рукава 65 см.\r\nС уважением', 0),
(71, 668, 0, 'Есть ли шлица на этом платье?', '', 'Оксана Даева', '2017-11-02 22:18:40', 'Добрый день!\r\nНет, модель идет без шлицы или разреза.\r\nС уважением', 0),
(72, 641, 0, 'У меня на экране цвет темнее, чем розовый. Что правильнее? И есть ли шлица у этого платья сзади? Спасибо.', '', 'Кристина Власова', '2017-11-17 22:25:00', 'Добрый день!\r\nЦвет как на фото, темная роза, ближе к бордовому. Шлица есть.\r\nС уважением', 0),
(73, 635, 0, 'Можете сказать длину рукава?', '', 'Ванда', '2017-11-17 22:28:25', 'Добрый день!\r\nДлина рукава от плечевого шва 36 см.\r\nС уважением', 0),
(74, 606, 0, 'У Вас написана длина рукава 39 см. от какого места?', '', 'Валентина малышева', '2017-11-17 22:33:19', 'Добрый день!\r\nОт шва на рукаве.\r\nС уважением', 0),
(75, 1329, 0, 'Правильно ли я поняла, что воротник превращается в капюшон?', '', 'Мария', '2017-11-03 22:54:34', 'Добрый день!\r\nДа, объемный ворот можно сделать капюшоном.\r\nС уважением', 0),
(76, 225, 0, 'У этого пальто спинка длиннее?', '', 'Вера Смирнитская', '2017-11-09 23:01:51', 'Добрый день!\r\nДа, спинка немного удлиненная.\r\nС уважением', 0),
(77, 221, 0, 'А капюшон отстегивается? Спасибо.', '', 'Маша Прима', '2017-11-08 23:03:48', 'Добрый день!\r\nДа, отстегивается.\r\nС уважением', 0),
(78, 2180, 0, 'Скажите, у этого платья есть застежка в горловине?', '', 'Вероника Г.', '2017-11-19 20:17:38', 'Добрый день!\r\nНет, оно трикотажное, горловина хорошо тянется.\r\nС уважением', 0),
(79, 2177, 0, 'Извините, но на моём компьютере плохо видна спинка. Там вытачки или просто складки на фото.', '', 'Варя Одинцова', '2017-10-21 20:23:47', 'Добрый день!\r\nНа платье на спинке вытачки.\r\nС уважением', 0),
(80, 2061, 0, 'Добрый день! У платья спинка длиннее или это так кажется?', '', 'Вероника Пимако', '2017-11-06 21:12:47', 'Добрый день!\r\nДа, спинка изделия немного удлиненная.\r\nС уважением', 0),
(81, 2055, 0, 'В этом платье есть сзади шлица?', '', 'Александра', '2017-11-12 21:19:55', 'Добрый день!\r\nДа, шлица есть. Фото модели сзади добавили.\r\nС уважением', 0),
(82, 2049, 0, 'Есть ли застежка в горловине?', '', 'Алла', '2017-11-11 21:31:06', 'Добрый день!\r\nМодель без застежки.\r\nС уважением', 0),
(83, 1975, 0, 'Немного непонятно- молнии в среднем шве сзади?', '', 'Инна', '2017-10-11 22:06:52', 'Добрый день!\r\nДа, молния в центральном шве.\r\nС уважением', 0),
(84, 1949, 0, 'Скажите пожалуйста, накидка снимается?', '', 'Лера Ш', '2017-11-08 22:13:50', 'Добрый день!\r\nНет, это имитация, вшитая в боковые швы платья.\r\nС уважением', 0),
(85, 714, 0, 'Скажите, а что это за застежка?', '', 'Мила Мирошниченко', '2017-11-04 22:53:37', 'Добрый день!\r\nЭто текстильная пуговка с текстильной петлей вязаные из шнурка-сутажа.\r\nС уважением', 0),
(86, 689, 0, 'Не поняла, "ключики" идут вместе с платьем или нет?', '', 'Оксана Иевлева', '2017-11-01 23:22:00', 'Добрый день!\r\nМеталлический элемент "ключики" идет вместе с платьем.\r\nС уважением ', 0),
(87, 642, 0, 'Скажите, это платье или сарафан? Спасибо.', '', 'Елизавета П.', '2017-11-20 13:05:06', 'Добрый день!\r\nБлиже к сарафану, потому что блуза одевается отдельно (в комплект не входит). \r\nС уважением', 0),
(88, 2081, 0, 'Подскажите длину брюк на 42 размер?', '', 'Юлия', '2017-11-20 14:40:42', 'Добрый день!\r\nДлина изделия от линии пояса до низа изделия - 99 см. Информацию добавили в описание изделия.\r\nС уважением', 0),
(89, 1972, 0, 'Добрый день! Скажите пальто идет размер в размер?', '', 'Зоя', '2017-11-20 14:43:50', 'Добрый день!\r\nМодель свободного объемного покроя. Поэтому если размер у Вас попадает между размерами, то рекомендуем брать меньший на донном изделии.\r\nС уважением', 0),
(90, 428, 0, 'Подскажите какая длина изделия?', '', 'Галина', '2017-11-20 14:50:23', 'Добрый день!\r\nДлина изделия по спинке около 90 см. Информацию добавили в описание.\r\nС уважением', 0),
(91, 271, 0, 'Я сомневаюсь с выбором размера. Как быть?', '', 'Кристина', '2017-11-20 14:52:42', 'Добрый день!\r\nМодель свободного стиля. Если по нашей размерной сетке размер попадает между размерами, то зависит от Ваших пожеланий в одежде. Если любите посвободнее, то берите больший размер.\r\nС уважением', 0),
(92, 1351, 0, 'Соответствуют ли цвета на фото реальным?', '', 'Лариса Ивановна', '2017-11-20 14:55:49', 'Добрый день!\r\nДа, модели данной фабрики идут целиком по цвету фото.\r\nС уважением', 0),
(93, 2158, 0, 'Можно к вам приехать и посмотреть-потрогать товар без предварительного заказа?', '', 'Света', '2017-11-20 14:57:40', 'Добрый день!\r\nНа данный момент шоу-рума нет, но в ближайшее время мы займемся этим вопросом и сделаем соответствующее объявление.\r\nС уважением', 0),
(94, 830, 0, 'Предусмотрена ли доставка по Украине?', '', 'Настя', '2017-11-20 15:08:21', 'Добрый день!\r\nНа Украину возможна отправка транспортными компаниями или ЕМС.\r\nС уважением', 0),
(97, 2031, 0, 'Какая длина комбинезона?', '', 'Оля', '2017-11-20 15:14:52', 'Добрый день!\r\nДлина изделия: от талии 98 (общая 140).\r\nС уважением', 0),
(98, 384, 0, 'помогите определится с размером? и можно ли заказать два размера на выбор?', '', 'Евгения', '2017-11-20 15:17:44', 'Добрый день!\r\nРазмеры на выбор мы не привозим. На странице изделия есть таблица размеров для помощи при выборе размера.\r\nС уважением', 0),
(99, 732, 0, 'Здравствуйте.  Соответствует ли размер российскому?', '', 'Валерия', '2017-11-21 17:42:28', 'Добрый день!\r\nДа, данная фабрики прошивает по российским лекалам.\r\nС уважением', 0),
(100, 755, 0, 'Есть ли кофта в наличии ?', '', 'Люся', '2017-11-21 17:51:14', 'Добрый день!\r\nВсе модели заказываем на фабрики. Привозы раз в неделю.\r\nС уважением', 0),
(101, 404, 0, 'Какая длина  жилета?', '', 'Ангелина', '2017-11-21 17:52:34', 'Добрый день!\r\nДлина изделия: по спинке около 95 см (52 р.), 96 см (58 р.)\r\nС уважением', 0),
(102, 554, 0, 'На какой сезон рассчитано пальто?', '', 'Ольга', '2017-11-22 17:54:08', 'Добрый день!\r\nНа прохладную осень/весну.\r\nС уважением', 0),
(103, 2038, 0, 'Можно ли заказать два размера на выбор?', '', 'Мара', '2017-10-27 17:57:23', 'Добрый день!\r\nВообще размеры на выбор мы не привозим, но если модель будет в момент заказа на складе в 2х размерах, то мы обязательно привезем оба.\r\nС уважением', 0),
(104, 777, 0, 'Какие сроки доставки?', '', 'Екатерина', '2017-11-22 18:02:19', 'Добрый день!\r\nВсе модели заказываем на фабрику. Привозы каждую неделю по понедельникам.\r\nС уважением', 0),
(105, 2054, 0, 'Какая длина платья?', '', 'Елена', '2017-11-11 18:04:12', 'Добрый день!\r\nДлина изделия по спинке от плечевого шва до низа изделия — 149 см.\r\nС уважением', 0),
(106, 2051, 0, 'Бусы идут в комплекте?', '', 'Анжела', '2017-11-22 18:05:29', 'Добрый день!\r\nБусы в комплект не входят.\r\nС уважением', 0),
(107, 1935, 0, 'Какая длина у рукавов ?', '', 'Анна Ивановна', '2017-11-22 18:07:27', 'Добрый день!\r\nДлина рукава 58 см.\r\nС уважением', 0),
(108, 2156, 0, 'Здравствуйте, какая длина снуда?', '', 'Светлана', '2017-11-22 18:09:16', 'Добрый день!\r\nОколо 70 см.\r\nС уважением', 0),
(109, 611, 0, 'Добрый день! Скажите, это просто металлический элемент или со стразами?', '', 'Карина Р.', '2017-11-21 20:38:17', 'Добрый день!\r\nЭто металлический элемент с россыпью страз.\r\nС уважением', 0),
(110, 594, 0, 'Не поняла, пояс идет в комплекте или нет?', '', 'Татьяна Крупко', '2017-11-05 21:16:46', 'Добрый день!\r\nДа, ремешок входит в комплект.\r\nС уважением ', 0),
(111, 583, 0, 'Платье продается с поясом или нет?', '', 'Тамара Герцинова', '2017-11-22 21:40:45', 'Добрый день!\r\nМодель продается без пояса.\r\nС уважением', 0),
(112, 355, 0, 'Скажите, сзади есть вытачки? Спасибо.', '', 'Влада З.', '2017-11-22 22:16:08', 'Добрый день!\r\nДа, сзади на платье имеются вытачки.\r\nС уважением', 0),
(113, 1093, 0, 'Скажите пожалуйста, этот снуд двухсторонний или нет?', '', 'Ирина Смирнова', '2017-11-11 22:53:08', 'Добрый день!\r\nМодель можно носить на обе стороны.\r\nС уважением', 0),
(114, 2184, 0, 'Здравствуйте! Трикотаж с блестками?', '', 'Митрофанова Ирина', '2017-11-01 23:27:54', 'Добрый день!\r\nДа, трикотаж украшен блестящими элементами.\r\nС уважением', 0),
(115, 2161, 0, 'В левой части описания написано, что рукав короткий. Это ошибка?', '', 'Наталья Г.', '2017-11-21 23:30:08', 'Добрый день!\r\nЭто ошибка. Спасибо, подправили.\r\nС уважением', 0),
(116, 1962, 0, 'Завязки с одной стороны или с обеих?', '', 'Инна Широкова', '2017-11-15 23:34:36', 'Добрый день!\r\nНет, бант только с одной стороны.\r\nС уважением', 0),
(117, 1344, 0, 'Хотелось бы заказать такой костюм. Это возможно?', '', 'Людмила Федулова', '2017-11-22 23:42:49', 'Добрый день!\r\nМодель продается двумя артикулами. Юбка от этого костюма артикул ВА-Ю4-3089/20-23. Его можно найти с помощью поисковой строки в верхней части сайта.\r\nС уважением', 0),
(118, 865, 0, 'А костюм можно такой купить?', '', 'Варвара Кудрешова', '2017-11-22 23:45:17', 'Добрый день!\r\nМодель продается двумя артикулами. Брюки от этого костюма артикул Б5-3518. Его можно найти с помощью поисковой строки в верхней части сайта.\r\nС уважением', 0),
(119, 338, 0, 'Подскажите, какой второй цвет кроме зеленого. У меня на компе плохо видно.', '', 'Наталия Г', '2017-11-22 23:53:42', 'Добрый день!\r\nМодель сине-зеленой расцветки.\r\nС уважением', 0),
(120, 2038, 0, 'Не пойму какие карманы и где?', '', 'Ксюша Веретенко', '2017-11-23 22:38:20', 'Добрый день!\r\nНакладные карманы на правом бедре и на левой груди. Лучше видно на бордовом цвете фото.\r\nС уважением', 0),
(121, 606, 0, 'Это платье отрезное по талии?', '', 'Алина В.', '2017-11-23 22:45:40', 'Добрый день!\r\nНет, это цельнокройное платье.\r\nС уважением', 0),
(122, 2177, 0, 'На этом платье рющи тоже из трикотажа?', '', 'Светлана К', '2017-11-23 22:51:29', 'Добрый день!\r\nНет, они из шифона.\r\nС уважением', 0),
(123, 2174, 0, 'Есть ли застежка в этом платье?', '', 'Вероника Г.', '2017-11-23 22:54:53', 'Добрый день!\r\nДа, на платье молния в боковом шве.\r\nС уважением', 0),
(124, 2172, 0, 'Воротничок входит в комплект?', '', 'Валентина малышева', '2017-11-23 22:57:24', 'Добрый день!\r\nДа, он в комплекте платья.\r\nС уважением', 0),
(126, 2050, 0, 'Из какой ткани сделаны цветы?', '', 'Милена', '2017-11-23 23:08:18', 'Добрый день!\r\nЦветы из шифона.\r\nС уважением', 0),
(127, 2046, 0, 'Расскажите, пожалуйста, про застежку', '', 'Илона', '2017-11-23 23:12:11', 'Добрый день!\r\nСзади на платье втачная молния.\r\nС уважением', 0),
(128, 1973, 0, 'Скажите пожалуйста, на спинке завязки?', '', 'Мариана Серая', '2017-11-23 23:26:42', 'Добрый день!\r\nНет, это фиксированная планка, которая удерживает плечи.\r\nС уважением', 0),
(129, 1338, 0, 'Платье цельнокройное по длине, без швов?', '', 'Кристина', '2017-11-23 23:38:25', 'Добрый день!\r\nДа, модель без швов.\r\nС уважением', 0),
(130, 1334, 0, 'На спинке есть застежка?', '', 'Светлана Лианова', '2017-11-23 23:40:03', 'Добрый день!\r\nНа платье сзади вшита молния.\r\nС уважением', 0),
(131, 706, 0, 'В этом платье верх из кружева?', '', 'Анна Петренко', '2017-11-23 23:47:42', 'Добрый день!\r\nНет, это рельефный трикотаж.\r\nС уважением', 0),
(132, 171, 0, 'Добрый день. Подскажите на какой рост женский костюм Артикул: СБК-2', '', 'Елена', '2017-11-25 12:08:22', 'Добрый день!\r\nМодель на рост 165-170 см.\r\nС уважением', 0);
